import{_ as g,o as t,c as n,a as i,t as u,C as _,M as h,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},z=["src","alt"],C={class:"entry-content"},j={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,z)]),i("div",C,[i("h2",j,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-8621231d"]]),M=JSON.parse(`[{"page_url":"https://sl.wikipedia.org/wiki/Mojave_Air_and_Space_Port","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Kluft-photo-SS1-landing-June-2004-Img_1406c.jpg","page_title":"Mojave Air and Space Port","context_page_description":"Mojave Air and Space Port, tudi znan kot Civilian Aerospace Test Center je letališče in vesoljsko izstrelišče v puščavi Mojave, Kalifornija, na nadmorski višini 851 metrov. Je prvo izstrelišče v ZDA z dovoljenjem za horizontalne izstrelitve večkrat uporabljivih vesoljskih plovil. FAA je certificirala Mojave kot izstrelišče 17. junija 2004.\\nPoleg običanjega letališča za splošno aviacijo se uporablja tudi za testiranje letal in drugih plovil, razvoj vesoljske tehnike, vzdrževanje zrakoplovov, zračno dirkanje in drugo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BB%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Bedburn_Beck_in_autumn%2C_Hamsterley_Forest.jpg","page_title":"Лиственный лес","context_page_description":"Ли́ственный лес — лес, состоящий из лиственных пород деревьев и кустарников. Также называют листопадным или летнезелёным за характерный ежегодный сброс листьев перед наступлением холодов.\\nНа долю лиственных лесов в Европе приходится 24 %."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AE%91%E7%88%BE_(%E9%9F%B3%E6%A8%82%E5%AE%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Baauer_Big_Dancing_by_Leah_Gair_cropped.jpg","page_title":"鮑爾 (音樂家)","context_page_description":"哈瑞·鮑爾·羅德里格斯，藝名鮑爾，是美國一位專精貝斯的音樂製作人，因為於2013年所製作的《哈林搖》而出名。他自13歲即開始製作舞曲，主要專注於浩室音樂和電子音樂上。他之前以「哈瑞船長」之藝名為Kissy Sell Out製作歌曲，而最終由BBC電台播出。他製作的靈感一般來自於嘻哈音樂和舞曲，且為超凡樂團和不要懷疑製作混音舞曲。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_stations_du_tramway_d%27%C3%8Ele-de-France","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Travaux_t6_-_mars_2014_-_velizy_station_l%27onde.jpg","page_title":"Liste des stations du tramway d'Île-de-France","context_page_description":"La liste des stations du tramway d'Île-de-France propose un aperçu des stations actuellement en service sur les lignes de tramway d'Île-de-France, en France. La première ligne a ouvert en 1992. L'ensemble des lignes, qui ne sont pas toutes en correspondance entre elles, comprend 204 stations, depuis le 14 décembre 2019, date d'extension de la ligne 4 du tramway d'Île-de-France."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%84%BF%E7%AB%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Group_of_Breaker_boys._Smallest_is_Sam_Belloma.jpg","page_title":"儿童","context_page_description":"兒童，是指從生命誕生之始到成年期之前的人類。但兒童時期的年齡段各有不同。而較多國家的定義與聯合國的兒童權利公約相同，兒童是指18歲以下的任何人，除非對其適用的法律規定的年齡不到18歲的。孩子亦可代指「子女」；在特定情況下，可以人類說「大自然的孩子」或者「老小孩」。\\n兒童是人類社會最弱勢的群體，應獲得各方面的保護。這包含從法律、社會到家庭等。法律上，禁止虐待兒童成為多數國家的法律條文，禁止童工也是國際慣例。社會上，保護兒童的身心健康成長是關鍵。兒童的發展，即童年時期是每人都經歷過的，這是人類的未來。兒童也有些各自特殊的消遣與娛樂活動。從16世紀和17世紀開始，人們意識到兒童不再是縮小版的成年人。"},{"page_url":"https://en.wikipedia.org/wiki/Catfight","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Maryse_vs_Maria_-_Diva%27s_match.jpg","page_title":"Catfight","context_page_description":"Catfight is a term for an altercation between two females, often characterized as involving scratching, slapping, punching, biting, hair-pulling, and shirt-shredding. It can also be used to describe women insulting each other verbally or engaged in an intense competition for men, power, or occupational success. The catfight has been a staple of American news media and popular culture since the 1940s, and use of the term is often considered derogatory or belittling. Some observers argue that in its purest form, the word refers to two women, one blonde and the other a brunette, fighting each other. However, the term is not exclusively used to indicate a fight between women, and many formal definitions do not invoke gender."},{"page_url":"https://en.wikipedia.org/wiki/2006%E2%80%932008_Juba_talks","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kitgum_IDP_camp_from_the_air%2C_Uganda.jpg","page_title":"2006–2008 Juba talks","context_page_description":"The Juba talks were a series of negotiations between the government of Uganda and the Lord's Resistance Army rebel group over the terms of a ceasefire and possible peace agreement. The talks, held in Juba, the capital of autonomous Southern Sudan, began in July 2006 and were mediated by Riek Machar, the Vice President of Southern Sudan. The talks, which had resulted in a ceasefire by September 2006, were described as the best chance ever for a negotiated settlement to the 20-year-old war. However, LRA leader Joseph Kony refused to sign the peace agreement in April 2008. Two months later, the LRA carried out an attack on a Southern Sudanese town, prompting the Government of Southern Sudan to officially withdraw from their mediation role."},{"page_url":"https://nl.wikipedia.org/wiki/Haven_van_Brussel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Haven_Brussel_1640.jpg","page_title":"Haven van Brussel","context_page_description":"De Haven van Brussel is een binnenhaven, die toegankelijk is voor schepen tot 4500 ton en duwvaartkonvooien tot 9000 ton. Via het Zeekanaal Brussel-Schelde kunnen zelfs zeeschepen de voorhaven bereiken, en via het Kanaal Charleroi-Brussel wordt de doorvoer naar het Waals Gewest verzekerd. Het grootste gedeelte van de haven bevindt zich in de noordelijke uitbreiding van Brussel."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%8D%D1%88_%D0%BF%D1%80%D0%BE%D1%86%D0%B5%D1%81%D1%81%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Cache_nway.jpg","page_title":"Кэш процессора","context_page_description":"Кэш микропроцессора — кэш, используемый микропроцессором компьютера для уменьшения среднего времени доступа к компьютерной памяти. Является одним из верхних уровней иерархии памяти. Кэш использует небольшую, очень быструю память, которая хранит копии часто используемых данных из основной памяти. Если большая часть запросов в память будет обрабатываться кэшем, средняя задержка обращения к памяти будет приближаться к задержкам работы кэша.\\nКогда процессору нужно обратиться в память для чтения или записи данных, он сначала проверяет, доступна ли их копия в кэше. В случае успеха проверки процессор производит операцию, используя кэш, что значительно быстрее использования более медленной основной памяти. Подробнее о задержках памяти см. Латентность SDRAM: tCAS, tRCD, tRP, tRAS.\\nДанные между кэшем и памятью передаются блоками фиксированного размера, также называемые линиями кэша или блоками кэша."},{"page_url":"https://fi.wikipedia.org/wiki/Selk%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Back_Muscles.jpg","page_title":"Selkä","context_page_description":"Ihmisen selkä on kehon takapuolella pakaroiden ja niskan välissä. Selän rakenne muodostuu luisten nikamien muodostamasta selkärangasta sekä selkälihaksista. Rakenteensa johdosta selkä tukee kehoa ja on liikkuva ja taipuisa.\\nSelän keskellä päästä lantioon kulkeva selkäranka koostuu 24 luisesta nikamasta, joiden välissä on tyynymäiset nikamavälilevyt. Selkäranka tukee vartaloa ja suojaa selkäydintä, joka kulkee nikamien sisällä.\\nKoverat kaularanka ja lanneranka taipuvat lordoosiin ja kupera rintaranka kyfoosiin. Tämän seurauksena selkäranka ja sitä kautta myös selkä on sivulta katsottuna normaalisti S:n muotoinen. Kaaret lisäävät selkärangan joustavuutta ja suojaavat selkää vammoilta.\\nKehon paino kuormittaa eniten selän alaosaa eli lannerankaa.\\nSelkälihakset tekevät työtä, tukevat selkärankaa ja auttavat säilyttämään ryhdin.\\nSelän ihon tuntoaisti on epätarkka.\\nSelkäkipu voi johtua useasta syystä. Alaselkäkipuja aiheuttavat muun muassa hermojuuren toimintahäiriöt, pienet kudosvauriot selkärankaa ympäröivissä kudoksissa, tai melko harvoin kasvain, tulehdus, murtuma tai selkärankareuma."},{"page_url":"https://it.wikipedia.org/wiki/Metropolitana_in_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Train_s_300.jpg","page_title":"Metropolitana in Italia","context_page_description":"Nel diritto italiano dei trasporti, la metropolitana è un'infrastruttura di trasporto pubblico omologata come tale dal Ministero dei Trasporti, che risponde ad alcuni requisiti definiti dalla norma UNI 8379. Dispongono di metropolitane le seguenti città: Milano; Roma; Napoli; Brescia; Torino; Catania; Genova. La somma della lunghezza delle relative metropolitane è pari a circa 230 km.\\nAltre città italiane possiedono, o hanno in progetto, linee di trasporto ferroviario a carattere metropolitano o tranviario rapido di massa, talora affini alle metropolitane vere e proprie. Spesso tali sistemi vengono indicati, localmente o a fini commerciali, con termini impropri come metropolitana leggera, metropolitana di superficie e simili."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%83%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%B8%D0%B9_%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/uk/f/f2/%D0%94%D0%BE%D0%BD%D0%B1%D0%B0%D1%815.jpg","page_title":"Рудниковий транспорт","context_page_description":"Рудниковий транспорт — транспортна служба шахти, призначена для переміщення по підземних виробках корисних копалин та різного роду вантажів.\\nУ сучасному рудниковому транспорті широко застосовуються електровозні, автомобільні і конвеєрні транспортні засоби, а також скіпові підйомники, лебідки, іноді гідротранспорт, монорейковий транспорт та інш."},{"page_url":"https://nl.wikipedia.org/wiki/Thea_von_Harbou","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Fritz_Lang_und_Thea_von_Harbou%2C_1923_od._1924.jpg","page_title":"Thea von Harbou","context_page_description":"Thea Gabriele von Harbou was een Duitse actrice en auteur van Pruisische adellijke afkomst.\\nIn 1905 publiceerde ze haar eerste roman in de Deutsche Roman-Zeitung. Zij begon in 1906 te werken als actrice in Düsseldorf, daarna verhuisde naar Weimar, Chemnitz en Aken. In Aken ontmoette ze haar eerste man, de acteur en regisseur Rudolf Klein-Rogge, met wie ze in 1914 trouwde. In 1920 schreef ze haar eerste filmscenario, Das Indische Grabmal, samen met Fritz Lang.\\nIn 1922 huwde Von Harbou Fritz Lang, nadat ze gescheiden was van Rudolf Klein-Rogge, die zou blijven optreden als acteur in hun films. Von Harbou schreef niet alleen scenario's voor Fritz Lang Maar ook voor films van Friedrich Wilhelm Murnau, Carl Theodor Dreyer en Arthur von Gerlach.\\nIn 1927 maakte zij samen met haar man de beroemde film Metropolis. De film ging in januari 1927 in première in Berlijn, maar was commercieel gezien geen groot succes. Desondanks was het publiek zeer onder de indruk van de speciale effecten die gebruikt zijn in Metropolis."},{"page_url":"https://pt.wikipedia.org/wiki/Escrevedeira-de-pallas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Emberiza_pallasi_MHNT.ZOO.2011.11.219_Mongolie.jpg","page_title":"Escrevedeira-de-pallas","context_page_description":"A escrevedeira-de-pallas é uma ave da família Fringillidae. É um pouco mais pequena que a escrevedeira-dos-caniços, à qual se assemelha.\\nÉ uma espécie migradora que nidifica na Ásia a leste do meridiano 60º E e inverna no extremo oriente.\\nEsta escrevedeira é muito rara na Europa."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E8%A6%8B%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Bitchu_kojiro_sta.jpg","page_title":"新見市","context_page_description":"新见市是位于冈山县西北部新见盆地及周边地区的城市。农业发达，冬天是滑雪胜地。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A5%D0%B8%D1%80%D0%BE%D1%85%D0%B8%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Emperor_Hirohito_and_empress_Kojun_of_japan.JPG","page_title":"Хирохито","context_page_description":"Хирохито, яп. 裕仁, тәхет исеме Сёва, яп. 昭和天皇 — Япониянең 124нче императоры. Япония гаскәрләре генералиссимусы."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%A8%D7%92%D7%95%D7%A8%D7%99_%D7%A7%D7%95%D7%A4%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Gr%C3%A9gory_Coupet.jpg","page_title":"גרגורי קופה","context_page_description":"גרגורי קוּפֵּה הוא כדורגלן עבר צרפתי ששיחק בעמדת השוער."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D1%83%D0%BF%D0%B0%D0%BD%D1%87%D0%B8%D1%87,_%D0%9E%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/OtonZupancic_%282%29.jpg","page_title":"Жупанчич, Отон","context_page_description":"Отон Жупанчич — словенский поэт, прозаик, драматург, один из лидеров словенского модернизма."},{"page_url":"https://es.wikipedia.org/wiki/Batophila_rubi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Batophila_rubi_%28Paykull%2C_1977%29.jpg","page_title":"Batophila rubi","context_page_description":"Batophila rubi es un coleóptero de la familia Chrysomelidae."},{"page_url":"https://pl.wikipedia.org/wiki/Airco_DH.2","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Airco_DH2_2.jpg","page_title":"Airco DH.2","context_page_description":"Airco DH.2 to jednomiejscowy, dwupłatowy samolot myśliwski z okresu I wojny światowej o oryginalnej konstrukcji – silnik i śmigło było umieszczone za kabiną pilota i \\"pchało\\", a nie \\"ciągnęło\\" samolot. Jego powstanie było spowodowane zapotrzebowaniem na lekki, zwrotny samolot o dobrym wznoszeniu.\\nDH.2 został zaprojektowany dla Airco przez Geoffreya de Havillanda wiosną 1915 roku i był jego drugą konstrukcją ze śmigłem pchającym, bazującą na pierwszym rozwiązaniu Airco DH.1. Maszyna ta została skonstruowana, aby przeciwdziałać zmorom Fokkera, czyli doskonałym, górującym parametrami nad wszystkimi samolotami aliantów, myśliwcom konstrukcji firmy Fokker. Z powodu braku synchronizatora k.m. samolot był też niejako \\"rozwiązaniem zastępczym\\".\\nSamolot wszedł do służby 1 czerwca 1915 roku na wyposażenie sześciu dywizjonów. Postępy w technice lotniczej w czasie wojny, przede wszystkim posiadanie synchronizatora karabinu maszynowego przez Aliantów i wprowadzenie przez Niemcy samolotów Albatros uczyniły samolot przestarzałym. Mimo tego pozostał on w służbie do czerwca 1918 roku przejmując zadania obserwacyjne i jako eskorta samolotów bombowych."},{"page_url":"https://cs.wikipedia.org/wiki/Pipin_II._Prost%C5%99edn%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/St_Hubert_of_Li%C3%A8ge_offers_his_services_to_Pepin_of_Heristal.jpg","page_title":"Pipin II. Prostřední","context_page_description":"Pipin II., zvaný Prostřední, či z Herstalu, byl mocný austrasijský majordomus.\\nNejvíc se uplatnil v bitvě u Tertry v roce 687. V této bitvě porazil neustrijsko-burgundského krále Theodoricha III., a jeho majordoma Berthara. Postupem času tak ovládal celou Franskou říši, sjednocoval postupně Franky a byl úspěšný také tím, že si začal podrobovat část Fríska. Několikrát se také střetl s Alamany, pronikal do severní Itálie. Byl vnukem majordoma Austrasie Pipina I.\\nSynem Pipina II. byl Karel Martel."},{"page_url":"https://ro.wikipedia.org/wiki/Tratatul_de_la_Karlowitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Altomonte_Siebenb%C3%BCrgen_und_Serbien.JPG","page_title":"Tratatul de la Karlowitz","context_page_description":"Tratatul de la Karlowitz sau de la Carloviț a fost semnat la 26 ianuarie 1699 în localitatea Carloviț din Voivodina, la sfârșitul războiului austriaco-otoman, în care otomanii au fost învinși.\\nDupă două luni de negocieri între Imperiul Otoman pe de o parte și, pe de altă parte, Liga Sfântă, o coaliție formată din mai multe puteri europene incluzând Casa de Habsburg, Uniunea Polono-Lituaniană, Republica Venețiană și Imperiul Rus, tratatul de pace a fost semnat la 26 ianuarie 1699. Otomanii au cedat Austriei cea mai mare parte a teritoriului Ungariei și Slavonia, iar Podolia a revenit Poloniei. Simultan au renunțat la vasalitatea Transilvaniei, transferată Habsburgilor. Au cedat de asemenea către Veneția teritorii Dalmațiene și peninsula Peloponez, pe care însă otomanii au recuperat-o prin tratatul de pace de la Passarowitz din 1718. Simultan au renunțat la vasalitatea republicii Raguzane, transferată Veneției.\\nTratatul de la Karlowitz a marcat începutul declinului Imperiului Otoman în Europa de Est și a stabilit monarhia habsburgică ca putere dominantă în Europa centrală."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%8A%D9%83%D9%88%D9%84%D8%A7%D8%B3_%D9%85%D9%8A%D9%86%D9%88%D8%B1%D8%B3%D9%83%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Portrait_of_Nicolas_Minorsky.jpg","page_title":"نيكولاس مينورسكي","context_page_description":"نيكولاس مينورسكي عالم رياضيات أمريكي روسي اشتهر بأبحاثه في نظرية التحكم، مهندس وعالم تطبيقي اشتهر بتحليله النظري وأول تطبيق فعلي لوحدات التحكم PID في أنظمة التوجيه التلقائي لسفن البحرية الأمريكية."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B9%9D%E9%BE%8D%E9%86%AB%E9%99%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/HK_TheKowloonHospital_RehabilitationBuilding.JPG","page_title":"九龍醫院","context_page_description":"九龍醫院是香港的公營醫院，位於香港九龍城區馬頭圍加多利山亞皆老街147號A，為九龍區首間由香港政府設立的醫院，由醫院管理局管理，為九龍中聯網醫院之一，主要提供服務予九龍區病人。\\n醫院共有17座院舍，分別於1925年至1965年年間建成。九龍醫院的胸肺內科是九龍區最大型胸肺專科中心之一，亦是香港首間提供胸肺康復計劃的醫院。另外，九龍醫院亦為伊利沙伯醫院及基督教聯合醫院的病人提供延續護理服務。\\n九龍醫院還肩負著培育醫護人員的責任。九龍醫院護士學校，亦為非政府機構培訓登記護士。"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8D%B0%EB%AA%A8%EC%8A%A4%ED%85%8C%EB%84%A4%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Demosthenes_orator_Louvre.jpg","page_title":"데모스테네스","context_page_description":"데모스테네스는 고대 그리스 아테네의 저명한 정치가이자 웅변가였다. 아테네의 지도자로 그리스의 여러 폴리스의 자립을 호소하며 패권을 추구하는 필리포스 2세에 대항하여 반 마케도니아 운동을 전개했지만 뜻을 이루지 못하고 자살로 생을 마쳤다."},{"page_url":"https://de.wikipedia.org/wiki/Privates_Gymnasium_Marienstatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Abi-Aktion_am_Privaten_Gymnasium_Marienstatt.jpg","page_title":"Privates Gymnasium Marienstatt","context_page_description":"Das Private Gymnasium Marienstatt ist ein 1910 gegründetes Gymnasium in Streithausen im rheinland-pfälzischen Westerwaldkreis, das sich in Trägerschaft der Zisterzienser der Abtei Marienstatt befindet. Die Schule ist eine sog. Ersatzschule, also eine vom Land anerkannte Privatschule. Deshalb wird auch kein Schulgeld erhoben."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Europameisterschaften_2018/400_m_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Leichtathletik_Gala_Linz_2018-6071.jpg","page_title":"Leichtathletik-Europameisterschaften 2018/400 m der Männer","context_page_description":"Der 400-Meter-Lauf der Männer bei den Leichtathletik-Europameisterschaften 2018 fand zwischen dem 7. und 10. August im Olympiastadion in der deutschen Hauptstadt Berlin statt.\\nWeltmeister wurde der Brite Matthew Hudson-Smith. Silber und Bronze gingen an ein Bruderpaar aus Belgien. Kevin Borlée wurde Zweiter, Jonathan Borlée kam auf den dritten Platz."},{"page_url":"https://zh.wikipedia.org/zh-cn/2015%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B1%E9%A2%A8%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/12W_2015-07-24_0300Z.jpg","page_title":"2015年太平洋颱風季","context_page_description":"2015年太平洋台风季泛指于2015年全年内的任何时间，于赤道以北及国际换日线以西的太平洋水域，以及南中国海所产生的热带气旋。虽然有关方面并没有设下本台风季的指定期限，但大部分于西北太平洋的热带气旋通常皆会于五月至十二月期间形成。而本年是日本气象厅有观测纪录以来，本洋面首次每个月均有的热带风暴生成的一年。\\n本条目的范围仅局限于赤道以北及国际换日线以西的太平洋及南海的水域。于赤道以北及国际换日线以东的太平洋水域产生的风暴则被称为飓风，并被列入2015年太平洋飓风季。于西北太平洋产生的热带风暴是由日本气象厅所命名，国际编号为15xx，而美国联合台风警报中心则将于该地区的热带低压之编号以W字母作结。\\n凡进入或产生于菲律宾风暴责任范围以内的热带低压，菲律宾大气地球物理和天文服务管理局均会给予当地名称，作当地警报用途，因此可能会有两个不同的英文名称；此外，由于中港澳采用同一中文译名，而台湾当地之中文译名可能与其有所不同，故同一个风暴可能会有两个不同的中文名称。以下各热带气旋资讯以热带气旋存在期间的巅峰形态为准。\\n2015年风季的热带气旋明显较强，该年成为香港天文台在2009年采用新热带气旋分级制，新增“强台风”和“超强台风”以来，最多超强台风的风季，以及首个在6月前已经出现4个超强台风风季。"},{"page_url":"https://da.wikipedia.org/wiki/J%C3%B8rgen_Stilling","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/J%C3%B8rgen_Vilhelm_Stilling_1940.jpg","page_title":"Jørgen Stilling","context_page_description":"Jørgen Vilhelm Stilling var en dansk søofficer og modstandsmand."},{"page_url":"https://be.wikipedia.org/wiki/%D0%97%D0%BC%D1%96%D1%82%D1%80%D0%BE%D0%BA_%D0%91%D1%8F%D0%B4%D1%83%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%D0%97._%D0%91%D1%8F%D0%B4%D1%83%D0%BB%D1%8F_%D1%96_%D0%AF._%D0%9A%D0%BE%D0%BB%D0%B0%D1%81.jpg","page_title":"Змітрок Бядуля","context_page_description":"Змітрок Бядуля, сапр.: Самуіл Яфімавіч Плаўнік — беларускі паэт і празаік, мовазнаўца."},{"page_url":"https://es.wikipedia.org/wiki/Ruta_de_las_Caras","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Ruta_de_las_Caras%2C_Cuenca%2C_Espa%C3%B1a%2C_2017-01-03%2C_DD_56.jpg","page_title":"Ruta de las Caras","context_page_description":"La Ruta de las Caras es una ruta turística de acceso libre situada en las cercanías del municipio de Buendía, Cuenca, España. Una parte de la ruta, conocida como las Caras de Buendía, destaca por esculturas en piedra de diferentes tamaños.​"},{"page_url":"https://el.wikipedia.org/wiki/%CE%86%CE%BA%CE%B1%CF%81%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Rust_Mite%2C_Aceria_anthocoptes.jpg","page_title":"Άκαρι","context_page_description":"Το άκαρι είναι μικρό αρθρόποδο και ταξινομείται μαζί με το τσιμπούρι στα ακάρεα. Είναι το πιο ποικιλόμορφο από τα αραχνοειδή και ενώ το τσιμπούρι φαίνεται εύκολα, ένα άκαρι γίνεται δύσκολα ορατό με το ανθρώπινο μάτι καθώς έχει μέγεθος μικρότερο, συνήθως, από ένα χιλιοστό του μέτρου. Μερικά είδη μπορούν να φτάσουν τα 20 χιλιοστά και άλλα, με μέγεθος μόλις 0,08 του χιλιοστόμετρου, μπορούν να κάνουν φωλιά ακόμη και στο θύλακα μιας ανθρώπινης τρίχας. Τα ακάρεα βρίσκονται σχεδόν παντού στη βιόσφαιρα του πλανήτη μας, σε βάθος ακόμη και ως 10 μέτρα μέσα σε έδαφος με ανόργανα υλικά, σε πολικές ή τροπικές περιοχές και ερήμους, σε κρύες ή θερμές πηγές, σε θαλάσσια βάθη ως και 5.000 μέτρα κλπ.\\nΕκτιμάται ότι έχουν περιγραφεί γύρω στα 48.200 είδη ακάρεων, σε συνολικά πάνω από 1 εκατομμύριο είδη που ζουν σήμερα.\\nΦαίνεται πως είναι από τους πιο παλαιούς οργανισμούς πάνω στη Γη και εμφανίστηκαν 400 εκατομμύρια χρόνια πριν στον πλανήτη, ενώ σήμερα ζει το 5% των ειδών που έχουν ποτέ εμφανιστεί."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%82%AF%E3%82%B5%E3%83%B3%E3%83%89%E3%83%AB%E3%83%BB%E3%82%AA%E3%82%B9%E3%82%AD%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Tank_%22Tiger_II%22.Inscription_on_a_trunk_%22Glory_to_the_Captain_Korobov%21%22_%284567311642%29.jpg","page_title":"アレクサンドル・オスキン","context_page_description":"アレクサンドル・ペトローヴィチ・オスキンは、ソヴィエト連邦の軍人。最終階級は陸軍大佐。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A1%9E%E5%8F%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Segou_120.jpg","page_title":"塞古","context_page_description":"塞古，位於尼日河沿岸，是馬利中南部的一座城市。在巴馬科東北大約235千米處。城市在1620年由博若人建立，距離現在城鎮所在地大約10千米。塞古是馬利第三大城市，定居人口大約100,000人。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%83%D9%88%D8%AA_%D9%85%D8%A7%D8%AB%D9%8A%D9%88_%D8%A7%D9%8A%D9%85%D8%B1%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Scott_Emerson_edited-1.jpg","page_title":"سكوت ماثيو ايمرسون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nسكوت ماثيو ايمرسون لاعب بيسبول أمريكى."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigreich_Tungning","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Herport_Albrecht_Zeelandia_1669.jpg","page_title":"Königreich Tungning","context_page_description":"Das Königreich Tungning oder Königreich von Formosa war zwischen 1661 und 1683 ein Feudalstaat im südwestlichen Teil von Taiwan mit der Hauptstadt Dongdu."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%83%D8%A7%D8%AF%D9%8A%D9%85%D9%8A%D8%A9_%D8%AC%D9%88%D8%B1%D8%AC_%D9%88%D8%A7%D8%B4%D9%86%D8%B7%D9%86_(%D8%A7%D9%84%D9%85%D8%BA%D8%B1%D8%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/GWAtop.jpeg","page_title":"أكاديمية جورج واشنطن (المغرب)","context_page_description":"أكاديمية جورج واشنطن ‏ هي مدرسة أميركية خاصة من مستوى رياض الأطفال إلى الثانوية في مدينة الدار البيضاء المغربية."},{"page_url":"https://vi.wikipedia.org/wiki/Tr%C3%BCmmerfrau","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Steine_klopfen_janczikowsky.jpg","page_title":"Trümmerfrau","context_page_description":"Trümmerfrau là tên gọi tiếng Đức để chỉ những phụ nữ, sau thế chiến thứ hai, phải góp tay giúp đỡ để dọn dẹp và xây dựng lại những thành phố ở Đức và Áo, mà đã bị tàn phá vì bom đạn. Với hàng trăm thành phố mà đã bị đổ nát nặng nề vì bom đạn hay vì bão lửa. Với nhiều thanh niên đã chết vì chiến tranh hay đang là tù nhân chiến tranh, trách nhiệm lớn lao này một số đông phụ nữ đã phải gánh chịu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_parks_and_gardens_in_Malta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Malta_-_Mellieha_-_Triq_il-Marfa_-_L-Inhawi_tal-Ghadira_-_Ghadira_Nature_Reserve_03_ies.jpg","page_title":"List of parks and gardens in Malta","context_page_description":"This is a list of parks and gardens, open to the general public, in Malta and Gozo by locality:"},{"page_url":"https://gl.wikipedia.org/wiki/Barbapapa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Bouteilles_de_Sirop_Barbapapa.jpg","page_title":"Barbapapa","context_page_description":"Barbapapa é unha serie de libros infantís, creada o 19 de maio de 1970 pola parella franco-norteamericana, Annette Tison e Talus Taylor. Os Barbapapa son personaxes con forma de pera de diversas cores que teñen a capacidade de mudar de forma á mantenta.\\nOs libros publicounos en francés L'École des loisirs e despois Éditions du Dragon d'Or. Traducíronse a máis de trinta linguas, e adaptáronse en series animadas de televisión."},{"page_url":"https://pt.wikipedia.org/wiki/Dix_Mille","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Farkle_dice.jpg","page_title":"Dix Mille","context_page_description":"Dix Mille é um nome de uma família de jogo de dados de origem francesa, muito semelhante ao Farkle. Existem versões eletrônicas do jogo, com o nome de Ten Thousand. Também é conhecido por outros nomes como Zilch, Foo, Boxcar, Bogus e Crap Out."},{"page_url":"https://no.wikipedia.org/wiki/Hestestridsvogn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Biga._Festa_do_esquecemento._Xinzo_de_Limia%2C_Ourense%2C_Galicia.jpg","page_title":"Hestestridsvogn","context_page_description":"Stridsvogn er en særskilt vogn trukket av en eller flere hester, og styrt av en fører. Stridsvognen er den eldste og enkleste formen for hestevogn ved at det ga rask og bevegelig kraft. Stridsvogner ble benyttet av hærstyrker både som transport eller som mobile plattform for bueskyttere, for jakt eller for hesteveddeløp, og som en beleilig måte å reise på for mange mennesker siden oldtiden.\\nDet norske ordet vogn er avledet fra norrøne vagn, mens det engelske ordet chariot er avledet fra franske charriot som kommer fra latinske carrus, i seg selv et lånord fra gallisk. I antikkens Roma, og en del andre oldtidssivilisasjoner ved Middelhavet, krevde en biga to hester, en triga tre, og en quadriga fire.\\nHestestridsvogn var en rask, lett, åpen transport trukket av to eller flere hester spent opp side ved side. Stridsvognen var ikke mer enn et gulv eller en liten plattform, omgitt av et brystvern foran og på sidene. Den bemannet med en fører og med en eller to soldater. Fra stridsvognene ble fienden beskutt med pil og bue eller angrepet med spyd eller spydøks."},{"page_url":"https://pl.wikipedia.org/wiki/Christian_Vietoris","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/2014_DTM_HockenheimringII_Christian_Vietoris_by_2eight_8SC4949.jpg","page_title":"Christian Vietoris","context_page_description":"Christian Vietoris – niemiecki kierowca wyścigowy."},{"page_url":"https://de.wikipedia.org/wiki/Stadtschreiber_von_Bergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Stadtschreiber-von-Bergen-2019-_Ffm-012.jpg","page_title":"Stadtschreiber von Bergen","context_page_description":"Stadtschreiber von Bergen ist ein Literaturpreis für deutschsprachige Autoren, der von 1974 bis 1976 – vor der Eingemeindung nach Frankfurt – von der ehemaligen Stadt Bergen-Enkheim vergeben und seitdem durch die Kulturgesellschaft Bergen-Enkheim im Auftrag der Stadt Frankfurt am Main verliehen wird. Die Auszeichnung „gilt als angesehenster Stadtschreiberpreis im deutschsprachigen Raum.“\\nDer Preis wurde von Franz Joseph Schneider, Bürger von Bergen-Enkheim und Autor der Gruppe 47, begründet. Damit wurde der erste aus einer Reihe von Stadtschreiber-Preisen geschaffen. Dieser Literaturpreis ist jedoch deshalb einzigartig geblieben, weil dem ausgezeichneten Schriftsteller keinerlei Verpflichtungen auferlegt werden. Er umfasst einen Geldpreis von 20.000 Euro und ein Jahr kostenfreies Wohnen im Stadtschreiberhaus in Bergen-Enkheim, „An der Oberpforte“ 4. Über die Vergabe des Preises entscheidet alljährlich eine neunköpfige Jury.\\nDie Verleihung erfolgt jedes Jahr am Freitagabend vor dem ersten Dienstag im September im Rahmen des Volksfestes „Berger Markt“. Dabei finden Schlüsselübergabe, Fest-, Antritts- und Abschiedsrede im Festzelt vor Hunderten von Besuchern statt."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%84%D9%83%D8%A9_%D8%AC%D9%85%D8%A7%D9%84_%D8%A7%D9%84%D9%83%D9%88%D9%86_1954","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Miss_Universe_1954_Map.PNG","page_title":"ملكة جمال الكون 1954","context_page_description":"ملكة جمال الكون 1954، هي مسابقة ملكة جمال الكون الثالثة في تاريخ مسابقة ملكة جمال الكون منذ انطلاقتها عام 1952، عقدت المسابقة في 24 يوليو 1954 في قاعة مركز لونغ بيتش للمؤتمرات والترفيه في لونغ بيتش، كاليفورنيا، الولايات المتحدة. تنافست 33 متسابقة. في نهاية الحدث فازت ملكة جمال الولايات المتحدة الأمريكية ميريام ستيفنسون، البالغة من العمر 21 عامًا. كانت أول ملكة جمال أميركية وأول فائزة تتوجها ملكة جمال الكون."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9F%B6%E5%85%B3%E4%B8%9C%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Zhenjiang%2C_Shaoguan%2C_Guangdong%2C_China_-_panoramio.jpg","page_title":"韶关东站","context_page_description":"韶关东站位于中国广东省韶关市浈江区车站街道，为京广铁路、赣韶铁路车站。车站目前为广州局集团广深铁路股份有限公司管辖的一等区段站，办理客货运业务、列车中转技术作业机车换挂、列检、商检作业等和部分直通、区段、摘挂货物列车的解编，客货源辐射粤北地区、赣南地区。"},{"page_url":"https://fr.wikipedia.org/wiki/Nina_Williams","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Tekken_Sisters.jpg","page_title":"Nina Williams","context_page_description":"Nina Williams est un personnage de jeu vidéo de la série Tekken de Namco, qui fait sa première apparition sur arcade et console dans Tekken. Parmi tous les personnages de Tekken, elle est l'un des 4, avec Paul, Yoshimitsu et Heihachi, à être apparu dans la totalité des opus de la saga.\\nElle est la sœur ainée d'Anna Williams, et sa plus grande rivale, ainsi que la mère biologique de Steve Fox. Elle est l'une des plus redoutables tueuses à gages du monde. A 44 ans, Nina est actuellement le personnage féminin le plus âgé de la saga. Grande, belle et blonde, elle est totalement dévouée à son art et rejette les sentiments humains, comme la pitié ou la compassion, qui la ralentiraient dans son travail."},{"page_url":"https://eu.wikipedia.org/wiki/Dolenice","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Dolenice_CoA.jpg","page_title":"Dolenice","context_page_description":"Dolenice Txekiar Errepublikako udalerri bat da. 142 biztanle ditu eta 4,46 kilometro koadroko azalera. Znojmoko barrutian dago."},{"page_url":"https://nl.wikipedia.org/wiki/Arcachon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Arcachon20050318Blorg.jpg","page_title":"Arcachon","context_page_description":"Arcachon is een gemeente in het Franse departement Gironde gelegen aan het Bassin d'Arcachon en de Atlantische Oceaan. De gemeente telt 11.454 inwoners, die Arcachonnais worden genoemd. De plaats maakt deel uit van het op 1 januari 2007 ontstane arrondissement Arcachon.\\nIn de 19e eeuw ontwikkelde Arcachon zich tot een belangrijke badplaats. In 1823 begon de eerste toeristische ontwikkeling, die een impuls kreeg door de bouw van een eigen spoorwegstation, Arcachon, in 1841. In 1857 werd deze voormalige wijk van La Teste-de-Buch een zelfstandige gemeente.\\nTegelijk kende de visserijhaven een gestage groei met als hoogtepunt de jaren 1940-1950 en werd Arcachon een van de belangrijkste Franse havens voor de vangst van sardines en makreel. Daarna ging de visvangst achteruit. Maar ook nu nog is er een vismijn."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EC%8B%9C%EC%95%84_%EB%A1%9D%EC%8A%A4%ED%83%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/R2_1.jpg","page_title":"아시아 록스타","context_page_description":"아시아 록스타는 아시아자동차공업의 지프형 스포츠 유틸리티 자동차이다."},{"page_url":"https://es.wikipedia.org/wiki/Cruz_de_Calatrava","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Cross_Calatrava.svg","page_title":"Cruz de Calatrava","context_page_description":"La Cruz de Calatrava es un símbolo utilizado por la Orden de Calatrava y la Orden de Montesa, así como por la Orden de Predicadores. Consiste en una cruz griega con los cuatro brazos iguales, de gules y flordelisada."},{"page_url":"https://en.wikipedia.org/wiki/2014_Cannondale_season","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/D%C3%A9part_2e_%C3%A9tape_2014_-_Tarare_%2812%29.JPG","page_title":"2014 Cannondale season","context_page_description":"The 2014 season for Cannondale began in January with the Tour de San Luis. As a UCI ProTeam, Cannondale were automatically invited and obligated to send a squad to every event in the UCI World Tour."},{"page_url":"https://fr.wikipedia.org/wiki/Pont_Alexandre-III","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/France_Renaissance_Coutan_Pont_Alexandre_III.jpg","page_title":"Pont Alexandre-III","context_page_description":"Le pont Alexandre-III est un pont franchissant la Seine entre le 7ᵉ et le 8ᵉ arrondissement de Paris."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%96_4%D0%A54","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/2009_Chevrolet_Traverse.jpg","page_title":"Автомобілі 4Х4","context_page_description":"Автомобілі 4Х4 — автомобілі, які мають повний привід."},{"page_url":"https://simple.wikipedia.org/wiki/Grade_(slope)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/UK_traffic_sign_524.1.svg","page_title":"Grade (slope)","context_page_description":"The grade of a road or railway line is a measure of its steepness. It may be expressed as a percentage or in other ways. For example, a gradient of 1% may also be expressed as 1 in 100. This means that the road rises or falls by 1 metre for every 100 metres of forward travel."},{"page_url":"https://ca.wikipedia.org/wiki/Racing_Club_de_Roubaix","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/RC_Roubaix_1902.png","page_title":"Racing Club de Roubaix","context_page_description":"El Racing Club de Roubaix fou un club de futbol francès de la ciutat de Roubaix."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%BE%D1%81%D0%B5%D0%B5%D0%B2%D0%BE_(%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B5%D1%81%D1%82%D0%BD%D0%BE%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Kiev_Didorivka_Lake_070628.jpg","page_title":"Голосеево (историческая местность)","context_page_description":"Голосе́ев — историческая местность на территории Голосеевского района города Киева. Голосеев располагается в южной части города, между Добрым Путём, Демиевкой, Теремками, Феофанией и Мышеловкой, охватывая Голосеевский лес, а также застройку между ним и улицами Васильковской и Сумской.\\nВ грамоте короля Сигизмунда Выдубицкому монастырю, местность упомянута как «Голосѣевъ», при описании границ землевладений Киево-Печерской Лавры а также в 1604 году упомянут как «хутор Голосѣевскій». Позже — хутор снова упомянут как «Голосѣевъ».\\nПроисхождение названия неизвестно. Некоторые источники объясняют название «Голосеев» тем, что лес был насажен на голом месте либо тем, что при монголо-татарском нашествии здесь «голосили» женщины. Ни одна из этих версий не подтверждена убедительными доказательствами, но вторая версия кажется наименее вероятной, поскольку историческая транскрипция «Голосѣевъ» содержит корень «сеять», а не «голосить».\\nНазвание местности ошибочно используют с окончанием на -о. Хотя это противоречит как и древним упоминаниям, так и современным нормативам в украинском языке, которые считают название Голосеево ошибочным."},{"page_url":"https://pt.wikipedia.org/wiki/Ruwer_(Verbandsgemeinde)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Lage_der_Verbandsgemeinde_Ruwer_in_Deutschland.png","page_title":"Ruwer (Verbandsgemeinde)","context_page_description":"Ruwer é uma Verbandsgemeinde da Alemanha do distrito de Trier-Saarburg."},{"page_url":"https://gl.wikipedia.org/wiki/Abdera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Abdera_West_gate.jpg","page_title":"Abdera","context_page_description":"Abdera, foi unha cidade grega da antiga Tracia, na foz do río Nestos, no mar Exeo. Na actualidade está en ruínas.\\nA súa fundación mítica atribúese a Heracles, aínda se ben en orixe foi unha colonia de Clazomenas fundada no 656 a. C.. Esta primeira colonización entra en devalo axiña ata que no 544 a. C. a maioría da poboación de Teos migrou aquí para escapar dos persas.\\nA cidade comeza a declinar a partir de mediados do século IV a.c. e foi abandonada na época do Imperio Otomán."},{"page_url":"https://es.wikipedia.org/wiki/Oi%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Colecci%C3%B3n_Virgen_de_Candelaria_by_elduendesuarez_47.JPG","page_title":"Oiá","context_page_description":"Oiá es una de las deidades de la religión iorubá.\\nEn la santería está sincretizada con la Virgen de la Candelaria​ o con santa Teresa de Ávila.\\nOiá está muy relacionada con la divinidad de la muerte.\\nPropicia los temporales, los vientos fuertes o huracanados y las centellas."},{"page_url":"https://tr.wikipedia.org/wiki/II._Aleksandr_Suikast%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/The_uniform_of_Alexander_II.jpg","page_title":"II. Aleksandr Suikastı","context_page_description":"II. Aleksandr suikastı, 13 Mart 1881'de Sankt-Peterburg, Rusya'da gerçekleşti. II. Aleksandr at arabasının kapalı vagonunda Mikhailovsky Manège'den Kışlık Saray'a dönerken gerçekleştirilen bir suikast neticesinde öldürüldü. Suikast, başta Andrey Jelyabov tarafından Narodnaya Volya İcra Komitesi tarafından planlanmıştı. Sofya Perovskaya tarafından koordine edilen dört suikastçiden sadece ikisi aslında kararlı bir eylem gerçekleştirdi. Suikastçılardan olan Nikolay Rısakov, arabaya zarar veren bir bomba attı. Bu noktada ikinci bir suikastçı olan İgnati Grinevitski, arabaya II. Aleksandr'ı ölümcül şekilde yaralayan bir bomba daha attı. II. Aleksandr, Zaporijya'daki imparatorluk trenini dinamitle patlatma girişimi ve Şubat 1880'de Kış Sarayı'nın bombalanması gibi Dmitri Karakozov ve Aleksandr Solovyov'un girişimleri de dahil olmak üzere hayatında birkaç suikastten kurtulmayı başarmıştı. Gerçekleştirilen bu suikast, halkın 19. yüzyıl Rus Nihilist hareketinin en başarılı eylemi olarak kabul edilmektedir."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%A0%C4%8Decino_%C4%AFlanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Zalewszczecinski.jpeg","page_title":"Ščecino įlanka","context_page_description":"Ščecino įlanka – lagūna Baltijos jūros pietryčiuose. Priklauso Lenkijai ir Vokietijai. Nuo Baltijos jūros ją skiria Uznamo ir Volino salos, o su jūra jungia Peenestromo, Svinos ir Dzivnos sąsiauriai. Plotas – 687 km², vidutinis gylis – 4 m, didžiausias gylis – 6 m.\\nTarp 1874 ir 1880 m. buvo iškastas 10 m gylio kanalas, palengvinantis susisiekimą su Baltijos jūra."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CE%BD%CE%BF%CE%BD%CE%B9%CE%BF%CF%86%CF%8C%CF%81%CE%BF%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/HS_Tolmi_%28P229%29_mail_transfer.jpg","page_title":"Κανονιοφόρος","context_page_description":"Η Κανονιοφόρος είναι ένα σχετικά μικρού εκτοπίσματος μηχανοκίνητο περιπολικό πολεμικό πλοίο, ο βασικός οπλισμός του οποίου αποτελείται από ένα ή περισσότερα πυροβόλα όπλα στην πλώρη, στην πρύμνη και στο μεσόστεγο.\\nΠαλαιότερα, η κανονιοφόρος ήταν ιστιοφόρο πλοίο, με κύρια αποστολή την προσβολή των πλησιέστερων ακτών. Τα ιδιαίτερα χαρακτηριστικά της κανονιοφόρου υπήρξαν ανέκαθεν ακαθόριστα περιλαμβάνοντας έτσι πλείστα είδη πολεμικών πλοίων από βάρκες κανονιέρες μέχρι θωρακισμένες ακταιωρούς και αργότερα μεγαλύτερα σκάφη."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A6%D8%AD%D8%A9_%D9%81%D9%8A%D8%B1%D9%88%D8%B3_%D9%83%D9%88%D8%B1%D9%88%D9%86%D8%A7_%D9%81%D9%8A_%D8%A7%D9%84%D8%AA%D8%B4%D9%8A%D9%83_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/20200403_Flatten_the_curve_animated_GIF.gif","page_title":"جائحة فيروس كورونا في التشيك 2020","context_page_description":"شهدت جائحة كوفيد 19 حالاتها الثلاث الأولى في جمهورية التشيك يوم 1 مارس عام 2020. وفي يوم 12 مارس، صرحت الحكومة بحالة الطوارئ، وهي أول مرة تصرح الحكومة بهذه الحالة، في التاريخ الحديث للدولة، لمنطقة تشمل الدولة بأكملها. وفي يوم 16 مارس، أغلقت الدولة حدودها وحظرت دخول الأجانب وأصدرت قرارًا بحظر التجول في جميع أنحاء البلاد. مُدت هذه التدابير حتى يوم 1 أبريل، على الرغم من أنه خُطط لها في البداية أن تستمر حتى يوم 24 مارس، ثم مُدت مرةً أخرى حتى نهاية حالة الطوارئ، التي مُدت بواسطة مجلس النواب حتى يوم 30 أبريل 2020، ثم مرةً أخرى حتى يوم 17 مايو 2020.\\nاختلفت بعض التدابير التي اتخذتها جمهورية التشيك عن الدول الأخرى. طُبق حظر التجول العام بين يومي 16 مارس و24 أبريل، ولكنه احتوى على استثناءات سخية، إذ استثنى التسوق الأساسي المعتاد والذهاب والإياب من العمل، ومن بين العديد من الاستثناءات الأخرى أيضًا زيارة الأقارب والحركة في الحدائق والريف المفتوح. طُبق إغلاق عام للخدمات ومراكز البيع بالتجزئة منذ يوم 14 مارس حتى 11 مايو، ولكن سُمح لجميع المحلات أن تقدم خدمة البيع عن بُعد مع التوصيل إلى المنازل من خلال نافذة الوجبات الجاهزة، وبدأ الافتتاح التدريجي للمحلات المختارة على عدة مراحل بدايةً من يوم 24 مارس فصاعدًا."},{"page_url":"https://sk.wikipedia.org/wiki/Zdv%C3%ADhacie_%C4%8Delo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/LKW_Ladebordwand_WP.jpg","page_title":"Zdvíhacie čelo","context_page_description":"Zdvíhacie čelo je druh zdvíhacej plošiny. Je to zariadenie, ktoré uľahčuje manipuláciu s nákladom nákladného automobilu. Dopĺňa alebo úplne nahrádza zadné čelo valníkovej alebo skriňovej nadstavby a umožňuje zdvíhať a skladať náklad z úrovne vozovky do výšky podlahy nákladného priestoru. Náklad vozidla vybaveného zdvíhacím čelom tak možno vyložiť alebo naložiť aj bez pomoci žeriavu alebo vysokozdvižného vozíka pomocou nízkozdvižného vozíka."},{"page_url":"https://de.wikipedia.org/wiki/Chazeuil_(Ni%C3%A8vre)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Chazeuil_-_Chateau_en_bas.jpg","page_title":"Chazeuil (Nièvre)","context_page_description":"Chazeuil ist eine französische Gemeinde mit 59 Einwohnern im Département Nièvre in der Region Bourgogne-Franche-Comté. Sie gehört zum Arrondissement Clamecy und zum Kanton Corbigny. Die Einwohner werden Chazuilois genannt."},{"page_url":"https://it.wikipedia.org/wiki/Osphronemus_goramy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Benih_Gurami_-_02.jpg","page_title":"Osphronemus goramy","context_page_description":"Osphronemus goramy Lacépède, 1801) conosciuto comunemente come gurami gigante, è un grosso pesce d'acqua dolce appartenente alla famiglia Osphronemidae."},{"page_url":"https://en.wikipedia.org/wiki/1972%E2%80%9373_South_Pacific_cyclone_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Juliette_1973-04-03.png","page_title":"1972–73 South Pacific cyclone season","context_page_description":"The 1972–73 South Pacific cyclone season ran year-round from July 1 to June 30. Tropical cyclone activity in the Southern Hemisphere reaches its peak from mid-February to early March."},{"page_url":"https://la.wikipedia.org/wiki/Turma_Pedilusoria_Nationalis_Germanica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Football_at_the_1912_Summer_Olympics_-_German_squad.jpg","page_title":"Turma Pedilusoria Nationalis Germanica","context_page_description":"Turma Nationalis Germanica est pedilusoria nationalis Germaniae turma virilis, die 5 Aprilis 1908 primus contra Turmam Nationalem Helveticam lusit. Haec turma inter alia quater Certamina Mundana Pedilusoria vicit: 1954, 1974, 1990 et 2014. Praesens pedilusorum exercitor est Ioachim Löw."},{"page_url":"https://fr.wikipedia.org/wiki/Argynnis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Argynnis_paphia_male_Weinsberg_20070722_2.jpg","page_title":"Argynnis","context_page_description":"Argynnis est un genre de lépidoptères de la famille des Nymphalidae et de la sous-famille des Heliconiinae."},{"page_url":"https://en.wikipedia.org/wiki/Forests_of_Mexico","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Cumbres_del_Ajusco.jpg","page_title":"Forests of Mexico","context_page_description":"The forests of Mexico cover a surface area of about 64 million hectares, or 34.5% of the country. These forests are categorized by the type of tree and biome: tropical forests, temperate forests, cloud forests, riparian forests, deciduous, evergreen, dry, moist, etc.. The agency in charge of Mexico's forests is the Comisión Nacional Forestal."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%86%DA%86%D8%B3%D8%AA%D8%B1_%D8%B3%DB%8C%D8%AA%DB%8C_%D8%B3%D9%86%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/St_John_the_Baptist%27s_Church%2C_Hatherleigh_-_geograph.org.uk_-_80166.jpg","page_title":"منچستر سیتی سنتر","context_page_description":"منچستر سیتی سنتر بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 17861 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Flatiron_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Typical_floor_of_the_Flatiron_Building.jpg","page_title":"Flatiron Building","context_page_description":"The Flatiron Building, originally the Fuller Building, is a triangular 22-story, 285-foot tall steel-framed landmarked building located at 175 Fifth Avenue in the Flatiron District neighborhood of the borough of Manhattan, New York City. Designed by Daniel Burnham and Frederick Dinkelberg, it was one of the tallest buildings in the city upon its 1902 completion, at 20 floors high, and one of only two \\"skyscrapers\\" north of 14th Street – the other being the Metropolitan Life Insurance Company Tower, one block east. The building sits on a triangular block formed by Fifth Avenue, Broadway, and East 22nd Street – where the building's 87-foot back end is located – with East 23rd Street grazing the triangle's northern peak. As with numerous other wedge-shaped buildings, the name \\"Flatiron\\" derives from its resemblance to a cast-iron clothes iron.\\nThe building, which has been called \\"one of the world's most iconic skyscrapers and a quintessential symbol of New York City\\", anchors the south end of Madison Square and the north end of the Ladies' Mile Historic District."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%B4_%D0%9A%D0%B0%D0%BF_%D0%90%D1%80%D0%BA%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Cap_Arcona_10.86422E_54.04183N.jpg","page_title":"Брод Кап Аркона","context_page_description":"Брод Кап Аркона био је немачки луксузни прекоокеански брод, од 27.500 бруто регистарских тона, који је путовао на линији Хамбург-Јужна Америка. Име је добио по рту Аркона на острву Риген у северној Немачкој. Поринут је 1927. и сматран једним од најлепших на свету.\\nОд 1940. брод је коришћен за војне потребе у Другом светском рату.\\nМаја 1945. брод се налазио у луци Либек пун ратних заробљеника, када га је грешком потопила британска авијација. Тада је погинуло преко 4000 заробљеника."},{"page_url":"https://pl.wikipedia.org/wiki/Karnawa%C5%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Maski_weneckie_1.JPG","page_title":"Karnawał","context_page_description":"Karnawał, zapusty – okres zimowych balów, maskarad, pochodów i zabaw. Rozpoczyna się najczęściej w dniu Trzech Króli, a kończy we wtorek przed Środą Popielcową, która oznacza początek wielkiego postu i oczekiwania na Wielkanoc."},{"page_url":"https://es.wikipedia.org/wiki/Luca_Ghiotto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Lucaghiottoitaliangp.jpg","page_title":"Luca Ghiotto","context_page_description":"Luca Ghiotto es un piloto de automovilismo italiano.​ Desde 2016 compite en GP2 Series/Fórmula 2, terminando cuarto en la temporada 2017. Es parte del equipo debutante Hitech Grand Prix en 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D1%82%D1%8E%D1%80%D0%B8%D0%BD,_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kosturin_SD.jpg","page_title":"Костюрин, Степан Дмитриевич","context_page_description":"Степан Дмитриевич Костюрин — русский врач, патолог и педагог."},{"page_url":"https://en.wikipedia.org/wiki/Imbi_Monorail_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Imbi_station_platform.jpg","page_title":"Imbi Monorail station","context_page_description":"Imbi Monorail station is a Malaysian elevated monorail train station that serves as a part of the Kuala Lumpur Monorail, located in Kuala Lumpur and opened alongside the rest of the train service on August 31, 2003. The station's similar location and proximity to a shopping district as the Bukit Bintang station means that the Imbi station is also one of the most heavily used stations along the KL Monorail line."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BC%D0%BD%D0%B0%D1%82%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Temnatyk-2-w_IMG-3071.jpg","page_title":"Томнатик","context_page_description":"Темна́тик — вершина в Українських Карпатах. Розміщена на крайній північно-західній віднозі масиву Полонина Боржава, в межах Закарпатської області."},{"page_url":"https://af.wikipedia.org/wiki/Tara_Buck","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Tara_Buck_2013.jpg","page_title":"Tara Buck","context_page_description":"Tara Buck is 'n Amerikaanse aktrise en vervaardiger. Sy is bekend vir haar rolle in die rolprente Pee-wee's Big Holiday en Great Plains, en in die televisiereekse True Blood en Ray Donovan."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%D9%88%D9%84_%D9%87%D8%B1%D9%85%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Hermann_Paradisus_Batavus.jpg","page_title":"پاول هرمان","context_page_description":"پاول هرمان، پزشک و گیاه‌شناس زادهٔ آلمان و ۱۵ سال رئیس باغ گیاه‌شناسی شهر لیدن بود."},{"page_url":"https://fi.wikipedia.org/wiki/Jon%C3%A1s_Ramalho","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Jon%C3%A1s_Ramalho.jpg","page_title":"Jonás Ramalho","context_page_description":"Jonás Ramalho Chimeno on espanjalainen jalkapalloilija. Hän edustaa Espanjan toiseksi korkeimmalla sarjatasolla Segunda Divisiónissa pelaavaa Gironaa lainasopimuksella Athletic Bilbaosta ja on pelipaikaltaan puolustaja.\\nRamalho on vain Baskimaassa syntyneitä tai alueen seurojen kasvattamia pelaajia edustusjoukkueessaan peluuttavan Athleticin ensimmäinen tummaihoinen pelaaja. Hänen äitinsä on kotoisin Baskimaasta ja isä Angolasta."},{"page_url":"https://de.wikipedia.org/wiki/Kommunaler_Friedhof_(Cieszyn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Cieszyn_0120.jpg","page_title":"Kommunaler Friedhof (Cieszyn)","context_page_description":"Der Kommunale Friedhof ist ein Friedhof in Cieszyn und wurde 1891 an der nördlichen Stadtgrenze eingerichtet, als der Alte Friedhof an der Georgskirche zu klein wurde. Bestattungen finden hier weiterhin statt. Der Friedhof wird von der Stadt Cieszyn verwaltet und befindet sich an der ulica Bielska nördlich der Altstadt. Er ist mittlerweile mit 6,94 ha der größte Friedhof der Stadt.\\nAuf dem Friedhof befinden sich auch ein Massengrab der Opfer der NS-Besetzung sowie Soldatenfriedhöfe beider Weltkriege.\\nDer Friedhof steht unter Denkmalschutz."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8B%B0%EB%AC%B4%EB%A5%B4_%EC%82%AC%ED%95%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Baldini_v_Safin_Challenge_International_de_Paris_2013_ts155457.jpg","page_title":"티무르 사핀","context_page_description":"티무르 마르셀레비치 사핀은 러시아의 펜싱 선수로 주 종목은 플뢰레이다. 2014년 세계 선수권 대회에서 동메달을 획득한 후 2016년 하계 올림픽에서 단체전 금메달, 개인전 동메달을 획득했다."},{"page_url":"https://sco.wikipedia.org/wiki/Echosmith","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Echosmith_11_15_2017.jpg","page_title":"Echosmith","context_page_description":"Echosmith is an American rock andindie pop baund formed in Februar 2009 frae Toluca Lake, Los Angeles."},{"page_url":"https://sv.wikipedia.org/wiki/Pterostylis_sargentii","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Pterostylis_sargentii_-_Flickr_003_%281%29.jpg","page_title":"Pterostylis sargentii","context_page_description":"Pterostylis sargentii är en orkidéart som beskrevs av Cecil Rollo Payton Andrews. Pterostylis sargentii ingår i släktet Pterostylis och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Municipal_District_of_Bonnyville_No._87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/AB_locator_MUNICIPAL_DISTRICT_OF_BONNYVILLE_NO_87.svg","page_title":"Municipal District of Bonnyville No. 87","context_page_description":"The Municipal District of Bonnyville No. 87 is a municipal district in northeastern Alberta, Canada in Division No. 12. It is located adjacent to the province of Saskatchewan on the east.\\nThe district was incorporated on January 1, 1955, through the merger of the Municipal District of Bonnyville No. 87, the Municipal District of Glendon No. 88 and part of Improvement District No. 101."},{"page_url":"https://es.wikipedia.org/wiki/Museo_Nacional_de_Arte_Moderno_%22Carlos_M%C3%A9rida%22","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Sala_Carlos_Merida.jpg","page_title":"Museo Nacional de Arte Moderno \\"Carlos Mérida\\"","context_page_description":"El Museo Nacional de Arte Moderno \\"Carlos Mérida\\" es un museo nacional de arte moderno ubicada en la ciudad de Guatemala, nombrado en honor a Carlos Mérida."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Voyageur_imprudent","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Barjavel%2C_Le_Voyageur_imprudent%2C_1944_Deno%C3%ABl.jpg","page_title":"Le Voyageur imprudent","context_page_description":"Le Voyageur imprudent est un roman de science-fiction de René Barjavel, paru en 1944."},{"page_url":"https://it.wikipedia.org/wiki/Cherusci","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Battaglia_Idistaviso.jpg","page_title":"Cherusci","context_page_description":"I Cherusci erano una tribù germanica che abitò nella valle del Reno e nelle pianure e foreste della Germania nord-occidentale tra il I secolo a.C. ed il I secolo d.C."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%82%A7%E3%82%B7%E3%83%BC%E3%83%BB%E3%83%9E%E3%83%BC%E3%82%B7%E3%83%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/FC_RB_Salzburg_versus_Kayseri_Spor_Kul%C3%BCb%C3%BC_%28Testspiel%2C_23._Juli_2019%29_26.jpg","page_title":"ジェシー・マーシュ","context_page_description":"ジェシー・マーシュは、アメリカの元サッカー選手、オーストリアのクラブ、レッドブル・ザルツブルク現監督。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%94_%D7%A1%D7%95%D7%98%D7%95_%D7%93%D7%99%D7%A4%D7%9C%D7%95%D7%9E%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/DeSoto_Diplomat_1961.jpg","page_title":"דה סוטו דיפלומט","context_page_description":"דה סוטו דיפלומט היא מכונית סלון שיוצרה על ידי חטיבת \\"דה סוטו\\" בחברת קרייזלר האמריקאית, אשר יועדה לשוקי יצוא מחוץ לארצות הברית למעט קנדה, בין השנים 1946–1962.\\nדגמי הדה סוטו דיפלומט יוצאו לאירופה, דרום אפריקה, דרום אמריקה, הוואי ואוסטרליה. משנת 1953 דגם הדה סוטו יוצר והורכב באוסטרליה, ומאוחר יותר גם בדרום אפריקה.\\nבשנת 1957 שונו מרכב ועיצוב הרכב מהקצה אל הקצה."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2_%D0%B2_1934_%D0%B3%D0%BE%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/GheorgheTatarescu.PNG","page_title":"Список глав государств в 1934 году","context_page_description":"В списке перечислены лидеры государств по состоянию на 1934 год. В том случае, если ведущую роль в государстве играет коммунистическая партия, указан как де-юре глава государства — председатель высшего органа государственной власти, так и де-факто — глава коммунистической партии.\\nВ список не включены главы ассоциированных государств, подмандатных и автономных территорий.\\nЕсли в 1934 году в каком-либо государстве произошла смена руководителя, в списке указываются оба из них. В случае если государство сменило флаг, указываются также оба флага.\\nСправа от текста даются изображения политиков, впервые пришедших к власти в 1934 году.\\nТочные даты смены правлений даются только для 1934 года. Прочие года смены власти даны ссылками на соответствующие списки глав государств и правительств по годам.\\nЦветом выделены страны, в которых в данном году произошли смены власти вследствие следующих событий:\\nПолучение страной независимости;\\nВоенный переворот, революция, всеобщее восстание;\\nПрезидентские выборы;\\nпарламентские выборы, парламентский кризис;\\nСмерть одного из руководителей страны;\\nИные причины."},{"page_url":"https://es.wikipedia.org/wiki/Relaciones_Camboya-Estados_Unidos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/John_Kerry_meets_with_Cambodian_Prime_Minister_Hun_Sen.jpg","page_title":"Relaciones Camboya-Estados Unidos","context_page_description":"Las relaciones Camboya-Estados Unidos son las relaciones diplomáticas entre Estados Unidos y Camboya. Las relaciones bilaterales entre los Estados Unidos y el Reino de Camboya, mientras se tensaron durante la Guerra Fría, se han fortalecido considerablemente en los tiempos modernos. Los Estados Unidos apoyan los esfuerzos en Camboya para combatir el terrorismo, crear instituciones democráticas, promover los derechos humanos, fomentar el desarrollo económico, eliminar la corrupción, lograr la mayor contabilidad posible para los estadounidenses desaparecidos de la Guerra de Vietnam / Guerra de los Estados Unidos -era, y llevar ante la justicia a los principales responsables de violaciones graves del derecho internacional humanitario cometidas bajo el régimen de Khmer Rouge.\\nSegún una encuesta de 2011 de Gallup, el 68% de los camboyanos aprobó el desempeño laboral de los Estados Unidos bajo la Administración de Obama, con un 7% de desaprobación, la opinión más favorable para cualquier nación encuestada de Asia-Pacífico.​ En una encuesta de Gallup de 2012, el 62% de los camboyanos aprobó el liderazgo de los Estados Unidos, con un 8% de desaprobación.​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BC%82%E7%A1%AB%E6%B0%B0%E9%85%B8%E9%85%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/ThiazolidineSynthesis.png","page_title":"异硫氰酸酯","context_page_description":"異硫氰酸酯是一類通式為R-N=C=S的有機化合物，可看作是由異氰酸酯中的氧原子被硫替換後形成。\\n異硫氰酸鹽是硫氰酸根用氮原子配位時生成的化合物。它是硫氰酸鹽的鍵合異構體。有時「異硫氰酸鹽」也指「異硫氰酸酯」，比如異硫氰酸苯酯也被稱作苯基異硫氰酸鹽。"},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B0%80%EC%8A%A4%EB%A0%88%EC%9D%B8%EC%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Whirpool_gas_range.jpg","page_title":"가스레인지","context_page_description":"가스레인지 또는 가스 스토브는 가스를 연료로 음식을 조리하는 기구다. 가스오븐 레인지는 가스 버너와 오븐이 함께 달린 조리기구이고, 가스그릴 레인지는 레인지 아래에 간단하게 생선이나 고기 등을 구울 수 있는 공간이 확보되어 있는 조리기구다."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DB%8C%D8%AA%DA%A9%D8%B1%D8%8C_%DA%A9%D8%A7%D8%B1%D9%88%D9%84%DB%8C%D9%86%D8%A7%DB%8C_%D8%B4%D9%85%D8%A7%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/2005-06-25_Whitakers%2C_NC_water_tower.jpg","page_title":"ویتکر، کارولینای شمالی","context_page_description":"ویتکر شهری در ایالت کارولینای شمالی کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۷۴۴ نفر بوده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1977","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Jidkova_2009.jpg","page_title":"Lijst van personen geboren in 1977","context_page_description":"Dit is een lijst van personen die geboren zijn in 1977.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/CAA_Theatre","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/20171201-caa-theatre-mirvish.jpg-resize_then_crop-_frame_bg_color_FFF-h_1365-gravity_center-q_70-preserve_ratio_true-w_2048_.webp","page_title":"CAA Theatre","context_page_description":"The CAA Theatre, formerly the Panasonic Theatre, is a live theatre owned and operated by Mirvish Productions located at 651 Yonge Street in Toronto, Ontario, Canada. On December 1, 2017, Mirvish Productions announced a marketing partnership with CAA South Central Ontario, which included renaming the venue that was known as the Panasonic Theatre."},{"page_url":"https://eu.wikipedia.org/wiki/Gaztelu_(Gipuzkoa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Gaztelu_gipuzkoa_historikoa_001.jpg","page_title":"Gaztelu (Gipuzkoa)","context_page_description":"Gaztelu Gipuzkoako ekialdean eta Tolosaldea dagoen landa-udalerri txiki eta euskalduna da.\\n165 biztanle zituen\\n2016. urtean.\\nNafarroako mugan egonda, historian zehar hainbat liskar eduki izan ditu, izan ere herriaren izenak iraganaldi militar hori iradokitzen du."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BC%D0%BD_%D0%BD%D0%B0_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/HoffmanDeutschlandlied.jpg","page_title":"Химн на Германия","context_page_description":"„Песента на немците“ или „Немската песен“ е песен по текст на Аугуст Хайнрих Хофман фон Фалерслебен и музика на Йозеф Хайдн. Тя е химн на съвременната Федерална република Германия, но първите 2 куплета не се изпълняват.\\nНаписана през 1841 г. в средите на немското национално-обединително движение, песента е била многократно повод за коментари, а отношението към нея се е променяло в зависимост от историческата епоха. Една от причините за това е известната и интерпретирана по различен начин първа строфа: „Германия, Германия над всичко“."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%AE%D9%84_%D8%AA%D9%82%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ejl3a.jpg","page_title":"نخل تقي","context_page_description":"مدينة أو میناء نخل تقي تقع في جنوب ساحل الخليج وهم اصل عرب من شبه الجزيرة العربية.نخل تقي تقع في إيران جنوب ساحل الخليج العربي. مدينة نخل تقي في مقاطعة عسلوية من محافظة بوشهر.\\nسكانها هم من العرب السنة من قبلية بني خالد النصوريين \\"النصور... سميت بنخل تقي بعد تعرض هذه القرية لقصف من قبل القزاق الذي أجبر سكانها على الهجرة أبان كشف الحجاب إلى ضواحيها. البيشة وشير مصباح الذي يقع في غرب القرية وفي تلك الأثنا ء بقى فيها شخصٌ صالح ومتقي جداً وحوله من النخيل وعندما ارادوا الناس أن يسئلوا عن المكان الذي يعيشون فيه أعطوا مكان الرجل الصالح والمتقي حيث اكتسب المكان والصفة باسم نخل تقي وتغيرت من النعيمة إلى الاسم الجديد والأماكن المعروفة: تل الزايرة، نخل مصباح نخل عبودو، مطينة مصباح، مطينة الشرقية، الفرفار، اليبيل الرحيّة، بنود مسعود، الخور، هيونة طوي الصغيّر، شير مصباح، وادي المخازن، وادي الكبريت، طوي عمران، طوي القطن، تل كواخ، راس الشير، ديار العين، الجليعات، طوي بوجزة، وادي الرولة، وادي البرجة وغيره..."},{"page_url":"https://fr.wikipedia.org/wiki/Westover_(Virginie-Occidentale)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/WVMap-doton-Westover.PNG","page_title":"Westover (Virginie-Occidentale)","context_page_description":"Westover est une ville américaine située dans le comté de Monongalia en Virginie-Occidentale.\\nSelon le recensement de 2010, Westover compte 3 983 habitants. La municipalité s'étend sur une superficie de 1,51 milles carrés.\\nLa ville est nommée Westover car elle est située à l'ouest de Morgantown, par-delà la Monongahela."},{"page_url":"https://en.wikipedia.org/wiki/Mercury_Commuter","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/1957_Mercury_Commuter.jpg","page_title":"Mercury Commuter","context_page_description":"The Mercury Commuter is a full-size station wagon that was produced by Mercury from 1957 to 1968. When introduced for the 1957 model year it was priced below Mercury's other two new full size wagons, the Voyager and the Colony Park. In 1957 the same 368 cu in Lincoln Y-Block V8 that was standard equipment on the Mercury Turnpike Cruiser was optional equipment on the Commuter.\\nIt was initially available as a two-door wagon and as a four-door wagon with the former discontinued after the 1959 model year. The Commuter was temporarily absent in 1963, in concession to the new Meteor station wagons, but was reinstated for 1964, when the Meteor was discontinued. The Commuter was phased out for good, like the full-size Mercury Montclair and Park Lane, after the 1968 model year."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%BE_%D0%B8%D0%B7%D0%BA%D1%83%D1%81%D1%82%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Akan_MHNT.ETH.2010.25.051.jpg","page_title":"Африканско изкуство","context_page_description":"Африканското изкуство описва съвременните и исторически картини, скулптури, инсталации и друга визуална култура на местното африканско население и африканския континент. Определението може да включва и изкуството на африканските диаспори, като афроамериканското, карибското и изкуството в южноамериканските общества, вдъхновени от африканските традиции. Въпреки това разнообразие, съществуват обединяващи художествени теми, чрез които се разглежда целостта на визуалната култура от континента Африка.\\nМаскарадът, металопластиката, скулптурата, архитектурата и танците са важни форми на изкуството в Африка и могат да бъдат включени в изследването на африканското изкуство. Терминът „африканско изкуство“ обикновено не включва изкуството на северноафриканските райони по брега на Средиземно море, тъй като такива райони отдавна са част от различни традиции. В продължение на повече от хилядолетие изкуството на такива области е част от берберското или ислямското изкуство, макар и с много специфични местни характеристики. Изкуството на Етиопия, с дългата си християнска традиция, също е различно от това на останалата част от Африка, където традиционната африканска религия е доминираща, от скоро."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%AF%8C%E5%A3%AB%E8%A6%8B%E5%8F%B0%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Fujimidai-Sta-S.JPG","page_title":"富士見台站","context_page_description":"富士见台站是位于日本东京都练马区贯井三丁目，属于西武铁道池袋线的铁路车站。车站编号是SI08。"},{"page_url":"https://en.wikipedia.org/wiki/Tirodi_copper_plates","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Tirodi_first_plate.jpg","page_title":"Tirodi copper plates","context_page_description":"The Tiroḍī copper plates are an epigraphic record of the Vākāṭaka dynasty, documenting a land donation to a brāhmaṇa in the reign king Pravarasena II in the fifth century CE. They were acquired by T. A. Wellsted at Tirodi in District Balaghat, Madhya Pradesh, India."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%95%E0%A9%8D%E0%A8%B0%E0%A8%BF%E0%A8%AA%E0%A8%9F%E0%A9%8B%E0%A8%95%E0%A8%B0%E0%A9%B0%E0%A8%B8%E0%A9%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/%D0%9E%D0%B1%D0%BE%D1%80%D1%83%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_HashCoins.jpg","page_title":"ਕ੍ਰਿਪਟੋਕਰੰਸੀ","context_page_description":"ਕ੍ਰਿਪਟੋਕਰੰਸੀ ਇੱਕ ਡਿਜ਼ੀਟਲ ਸੰਪਤੀ ਹੈ ਜੋ ਕਿ ਐਕਸਚੇਂਜ ਦਾ ਇੱਕ ਮਾਧਿਅਮ ਵਜੋਂ ਕੰਮ ਕਰਨ ਲਈ ਤਿਆਰ ਕੀਤਾ ਗਿਆ ਹੈ ਜੋ ਕ੍ਰਿਪਟੋਗ੍ਰਾਫੀ ਦੀ ਵਰਤੋਂ ਕਰਦੀ ਹੈ। ਇਸਦੇ ਨਾਲ ਟ੍ਰਾਂਜੈਕਸ਼ਨਾਂ ਨੂੰ ਸੁਰੱਖਿਅਤ ਕੀਤਾ ਜਾਂਦਾ ਹੈ, ਵਾਧੂ ਇਕਾਈਆਂ ਦੀ ਰਚਨਾ ਨੂੰ ਨਿਯੰਤਰਿਤ ਕੀਤਾ ਜਾਂਦਾ ਹੈ ਅਤੇ ਸੰਪਤੀਆਂ ਦੇ ਟ੍ਰਾਂਸਫਰ ਦੀ ਤਸਦੀਕ ਕੀਤੀ ਜਾਂਦੀ ਹੈ। ਕ੍ਰਿਪੋਟੋਕਰੰਸੀ ਨੂੰ ਡਿਜੀਟਲ ਕਰੰਸੀ ਦੇ ਸਬਸੈੱਟ ਦੇ ਰੂਪ ਵਿੱਚ ਸ਼੍ਰੇਣੀਬੱਧ ਕੀਤਾ ਜਾਂਦਾ ਹੈ ਅਤੇ ਇਹਨਾਂ ਨੂੰ ਵਿਕਲਪਿਕ ਮੁਦਰਾਵਾਂ ਅਤੇ ਵਰਚੁਅਲ ਮੁਦਰਾਵਾਂ ਦੀ ਸ਼੍ਰੇਣੀ ਵਜੋਂ ਮੰਨਿਆ ਜਾਂਦਾ ਹੈ।"},{"page_url":"https://de.wikipedia.org/wiki/Empress_of_Ireland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Empress-of-Ireland.jpg","page_title":"Empress of Ireland","context_page_description":"Die RMS Empress of Ireland war ein 1906 in Glasgow gebautes Passagierschiff der Canadian Pacific Railway. Sie fuhr ab Juni 1906 im regelmäßigen Liniendienst im Nordatlantik zwischen Québec und Liverpool. Am 29. Mai 1914 sank sie nach einer Schiffskollision im Sankt-Lorenz-Strom. Dabei kamen 1.012 Menschen ums Leben. Der Untergang der Empress of Ireland ist damit die zivile Schiffskatastrophe mit dem drittgrößten Verlust an Menschenleben vor dem Ausbruch des Ersten Weltkrieges, sowie das bis heute schwerste maritime Unglück in der Geschichte Kanadas."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%83%E6%B2%A2%E6%A3%AE%E6%9E%97%E5%85%AC%E5%9C%92","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Nanasawa_06e5905v.jpg","page_title":"七沢森林公園","context_page_description":"神奈川県立七沢森林公園は、神奈川県厚木市七沢、小野、上古沢にある都市公園である。"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86_%D8%A8%DB%8C%D8%B3%D9%86%D8%AA%D9%87_%D8%AF%D9%84_%D8%B1%D8%A7%D8%B3%D9%BE%DB%8C%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/UA-Aulario2.jpg","page_title":"سان بیسنته دل راسپیق","context_page_description":"{{Infobox settlement|\\n| settlement_type = Municipality\\n| name = San Vicente del Raspeig\\n| native_name =\\nسان بیسنته دل راسپیق ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و آلیکانته اوستانینده یئرلشیب. ۱۰۹ متر دنیز سویه‌سیندن اۇجالیقی وار. بۇ شهرین مساحتی ۴۰٫۵۵ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۵۶۷۱۵ نفر دیر."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%B9a_b%C3%A3o_T%C3%A2y_Nam_%E1%BA%A4n_%C4%90%E1%BB%99_D%C6%B0%C6%A1ng_2013-14","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Edilson_Feb_6_2014_0610UTC.jpg","page_title":"Mùa bão Tây Nam Ấn Độ Dương 2013-14","context_page_description":"Mùa bão Tây Nam Ấn Độ Dương 2013-14 là một sự kiện đang diễn ra trong chu kỳ hàng năm về sự hình thành các xoáy nghịch nhiệt đới sẽ kết thúc vào ngày 30 tháng 6 năm 2014. Mùa bão chính thức bắt đầu vào ngày 01 tháng 7 năm 2013, mặc dù hệ thống nhiệt đới đầu tiên do Météo-Pháp là một nhiễu động nhiệt đới trong thời gian ngắn đã phát triển vào ngày 8 Tháng 7. Tuy nhiên, cơn bão đầu tiên có tên là bão mạnh Amara hình thành trong tháng mười hai. Như vậy đến nay, cơn bão mạnh nhất của mùa bão là cơn bão Bruce, có nguồn gốc từ khu vực Úc và sau đó tăng cường với một cường độ cao với sức gió duy trì tối đa 230 km/h, làm cho nó là bão xoáy nhiệt đới đầu tiên ở miền Tây Nam Ấn Độ Dương đạt được cấp độ bão xoáy nhiệt đới cực mạnh kể từ sau siêu bão Edzani trong năm 2010. Sau đó cơn bão này quay lại vùng biển Úc vào ngày 25 tháng 12 khi nó tiêu tan dần.\\nTrong khu vực này, các xoáy thuận nhiệt đới và xoáy cận nhiệt đới được giám sát bởi Trung tâm Khí tượng chuyên khu vực trên đảo Réunion, trong khi Mauritius và trung tâm thời tiết Madagascar gán tên của các xoáy thuận nhiệt đới và xoáy cận nhiệt đới."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BB%D1%8C%D0%B1%D0%B5%D1%80,_%D0%9D%D0%B0%D1%82%D0%B0%D0%BD_%D0%9C%D0%B8%D1%85%D0%B0%D1%8D%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Nathan_Michael_Gelber.jpg","page_title":"Гельбер, Натан Михаэль","context_page_description":"Натан Михаэль Гельбер — еврейский историк и общественный деятель, исследователь раннего сионизма и польского еврейства, сионистский функционер, историк евреев Галиции, редактор. Доктор наук. Один из основателей еврейской генеалогии."},{"page_url":"https://ca.wikipedia.org/wiki/Kannushi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Wedding_procession_at_Meiji_shrine_02.jpg","page_title":"Kannushi","context_page_description":"Els Kannushi, també anomenats Jinshu o Shinshoku, és la persona responsable del manteniment dels jinja o santuaris xintoistes així com de l'adoració i els oficis religiosos als kami o divinitats xintoistes. El Kannushi és l'intermediari entre els kami i els essers humans. Els Kannushi són assistits en les seues tasques religioses per les miko i els sacerdots de menor graduació. En el sentit actual del terme, els Kannushi són l'equivalent xintoista dels sacerdots."},{"page_url":"https://de.wikipedia.org/wiki/Liste_seem%C3%A4nnischer_Fachw%C3%B6rter_(A_bis_M)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Mh_winkerflaggenalphabet_l.png","page_title":"Liste seemännischer Fachwörter (A bis M)","context_page_description":"Dies ist eine Liste speziell seemännischer Fachausdrücke nebst Erläuterung, die an Bord von see- und binnen-gängigen Schiffen benutzt werden:"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D9%86%D8%A7%D8%AB%D8%A7%D9%86_%D9%83%D8%A7%D9%8A%D8%B3%D9%8A%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/4_Etapa-Vuelta_a_Colombia_2018-Ciclista_Jonathan_Caicedo_Linder_Clasificacion_General.jpg","page_title":"جوناثان كايسيدو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجوناثان كايسيدو لاعب سباق عجل من اكوادور."},{"page_url":"https://nl.wikipedia.org/wiki/Henderikadius_Zwantinus_Kloekers","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Henderikadius_Zwantinus_Kloekers_%281828-1893%29.jpg","page_title":"Henderikadius Zwantinus Kloekers","context_page_description":"Henderikadius Zwa[a]ntinus Kloekers was een Nederlandse predikant en zendeling."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%85%E9%BB%9E%E7%9F%B3%E6%96%91%E9%AD%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Epinephelus_guttatus_-_pone.0010676.g050.png","page_title":"紅點石斑魚","context_page_description":"紅點石斑魚，為輻鰭魚綱鱸形目鱸亞目鮨科的其中一種，分布於西大西洋區，從美國北卡羅萊納州至巴西海域，棲息深度2-100公尺，本魚體綠灰色致淺棕色，腹部白色，頭部、身體和魚鰭具有橙紅色或褐色斑點，背鰭硬棘11枚;背鰭軟條15-16枚;臀鰭硬棘3枚;臀鰭軟條8枚，體長可達76公分，生活在水淺的珊瑚礁、岩石底部，為底棲性魚類，屬肉食性，以甲殼類、魚類、章魚等為食，可做為食用魚、遊釣魚及觀賞魚。"},{"page_url":"https://sv.wikipedia.org/wiki/Bandad_hallonspinnare","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Moths_of_the_British_Isles_Plate036.jpg","page_title":"Bandad hallonspinnare","context_page_description":"Bandad hallonspinnare är en fjärilsart som beskrevs av Hüfnagel 1767. Bandad hallonspinnare ingår i släktet Habrosyne och familjen sikelvingar. Enligt den finländska rödlistan är arten nära hotad i Finland. Arten är reproducerande i Sverige. Artens livsmiljö är kulturmarker och andra av människan skapade miljöer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%82%A6%E3%83%93%E3%82%BF%E3%82%AD%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Phoenicurus_moussieri.jpg","page_title":"ジョウビタキ属","context_page_description":"ジョウビタキ属は、スズメ目・ツグミ科に分類される鳥類の一属。"},{"page_url":"https://sq.wikipedia.org/wiki/Charles_Goodyear","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Charles_Goodyear.png","page_title":"Charles Goodyear","context_page_description":"Charles Nelson Goodyear lindi më 29 dhjetor 1800 në New Haven, Connecticut dhe vdiq më 1 qershor 1860 në New York. Ishte një kimist dhe zbulues amerikan. Goodyear bëri vulkanizimin e kauçukut kështu që bazë kësaj u krijua industrija e sotshme e kauçukut. Ai është zbuluesi i gomës së fortë."},{"page_url":"https://es.wikipedia.org/wiki/Villers-Chemin-et-Mont-l%C3%A8s-%C3%89trelles","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Map_commune_FR_insee_code_70366.png","page_title":"Villers-Chemin-et-Mont-lès-Étrelles","context_page_description":"Villers-Chemin-et-Mont-lès-Étrelles es una comuna y población de Francia, en la región de Franco Condado, departamento de Alto Saona, en el distrito de Vesoul y cantón de Gy.\\nSu población en el censo de 1999 era de 113 habitantes.\\nEstá integrada en la Communauté de communes des Monts de Gy."},{"page_url":"https://nl.wikipedia.org/wiki/Handschrift_684","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/UBU_Ms_684-f._1r_1874-335146p5.jpg","page_title":"Handschrift 684","context_page_description":"Hs. 684 is een vroeg 14e-eeuws manuscript met de Lilium Medicinae van Bernard de Gordon. Het kan zowel gebruikt zijn als medisch naslagwerk, ofwel als studieboek. Het geschrift is afkomstig van de Utrechtse Paulusabdij.\\nHet handschrift wordt tegenwoordig bewaard in de Universiteitsbibliotheek Utrecht. Het is te citeren als: Universiteitsbibliotheek Utrecht Hs. 684."},{"page_url":"https://cs.wikipedia.org/wiki/ZOO_Dvorec","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Lev_pustinn%C3%BD.jpg","page_title":"ZOO Dvorec","context_page_description":"ZOO Dvorec, dříve známá jako Park exotických zvířat, o. p. s., je soukromá, nejjižněji položená zoologická zahrada v Česku, jež se nachází u vesnice Dvorec v obci Borovany 15 km jihovýchodně od Českých Budějovic. Statut zoologické zahrady získala v roce 2012.\\nSvou rozlohou se řadí k nejmenším v České republice. Zoo se zaměřuje na chov kočkovitých šelem, kopytníků, plazů a primátů."},{"page_url":"https://pt.wikipedia.org/wiki/Migra%C3%A7%C3%A3o_de_aves","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Pandion_haliaetus_2355.JPG","page_title":"Migração de aves","context_page_description":"As migrações são fenômenos voluntários e intencionais com carácter periódico com o objectivo de encontrar alimento e boas condições meteorológicas. Este comportamento não deve ser confundido com as deslocações ocasionais ou com os movimentos dispersantes.\\nOs factores que desencadeiam as migrações são pouco conhecidos. Em muitas aves observa-se o aumento das várias hormonas que iniciam o processo pré-migratório onde se pode observar a engorda e o crescimento das gónadas. Essas alterações das concentrações hormonais podem ser induzidas por modificações externas como a variação do número de horas de dia, a escassez de alimentos ou das modificações climatéricas.\\nDurante as migrações algumas aves orientam-se principalmente através da capacidade extraordinária de reconhecer características topográficas, como rios, árvores ou características do litoral. Noutras espécies a migração, durante o dia, parece ser orientada principalmente pela posição do sol e durante a noite pelo eixo estrelar de rotação."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CE%BB%CE%BB%CE%B7%CE%BD%CE%B9%CE%BA%CE%AD%CF%82_%CE%B2%CE%BF%CF%85%CE%BB%CE%B5%CF%85%CF%84%CE%B9%CE%BA%CE%AD%CF%82_%CE%B5%CE%BA%CE%BB%CE%BF%CE%B3%CE%AD%CF%82_%CE%A3%CE%B5%CF%80%CF%84%CE%B5%CE%BC%CE%B2%CF%81%CE%AF%CE%BF%CF%85_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Fofi_Gennimata_2009_%28cropped%29.jpg","page_title":"Ελληνικές βουλευτικές εκλογές Σεπτεμβρίου 2015","context_page_description":"Οι ελληνικές βουλευτικές εκλογές του Σεπτεμβρίου 2015 διεξήχθησαν στις 20 Σεπτεμβρίου. Ήταν πρόωρες εκλογές που διενεργήθηκαν από την υπηρεσιακή κυβέρνηση Θάνου.\\nΟι εκλογές προκλήθηκαν από την παραίτηση της κυβέρνησης Τσίπρα στις 20 Αυγούστου, μετά από την αποστασιοποίηση μεγάλου αριθμού βουλευτών του ΣΥ.ΡΙΖ.Α. και τη ψήφιση νέας τριετούς δανειακής σύμβασης. Στις 21 Αυγούστου, η λεγόμενη αριστερή πλατφόρμα, σύστησε νέα κοινοβουλευτική ομάδα με την ονομασία Λαϊκή Ενότητα που αποτελούνταν από 25 βουλευτές.\\nΠρώτο κόμμα ήλθε ο Συνασπισμός Ριζοσπαστικής Αριστεράς με 35,46% και 145 έδρες, με δεύτερο κόμμα η Νέα Δημοκρατία με 28,10% και 75 έδρες, τρίτο κόμμα η Χρυσή Αυγή με 6,99% και 18 έδρες, τέταρτο κόμμα η Δημοκρατική Συμπαράταξη με 6,28% και 17 έδρες, πέμπτο κόμμα το Κομμουνιστικό Κόμμα Ελλάδας με 5,55% και 15 έδρες, έκτο κόμμα το Ποτάμι με 4,09% και 11 έδρες, έβδομο κόμμα οι Ανεξάρτητοι Έλληνες με 3,69% και 10 έδρες, όγδοο και τελευταίο κόμμα η Ένωση Κεντρώων με 3,44% και 9 έδρες. Η κατανομή των εδρών έγινε με το σύστημα της ενισχυμένης αναλογικής.\\nΗ αποχή άγγιξε το 43,4% των εγγεγραμμένων ψηφοφόρων."},{"page_url":"https://en.wikipedia.org/wiki/Nobunari_Oda","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Oda_inabauer_2008_NHK.jpg","page_title":"Nobunari Oda","context_page_description":"Nobunari Oda is a Japanese figure skater. He is the 2006 Four Continents champion, a four-time Grand Prix Final medalist, the 2005 World Junior champion and the 2008 Japanese national champion."},{"page_url":"https://nl.wikipedia.org/wiki/Perikles","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Perikles_altes_Museum.jpg","page_title":"Perikles","context_page_description":"Perikles was een prominent en invloedrijk staatsman, redenaar en generaal in Athene, van de phyle Akamantis en de deme Cholargos. Hij was de zoon van Xanthippos en Agariste. Via haar stamde hij af van de machtige familie van de Alkmaioniden. Hij leefde tijdens de bloeiperiode van zijn stad, de periode tussen de Perzische en Peloponnesische Oorlog.\\nPerikles had zo'n grote invloed op de Atheense samenleving dat Thoukydides, een contemporain historicus en zijn bewonderaar, hem \\"de eerste man in Athene\\" noemt. Perikles vormde de Delisch-Attische Zeebond om tot een \\"Atheens rijk\\" en leidde zijn landgenoten tijdens de eerste twee jaar van de Peloponnesische Oorlog. De periode waarin hij Athene leidde, ruwweg vanaf 461 tot 429 v.Chr., staat bekend als de \\"Eeuw van Perikles\\", hoewel deze periode kan teruggaan tot de Perzische Oorlogen of tot de eeuw voordien.\\nPerikles bevorderde de kunsten en literatuur. Dit was de voornaamste reden waarom Athene de reputatie heeft het culturele centrum van de oud-Griekse wereld te zijn. Hij begon een ambitieus project waarvoor de meeste van de overgebleven structuren op de Akropolis zijn gebouwd."},{"page_url":"https://simple.wikipedia.org/wiki/Pra%C3%A7a_Diogo_de_Vasconcelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Pracadasavassi1.jpg","page_title":"Praça Diogo de Vasconcelos","context_page_description":"The Praça Diogo de Vasconcelos is a public square in the area of Savassi, in Belo Horizonte, Brazil.\\nIt is located where the roads Cristóvão Colombo and Getúlio Vargas meet. Also near there are the streets Pernambuco and Antônio de Albuquerque. The square a lively meeting place for the people who live in Belo Horizonte. It is located in the center of Savassi, an important commercial neighborhood.\\nIts name honors the politician and historian Diogo de Vasconcelos. He was an early is considered the first historian of art in Brazil. Although its official name is Square Diogo de Vasconcelos, this name is not very widely used. The name Square Savassi comes from the Savassi Bakery. It was located at the corner of Rua Pernambuco and Cristóvão Colombo avenue. The original bakery could still be seen on the site until a coffee shop Arturo's replaced it.\\nThe square used to be surrounded by mostly boutiques, restaurants and snack bars, shops. Since 2006, however, mobile phone companies have set up shops there. The patrons of the traditional Café Três Corações came to protest against its closure at the site due to the opening of a store operator Claro."},{"page_url":"https://es.wikipedia.org/wiki/Hru%C5%A1ky","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Hru%C5%A1ky_%28B%C5%99eclav%29_CoA_CZ.jpg","page_title":"Hrušky","context_page_description":"Hrušky es una localidad del distrito de Břeclav en la región de Moravia Meridional, República Checa, con una población estimada a principio del año 2018 de 1575 habitantes.\\nSe encuentra ubicada al sur de la región, a poca distancia al sur de Brno, y cerca de la orilla del río Dyje —un afluente del río Morava que, a su vez, lo es del Danubio— y de la frontera con Austria.​"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Huck_and_jim_on_raft.jpg","page_title":"کلک","context_page_description":"کَلَک قایقی ابتدایی است به‌صورت سازه‌ای تخت که ترکیبی از مواد شناور مانند چوب و بشکه و محفظهٔ هوا است. کلک‌ها معمولاْ از به هم بستن چند قطعه چوب، نی یا الوار ساخته می‌شوند. گاه چند مَشک پر از هوا نیز به زیر آن می‌بندند.\\nکلک ساده‌ترین سازه شناور است و سابقاً تنها به صورت بدون بدنه وجود داشت. در ساخت کلک‌های نوین از بلوک‌های پلی‌استیرن نیز بهره می‌گیرند و این کلک‌ها دارای دیواره نیز ممکن است باشند."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%B3%D8%AA%D8%AC%D9%8A%D8%AA%D9%88%D9%86_%D8%B3%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/St_James_Westgate_4.jpg","page_title":"وستجيتون سي","context_page_description":"وستجيتون-سي ‏ هي مدينة ساحلية وأبرشية مدنية في شمال شرق كنت، في إنجلترا، ويبلغ عدد سكانها 6996 نسمة في تعداد 2011. تقع داخل منطقة الحكومة المحلية Thanet وعلى حدود منتجع Margate الساحلي الأكبر. ظل شاطئيها الرمليان من المعالم السياحية الشهيرة منذ تطوير المدينة في ستينيات القرن التاسع عشر من مجتمع زراعي صغير.\\nتشتهر المدينة بكونها موقعًا لقاعدة طائرات مائية تابعة للخدمة الجوية البحرية الملكية في خليج سانت ميلدريد، والتي دافعت عن المدن الساحلية لمصب نهر التايمز خلال الحرب العالمية الأولى. البلدة هي موضوع قصيدة السير جون بيتجمان \\"وستجيتون سي\\". ومن بين السكان جراح القرن التاسع عشر السير إيراسموس ويلسون ورئيس أساقفة كانتربري ويليام تمبل السابق. رسم الفنان السير ويليام كويلر أوركاردسون العديد من أشهر صوره أثناء إقامته في وستجيتون سي. التحق الملحن البريطاني أرنولد كوك بمدرسة Streete الإعدادية في البلدة في أوائل القرن العشرين، وقضى مدير مدرسة إيتون أنتوني تشينيفيكس ترينش السنوات القليلة الأولى من تعليمه في المدينة."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Saint-Sauveur-de-Carrouges","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Map_commune_FR_insee_code_61453.png","page_title":"Saint-Sauveur-de-Carrouges","context_page_description":"Saint-Sauveur-de-Carrouges sī ūi-tī Hoat-kok Basse-Normandie toā-khu Orne koān ê chi̍t ê commune."},{"page_url":"https://no.wikipedia.org/wiki/Arkeologi%C3%A5ret_1734","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Carl_Ludvig_von_Schantz_x_Arvid_Karlsteen.jpg","page_title":"Arkeologiåret 1734","context_page_description":"Arkeologiåret 1734 er en oversikt over blant annet utgravninger, fødte og avdøde personer med tilknytning til arkeologi i 1734."},{"page_url":"https://nl.wikipedia.org/wiki/Kv%C3%A4num","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Kv%C3%A4num_-_Vara_municipality_-_Sweden_02.jpg","page_title":"Kvänum","context_page_description":"Kvänum is een plaats in de gemeente Vara in het landschap Västergötland en de provincie Västra Götalands län in Zweden. De plaats heeft 1238 inwoners en een oppervlakte van 156 hectare."},{"page_url":"https://de.wikipedia.org/wiki/Xatar/Diskografie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Xatar_-_Nr_415_-_Cover.jpg","page_title":"Xatar/Diskografie","context_page_description":"Diese Diskografie ist eine Übersicht über die musikalischen Werke des Deutschrappers Xatar. Die erfolgreichste Veröffentlichung von Xatar ist die Single Ich liebe es mit über 200.000 verkauften Einheiten."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B5%D1%98%D0%B4%D0%B8_%D0%93%D0%B0%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Lady_Gaga_%26_Tony_Bennett_%2817358336861%29.jpg","page_title":"Лејди Гага","context_page_description":"Стефани Џоен Анџелина Џерманота, професионално позната као Лејди Гага, америчка је певачица, текстописац и глумица. Позната је по својој неуобичајености, провокативном раду и визуелним експериментима. Са наступима је почела као тинејџерка, певајући по разним локалима и глумећи у школским представама. Студирала је на Факултету уметности Универзитета у Њујорку али је прекинула студије како би се посветила музичкој каријери. Након што је издавачка кућа Деф Џем Рикордингс отказала потписивање уговора са њом, радила је као текстописац за Сони где јој је Ејкон помогао да постигне договор са Интерскоуп Рекордсом и његовом кућом Конлајв Дистрибјушн 2007. Као уметница дошла је до већег изражаја следеће године након што је објавила свој дебитантски електро-поп албум, „The Fame“, на ком су се нашли хит синглови „Just Dance“ и „Poker Face“. Наредни албум, „The Fame Monster“, са сингловима „Bad Romance“, „Telephone“ и „Alejandro“, такође је био успешан.\\nНа свом другом студијском албуму, „Born This Way“, Гага је експериментисала са електро-поп и техно-поп жанровима."},{"page_url":"https://fr.wikipedia.org/wiki/Henri_IV_du_Palatinat","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Heinrich_Pfalzgraf_bei_Rhein.jpg","page_title":"Henri IV du Palatinat","context_page_description":"Henri de Brunswick dit « le Beau » en allemand: der Schöne était un comte palatin du Rhin sous le nom d’Henri IV du 6 août 1195 à 1214."},{"page_url":"https://en.wikipedia.org/wiki/Caesar_(Mercury_Theatre)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Caesar-Gabel-Welles.jpg","page_title":"Caesar (Mercury Theatre)","context_page_description":"Caesar is the title of Orson Welles's innovative 1937 adaptation of William Shakespeare's Julius Caesar, a modern-dress bare-stage production that evoked comparison to contemporary Fascist Italy and Nazi Germany. Considered Welles's highest achievement in the theatre, it premiered November 11, 1937, as the first production of the Mercury Theatre, an independent repertory theatre company that presented an acclaimed series of productions on Broadway through 1941."},{"page_url":"https://es.wikipedia.org/wiki/Panorama_urbano_de_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Vista_de_Madrid_desde_Somosaguas_01.jpg","page_title":"Panorama urbano de Madrid","context_page_description":"El panorama urbano de Madrid queda definido por sus rascacielos y torres, visibles desde todos los lados del núcleo urbano.\\nPese a su menor altura y su emplazamiento en pleno centro, estos monumentos pueden ser contemplados desde la cara oeste de la villa, gracias a que están situados sobre un promontorio, junto con tres rascacielos erigidos en el siglo XX, dentro del casco viejo.\\nFuera del centro histórico, el horizonte madrileño queda configurado por el complejo Cuatro Torres Business Area, situado en la parte septentrional de la ciudad, y el centro financiero y comercial AZCA. El primero impone en el horizonte altitudes que van desde los 230 m m de la Torre Espacio hasta los 250 m de la Torre Bankia. En el segundo, sobresalen la Torre Picasso, la Torre Europa y la Torre del BBVA.\\nA ellos se añaden, por la singularidad de su silueta, las dos torres inclinadas de la Puerta de Europa y la torre de comunicaciones Torrespaña."},{"page_url":"https://ast.wikipedia.org/wiki/La_Valeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/MaltaImmagine448.jpg","page_title":"La Valeta","context_page_description":"La Valeta ye la capital de Malta, asitiada sobre una península na parte centro-oriental de la islla de Malta. La ciudá puramente dicha cuenta con una población de 7.650 habitantes, escluyendo la área metropolitana axacente. Tamién ye unu de los sesenta y ocho conseyos locales que conformen el país dende 1993.\\nLa Valeta tien edificios que daten a partir del sieglu XVI construyíos mientres la dómina de los Caballeros Hospitalarios. La Valeta carauterizar por tener construcciones Arquiteutura del Barrocu barroques, con elementos de l'arquiteutura del Renacimientu, la Neoclásica y arquiteutura Moderna en zones determinaes; una y bones la Segunda Guerra Mundial dexó repulgos na ciudá. Foi oficialmente reconocida como un Patrimoniu de la Humanidá pola Unesco en 1980."},{"page_url":"https://it.wikipedia.org/wiki/Giulio_Gabrielli_il_Vecchio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Coa_fam_ITA_gabrielli.jpg","page_title":"Giulio Gabrielli il Vecchio","context_page_description":"Giulio Gabrielli è stato un cardinale e vescovo cattolico italiano."},{"page_url":"https://en.wikipedia.org/wiki/Ptuj","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Ptuj_Castle_Ouroboros_27102006_01.jpg","page_title":"Ptuj","context_page_description":"Ptuj is a town in northeastern Slovenia that is the seat of the Municipality of Ptuj. Ptuj, the oldest recorded city in Slovenia, has been inhabited since the late Stone Age and developed from a Roman military fort. Ptuj was located at a strategically important crossing of the Drava River, along a prehistoric trade route between the Baltic Sea and the Adriatic. Traditionally the area was part of the Styria region and became part of the Austria-Hungarian Empire. In the early 20th century the majority of the residents were ethnic Germans, but today the population is largely Slovene. Residents of Ptuj are known as Ptujčani in Slovene."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Dijon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Ch%C3%A2teau_de_Dijon_004.JPG","page_title":"Château de Dijon","context_page_description":"Le château royal de Dijon est un ancien château fort du XVᵉ siècle dont il ne reste rien, situé à l'emplacement de l'actuelle place Grangier, au centre ville de Dijon, ancienne capitale du duché de Bourgogne / État bourguignon."},{"page_url":"https://nl.wikipedia.org/wiki/Roy_Acuff","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Roy_Acuff_1950.JPG","page_title":"Roy Acuff","context_page_description":"Roy Claxton Acuff was een Amerikaanse country zanger. Hij werd geboren in Maynardville, Tennessee, als derde van vijf kinderen."},{"page_url":"https://es.wikipedia.org/wiki/Aniba_perutilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Aniba_perutilis.jpg","page_title":"Aniba perutilis","context_page_description":"El comino crespo, ​ comino real, ​ laurel comino, ​ medio comino, ​ chachajo, ​ o punte​ ​ es una especie botánica de fanerógama en la familia de las lauráceas endémica de Colombia; donde ha sido encontrada entre el nivel del mar y los 2400 m de altitud en diversos departamentos.​ Es una planta maderable, motivo por el cual se encuentra amenazada. Su madera es finísima, resistente al comején;​ de hecho, en latín, perutilis significa muy útil."},{"page_url":"https://ca.wikipedia.org/wiki/Bani%C3%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Chinese_Banyan%2C_1971-2007.jpg","page_title":"Banià","context_page_description":"Un banià, de vegades escrit amb la grafia anglesa, \\"banyan\\", és un tipus d'arbre del gènere Ficus."},{"page_url":"https://pl.wikipedia.org/wiki/Wybory_prezydenckie_w_Stanach_Zjednoczonych_w_1904_roku","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/AltonBParker.png","page_title":"Wybory prezydenckie w Stanach Zjednoczonych w 1904 roku","context_page_description":"Wybory prezydenckie w Stanach Zjednoczonych w 1904 roku – trzydzieste wybory prezydenckie w historii Stanów Zjednoczonych. Na urząd prezydenta wybrano Theodore’a Roosevelta, a wiceprezydentem został Charles Warren Fairbanks."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_mondiale_de_la_France","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Annette_Wieviorka_par_Claude_Truong-Ngoc.JPG","page_title":"Histoire mondiale de la France","context_page_description":"L’Histoire mondiale de la France est un ouvrage dirigé par Patrick Boucheron et paru en 2017 aux éditions du Seuil. Il propose une vision originale de l'histoire de France en la reliant à celle du monde à travers 146 dates correspondant à autant d'événements. Cette démarche associe donc une approche chronologique propre à séduire le grand public et une exigence scientifique au plus près des renouvellements historiographiques contemporains. Patrick Boucheron a pu mener à bien cette entreprise éditoriale grâce à 122 collaborateurs, Nicolas Delalande, Florian Mazel, Yann Potin et Pierre Singaravélou en assurant la coordination.\\nLa parution de l'ouvrage s'inscrit également dans un contexte où l'histoire de France constitue un enjeu politique. En se présentant comme une réponse au « roman national », l'Histoire mondiale de la France s'oppose au point de vue de plusieurs candidats à l'élection présidentielle, ce qui lui vaut des critiques sur son caractère partisan et une polémique avec l'historien Pierre Nora. L'accueil de la presse est très positif dans l'ensemble, et le livre devient rapidement un succès de librairie."},{"page_url":"https://en.wikipedia.org/wiki/Richard_K._A._Kletting","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Albert_E._Fisher_Mansion.JPG","page_title":"Richard K. A. Kletting","context_page_description":"Richard Karl August Kletting was an influential architect in Utah. He designed many well-known buildings, including the Utah State Capitol, the Enos Wall Mansion, the original Salt Palace, and the original Saltair Resort Pavilion. His design for the Utah State Capitol was chosen over 40 competing designs. A number of his buildings survive and are listed on the U.S. National Register of Historic Places including many in University of Utah Circle and in the Salt Lake City Warehouse District."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%B4%E6%99%AF%E6%BF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%E5%90%B3%E6%99%AF%E6%BF%82%E8%AD%B0%E5%93%A1.jpg","page_title":"吴景濂","context_page_description":"吴景濂，字莲伯，濂伯，号述唐，别号晦庐，晚年署抱冰老人，辽宁宁远人，民国初年四次出任国会议长。"},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%DB%8C%D8%B1%D9%B9%DA%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Shaheed_Smarak_Meerut-2.jpg","page_title":"میرٹھ","context_page_description":"میرٹھ بھارت کی ریاست اتر پردیش کا ایک تاریخی شہر ہے۔"},{"page_url":"https://la.wikipedia.org/wiki/%C8%9Aicleni","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Ticleni_jud_Gorj.png","page_title":"Țicleni","context_page_description":"Țicleni est Romaniae oppidum 4 414 incolarum et pars circuli Gorj."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%99%D7%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Olympia_-_Temple_of_Hera_1.jpg","page_title":"אליס","context_page_description":"אֵליס, או איליס, היא יחידה אזורית וחבל ארץ היסטורי של יוון. אליס שייכת למחוז מערב יוון, וממוקמת בצפון-מערב חצי אי פלופונסוס, בין אכאיה בצפון-מזרח, ארקאדיה במזרח, מסיניאה בדרום והים היוני במערב ובצפון. גבולותיה של אליס העתיקה אינם חופפים במלואם לגבולות של היחידה האזורית המודרנית: חלק משטחה המסורתי נמצא בתחום היחידות האזוריות של אכאיה וארקאדיה, וחלקים שנמצאים תחת שיפוט אליס המודרנית, היוו חלק מארקאדיה ההיסטורית.\\nשטחה הכולל של אליס המודרנית עומד על 2,618 קמ\\"ר, ונכון לשנת 2011, אוכלוסייתה מונה 159,300 נפשות, מה שהופך אותה ליחידה האזורית השנייה בגודל אוכלוסייתה בחצי האי פלופונסוס. העיר הגדולה ביותר באליס היא פירגוס, שמהווה את בירתה המנהלתית.\\nאליס העתיקה התגבשה כיחידה מדינית בסוף המאה ה-8 לפנה\\"ס, שמרכזה היה בצפון הארץ, סביב נהר הפניאוס, אבל היא הייתה מאוכלסת כבר המאה ה-11 לפנה\\"ס. אף על פי שאליס מעולם לא השתוותה בהשפעתה המדינית או בכוחה הצבאי לשכנותיה החזקות יותר בחצי האי, כגון ספרטה, ארגוס, או הליגה האכאית, הייתה לה חשיבות ניכרת ביוון העתיקה, בשל מיקומה של אולימפיה בתחומיה: אולימפיה הייתה מתחם קדוש לכלל ההלנים, והמקום בו נערכו המשחקים האולימפיים העתיקים, אשר נוהלו על ידי האילאיים החל מסוף המאה ה-8 לפנה\\"ס."},{"page_url":"https://de.wikipedia.org/wiki/Triersches_Haus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/DD-Triersches-Haus1.jpg","page_title":"Triersches Haus","context_page_description":"Das Triersche Haus ist ein barockes Wohnhaus in der inneren Altstadt von Dresden, das 1695 für den Kurfürstlichen Bibliothekar, Hof- und Justizrat Johann Friedrich Trier errichtet wurde und 1791 um ein weiteres Stockwerk aufgestockt wurde. Besonders auffallend ist der Eckerker des Hauses an der Sporergasse Ecke Schössergasse.\\nAb 1939 wohnten hier jüdische Familien, daher der damalige Name „Judenhaus“.\\nDas Gebäude wurde 1945 beim Bombardement der Stadt zerstört und 2016 wieder errichtet."},{"page_url":"https://it.wikipedia.org/wiki/Alberto_I_di_Thurn_und_Taxis","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Wappen_von_Thurn_und_Taxis.jpg","page_title":"Alberto I di Thurn und Taxis","context_page_description":"Alberto Maria Giuseppe Massimiliano Lamoral, Principe di Thurn und Taxis, fu l'ottavo Principe di Thurn und Taxis e Capo del Casato Principesco di Thurn und Taxis dal 2 giugno 1885 fino alla sua morte il 22 gennaio 1952."},{"page_url":"https://es.wikipedia.org/wiki/Asambleas_de_Dios","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Sociedad_de_Damas.jpg","page_title":"Asambleas de Dios","context_page_description":"Las Asambleas de Dios son una denominación cristiana evangélica de diversos países, agrupadas en concilios o convenciones nacionales que conforman la organización pentecostal Fraternidad Mundial de las Asambleas de Dios.​\\nLas Asambleas de Dios conforman una de las organizaciones pentecostales más grandes del mundo. Según datos suministrados por la propia organización, en 2015 contaban con 67 992 330 miembros, ​ 365 157 iglesias, ​ 388 472 ministros​ y 2 474 institutos bíblicos​ en los que estudiaban 158 322 alumnos.​ Pertenecen a la asociación nacional de iglesias evangélicas de sus respectivos países o regiones y a la Fraternidad Mundial Pentecostal.​ Sin embargo, desaprueban el ecumenismo con organizaciones religiosas contrarias a su declaración de fe y no están afiliadas al Consejo Mundial de Iglesias.​\\nExisten otras organizaciones que usan el nombre \\"Asambleas de Dios\\" pero no pertenecen a la Fraternidad Mundial de las Asambleas de Dios; algunas utilizan los términos independientes o autónomas para diferenciarse de las iglesias de la fraternidad."},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%AE%CE%BC%CE%BF%CF%82_%CE%A0%CF%89%CE%B3%CF%89%CE%BD%CE%AF%CE%BF%CF%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Kinotita_Pogonianis.png","page_title":"Δήμος Πωγωνίου","context_page_description":"Ο Δήμος Πωγωνίου είναι δήμος της Περιφερειακής Ενότητας Ιωαννίνων της Περιφέρειας Ηπείρου, ο οποίος συστάθηκε το 2011 από τη συνένωση των προϋπαρχόντων δήμων Άνω Καλαμά, Άνω Πωγωνίου, Δελβινακίου, Καλπακίου και των κοινοτήτων Πωγωνιανής, Λάβδανης.\\nΑποτελείται από χωριά με μεγαλύτερο το Κεφαλόβρυσο, ενώ έδρα του είναι το Καλπάκι. Επίσης το Δελβινάκι, το οποίο διαθέτει πλουσιότατη ιστορία, έχει ορισθεί ως ιστορική έδρα του δήμου.\\nΣυνορεύει βορείως με το Δήμο Κόνιτσας και Αλβανία, δυτικά με το Δήμο Ζαγορίου. νοτίως με το Δήμο Ζίτσας και ανατολικά με το Δήμο Φιλιατών και την Αλβανία.\\nΟ Δήμος Πωγωνίου διαιρείται σε 5 Δημοτικές Ενότητες οι οποίες αντιστοιχούν στους πέντε καταργηθέντες Δήμους. Κάθε δημοτική ενότητα αποτελείται από κοινότητες οι οποίες αντιστοιχούν στα Δημοτικά Διαμερίσματα των κατηργηθέντων Δήμων.\\nΟι Δημοτικές ενότητες, σύμφωνα με την υπ. αριθμ. 45892 απόφαση του ΥΠ.ΕΣ.ΔΔΑ, καθώς και οι Τοπικές Κοινότητες αυτών φαίνονται στον πίνακα που ακολουθεί:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D1%81%D1%8F%D1%82%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%D0%A1%D0%B8%D0%BD%D0%B0%D0%B3%D0%BE%D0%B3%D0%B0_%D0%B2_%D0%93%D1%83%D1%81%D1%8F%D1%82%D0%B8%D0%BD%D1%96_%281910%29.jpg","page_title":"Гусятин","context_page_description":"Гуся́тин — селище міського типу Тернопільської області, адміністративний центр Гусятинського району.\\nНаселення — 7,7 тис. осіб.\\nРозташований на автошляху Т 2002. Автошляхом Т 2011 сполучений з автошляхом М19.\\nДо містечка приєднаний хутір Кринички, який тепер є житловим районом.\\nВід вересня 2015 року — центр Гусятинської селищної громади"},{"page_url":"https://ru.wikipedia.org/wiki/NGC_6123","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/NGC6123_-_SDSS_DR14.jpg","page_title":"NGC 6123","context_page_description":"NGC 6123 — галактика в созвездии Дракон.\\nЭтот объект входит в число перечисленных в оригинальной редакции «Нового общего каталога»."},{"page_url":"https://es.wikipedia.org/wiki/Israel_Electric_Corporation","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Migdal_hevrat_hashmal.jpg","page_title":"Israel Electric Corporation","context_page_description":"Israel Electric Corporation es el principal proveedor de energía eléctrica en Israel. IEC construye, mantiene y opera estaciones generadoras de energía, subestaciones, así como las redes de transporte y distribución.\\nLa compañía es la única empresa eléctrica integrada en el Estado de Israel y genera, transmite y distribuye prácticamente toda la electricidad utilizada en dicho Estado que, a su vez, posee aproximadamente el 99,85% de la compañía. En la última década la empresa invirtió más de US$ 9 mil millones en el desarrollo del sector de la electricidad en Israel. En 2012 la compañía contaba con aproximadamente 12.500 empleados y prestó servicio a 2,5 millones de hogares.\\nEl actual CEO de la empresa es Eli Glickman."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Hoorn_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Hoorn%2C_Kleine_Oost_37.jpg","page_title":"Lijst van rijksmonumenten in Hoorn (plaats)","context_page_description":"De stad Hoorn telt 369 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht.\\nEen groot aantal monumenten bevindt zich aan of bij de Grote Oost, deze zijn afgesplitst naar de lijst van rijksmonumenten aan het Grote Oost.\\nBij de overige straten bevinden zich de volgende rijksmonumenten:"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%BD%D0%B8_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%B8_%D1%82%D0%B8%D0%BF_%E2%80%9E%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B8%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/RedOakVictory-2013-07-20.jpg","page_title":"Транспортни кораби тип „Виктори“","context_page_description":"Виктори са тип транспортни кораби на САЩ от времето на Втората световна война, построени в голяма серия за подсигуряване на масовите военни превози.\\nСнабдяването на операциите на ВМС се сблъсква с определени трудности – съдовете от типа „Либърти“ развиват максимална скорост от 11 възела и не могат да пътуват заедно с бързите военни кораби, без да бавят цялата ескадра. Решение на този проблем са транспортите тип „Виктори“.\\nОт 531 съда на проекта, построени по време на войната, загиват само пет: Fort Bellingham и Fort St. Nicholas са потопени от подводница, трите останали: загиват от атаки на камикадзе през април 1945 г."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Mu%C8%99eni%C8%9Ba,_Suceava","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/ROU_SV_Musenita_CoA.png","page_title":"Comuna Mușenița, Suceava","context_page_description":"Mușenița este o comună în județul Suceava, Bucovina, România, formată din satele Baineț, Băncești, Climăuți, Mușenița, Vășcăuți și Vicșani."},{"page_url":"https://sk.wikipedia.org/wiki/Meylan","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Map_commune_FR_insee_code_38229.png","page_title":"Meylan","context_page_description":"Meylan je francúzska obec, ktorá sa nachádza v departemente Isère, v regióne Rhône-Alpes."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%95%E0%B2%B0%E0%B3%8D%E0%B2%A8%E0%B2%BE%E0%B2%9F%E0%B2%95_%E0%B2%B8%E0%B2%BE%E0%B2%B9%E0%B2%BF%E0%B2%A4%E0%B3%8D%E0%B2%AF_%E0%B2%85%E0%B2%95%E0%B2%BE%E0%B2%A1%E0%B3%86%E0%B2%AE%E0%B2%BF_%E0%B2%AA%E0%B3%8D%E0%B2%B0%E0%B2%B6%E0%B2%B8%E0%B3%8D%E0%B2%A4%E0%B2%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Jayant_Kaikini_02.jpg","page_title":"ಕರ್ನಾಟಕ ಸಾಹಿತ್ಯ ಅಕಾಡೆಮಿ ಪ್ರಶಸ್ತಿ","context_page_description":"ಕರ್ನಾಟಕ ಸಾಹಿತ್ಯ ಅಕಾಡೆಮಿ ಪ್ರಶಸ್ತಿ ಕರ್ನಾಟಕ ಸಾಹಿತ್ಯ ಅಕಾಡೆಮಿಯಿಂದ ಕನ್ನಡದ ಸಾಹಿತ್ಯ ಕೃತಿಗಳಿಗೆ ನೀಡಲಾಗುವ ವಾರ್ಷಿಕ ಸಾಹಿತ್ಯ ಪ್ರಶಸ್ತಿ ಆಗಿದೆ. ಕನ್ನಡ ಸಾಹಿತ್ಯದ ಕವನ, ಕಾದಂಬರಿ, ಸಣ್ಣ ಕಥೆ, ವಿಮರ್ಶೆ, ಪ್ರವಾಸ ಬರವಣಿಗೆ, ಅನುವಾದ, ಮಕ್ಕಳ ಬರವಣಿಗೆ ಮುಂತಾದ ವಿವಿಧ ಪ್ರಕಾರಗಳಲ್ಲಿ ಪ್ರಕಟವಾದ ಪುಸ್ತಕಗಳಿಗೆ 1965ರಿಂದ ಈ ಪ್ರಶಸ್ತಿ ನೀಡಲಾಗುತ್ತಿದೆ."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B5%9C%EB%A3%A8%EC%A0%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Exploded_tear_gas_can_on_the_fly.jpg","page_title":"최루제","context_page_description":"최루제 또는 눈물 가스는 주로 눈을 따갑게 만들고 눈 주위에 통증을 일으키며 심지어는 일시적인 실명 현상을 일으키는 화합물이다. 보통은 단독으로 사용되지 않고 최루탄 같은 형태의 화학 무기로 쓰인다. 주로 시위 진압용으로 많이 사용된다.\\n최루 가스로는 클로로피크린이나 클로로아세토페논이라 하는 가스가 주로 쓰인다. 간혹 겨자 가스를 사용한다는 주장도 있으나, 겨자 가스는 눈이나 피부 등을 통해 인체에 흡수되어 인체에 큰 손상을 주기 때문에 전쟁 목적이 아닌 일반적인 사용 목적으로는 잘 사용되지 않는다. 대한민국에서는 최루탄을 거의 사용하지 않고 있는데, 이는 학생운동가 이한열 열사가 후두부에 최루탄을 가격당해 사망한 사건처럼 최루탄으로 인한 사망 사건이나 중경상을 입는 사건들이 많이 발생했기 때문이다.최루제 또는 눈물 가스는 주로 눈을 따갑게 만들고 눈 주위에 통증을 일으키며 심지어는 일시적인 실명 현상을 일으키는 화합물이다. 보통은 단독으로 사용되지 않고 최루탄 같은 형태의 화학 무기로 쓰인다. 주로 시위 진압용으로 많이 사용된다.\\n최루 가스로는 클로로피크린이나 클로로아세토페논이라 하는 가스가 주로 쓰인다. 간혹 겨자 가스를 사용한다는 주장도 있으나, 겨자 가스는 눈이나 피부 등을 통해 인체에 흡수되어 인체에 큰 손상을 주기 때문에 전쟁 목적이 아닌 일반적인 사용 목적으로는 잘 사용되지 않는다. 대한민국에서는 최루탄을 거의 사용하지 않고 있는데, 이는 학생운동가 이한열 열사가 후두부에 최루탄을 가격당해 사망한 사건처럼 최루탄으로 인한 사망 사건이나 중경상을 입는 사건들이 많이 발생했기 때문이다.\\n효과 편집\\n최루 \\"가스\\"는 가스가 아닌 에어로졸 화 된 고체 화합물로 구성된다.[1] 최루탄의 최루가스나 최루액이 눈이나 피부, 호흡기 등으로 들어가면 일시적으로 눈물과 콧물이 분비되며 접촉 부위에서 극심한 통증을 느끼게 된다. 간혹 구토 증상을 일으키며, 피부 알레르기를 일으키기도 하며 머리에 맞을 경우 중상을 입거나 심지어 사망에 이를 수 있다.\\n같이 보기 편집\\nCS 가스\\n이한열\\n각주 편집\\n↑ Achanta. “Tear gas: an epidemiological and mechanistic reassessment.”. 《Annals of the New York Academy of Sciences》.\\n외부 링크 편집"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Gervais-Saint-Protais_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/P1270292_Paris_IV_eglise_St-Gervais-St-Protais_Gisant_de_Michel_Le_Tellier_rwk.jpg","page_title":"Église Saint-Gervais-Saint-Protais de Paris","context_page_description":"L'église Saint-Gervais-Saint-Protais de Paris, généralement connue sous le nom d'église Saint-Gervais, est située sur la place Saint-Gervais, dans le quartier Saint-Gervais, auxquels elle donne leurs noms, dans le 4ᵉ arrondissement, à l'est de l'Hôtel de Ville.\\nDepuis 1975, les offices sont célébrés par les Fraternités monastiques de Jérusalem, qui rassemblent des moines et des moniales, qui vivent l'esprit de la solitude monastique au cœur des grandes villes."},{"page_url":"https://en.wikipedia.org/wiki/Damdin_S%C3%BCkhbaatar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Mongolian_Revolutionaries.jpg","page_title":"Damdin Sükhbaatar","context_page_description":"Damdin Sükhbaatar was a founding member of the Mongolian People's Party and leader of the Mongolian partisan army that took Khüree during the Outer Mongolian Revolution of 1921. For his part in the Outer Mongolian revolution of 1921, he was enshrined as the \\"Father of Mongolia's Revolution\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Choeroniscus_periosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Choeroniscus_periosus_map.png","page_title":"Choeroniscus periosus","context_page_description":"Choeroniscus periosus is een zoogdier uit de familie van de bladneusvleermuizen van de Nieuwe Wereld. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd door Handley in 1966."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Pulkau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Pulkau_Steinkreuze.jpg","page_title":"Liste der denkmalgeschützten Objekte in Pulkau","context_page_description":"Die Liste der denkmalgeschützten Objekte in Pulkau enthält die 67 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Gemeinde Pulkau."},{"page_url":"https://en.wikipedia.org/wiki/Central_Ohio_Transit_Authority","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/COTA_Transit_Terminal.jpg","page_title":"Central Ohio Transit Authority","context_page_description":"The Central Ohio Transit Authority is a public transit agency serving the Columbus metropolitan area, headquartered in Columbus, Ohio. It operates fixed-route buses, bus rapid transit, microtransit, and paratransit services.\\nCOTA's headquarters are located in the William J. Lhota Building in downtown Columbus. The agency is managed by President and CEO Joanna Pinkerton along with a 13-member board of trustees. COTA is funded by a permanent 0.25% sales tax as well as another 10-year 0.25% sales tax.\\nThe agency was founded in 1971, replacing the private Columbus Transit Company. Mass transit service in the city dates to 1863, progressively with horsecars, streetcars, and buses. The Central Ohio Transit Authority began operating in 1974, and has made gradual improvements to its fleet and network. Its first bus network redesign took place in 2017. The 2010s have also seen noted service improvements, with the addition of the CBUS free downtown circulator in 2014, its AirConnect airport service in 2016, and the CMAX bus rapid transit service in 2018."},{"page_url":"https://fr.wikipedia.org/wiki/Luzenac_de_Moulis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Moulis_-_Pile_de_Luzenac_-_20150820_%281%29.jpg","page_title":"Luzenac de Moulis","context_page_description":"Luzenac de Moulis est un village français situé dans les Pyrénées sur la commune de Moulis en Ariège."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A5%A7%E8%B5%AB%E6%A3%AE%E5%B1%B1_(%E5%A5%A5%E5%9C%B0%E5%88%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Ochsenkopf%28Silvretta%29.jpg","page_title":"奧赫森山 (奥地利)","context_page_description":"奥赫森山，是奥地利的山峰，位于该国南部，处于蒂罗尔州和福拉尔贝格州接壤的边界，属于锡尔夫雷塔阿尔卑斯山脉的一部分，海拔高度3,057米，每年平均降雨量1,367毫米，人类在1896年9月9日首次登顶。"},{"page_url":"https://it.wikipedia.org/wiki/%C5%BDiga_Dimec","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/20160813_Basketball_%C3%96BV_Vier-Nationen-Turnier_2650.jpg","page_title":"Žiga Dimec","context_page_description":"Žiga Dimec è un cestista sloveno."},{"page_url":"https://en.wikipedia.org/wiki/L%C3%A9on_Meyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/L%C3%A9on_Meyer-1924.jpg","page_title":"Léon Meyer","context_page_description":"Léon Meyer was a French freight broker and Radical politician from the port city of Le Havre.\\nHe was mayor of Le Havre from 1919 to 1941, and a national deputy from 1923 to 1941.\\nHe was Minister of Merchant Marine in 1932–33.\\nAs a Jew he was removed from office during World War II, and in 1944 was deported and spent 17 months in concentration camps."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A1%D0%B0%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Saar-hitler-1947.jpg","page_title":"История почты и почтовых марок Саара","context_page_description":"История почты и почтовых марок Саара соответствует периодам, когда Саар последовательно находился в XX веке под управлением Лиги Наций, Франции и Германии. Всего для этой территории было выпущено 443 почтовые марки, два блока и 38 служебных марок."},{"page_url":"https://de.wikipedia.org/wiki/F%C4%93nix","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Nachbildung_von_%22Excalibur%22_als_Teil_der_Thematisierung.jpg","page_title":"Fēnix","context_page_description":"Fēnix im Freizeitpark Toverland ist eine Stahlachterbahn vom Typ Wing Coaster des Herstellers Bolliger & Mabillard.\\nMit 40 Metern Höhe und 813 Metern Streckenlänge handelt es sich um den längsten Wing Coaster in Europa, es ist zudem der erste Wing Coaster in den Niederlanden. Die Bahn eröffnete offiziell am 7. Juli 2018, nachdem es am 6. Juli 2018 schon eine Voraböffnung für die Presse sowie geladene Gäste und Achterbahnfans gab.\\nFēnix gehört zum Themenbereich Avalon, welcher an die Sage von Merlin und König Artus angelehnt ist. Zusammen mit dem Themenbereich Port Laguna ist die Anlage Teil der bisher größten Erweiterung in der Geschichte des Toverlands. Auf sie entfiel mit 13 Millionen Euro ein großer Teil der 35 Millionen Euro Investitionssumme."},{"page_url":"https://nl.wikipedia.org/wiki/Meer_van_Misurina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Pista_di_pattinaggio_a_Misurina_%28Cortina_1956%29.jpg","page_title":"Meer van Misurina","context_page_description":"Het Meer van Misurina is een meer in de Italiaanse provincie Belluno aan de voet van de berggroep Cadini di Misurina. Het is het grootste natuurlijke meer van de streek Cadore. De waterspiegel van het meer ligt 1754 meter boven zeeniveau.\\nLangs de zuidwestelijke oever ligt het plaatsje Misurina dat beschikt over een tiental hotels die samen zo'n 500 gasten kunnen herbergen. Gedurende de zomer wordt er in het meer gezwommen en kan er gewaterfietst worden. In de winter vriest het oppervlak geheel dicht en wordt hierop geschaatst. Tijdens de Olympische Winterspelen van 1956 werden de schaatswedstrijden op dit meer gehouden.\\nHet meer en zijn omgeving staan bekend om hun gezonde lucht. Nabij het meer bevindt zich dan ook het enige Italiaanse astmacentrum."},{"page_url":"https://de.wikipedia.org/wiki/Windkraftanlage","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Windturbine_HamburgWasser_Steinwerder_02.jpg","page_title":"Windkraftanlage","context_page_description":"Eine Windkraftanlage oder Windenergieanlage wandelt die Energie des Windes in elektrische Energie, um sie dann in ein Stromnetz einzuspeisen. Umgangssprachlich werden auch die Bezeichnungen Windkraftwerk oder Windrad oder auch Windkraftkonverter verwendet. Windkraftanlagen sind heute mit Abstand die wichtigste Form der Nutzung der Windenergie. Die mit großem Abstand dominierende Bauform ist der dreiblättrige Auftriebsläufer mit horizontaler Achse und Rotor auf der Luvseite, dessen Maschinenhaus auf einem Turm montiert ist und der Windrichtung aktiv nachgeführt wird. Eine Reihe weiterer Konstruktionsformen, insbesondere mit anderer Bauweise des Rotors, haben sich bisher nicht durchgesetzt.\\nWindkraftanlagen können in allen Klimazonen genutzt werden. Sie werden an Land und in Offshore-Windparks im Küstenvorfeld der Meere installiert. Heutige Anlagen werden fast ausschließlich mit Netzanschluss betrieben und weisen durch Einspeisung über Leistungselektronik im Gegensatz zu älteren Anlagen mit direkt netzgekoppeltem Asynchrongenerator eine sehr gute Netzverträglichkeit auf."},{"page_url":"https://ca.wikipedia.org/wiki/Gaiet%C3%A0_Bu%C3%AFgas_i_Monrav%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Sitges._Old_market_%281890%29._Gaiet%C3%A0_Buigas%2C_architect_%2815704246102%29.jpg","page_title":"Gaietà Buïgas i Monravà","context_page_description":"Gaietà Buïgas i Monravà fou un arquitecte català i cap de l'Exposició Universal de Barcelona de 1888.\\nÉs conegut per ser l'autor del monument a Colom de Barcelona i va ser pare de l'enginyer Carles Buïgas i Sans, que va dissenyar i construir la Font màgica de Montjuïc. El seu cosí, l'arquitecte modernista Joaquim Raspall, va decidir estudiar arquitectura influït per Buïgas."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDelezni%C4%8Dn%C3%AD_tra%C5%A5_D%C4%9B%C4%8D%C3%ADn%E2%80%93Rumburk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Zast%C3%A1vka_%C4%8CD_Kytlice_2018_%283%29.jpg","page_title":"Železniční trať Děčín–Rumburk","context_page_description":"Železniční trať Děčín–Rumburk je jednokolejná železniční trať. Vede z Děčína do Rumburku přes Benešov nad Ploučnicí, Českou Kamenici, Jedlovou, Rybniště a Krásnou Lípu. Trať byla zprovozněna v roce 1869. Trať prochází Libereckým a Ústeckým krajem.\\nÚsek Benešov nad Ploučnicí – Jedlová je s účinností od 7. 4. 2014 kategorizován jako regionální dráha, ostatní úseky jsou nadále částmi celostátní dráhy."},{"page_url":"https://sk.wikipedia.org/wiki/%C4%8Ealekozrakos%C5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Hypermetropia.png","page_title":"Ďalekozrakosť","context_page_description":"Ďalekozrakosť je chyba oka, pri ktorej sa lúče svetla usmernené očnou šošovkou zbiehajú až za sietnicou, preto na sietnici nevzniká ostrý obraz. Oko minimálne odchýlky dokáže čiastočne kompenzovať akomodáciou šošovky.\\nTakto postihnutý človek zle vidí blízke predmety, naopak celkom dobre vidí predmety vzdialené. Chyba sa dá napraviť použitím spojnej šošovky. Opakom ďalekozrakosti je krátkozrakosť. Chyba sa dá riešiť aj operáciou."},{"page_url":"https://de.wikipedia.org/wiki/1er_r%C3%A9giment_de_parachutistes_d%E2%80%99infanterie_de_marine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Heckler_Koch_MP5.jpg","page_title":"1er régiment de parachutistes d’infanterie de marine","context_page_description":"Das 1ᵉʳ régiment de parachutistes d’infanterie de marine ist ein Fallschirmjäger, Spezialeinheit-Verband in Regimentsstärke des französischen Heeres, dessen Namen aus Traditionsgründen für den Überseeeinsatz in den ehemaligen französischen Kolonien die Bezeichnung de marine angefügt ist.\\nDas Hauptquartier des 1ᵉʳ RPIMa befindet sich in der Citadelle Général Bergé in Bayonne, Département Pyrénées-Atlantiques in der Region Nouvelle-Aquitaine. Der Kommandant des Regiments steht im Rang eines Colonel.\\nDas Motto lautet: Qui ose gagne. Es geht auf die Gründungszeit des Regiments im Zweiten Weltkrieg zurück, als es als Teil der Freifranzösischen Streitkräfte dem britischen SAS unterstand. Das heutige Regiment wurde aus dem 2ᵉ régiment de chasseurs parachutistes und dem 3ᵉ régiment de chasseurs parachutistes der SAS gebildet."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%AB%E0%B1%88%E0%B0%95%E0%B0%B8%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ficus_ilicina.jpg","page_title":"ఫైకస్","context_page_description":"ఫైకస్ పుష్పించే మొక్కలలో మోరేసి కుటుంబానికి చెందిన ప్రజాతి.\\nఇందులో సుమారు 850 జాతుల వృక్షాలు ఉష్ణమండలమంతటా విస్తరించాయి."},{"page_url":"https://pl.wikipedia.org/wiki/Krywiatycze","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Krywiatycze_gm._Orla.JPG","page_title":"Krywiatycze","context_page_description":"Krywiatycze – wieś w Polsce położona w województwie podlaskim, w powiecie bielskim, w gminie Orla.\\nWedług Pierwszego Powszechnego Powszechnego Spisu Ludności, przeprowadzonego w 1921 r., wieś liczyła 142 mieszkańców zamieszkałych w 26 domach. Wszyscy ówcześni mieszkańcy miejscowości zadeklarowali białoruską przynależność narodową oraz wyznanie prawosławne.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa białostockiego."},{"page_url":"https://en.wikipedia.org/wiki/Acad%C3%A9mie_Royale_des_Beaux-Arts","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Rik_Wouters_-_Portretbuste_van_James_Ensor_10-03-2009_16-00-33.JPG","page_title":"Académie Royale des Beaux-Arts","context_page_description":"The Académie Royale des Beaux-Arts - École supérieure des Arts de la Ville de Bruxelles, in Dutch Koninklijke Academie voor Schone Kunsten van Brussel, is the Belgian art school, established in Brussels in the Kingdom of Belgium. It was founded in 1711. At the beginning housed in a single room in the city hall, in 1876 the school moved to a former convent and orphanage in the Rue du Midi, rehabilitated by the architect Pierre-Victor Jamaer, where the school still operates."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E7%B6%AD%E6%96%B0%E6%94%BF%E5%BA%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Wen_Zongyao.JPG","page_title":"中華民國維新政府","context_page_description":"中華民國維新政府，為大日本帝國於抗日戰爭期間成立的傀儡政權，由梁鴻志等人於1938年3月28日成立於南京。管轄蘇、浙、皖三省的日佔區和京、滬兩個特別市。其主要支持力量為日軍的華中方面軍。\\n維新政府以梁鴻志為行政院長兼交通部長，溫宗堯為立法院長，陳群為內政部長，陳籙為外交部長，陳錦濤為財政部長，王子惠為實業部長，陳則民為教育部長，任援道為綏靖部長，胡礽泰為司法部長。閣僚多為過去在北洋政府身居要職卻在國民政府遭受冷遇的政客。中華民國維新政府存在的意義除了以華制華與分割中國之外，最大的問題是在於日軍華北方面軍與華中方面軍的利益衝突。\\n1939年6月10日，被日軍占領的南京城發生了一起刺殺案。在日本領事館當天舉行的宴會上，由於領事館的中國籍僕人詹長麟在酒裡下毒，參加宴會的維新政府要員全部中毒受傷，另兩名日本書記官當場斃命。\\n日本政府方面的立場是維新政府仍為一地方政權、應儘早與作為中央政府的華北臨時政府合併。汪精衛的國民政府成立後，維新政府於1940年3月30日與華北臨時政府一同併入汪精衛的國民政府。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%B0%D1%80%D0%BC%D0%BE%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%BA%D0%B5%D1%81%D1%82%D1%80_%D0%91%D1%80%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Filharmonie_Brno.jpg","page_title":"Филармонический оркестр Брно","context_page_description":"Филармонический оркестр Брно — чешский симфонический оркестр, базирующийся в Брно. В нынешнем виде сформирован в 1956 г. путём слияния двух городских симфонических коллективов. Уже в том же году оркестр отправился на свои первые гастроли для участия в музыкальном фестивале «Варшавская осень». История оркестра тесно связана с именем Леоша Яначека — центральной фигуры в музыкальной истории города; его произведения составляют важную часть репертуара, те или иные из них неоднократно были записаны оркестром, в том числе с такими приглашёнными дирижёрам, как Чарльз Маккерас.\\nСреди дирижёров и солистов, в разное время выступавших вместе с оркестром, — Карел Анчерл, Ефим Бронфман, Вильгельм Кемпф, Гидон Кремер, Курт Мазур, Иегуди Менухин, Святослав Рихтер и др."},{"page_url":"https://it.wikipedia.org/wiki/Economia_di_Ariccia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Ariccia_-_panorama_di_Vallericcia_dall%27Appia_antica.JPG","page_title":"Economia di Ariccia","context_page_description":"L'agricoltura è stata dall'antichità fino alla metà del Novecento la principale risorsa economica del territorio ariccino. I porri di Aricia erano già ricordati da Lucio Giunio Moderato Columella, mentre i cavoli di Vallericcia furono lodati da Gaio Plinio Secondo. Molto diffusa nella stessa Vallericcia era già nel Seicento la coltivazione delle cipolle, che gareggiavano in bontà con quelle di Nemi, poiché fatte crescere in zone paludose della valle tramite allagamento, come si usava ancora alla fine del Settecento nella valle alluvionale del Lago di Nemi.\\nEra praticata a Vallericcia la coltivazione della canapa, rimpiazzata tra Seicento e Settecento dalla più redditizia coltivazione del lino: lo storico ariccino Emanuele Lucidi riferisce che nel 1792 venivano coltivate ogni anno venti rubbia di terreno -circa 36 ettari moderni, considerando il valoro di un rubbio romano a 1.848438 ettari-, e che ogni rubbio rendeva circa 68 scudi al principe Agostino Chigi. La coltivazione del lino, che si svolgeva tra la semina nel mese di marzo e la raccolta a luglio, faceva accorrere ad Ariccia anche braccianti dai vicini comuni castellani, contribuendo non poco all'occupazione dell'area."},{"page_url":"https://sv.wikipedia.org/wiki/Molossus_rufus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bats_of_the_genus_Carollia_in_Belize.jpg","page_title":"Molossus rufus","context_page_description":"Molossus rufus är en fladdermusart som beskrevs av E. Geoffroy 1805. Molossus rufus ingår i släktet Molossus och familjen veckläppade fladdermöss. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Bal_maiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Earthworks_in_a_valley_-_geograph.org.uk_-_222343.jpg","page_title":"Bal maiden","context_page_description":"A bal maiden, from the Cornish language bal, a mine, and the English \\"maiden\\", a young or unmarried woman, was a female manual labourer working in the mining industries of Cornwall and western Devon, at the south-western extremity of Great Britain. The term has been in use since at least the early 18th century. At least 55,000 women and girls worked as bal maidens, and the actual number is likely to have been much higher.\\nWhile women worked in coal mines elsewhere in Britain, either on the surface or underground, bal maidens worked only on the surface. It is likely that Cornish women had worked in metal mining since antiquity, but the first records of female mine workers date from the 13th century. After the Black Death in the 14th century, mining declined, and no records of female workers have been found from then until the late 17th century. Industrial improvements, the end of Crown control of metal mines, and rising demand for raw materials caused a boom in Cornish mining in the late 17th and early 18th centuries. Increasing numbers of women and girls were recruited to the mines from about 1720, processing ore sent up by the male miners underground."},{"page_url":"https://vi.wikipedia.org/wiki/Qu%E1%BA%A7n_%C4%91%E1%BA%A3o_Tiwi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Tiwi_Islands.png","page_title":"Quần đảo Tiwi","context_page_description":"Quần đảo Tiwi là một phần của Lãnh thổ Bắc Úc, Úc, cách thủ phủ Darwin 80 km về phía bắc, tại ranh giới biển Arafura và biển Timor. Quần đảo gồm đảo Melville, Đảo Bathurst, và chín đảo không người nhỏ hơn, với tổng diện tích 8.320 kilômét vuông.\\nCó khoảng 3.000 người tại quần đảo, đa số là thổ dân Tiwi, những người đã sống tại đây từ lâu.\\nHội đồng Đất Tiwi là một trong bốn hội đồng đất đai tại Lãnh thổ Bắc Úc. Nó là một cơ quan đại diện với quyền hành luật theo Đạo luật quyền đất đai thổ dân 1976 và có trách nhiệm theo Đạo luật quyền sở hữu người bản địa 1993 và Đạo luật đất nuôi trồng 1992."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%DA%A9%D9%88%D9%84%D8%B2_%D8%A7%D9%86%D9%B9%D8%B1%D9%86%DB%8C%D8%B4%D9%86%D9%84_%D8%A7%DB%8C%D8%A6%D8%B1%D9%BE%D9%88%D8%B1%D9%B9_%D8%A7%DB%8C%D9%B9_%DA%AF%DB%8C%D9%84%D9%88%DB%8C%D8%B3%D9%B9%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Scholes_International_Airport_at_Galveston_-_Texas.jpg","page_title":"سکولز انٹرنیشنل ایئرپورٹ ایٹ گیلویسٹن","context_page_description":"سکولز انٹرنیشنل ایئرپورٹ ایٹ گیلویسٹن ریاستہائے متحدہ امریکا کا ایک ہوائی اڈا جو ٹیکساس میں واقع ہے۔"},{"page_url":"https://hu.wikipedia.org/wiki/Zenet%C3%B6rt%C3%A9net","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Satie-erik-4ff9d0bde1749.jpg","page_title":"Zenetörténet","context_page_description":"A zenetörténet a zene múltjával foglalkozó tudományág, amely a zenetudománynak, és egyúttal a történettudománynak is egy ága. A zenetörténet hagyományosan az európai egyházi és világi komolyzene történetével foglalkozik. A vele párhuzamosan létező népzene, a 20. században kialakult dzsessz, popzene és filmzene történetét nem szokták tárgyalni a kézikönyvek. Az Európán kívüli világ egyes kultúrájában is kialakultak az európai komolyzenéhez hasonló szabályozott zenefajták, így bizonyos értelemben lehet beszélni Európán kívüli műzenéről. Utóbbiakat általában nem szokták tárgyalni a zenetörténeti kézikönyvek, és – gyakorlatukat követve – ez a szócikk sem.\\nAz európai klasszikus zenében a magyar zeneszerzők közül elsősorban három személy: a nagyrészt külföldön működő Liszt Ferenc, Bartók Béla, és Kodály Zoltán tett szert nagyobb hírnévre. Ettől függetlenül azonban a magyar klasszikus zenének is hosszú története, nevezetes alkotói vannak, akikkel részletesebben a Magyar klasszikus zene szócikk foglalkozik."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BB%D0%BB%D0%B0_%D0%A0%D0%BE%D1%82%D0%BE%D0%BD%D0%B4%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/VillaCapra_2007_07_18_8.jpg","page_title":"Вілла Ротонда","context_page_description":"Вілла Ротонда — заміська споруда архітектора Палладіо, що вважається зразком вілли в стилі класицизм чи його різновиду — палладіанства."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9B%D1%96%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Diagramma_di_Venn_dei_numeri-ru.svg","page_title":"Лік","context_page_description":"Лік — базавае паняцце матэматыкі, якое характарызуе колькасць; адна з асноўных матэматычных абстракцый, звязаная з выражэннем колькаснай характарыстыкі прадметаў.\\nУ матэматыцы разглядаюць наступныя мноствы лікаў:\\nнатуральныя лікі\\nцэлыя лікі\\nрацыянальныя лікі\\nрэчаісныя лікі\\nНабор правіл, што дазваляюць запісаць лікі з дапамогаю знакаў, называюць сістэмай злічэння. У матэматыцы ўжываецца дзесятковая сістэма злічэння, якая на сёння пануе і ў бытавой сферы."},{"page_url":"https://hu.wikipedia.org/wiki/Nick_Zano","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Nick_Zano_2015_TCA_%28cropped%29.jpg","page_title":"Nick Zano","context_page_description":"Nick Zano amerikai színész."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%98%B8%EB%93%9C%EB%A6%AC%EA%B5%AC_%EC%86%8C%EC%9A%B0%EC%9E%90_%EC%8B%9C%EC%9A%B0%EB%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/RodrigoSouzavsFujairah.JPG","page_title":"호드리구 소우자 시우바","context_page_description":"호드리구 소우자 시우바는 짧게는 호드리구 라고 불리며, 브라질의 축구 선수이자 동티모르 대표팀에서 활약하고 있다. 포지션은 공격형 미드필더이다. 2017년 K리그 클래식의 대구 FC에서 활약한 바 있으며, 등록명은 호드리고이었다."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC_%D0%92%D0%BE%D1%98%D1%81%D0%BA%D0%B5_%D1%83_%D0%9D%D0%B8%D1%88%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/ZIS-3_Dom_vojske_Ni%C5%A1.jpg","page_title":"Дом Војске у Нишу","context_page_description":"Дом Војске у Нишу као установа у саставу Војске Србије, једна је од културних институциај у овом граду која својим активностима више од шест деценија значајно доприноси развоју и ширењу културе, образовања, забаве и креативности, како међу војницима тако и међу становницима Ниша и целог простора Југоисточне Србије."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%98%D7%95%D7%A0%D7%99%D7%95_%D7%A7%D7%95%D7%98%D7%95%D7%A0%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Antonio-Cotogni-1889.jpg","page_title":"אנטוניו קוטוני","context_page_description":"אנטוניו קוטוני היה זמר בריטון איטלקי, מגדולי הבריטונים של המאה ה-19. ורדי רחש לו הערכה רבה."},{"page_url":"https://en.wikipedia.org/wiki/China_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/China_Airlines_Inflight_Magazines_-_Dynasty%2BFantasy_Sky%2BSky_Boutique.jpg","page_title":"China Airlines","context_page_description":"China Airlines is the state-owned national carrier of the Republic of China, and one of its two major airlines along with EVA Air. It is headquartered in Taipei Taoyuan International Airport and operates over 1400 flights weekly to 102 cities across Asia, Europe, North America, and Oceania. Carrying over 19 million passengers and 5700 tons of cargo in 2017, the carrier was the 33rd largest airline in the world in terms of revenue passenger kilometers and 10th largest in terms of freight revenue ton kilometers.\\nChina Airlines is owned by Taiwan-based China Airlines Group and operates the China Airlines Cargo, a member of SkyTeam Cargo, which operates a fleet of freighter aircraft and manages its parent airline's cargo-hold capacity. Its sister airlines include Mandarin Airlines which operates flights to domestic and low-demand regional destinations, and Tigerair Taiwan which is a low-cost carrier established by China Airlines and Singaporean airline group Tigerair Holdings but is now wholly owned by China Airlines Group. The company slogan is Journey with a caring smile."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Indian_state_flowers","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Acidanthera.jpg","page_title":"List of Indian state flowers","context_page_description":"India, officially the Republic of India is a country in South Asia. It is made up of 28 states and 8 union territories. All Indian states have their own government and Union territories come under the jurisdiction of the Central Government. As most of the other countries India too has a national emblem—the Lion Capital of Sarnath.\\nApar flowers etc. A list of state flowers of India is given below. See Symbols of Indian states and territories for a complete list of all State characters and seals."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%85%D0%B0%D1%80%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D1%81%D0%B5%D0%B2%D0%BE%D0%BB%D0%BE%D0%B4_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/e/e1/Vaharlovsky_VN.jpg","page_title":"Вахарловский, Всеволод Николаевич","context_page_description":"Всеволод Николаевич Вахарловский — русский военачальник, генерал-лейтенант."},{"page_url":"https://en.wikipedia.org/wiki/Timna_Valley","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Timna_1.jpg","page_title":"Timna Valley","context_page_description":"The Timna Valley is located in southern Israel in the southwestern Arava/Arabah, approximately 30 kilometres north of the Gulf of Aqaba and the city of Eilat. The area is rich in copper ore and has been mined since the 5th millennium BCE. There is controversy whether the mines were active during the biblical united Kingdom of Israel and its second ruler, King Solomon.\\nA large section of the valley, containing ancient remnants of copper mining and ancient worship, is encompassed in a recreation park.\\nIn July 2011, the Israeli government approved the construction of an international airport, the Ramon Airport, in the Timna Valley."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_slott_och_herrg%C3%A5rdar_i_S%C3%B6dermanland","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/L%C3%B6vsta_g%C3%A5rd.jpg","page_title":"Lista över slott och herrgårdar i Södermanland","context_page_description":"Lista över slott och herrgårdar i Södermanland.\\nListan visar ett urval av de viktigaste slotten och herrgårdarna och redovisar även numera försvunna egendomar. Listan bygger huvudsakligen på Historiskt-geografiskt och statistiskt lexikon öfver Sverige i 7 band, Stockholm 1856–1870 och Carl Martin Rosenbergs Geografiskt-statistiskt handlexikon öfver Sverige, Stockholm 1882–1883 samt Slott och herresäten i Sverige, Allhems förlag, Malmö, 1966–1971."},{"page_url":"https://en.wikipedia.org/wiki/Tai_O","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Tai_O_Pier_and_Old_Police_Station.JPG","page_title":"Tai O","context_page_description":"Tai O is a fishing town, partly located on an island of the same name, on the western side of Lantau Island in Hong Kong. The village names means large inlet, referring to outlet for the waterways merges as it moves through Tai O."},{"page_url":"https://ms.wikipedia.org/wiki/Adam_Larsen_Kwarasey","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/PORTLAND_TIMBERS_VS._SPORTING_KC_2_-_2_%288%29.jpg","page_title":"Adam Larsen Kwarasey","context_page_description":"Adambathia Larsen Kwarasey merupakan pemain bola sepak profesional Ghana yang bermain untuk kelab MLS, Portland Timbers sebagai penjaga gol.\\nKwarasey dilahirkan di Norway tetapi memilih untuk mewakili negara bapanya, Ghana di peringkat antarabangsa."},{"page_url":"https://vi.wikipedia.org/wiki/Eugene_Wigner","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Wigner.jpg","page_title":"Eugene Wigner","context_page_description":"Eugene Paul Wigner là một nhà vật lý và nhà toán học người Hungary.\\nÔng nhận giải Nobel về vật lý vào năm 1963 \\"cho những đóng góp của ông vào lý thuyết hạt nhân và các hạt cơ bản, đặc biệt là thông qua sự khám phá và áp dụng các nguyên lý đối xứng cơ sở\\". Một số người đương thời cho Wigner là một thiên tài im lặng và một số người khác còn cho rằng ông có thể sánh ngang cùng với Albert Einstein, mặc dù là không nổi tiếng bằng. Wigner đã đặt những nền tảng quan trọng cho lý thuyết về sự đối xứng trong cơ học lượng tử cũng như các nghiên cứu của ông về hạt nhân nguyên tử, và một vài định lý khác mang tên ông."},{"page_url":"https://gl.wikipedia.org/wiki/Pittsburgh_Penguins","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/The_Mario_Mosaic.jpg","page_title":"Pittsburgh Penguins","context_page_description":"Os Pittsburgh Penguins son un equipo profesional de hóckey sobre xeo da cidade de Pittsburgh, Pennsylvania. Os Pinguins compiten na máxima competición de hóckey sobre xeo en América do Norte, a National Hockey League, estando encadrados na Metropolitan Division da Conferencia Leste. Dende o 2010 o equipo xoga os seus partidos como local no Consol Energy Center, logo de ter xogado a maior parte da súa historia no Mellon Arena. O equipo gañou a Stanley Cup en catro ocasións, a última delas en 2016, ademais de gañar unha vez o Presidents' Trophy, cinco o Prince of Wales Trophy e finalizar oito veces como campión da súa división.\\nOs Penguins creáronse en 1967 como equipo de expansión, tomando parte na NHL na tempada 1967-68 xunto con outros cinco novos equipos: Minnesota North Stars, Los Angeles Kings, California Seals, Philadelphia Flyers e St. Louis Blues. Dende a súa primeira tempada, os Penguins teñen disputado cinco veces a final da Stanley Cup, conseguindo o campionato en tres desas ocasión."},{"page_url":"https://hu.wikipedia.org/wiki/Debrecen_trolibuszvonal-h%C3%A1l%C3%B3zata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Debrecen_K%C3%B6ztemet%C5%91_Ziu-9_troli_323.jpg","page_title":"Debrecen trolibuszvonal-hálózata","context_page_description":"A debreceni trolibuszhálózat három trolibuszvonalból áll. Összesen öt troliviszonylat létezik, ezek mindegyikének a Segner tér a végállomása. Működése 1985. július 2-án kezdődött a mai 5-ös viszonylat vonalán, a Segner tér és az MGM között. A hálózat fokozatosan fejlődött, 1987-ben a 3-as, majd 1995-ben a 4A vonal indult el. Napjainkban, főleg hétvégente gazdasági okokból az összes trolivonalon trolipótló autóbuszok közlekednek."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BA%D0%B0%D1%84%D0%BE%D1%80%D1%82%D1%8D-%D0%9C%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/RoccaforteMondovi_2010.jpg","page_title":"Ракафортэ-Мандові","context_page_description":"Рокафортэ-Мандові — камуна ў Італіі, размяшчаецца ў рэгіёне П'емонт, падпарадкоўваецца адміністрацыйнаму цэнтру Кунеа.\\nНасельніцтва складае 2132 чалавек, шчыльнасць насельніцтва складае 25 чал./км². Займае плошчу 84 км². Паштовы індэкс — 12088. Тэлефонны код — 0174.\\nЗаступнікам населенага пункта лічыцца святы San Maurizio martire."},{"page_url":"https://es.wikipedia.org/wiki/Weiding_(Schwandorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Weiding_in_SAD.svg","page_title":"Weiding (Schwandorf)","context_page_description":"Weiding es un municipio situado en el distrito de Schwandorf, en el estado federado de Baviera, con una población a finales de 2016 de unos 474 habitantes.​\\nSe encuentra ubicado al este del estado, en la región de Alto Palatinado, cerca de la orilla del río Naab —un afluente izquierdo del Danubio— y de la frontera con República Checa."},{"page_url":"https://nl.wikipedia.org/wiki/Universiteit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Divinity_School_Interior_2%2C_Bodleian_Library%2C_Oxford%2C_UK_-_Diliff.jpg","page_title":"Universiteit","context_page_description":"Een universiteit is een onderwijsinstelling in het hoger onderwijs die ingericht is om wetenschappelijk onderwijs te bieden en wetenschappelijk onderzoek te verrichten. Zij verzorgt academische opleidingen en verleent academische graden."},{"page_url":"https://en.wikipedia.org/wiki/Austroponera_castaneicolor","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Pachycondyla_castaneicolor_casent0172339_profile_1.jpg","page_title":"Austroponera castaneicolor","context_page_description":"Austroponera castaneicolor is an ant species of the subfamily Ponerinae, endemic to the North Island, and the north and north west of the South Island, of New Zealand."},{"page_url":"https://de.wikipedia.org/wiki/Christoph_Harting","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/20150726_1412_DM_Leichtathletik_M%C3%A4nner_Diskuswurf_0582.jpg","page_title":"Christoph Harting","context_page_description":"Christoph Harting ist ein deutscher Diskuswerfer und wurde in dieser Disziplin im Jahr 2016 Olympiasieger. Er ist 2,07 m groß und hat ein Wettkampfgewicht von 120 kg."},{"page_url":"https://pl.wikipedia.org/wiki/Cyfrowe_przetwarzanie_obraz%C3%B3w_binarnych","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Erozja_przyklad.png","page_title":"Cyfrowe przetwarzanie obrazów binarnych","context_page_description":"Cyfrowe przetwarzanie obrazów binarnych, przetwarzanie binarnych obrazów cyfrowych – dziedzina przetwarzania obrazów cyfrowych zajmująca się komputerowymi algorytmami obróbki obrazów binarnych."},{"page_url":"https://fr.wikipedia.org/wiki/Bayerische_Oberlandbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Bayerische_Oberlandbahn_Triebwagen_VT_106_%28Integral%29.JPG","page_title":"Bayerische Oberlandbahn","context_page_description":"La compagnie du Bayerische Oberlandbahn GmbH est une entreprise ferroviaire allemande basée à Holzkirchen, Allemagne et exploitée par la société privée Transdev GmbH, filiale du groupe français Transdev.\\nLe réseau s'étend depuis la gare centrale de Munich et relie les villages alpins de Bayrischzell, de Lenggries et la ville thermale de Tegernsee. Les lignes ne sont pas électrifiées et sont parcourues par des automoteurs à moteur diesel.\\nLa compagnie exploite également, depuis décembre 2013 et sous le nom commercial Meridian, plusieurs lignes de train de banlieue de la Deutsche Bahn dans les régions de Munich, de Rosenheim et de la vallée de la Mangfall."},{"page_url":"https://fi.wikipedia.org/wiki/Indonesia_AirAsian_lento_8501","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Crest_Onyx_with_the_tail_of_Air_Asia_Flight_QZ8501_on_its_stern.jpg","page_title":"Indonesia AirAsian lento 8501","context_page_description":"Indonesia AirAsian lento 8501 oli Indonesia AirAsian lento, joka putosi mereen matkalla Indonesian Surabayasta Singaporeen 28. joulukuuta 2014. Lennolla oli 155 matkustajaa ja seitsemän miehistön jäsentä."},{"page_url":"https://es.wikipedia.org/wiki/Hans_Christian_%C3%98rsted","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Hans_Christian_%C3%98rsted_daguerreotype.jpg","page_title":"Hans Christian Ørsted","context_page_description":"Hans Christian Ørsted fue un físico y químico danés, conocido por haber descubierto de forma experimental la relación física entre la electricidad y el magnetismo, y por aislar el aluminio.\\nInfluido por el pensamiento alemán de Immanuel Kant y también de la filosofía de la Naturaleza, fue un gran estudioso del electromagnetismo. En 1813 ya predijo la existencia de los fenómenos electromagnéticos, que no demostró hasta 1820, inspirando los desarrollos posteriores de André-Marie Ampère y Faraday, cuando observó que una aguja imantada colocada en dirección paralela a un conductor eléctrico se desviaba cuando se hacía circular una corriente eléctrica por el conductor, demostrando así la existencia de un campo magnético en torno a todo conductor atravesado por una corriente eléctrica, e iniciándose de ese modo el estudio del electromagnetismo. Este descubrimiento fue crucial en el desarrollo de la electricidad, ya que puso en evidencia la relación existente entre la electricidad y el magnetismo. Oersted es la unidad de medida de la reluctancia magnética."},{"page_url":"https://eo.wikipedia.org/wiki/Belfort","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/France-90-Belfort-Cathedrale_Saint_Christophe-Facade.jpg","page_title":"Belfort","context_page_description":"Belfort [belfor] estas mezgranda franca komunumo lokita en la departemento Territoire-de-Belfort kaj en la regiono Franĉ-Konteo. Ĝi estas la prefektejo kaj la plej granda urbo de la departemento.\\nLa loĝantojn de Belfort oni kutime nomigas la Belfortains."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B0_%D0%B4%D0%B8_%D0%91%D0%B0%D1%80%D1%82%D0%BE%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/19_Andrea_di_Bartolo._Polyptych._c._1425_Duomo%2C_Tuscania.jpg","page_title":"Андреа ди Бартоло","context_page_description":"Андреа ди Бартоло е италиански художник, представител на Cиенската школа."},{"page_url":"https://pt.wikipedia.org/wiki/Robi_Draco_Rosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/DracoRosa3.jpg","page_title":"Robi Draco Rosa","context_page_description":"Robert Edward Rosa Suárez, ou simplesmente Draco Rosa, é um cantor, ex-integrante do grupo Menudo. Apesar de ter nascido em Estados Unidos, se considera portoriquenho, devido à origem de seus pais, e para onde se mudou ainda criança, o que ajudou a reforçar suas raízes latinas."},{"page_url":"https://hu.wikipedia.org/wiki/Boszra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/016_Bosra_ruins.JPG","page_title":"Boszra","context_page_description":"Boszra.\\nŐsi város Daraa kormányzóság közigazgatási területéhez tartozik a mai Szíria déli részén. Régészeti és UNESCO világörökségi helyszín."},{"page_url":"https://it.wikipedia.org/wiki/Vrbanja_(fiume)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Most_kod_Incela_preko_rijeke_Vrbanje.jpg","page_title":"Vrbanja (fiume)","context_page_description":"Il Vrbanja è un fiume della Bosnia ed Erzegovina centrale. Vrbanja e Ugar a riposo il più grande affluente di destra del Vrbas.\\nSi stima che il discarico annuale media alla foce è 16,8 m³, e la capacità totale di energia degli attuali 310,9 GWh all'anno."},{"page_url":"https://eu.wikipedia.org/wiki/Alexander_Meissner","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Alexander_Meissner_plaque.jpg","page_title":"Alexander Meissner","context_page_description":"Alexander Meissner austriar fisikari eta ingeniaria izan zen. Irratitekniaren alorrean aritu zen lanean. Hari gabeko komunikazio-teknika hobetu zuen, eta piezoelektrizitatea aztertu zuen. 1931n, maiztasun handiko osziladore-mota bat aurkitu zuen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%B3%E3%83%91%E3%82%A4%E3%82%A2%E3%83%BB%E3%82%B9%E3%83%86%E3%83%BC%E3%83%88%E3%83%BB%E3%83%93%E3%83%AB%E3%83%87%E3%82%A3%E3%83%B3%E3%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/EmpireStateBldg.jpg","page_title":"エンパイア・ステート・ビルディング","context_page_description":"エンパイア・ステート・ビルディングは、アメリカ合衆国ニューヨーク州ニューヨーク市マンハッタン区にある超高層ビル。\\n「エンパイア・ステート」はニューヨーク州の異名である。"},{"page_url":"https://vi.wikipedia.org/wiki/Bom_bay_V-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Fieseler-Fi-103-2.jpg","page_title":"Bom bay V-1","context_page_description":"Bom bay V-1 tiếng Đức: Vergeltungswaffe 1, số khung thân của RLM là Fieseler Fi 103 — còn gọi là Buzz Bomb hay Doodlebug — là một loại bom gắn động cơ phản lực xung, tiền thân của tên lửa hành trình ngày nay."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%BA%E5%88%A9%E6%80%BB%E7%BB%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/German_Riesco.jpg","page_title":"智利总统","context_page_description":"智利总统为智利国家元首兼政府首脑。拥有行政权。1993年通过的智利宪法修正案规定总统由普选产生，任期6年，不能连任，2006年后总统任期由6年缩短至4年，与国会任期相同。智利宪法不允许同一人“连续”担任两届总统，但对非连续的当选没有限制。"},{"page_url":"https://en.wikipedia.org/wiki/Forest_Capital_Museum_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Forest_Capital_Museum_SP_cracker01d.jpg","page_title":"Forest Capital Museum State Park","context_page_description":"Forest Capital State Museum is a 13-acre Florida State Park located 1-mile south of Perry on US 19/US 98. The museum contains displays that recount the history of the forest industry as well as the wildlife of the forest. Adjacent to the museum is the Cracker Homestead built in 1864 that depicts life on a Florida homestead with a house, barn, well, arbor, and garden."},{"page_url":"https://nl.wikipedia.org/wiki/Edward_Zwick","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Edward_Zwick_by_Bridget_Laudien.jpg","page_title":"Edward Zwick","context_page_description":"Edward Zwick is een Amerikaanse regisseur, scenarioschrijver en producent van speelfilms. Zwick won in 1998, als producer een Academy Award en een BAFTA voor de film Shakespeare in Love. Verder ontving hij onder andere een Oscar nominatie en twee Golden Globe nominaties. Andere bekende films van Zwick zijn: The Last Samurai met Tom Cruise, Blood Diamond met onder andere Leonardo DiCaprio en het Tweede Wereldoorlog drama Defiance. Zwick zijn films zijn vaak groots en episch opgezet. Zijn specialiteit is de Historische avonturenfilm/oorlogsfilm."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%87%D5%B8%D6%82%D6%80%D5%AB%D5%B7%D5%AF%D5%A1%D6%80%D5%BD%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/%D0%A1%D0%B5%D0%BB%D0%BE_%D0%9E%D0%B2%D0%B3%D0%BE%D1%80%D1%82.JPG","page_title":"Շուրիշկարսկի շրջան","context_page_description":"Շուրիշկարսկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Յամալ-Նենեցյան ինքնավար օկրուգում։\\nՍտեղծվել է 1930 թվականին։ Վարչական կենտրոնը՝ Մուժի։"},{"page_url":"https://ja.wikipedia.org/wiki/BMW%E3%83%BBM1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Marc_Surer_drives_the_BMW_M1_Procar_-_1998_Goodwood_Festival_of_Speed_%2815598397840%29.jpg","page_title":"BMW・M1","context_page_description":"BMW・M1は、1970年代にモータースポーツでの活躍を期待したことに端を発する、ドイツの自動車メーカー、BMWのスーパーカーである。"},{"page_url":"https://id.wikipedia.org/wiki/Blazer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Blazer.JPG","page_title":"Blazer","context_page_description":"Blazer adalah sejenis jaket yang dipakai sebagai pakaian yang santai namun tetap cukup rapi. Sebuah blazer bentuknya menyerupai jas dengan potongan yang lebih santai. Bahan untuk membuat blazer biasanya tahan lama, karena merupakan jaket olahraga luar ruangan. Blazer juga sering dijadikan sebagai pakaian seragam, misalnya seragam untuk penerbangan, sekolah, dan klub olahraga."},{"page_url":"https://gl.wikipedia.org/wiki/Sopa_de_ni%C3%B1o_de_anduri%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Collocallia_esculenta_-_Meyers.jpg","page_title":"Sopa de niño de anduriña","context_page_description":"A sopa de niño de anduriña é unha sopa considerada como unha especialidade da gastronomía chinesa.\\nÉ un dos pratos máis caros do mundo, xa que está feita cos niños de aves de varias especies dos xéneros Aerodramus e Collocalia, da familia dos apódidos, subfamilia dos colocaliinos, que non son verdadeiras anduriñas, senón salanganas, que nidifican en grandes grupos en covas, polo que a súa colleita é difícil e perigosa.\\nOs niños están construídos case exclusivamente coa saliva destes paxaros, e teñen unha forma e un tamaño semellantes ao dunha orella humana."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D1%8B%D0%BA%D0%B0_%D0%AD%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Talsi%2C_Eeva.IMG_0042.JPG","page_title":"Музыка Эстонии","context_page_description":"Музыка Эстонии — музыка и танцы народов, населяющих Эстонию, в основном, эстонцев и сету. Тесно связана с карело-финской и балтийской музыкальными традициями.\\nЗначительную часть своей истории эстонская музыка была в подавляющем большинстве случаев любительской и бесписьменной, изучать её начали лишь в XVIII веке. Древний народный песенный жанр — лирическая руническая песня — сохранился на острове Кихну и у сету, в остальной Эстонии был вытеснен более современной рифмованной песней.\\nНародные музыкальные инструменты представлены преимущественно деревянными духовыми, струнными смычковыми и струнными щипковыми. Традиции игры на скрипке, гармони и каннеле непрерывно продолжались по крайней мере с XVIII века, некоторые старинные инструменты типа смычковой лиры и волынки были реконструированы и стали использоваться снова.\\nС конца XIX века в Эстонии проводится множество музыкальных фестивалей, хоровое пение во время акций протеста против нахождения Эстонии в составе СССР дало название «Поющей революции». Население независимой Эстонии продолжает активно интересоваться народной музыкой."},{"page_url":"https://en.wikipedia.org/wiki/MGWR_Class_A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/No._548_%2846272913442%29.jpg","page_title":"MGWR Class A","context_page_description":"The Midland Great Western Railway A Class, later Inchicore Class D5, consisted of 6 4-4-0 express passenger locomotives built at Broadstone Works in the period 1902-1905. The largest express passenger locomotive in Ireland for a short while after introduction they were used on the MGWR's flagship services to Galway with most surviving until the 1950s albeit on less prestigious work."},{"page_url":"https://es.wikipedia.org/wiki/Cid_Campeador_(Buenos_Aires)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Cid_Campeador_Buenos_Aires.jpg","page_title":"Cid Campeador (Buenos Aires)","context_page_description":"El monumento al Cid Campeador, dedicado a Rodrigo Díaz de Vivar, hidalgo y guerrero castellano del siglo XI, más conocido como el Cid Campeador, se encuentra en el barrio de Caballito de la Ciudad de Buenos Aires.\\nEn la imagen se observa a su caballo Babieca, que levanta una de sus patas delanteras. El Cid aparece levantando su brazo derecho, en el cual sostiene una lanza, mientras que en la cintura está su espada Tizona. La altura es de casi 12 metros hasta el extremo de la lanza, sobre un pedestal que no es el que existió originalmente, aunque todavía se desconoce cuál fue el motivo del cambio. El basamento sufrió cambios a lo largo de los años. Se pueden encontrar viejas fotografías con otro pedestal. Sin embargo, la majestuosidad que le otorga la altura lo distingue de sus otros emplazamientos como el de Nueva York o el de Sevilla.\\nEs uno de los puntos más característicos de esa zona de la ciudad. Se encuentra en la intersección de las avenidas Gaona, San Martín, Ángel Gallardo, Dr. Honorio Pueyrredón y Díaz Vélez. Se trata de un nudo de comunicaciones internas de la ciudad, en una zona de gran importancia comercial."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%A0%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Imus_Heritage_Park.jpg","page_title":"イムス","context_page_description":"イムス市はフィリピン共和国のルソン島のカラバルソン地方のカヴィテ州の州都である。2010年時点で人口は約30.2万人だった。 マニラ首都圏から19kmの位置に有る。フィリピン独立革命でスペインを相手にカティプナンが2回勝利した都市である。イムスの戦いは1896年9月3日、アラパンの戦いは1898年5月28日に行われた。この日にフィリピン国旗が初めて掲げられた事から、イムスは「フィリピン国旗の首都」と呼ばれる。イムスではどちらの日にも祭りが行われる。イムス歴史博物館では独立革命に関する展示をしている。イムスにはカヴィテ州を管轄するイムス司教区が有る。2009年11月20～27日、イムスでワールドユースデーが開催された。"},{"page_url":"https://en.wikipedia.org/wiki/Northeast,_Minneapolis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Ahennbridge.jpg","page_title":"Northeast, Minneapolis","context_page_description":"Northeast is a defined community in the U.S. city of Minneapolis, Minnesota, composed of 13 smaller neighborhoods whose street addresses end in \\"NE\\". Unofficially it also includes the neighborhoods of the University community which have \\"NE\\" addresses, and the entirety of the Old Saint Anthony business district, which sits on the dividing line of \\"NE\\" and \\"SE\\" addresses. In the wider community, this business district, which is the oldest settlement in the city, is often identified as the heart of Northeast, in part because it lies across the Mississippi River from Downtown Minneapolis. Northeast is sometimes referred to as \\"Nordeast\\", reflecting the history of northern and eastern European immigrants and their language influence.\\nThe modern community includes commercial districts stretching along the major corridors of University Avenue, Central Avenue, East Hennepin Avenue, Broadway Street, and Stinson and New Brighton Boulevards towards the city limits."},{"page_url":"https://fi.wikipedia.org/wiki/Big_Daddy_Kane","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Big_Daddy_Kane-03.jpg","page_title":"Big Daddy Kane","context_page_description":"Antonio Hardy, paremmin tunnettu taiteilijanimellään Big Daddy Kane, on yhdysvaltalainen rap-artisti ja näyttelijä, joka on kotoisin Bedford-Stuyvesantista Brooklynista New Yorkista. Hän aloitti uransa Juice Crew -rap-kollektiivissa. Häntä pidetään yhtenä taitavimmista ja vaikuttavimmista MC:istä."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27Aisne_(nord)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bucilly_%28Aisne%29_lieu-dit_l%27abbaye.JPG","page_title":"Liste des monuments historiques de l'Aisne (nord)","context_page_description":"Cet article recense les monuments historiques du nord de l'Aisne, en France.\\nDu fait du nombre de protections à Laon, la commune dispose d'une liste à part : voir la liste des monuments historiques de Laon"},{"page_url":"https://de.wikipedia.org/wiki/Zietsch_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Fotothek_df_rp-d_0150072_Krakau._Karte_des_Amtes_Gro%C3%9Fenhain%2C_von_Z%C3%BCrner%2C_1711%2C_Nachtr%C3%A4ge_1730_%28Sign.%2C_VII%29.jpg","page_title":"Zietsch (Sachsen)","context_page_description":"Zietsch ist eine Wüstung im Naturschutzgebiet „Königsbrücker Heide“ auf dem Gelände des früheren Truppenübungsplatzes Königsbrück in Sachsen."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A5%B5%E5%A4%A7%E6%9C%9B%E9%81%A0%E9%8F%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/OverWhelmingly_Large_Telescope.jpg","page_title":"極大望遠鏡","context_page_description":"极大望远镜是指天文台使用的直径大于20米的望远镜。当讨论反射望远镜的光波波长时，包括紫外线，可见光和近红外线的波长。在众多的规划中的性能中，极大望远镜预计将增加发现其他恒星周围的类地行星的机会。\\n对于其他波长的望远镜在物理上可以大得很多，例如，无线电波长的绿岸望远镜的光圈为100米。\\n这些望远镜有一定数量的特点和共同性，特别是都使用分割式的镜片组合成主镜，和使用高阶的自适应光学系统。\\n虽然极大望远镜的设计都很大，但是它们可以有比许多大型的光学干涉仪的孔径合成更加小的孔径。然而，它们可以收集更多的光，并且有其他的优点。"},{"page_url":"https://fr.wikipedia.org/wiki/Alexandre_II_d%27%C3%89pire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Coin_of_Alexander_II_of_Epirus.png","page_title":"Alexandre II d'Épire","context_page_description":"Alexandre II d'Épire, né vers 295 et mort vers 252/247 av. J.-C, est un roi d'Épire à partir de 272, quand il succède à son père, Pyrrhus Iᵉʳ, de la famille des Éacides."},{"page_url":"https://pt.wikipedia.org/wiki/Bras%C3%A3o_de_armas_do_Pr%C3%ADncipe_das_Ast%C3%BArias","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Coat_of_Arms_of_John_of_Aragon_and_Castile%2C_Prince_of_Asturias_and_Girona_%28with_crest%29.svg","page_title":"Brasão de armas do Príncipe das Astúrias","context_page_description":"O Brasão de armas da Princesa das Astúrias está descrito de acordo com o Real Decreto 979/2015, de 30 de outubro, que institui o brasão e o estandarte.\\nÉ composto por seis brasões:\\nO primeiro quarto, de Castela: uma torre de três torreões a dourado, aclarado a azul, com contorno negro;\\nO segundo quarto, de Leão: de fundo cor de prata, com um leão de coroa dourada, linguado e unhado;\\nO terceiro quarto, de Aragão: a dourado, com quatro listas vermelhas;\\nO quarto quarto, de Navarra: fundo vermelho, com correntes interligadas a dourado dispostas em cruz, a partir do centro, onde consta uma esmeralda;\\nNa base, de Granada: de fundo de prata, uma romã, com duas folhas a verde.\\nSobre tudo e ao centro, um escudo pequeno de azul com três flores de lis de ouro, bordadas de gules, representando os Bourbon.\\nNo topo, uma coroa fechada, que é um círculo em ouro, cravado de pedras preciosas, e é forrada a vermelho. Diferenciado, um lambel de azul de três pés, na parte superior do escudo. Todo o brasão é rodeado pelo Colar do Tosão de Ouro."},{"page_url":"https://no.wikipedia.org/wiki/%C3%81gnes_Sz%C3%A1vay","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/%C3%81gnes_Sz%C3%A1vay_2008_RG_8.jpg","page_title":"Ágnes Szávay","context_page_description":"Ágnes Szávay er en ungarsk tennisspiller. Hun representerte Ungarn under Sommer-OL 2008, der hun ble utslått i første runde."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%A0%EB%8B%A4%EC%9D%B4%EB%B0%94_%EB%B6%80%EC%9D%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Lady_Godiva_by_John_Collier.jpg","page_title":"고다이바 부인","context_page_description":"고다이바 부인은 고대 머시아 왕국의 백작부인이다. 전설에 의하면 레프릭 영주의 무리한 세금징수로 인해 백성들이 고통받자, 그의 부인인 고다이바는 세금을 감면해 줄 것을 간청하였다. 이에 영주는 부인에게 \\"벗은 몸으로 마을을 한 바퀴 돌면 생각해 보겠다\\"고 조롱하였다. 고심하던 고다이바는 영주의 제의를 받아들이기로 하였고, 이 소식을 듣게 된 마을 사람들은 부인이 마을을 돌 때 아무도 내다보지 않기로 하였다고 한다."},{"page_url":"https://vi.wikipedia.org/wiki/Mors","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/MorsHanklit.jpg","page_title":"Mors","context_page_description":"Mors hoặc Morsø là 1 đảo của Đan Mạch trong Limfjorden giữa Salling và Thy. Đảo có diện tích 363,3 km² với số dân 22.091. Thành phố lớn nhất của đảo là Nykøbing Mors, cũng là trụ sở của thị xã Morsø bao gồm đảo Mors, đảo Agerø và vài đảo nhỏ nữa."},{"page_url":"https://de.wikipedia.org/wiki/Muriel_Sarkany","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/2013-11-24_Muriel_Sarkany.jpg","page_title":"Muriel Sarkany","context_page_description":"Muriel Sarkany ist eine belgische Sportkletterin, die hauptsächlich in der Disziplin Lead erfolgreich ist. Sie ist mit insgesamt fünf Gesamtweltcuperfolgen eine der erfolgreichsten Wettkampfkletterinnen."},{"page_url":"https://fr.wikipedia.org/wiki/Toscane_d%27Auvergne","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Usson_%28Puy-de-D%C3%B4me%29_-_Village_-_JPG1.jpg","page_title":"Toscane d'Auvergne","context_page_description":"La Toscane d'Auvergne ou Toscane auvergnate est une micro-région naturelle et culturelle de France située en Auvergne."},{"page_url":"https://fr.wikipedia.org/wiki/T%C3%BAcume","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Huaca_Las_Balsas_-_Personaje_principal_sobre_balsa.jpg","page_title":"Túcume","context_page_description":"Túcume est un site archéologique situé à 33 km au nord de Chiclayo, dans la partie basse de la vallée de La Leche, au nord-ouest du Pérou. Il est formé par les restes de nombreuses pyramides ou huacas en adobe, autour d'une structure rocheuse connue sous le nom de Cerro La Raya.\\nC'était l'un des centres administratifs et cérémoniels de la culture sicán ou lambayeque, érigé au XIᵉ siècle de notre ère. Il fut annexé successivement au royaume Chimú et à l'empire Inca, et resta en activité jusqu'à la conquête espagnole."},{"page_url":"https://de.wikipedia.org/wiki/Echte_Blattwespen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Tenthredopsis_sordida_female.jpg","page_title":"Echte Blattwespen","context_page_description":"Die Echten Blattwespen bilden eine Familie der Pflanzenwespen innerhalb der Hautflügler. Sie werden auch als „Blattwespen“ bezeichnet, dies kann aber zu Verwechslungen führen, da es auch andere Blattwespenfamilien innerhalb der Pflanzenwespen gibt. Die Tiere kommen weltweit mit etwa 9000 Arten vor und sind damit die größte Familie der Pflanzenwespen. 1070 Arten und Unterarten leben auch in Europa, von ihnen kommen über 900 in Mitteleuropa vor. Sie sind überall auf der Welt häufig, nur in Australien sind nur drei Arten bekannt."},{"page_url":"https://tr.wikipedia.org/wiki/Vitre_emay%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Medallion_St_Demetrios_Louvre_OA6457.jpg","page_title":"Vitre emayı","context_page_description":"Vitre emayı veya porselen emayı, toz hale getirilmiş camı 750 and 850 °C arasında, genellikle bir substrat ile yakma işlemiyle eriterek yapılan bir malzemedir."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%BD%E0%B7%92%E0%B6%B1%E0%B6%9A%E0%B7%8A%E0%B7%83%E0%B7%8A_%E0%B6%9A%27%E0%B6%B1%E0%B6%BD%E0%B6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Linux_kernel_map.png","page_title":"ලිනක්ස් ක'නලය","context_page_description":"\\"ලිනක්ස් කර්නලය\\" යනු ලිනක්ස් පවුලේ Unix-like මෙහෙයුම් පද්ධති කර්නලයකි. එසේම එය නිදහස් හා විවෘත මූලාශ්‍ර මෘදුකාංග සඳහා ප්‍රමුඛ උදාහරණයකි.\\nඑය ජීඑන්යූ ජෙනරල් පබ්ලික් ලයිසෙන්ස් දෙවන සංස්කරණය යටතේ නිකුත් කර තිබෙන අතර ලොව වටා දහස් ගණනකගේ දායකත්වය ලැබ ඇත. ඒසේම ලිනක්ස් කර්නලය ලිනක්ස් කර්නල විද්යුත් තැපැල් ලැයිස්තුව හරහා එදිනෙදා සංවර්ධනයට බඳුන්වේ.\\nලිනක්ස් කර්නලයෙහි නිර්මාර්තෘ පින්ලන්ත ජාතික ලිනස් ටොර්වල්ඩ්ස් වන අතර ඒ 1991 දී ඔහුට ඇතිවූ අදහසක් අනුවය. ඔහුගේ කර්නලය සීඝ්‍රයෙන් අනිකුත් නිදහස් මෘදුකාංග ව්‍යාපෘති කේතකරුවන් සහ පරිශිලකයින් ආකර්ශනය කරගන්නා ලදි. මෙසේ ලොවපුරා දහස් ගණනකගේ දායකත්වය ලැබූ ලිනක්ස් කර්නලය පදනම් කර ගනිමින් අද වන විට බොහෝ ලිනක්ස් බෙදා හැරීම් නිකුත්වී ඇත."},{"page_url":"https://ca.wikipedia.org/wiki/Una_ment_meravellosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/RussellCroweOct05.jpg","page_title":"Una ment meravellosa","context_page_description":"Una ment meravellosa és una pel·lícula estatunidenca de Ron Howard, adaptació de la novel·la homònima, estrenada el 2001 i guanyadora de quatre oscars."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%83%D0%BB%D1%83%D1%87%D1%87%D0%B8,_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_%D0%9E%D1%81%D0%B8%D0%BF%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Filippo_Paulucci_monument_01.JPG","page_title":"Паулуччи, Филипп Осипович","context_page_description":"Филипп Осипович Паулуччи — маркиз, генерал русской и сардинской армий, дипломат, Лифляндский, Курляндский, Эстляндский и Псковский генерал-губернатор, губернатор Генуи."},{"page_url":"https://en.wikipedia.org/wiki/BRP_Diego_Silang_(PF-9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/USS_Bering_Strait_%28AVP-34%29.jpg","page_title":"BRP Diego Silang (PF-9)","context_page_description":"BRP Diego Silang (PF-9) was an Andrés Bonifacio-class frigate of the Philippine Navy in commission from 1976 to 1990. She and her three sister ships were the largest Philippine Navy ships of their time."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%91%A1%E8%90%84%E9%A3%8E%E4%BF%A1%E5%AD%90%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Muscari_racemosum.jpg","page_title":"葡萄风信子属","context_page_description":"葡萄风信子属又称蓝壶花属、串铃花属，是天门冬科的落叶草本植物，原产于欧亚大陆，花密集生长，玲壶形，多为蓝色，也有白色栽培种，花期为春季，开花时外形像一串串葡萄。\\n葡萄风信子属原产于旧大陆的地中海流域、欧洲中部和南部、北非、亚洲西部、中部和西南部。"},{"page_url":"https://ca.wikipedia.org/wiki/Sent_Marc%C3%A8l_e_Paul%C3%A8l","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Saint-Marcel-Paulel.jpg","page_title":"Sent Marcèl e Paulèl","context_page_description":"Sent Marcèl e Paulèl és un municipi del departament francès de l'Alta Garona, a la regió d'Occitània."},{"page_url":"https://ceb.wikipedia.org/wiki/Knemidokoptes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Knemidocoptes-mite.jpg","page_title":"Knemidokoptes","context_page_description":"Henero sa mga mananap nga kaka ang Knemidokoptes. Ang Knemidokoptes sakop sa kabanay nga Knemidokoptidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89tat_policier","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Drongpa%2C_Tibet_in_August_2007_with_Chinese_People%27s_Armed_Police_marching_through_town%2C_photo_by_Dieter_Schuh_%28cropped%29.JPG","page_title":"État policier","context_page_description":"Un État policier est un gouvernement qui exerce son pouvoir de manière autoritaire et arbitraire, par le biais des forces policières. Les habitants d'un État policier sont limités dans leur liberté d'expression et leur liberté de circulation, et peuvent faire l'objet de diverses coercitions, de tortures, être soumis à de la propagande, de la manipulation mentale, ou encore une surveillance de masse par un État, sous la menace de forces policières.\\nCette notion est théorisée par le juriste allemand Robert von Mohl, alors sans connotation négative. Pour le juriste français Raymond Carré de Malberg, la notion d'État policier est à considérer par opposition à l'État de droit. Les analyses plus récentes, tant de juristes que de sociologues, proposent de la considérer en termes de gradations, des réformes ou évolutions successives pouvant transformer un État de droit en État policier, d'où la notion d'« État policier émergent » appliquée à des pays à constitution démocratique. Toute réduction des libertés des citoyens, faisant l'objet d'une surveillance et d'une répression par des forces policières fonctionnant comme appareil d'État, est symptomatique d'un État policier."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Leiden,_straat_A-I","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Leiden_-_Levendaal_111_en_109_%28closeup%29.JPG","page_title":"Lijst van rijksmonumenten in Leiden, straat A-I","context_page_description":"De stad Leiden telt 1235 inschrijvingen in het rijksmonumentenregister. Hieronder alle 480 monumenten waarbij de straat begint met de letter A t/m I:"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%9D%BD%ED%83%84%ED%8B%B0%EC%9A%B0%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Auct._L_3.33_f3v.jpg","page_title":"락탄티우스","context_page_description":"루키우스 카이킬리우스 피르미아누스 락탄티우스는 초기 기독교의 신학자이자 저술가였으며 콘스탄티누스 1세의 초대 자문자였다. 락탄티우스는 북아프리카 베르베르 출신으로주로 로마제국 동방의 여러도시를 다니면서 수사학을 가르쳤다. 그는 주로 그리스 이교 철학자들의 논리에 대항하여 교육받은 이교도들을 대상으로 기독교의 교리를 묵시론적으로 설명하는 글을 주로 저술했다. 그의 저술 《신의 교훈 Divinae Institutiones》은 초기 기독교 사상의 체계화된 저작의 대표적인 사례로 꼽힌다. 그의 사후에 이단성이 있는 것으로 분류되었는데, 르네상스 인문주의자들에 의해 재발견되어 그의 신학보다는 현학적인 스타일의 수사학적인 라틴문학으로 더 각광을 받았다. 이 책 4.28에서 종교에 대하여 어원적으로 re+lig로 이해하여 종교를 '다시 묶다', '하나님과 다시 결합하다'로 정의하였다. 어거스틴은 이 견해를 따랐다. 그래서 종교를 하나님에 대한 경외로 정의하게 되었다.\\n로마 황제 디오클레티아누스가 니코메데이아의 수사학 교사로 임명했지만, 황제가 기독교인들을 박해하기 시작하자 305년경 교사직을 사임하고 서방으로 돌아갔다. 그 뒤 317년 은둔생활을 끝내고 트리어에서 콘스탄티누스 1세의 아들 크리스푸스를 가르쳤다. 그리스도의 재림과 관련하여 종말론의 견해는 전천년주의을 주장했다."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_4358","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/NGC4358_%28PGC40309%29_-_SDSS_DR14.jpg","page_title":"NGC 4358","context_page_description":"NGC 4358 galaxia bat da, Hartz Handia konstelazioan. William Herschelek aurkitu zuen 1789ko apirilaren 17an."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%BE%D0%BF%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%B5%D0%BE%D0%BC%D0%B5%D1%82%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Tropical_curves_2nd_order.png","page_title":"Тропическая геометрия","context_page_description":"Тропическая геометрия — появившаяся в 2000-е годы область в математике, исходно возникшая в информатике, и связанная с алгебраической и симплектической геометрией. Исследуемые в ней объекты являются пределом образов амёб обычных алгебраических многообразий при вырождении последних.\\nНазвание «тропическая» отдаёт честь бразильской школе — пионерским работам бразильского математика венгерского происхождения Имре Шимона, исследовавшего тропическое полукольцо в связи с вопросами информатики и теории оптимизации.\\nСовершенно независимо от бразильской школы термин «тропическая» по отношению к новой математике, инициированной ситуацией, возникшей в СССР во время перестройки 80-ых годов прошлого века, и открытием «железного занавеса» между странами коммунистического и капиталистического лагеря, применял В.П. Маслов с середины 80-х годов. В многочисленных устных выступлениях и в советской прессе он предостерегал, что открытие занавеса между двумя системами неизбежно приведет к ситуации, аналогичной той, которая возникла в 17 веке, когда океан перестал быть границей между Европой и Америкой, с одной стороны, и тропической Африкой, с другой."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%AA%D8%B1_%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Walter_Law_-_Feb_1919_MPW.jpg","page_title":"والتر لا","context_page_description":"والتر لا آمریکالی اوْیونچو. ۲۶ مارس ۱۸۷۶ ایلینده دۆنیایا گؤز آچیب."},{"page_url":"https://oc.wikipedia.org/wiki/Lista_dels_primi%C3%A8rs_ministres_de_Finl%C3%A0ndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Rangell_Jukka.jpg","page_title":"Lista dels primièrs ministres de Finlàndia","context_page_description":"Lo primièr ministre es lo cap de govèrn de Finlàndia.\\nVaquí la lista de primièrs ministres de Finlàndia aprèp l'independéncia, lo 1917, fins a uèi."},{"page_url":"https://cs.wikipedia.org/wiki/Chisar_kapija","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Old_town_hisar_kapia.jpg","page_title":"Chisar kapija","context_page_description":"Chisar Kapija je historická brána v městském opevnění původně z období antiky a v dnešní podobě ze středověku nacházející se v památkové rezervaci Starý Plovdiv na ulici Čankov Lavrenova přibližně 150 metrů východně od Východní brány antického města Filipopol v centru města Plovdiv v Plovdivská oblasti v jižním Bulharsku. Má status kulturní památky. Její název pochází z tureckého hisar a kapu a byl poslovanštěn/pobulharštěn."},{"page_url":"https://en.wikipedia.org/wiki/Ky-Mani_Marley","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Kymani_Marley_-_Smile_Jam_Stage_-_02-23-2008.jpg","page_title":"Ky-Mani Marley","context_page_description":"Ky-Mani Marley is a Jamaican reggae and hip-hop artist. His name is of East African origin, and means \\"Adventurous Traveler\\". He is the only child of Bob Marley with Anita Belnavis, a Jamaican table tennis champion."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%91%D0%BE%D1%80%D1%82%D0%BD%D1%96%D1%86%D1%82%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Dadan-Blatove_kosnice.JPG","page_title":"Бортніцтва","context_page_description":"Бо́ртніцтва — старадаўні лясны промысел, пачатковая форма культурнага пчалярства. Заснавана на разьвядзеньні й утрыманьні лясных пчолаў-баровак у штучных дуплах — борцях. Разьвілося зь дзікага пчалярства, калі чалавек выпадкова, а пазьней сьвядома знаходзіў пчаліныя гнёзды ў дуплах дрэваў, зьнішчаў вагнём пчолаў і забіраў мёд.\\nПаступова бортніцтва замяняецца калодачным, а пасьля вынаходніцтва Пятром Пракаповічам у 1814 годзе рамовага вульля — рамовым пчалярствам. Па пераемнасьці калоднае пчалярства ўспрыняло ранейшую назву й працяглы час называлася бортніцтвам. Абумоўлена гэта было тым, што выраб калодаў, спосаб догляду пчолаў, бортны інструмэнт і тэрміналёгія засталіся ранейшымі. Розьніца складаецца толькі ў адным: борць выдзёўбвалі ў жывым дрэве, калоду-борць — у сьпілаваным.\\nБортніцтва выпрацавала спэцыфічныя прылады й прыстасаваньні, якія безь істотных зьменаў, пад рознымі назовамі альбо ў іх варыянтах вядомы на ўсёх тэрыторыі краіны.\\nБортная тэрміналёгія ў беларусаў, палякаў і ўкраінцаў ня мае істотных адрозьненьняў. Гэта сьведчыць пра тое, што бортніцтва ўзьнікла ў пэрыяд агульнаславянскага моўнага адзінства."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%96%A9%E6%B0%91%E7%B3%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Lingshan_Islamic_Cemetery_-_tomb_-_DSCF8381.JPG","page_title":"閩民系","context_page_description":"闽民系，为汉族的一支民系，亦称闽族、福建人，使用闽语，分布在福建、台湾、海南、浙南、广东以及一部分东南亚国家的华裔，在欧美和日本的华裔亦有闽民系。今日全球闽民系的总人数约有1亿1500万人。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Union_Civil_War_monuments_and_memorials","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Civil_War_Monument_-_Springfield%2C_MA_-_DSC03240.JPG","page_title":"List of Union Civil War monuments and memorials","context_page_description":"This is a list of American Civil War monuments and memorials associated with the Union. Monuments and memorials are listed below alphabetically by state. States not listed have no known qualifying items for the list."},{"page_url":"https://de.wikipedia.org/wiki/SsangYong_Korando","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/20100907_ssangyong_korando_2.jpg","page_title":"SsangYong Korando","context_page_description":"Der SsangYong Korando ist ein Geländewagen mit kurzem Radstand und drei Türen in den ersten beiden Generationen sowie mit fünf Türen in der dritten Generation. Produziert wird das Modell von der südkoreanischen Firma SsangYong.\\nUrsprünglich war der Korando Ende der 1980er und Anfang der 1990er Jahre ein Lizenznachbau des Jeep CJ-7, das Nachfolgemodell wurde von 1997 bis 2006 gefertigt. Im Folgenden wird jedoch nur das Modell der zweiten Serie behandelt. Es basiert auf einem stabilen Leiterrahmen mit Starrachse hinten und Einzelradaufhängung vorne und war als geschlossenes Modell und als Cabrio erhältlich.\\nEs wurden drei Diesel und zwei Benzinmotoren angeboten. Topmodell war der E32 mit 3,2 Liter Reihensechszylindermotor und 209 bis 212 PS der in Europa ausschließlich mit 4 Gang Automatik angeboten wurde. Alle anderen Motoren waren ebenfalls mit dieser Automatik oder wahlweise mit 5-Gang-Schaltgetriebe erhältlich. Der Korando verfügt über einen elektronisch zuschaltbaren Allradantrieb und eine Untersetzung die ebenfalls elektronisch per Drehschalter im Cockpit zugeschaltet werden kann."},{"page_url":"https://es.wikipedia.org/wiki/Amblyeleotris_randalli","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Amblyeleotris_randalli.jpg","page_title":"Amblyeleotris randalli","context_page_description":"Amblyeleotris randalli es una especie de peces de la familia de los Gobiidae en el orden de los Perciformes."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B8%82%E5%B7%9D%E5%A3%BD%E6%B5%B7_(3%E4%BB%A3%E7%9B%AE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Kotobuki_Ebi_inverted.png","page_title":"市川壽海 (3代目)","context_page_description":"三代目 市川 壽海は、大正から昭和にかけて活躍した歌舞伎役者。屋号は成田屋。定紋は壽海老、替紋は蝙蝠。本名は太田 照造。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%88%D9%8A%D8%B3_%D8%AF%D9%88%D9%85%D9%8A%D9%86%D9%8A%D9%83_%D8%A8%D9%88%D8%B1%D8%BA%D9%8A%D9%86%D9%8A%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Le_v%C3%A9ritable_portrait_de_Cartouche.jpeg","page_title":"لويس دومينيك بورغينيون","context_page_description":"لويس دومينيك بورغينيون ‏ هو مجرم فرنسي، ولد في 1 أكتوبر 1693 في باريس في فرنسا، وتوفي بنفس المكان في 27 نوفمبر 1721."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%97%D0%B0%D0%B1%D1%83%D0%BB%D0%B5%D0%BD%D0%B8_%D1%81%D0%BE%D0%B2%D0%B8_(%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Grass_Owl_adult.jpg","page_title":"Забулени сови (род)","context_page_description":"Забулените сови са род нощни грабливи птици, който включва 14 вида."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%88%D9%86%D8%AA%D8%B2%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Parco-Villa-Reale-ceppaia-02.jpg","page_title":"مونتزا","context_page_description":"مونتزا ایتالیانین لمباردی بؤلگه سینده یئر آلان بیر شهردیر. 2016-جی ایلين نۆفوس ساییمی اساسیندا 122 728 نفر دیر. بۇ باخیم‌دان اۆلکه‌نین 34_اینجی شهری سایاگلیر."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B0%D0%BA%D1%86%D1%96%D1%8F_%D0%A1%D1%83%D0%B4%D0%B7%D1%83%D0%BA%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/CapparatrieneFromCitronellal.png","page_title":"Реакція Судзукі","context_page_description":"Реа́кція Судзу́кі — каталізована паладієм реакція крос-сполучення боронових кислот з галогенідами.\\nРеакція найкраще відпрацьована для синтезу біарилів, проте нові каталізатори і синтетичні методи значно розширили область застосування цієї реакції; як компоненти можна використовувати не лише арил-, але й алкіл-, алкеніл- та алкінілпохідні. Замість боронових кислот можна використовувати похідні 9-борабіцикло[3.3.1]нонану, органотрифлуороборатні солі або боронові естери. Реакція також може проходити з псевдогалогенідами, такими як трифлати або нонафлати CF₃CF₂CF₂CF₂SO₃–. Реакційна здатність субстратів спадає у ряду R₂-I > R₂-OTf > R₂-Br >> R₂-Cl, причому за присутності в будь-якій комноненті атомів хлору, каплінґ з використанням йодпохідних проходить селективно. Фториди до реакції Судзукі не вступають. Реакція каталізується фосфіновими або карбеновими комплексами паладію. По реакції Судзукі було опубліковано декілька оглядових статей. Реакція широко застосовується при синтезі поліолефінів, стиренів та біарилів.\\nРеакцію вперше опублікували в 1979 році Акіра Судзукі та Норіо Міяура. За відкриття цієї реакції Акіра Судзукі в 2010 році отримав Нобелівську премію з хімії."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%8C%EB%B2%A0%EB%A5%B4_%EB%A5%B4%EB%B8%8C%EB%A5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Albert_Lebrun_1932_%282%29.jpg","page_title":"알베르 르브륑","context_page_description":"알베르 르브륑은 프랑스의 15대 대통령이다.\\n1900년 로렌 선거구에서 하원의원으로 당선되었고 1920년 상원의원, 1931년 상원의원장으로 선출되었다. 또한 그 외 시기에 식민장관 육군 장관을 지냈다.\\n1939년, 재선되었으나 1940년 프랑스 전투에서의 패배로 인해 비시 프랑스의 필리프 페탱에게 정권을 이양한다.\\n그는 중도 우파 성향이었고 좌파와 우파 내각 모두에게 잘 적응 하였지만 프랑스 제 3공화국의 헌법으로 인한 여러제약과 지지기반이 취약했던 탓에 많은 실권을 행사하지는 못하였다."},{"page_url":"https://de.wikipedia.org/wiki/THW_Kiel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Handballspiel_THW_Kiel_gegen_Viktoria_Hamburg_in_der_Endrunde_um_die_Deutsche_Meisterschaft%2C_15-10_%28Kiel_78.403%29.jpg","page_title":"THW Kiel","context_page_description":"Der Turnverein Hassee-Winterbek e. V. von 1904, bekannt als THW Kiel, ist ein Sportverein aus Kiel. Er stammt aus der ursprünglich selbständigen Gemeinde Hassee und deren Ortsteil Winterbek.\\nDer Verein wurde am 4. Februar 1904 gegründet. Als Sportarten wurde Turnen für Knaben und Männer angeboten, ab 1907 durften auch Mädchen teilnehmen. Ab 1923 wurde Handball gespielt, 1926 kam Leichtathletik hinzu, zeitweise Schwimmen, 1949 Tischtennis, 1959 Badminton und 1972 Tennis. Seit 2011 verfügt der THW Kiel über eine Kung-Fu-Abteilung.\\nBekannt ist der Verein vor allem durch seine Handballabteilung, deren Bundesliga-Spielbetrieb am 1. Juli 1992 in die THW Kiel Handball-Bundesliga GmbH & Co. KG ausgegliedert wurde. Der Turnverein Hassee-Winterbek e. V. von 1904 hält dort 26 Prozent der Stimmrechte."},{"page_url":"https://es.wikipedia.org/wiki/Matilde_de_Lupka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Matilde_de_Lupka.jpg","page_title":"Matilde de Lupka","context_page_description":"Matilde de Lupka fue una soprano spinto argentina."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B4%D0%BE%D0%BD%D0%B0%D1%87%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B8_%D0%91%D0%B0%D1%80%D0%BD%D0%B0%D1%83%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Coat_of_Arms_of_Barnaul_%28Altai_krai%29_%281846%29.png","page_title":"Градоначальники Барнаула","context_page_description":"Список градоначальников города Барнаула за более чем вековую историю.\\nВ 1877, в ходе реализации нового Городового положения 1870, появилась городская дума, действительное всесословное представительное учреждение. Из числа гласных избирался городской голова и члены управы — исполнительного органа. Городской голова возглавлял и думу, и управу. Было избрано 72 гласных думы и 5 членов управы."},{"page_url":"https://ca.wikipedia.org/wiki/Jo%C3%ABl_Robert","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/MX_Spanish_GP_250cc_19730408_Domingo_Gris_Joel_Robert.png","page_title":"Joël Robert","context_page_description":"Joël Robert és un ex-pilot belga de motocròs, un dels més famosos de la història d'aquest esport. Va guanyar sis Campionats del Món de motocròs en la categoria dels 250 cc, a banda d'un Motocross des Nations i tres Trophée des Nations formant part de l'equip belga.\\nEl seu rècord de 50 victòries en Gran Premi va ser vigent durant més de 30 anys, fins que el superà el també belga Stefan Everts el 2004 i, el 2012, Antonio Cairoli el féu retrocedir a la quarta posició d'aquest rànquing."},{"page_url":"https://ca.wikipedia.org/wiki/Monestir_de_Santa_Maria_de_Ripoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Evidence_of_a_seated_Virgin_Mary._Plaster_sculpture_%28Ripoll_cloister%29.JPG","page_title":"Monestir de Santa Maria de Ripoll","context_page_description":"El monestir de Santa Maria de Ripoll és un edifici conegut com a monestir benedictí a la localitat catalana de Ripoll. El monestir, fundat cap a l'any 880 pel comte Guifré el Pelós –segurament sobre un de l'època visigòtica destruït pels àrabs–, va esdevenir lloc d'enterrament dels comtes de Barcelona i Besalú i un centre cultural de scriptorium molt important de la Catalunya medieval, amb una projecció a l'alçada d'altres abadies europees d'aquest període com Saint-Denis, Fleury o Montecassino. Va ser declarat bé cultural d'interès nacional l'any 1931.\\nL'edifici va passar per diverses ampliacions, reformes i reconstruccions degudes a falta d'espai, incendis, pillatges i finalment profanacions de tombes durant la Guerra Civil espanyola, per la qual cosa del gran conjunt monàstic només resten la basílica i el claustre reconstruïts i l'edifici adossat al claustre, antic habitatge del vicari i en l'actualitat seu de l'ajuntament de la vila."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B4%D0%B6%D0%B5%D0%BD%D1%82,_%D0%94%D0%B6%D0%BE%D0%BD_%D0%A1%D0%B8%D0%BD%D0%B3%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Duke_Marlborough_Singer_Sargent.jpg","page_title":"Сарджент, Джон Сингер","context_page_description":"Джон Сингер Сарджент — американский художник, двоюродный брат известного ботаника Чарльза Сарджента, один из наиболее успешных живописцев периода Belle Époque."},{"page_url":"https://pl.wikipedia.org/wiki/Fiat_Dobl%C3%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/2017_Fiat_Doblo_%28263_Series_II%29_SWB_van_%282018-09-03%29_02.jpg","page_title":"Fiat Doblò","context_page_description":"Fiat Doblò – samochód osobowo-dostawczy typu kombivan klasy kompaktowej produkowany przez włoską markę FIAT od 2000 roku. Od 2010 roku produkowana jest druga generacja modelu."},{"page_url":"https://en.wikipedia.org/wiki/Tron:_Legacy_(soundtrack)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Daftpunklapremiere2010.jpg","page_title":"Tron: Legacy (soundtrack)","context_page_description":"Tron: Legacy is the soundtrack album to the 2010 film of the same name, released by Walt Disney Records on December 3, 2010. It is the first film score by French music duo Daft Punk."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%90%E1%83%9C%E1%83%90%E1%83%9B%E1%83%98%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%96%E1%83%98%E1%83%93%E1%83%94%E1%83%9C%E1%83%A2%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Jose_Domingo_de_Obald%C3%ADa.jpg","page_title":"პანამის პრეზიდენტი","context_page_description":"პანამის პრეზიდენტი — პანამის მთავრობისა და ქვეყნის მეთაური. მოსახლეობა ირჩევს 5 წლის ვადით."},{"page_url":"https://de.wikipedia.org/wiki/Zotter_Schokolade","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/ZotterLOGO-72dpi-dt.jpg","page_title":"Zotter Schokolade","context_page_description":"Die Zotter Schokolade GmbH ist ein 1999 als Zotter Schokoladen Manufaktur GmbH gegründeter Hersteller von biologisch und fair produzierter Schokolade mit Sitz in der Ortschaft Bergl der steirischen Gemeinde Riegersburg. Vorgängerin war die 1987 gegründete Zotter Konditorei. Im Jänner 2020 wurde das Unternehmen in Zotter Schokolade GmbH umbenannt.\\nRund 200 Tonnen biologischer Kakaobohnen und 150 Tonnen Kakaobutter werden dort mit ca. 400 weiteren Bio-Zutaten jährlich zu über 500 Sorten Schokolade, Pralinen, Trinkschokolade und weiteren Schokoladenprodukten veredelt. Zotter ist ein Bean-to-Bar-Hersteller, der die Schokolade von der Kakaobohne weg selbst herstellt. Knapp die Hälfte des Umsatzes erzielt das österreichische Unternehmen mit über 4000 Vertriebsstellen im weltweiten Ausland."},{"page_url":"https://en.wikipedia.org/wiki/List_of_listed_buildings_in_Airdrie,_North_Lanarkshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Airdrie_Town_Hall_-_geograph.org.uk_-_1227063.jpg","page_title":"List of listed buildings in Airdrie, North Lanarkshire","context_page_description":"This is a list of listed buildings in the parish of Airdrie in North Lanarkshire, Scotland."},{"page_url":"https://af.wikipedia.org/wiki/Sagrada_Fam%C3%ADlia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/%CE%A3%CE%B1%CE%B3%CF%81%CE%AC%CE%B4%CE%B1_%CE%A6%CE%B1%CE%BC%CE%AF%CE%BB%CE%B9%CE%B1_2941.jpg","page_title":"Sagrada Família","context_page_description":"Die Basílica de la Sagrada Família, ook bekend as die Sagrada Família, is 'n groot, onvoltooide Rooms-Katolieke kerk in Barcelona, Katalonië, Spanje. Die kerk is deur die Spaanse/Katalaanse argitek Antoni Gaudí ontwerp; sy werk aan die gebou is deel van 'n UNESCO-wêrelderfenisgebied. Op 7 November 2010 het pous Benedictus XVI die kerk ingewy en dit as 'n mindere basilika verklaar.\\nBouwerk aan die Sagrada Família het op 19 Maart 1882, onder leiding van die argitek Francisco de Paula del Villar begin. In 1883, toe Villar bedank, het Antoni Gaudí as hoofargitek oorgeneem. Hy het die projek met sy eiesoortige argitektoniese- en ingenieurstyl, met 'n kombinasie van Gotiese en gekurfde Art Nouveau-vorms, omskep. Gaudí het die res van sy lewe aan die projek gewy, en hy is in die kript van die gebou begrawe. Ten tyde van sy dood in 1926 was minder as 'n kwart van die projek voltooi.\\nOmdat die konstruksie van die Sagrada Família slegs van private skenkings afhanklik was, het dit stadig gevorder, en is dit boonop deur die Spaanse Burgeroorlog onderbreek."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/%D0%9A%D0%94%D0%96%D0%94_%D0%97%D0%B2%D0%B5%D0%B7%D0%B4%D0%BE%D1%87%D0%BA%D0%B0.jpg","page_title":"Курганская детская железная дорога","context_page_description":"Курганская детская железная дорога — узкоколейная детская железная дорога в Кургане. Открыта 13 августа 1989 года.\\nПредприятие-куратор: Южно-Уральская железная дорога — филиал ОАО «Российские железные дороги». Курганская ДЖД является филиалом Челябинской ДЖД.\\nВиды деятельности:\\nПрофессиональная ориентация детей для учебы и работы в учебных учреждениях и на предприятиях железнодорожного транспорта.\\nСоздание оптимальных условий для развития у детей способностей к познанию и творчеству.\\nРеализация образовательных программ в интересах развития личности ребенка."},{"page_url":"https://en.wikipedia.org/wiki/The_Wizarding_World_of_Harry_Potter_(Universal_Studios_Hollywood)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Hogwarts_Under_Construction.jpg","page_title":"The Wizarding World of Harry Potter (Universal Studios Hollywood)","context_page_description":"The Wizarding World of Harry Potter is a themed area at Universal Studios Hollywood theme park near Los Angeles. The area is themed to the Harry Potter media franchise, adapting elements from the film series and novels by J.K. Rowling. The attraction—the second Harry Potter-themed area to exist at a Universal resort—was designed by Universal Creative from an exclusive license with Warner Bros. Entertainment.\\nAfter the successful debut of a similarly-themed area at Universal Orlando Resort, Universal Parks & Resorts announced the construction of a second Wizarding World of Harry Potter on December 6, 2011. The Wizarding World of Harry Potter officially began operation on April 7, 2016.\\nThis attraction suspended operations on 14 March 2020 on grounds of COVID-19 pandemic."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D1%82%D0%B5%D1%80_%D0%AE%D0%BD%D0%B0%D0%B9%D1%82%D0%B5%D0%B4_(%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/BHA_Women_0_Man_Utd_Women_2_WFAC_4th_rd_03_02_2019-267_%2832044693207%29.jpg","page_title":"Манчестер Юнайтед (женский футбольный клуб)","context_page_description":"Женский футбольный клуб «Манчестер Юнайтед» — английский профессиональный футбольный клуб из Бротона, Солфорд, основанный в 2018 году. Выступает в Женской суперлиге, высшем дивизионе в системе женских футбольных лиг в Англии. Базой команды является «Клифф», которая ранее использовалось в качестве тренировочной базы для мужской команды «Манчестер Юнайтед». Домашние матчи команда проводит на стадионе «Ли Спортс Виллидж»."},{"page_url":"https://fr.wikipedia.org/wiki/Arnaud_Mendy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Arnaud_Mendy.jpg","page_title":"Arnaud Mendy","context_page_description":"Arnaud Mendy est un footballeur franco-bissau-guinéen. Il est international bissau-guinéen depuis 2011. Il joue actuellement au Welling United Football Club."},{"page_url":"https://lv.wikipedia.org/wiki/Vec%C4%81_Rauma","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Rauman_Kalatori.jpg","page_title":"Vecā Rauma","context_page_description":"Vecā Rauma ir Raumas pilsētas senākā daļa. Tā sastāv no vairāk nekā 500 koka ēkām un celtnēm, kas celtas sākot no 18. gadsimta. Vecajā Raumā atrodas arī 16. gadsimta Raumas Svētā Krusta baznīca, kā arī pilsētas vecais rātsnams. Pilsētas rajonā mūsdienās dzīvo ap 500 cilvēku. 1991. gadā Raumas vecpilsēta iekļauta UNESCO Pasaules mantojuma sarakstā."},{"page_url":"https://de.wikipedia.org/wiki/Br%C3%BCcken_in_M%C3%BCnchen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Mariannenbruecke_Muenchen-1.jpg","page_title":"Brücken in München","context_page_description":"In der bayerischen Landeshauptstadt München gibt es mehr als 1000 Brücken. Besonders bekannt und für das Stadtbild prägend sind die Brücken über die Isar und über die breite Eisenbahntrasse der Bahnstrecke München–Augsburg. Andere dagegen sind im Straßenbild kaum zu erkennen, da sie über mittlerweile überwölbte oder stillgelegte und verfüllte Stadtbäche führen."},{"page_url":"https://tr.wikipedia.org/wiki/Shinsengumi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Flag_of_Shinsengumi.svg","page_title":"Shinsengumi","context_page_description":"Shinsengumi 1864 yılında Bakufu tarafından Japonya'daki Bakumatsu periyodu sırasında kurulan özel bir polis birliğidir.1869 yılına kadar aktif olarak görev aldı. Şogun temsilcilerini, imparatorluğun yabancı ülkeler ile ticaret ilişkilerinin gerçekleştirilmesini sağlayan, tartışmalı bir imparatorluk fermanının yayımlandığı sırada Kyoto'da korumak üzere kuruldu.Shinsengumi üyelerinin birçoğu Edo'dan bulunan kılıç okullarından gelen kişilerdi. Popüler kültürde cesur ve kararlı kahramanlar olarak gösterilmelerine rağmen tarihçiler tarafından merhametsiz katillerden oluşan bir birlik olarak tanımlanmaktadır."},{"page_url":"https://fr.wikipedia.org/wiki/Province_de_Salta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Iglesia_de_San_Francisco_01.JPG","page_title":"Province de Salta","context_page_description":"La province de Salta est une province de l'Argentine, située à l'extrême nord-ouest du pays. Elle est limitée au nord par la province de Jujuy et par la Bolivie, à l'est par le Paraguay, Formosa et la province du Chaco, au sud par les provinces de Santiago del Estero, de Tucumán et de Catamarca, enfin à l'ouest par le Chili.\\nSa population était de 1 215 207 habitants en 2010. Sa capitale Salta avait 535 303 habitants la même année."},{"page_url":"https://en.wikipedia.org/wiki/Lyudmila_Verbitskaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Lyudmila_Verbitskaya%2C_2014.jpg","page_title":"Lyudmila Verbitskaya","context_page_description":"Lyudmila Verbitskaya was a Russian linguist and teacher. She served as president of Saint Petersburg State University."},{"page_url":"https://pl.wikipedia.org/wiki/Techelsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Techelsdorf_Wappen.png","page_title":"Techelsdorf","context_page_description":"Techelsdorf – miejscowość i gmina w Niemczech, w kraju związkowym Szlezwik-Holsztyn, w powiecie Rendsburg-Eckernförde, wchodzi w skład urzędu Flintbek."},{"page_url":"https://fr.wikipedia.org/wiki/Jude%C8%9B_de_Gala%C8%9Bi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Biserica_Fortificata_Precista_Galati.jpg","page_title":"Județ de Galați","context_page_description":"Le județ de Galați est un județ de Moldavie roumaine, à l'est du pays. Son chef-lieu est Galați. Le județ possède une frontière avec la République de Moldavie."},{"page_url":"https://ast.wikipedia.org/wiki/Lluis_XVIII_de_Francia","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Royal_Monogram_of_King_Louis_XVIII_of_France.svg","page_title":"Lluis XVIII de Francia","context_page_description":"Lluis XVIII de Francia, tamién conocíu como \\"el deseyáu\\", foi rei de Francia y de Navarra ente 1814 y 1824, a esceición del curtiu periodu conocíu como los Cien Díes en que Napoleón recuperó de volao el poder, siendo'l primer monarca de la restauración borbónica en Francia.\\nLluis XVIII pasó veintitrés año nel esiliu, mientres la Revolución francesa y el Primer Imperiu francés, y nuevamente en 1815, mientres el periodu de los Cien Díes al regresu de Napoleón d'Elba. Hasta la so llegada al tronu de Francia, Luis tuvo'l títulu de conde de Provenza como hermanu del rei Lluis XVI. El 21 de setiembre de 1792, la Convención Nacional abolió la monarquía polo que Lluis XVI foi depuestu del tronu, y más tarde sería xulgáu, condergáu y executáu na guillotina. Cuando'l mozu Lluis XVII, el fíu de Lluis XVI, morrió na cárcel en xunu de 1795, Lluis XVIII asocedió al so sobrín —de forma nominal— como rei titular de Francia.\\nMientres el so esiliu, Lluis XVIII llegó a vivir en Prusia, el Reinu Xuníu y en Rusia. Cuando la Sesta Coalición ganó finalmente a Napoleón en 1814, Luis foi restauráu na posición de rei, de la qu'él y los realistes franceses consideraben la so lexítima posición."},{"page_url":"https://hu.wikipedia.org/wiki/Katyusa%E2%80%93Alpecin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Katusha_-_Tour_de_Romandie_2009.jpg","page_title":"Katyusa–Alpecin","context_page_description":"A Katyusa–Alpecin egy svájci profi kerékpárcsapat. Jelenleg ProTour besorolással rendelkezik."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_3112","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/NGC_3112_DSS.jpg","page_title":"NGC 3112","context_page_description":"NGC 3112 is een spiraalvormig sterrenstelsel in het sterrenbeeld Waterslang. Het hemelobject werd in 1886 ontdekt door de Amerikaanse astronoom Ormond Stone."},{"page_url":"https://en.wikipedia.org/wiki/Carl_Gotthard_Langhans","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%C5%BBelisz%C3%B3w_-_dawny_ko%C5%9Bci%C3%B3%C5%82_ewangelicki.jpg","page_title":"Carl Gotthard Langhans","context_page_description":"Carl Gotthard Langhans was a Prussian master builder and royal architect. His churches, palaces, grand houses, interiors, city gates and theatres in Silesia, Berlin, Potsdam and elsewhere belong to the earliest examples of Neoclassical architecture in Germany. His best-known work is the Brandenburg Gate in Berlin, national symbol of today’s Germany and German reunification in 1989/90."},{"page_url":"https://it.wikipedia.org/wiki/Kensett_(Iowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/KensettMethodist.jpg","page_title":"Kensett (Iowa)","context_page_description":"Kensett è un comune degli Stati Uniti d'America, situato nello Stato dell'Iowa, nella contea di Worth."},{"page_url":"https://gl.wikipedia.org/wiki/Cr%C3%B3mlech","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Calendar_aswan.JPG","page_title":"Crómlech","context_page_description":"Un crómlech é un monumento megalítico formado por menhires cravados no chan, e dispostos en círculo É un monumento megalítico formado por pedras ou menhires chantados e que adoptan unha forma circular ou elíptica, cercando un terreo. Atópanse en Gran Bretaña, a Bretaña francesa, así coma no norte e oeste da península ibérica, Dinamarca e Suecia.\\nEn galego tamén reciben os nomes compostos de círculo de pedras, aneis de pedras ou círculo megalítico.\\nA verba cromlech en inglés é usada para os dolmens e non para os círculos de penedos. En francés e castelán dáselle o mesmo uso ca en galego."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BB%D0%B5%D0%B2%D0%B8%D0%B9_%D1%88%D0%BE%D0%BB%D0%BE%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Naziuniformen_1934.jpg","page_title":"Сталевий шолом","context_page_description":"Сталевий шолом, Ліга фронтовиків — військове об'єднання часів Веймарської республіки, яке засноване одразу після закінчення Першої Світової війни в грудні 1918 року офіцером запасу Францом Зельдте в Магдебургу. Зельдте разом із Теодором Дюстербергом був Головою об'єднання. Дана організація була збройною частиною Німецької національної народної партії. Сталевий шолом багаторазово забезпечував охорону зали на партійних зборах."},{"page_url":"https://it.wikipedia.org/wiki/Strada_dei_Castelli_Orientali","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Venzone_curtain_wall_and_moat_05042008_12.jpg","page_title":"Strada dei Castelli Orientali","context_page_description":"La Strada dei Castelli Orientali è un antichissimo percorso che costeggia il confine tra Italia e Slovenia, a ridosso della Alpi Giulie, caratterizzato dalla presenza di un grande quantità di castelli di epoca medievale. Parte integrante della Terra dei Castelli patriarcali, essa costituisce la linea difensiva di origini tardoantiche che era posta a difesa dei possessi dello Stato Patriarcale di Aquileia, principato indipendente vassallo del Sacro Romano Impero, che coincide essenzialmente con l'odierno Friuli."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%8D%E5%BA%86%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%E9%87%8D%E5%BA%86%E5%A4%A7%E5%AD%A6%E8%80%81%E5%9B%BE%E4%B9%A6%E9%A6%86%E6%A5%BC.jpg","page_title":"重庆大学","context_page_description":"重庆大学，旧称四川省立重庆大学、国立重庆大学，位于中国重庆市，是一所以理工学科为侧重点的综合性大学。重庆大学现为教育部直属全国重点大学，国家“985工程”、“211工程”重点建设高校，42所双一流大学建设高校之一，入选“2011计划”、“111计划”、“卓越工程师教育培养计划”、“卓越法律人才教育培养计划”、“海外高层次人才引进计划”、“中国政府奖学金来华留学生接收院校”、“教育部来华留学示范基地”、“国家建设高水平大学公派研究生项目”；也是“中俄工科大学联盟”、“国际商管学院促进协会”、“工商管理硕士协会”、“欧洲质量改善系统”、“中英大学工程教育与研究联盟”、“重庆市大学联盟”、“中国酿酒高校联盟”、“卓越大学联盟”成员。是中国著名的“建筑老八校”和“电气五虎”之一。重大在1929年由中华民国军事将领刘湘创办，校址最初设于渝中区菜园坝，1933年迁至现址沙坪坝区嘉陵江江畔。2000年，原重庆大学、重庆建筑大学、重庆建筑高等专科学校合并组成新的重庆大学。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%9E%D7%A6%27%D7%98%D7%A7%D7%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Petropavlovsk_Kamcatskij_Volcan_Koriacky_in_background.jpg","page_title":"קמצ'טקה","context_page_description":"קַמְצַ'טְקָה הוא חצי אי במזרח הרחוק הרוסי; שנמצא בחבל קמצ'טסקי קראי, רוחבו המקסימלי 450 ק\\"מ, אורכו 1,250 ק\\"מ והוא משתרע על פני 270,000 קמ\\"ר, שטח המחוז כולו הוא 472,300 קמ\\"ר. חצי האי גובל במזרח עם האוקיינוס השקט ועם ים ברינג החוצץ בינו ובין חצי האי אלסקה ובמערב עם ים אוחוצק."},{"page_url":"https://sk.wikipedia.org/wiki/Lockheed_F-104_Starfighter","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/F-104J_JASDF_KwangjuAB_1982.jpeg","page_title":"Lockheed F-104 Starfighter","context_page_description":"Lockheed F-104 Starfighter je americké jednomiestne prúdové nadzvukové stíhacie lietadlo, používané letectvom Spojených štátov v rokoch 1958 až 1969, a potom jednotkami Leteckej národnej gardy až do ich vyradenia v roku 1975. Lietadlo bolo vyrábané aj v licencii v ďalších krajinách. Stroje sa stali známe hlavne kvôli početným nehodám."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6lner_Zoo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Jielbeaumadier_dendrolague_de_matschie_K%C3%B6ln_2008.jpeg","page_title":"Kölner Zoo","context_page_description":"Der Zoologische Garten Köln im nördlichen Stadtteil Riehl wurde im Jahre 1860 gegründet und gilt unter den heute in Deutschland vorhandenen Tiergärten als drittältester Zoo. Er ist an zahlreichen Erhaltungszuchten von Tierarten beteiligt. Mit über 1,3 Millionen Zutritten gehört er zu den meistbesuchten Einrichtungen seiner Art hierzulande."},{"page_url":"https://vi.wikipedia.org/wiki/Pogostemon_purpurascens","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Pogostemon_purpurascens_05.JPG","page_title":"Pogostemon purpurascens","context_page_description":"Pogostemon purpurascens là một loài thực vật có hoa trong họ Hoa môi. Loài này được Dalzell miêu tả khoa học đầu tiên năm 1850."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%B0%D1%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Paradiso_Canto_31.jpg","page_title":"Рај","context_page_description":"Рај у хришћанству означава место где обитава Бог и почивају душе свих оних који су прихватили Исуса Христа, сина Божјега, као свога спаситеља. Супротност је Паклу у кога одлазе сви они који су живели у греху и нису прихватили Исуса као спаситеља. Рај у Светоме Писму има неколико синонима тако да се може поистоветити са библијским терминима Царство небеско и Царство Божије. Такође у хришћанској теологији термин рај може бити поистовећен са појмом Есхатон који у теологији означава идеалну димензију постојања Божијег Царства. Сама реч појављује се у Библији, тако на пример у Јеванђељу по Луци или у Откривењу Јовановом.\\nТермин рај је изворно реч грчког порекла - грч. ο παραδεισος, и означава реално есхатолошко место или димензију постојања и то идеалну и савршену и у том смислу се и користи у библијском тексту, нарочито у новозаветним списима. У старозаветном тексту, реч рај означава и конкретно географски одређено место познато под именом Еденски врт који се налазио у Месопотамији, у долинама река Нил, Еуфрат и Тигар, која се сматра колевком човечанства, и тај идеаелни земаљски врт помиње се као религиозни архетип у свим цивилизацијама тако да је то, према Карлу Г."},{"page_url":"https://pl.wikipedia.org/wiki/Premierzy_Bu%C5%82garii","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/BASA-568K-2-147-3-Ivan_Evstratiev_Geshov_%28cropped%29.jpg","page_title":"Premierzy Bułgarii","context_page_description":"tymczasowo"},{"page_url":"https://uk.wikipedia.org/wiki/TEX10","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/PBB_GE_TEX10_218104_at_fs.png","page_title":"TEX10","context_page_description":"TEX10 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 9-ї хромосоми. Довжина поліпептидного ланцюга білка становить 929 амінокислот, а молекулярна маса — 105 674.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у такому біологічному процесі, як альтернативний сплайсинг.\\nЛокалізований у цитоплазмі, ядрі, мембрані."},{"page_url":"https://eu.wikipedia.org/wiki/Ablanque","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Ablanque%2C_Guadalajara%2C_Espa%C3%B1a%2C_2016-01-05%2C_DD_34.JPG","page_title":"Ablanque","context_page_description":"Ablanque Guadalajarako udalerria da, Señorío de Molina-Alto Tajo eskualdean dagoena.\\n2009ko urtarrilaren 1eko erroldaren arabera 110 biztanle zituen."},{"page_url":"https://de.wikipedia.org/wiki/Rosenquarz","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Quarz_-_Rosenquarz_-_Rohstein.jpg","page_title":"Rosenquarz","context_page_description":"Rosenquarz ist eine Varietät des Minerals Quarz. Er besitzt eine rosarote Färbung, ist milchig-trüb bis durchscheinend und tritt meist in körnigen bis derben Aggregaten auf. Als Rosa Quarz werden dagegen idiomorphe Kristalle bezeichnet, die im Gegensatz zum Rosenquarz nur sehr selten zu finden sind. Beide Bezeichnungen werden allerdings oft irreführend synonym verwendet."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_2991","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/NGC_2991_SDSS.jpg","page_title":"NGC 2991","context_page_description":"NGC 2991 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://pt.wikipedia.org/wiki/Wertheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Burg_Wertheim.jpg","page_title":"Wertheim","context_page_description":"Wertheim é uma cidade da Alemanha, no distrito de Main-Tauber, na região administrativa de Estugarda, estado de Baden-Württemberg."},{"page_url":"https://fr.wikipedia.org/wiki/Georges_Penabert","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Alexander_B._Weeks_%28photographer%29_%28A%29.jpg","page_title":"Georges Penabert","context_page_description":"Georges Penabert est un photographe français, né à Arudy le 23 avril 1825 et mort à Paris le 27 décembre 1903, dans le 11ᵉ arrondissement."},{"page_url":"https://en.wikipedia.org/wiki/Kroger_Field","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/CommonwealthStadium1.jpg","page_title":"Kroger Field","context_page_description":"Kroger Field, formerly known as Commonwealth Stadium, is a stadium in Lexington, Kentucky, United States, located on the campus of the University of Kentucky that primarily serves as the home field for the Kentucky Wildcats football team. The stadium is located at the corner of Alumni Drive and University Drive in Lexington. The playing surface is named C.M. Newton Grounds in honor of retired UK athletic director and former baseball and basketball player C.M. Newton. Built in 1973, it is the newest football stadium in the Southeastern Conference, as measured by date of original construction. The original capacity for the stadium was 57,800. In the stadium's first game, played on September 15, 1973, the Wildcats defeated the Virginia Tech Hokies 31–26"},{"page_url":"https://en.wikipedia.org/wiki/Mechanised_Infantry_Brigade_Iron_Wolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/MIB_Iron_Wolf_soldiers_during_exercises.jpg","page_title":"Mechanised Infantry Brigade Iron Wolf","context_page_description":"Mechanized Infantry Brigade \\"Iron Wolf\\" is the core unit of the Lithuanian Army and forms the country's contribution to NATO collective defence. The name of the brigade relates to the Lithuanian mythical character from the medieval foundation legend of the Vilnius city."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BC%A6%E6%9C%AC%E6%82%A0%E5%B8%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/HC-Yuki-Tsurumoto20110623.jpg","page_title":"弦本悠希","context_page_description":"弦本 悠希は、大阪府出身の元プロ野球選手。右投右打。"},{"page_url":"https://fr.wikipedia.org/wiki/Tr%C3%A9sors_nationaux_de_Cor%C3%A9e_du_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Korea-Tongdosa-09.jpg","page_title":"Trésors nationaux de Corée du Sud","context_page_description":"Les trésors nationaux de Corée du Sud sont un ensemble d'objets et de bâtiments qui ont été reconnus par le gouvernement sud-coréen pour leur exceptionnelle valeur historique, artistique et culturelle."},{"page_url":"https://cs.wikipedia.org/wiki/Mistrovstv%C3%AD_sv%C4%9Bta_ve_fotbale_2010_%E2%80%93_skupina_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/FIFA_World_Cup_2010_Portugal_North_Korea3.jpg","page_title":"Mistrovství světa ve fotbale 2010 – skupina G","context_page_description":"Skupina G Mistrovství světa ve fotbale 2010 byla jednou z osmi základních skupin tohoto šampionátu. Nalosovány do ní byly celky Brazílie, Severní Koreje, Pobřeží slonoviny a Portugalska."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%98%E1%83%90%E1%83%A0%E1%83%93%E1%83%98%E1%83%9B%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%A0%E1%83%90%E1%83%98%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Yardimli01.jpg","page_title":"იარდიმლის რაიონი","context_page_description":"იარდიმლის რაიონი — აზერბაიჯანის ერთ-ერთი რაიონი. მისი ადმინისტრაციული ცენტრია ქალაქი იარდიმლი. 2017 წლის აღწერის თანახმად, მოსახლეობა 65 200 ადამიანს შეადგენდა."},{"page_url":"https://war.wikipedia.org/wiki/Centrolobium_robustum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Papilionaceae_seed_pods%E2%80%94Handbuch_der_Systematischen_Botanik_%281924%29.jpg","page_title":"Centrolobium robustum","context_page_description":"An Centrolobium robustum in uska species han Magnoliopsida nga syahan ginhulagway ni Vell., ngan ginhatag han pagkayana nga asya nga ngaran ni George Bentham. An Centrolobium robustum in nahilalakip ha genus nga Centrolobium, ngan familia nga Fabaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://pt.wikipedia.org/wiki/Fernando_Pessoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Pessoabaixa.jpg","page_title":"Fernando Pessoa","context_page_description":"Fernando António Nogueira Pessoa foi um poeta, filósofo, dramaturgo, ensaísta, tradutor, publicitário, astrólogo, inventor, empresário, correspondente comercial, crítico literário e comentarista político português.\\nFernando Pessoa é o mais universal poeta português. Por ter sido educado na África do Sul, numa escola católica irlandesa, chegou a ter maior familiaridade com o idioma inglês do que com o português ao escrever os seus primeiros poemas nesse idioma. O crítico literário Harold Bloom considerou Pessoa como \\"Whitman renascido\\", e o incluiu no seu cânone entre os 26 melhores escritores da civilização ocidental, não apenas da literatura portuguesa mas também da inglesa.\\nDas quatro obras que publicou em vida, três são na língua inglesa e apenas uma em língua portuguesa, entitulada Mensagem. Fernando Pessoa traduziu várias obras em inglês para o português, e obras portuguesas para o inglês.\\nEnquanto poeta, escreveu sob diversas personalidades – heterónimos, como Ricardo Reis, Álvaro de Campos e Alberto Caeiro –, sendo estes últimos objeto da maior parte dos estudos sobre a sua vida e obra."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_San_Polieucto","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Polieuktos_Kilisesi.JPG","page_title":"Iglesia de San Polieucto","context_page_description":"La iglesia de San Polieucto fue una antigua iglesia bizantina construida en Constantinopla —que corresponde a la actual ciudad de Estambul en Turquía— por Anicia Juliana y dedicada a San Polieucto.​​ Concebido como una afirmación del propio linaje imperial de Juliana, el edificio estaba ricamente decorado y se cree que fue el templo más grande de la ciudad antes de la construcción de la iglesia de Santa Sofía.​ En su diseño se introdujo el uso a gran escala de elementos decorativos persas sasánidas y se cree que puede haber inaugurado el nuevo tipo de arquitectura de basílica con cúpula, perfeccionado más tarde en Santa Sofía.​​\\nPoco se sabe de la historia de la iglesia después de su construcción; el edificio sobrevivió hasta el siglo XI, tras lo cual cayó en decadencia. Varios elementos arquitectónicos fueron retirados y reutilizados en Constantinopla y otras ciudades. Después de que durante el período otomano se construyeran otras edificaciones sobre sus ruinas, el sitio fue redescubierto mientras se realizaban unas excavaciones en la década de 1960."},{"page_url":"https://ru.wikipedia.org/wiki/ANTEL","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Torreantel.JPG","page_title":"ANTEL","context_page_description":"«ANTEL» — ведущий оператор сотовой связи Уругвая, принадлежащий государству. Предоставляет услуги сотовой связи стандарта GSM. Делит рынок сотовой связи с двумя другими компаниями — Claro и Movistar. В качестве мобильного оператора использует бренд ANCEL.\\nТакже является фактически монополистом на рынке стационарной телефонии и установки ADSL-модемов для населения Уругвая. ANTEL принадлежат бренды Ancel, Ruralcel, UruguayNet.\\nANTEL — это аббревиатура, которая расшифровывается с испанского как Administración Nacional de Telecomunicaciones. Иногда также используется написание Antel."},{"page_url":"https://hu.wikipedia.org/wiki/Szeged_t%C3%B6megk%C3%B6zleked%C3%A9se","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/PESA_120Nb2.JPG","page_title":"Szeged tömegközlekedése","context_page_description":"Szeged tömegközlekedéséről az önkormányzati tulajdonú Szegedi Közlekedési Kft. és az állami tulajdonú Volánbusz Zrt. gondoskodik. A szegedi tömegközlekedés villamosokra, trolibuszokra és autóbuszokra épül.\\nSzeged egyike a négy magyar városnak, amely villamosvonalat üzemeltet, illetve Szegeden kívül csak Budapesten és Debrecenben ülhetünk trolira."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%8C%D0%B5%D1%80%D1%80%D0%B8,_%D0%90%D0%BC%D0%B5%D0%B4%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ger%C3%B4me_-_Am%C3%A9d%C3%A9e_Thierry.jpg","page_title":"Тьерри, Амедей","context_page_description":"Амедей Тьерри, полное имя Амеде́й Симо́н Домини́к Тьерри́ — французский журналист и историк; младший брат Огюстена Тьерри."},{"page_url":"https://pl.wikipedia.org/wiki/Wielki_Order_Kr%C3%B3la_Petara_Kre%C5%A1imira_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Grand_Order_of_King_Peter_Kresimir_IV.jpg","page_title":"Wielki Order Króla Petara Krešimira IV","context_page_description":"Wielki Order Króla Piotra Krzesimira IV z Wstęgą i Gwiazdą Poranną – wysokie chorwackie odznaczenie państwowe ustanowione w 1992, noszące imię króla Piotra Krzesimira IV."},{"page_url":"https://no.wikipedia.org/wiki/Europa_(m%C3%A5ne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/PIA01130_Interior_of_Europa.jpg","page_title":"Europa (måne)","context_page_description":"Europa, eller Jupiter II, er en av Jupiters måner. Den er den sjette månen og den andre galileiske månen utover fra Jupiter. Månen fullfører et omløp på 3,55 jorddager og har baneresonans med Io og Ganymedes. Diameteren på 1 569 km gjør Europa til den minste av de fire galileiske månene, og til den sjette største månen i solsystemet. Utenfor Jupiter-systemet er bare Titan og jordens måne større. Europa har planetmasse – det vil si stor nok masse til å oppnå hydrostatisk likevekt, og hadde vært en dvergplanet dersom den gikk i bane direkte rundt solen.\\nEuropa består primært av silikatbergarter, sannsynligvis med en kjerne av jern, og har en tynn atmosfære hovedsakelig sammensatt av oksygen. Overflaten, som stort sett består av is, er en av de jevneste i solsystemet, og er tverrstripet av sprekker og riller og med relativt få kratre. Dens tilsynelatende unge glatthet har ført til teorier om et underjordisk hav av vann som huser utenomjordisk liv.\\nHypotesen foreslår at varmeenergi fra tidevannsakselerasjon gjør at havene forblir flytende, og driver geologisk aktivitet på samme måte som platetektonikk.\\nEuropa ble oppdaget av Galileo Galilei i 1610\\nog av Simon Marius rundt samme tid."},{"page_url":"https://sh.wikipedia.org/wiki/Stari_grad_(Baku)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Azerbaigian-baku2.jpg","page_title":"Stari grad (Baku)","context_page_description":"Stari grad Bakua ili Unutarnji grad je povijesno središte Bakua, glavnog grada Azerbejdžana, koje je 2000. godine upisano na UNESCO-v popis mjesta svjetske baštine u Aziji i Oceaniji.\\nUnutarnji grad ima sačuvane gradske zidine i tornjeve iz 1806. godine, a njegove ulice su slikovite, uske i izbijaju na malene trgove na kojima se nalaze znamenite građevine kao što su:\\nPalača Širvanšahova iz 15. stoljeća je izgrađen na brdu tako da se vidi iz svih dijelova Starog grada i s mora. To je najveći povijesni kompleks građevina u Azerbejdžanu a sastoji se od palače, divanhana, mauzoleja i nadsvođenih grobnica, šahove džamije s minaretom, portala \\"Muratova vrata\\", rezervoara i ostataka hamama. Palača je oštećena u ruskom bombardiranju u 18. stoljeću i obnovljena je do 20. stoljeća, ali je većina njezina blaga ukradena i danas je u Topkapi Saraju u Istanbulu.\\nToranj djeva iz 12. stoljeća je izgrađen na mjestu starijeg paganskog hrama iz 7. ili 6. stoljeća pr. Kr. To je cilindrična građevina od osam katova od kojih svaki kat ima plitki svod. Prva tri kata su iz 7. ili 6. st. i predstavjaju drevni astronomski opservatorij ili hram vatre."},{"page_url":"https://fr.wikipedia.org/wiki/Navet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Brassica_rapa_turnip.jpg","page_title":"Navet","context_page_description":"Le Navet, Brassica rapa L. subsp. rapa, est une plante herbacée de la famille des Brassicacées, cultivée comme plante potagère ou fourragère pour sa racine charnue allongée ou arrondie, consommée comme légume. Le terme désigne aussi ce légume.\\nNoms communs : navet, naveau, rave."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9C%8D%E6%AF%94%E7%89%B9%E4%BA%BA%EF%BC%9A%E6%84%8F%E5%A4%96%E6%97%85%E7%A8%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/The_Hobbit_-_An_Unexpected_Journey_premiere.jpg","page_title":"霍比特人：意外旅程","context_page_description":"《哈比人：意外旅程》是奇幻冒險史詩電影《哈比人電影系列》的首部，為魔戒電影三部曲的前傳，依然由彼得·傑克森執導。改編自J·R·R·托爾金於1937年發表的同名小說。2012年12月12日於紐西蘭等地上映。\\n伊利亞·伍德、馬丁·費里曼和伊恩·麥克連擔綱主演。Weta Workshop公司負責美術與藝術設計，特效依舊由維塔數碼負責製作，霍華德·肖負責作曲配樂。"},{"page_url":"https://tl.wikipedia.org/wiki/Baotou","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Baotou.jpg","page_title":"Baotou","context_page_description":"Ang Lungsod ng Baotou ay isang lungsod sa Nagsasariling Rehiyon ng Nei Mongol sa bansang Tsina."},{"page_url":"https://cs.wikipedia.org/wiki/McDonnell_Douglas_KC-10_Extender","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/USAF_F-14D_and_F-18C%27s_prepare_to_refuel.jpg","page_title":"McDonnell Douglas KC-10 Extender","context_page_description":"McDonnell Douglas KC-10 Extender je vojenský letoun určený pro doplňování paliva jiných letounů ve vzduchu. Kromě doplňování paliva může sloužit i k přepravě cestujících a nákladu. Byl vyvinut na základě civilního dopravního letounu McDonnell Douglas DC-10. Pro letectvo Spojených států amerických bylo postaveno 60 letounů KC-10A. Přestavbou dvou nákladních DC-10 vznikly ještě dva stroje KDC-10 pro Nizozemsko. Americké letouny byly nasazeny v řadě operací, například ve válce v Zálivu. KC-10A unesou dvakrát více paliva, než jejich předchůdci Boeing KC-135 Stratotanker. Roku 2017 americké letectvo provozovalo celkem 59 letounů KC-10A, přičemž jejich vyřazení je plánováno na roky 2019–2024."},{"page_url":"https://en.wikipedia.org/wiki/Benazir_Salam","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Benazir_Salam2.JPG","page_title":"Benazir Salam","context_page_description":"Benazir Salam is an Indian classical dancer from Bangladesh."},{"page_url":"https://de.wikipedia.org/wiki/Prieur%C3%A9_de_Ganagobie","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/F10_39_Prieur%C3%A9_de_Ganagobie.0010.JPG","page_title":"Prieuré de Ganagobie","context_page_description":"Das Priorat Notre-Dame de Ganagobie ist ein Benediktinerkloster der Kongregation von Solesmes. Es liegt 15 Kilometer nordöstlich von Forcalquier und etwa 30 km südlich von Sisteron, im französischen Département Alpes-de-Haute-Provence, hoch über dem Ufer der Durance.\\nDas Priorat ist für seinen mittelalterlichen farbigen Mosaikboden bekannt, der auf die Mitte oder das dritte Viertel des 12. Jahrhunderts datiert wird und in Frankreich einzigartig ist.\\nEin erstes Kloster wurde im 10. Jahrhundert gegründet, das vom Bischof von Sisteron auf eigenem Land erbaut und dann der Abtei Cluny übertragen wurde.\\nDas Priorat hat eine allseits geschützte Lage 350 Meter über dem Tal der Durance, auf einem schmalen Plateau, umgeben von steilen Felsklippen. Die Römerstraße Via Domitia führte an der Hochebene vorbei. Sie war im Mittelalter der kürzeste und sicherste Weg zwischen Spanien und Rom.\\nZwischen dem 15. und 20. Jahrhundert blieb das Kloster verlassen. Seit 1987 ist die benediktinische Gemeinschaft von Hautecombe hier untergebracht, die auf die Benediktinerabtei Marseille zurückging."},{"page_url":"https://de.wikipedia.org/wiki/FDP_Hamburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Hinnerk_Fock_3.jpg","page_title":"FDP Hamburg","context_page_description":"Die FDP Hamburg ist der Landesverband der FDP im Bundesland Hamburg. Sie wurde am 20. September 1945 unter dem Namen Partei Freier Demokraten als erste liberale Landespartei in Westdeutschland gegründet. Sie gehörte von 1946 bis 1978, von 1987 bis 1993, von 2001 bis 2004 und seit 2011 der Hamburgischen Bürgerschaft an. Seit der Bürgerschaftswahl in Hamburg 2020 ist sie nur noch mit einer direkt gewählten, fraktionslosen Abgeordneten in der Bürgerschaft vertreten und verfügt über keine eigene Fraktion."},{"page_url":"https://fr.wikipedia.org/wiki/Serpentes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/False_Coral_Snake_%28Anilius_scytale%29_%2814112604251%29.jpg","page_title":"Serpentes","context_page_description":"Les serpents, formant le sous-ordre des Serpentes, sont des reptiles carnivores au corps très allongé et dépourvus de membres apparents. Comme tous les squamates, ce sont des vertébrés amniotes caractérisés par un tégument recouvert d'écailles, imbriquées les unes sur les autres et protégées par une couche cornée épaisse, et par une thermorégulation assurée par trois mécanismes, l'ectothermie, la poïkilothermie et le bradymétabolisme. Ils sont aussi appelés plus rarement Ophidiens.\\nLes serpents ont comme caractéristiques spécifiques d'avoir une langue bifide, des yeux sans paupière, un crâne articulé et des mâchoires mobiles qui facilitent l'ingestion de proies. Ils partagent la disparition des pattes avec deux autres groupes de vertébrés tétrapodes : les amphisbènes, d'autres squamates, et les gymnophiones, qui appartiennent au groupe des lissamphibiens."},{"page_url":"https://eu.wikipedia.org/wiki/Forsterita","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Forsterite_on_Sanidine_-_Ochtendung%2C_Eifel%2C_Germany.jpg","page_title":"Forsterita","context_page_description":"Forsterita magnesioa duen olibinoaren disoluzio solidoaren bukaeran dagoen mineral silikatoduna da.\\nForsteritak sistema ortorronbikoan kristaltzen du eta bere gela parametroak a 4.75 Å, b 10.20 Å eta c Å 5.98 dira. Forsterita arroka igneoekin batera agertzen da eta meteorito burdintsu batzuetan ere aurkitu da. 2005ean Stardust frogan kometen hautsarekin itzuli zen sateliteak ere aurkitu zuen. Johann Forster naturalistaren omenez eman zitzaion izena. Gema forman agertzen denean peridota izena ematen zaio.\\nForsteritak kuartzoarekin erreakzionatzen du eta enstatita izeneko ortopiroxenoa sortzen da honako erreakzioa dela medio:\\nMg₂SiO₄ + SiO₂ → 2MgSiO₃."},{"page_url":"https://cs.wikipedia.org/wiki/Vysok%C3%A1_Pec_(okres_Chomutov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Vysok%C3%A1_Pec_%28okres_Chomutov%29_znak.jpg","page_title":"Vysoká Pec (okres Chomutov)","context_page_description":"Obec Vysoká Pec se nachází v okrese Chomutov, kraj Ústecký. V obci žije přibližně 1 100 obyvatel."},{"page_url":"https://de.wikipedia.org/wiki/Baojun_630","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/2014_Baojun_630_sedan%2C_rear_8.3.18.jpg","page_title":"Baojun 630","context_page_description":"Der Baojun 630 ist ein Pkw-Modell, das gemeinsam von General Motors und dem chinesischen Konzern SAIC entwickelt und von 2011 bis 2019 unter der Marke Baojun vertrieben wurde."},{"page_url":"https://ca.wikipedia.org/wiki/Rom%C3%A1rio_de_Souza_Faria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Romario_2015.jpg","page_title":"Romário de Souza Faria","context_page_description":"Romário De Souza Faria, és un futbolista i diputat brasiler."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%98%E1%83%93%E1%83%9C%E1%83%94%E1%83%98%E1%83%A1_%E1%83%9D%E1%83%9E%E1%83%94%E1%83%A0%E1%83%98%E1%83%A1_%E1%83%97%E1%83%94%E1%83%90%E1%83%A2%E1%83%A0%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Sydneyoperahouse.JPG","page_title":"სიდნეის ოპერის თეატრი","context_page_description":"სიდნეის ოპერის თეატრი — მუსიკალური თეატრი სიდნეიში, ახალი საუზ-უელსი, ავსტრალია, XX საუკუნის ერთ-ერთი ყველაზე გამორჩეული შენობა და ერთ-ერთი ყველაზე განთქმული საკონცერტო დარბაზი მსოფლიოში. შენობის პროექტი ეკუთვნის დანიელ არქიტექტორ იორნ უტზონს, რომლემაც ამ შენობისთვის 2003 წელს პრიცკერის პრემია მიიღო. შენობა მდებარეობს ბენელონგის პოინტზე სიდნეის ყურეში უზარმაზარ ხიდთან სიახლოვეს და კომპლექსში განუმეორებელ ესთეტიურ შთაბეჭდილებას ქმნის.\\nბევრისთვის შენობის სფერული ნიჟაროვანი სახურავი ახლომდებარე ყურეში მცურავი აფროსან ფლოტილიას ჰგავს. ტურისტები, რომელთა უმრავლესობას ოპერა საერთოდ ან თითქმის არ აინტერესებს, შენობას აწყდება მხოლოდ მისი ახლოდან ნახვის შანსისთვის.\\nოპერის თეატრში მდებარეობს ავსტრალიის ეროვნული საოპერო დასი, სიდნეის თეატრალური კომპანია და სიდნეის სიმფონიური ორკესტრი. მისი ადმინისტრაცია ახალი სამხრეთ-უელსის ხელოვნების სამინისტროს დაქვემდებარებაშია."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BA%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%B1%D1%83%D1%85%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Panoramic_Baku.jpg","page_title":"Бакинська бухта","context_page_description":"Бакинська бухта — природна гавань Бакинського порту, Військово-морських сил Азербайджану і місцевого яхт-клубу, розташована на південному узбережжі Апшеронского півострова в Азербайджані."},{"page_url":"https://es.wikipedia.org/wiki/Astronom%C3%ADa_isl%C3%A1mica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Astrolabio_andalus%C3%AD_Toledo_1067_%28M.A.N.%29_01.jpg","page_title":"Astronomía islámica","context_page_description":"En historia de la astronomía, la astronomía islámica, árabe o musulmana es el trabajo astronómico dentro del mundo islámico, especialmente durante la Edad de Oro del islam y transcrito en su mayoría en árabe. Estos descubrimientos fueron realizados principalmente en los sultanatos de Oriente Medio, Asia Central, Al-Ándalus, el norte de África, y más tarde en China e India.\\nEn sus inicios, la astronomía en el mundo islámico llevó a cabo una trayectoria similar a otras ciencias en el islam, la asimilación de conocimientos extranjeros y la composición de estos elementos dispares para dar a luz a una tradición original. Las principales contribuciones son indias, persas y griegas, conocidas y asimiladas por traducciones.​ Posteriormente, la astronomía árabe ejerce a su vez una influencia significativa en las astronomías india​ y europea​ e incluso en la astronomía china.​\\nTradujeron el Almagesto; dieron nombre y catalogaron muchas estrellas visibles a simple vista en el cielo, como Aldebarán o Altair, y varios términos astronómicos como «alidada», «acimut» o «Almicantarat», que evidencian por su morfología su origen árabe.​"},{"page_url":"https://it.wikipedia.org/wiki/Canale_di_Cordero","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Locmap-CorderoChannel.png","page_title":"Canale di Cordero","context_page_description":"Il canale di Cordero è uno stretto della Columbia Britannica, Canada, situato tra la terraferma e le Isole Discovery, a nord dell'isola di Vancouver."},{"page_url":"https://pl.wikipedia.org/wiki/Saint-Mard_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/%C3%89glise_de_saint-Mard_apr%C3%A8s_la_Premi%C3%A8re_Guerre_mondiale.jpg","page_title":"Saint-Mard (Aisne)","context_page_description":"Saint-Mard – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Aisne.\\nWedług danych na styczeń 2014 roku gminę zamieszkiwało 117 osób, a gęstość zaludnienia wynosiła 24,9 osób/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Train_%C3%A0_grande_vitesse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Taiwan-HighSpeedRail-700T-testrun-2006-0624.jpg","page_title":"Train à grande vitesse","context_page_description":"Un train à grande vitesse est, selon l'Union internationale des chemins de fer :\\nun train roulant à des vitesses supérieures à 250 km/h sur des lignes spécialisées ;\\nun train roulant à environ 200 km/h sur des lignes standards adaptées ;\\nun train pouvant rouler à des vitesses inférieures en raison de conditions particulières de relief, de contraintes topographiques ou en environnement urbain.\\nEn France, dans les projets d'infrastructure ferroviaire, on parle plutôt de TAGV dans le but de respecter les règles européennes d'ouverture à la concurrence.\\nLa grande vitesse ferroviaire est née au Japon en 1964 avec le Shinkansen, puis s'est étendue dans plusieurs pays d'Europe et d'Asie. Elle a transformé le transport de voyageurs par trains et donné un nouvel élan à ce mode de transport.\\nCet article évoque également, à titre secondaire, les véhicules à sustentation magnétique, qui ne peuvent être définis comme des matériels ferroviaires puisqu'ils ne sont pas guidés par des rails, ne disposent pas de roues, et n'ont pas de contact avec leur infrastructure de guidage."},{"page_url":"https://ro.wikipedia.org/wiki/Ita%C3%BAna","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Bandeiraitauna.jpg","page_title":"Itaúna","context_page_description":"Itaúna este un oraș în Minas Gerais, Brazilia."},{"page_url":"https://sv.wikipedia.org/wiki/Bousseviller","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Map_commune_FR_insee_code_57103.png","page_title":"Bousseviller","context_page_description":"Bousseviller är en kommun i departementet Moselle i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Volmunster som tillhör arrondissementet Sarreguemines. År 2009 hade Bousseviller 136 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Redwood-Nationalpark","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Redw_rhododendron_20061030191827.jpg","page_title":"Redwood-Nationalpark","context_page_description":"Der Redwood-Nationalpark ist ein Nationalpark der USA an der kalifornischen Pazifikküste nahe der Grenze zu Oregon. Im Schutzgebiet wachsen knapp 50 Prozent des natürlichen Bestands an Küstenmammutbäumen Sequoia sempervirens, den höchsten Bäumen der Erde. Zum Park gehören der naturbelassene, vielgestaltige Küstenstreifen, der von der zerklüfteten Kliffküste über flache Felsstrukturen mit Gezeitentümpeln bis zum Sandstrand reicht, und die Hänge des Küstengebirges, an denen die Mammutbäume die Leitart des Ökosystems gemäßigter Regenwald sind.\\nIn den 1920er Jahren wurden zunächst die drei kalifornischen State Parks Prairie Creek Redwoods State Park, Del Norte Coast Redwoods State Park und Jedediah Smith Redwoods State Park eingerichtet. Der Nationalpark wurde am 2. Oktober 1968 gegründet und 1994 die Verwaltung mit den State Parks vereint. Seit 1980 ist das Gebiet als Weltnaturerbe der UNESCO ausgewiesen. Der Park wird gemeinsam durch den National Park Service und das California Department of Parks and Recreation verwaltet."},{"page_url":"https://en.wikipedia.org/wiki/Great_Soviet_Encyclopedia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B0%D1%8F_%D1%81%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D1%8D%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%BE%D0%BF%D0%B5%D0%B4%D0%B8%D1%8F_-_%D0%BF%D0%B5%D1%80%D0%B2%D0%BE%D0%B5_%D0%B8%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5.jpg","page_title":"Great Soviet Encyclopedia","context_page_description":"The Great Soviet Encyclopedia is one of the largest Russian-language encyclopedias, published by the Soviet Union from 1926 to 1990. After 2002, the encyclopedia's data was partially included into the later Bolshaya Rossiyskaya entsiklopediya in an updated and revised form. The GSE claimed to be \\"the first Marxist–Leninist general-purpose encyclopedia\\"."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%A7%DB%8C%D9%84%D8%A7_%D8%B1%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Nyla_Rose_at_New_York_Comic_Con_2019.png","page_title":"نایلا رز","context_page_description":"نایلا رز ورزشکار کشتی کج آمریکایی است.\\nاو قبلاً مرد بود و حالا یک ترازن است.\\nاو نخستین بازیکن تراجنسی در کشتی حرفه‌ای است، او در سال ۲۰۱۹ در اول الیت رسلینگ شرکت کرد."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B8%D0%BD%D0%B0_%D0%A3%D1%99%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Russia-2000-stamp-Galina_Ulanova.jpg","page_title":"Галина Уљанова","context_page_description":"Галина Сергејевна Уљанова је била руска примабалерина. Била је готово две деценије водећа балерина \\"Бољшој театра\\" после Другог светског рата."},{"page_url":"https://fr.wikipedia.org/wiki/Blauen_(Badenweiler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/PanoBlauen-IMG_6623-6637_900.jpg","page_title":"Blauen (Badenweiler)","context_page_description":"Le Blauen ou Hochblauen est une montagne du Sud de la Forêt-Noire qui culmine à 1 165 mètres d'altitude. Le sommet est situé sur les communes de Schliengen, Malsburg-Marzell et Badenweiler, les deux premières dans l'arrondissement de Lörrach et la dernière dans l'arrondissement de Brisgau-Haute-Forêt-Noire. C'est un point de vue panoramique idéal sur la Forêt-Noire, la plaine d'Alsace, les Vosges, le Jura et les Alpes."},{"page_url":"https://lv.wikipedia.org/wiki/Lubumba%C5%A1i","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Downtown_Lubumbashi%2C_Democratic_Republic_of_the_Congo_-_20061130.jpg","page_title":"Lubumbaši","context_page_description":"Lubumbaši ir pilsēta Kongo Demokrātiskās Republikas galējos dienvidos pie Zambijas robežas, valsts otrā lielākā pilsēta. Atrodas ap 1000 m virs jūras līmeņa.\\nRelatīvi pārticīgās Katangas provinces centrs. Liels vara ieguves centrs. Apkārtnē iegūst arī kobaltu, cinku un svinu."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Sainte-Eug%C3%A9nie_d%27Erloy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Erloy_Eglise_15.jpg","page_title":"Église Sainte-Eugénie d'Erloy","context_page_description":"L'église Sainte-Eugénie d'Erloy est une église située à Erloy, en France."},{"page_url":"https://ceb.wikipedia.org/wiki/Ivanovo_(kapital_sa_lalawigan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Flag_of_Ivanovo_%28Ivanovo_oblast%29.png","page_title":"Ivanovo (kapital sa lalawigan)","context_page_description":"Kapital sa lalawigan ang Ivanovo sa Rusya. Nahimutang ni sa distrito sa Gorod Ivanovo ug lalawigan sa Ivanovskaya Oblast', sa kasadpang bahin sa nasod, 250 km sa amihanan-sidlakan sa Moscow ang ulohan sa nasod. 126 metros ibabaw sa dagat kahaboga ang nahimutangan sa Ivanovo, ug adunay 420,839 ka molupyo.\\nAng yuta palibot sa Ivanovo kay daghan kaayong patag. Dunay mga 48 ka tawo kada kilometro kwadrado sa palibot sa Ivanovo medyo gamay nga populasyon. Ivanovo ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kabalayan ang palibot sa Ivanovo.\\nAng klima hemiboreal. Ang kasarangang giiniton 2 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -16 °C."},{"page_url":"https://ast.wikipedia.org/wiki/Llista_de_centrales_hidroel%C3%A9ctriques_m%C3%A1s_grandes_del_mundu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/HooverDam2009.jpg","page_title":"Llista de centrales hidroeléctriques más grandes del mundu","context_page_description":"Esti artículu recueye les centrales hidroeléctriques más grandes del mundu, incluyendo namái aquelles centrales hidroeléctriques con una capacidá de xeneración que supere los 1.000 MW.\\nEl complexu de la Presa de los Trés Gargüelos, na provincia de Hubei, en China, tien la mayor capacidá de xenerar enerxía del mundu, anque la central de Itaipú xenera, nuna sola presa, la mayor lletricidá del mundu. El complexu chinu inclúi dos centrales de xeneración: la presa de los Trés Gargüelos y la presa Gezhouba nel añu 2009; la capacidá total de xeneración d'esti complexu algamaría los 25.615 MW. En 2008, esti complexu xeneró 97,9 TWh de lletricidá.\\nLa central hidroeléctrica d'Itaipú, alcontrada na frontera ente Brasil y Paraguái, tien anguaño la más alta producción d'enerxía hidroeléctrica del mundu nuna sola presa. Con 20 unidaes de xeneración y 14.000 MW de capacidá instalaos, en 2013 la central hidroeléctrica de Itaipú algamó un nuevu récor históricu na producción d'enerxía llétrica al algamar los 98,6 TWh."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Shrewsbury_(southeast_central_area)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/22_High_Street%2C_Shrewsbury.jpg","page_title":"Listed buildings in Shrewsbury (southeast central area)","context_page_description":"Shrewsbury is a civil parish in Shropshire, England. It contains nearly 800 listed buildings that are recorded in the National Heritage List for England. Of these, 14 are listed at Grade I, the highest of the three grades, 71 are at Grade II*, the middle grade, and the others are at Grade II, the lowest grade.\\nShrewsbury is the county town of Shropshire, it is a market town and the commercial centre for the county and for mid-Wales. It stands on the River Severn, and its centre is almost surrounded by a large curve in the river. The oldest substantial surviving buildings in the town are Shrewsbury Castle and Shrewsbury Abbey, together with a number of churches and the town walls. The town flourished commercially during the 13th century, mainly from the wool trade, and a number of friaries were founded. Two major bridges were built, the Welsh Bridge at the north of the town, linking its centre with the suburb of Frankwell, and the English Bridge to the east, linking with the abbey and the suburb of Abbey Foregate."},{"page_url":"https://en.wikipedia.org/wiki/List_of_geological_features_on_Ceres","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Rongo_and_Haulani_craters.jpg","page_title":"List of geological features on Ceres","context_page_description":"Ceres is a dwarf planet in the asteroid belt that lies between the orbits of Mars and Jupiter. The IAU has adopted two themes for naming surface features on Ceres: agricultural deities for craters and agricultural festivals for everything else.\\nAs of September 2016, the IAU has approved names for 111 geological features on Ceres: craters, montes, catenae, rupēs, plana, tholi, planitiae, fossae and sulci. In July 2018, NASA released a comparison of physical features found on Ceres with similar ones present on Earth.\\nPiazzi, named after Giuseppe Piazzi, the discoverer of Ceres, is a dark region southwest of Dantu crater in ground-based images that was named before Dawn arrived at Ceres."},{"page_url":"https://id.wikipedia.org/wiki/Gurita","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Ocellated_octopus.jpg","page_title":"Gurita","context_page_description":"Gurita adalah hewan moluska dari kelas Cephalopoda, ordo Octopoda dengan terumbu karang di samudra sebagai habitat utama. Gurita terdiri dari 289 spesies yang mencakup sepertiga dari total spesies kelas Cephalopoda. Gurita dalam bahasa Inggris disebut Octopus yang sering hanya mengacu pada hewan dari genus Octopus."},{"page_url":"https://es.wikipedia.org/wiki/Rowhedge","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Rowhedge_Essex_UK_-_View_from_River_Bank_Opposite_in_Wivenhoe.jpg","page_title":"Rowhedge","context_page_description":"Rowhedge es una localidad situada en el condado de Essex, en Inglaterra, con una población estimada a mediados de 2016 de 2004 habitantes.​\\nSe encuentra ubicada al sureste de la región Este de Inglaterra, al noreste de Londres, y a poca distancia de la ciudad de Chelmsford —la capital del condado— y de la costa del mar del Norte."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_neorrenacentista","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Wut-interior.jpg","page_title":"Arquitectura neorrenacentista","context_page_description":"El estilo arquitectónico denominado neorrenacimiento, neorrenacentismo o neo-Renacimiento, ​ es una amplia designación que comprende muchos estilos historicistas del siglo XIX, que no se inspiraban en la arquitectura griega, ni en la gótica, sino que lo hacían en un amplio rango de modos clasicistas italianos. Bajo la amplia designación de «arquitectura renacentista» los arquitectos y críticos del siglo XIX fueron más allá del estilo arquitectónico que se había iniciado en Florencia y el centro de Italia a principios del siglo XV como una expresión del humanismo y también incluyeron estilos que se podrían identificar como manierismo o barroco. Estas designaciones estilicas, a menudo autoaplicadas, fueron de uso corriente a mediados de siglo XIX y más tarde «neorrenacimiento» pasó a ser aplicado por los contemporáneos a edificaciones que otros llamaban de estilo italianizante, o incluso cuando en ellas era evidente la presencia de muchos elementos del barroco francés. Se manifestó principalmente en la arquitectura pero también influyó en las artes decorativas."},{"page_url":"https://sv.wikipedia.org/wiki/Trakt%C3%B6ren","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Trakt%C3%B6ren_K%C3%B6pmansgatan_i_G%C3%B6teborg.jpg","page_title":"Traktören","context_page_description":"Traktören, är en kommunal förvaltningsbyggnad i kvarteret Traktören i västra Nordstaden i centrala Göteborg. De förvaltningar som inryms i byggnaden är Stadsbyggnadskontoret, Trafikkontoret och Stadsledningskontoret. Kvarteret Traktören avgränsas av Köpmansgatan - Torggatan - Postgatan och Tyggårdsgatan.\\nRedan 1963 uttalade sig Göteborgs stadsfullmäktige för att ett förvaltningscentrum skulle uppföras i västra Nordstan, och 1966 tillsattes en byggnadskommitté. År 1969 beslutades att stadsbyggnadskontoret, fastighetskontoret och stadskontoret, med flera skulle ingå i en första etapp, då dessa var utspridda på åtta stycken olika adresser. Ett avtal upprättades 1971 mellan kommunen och Familjebostäder, där bolaget skulle projektera, finansiera och uppföra en byggnad i kvarteret. Avtalet överfördes senare till Göteborgs stads bostads AB.\\nByggnaden i sex plan stod klar vid årsskiftet 1978–79 och hade ritats av Per-Axel Ekholm Arkitektkontor. Byggnadens längd är 120 meter och bredden är 55 meter. Byggnadsvolymen är 84 000 kubikmeter och golvytan 23 000 kvadratmeter. Huset står byggt dels direkt på berget, dels på pålar."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%B7%D8%B9_%D9%85%D8%B1%D9%83%D8%B2%D9%8A_%D8%B9%D9%84%D9%88%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/The_5_different_lingual_views_of_maxillary_central_incisor.jpg","page_title":"قاطع مركزي علوي","context_page_description":"القاطع المركزي العلوي ‏ هو السن الموجود في الفك العلوي من الأمام، وعادة ما تكون أكثر الأسنان وضوحًا من بين جميع الأسنان في الفم. وهو يقع في الجانب الإنسي إلى القاطع الجانبي العلوي. كما هو الحال مع جميع القواطع، وظيفتها هي تقطيع الطعام أثناء عملية مضغ الطعام. عادة ما تكون هناك حدبة واحدة على كل قاطع تسمى بالحافة القاطعة. تكون هذه الأسنان يبدأ في عمر 14 أسبوعًا في الرحم بالنسبة للقواطع المركزية اللبنية، وفي عمر 3-4 أشهر بالنسبة للقواطع المركزية الدائمة.\\nتوجد بعض الاختلافات البسيطة بين القاطع المركزي العلوي اللبني، والقاطع المركزي العلوي الدائم. تظهر القواطع المركزية العلوية اللبنية في الفم في عمر 8-12 شهر، وتتبدل في عمر 6-7 سنوات، وتظهر القواطع المركزية العلوية الدائمة في عمر 7-8 سنوات. الأسنان الدائمة أكبر وطولها أكبر من عرضها. القواطع المركزية العلوية تلامس بعضها في خط منتصف الوجه. القواطع المركزية السفلية هي النوع الآخر فقط من الأسنان التي تتلامس في خط منتصف الوجه. موقع هذه الأسنان يحدد وجود عضة مفتوحة أو وجود فرق. كما في كل الأسنان توجد اختلافات في الحجم، الشكل واللون من شخص لآخر. الأمراض العامة مثل مرض الزهري قد يؤثر على مظهر الأسنان."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BB%D0%B0%D0%BD_%D0%88%D0%BE%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%9B_%D0%91%D0%B0%D1%82%D1%83%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/M_j_batut.jpg","page_title":"Милан Јовановић Батут","context_page_description":"Милан Јовановић Батут био је југословенски српски лекар, универзитетски професор, утемељивач Медицинског факултета."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%93%9D%E5%B1%B1%E9%9B%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Cyanistes_caeruleus_2_Luc_Viatour.jpg","page_title":"蓝山雀","context_page_description":"蓝山雀，又名蓝冠山雀，是长10.5-12厘米的山雀。它们分布在欧洲温带及亚北极带并西亚的林地。它们并非候鸟。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BC%D0%BE%D1%81,_%D0%A5%D1%83%D0%B0%D0%BD%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Juande_Ramos_in_FC_Dnipro.jpg","page_title":"Рамос, Хуанде","context_page_description":"Хуа́н де ла Крус Ра́мос Ка́но — испанский футболист, тренер."},{"page_url":"https://en.wikipedia.org/wiki/Chisholm_Trail_Academy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Chisolm_Trail_Academy.jpg","page_title":"Chisholm Trail Academy","context_page_description":"Chisholm Trail Academy is a Seventh-day Adventist co-educational high school located at Fourth and Old Betsy in Keene, Texas. Keene is located midway between Alvarado and Cleburne, 25 miles south of Fort Worth. Chisholm Trail Academy is situated on 27 acres of land."},{"page_url":"https://fi.wikipedia.org/wiki/Ruotsin_p%C3%A4%C3%A4ministeri","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Axel_Pehrsson-Bramstorp.jpg","page_title":"Ruotsin pääministeri","context_page_description":"Ruotsin pääministeri on Ruotsin hallituksen päämies. Vuoden 1974 perustuslain jälkeen kuningas on ollut vain muodollinen valtionpäämies. Nykyinen pääministeri Stefan Löfven astui virkaan 3. lokakuuta 2014. Hänet syrjäytettiin 25. syyskuuta 2018, kun hän ei saanut uuden parlamentin luottamusta. Hänet valittiin kuitenkin jatkokaudelle hallitusneuvottelujen päätteeksi tammikuussa 2019."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Cambridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Cambridge_town_hall.jpg","page_title":"Liste der Baudenkmale in Cambridge","context_page_description":"Die Liste der Baudenkmale in Cambridge umfasst alle vom New Zealand Historic Places Trust als „Historic Place“ oder „Historic Area“ eingestuften Baudenkmale und Flächendenkmale der neuseeländischen Ortschaft Cambridge. Die Angaben stammen aus dem Register des NZHPT. Die Bezeichnungen der Baudenkmale orientieren sich an diesem Register. In die Liste werden auch bekannte Wahi Tapu, kulturell und religiös bedeutsame Stätten und Gebiete der Māori, aufgenommen. Sie werden jedoch meist nicht publiziert."},{"page_url":"https://sco.wikipedia.org/wiki/Siller_Y","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Gamma-uil_op_wortel_zijkant_%28Autographa_gamma_on_Daucus_carota%29.jpg","page_title":"Siller Y","context_page_description":"The Siller Y is a migratory moch o the faimily Noctuidae which is namit for the sillery Y-shapit merk on each o its forewings."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Frion","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Map_commune_FR_insee_code_23196.png","page_title":"Saint-Frion","context_page_description":"Saint-Frion is een gemeente in het Franse departement Creuse en telt 177 inwoners. De plaats maakt deel uit van het arrondissement Aubusson."},{"page_url":"https://de.wikipedia.org/wiki/Madison_County_(Illinois)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Madison_County_Illinois_1829.png","page_title":"Madison County (Illinois)","context_page_description":"Das Madison County ist ein County im US-amerikanischen Bundesstaat Illinois. Im Jahr 2010 hatte das County 269.282 Einwohner und eine Bevölkerungsdichte von 143,4 Einwohnern pro Quadratkilometer. Der Verwaltungssitz ist Edwardsville.\\nDas Madison County liegt im Metro-East genannten östlichen Teil der Metropolregion Greater St. Louis um die Stadt St. Louis im benachbarten Missouri."},{"page_url":"https://en.wikipedia.org/wiki/Nahuel_DL_43","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Nahuel_Tank.jpg","page_title":"Nahuel DL 43","context_page_description":"The \\"Nahuel\\" DL 43 tank was a medium tank developed in Argentina during World War II. It was the Argentine equivalent of the M4 Sherman and the M3 Grant American medium tanks."},{"page_url":"https://de.wikipedia.org/wiki/Ratschenitza","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Ivan_Mrkvi%C4%8Dka_-_Rachenitsa.jpg","page_title":"Ratschenitza","context_page_description":"Die Ratschenitza ist ein bulgarischer Volkstanz im 7/8-Rhythmus, mit der typischen Betonung 2-2-3. Der Tanz ist in ganz Bulgarien zu finden, unterscheidet sich jedoch stilistisch sehr stark in den verschiedenen Regionen des Landes. Seit 2017 ist er Namensgeber für den Ratscheniza-Nunatak auf der Alexander-I.-Insel in der Antarktis."},{"page_url":"https://cs.wikipedia.org/wiki/Shane_Black","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Shane_Black_by_Gage_Skidmore.jpg","page_title":"Shane Black","context_page_description":"Shane Black je americký režisér, scenárista, producent a herec. Filmy píše od druhé poloviny 80. let, jeho prvním snímkem byla Smrtonosná zbraň. V dalších letech napsal scénáře např. pro filmy Smrtonosná zbraň 2, Poslední skaut a Poslední akční hrdina. Od 80. let se rovněž objevuje ve vedlejších filmových rolích, jeho herecká filmografie zahrnuje např. i Predátora. V roce 2005 režisérsky debutoval snímkem Kiss Kiss Bang Bang."},{"page_url":"https://war.wikipedia.org/wiki/Phycidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Phycis_blennoides.jpg","page_title":"Phycidae","context_page_description":"An Phycidae in uska familia han Actinopterygii. An Phycidae in nahilalakip ha ordo nga Gadiformes, classis nga Actinopterygii, phylum nga Chordata, ngan regnum nga Animalia. An familia nga Phycidae in naglalakip hin 11 ka mga species, sumala ha Catalogue of Life.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://de.wikipedia.org/wiki/Lutherkirche_(Wiesbaden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Lutherkircher_Wiesbaden_Innenraum_854-h.jpg","page_title":"Lutherkirche (Wiesbaden)","context_page_description":"Die Lutherkirche in der hessischen Landeshauptstadt Wiesbaden ist eine protestantische Kirche, die 1908 bis 1910 in den Formen des Jugendstils und nach den Grundsätzen des Wiesbadener Programms errichtet wurde."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A3%92%E7%90%83%E5%A0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Dugout_baseball.jpg","page_title":"棒球場","context_page_description":"棒球場是棒球比賽場所，呈扇狀。比賽的活動大多以本壘為起點。內野是本壘、一壘、二壘、三壘圍繞的菱形。打擊者打出安打後要以逆時鐘方向試圖依序上壘。本壘往一壘邊線右方和本壘往三壘邊線左方都是界外區，反之為界內區。外野就是內野之外的界內區。"},{"page_url":"https://it.wikipedia.org/wiki/Progettazione_di_automobili","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/FlorenceSegwayTour.jpg","page_title":"Progettazione di automobili","context_page_description":"La progettazione di automobili è la branca del disegno industriale che si occupa della progettazione e sviluppo delle automobili.\\nIl termine in lingua italiana è tuttavia in disuso poiché la professione è confluita nel concetto più ampio di veicolo semovente, mentre la parola automobile si è ridotta a sinonimo di autovettura. Tale professione quindi viene identificata con il termine anglossassone automotive design, che si occupa dell'ideazione, progettazione e sviluppo di mezzi di trasporto, sia pubblici che privati, ma tocca anche concetti sociologici, ambientali, antropologici e di mobilità urbana."},{"page_url":"https://pl.wikipedia.org/wiki/Wollbrandshausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Wollbrandshausen.jpg","page_title":"Wollbrandshausen","context_page_description":"Wollbrandshausen − miejscowość i gmina w Niemczech, w kraju związkowym Dolna Saksonia, w powiecie Getynga, wchodzi w skład gminy zbiorowej Gieboldehausen."},{"page_url":"https://nl.wikipedia.org/wiki/Volvo_480","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/480-cockpit.jpg","page_title":"Volvo 480","context_page_description":"De Volvo 480 is een sportieve coupé gebouwd door Volvo tussen 1986 en 1995. De 480 is onder leiding van Rob Koch door John de Vries ontworpen op de stylingafdeling van Volvo Car in Helmond en werd gebouwd door de fabriek van dit bedrijf in Born. Met de Volvo 480 introduceerde Volvo verschillende innovaties."},{"page_url":"https://cy.wikipedia.org/wiki/Refferendwm_ar_bwerau_Cynulliad_Cenedlaethol_Cymru_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Debating_chamber_of_the_Welsh_Assembly_%282006%29.jpg","page_title":"Refferendwm ar bwerau Cynulliad Cenedlaethol Cymru 2011","context_page_description":"Cynhaliwyd refferendwm ar ymestyn pwerau deddfu Cynulliad Cenedlaethol Cymru yng Nghymru ar 3 Mawrth 2011. Gofynnodd y refferendwm y cwestiwn hwn: \\"A ydych yn dymuno i'r Cynulliad allu llunio deddfau ar bob mater yn yr 20 maes pwnc y mae ganddo bwerau ynddynt?\\"\\nOs caiff pleidlais 'ydw' ar y cyfan, bydd y Cynulliad â'r gallu i lunio deddfau ar bob mater yn yr 20 maes pwnc heb orfod cael caniatâd Llywodraeth y DU. Os caiff pleidlais 'nac ydw' ar y cyfan, ni ddigwyddith unrhyw beth a bydd y system sydd gan Gymru yn parhau.\\nCyhoeddwyd canlyniadau'r refferendwm ar 4 Mawrth 2011. Ar y cyfan, pleidleisiodd 63.49% 'ydw', a phleidleisiodd 36.51% 'nac ydw'. 'Ydw' oedd y bleidlais mewn 21 o'r 22 awdurdod lleol, gyda'r eithriad i Sir Fynwy. Ar y cyfan, pleidleisiodd 35.2% o Gymru. Croesawodd Prif Weinidog Cymru Carwyn Jones y canlyniad, gan ddywedyd: \\"Heddiw, fe gafodd hen wlad ei pharch.\\""},{"page_url":"https://fr.wikipedia.org/wiki/Anatoli_Gourevitch","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Brussels-Jubelpark_-_Parc_du_Cinquantenaire_%281%29.JPG","page_title":"Anatoli Gourevitch","context_page_description":"Anatoli Markovitch Gourevitch né le 7 novembre 1913 à Kharkiv, en Ukraine, mort le 2 janvier 2009 à Saint-Pétersbourg, est un espion soviétique. Membre du service de renseignement de l'Armée soviétique, le GRU, il fut un personnage central du mouvement de résistance anti-nazi Orchestre rouge en France et en Belgique. À son retour en Union soviétique, en 1945, Gourevitch, dont le nom de code était Kent, fut condamné pour trahison et passa 15 ans en détention. Il fut réhabilité en 1990."},{"page_url":"https://nl.wikipedia.org/wiki/Isaac_Isra%C3%ABls","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Isaac_Isra%C3%ABls_-_Naaiatelier_van_modehuis_Paquin%2C_Parijs.jpg","page_title":"Isaac Israëls","context_page_description":"Isaac Lazarus Israëls was een van de voornaamste Nederlandse schilders uit de groep van Amsterdamse Impressionisten. Naast zijn schilderwerk was hij tekenaar en aquarellist en maakte hij pastels, etsen en litho's."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%92%E3%82%B2%E3%82%BF%E9%86%A4%E6%B2%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Higeta_Building%2C_at_Nihonbashi-Koamicho%2C_Chuo%2C_Tokyo_%282019-01-02%29_01.jpg","page_title":"ヒゲタ醤油","context_page_description":"ヒゲタ醤油株式会社は、東京都中央区に本社を置く醤油などの調味料メーカー。かつては「銚子醤油」という社名。社名は、田の四隅にヒゲがついたようなトレードマークに由来する。工場や営業などの拠点は創業地である千葉県銚子市にある。1616年を創業とし、企業キャッチコピーは「江戸の味を伝えて4世紀」。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B9%D0%B5_%D0%94%D0%BE%D1%80%D0%B4%D0%B6%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/S.H._17._Karmapa_Thaye_Dorje_1.jpg","page_title":"Тайе Дордже","context_page_description":"Кармапа Тринли Тайе Дордже е роден на 6 май 1983 г. в Лхаса Тибет и съгласно традицията Кагю е признат за Седемнадесети Кармапа, глава на линията Кагю, една от четирите главни школи на Тибетския Будизъм."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E9%98%AA%E5%B8%82%E7%AB%8B%E6%B7%80%E5%B7%9D%E5%B0%8F%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Osaka_City_Yodogawa_elementary_school.JPG","page_title":"大阪市立淀川小学校","context_page_description":"大阪市立淀川小学校は、大阪府大阪市都島区にある公立小学校。\\n学校上空が大阪国際空港に着陸する航空機の経路となっているため、騒音対策として校舎には空調設備が設置されている。"},{"page_url":"https://da.wikipedia.org/wiki/Luftskib_L_45","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Zeppelin_L_45_Laragne.jpg","page_title":"Luftskib L 45","context_page_description":"Luftskib L 45 var en R-klasse super-zeppeliner, som blev bygget af Luftschiffbau Zeppelin i Berlin-Staaken til den tyske Kaiserliche Marine. Luftskibet fløj første gang 2. april 1917 og stationeredes i Ahlhorn sydvest for Bremen under ledelse af kommandant Waldemar Kölle. Han flyttede den 5. juni 1917 luftskibet til Tønder og deltog 19. oktober 1917 i det berømte Silent Raid, hvor L 45 bombarderede Piccadilly Circus i London. Dagen efter nødlandede L 45 i Sydøstfrankrig og sattes i brand inden besætningen blev taget som krigsfanger."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D0%B5%D0%BF%D1%82%D0%BE%D0%BA%D0%BE%D0%BA%D0%BE%D0%B2_%D1%84%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D0%B8%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Streptococcal_pharyngitis.jpg","page_title":"Стрептококов фарингит","context_page_description":"Стрептококовият фарингит или стрептококова инфекция на гърлото е заболяване, което се причинява от бактерия, наречена “Група A streptococcus”. Стрептококовата инфекция на гърлото засяга гърлото и сливиците. Сливиците представляват две жлези, разположени в гърлото, в задната част на устната кухина. Стрептококовата инфекция на гърлото може да засегне също и гласовата кутия. Честите симптоми включват температура, болка в гърлото и подути жлези в областта на врата. Стрептококовата инфекция на гърлото е причина за 37% от случаите на възпалено гърло при децата.\\nСтрептококовата инфекция на гърлото се разпространява при пряк контакт с болен. За да се провери дали даден човек има стрептококова инфекция на гърлото, трябва да се направи тест, наречен изследване за култура в гърлото. Дори без да се прави този тест вероятността от стрептококова инфекция на гърлото може да се установи от симптомите. Лечение с антибиотици може да помогне на болните със стрептококова инфекция на гърлото. Антибиотиците представляват лекарства, които умъртвяват бактериите."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B0%E0%A4%BE%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Drawing_by_my_younger_brother_krishna_11_year_old.jpg","page_title":"राक्षस","context_page_description":"राक्षस प्राचीन काल के प्रजाति का नाम है।\\nराक्षस वह है जो विधान और मैत्री में विश्वास नहीं रखता और वस्तुओं को हडप करना चाहता है।\\nरावण ने रक्ष संस्कृति या रक्ष धर्म की स्थापना की थी। रक्ष धर्म को मानने वाले गरीब, कमजोर, विकास के पीछे रह गए लोगों, किसानों व वंचितों की रक्षा करते थे। रक्ष धर्म को मानने वाले राक्षस थे।\\nविवरण\\nराक्षस को अक्सर बदसूरत, भयंकर दिखने वाले और विशाल प्राणियों के रूप में चित्रित किया गया था, जिसमें दो नुकीले मुंह ऊपर से उभरे हुए और नुकीले, पंजे जैसे नाखूनों वाले होते थे। उन्हें मतलबी, जानवरों की तरह बढ़ता हुआ और अतृप्त नरभक्षी के रूप में दिखाया गया है जो मानव मांस की गंध को सूंघ सकता है। कुछ अधिक क्रूर लोगों को लाल आंखों और बालों को जकड़ते हुए, उनकी हथेलियों से खून पीते हुए या मानव खोपड़ी से दिखाया गया था । आम तौर पर वे उड़ सकते थे, लुप्त हो सकते थे और उनमें माया थीं, जो उन्हें किसी भी प्राणी के रूप में इच्छानुसार आकार बदलने में सक्षम बनाती थीं। राकशा के समतुल्य महिला राक्षसी होती है\\nरामायण और महाभारत की दुनिया में, राक्षस एक लोकलुभावन जाति थी। अच्छे और बुरे दोनों प्रकार के युद्ध होते थे, और योद्धाओं के रूप में वे अच्छे और बुरे दोनों की सेनाओं के साथ लड़ते थे। वे शक्तिशाली योद्धा, विशेषज्ञ जादूगर और भ्रम फैलाने वाले थे।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B0%D1%83%D1%82%D0%B8%D1%82%D0%BB%D0%B0%D0%BD-%D0%98%D1%81%D0%BA%D0%B0%D0%BB%D1%8C%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Location_Cuautitlan_Izcalli.png","page_title":"Куаутитлан-Искальи","context_page_description":"Куаутитлан-Искальи — город и муниципалитет в Мексике, входит в штат Мехико. Население — 498 021 человек."},{"page_url":"https://da.wikipedia.org/wiki/Egernf%C3%B8rde","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Eckernf%C3%B6rde.Woisolofsky.jpg","page_title":"Egernførde","context_page_description":"Egernførde er en by i det nordlige Tyskland med cirka 25.000 indbyggere, beliggende i østdelen af den tyske delstat Slesvig-Holsten mellem Kiel i syd og Slesvig by i nord. En del af byens våbensymbol er et egern."},{"page_url":"https://ms.wikipedia.org/wiki/Kamala_Harris","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Senator_Harris_official_senate_portrait.jpg","page_title":"Kamala Harris","context_page_description":"Kamala Devi Harris ialah seorang ahli politik dan peguam dari Amerika Syarikat. Beliau berkhidmat sebagai senator junior Amerika Syarikat bagi negeri California sejak tahun 2017. Beliau juga merupakan calon naib presiden Amerika Syarikat bagi Parti Demokrat pada pilihan raya presiden A.S. 2020.\\nDilahirkan di Oakland, California, Harris merupakan graduan Universiti Howard dan Universiti California, Kolej Undang-Undang Hastings. Beliau memulakan kerjayanya di Pejabat Peguam Daerah Alameda, California sebelum direkrut ke Pejabat Peguam Daerah San Francisco dan kemudian di pejabat Ketua Peguam San Francisco. Pada tahun 2003, beliau terpilih sebagai peguam daerah San Francisco. Beliau juga terpilih sebagai ketua peguam California pada tahun 2010, dan dipilih semula pada tahun 2014.\\nBeliau mengalahkan Loretta Sanchez dalam pilihan raya Senat 2016, sekali gus menjadi wanita Afrika-Amerika kedua dan orang Asia Tenggara-Amerika pertama yang berkhidmat di Senat Amerika Syarikat. Sebagai senator, Harris telah menyokong reformasi penjagaan kesihatan, taraf kewarganegaraan untuk pendatang tanpa dokumen, Akta DREAM, larangan penggunaan senjata, dan reformasi cukai progresif."},{"page_url":"https://cs.wikipedia.org/wiki/Lutte_ouvri%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Lutte_Ouvriere_Mutualite_2008_02_29_n1.jpg","page_title":"Lutte ouvrière","context_page_description":"Lutte ouvrière je francouzská krajně levicová politická strana, hlásící se k trockismu; název LO postupně převážil nad původním názvem Union communiste. Mluvčím strany je Nathalie Arthaudová."},{"page_url":"https://fr.wikipedia.org/wiki/Seat_Formula","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Seat_Formula_yellow_hl_TCE.jpg","page_title":"Seat Formula","context_page_description":"La Seat Formula est un concept-car du constructeur automobile espagnol Seat."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%B8%D6%80%D5%A5%D5%B6%D5%BF%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%D0%A1%D0%BE%D1%80%D1%80%D0%B5%D0%BD%D1%82%D0%BE.%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D0%B5%D0%B9%D0%B7%D0%B0%D0%B6.jpg","page_title":"Սորենտո","context_page_description":"Սորենտո, քաղաք Հարավային Իտալիայում, Նեապոլի ծավածոցի հարավային ափին: Զբոսաշրջային կարևոր վայր է, որը հրապուրում է անտիկվարային բազմազան ու բազմաթիվ փոքր խանութներով, հանրահայտ Ամալֆի լողափի ընձեռած գրավիչ պայմաններով: Խանութները զբոսաշրջիկներին առաջարկում են գեղեցիկ խեցեղեն, ժանյակե գործվածքներ, փայտից պատրաստված տնային գործածության առարկաներ, հուշանվերներ: Սորենտո կարելի է հեշտությամբ հասնել Նեապոլից և Պոմպեյից, ավտոմեքենայով, նավով, գնացքով: Դիմացը, ոչ մեծ հեռավորության վրա, գտնվում են Վեզուվ հրաբուխը, Կապրի կղզին, ուր կարելի է հասնել աշխուժորեն երթևեկող նավերով ու նավակներով: Սորենտոյի տեսարժան վայրերը, բնակլիմայական հրաշալի պայմանները, շքեղ հյուրանոցները հրապուրել են բազում անվանի մարդկանց, նրանց թվում՝ Էնրիկո Կարուզոյին, Լուչիանո Պավարոտիին և շատ ու շատ ուրիշների:\\nԱյստեղ արտադրվում են լիմոնչելո լիկյոր, գինիներ, ալկոհոլային այլ խմիչքներ, շաքար, ջրեղեն, ցիտրուսային մրգեր, ձիթապտուղ, ընդեղեն: Կան տեքստիլ արդյունաբերության ձեռնարկություններ: Բնակիչներն զբաղվում են նաև այգեգործությամբ ու ձկնորսությամբ:"},{"page_url":"https://ca.wikipedia.org/wiki/Sula_(g%C3%A8nere)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Blue-footed_Booby_%28Sula_nebouxii%29_-one_leg_raised.jpg","page_title":"Sula (gènere)","context_page_description":"Sula és un gènere d'ocells marins de la família de súlids. Aquests mascarells tenen hàbits pelàgics i crien en aigües càlides de tots els oceans."},{"page_url":"https://pt.wikipedia.org/wiki/Universidade_Federal_de_S%C3%A3o_Carlos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Foto_aerea_UFSCar.jpg","page_title":"Universidade Federal de São Carlos","context_page_description":"Universidade Federal de São Carlos é uma instituição de ensino superior pública e federal brasileira, com sede no município de São Carlos, no estado de São Paulo. Fundada em 1968, é uma das três universidades federais do estado, ao lado da Universidade Federal do ABC e da Universidade Federal de São Paulo, e a única universidade federal sediada no interior do Estado de São Paulo. É composta por 48 departamentos acadêmicos, divididos em oito centros, nos quatro Campi: Ciências Agrárias, Ciências Biológicas e da Saúde, Ciências em Gestão e Tecnologia, Ciências e Tecnologias para a Sustentabilidade, Ciências Exatas e de Tecnologia, Ciências Humanas e Biológicas, Educação e Ciências Humanas e Ciências da Natureza. O principal fica no município de São Carlos que se destaca por estar entre as 8 melhores universidades públicas no curso de medicina, segundo a Cremesp com 645 hectares de extensão e 196 mil m² de área construída, localizado a 235 km da capital, à beira da Rodovia Washington Luís, na antiga fazenda Trancham."},{"page_url":"https://hsb.wikipedia.org/wiki/Zahrodna_truskalca","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Strawberry_blossom_%28aka%29.jpg","page_title":"Zahrodna truskalca","context_page_description":"Zahrodna truskalca je rostlina ze swójby róžowych rostlinow."},{"page_url":"https://tr.wikipedia.org/wiki/Dinozorlar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Leaellynasaura_BW.jpg","page_title":"Dinozorlar listesi","context_page_description":"Bu listede dinozor cinsleri kapsamlı bir şekilde listelenmiştir. Listede, geçerli olan veya henüz resmi isimlendirmesi yapılmamış 1379 cins ve alt sınıf dinozor ismi yer almıştır. Bazı isimlerin yanına aşağıdaki terminolojide belirtilen açıklamalar eklenmiştir."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D1%92%D0%B0%D1%80%D0%B8_%D1%83_%D0%A1%D1%98%D0%B5%D0%B4%D0%B8%D1%9A%D0%B5%D0%BD%D0%B8%D0%BC_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D1%87%D0%BA%D0%B8%D0%BC_%D0%94%D1%80%D0%B6%D0%B0%D0%B2%D0%B0%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/George_Pal_%281979%29.jpg","page_title":"Мађари у Сједињеним Америчким Државама","context_page_description":"Мађари у Сједињеним Америчким Државама становници су Сједињених Држава, који се изјашњавају као Мађари или имају мађарско порекло. Било је неколико таласа значајне мађарске имиграције, нарочито у периоду од 1870. године до почетка Првог светског рата, када се између 650.000-700.000 етничких Мађара населило у САД, а већина њих су напустили своје земљу јер су били неквалификовани радници."},{"page_url":"https://de.wikipedia.org/wiki/Holodomor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/GolodomorKharkiv.jpg","page_title":"Holodomor","context_page_description":"Der Begriff Holodomor bezeichnet eine schwere Hungersnot in der Ukraine in den Jahren 1932 und 1933, der zwischen drei und vierzehn Millionen Menschen zum Opfer fielen. Die Ukraine bemüht sich seit der Unabhängigkeit 1991 um eine internationale Anerkennung des Holodomors als Völkermord, doch ist diese Bewertung bis heute umstritten."},{"page_url":"https://es.wikipedia.org/wiki/Parque_nacional_Fuentes_Brotantes_de_Tlalpan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Parque_Fuentes_Brotantes_4.JPG","page_title":"Parque nacional Fuentes Brotantes de Tlalpan","context_page_description":"El Parque Nacional Fuentes Brotantes de Tlalpan se encuentra al sur de la Ciudad de México, específicamente en la delegación de Tlalpan. Es un espacio natural cuyo principal objetivo es conservar algunos manantiales que brotan de las faldas de la Sierra del Ajusco y cuyo nacimiento está en el fondo de la barranca que conforma el lugar y alimentan el lago del parque​\\nFue declarado Parque Nacional en 1936. Tiene senderos naturales, área de juegos infantiles, zona de alimentos y un pequeño lago que sirve de hábitat a numerosos patos, peces y tortugas.​ En 1999, el Gobierno de la Ciudad de México y la Secretaría de Medio Ambiente y Recursos Naturales, también conocido como SEMARNAT, firmaron un acuerdo mediante el cual se transfiere la administración del Parque al Gobierno Federal.​"},{"page_url":"https://fr.wikipedia.org/wiki/Tomas_Thormods%C3%A6ter_Haugen","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Metalmania_2007_-_Zyklon_-_Tomas_%27Samoth%27_Haugen_01.jpg","page_title":"Tomas Thormodsæter Haugen","context_page_description":"Tomas Thormodsæter Haugen, plus connu sous le pseudonyme Samoth, est un guitariste de black metal et de death metal norvégien."},{"page_url":"https://uk.wikipedia.org/wiki/RERE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/PBB_GE_RERE_200939_s_at_fs.png","page_title":"RERE","context_page_description":"RERE – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 1-ї хромосоми. Довжина поліпептидного ланцюга білка становить 1 566 амінокислот, а молекулярна маса — 172 424.\\nКодований геном білок за функціями належить до репресорів, білків розвитку, фосфопротеїнів.\\nЗадіяний у таких біологічних процесах як транскрипція, регуляція транскрипції, поліморфізм, ацетиляція.\\nБілок має сайт для зв'язування з іонами металів, іоном цинку.\\nЛокалізований у ядрі."},{"page_url":"https://pt.wikipedia.org/wiki/Marli%C3%A9ria","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Flag_of_Marli%C3%A9ria_MG.PNG","page_title":"Marliéria","context_page_description":"Marliéria é um município brasileiro no interior do estado de Minas Gerais, Região Sudeste do país. Localiza-se no Vale do Rio Doce e pertence ao colar metropolitano do Vale do Aço, estando situado a cerca de 190 km a leste da capital do estado. Ocupa uma área de 545,813 km², sendo que 0,4 km² estão em perímetro urbano, e sua população em 2018 era de 4 044 habitantes.\\nA área da atual cidade pertenceu originalmente a Maria José da Fonseca Lana, que recebeu as terras de presente de seu pai Lizardo José da Fonseca Lana, comandante do quartel local. O povoamento teve início após a instalação de cinco choupanas às margens do ribeirão Onça Grande, onde mais tarde foi construída uma capela dedicada à Nossa Senhora das Dores. Em 1901, a localidade foi elevada a distrito subordinado a São Domingos do Prata, do qual se emancipou em 1953.\\nMarliéria tem boa parte de seu território demarcado pelo Parque Estadual do Rio Doce, maior reserva de Mata Atlântica de Minas Gerais e um dos maiores sistemas lacustres do mundo, sendo o município considerado porta de entrada para a reserva ecológica."},{"page_url":"https://es.wikipedia.org/wiki/Duelo_(psicolog%C3%ADa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Michelangelo%27s_Pieta_5450_cropncleaned_edit.jpg","page_title":"Duelo (psicología)","context_page_description":"El duelo es el proceso de adaptación emocional que sigue a cualquier pérdida. Aunque convencionalmente se ha enfocado la respuesta emocional de la pérdida, el duelo también tiene una dimensión física, cognitiva, filosófica y de la conducta que es vital en el comportamiento humano y que ha sido muy estudiado a lo largo de la historia. En la actualidad se encuentra en discusión el tema de si otras especies también tienen sentimientos de duelo como los seres humanos, y en algunas de ellas se han observado comportamientos peculiares ante la muerte de sus congéneres.​"},{"page_url":"https://nl.wikipedia.org/wiki/Kenneth_Grahame","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/KennethGrahame.jpg","page_title":"Kenneth Grahame","context_page_description":"Kenneth Grahame was een Schots schrijver.\\nGrahame werd geboren in Edinburgh, Schotland. Hij werd beroemd met het klassieke kinderboek De wind in de wilgen\\nGrahame werd al vroeg wees en woonde bij zijn grootmoeder in Engeland. Hij bezocht St. Edward's School in Oxford maar kon zich geen universiteitsstudie veroorloven. Hij werkte bij de Bank of England, een kantoorbaan die hij verafschuwde, tot hij in 1907 vanwege gezondheidsproblemen met pensioen ging en het plattelandsleven kon gaan leiden dat hij altijd al had gewenst."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Neylandville_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/TXMap-doton-Neylandville.PNG","page_title":"Neylandville (Texas)","context_page_description":"Neylandville sī Bí-kok Texas chiu Hunt kūn ê chi̍t ê chng-thâu.\\nChe sī chi̍t phiⁿ koan-î Bí-kok Texas Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Chemnitz-R%C3%B6hrsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Beethovenweg_23_Chemnitz-R%C3%B6hrsdorf.jpg","page_title":"Liste der Kulturdenkmale in Chemnitz-Röhrsdorf","context_page_description":"Die Liste der Kulturdenkmale in Chemnitz-Röhrsdorf enthält die Kulturdenkmale des Chemnitzer Stadtteils Röhrsdorf, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand vom 20. Juni 2013 erfasst wurden. Zusätzlich ist ein aus der Denkmalliste gestrichenes Kulturdenkmal aufgeführt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A5%D1%83%D0%B0%D1%85%D0%B8%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Marae_%C3%A0_Maeva.JPG","page_title":"Хуахине","context_page_description":"Островот Хуахине или \\"Автентичен\\" е остров во Француска Полинезија, дел од Заветрените острови кои пак се дел Друштвените острови во Тихиот Океан. Тој се наоѓа 34 км на исток-североисток од Рајатеа, на 43 км исток-југоисток од Тахаа и на 167 км западно-северозападно од Тахити, од 151° западна должина и 16°30 јужна географска ширина. Тој е исто така во близина на Бора-Бора."},{"page_url":"https://sv.wikipedia.org/wiki/J%C3%B8rgen_Roed","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/J%C3%B8rgen_Roed_by_Budtz_M%C3%BCller.jpg","page_title":"Jørgen Roed","context_page_description":"Jørgen Pedersen Roed, född 13 januari 1808 i Ringsted, död 9 augusti 1888 i Köpenhamn, var en dansk målare, far till Helena Nyblom och Holger Roed.\\nJørgen Roed studerade vid akademien och för Eckersberg och började tidigt måla vardagliga motiv från landsbygden och Köpenhamn eller arkitektoniska minnesmärken. Över huvud taget ansågs hans tidiga målningar vara hans bästa. Med stipendium reste han 1837 utomlands, stannade i Italien till 1842, blev medlem av akademien 1844 och var 1862-1887 professor vid modellskolan.\\nI Italien hade han med iver studerat Rafael och gjort förtjänstfulla kopior av dennes större arbeten; senare kopierade han Sixtinska madonnan i Dresden. Han målade italienska folklivsbilder och arkitekturmotiv, danska landskap och genretavlor, utsikter av slott och domkyrkor och interiörer från dylika samt porträtt, bland\\ndessa sin moders, självporträtt, flera kamratporträtt: Küchler och Küchler som munk, Bissen den äldre och Marstrand.\\nHans färg, som aldrig varit stark, blev allt blekare och magrare med åren; det var uteslutande den gedigna teckningen som bar upp hans målningar."},{"page_url":"https://de.wikipedia.org/wiki/Salz-Teichbinse","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Schoenoplectus_tabernaemontani.jpeg","page_title":"Salz-Teichbinse","context_page_description":"Die Salz-Teichbinse wird auch Salz-Teichsimse oder Graue Seebinse genannt und gehört zur Familie der Sauergrasgewächse. Es handelt sich um eine recht großwüchsige binsenartige Pflanze von typisch graugrüner Farbe. Zeitweise wurde sie nur als Unterart der Gewöhnlichen Teichbinse angesehen, welche noch größer wird und ein frischeres Grün aufweist. Sie ist an Ufern von Gewässern zu finden und ist dabei vergleichsweise salztolerant. Benannte wurde das Taxon zu Ehren des frühneutzeitlichen Gelehrten Tabernaemontanus."},{"page_url":"https://en.wikipedia.org/wiki/Parthenodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/058-Parthenodes_rectangulalis_Kenrick%2C_1907.JPG","page_title":"Parthenodes","context_page_description":"Parthenodes is a genus of moths of the family Crambidae."},{"page_url":"https://fi.wikipedia.org/wiki/V%C3%A4in%C3%A4joki","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/River_Daugava_map-FI.png","page_title":"Väinäjoki","context_page_description":"Väinäjoki on 1 020 kilometriä pitkä Itämeren Riianlahteen laskeva joki. Se on Latvian tärkein ja Valko-Venäjän toiseksi tärkein joki."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BC%D0%BF%D0%BE%D1%80%D1%82%D0%B8%D0%BD-5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/PBB_GE_RANBP5_211952_at_fs.png","page_title":"Імпортин-5","context_page_description":"Імпортин-5 – білок, який кодується геном IPO5, розташованим у людей на короткому плечі 13-ї хромосоми. Довжина поліпептидного ланцюга білка становить 1 097 амінокислот, а молекулярна маса — 123 630.\\nЗадіяний у таких біологічних процесах як взаємодія хазяїн-вірус, транспорт, транспорт білків.\\nЛокалізований у цитоплазмі, ядрі."},{"page_url":"https://cy.wikipedia.org/wiki/John_Betjeman","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/John_Betjeman.jpg","page_title":"John Betjeman","context_page_description":"Bardd Seisnig yn yr iaith Saesneg ac awdur ar bensaernïaeth oedd Syr John Betjeman. Fe oedd Bardd Llawryfog y Deyrnas Unedig o 1972 hyd ei farwolaeth.\\nRoedd Betjeman yn un o hoff feirdd y cyhoedd ac yn gyfarwydd o ganlyniad i'w gerddi hawdd eu darllen a'i ymddangosiadau ar y radio a'r teledu. Fe gafodd ei alw'n aml yn \\"the nation's teddy bear\\"."},{"page_url":"https://es.wikipedia.org/wiki/Johnny_Woodly","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Johnny_Woodly.jpg","page_title":"Johnny Woodly","context_page_description":"Johnny Mauricio Woodly Lambert, es un futbolista costarricense que juega como delantero y actualmente milita en el equipo de la Asociación Deportiva Barrio México, de Segunda División de Costa Rica."},{"page_url":"https://de.wikipedia.org/wiki/Nordafrikanische_Elefantenspitzmaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Petrosaltator_rozeti-Zootaxa.jpg","page_title":"Nordafrikanische Elefantenspitzmaus","context_page_description":"Die Nordafrikanische Elefantenspitzmaus oder der Nordafrikanische Rüsselspringer, ist eine Art aus der Familie der Rüsselspringer. Lange Zeit wurde sie zu den Elefantenspitzmäusen gestellt, denen sie morphologisch stark ähnelt. Allerdings zeigen sowohl einzelne Merkmale der Skelett- und der Weichteilanatomie als auch Ergebnisse der Molekulargenetik eine nähere Beziehung zur Rüsselratte an. Im Jahr 2016 erhielt die daraufhin einen eigenen Gattungsstatus. Die Art ist der einzige Vertreter der Familie, der im nordwestlichen Afrika nördlich der Sahara vorkommt. Als bevorzugter Lebensraum fungieren felsige und trockene Landschaften mit Gebüschvegetation. Typisch im äußeren Erscheinungsbild sind die verlängerte, rüsselsartige Nase sowie die langen Hinter- und kurzen Vorderbeine, was ebenfalls für die Elefantenspitzmäuse charakteristisch ist. Die Tiere leben bodenbewohnend und ernähren sich hauptsächlich von Insekten. Im Fortpflanzungsverhalten weicht die Art durch eine längere Tragzeit und eine durchschnittlich höhere Anzahl an Neugeborenen je Wurf von den Vertretern der Elefantenspitzmäuse ab. Wissenschaftlich eingeführt wurde die Nordafrikanische Elefantenspitzmaus im Jahr 1833."},{"page_url":"https://eo.wikipedia.org/wiki/Romantikismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Caspar_David_Friedrich_-_Wanderer_above_the_sea_of_fog.jpg","page_title":"Romantikismo","context_page_description":"Romantikismo estis arta, literatura kaj intelekta movado precipe en la unua duono de la 19-a jarcento en Eŭropo. Ĝi havis siajn originojn en la dua duono de la 18-a jarcento, kaj fortiĝis kiel reago al la Industria Revolucio. Parte la romantikismo estis ribelo kontraŭ aristokrataj sociaj kaj politikaj normoj de la klerismo kaj reago kontraŭ la scienca raciigo de naturo. Ĝi enkorpiĝis plej forte en la vidaj artoj, muziko, kaj literaturo, sed havis gravan efikon ankaŭ al historiografio, eduko kaj naturhistorio.\\nDistanciĝante de la klasikismo la romantikistoj volas liberiĝi el ties malvastaj reguloj, el la regado de intelekto kaj sobreco. La romantikismon karakterizas strebado al sento kaj fantazio. El tiuj du fontoj la romantikistoj ĉerpas inspiron. Koloron, pitoreskon, eĉ terurecon, svagajn kaj nekontentigeblajn sopirojn ili taksas pli valoraj ol enkapsuligon de nobla klareco kaj reguleco, drastigon kaj esprimivon pli ol moderecon.\\nDifini la ideon de la romantikismo ŝajnas neebla. La adeptoj de la romantikismo parolis pri ĝi preskaŭ nur per alegorioj. Kio estas nepalpebla, eĉ ne eldirebla, tio iĝis la objekto de la revadoj de la romantikistoj."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%96%D0%BA%D1%96%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Flag_of_Bikinsky_rayon.png","page_title":"Бікінський район","context_page_description":"Бікі́нський район — район у складі Хабаровського краю Російської Федерації.\\nАдміністративний центр — місто Бікін."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%A3%E0%B8%B9%E0%B9%89%E0%B8%AA%E0%B8%B6%E0%B8%81%E0%B8%AB%E0%B8%A1%E0%B8%B8%E0%B8%99%E0%B9%80%E0%B8%9B%E0%B9%87%E0%B8%99%E0%B8%A3%E0%B8%B0%E0%B8%A2%E0%B8%B0%E0%B9%81%E0%B8%9A%E0%B8%9A%E0%B9%84%E0%B8%A1%E0%B9%88%E0%B8%A3%E0%B8%B8%E0%B8%99%E0%B9%81%E0%B8%A3%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Balance_Disorder_Illustration_A.png","page_title":"การรู้สึกหมุนเป็นระยะแบบไม่รุนแรง","context_page_description":"อาการรู้สึกหมุนฉับพลันขณะเปลี่ยนท่า เป็นโรคที่เกิดจากความผิดปกติของหูชั้นใน ผู้ป่วยจะมีอาการเวียนศีรษะเหมือนมีบ้านหมุน เป็นสาเหตุของอาการรู้สึกหมุนที่พบบ่อยมากที่สุดอย่างหนึ่ง"},{"page_url":"https://es.wikipedia.org/wiki/Enrique_San_Francisco","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Retrato_de_enrique.jpg","page_title":"Enrique San Francisco","context_page_description":"Rogelio Enrique San Francisco Cobo, popularmente conocido como Quique San Francisco, es un humorista y actor español."},{"page_url":"https://pl.wikipedia.org/wiki/Roman_Krukowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Krukowski_Roman.jpg","page_title":"Roman Krukowski","context_page_description":"Roman Stanisław Krukowski – polski pracownik samorządowy, działacz społeczny, poseł na Sejm IV kadencji w II Rzeczypospolitej, członek władz Obwodu Warszawa-Południe Obozu Zjednoczenia Narodowego w 1939 roku."},{"page_url":"https://bar.wikipedia.org/wiki/Wei%C3%9Fdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Weissdorf2.JPG","page_title":"Weißdorf","context_page_description":"Weißdorf is a Gmoa im Regiarungsbeziak obafränkischn Landkroas Hof und Mitglied vo da Vawoitungsgmoaschoft Sparneck."},{"page_url":"https://fi.wikipedia.org/wiki/Kudos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Blausen_0012_AdiposeTissue.png","page_title":"Kudos","context_page_description":"Kudos muodostuu vierekkäisistä, samalla tavoin toimivista soluista ja soluväliaineesta. Näiden perusteella kudokset luokitellaan usein neljään päätyyppiin: epiteelikudos, tukikudos, hermokudos ja lihaskudos. Monesti veri ja imuneste katsotaan omiksi ryhmikseen, joiden erikoispiirre on että soluväliaine on nestemäistä. Yhteen liittyneet kudokset muodostavat elimiä. Kudoksia tutkii kudosoppi eli histologia."},{"page_url":"https://sk.wikipedia.org/wiki/Lesko","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Lesko%2C_Ratusz.jpg","page_title":"Lesko","context_page_description":"Lesko je mesto v Poľsku v Podkarpatskom vojvodstve v okrese Powiat leski v rovnomennej gmine.\\nŽije tu 5 796 obyvateľov."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%AD%D9%84%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/LimosellaAquatica.jpg","page_title":"وحلية","context_page_description":"وَحْلِيَّة، جنس نباتات مائية إلى حد كبير، حولية من فصيلة الغدبية. توجد في المناطق الموحلة في جميع أنحاء العالم. نشوءها السُلالي وجُغْرافِيَتها الحَيَوِيَّة تُستنتج من بياناتها الجزيئية."},{"page_url":"https://en.wikipedia.org/wiki/Frederick_Banting","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Banting_birthplace_%2830169914253%29.jpg","page_title":"Frederick Banting","context_page_description":"Sir Frederick Grant Banting KBE MC FRS FRSC was a Canadian medical scientist, physician, painter, and Nobel laureate noted as the co-discoverer of insulin and its therapeutic potential.\\nIn 1923, Banting and John James Rickard Macleod received the Nobel Prize in Medicine. Banting shared the honours and award money with his colleague, Charles Best. As of November 2018, Banting, who received the Nobel Prize at age 32, remains the youngest Nobel laureate in the area of Physiology/Medicine. That same year, the Government of Canada granted Banting a lifetime annuity to continue his work. In 1934, he was knighted by King George V."},{"page_url":"https://de.wikipedia.org/wiki/Ryan_Robbins_(Schauspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Ryan_Robbins_at_Armageddon_Expo_Sydney_2011.JPG","page_title":"Ryan Robbins (Schauspieler)","context_page_description":"Ryan Robbins ist ein kanadischer Schauspieler."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_662","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/NGC_0662_DSS.jpg","page_title":"NGC 662","context_page_description":"NGC 662 galaxia espiral bat da, Andromeda konstelazioan. Édouard Stephanek aurkitu zuen 1884ko azaroaren 22an."},{"page_url":"https://es.wikipedia.org/wiki/Isla_de_Pascua_(comuna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Flag_of_Rapa_Nui%2C_Chile.svg","page_title":"Isla de Pascua (comuna)","context_page_description":"Isla de Pascua es una comuna con régimen especial​​ perteneciente a la Provincia de Isla de Pascua en la Región de Valparaíso, Chile. Es la única comuna que pertenece a la provincia de Isla de Pascua y agrupa a Isla de Pascua y la Isla Salas y Gómez. Su capital es el poblado de Hanga Roa, ubicado en la zona suroriental de la isla principal, donde se concentra la totalidad de la población."},{"page_url":"https://zh.wikipedia.org/wiki/1945%E5%B9%B4%E6%96%B0%E5%9B%9B%E5%86%9B%E7%BC%96%E5%88%B6%E5%BA%8F%E5%88%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Li_Xiannian_and_the_US_pilots.jpg","page_title":"1945年新四军编制序列","context_page_description":"1945年新四军编制序列，为列举1945年夏国民革命军陆军新编第四军的编制序列。\\n根据国共两党达成的协议，1937年10月，江西、福建、广东、湖南、湖北、河南、浙江、安徽等八省的红军和游击队改编为国民革命军陆军新编第四军，简称新四军，团结抗日。该部队仍归属中共中央军事委员会直接领导与指挥。1941年皖南事变后，国民政府取消了新四军的建制，但新四军仍然存在。直到1947年初，中共中央军委才正式将新四军部队改编为中国人民解放军。\\n新四军自建制以来逐步进行扩编，至1945年夏，其下属已经包括苏浙军区、苏中军区、第二师兼淮南军区、第三师兼苏北军区、第四师兼淮北军区、第五师兼鄂豫皖湘赣军区、第七师兼皖江军区。总兵力为268,581人。"},{"page_url":"https://bg.wikipedia.org/wiki/Acropora_divaricata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Acropora_divaricata%2C_Aureed.JPG","page_title":"Acropora divaricata","context_page_description":"Acropora divaricata е вид корал от семейство Acroporidae. Възникнали са преди около 0,78 млн. години по времето на периода кватернер. Видът е почти застрашен от изчезване."},{"page_url":"https://fr.wikipedia.org/wiki/Isotopes_du_neptunium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Neptunium-237-decay-scheme-simplified.svg","page_title":"Isotopes du neptunium","context_page_description":"Le neptunium est un élément synthétique qui n'a par conséquent pas de masse atomique standard. Comme tous les éléments synthétiques, il ne possède aucun isotope stable. Le premier isotope synthétisé en 1940 fut le neptunium 239 en bombardant ²³⁸U avec des neutrons pour produire ²³⁹U, qui subit ensuite une désintégration β pour former ²³⁹Np."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B8%D0%B1%D1%81%D0%BE%D0%BD,_%D0%94%D0%B0%D1%84%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Duff_Gibson.jpg","page_title":"Гибсон, Дафф","context_page_description":"Дафф Гибсон — канадский скелетонист, выступавший за сборную Канады с 1999 года по 2006. Участвовал в двух зимних Олимпиадах, в Солт-Лейк-Сити занял лишь десятое место, в то время как в Турине удостоился золотой награды, менее чем на пол секунды опередив своего соотечественника Джеффа Пэйна. Эта победа сделала его самым возрастным канадцем в истории зимних Олимпиад, получившим золотую медаль. Кроме того, Гибсон стал самым возрастным спортсменом за всю историю зимних Олимпиад, выигравшим золотую медаль в индивидуальных видах спорта"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%94%D0%B5%D0%B2%D0%B8%D0%BD%D0%B8_%D0%9A%D1%83%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/%D0%94%D0%B5%D0%B2%D0%B8%D0%BD%D0%B8_%D0%9A%D1%83%D0%BB%D0%B8_10.jpg","page_title":"Девини Кули","context_page_description":"Девини Кули — археолошко наоѓалиште на два километри јужно од поречкото село Девич. Се наоѓа на околу седум километри до Македонски Брод, во насоката кон Самоков. Тврдината се наоѓа на рид што се издигнува на височина од околу 75 метри над коритото на реката Треска. На ова место, реката прави голем завој и го оградува градиштето од три страни."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B2%D8%AD%D9%84%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Zahle%2CLebanon.JPG","page_title":"زحلة","context_page_description":"زحلة هي إحدى المدن اللبنانية من مدن قضاء زحلة في محافظة البقاع. وهي مركز القضاء. تسمى بعروس البقاع. اسست عام 1711 واستطاعت أن تنشيء أول جمهورية في الشرق بين عامي 1825 و 1858. تعتبر همزة وصل تجارة بين بيروت، دمشق، بغداد والموصل، خصوصاً بعد إقامة الخط الحديدي عام 1885. تشتهر بواديها الذي يجري فيه نهر البردوني وبمطاعمها المتناثرة على ضفافه.\\nزحلة هي المدينة الأحدث عهداً بين معظم مدن لبنان. ولُقبت بـ\\"عاصمة الكثلكة في الشرق\\" وبـ\\"مدينة الكنائس\\"؛ فهي تحتوي حوالي 50 كنيسة، وتعتبر أكبر مدينة مسيحية في الشرق وتتنافس في هذا الموقع مع مدينة جونية اللبنانية أيضاً والتي تسكنها أغلبية مارونية. وتعتبر زحلة ثالث أكبر مدينة لبنانيّة من حيث عدد السكان،.\\nتتميز زحلة ببيوتها القديمة، ذات القرميد الأحمر والقناطر. تتركّز صورة زحلة المناطقيّة والعالميّة على منتجاتها من عرق ونبيذ ومواد غذائيّة. وهي عاصمة المنتجات الزراعيّة الغذائيّة والقطب الزراعي على الصعيدين المحلي والشرق الأوسطي.\\nزحلـة مدينـة الخمر والشعر وهكـذا سميـت، وهي مدينـة السهل والجبل تربـط سهل البقاع الخصيـب ببيـروت والجبـل ودمشق."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%88%D9%88_%DB%8C%D9%88_(%D8%A8%D8%A7%D8%B2%DB%8C%DA%A9%D9%86_%D8%AA%D9%86%DB%8C%D8%B3_%D8%B1%D9%88%DB%8C_%D9%85%DB%8C%D8%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Mondial_Ping_-_Women%27s_Doubles_-_Final_-_69.jpg","page_title":"گوو یو (بازیکن تنیس روی میز)","context_page_description":"گوو یو یک بازیکن تنیس روی میز اهل جمهوری خلق چین است.\\nوی در مسابقات کشوری و بین‌المللی در مجموع برنده ۱۲ مدال طلا، ۵ مدال نقره، ۴ مدال برنز شده‌است."},{"page_url":"https://gl.wikipedia.org/wiki/Guanches","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Belmaco.jpg","page_title":"Guanches","context_page_description":"Os guanches son os primeiros habitantes coñecidos das illas Canarias. Estes pobos, de orixe bérber, vivían no Neolítico á chegada dos europeos durante a Idade media. A súa cultura desapareceu, mais ten deixado algunhas trazas."},{"page_url":"https://en.wikipedia.org/wiki/Middle_kingdoms_of_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Ajanta_%2863%29.jpg","page_title":"Middle kingdoms of India","context_page_description":"The Middle kingdoms of India were the political entities in India from the 3rd century BCE to the 13th century CE. The period begins after the decline of the Maurya Empire and the corresponding rise of the Satavahana dynasty, starting with Simuka, from 230 BCE. The \\"Middle\\" period lasted for about 1500 years and ended in the 13th century, with the rise of the Delhi Sultanate, founded in 1206, and the end of the Later Cholas.\\nThis period encompasses two eras: Classical India, from the Maurya Empire up until the end of the Gupta Empire in the 6th century CE, and early Medieval India from the 6th century onwards. It also encompasses the era of classical Hinduism, which is dated from 200 BCE to 1100 CE. From 1 CE until 1000 CE, India's economy is estimated to have been the largest in the world, having between one-third and one-quarter of the world's wealth. It is followed by the late Medieval period in the 13th century."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%A7%E5%93%81%E5%AF%BF%E5%91%BD%E7%BB%93%E6%9D%9F%E5%85%AC%E5%91%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/ProductEndOfLifeCycle.png","page_title":"产品寿命结束公告","context_page_description":"产品寿命结束公告是硬件或软件产品中，产品寿命结束阶段的开始，产品寿命结束公告后的一段时间是最后订购日期，最多可到90天。若消费者若需要产品/备品需在此期间内下单。JEDEC标准中有列出产品生命周期中的产品寿命结束周期。"},{"page_url":"https://es.wikipedia.org/wiki/Orbec","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Map_commune_FR_insee_code_14478.png","page_title":"Orbec","context_page_description":"Orbec es una población y comuna francesa, situada en la región de Baja Normandía, departamento de Calvados, en el distrito de Lisieux y cantón de Orbec."},{"page_url":"https://en.wikipedia.org/wiki/La_Union","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/FvfSudipenTagudin5010_36.JPG","page_title":"La Union","context_page_description":"La Union is a province in the Philippines located in the Ilocos Region in the island of Luzon. Its capital is the city of San Fernando, which also serves as the regional center of the whole Ilocos Region.\\nThe province is bordered by Ilocos Sur to the north, Benguet to the east, Pangasinan to the south and to the west by the shores of the South China Sea."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B2%D9%84%D8%AC_%D8%B4%D8%B1%D8%A7%D8%B9%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Kitesurfing_Sotavento.jpg","page_title":"تزلج شراعي","context_page_description":"التزلج الشراعي هي رياضة حركية تجمع بين جوانب التزلج على الجليد والتزلج على الماء وركوب الأمواج في رياضة واحدة. حيث يستخدم لوح التزلج الشراعي قوة الرياح مع طائرة ورقية كبيرة يمكن التحكم فيها ليتم دفعها عبر الماء أو الثلج أحيانًا.\\nمقارنة برياضات الإبحار الأخرى، يعد التزلج الشراعي أقل تكلفة والأكثر ملاءمة. كما أنها فريدة من نوعها من حيث أنها تحصد طاقة الرياح من حجم جو أكبر بكثير، مقارنة بحجم الشراع.\\nتعتمد رياضة التزلج الشراعي على قوة الرياح باستخدام الشراع من أجل دفع وتحريك اللوح على سطح الماء. هناك دورة تسمى نقطة الأمواج والتي تهدف للتركيز على اتجاه الرياح. ركوب الأمواج التقليدي لا يمكنه اخذ الطاقة من اللوح أثناء ركوب الموج القريب من الرياح. عند ركوب الأمواج، يقوم راكب الموج بضبط لوح التزلج تبعا لاتجاه الريح من أجل تحريك اللوح بواسطة قوة الرياح."},{"page_url":"https://es.wikipedia.org/wiki/Apeninos_s%C3%ADculos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Boschi_da_Cummar%C3%A0.jpg","page_title":"Apeninos sículos","context_page_description":"Los Apeninos sículos son una subdivisión de la cadena de los Apeninos que se encuentra en Sicilia. Están separados de los Apeninos calabreses por el estrecho de Mesina.\\nCuando se habla del relieve sículo se entiende todo el relieve montañoso de la isla, la expresión Apeninos sículos se refiere al conjunto de los montes Peloritani, Nebrodi y Madonia, todos situados en el mismo alineamiento en la parte nororiental de la isla, a lo largo de la costa tirrénica. Permanecen pues fuera de los Apeninos sículos propiamente dichos el Etna, los Montes Erei y los Iblei.\\nLos Apeninos sículos empiezan sobre el estrecho de Mesina, a espaldas de la ciudad de Mesina; este primer tramo de la cadena está constituido por los montes Peloritani; sigue luego hacua el oeste con el nombre de montes Nebrodi; andando aún más hacia el oeste la cadena apenínica prosigue con Madonia en la zona de Cefalù. Los últimos ramales de los Apeninos, ya en la Sicilia occidental, rodean el área metropolitana de Palermo; este último tramo es conocido como los montes de Palermo.\\nLa altura máxima es el Pizzo Carbonara, segunda cima de Sicilia después del Etna; esta última altura no forma parte de ningún sistema montañoso."},{"page_url":"https://it.wikipedia.org/wiki/Bandiera_del_Brasile","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bandeiras06052007.jpg","page_title":"Bandiera del Brasile","context_page_description":"La prima bandiera della Repubblica Brasiliana fu adottata il 15 novembre del 1889. Fu ideata da Raimundo Teixeira Mendes, con la collaborazione di Miguel Lemos e del professor Manuel Pereira Reis. Il disegno venne eseguito da Décio Villares.\\nLa bandiera è verde, con un grande rombo giallo al centro che ricorda i colori della bandiera imperiale. All'interno del rombo è posto un cerchio blu, con delle stelle bianche di cinque dimensioni differenti e una fascia bianca che lo attraversa. Sulla fascia è inscritto il motto \\"Ordem e Progresso\\", che è tratto da una celebre frase di Auguste Comte. Le costellazioni che figurano nella bandiera nazionale corrispondono all'aspetto del cielo, nella città di Rio de Janeiro, alle ore 8 e 30 minuti del giorno 15 novembre 1889 e devono essere considerate come viste da un osservatore situato al di fuori della sfera celeste. La bandiera è nota in portoghese col nome di A Auriverde, tradotto in italiano come \\"La Verde-oro\\"."},{"page_url":"https://es.wikipedia.org/wiki/Peugeot_308","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Peugeot_308_%28Facelift%29_%E2%80%93_Frontansicht%2C_21._Mai_2011%2C_D%C3%BCsseldorf.jpg","page_title":"Peugeot 308","context_page_description":"El Peugeot 308 es un automóvil de turismo del segmento C producido por el fabricante francés Peugeot desde finales del año 2007. Es un cinco plazas con tracción delantera y motor delantero transversal. Además es el primer Peugeot que repite el último número, y no será el último, porque desde este Peugeot, continuará con el 8 en todos sus nuevos modelos.​ Su segunda generación fue elegido Coche del Año en Europa en 2014.​\\nEl Peugeot 308 cuenta con una versión sedán, el Peugeot 408, que solo se vende en China y Sudamérica."},{"page_url":"https://nl.m.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1988","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Abid.JPG","page_title":"Lijst van personen geboren in 1988","context_page_description":"Dit is een lijst van personen die geboren zijn in 1988.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/St._Emmeram_(Oberf%C3%B6hring)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Pumpen-_und_Flo%C3%9Fw%C3%A4rterh%C3%A4uschen_Oberf%C3%B6hring.jpg","page_title":"St. Emmeram (Oberföhring)","context_page_description":"St. Emmeram ist ein Viertel im Münchner Stadtteil Oberföhring."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B8%83%E5%88%97%E5%A1%94%E5%B0%BC%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Kouignamann.JPG","page_title":"布列塔尼人","context_page_description":"布列塔尼人是法国西北部布列塔尼半岛上的民族。使用布列塔尼语，属于印欧语系凯尔特语族不列颠语支。"},{"page_url":"https://nl.wikipedia.org/wiki/Fort_bij_Penningsveer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Luchtfoto%27s_-_Penningsveer_-_20181736_-_RCE.jpg","page_title":"Fort bij Penningsveer","context_page_description":"Het Fort bij Penningsveer is een fort van de Stelling van Amsterdam. Het is gelegen aan de rivier de Liede bij de buurtschap Penningsveer, ten oosten van Haarlem.\\nVoordat de Stelling van Amsterdam werd aangelegd, kende Amsterdam al een eerdere verdedigingsgordel. Cornelis Krayenhoff kreeg in 1799 de opdracht om een permanente linie rondom de stad te ontwerpen die met gebruik van inundaties en aarden werken Amsterdam moest verdedigen. Deze werken stonden bekend als de Posten van Krayenhoff en bij Penningsveer kwam in 1813 Post 2 gereed, welke later werd opgenomen in de Stelling van Amsterdam.\\nIn 1886 werd begonnen op deze plaats met het opwerken van een aardwerk. Het zand werd daarna lange tijd met rust gelaten zodat het kon inklinken. Negen jaar later werd het zand vergraven tot een verdedigbaar aardwerk. De bomvrije gebouwen van Fort bij Penningsveer werden in 1901 opgeleverd en het fort maakte deel uit van de Positie bij de Liede. Deze Positie lag aan de oostkant van Haarlem bij de Liede en bestond uit dit fort, Fort bij de Liebrug en Fort aan de Liede, een liniewal, batterijen en inundatiesluizen."},{"page_url":"https://es.wikipedia.org/wiki/Renault_Clio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Renault_Clio_III_Phase_I_Dreit%C3%BCrer_2_1.2_16V.JPG","page_title":"Renault Clio","context_page_description":"El Renault Clio es un automóvil perteneciente al segmento B producido por el fabricante francés de automóviles Renault. Se comenzó a comercializar en 1990 como sucesor del Renault Supercinco.\\nEl Clio no se comercializa con este nombre en todos los países. En Japón es conocido por el de Lutecia, nombre que alude al origen romano de la ciudad de París.\\nEl Renault Clio fue elegido Coche del Año en Europa en 1991 y 2006, Coche del Año en España en 1991, \\"Mejor Automóvil Subcompacto\\" Automóvil Panamericano magazine en 2002, 2003 y 2004 en México."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%89%E6%9C%BA%E7%A1%BC%E5%8C%96%E5%90%88%E7%89%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Boryllithium.png","page_title":"有机硼化合物","context_page_description":"有机硼或有机硼化合物是一类硼烷BH₃的有机衍生物，如：三烷基硼烷。有机硼化学或有机硼烷化学是研究这类化合物的化学。 在有机化学中，有机硼化合物因其多种变化而被广泛应用，其中如常用的还原反应：硼氢化反应。"},{"page_url":"https://sk.wikipedia.org/wiki/Postbyzantsk%C3%A9_umenie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B3%D0%BE%D1%84_%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86_%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D1%81%D0%B1%D0%BE%D0%BA%D1%83.jpg","page_title":"Postbyzantské umenie","context_page_description":"Postbyzantské umenie je označenie množiny viacerých individuálnych umeleckých smerov, ktoré sa začali rozvíjať v rôznych, prevažne ortodoxných oblastiach Európy a Ázie pod vplyvom byzantského umenia, obzvlášť po páde Konštantínopola v roku 1453. Byzantská umelecká tradícia pokračovala na viacerých miestach, jednak šlo o v centrá vytvorené už v staršom období v Srbsku, Bulharsku, Valašsku, Moldavsku a Rusku, ale aj na Kréte okupovanej Benátkami a v Osmanskej ríši. Významný bol vplyv byzantskej architektúry v ortodoxných krajinách, ikony Krétskej školy boli zase známe a dychtivo vyhľadávané aj za hranicami ostrova v latinskej Európe, kde ovplyvnili štýl niektorých raných renesančných umelcov. Mnohí maliari Krétskej školy boli \\"dvojjazyční\\", maľovali buď alla greca, alebo alla latina."},{"page_url":"https://de.wikipedia.org/wiki/Via_Militaris_(Balkan)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/TrayanoviVragta.jpg","page_title":"Via Militaris (Balkan)","context_page_description":"Die Via Militaris oder auch Via Diagonalis, selten und unlateinisch auch Via Singidunum war eine antike römische Straßenverbindung auf dem Balkan, die die Landverbindung zwischen Europa und Kleinasien herstellte. Lange Zeit war sie die einzige Festlandroute zwischen Orient und Okzident. Während der Kreuzzüge, den osmanischen Belagerungen Wiens, der Raubzüge der Hunnen und Awaren, sowie der Wanderungen der Goten und Slawen hat sie eine weltgeschichtliche Rolle gespielt.\\nDie Via Diagonalis, die große Balkanstraße, war fast vier Jahrhunderte lang eine wichtige militärische Achse, die das Römische Reich zusammenhielt.\\nHeute ist die Via Militaris verfallen und nur noch an wenigen Stellen genau zu identifizieren. Auch ist die genaue Lage aller Wegestationen nicht genau zu bestimmen, jedoch ist der Name aller Wegestationen aus den Quellen bekannt. Das südöstliche Ende der Via Militaris war unbestritten Konstantinopel. Das nordwestliche Ende ist nicht genau definiert und wird je nach Autor in Singidunum, Viminatium, Sirmium, Aquincum oder gar Carnuntum lokalisiert."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80_%D0%A5%D0%B8%D0%BB%D0%B0%D0%BD%D0%B4%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/%D0%98%D0%BA%D0%BE%D0%BD%D0%B0-%D0%91%D0%BE%D0%B6%D0%B8%D0%B5%D0%B9-%D0%9C%D0%B0%D1%82%D0%B5%D1%80%D0%B8-%D0%A2%D1%80%D0%BE%D0%B5%D1%80%D1%83%D1%87%D0%B8%D1%86%D0%B0.jpg","page_title":"Манастир Хиландар","context_page_description":"Хиландар или Хилендар, такође и Хеландар, српски је православни мушки манастир државе православних монаха која постоји више од хиљаду година. Манастир је саграђен на иницијативу Светог Саве, који је постао монах на планини Атос 1191. године. Налази се у северном делу Свете горе, на полуострву Халкидики односно трећем краку полуострва Халкидики — Атосу, у северној Грчкој. Манастир је удаљен 2,5 km од Егејског мора.\\nХиландар је у хијерархији Свете горе на 4. месту по значају. Посматран споља, манастир има изглед средњовековног утврђења, с обзиром да је утврђен бедемима који су високи и до 30 m. Спољни зидови су у просеку дугачки 140 m и окружују површину која је широка око 75 m. Манастир је овако утврђен пошто је у прошлости, као и остала утврђена монашка насеља на Светој гори, морао да се брани од гусара. Неки сматрају Хиландар једним од првих универзитета, у претходничкој форми, а конкретно првим српским универзитетом. Садашњи игуман манастира Хиландар је Методије Марковић.\\nМанастир Хиландар је изградио грчки монах-светогорац, Георгије Хиландарио. Обновили су га Стефан Немања и његов син Сава 1198. године, а у манастиру је 1199. године умро Стефан Немања."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC1%E6%AC%A1%E5%90%89%E7%94%B0%E5%86%85%E9%96%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Hiroo_Wada_01.jpg","page_title":"第1次吉田内閣","context_page_description":"第1次吉田内閣は、外務大臣・貴族院議員の吉田茂が第45代内閣総理大臣に任命され、1946年5月22日から1947年5月24日まで続いた日本の内閣である。\\nこれが旧憲法下で天皇から組閣の大命を受けて発足した最後の内閣となった。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D1%81_%D0%BF%D0%B5%D1%80%D0%B0%D0%BC%D0%BE%D0%B3_%D0%9C%D0%B0%D0%BD%D1%84%D1%80%D1%8D%D0%B4%D0%B0_%D1%84%D0%BE%D0%BD_%D0%A0%D1%8B%D1%85%D1%82%D0%B3%D0%BE%D1%84%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/EarlyDH4.jpg","page_title":"Спіс перамог Манфрэда фон Рыхтгофена","context_page_description":"У дадзеным спісе адлюстраваны перамогі самага рэзультатыўнага аса Першай сусветнай вайны лейтэнанта Манфрэда фон Рыхтгофена, вядомага таксама пад мянушкай «Чырвоны барон». Усяго вядома 80 перамог, атрыманых ім у перыяд з 17 верасня 1916 па 20 красавіка 1918 года. Усе перамогі, за адзіным выключэннем, былі здабытыя над брытанскімі лётчыкамі. У спісе ў храналагічным парадку указаны:\\nпарадкавы нумар перамогі — графа «#»;\\nдата атрыманай перамогі — графа «Дата»;\\nдадзеныя аб пілотах, з якімі сутыкаўся барон, а таксама назвы іх падраздзяленняў — графа «Авіятары»;\\nдадзеныя аб самалётах, як англійскіх, так і германскіх — марка, серыйны нумар і нумар падраздзялення — графа «Самалёты»;\\nапісанне баявых сутыкненняў і абставін, пры якіх была здабыта тая ці іншая перамога, з указаннем прыблізных каардынат месцаў вынікаў перамогі — графа «Гісторыя».\\nГрафа «Самалёты» ці ўсе графы часам вылучаюцца колерамі:\\n— вылучэнне дадзеным колерам ўсіх граф азначае, што дадзеная перамога фон Рыхтгофена не была пацверджаная бокам-супернікам, альбо была здабытая іншым нямецкім авіятарам, але тым не менш, залічаная менавіта Рыхтгофену."},{"page_url":"https://en.wikipedia.org/wiki/List_of_bridges_in_Egypt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bridge_Giza_Zoo.jpg","page_title":"List of bridges in Egypt","context_page_description":"Nicolas Janberg, Structurae.com, International Database for Civil and Structural Engineering\\nOthers references"},{"page_url":"https://sv.wikipedia.org/wiki/Heliga_Trefaldighetskyrkan,_Jerevan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Holy_Trinity_Church%2C_Malatia-Sebastia%2C_Yerevan%2C_Armenia.jpg","page_title":"Heliga Trefaldighetskyrkan, Jerevan","context_page_description":"Heliga Trefaldighetskyrkan är en kyrka i distriktet Malatia-Sebastia i Jerevan. Den byggdes 2001–2003 och konsekrerades 2005. Den har gestaltats efter den tidigare 600-talskatedralen i Zvartnots.\\nKyrkan ritades av Baghdasar Arzoumanian."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%B0_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Nowy_herb_Ryglice_2018_POL_COA.png","page_title":"Города Польши","context_page_description":"По состоянию на 1 января 2019 года в Польше насчитывается 940 городов.\\nПольские города относятся к следующим размерным диапазонам с точки зрения количества жителей:\\n1 город с населением более 1 млн. жителей\\n4 города с населением от 500 000 до 999 999 жителей\\n11 городов с населением от 200 000 до 499 999 жителей\\n23 города с населением от 100 000 до 199 999 жителей\\n45 городов с населением от 50 000 до 99 999 жителей\\n69 городов с населением от 30 000 до 49 999 жителей\\n68 городов с населением от 20 000 до 29 999 жителей\\n187 городов с населением от 10 000 до 19 999 жителей\\n176 городов с населением от 5000 до 9999 жителей\\n220 городов с населением от 2500 до 4999 жителей\\n129 городов с населением от 1000 до 2499 жителей\\n7 городов с населением менее 1000 жителей"},{"page_url":"https://nl.wikipedia.org/wiki/James_Craig_Annan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/James_craig_annan_by_william_strang.jpg","page_title":"James Craig Annan","context_page_description":"James Craig Annan was een Schots fotograaf. Hij wordt gerekend tot de stroming van het picturalisme."},{"page_url":"https://fi.wikipedia.org/wiki/Viirukurkkupeukaloinen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bonner_zoologische_Monographien_-_Thryothorus_leucopogon_leucopogon.jpg","page_title":"Viirukurkkupeukaloinen","context_page_description":"Viirukurkkupeukaloinen on peukaloisten heimoon kuuluva varpuslintu."},{"page_url":"https://fr.wikipedia.org/wiki/Bossus-l%C3%A8s-Rumigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Bossus-l%C3%A8s-Rumigny_%28Ardennes%29_%C3%89glise_Saint-Martin%2C_fa%C3%A7ade.JPG","page_title":"Bossus-lès-Rumigny","context_page_description":"Bossus-lès-Rumigny est une commune française située dans le département des Ardennes, en région Grand Est."},{"page_url":"https://ms.wikipedia.org/wiki/Ufuk","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Earth%27s_horizon_as_seen_from_Shuttle_Endeavour.jpg","page_title":"Ufuk","context_page_description":"Ufuk atau kaki langit merupakan garis yang kelihatan seperti memisahkan bumi dari langit. Lebih tepatnya, ufuk ialah garis yang membahagi arah garis pandang kita ke dalam dua kategori: arah garis pandang yang memotong permukaan Bumi, dan yang tidak. Dalam banyak tempat, ufuk benar terhalang oleh pokok, bangunan, gunung, dan sejenisnya, yang membuat perpotongan antara bidang permukaan bumi dan bidang langit kemudian dikenal sebagai ufuk tampak."},{"page_url":"https://lmo.wikipedia.org/wiki/Tanacetum_balsamita","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Balsamita_major.jpg","page_title":"Tanacetum balsamita","context_page_description":"Tanacetum balsamita l'è 'na piànta erbàcea perène de la famìa botànica de le Asteraceae, cunusìda apò a col nòm popolàr de èrba amàra o èrba cazonsèla. L'è uriginària de l'Azia ma la s'è fàda natüràla en töta l'Europa meridiunàla e centràla."},{"page_url":"https://zh.wikipedia.org/zh-my/1970%E5%B9%B4%E4%BB%A3%E8%87%BA%E7%81%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Sun-Yat-sen_Memorial_Hall_in_Taipei.jpg","page_title":"1970年代臺灣","context_page_description":"1970年代台湾所经历的最重大事件，为面临全球两次石油危机。与其他资本化国家相同，该两次危机导致了台湾经济衰退的危机。从1950年代起，靠外贸支撑经济成长率的台湾面对此危机，采取“扩大公共建设”的方案。这里面，又以中华民国行政院长蒋经国所提出的十大建设最具代表性。1973年，十大建设建设计划正式展开；其计划包括中山高速公路、桃园国际机场、台中港、纵贯铁路电气化、中钢炼钢厂，核能发电、北回铁路、苏澳港、中船造船厂及三轻石油裂解等工程。\\n因为扩大公共建设的政策奏效，加上1970年代中期后的石油危机落幕，台湾不但渡过石油危机，也继续于经济成长率得以继续成长。加上各项外销政策继续施行，使台湾与韩国、香港及新加坡一同跻身为亚洲四小龙。 1975年，统治台湾将近30年的蒋中正，因病去世，主导十大建设的蒋中正之子--蒋经国经由间接选举，成为中华民国第六任总统。\\n同时期，以台北市为主的都会更加蓬勃，兴建了大量公寓并累积大量民间财富。该趋势虽然因为石油危机稍为遏止，但仍成为台湾主流趋势。惟台湾政府因政经情势不明朗，外汇等经济政策仍采取保守方向，埋下1980年代通货膨胀的恶果。\\n因与学生谢聪敏和魏廷朝于1964年共同起草“台湾自救运动宣言”而被中国国民党判刑八年的国立台湾大学教授彭明敏于1970年1月在重重特务的监视下神奇逃抵瑞典。同年2月8日，陆军军官学校学生江炳兴等政治犯受鼓舞而策画共同劫械起义欲武装推翻中国国民党政权的“泰源事件”。"},{"page_url":"https://de.wikipedia.org/wiki/Sander_M._Levin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Sanderlevin.jpg","page_title":"Sander M. Levin","context_page_description":"Sander Martin Levin ist ein US-amerikanischer Politiker der Demokratischen Partei. Von 1983 bis 2019 vertrat er den Bundesstaat Michigan im Repräsentantenhaus der Vereinigten Staaten."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_prot%C3%A9g%C3%A9s_en_1907","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Le_Puy-en-Velay_-_Fontaine_place_des_Tables_-392.jpg","page_title":"Liste des monuments historiques protégés en 1907","context_page_description":"Cet article recense les monuments historiques français classés en 1907."},{"page_url":"https://simple.wikipedia.org/wiki/Mikhail_Fradkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Mikhail_Fradkov_%282016-08-08%29.jpg","page_title":"Mikhail Fradkov","context_page_description":"Mikhail Yefimovich Fradkov is a Russian politician. He was the Prime Minister of Russia from March 2004 to September 2007. Fradkov was the head of Russia's Foreign Intelligence Service from 6 October 2007 to 5 October 2016.\\nSince January 2017, Fradkov is the director of the Russian Institute for Strategic Studies."},{"page_url":"https://nl.wikipedia.org/wiki/Glasoogbaars","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Priacanthus_cruentatus.jpg","page_title":"Glasoogbaars","context_page_description":"De glasoogbaars is een straalvinnige vissensoort uit de familie van de grootoogbaarzen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1801 door Bernard Germain de Lacépède."},{"page_url":"https://en.wikipedia.org/wiki/List_of_governors_of_South_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Thomas_Bothwell_Jeter.jpg","page_title":"List of governors of South Carolina","context_page_description":"This is a list of South Carolina governors. The current governor of South Carolina is Henry McMaster who has been in office since January 24, 2017. South Carolina governors are counted only once; therefore, Joseph West, for instance, a colonial governor who served three non-consecutive terms, is considered the 2nd Governor of South Carolina, not the 2nd, 4th, and 7th. There have been 11 governors who served non-consecutive terms. In addition to West, the others were Joseph Morton, Joseph Blake, Robert Johnson, William Bull II, Lord Charles Montagu, John Rutledge, William Moultrie, Charles Pinckney, John Drayton, and Olin D. Johnston."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Q)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Coa_fam_ITA_querni.jpg","page_title":"Armoriale delle famiglie italiane (Q)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con la lettera Q."},{"page_url":"https://de.wikipedia.org/wiki/212","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Caracalla-Grundriss2.jpg","page_title":"212","context_page_description":"11. Juli: Der römische Kaiser Caracalla verleiht mit der Antoninischen Verfassungsreform jedem freien Bürger des römischen Staates das Bürgerrecht.\\nCaracalla fährt mit der Verfolgung und Hinrichtung zahlloser tatsächlicher und vermeintlicher Anhänger des im Vorjahr von ihm ermordeten Geta fort. Trauerbekundungen gelten als todeswürdiges Verbrechen, auch Getas Mutter Julia Domna darf keine Trauer zeigen.\\nEdessa wird römische Provinz."},{"page_url":"https://lt.wikipedia.org/wiki/Balstog%C4%97s_technikos_universitetas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Politechnika_Bia%C5%82ostocka_-_wydzia%C5%82_informatyki%282%29.jpg","page_title":"Balstogės technikos universitetas","context_page_description":"Balstogės technikos universitetas – valstybinė aukštoji mokykla Balstogėje, Lenkijoje. Lenkijos aukštųjų mokyklų reitinge jis užima 51-60 vietą, tuo tarpu pasaulio reitinguose – 1826.\\nPrivati Vakarinė inžinerijos mokykla buvo įkurta Balstogėje 1949 m. gruodžio 1 d. 1964 m. mokykla gauna Aukštojo mokslo ministerijos leidimą vykdyti ir dienines studijas, taip pat magistro pakopoje, pakeisdama savo pavadinimą į Aukštąją inžinerijos mokyklą. 1974 m. mokykla gauna technikos universiteto statusą."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D1%88%D0%BA%D0%B0_(%D1%80%D1%96%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/182_Matricaria_chamomilla_L.jpg","page_title":"Ромашка (рід)","context_page_description":"Ромашка — рід однорічних дуже розгалужених рослин з сильним ароматичним запахом з родини Айстрові."},{"page_url":"https://en.wikipedia.org/wiki/Mary_Sue_Hubbard","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/IRS_building_on_constitution_avenue_in_DC.jpg","page_title":"Mary Sue Hubbard","context_page_description":"Mary Sue Hubbard was the third wife of L. Ron Hubbard, from 1952 until his death in 1986. She was a leading figure in Scientology for much of her life. The Hubbards had four children; Diana, Quentin, Suzette, and Arthur.\\nShe became involved in Hubbard's Dianetics in 1951, while still a student at the University of Texas at Austin, becoming a Dianetics auditor. She soon became involved in a relationship with Hubbard and married him in March 1952. She accompanied her husband to Phoenix, Arizona, where they established the Hubbard Association of Scientologists – the forerunner of the Church of Scientology, which was itself founded in 1953. She was credited with helping to coin the word \\"Scientology\\". She played a leading role in the management of the Church of Scientology, rising to become the head of the Church's Guardian's Office. In August 1978, she was indicted by the United States government on charges of conspiracy relating to illegal covert operations mounted by the Guardian's Office against government agencies. She was convicted in December 1979 and was sentenced to five years' imprisonment and the payment of a $10,000 fine."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A8%D8%A7%D8%B1%D8%B2%D8%A9_%D8%A7%D9%84%D8%B9%D9%82%D8%AF%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ganglionic_eminence_mice_E12.5_doi_10.1186_1747-5333-1-16-1.jpg","page_title":"البارزة العقدية","context_page_description":"البارزة العقدية -في التشريح العصبي وعلم الأجنة- هي بنية عابرة في الدماغ تتكون في المراحل المضغية والجنينية في عملية النماء العصبي. وتوجد هذه البوارز في الجزء البطني من المخ حيث تكون في شكل انتفاخات في البطينات. وتتطور هذه الانتفاخات إلى عقد قاعدية. وتسهم أيضًا بدور فعال في تكوين جمهرة حمض الغاما أمينوبوتيريك الموجود بجمهرة خلايا القشرة المخية."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BF%9D%E6%97%B6%E6%8D%B7%E8%B6%85%E7%BA%A7%E6%9D%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Richard_Muscat_2013_GT3_Cup_Champion.JPG","page_title":"保时捷超级杯","context_page_description":"保时捷超级杯，全名保时捷美孚1号超级杯，是一个由保时捷组织的国际一级方程式汽车赛。\\n赛上所有24位选手都需使用相同的保时捷赛车。该赛事创办于1993年，赛事大多数时候在欧洲举行，但偶尔也会前往沙特、美国等其他国家。"},{"page_url":"https://ceb.wikipedia.org/wiki/Campochiesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Albenga-chiesa_di_san_giorgio_di_campochiesa.jpg","page_title":"Campochiesa","context_page_description":"Lungsod ang Campochiesa sa Italya. Nahimutang ni sa lalawigan sa Provincia di Savona ug rehiyon sa Liguria, sa kasadpang bahin sa nasod, 400 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. 17 metros ibabaw sa dagat kahaboga ang nahimutangan sa Campochiesa, ug adunay 1,239 ka molupyo.\\nAng yuta palibot sa Campochiesa kay kabungtoran sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang patag. Sa habagatang-sidlakan, dagat ang pinakaduol sa Campochiesa. Ang kinahabogang dapit sa palibot dunay gihabogon nga 662 ka metro ug 3.7 km sa amihanan-kasadpan sa Campochiesa. Ang kinadul-ang mas dakong lungsod mao ang Albenga, 2.9 km sa habagatan-sidlakan sa Campochiesa. Hapit nalukop sa kabalayan ang palibot sa Campochiesa. Sa rehiyon palibot sa Campochiesa, mga lapyahan talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Agosto, sa 26 °C, ug ang kinabugnawan Enero, sa 9 °C. Ang kasarangang pag-ulan 1,269 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 276 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 22 milimetro."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%81%E5%AD%9D%E7%9C%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Yang_Hyo-Jin_1.jpg","page_title":"梁孝真","context_page_description":"梁孝真，韩国女子排球运动员，现为韩国国家女子排球队队员。"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%BA%A4%E5%8A%A0%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/HK_%E7%81%A3%E4%BB%94_Wan_Chai_%E4%BA%A4%E5%8A%A0%E8%A1%97_Cross_Street_shop_%E6%AC%8A%E8%A8%98%E9%9B%B2%E5%90%9E%E9%BA%B5_Kuen_Kee_noodle_restaurant_July_2019_IX2_01.jpg","page_title":"交加街","context_page_description":"交加街，是位于香港香港岛湾仔区的一条道路。 交加街东西走向，位于庄士敦道及皇后大道东之间。西起春园街，东面连接湾仔道。中间穿越的街道有太原街、石水渠街。交加街位于湾仔街市中心，街上两旁皆为小贩档位，车辆不能驶入。"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A1%D1%8C%D1%8E%D0%B4%D0%B0%D0%B4-%D0%A0%D0%BE%D0%B4%D1%80%D0%B8%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/RI-53-0000010.jpg","page_title":"Сьюдад-Родриго","context_page_description":"Сьюдад-Родриго — Испаниядағы қала. Кастилия және Леон автономды бірлестігіне қарасты Саламанка провинциясының құрамына кіреді.\\n2010 жылғы мәліметтер бойынша тұрғындарының саны 13777 адамды құрайды. Алып жатқан жер аумағы 239,61 км² шамасында. Провинцияның әкімшілік орталығына дейінгі қашықтығы — 86 км."},{"page_url":"https://de.wikipedia.org/wiki/Atlantische_Hurrikansaison_1950","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/HurricaneWilma20Oct2005.jpg","page_title":"Atlantische Hurrikansaison 1950","context_page_description":"Die Atlantische Hurrikansaison 1950 begann offiziell am 15. Juni 1950 und endete am 12. November 1950. Es war die erste Saison in der den tropischen Zyklonen Namen zugewiesen wurde. Die 1950er Saison war mit 16 Tropenstürmen, von denen sich alle außer fünf zu Hurrikans entwickelten, eine sehr aktive Saison. Insgesamt acht der Wirbelstürme wurden als schwere Hurrikane eingestuft, bevor eine moderne Reanalyse der National Oceanic and Atmospheric Administration nur sechs als wirklich schwere Hurrikane einstuft."},{"page_url":"https://de.wikipedia.org/wiki/Richland_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/USACE_Navarro_Mills_Lake_and_Dam.jpg","page_title":"Richland (Texas)","context_page_description":"Richland ist eine Stadt im Navarro County im US-Bundesstaat Texas in den Vereinigten Staaten."},{"page_url":"https://it.wikipedia.org/wiki/Opere_di_Vincent_van_Gogh","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Boerderij_met_turfhopen_-_s0130V1962_-_Van_Gogh_Museum.jpg","page_title":"Opere di Vincent van Gogh","context_page_description":"La tabella successiva è un elenco, non completo, delle principali opere di Vincent van Gogh, elencate cronologicamente. Nella colonna note è inserito sia il numero di catalogo redatto da Jacob Baart de la Faille sia quello di Jan Hulsker. Per quanto riguarda la data di creazione dell'opera e le sue dimensioni sono stati presi, quando possibile, i dati dai siti ufficiali dei vari musei."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D0%B8_%D1%85%D0%B5%D0%BB%D0%B8%D0%BA%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Pi_helix_topview.png","page_title":"Пи хеликс","context_page_description":"Пи хеликсот е вид на секундарна структура на белковините. Иако порано се сметал за многу ретка структура во белковините, денес е познато дека кратките π-хеликси се среќаваат во околу 15% од сите познати протеински структури. Се верува дека π-хеликсот е еволутивна адаптација настаната со инсерција на една аминокиселина во структурата на α-хеликсот. Бидејќи таквите инсерции се доста дестабилизирачки, формирањето на π-хеликсите би била селекционо нефаворизирана појава, освен ако не дава некаква функционална предност на протеинот во кој се јавува. Затоа π-хеликсите обично се локализирани во близината на функционално активните делови од протеинот."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%B5%CF%89%CE%B3%CF%81%CE%B1%CF%86%CE%B9%CE%BA%CE%AE_%CE%A5%CF%86%CE%AE%CE%B3%CE%B7%CF%83%CE%B9%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/PtolemyWorldMap.jpg","page_title":"Γεωγραφική Υφήγησις","context_page_description":"Η Γεωγραφικὴ Ὑφήγησις είναι εξάτομο έργο του Έλληνα γεωγράφου και αστρονόμου Κλαύδιου Πτολεμαίου που γράφτηκε το έτος 150."},{"page_url":"https://pt.wikipedia.org/wiki/Anita_Stewart_Morris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Anitastewart_4.jpg","page_title":"Anita Stewart Morris","context_page_description":"Anita Stewart Morris foi uma socialite americana que se casou com o pretendente dinástico Miguel Maria Maximiliano de Bragança, neto ex-infante D. Miguel e filho mais velho do anterior pretendente ao trono português Miguel Januário de Bragança."},{"page_url":"https://en.wikipedia.org/wiki/Bengazi_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Bengazi_%281955%29.jpg","page_title":"Bengazi (film)","context_page_description":"Bengazi is a 1955 American drama film directed by John Brahm and starring Richard Conte, Victor McLaglen, and Richard Carlson. Several adventurers hunt for treasure in the desert near the Libyan town of Benghazi."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_de_Paula_Sanz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Ej%C3%A9rcito_del_Norte_-_1ra_Campa%C3%B1a_%282%29.png","page_title":"Francisco de Paula Sanz","context_page_description":"Francisco de Paula Sanz y nacido como Francisco de Paula Sanz y Espinosa de los Monteros Martínez y Soler fue un funcionario español de fines del siglo XVIII y comienzos del XIX, uno de los más destacados y polémicos administradores en la historia del Virreinato del Río de la Plata, y en particular en la Real Audiencia de Charcas."},{"page_url":"https://de.wikipedia.org/wiki/Legierung","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Alloy_diagram_limited_mixed_crystal_building.png","page_title":"Legierung","context_page_description":"Eine Legierung ist in der Metallurgie ein makroskopisch homogener metallischer Werkstoff aus mindestens zwei Elementen, von denen mindestens eins ein Metall ist und die gemeinsam das metalltypische Merkmal der Metallbindung aufweisen. Aus chemischer Sicht gibt es Legierungen, die Gemische darstellen, und intermetallische Verbindungen mit definiertem stöchiometrischem Verhältnis der beteiligten Metalle. Im Allgemeinen haben Legierungen zudem einen kristallinen Aufbau. Es gibt jedoch auch amorphe metallische Gläser.\\nJe nach Art der Legierungsbildung kann eine Legierung auf mikroskopischer Ebene homogener oder heterogen sein. Legierungen, die ausschließlich Mischkristalle oder ausschließlich intermetallische Verbindungen bilden, sind homogen. Alle anderen, die aus mehreren Phasen bestehen, sind heterogen.\\nDas Verhalten der Elemente in einer Legierung und ihr Einfluss auf deren Eigenschaften sind in der Regel von drei Faktoren abhängig: Art und Anzahl der Legierungspartner, ihrem Massenanteil an der Legierung sowie der Temperatur."},{"page_url":"https://cs.wikipedia.org/wiki/Pa%C5%99%C3%AD%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/France%2C_Paris%2C_Biblioth%C3%A8que_nationale_de_France%2C_site_Richelieu%2C_salle_ovale.jpg","page_title":"Paříž","context_page_description":"Paříž, hlavní a zároveň největší město Francie, je správním centrem regionu Île-de-France, zahrnujícího Paříž a její předměstí, přičemž sama tvoří jeden z departementů. Představuje přirozené centrum Pařížské aglomerace a díky 552,7 miliardám € HDP hospodářsky nejaktivnější oblast ve Francii. V Paříži sídlí vedení téměř poloviny všech francouzských společností stejně jako kanceláře hlavních mezinárodních firem a ředitelství mnoha mezinárodních organizací, jako jsou UNESCO, OECD nebo ICC. Paříž je proto významným světovým kulturním, obchodním i politickým centrem. Počet obyvatel v roce 2015 činil 2 229 621, v celé aglomeraci pak 12 142 802. Město se stalo nositelem Řádu čestné legie, Válečného kříže 1914–1918 a Řádu osvobození."},{"page_url":"https://az.wikipedia.org/wiki/H%C9%99mz%C9%99lli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/H%C9%99mz%C9%99lli_qara%C3%A7%C3%B6hr%C9%99liyi_%28Q%C9%99b%C9%99l%C9%99_rayonu%29.jpg","page_title":"Həmzəlli","context_page_description":"Həmzəlli — Azərbaycan Respublikasının Qəbələ rayonunun inzibati ərazi vahidində kənd."},{"page_url":"https://nn.wikipedia.org/wiki/Mikhail_Klodt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/KlodtM_VechernVidVDerevHAB.jpg","page_title":"Mikhail Klodt","context_page_description":"Mikhail Konstantinovitsj Klodt, baron av Jürgensburg, var ein russisk realistisk målar. Han var fødd i St. Petersburg, og døydde same staden."},{"page_url":"https://en.wikipedia.org/wiki/Decomposition","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Berge_naturreservat_omkullfallet_liten_tall.jpg","page_title":"Decomposition","context_page_description":"Decomposition is the process by which dead organic substances are broken down into simpler organic or inorganic matter such as carbon dioxide, water, simple sugars and mineral salts. The process is a part of the nutrient cycle and is essential for recycling the finite matter that occupies physical space in the biosphere. Bodies of living organisms begin to decompose shortly after death. Animals, such as worms, also help decompose the organic materials. Organisms that do this are known as decomposers. Although no two organisms decompose in the same way, they all undergo the same sequential stages of decomposition. The science which studies decomposition is generally referred to as taphonomy from the Greek word taphos, meaning tomb. Decomposition can also be a gradual process for organisms that have extended periods of dormancy.\\nOne can differentiate abiotic from biotic substance. The former means \\"degradation of a substance by chemical or physical processes, e.g., hydrolysis. The latter means \\"the metabolic breakdown of materials into simpler components by living organisms\\", typically by microorganisms."},{"page_url":"https://en.wikipedia.org/wiki/Naples_Mound_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Naples-Russel_Mound_8.jpg","page_title":"Naples Mound 8","context_page_description":"The Naples Mound 8 is a Havana Hopewell culture mound site located in Pike County, Illinois three miles east of the city of Griggsville.\\nThe mound was given the name Naples Mound #8 in 1882. The mound was listed on the National Register of Historic Places in 1975."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E5%A4%AE%E9%93%81%E8%B7%AF_(%E5%9D%A6%E6%A1%91%E5%B0%BC%E4%BA%9A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ostafrikanische_Eisenbahngesellschaft_-_Kidete.jpg","page_title":"中央铁路 (坦桑尼亚)","context_page_description":"中央铁路，以前称坦噶尼喀铁路 是横穿坦桑尼亚东西国土的铁路。东起达累斯萨拉姆，西至坦噶尼喀湖畔的基戈马里程为1252公里。全程旅行时间58小时。支线铁路通维多利亚湖畔的姆万扎。单线米轨。"},{"page_url":"https://en.wikipedia.org/wiki/Kleve","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Borstbeeld_Berend_Cornelis_Koekoek_Kleve_Cleves_Kleef.jpg","page_title":"Kleve","context_page_description":"Kleve is a town in the Lower Rhine region of northwestern Germany near the Dutch border and the river Rhine. From the 11th century onwards, Cleves was capital of a county and later a duchy. Today, Cleves is the capital of the district of Cleves in the German state of North Rhine-Westphalia. The city is home to one of the campuses of the Rhine-Waal University of Applied Sciences."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_eredoctoraten_van_de_Erasmus_Universiteit_Rotterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Howard-S.-Becker-EHESS.JPG","page_title":"Lijst van eredoctoraten van de Erasmus Universiteit Rotterdam","context_page_description":"Dit is een lijst van de eredoctoraten van de Erasmus Universiteit Rotterdam. De universiteit werd in 1913 opgericht als Nederlandsche Handels-Hoogeschool. In 1939 leidde wettelijke erkenning ook tot een naamsverandering, tot Nederlandsche Economische Hoogeschool. In 1973 veranderde de naam in Erasmus Universiteit Rotterdam.\\nEredoctoraten worden ter gelegenheid van de Dies Natalis toegekend aan “natuurlijke personen wegens uitstekende verdiensten in aan de EUR beoefende wetenschappen”."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%82%AF%E3%82%B6%E3%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Echinorhinus_brucus_embryo.jpg","page_title":"キクザメ","context_page_description":"キクザメはキクザメ科に属するサメの一種である。東太平洋を除く全世界の熱帯、温帯域の海に生息する。本種はめったに発見されない種であり、通常水深400 - 900メートルくらいの海底で生活するが、それより浅い海に現れることもある。太いがっしりとした魚体の最後方に二つの小さな背鰭を持ち、臀鰭はもたない。体表に大きな、棘状の楯鱗が散在していることにより他種と容易に区別できる。体色は茶色か黒色で、最大で体長3.1メートルにまで成長する。\\nキクザメが捕食する生物には、自分より小さなサメ、硬骨魚、そしてカニが含まれ、動きの遅い本種はこれらを吸い込むように捕食すると考えられる。本種は卵胎生で、メスは一度に15匹から52匹の子を産む。人間に害はなく、漁業においてまれに混獲され、魚粉や肝油という形で利用されることがある。IUCNは現在本種の保全状態についてはデータ不足としているが、北東大西洋における本種の生息数は18世紀、19世紀以来かなり減少しており、乱獲が原因の可能性がある。"},{"page_url":"https://pl.wikipedia.org/wiki/Banknoty_Banku_Emisyjnego_w_Polsce","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Projekt1_500_z%C5%82otych_1941_rewers.jpg","page_title":"Banknoty Banku Emisyjnego w Polsce","context_page_description":"Banknoty Banku Emisyjnego w Polsce – banknoty emitowane w okresie Generalnego Gubernatorstwa przez Bank Emisyjny w Polsce w dwóch seriach – z 1940 i 1941 r."},{"page_url":"https://es.wikipedia.org/wiki/Julien_Offray_de_La_Mettrie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Portrait_de_Julien_Offray_de_La_Mettrie.jpg","page_title":"Julien Offray de La Mettrie","context_page_description":"Julien Offray de La Mettrie fue un médico y filósofo francés, uno de los primeros escritores materialistas de la Ilustración."},{"page_url":"https://cs.wikipedia.org/wiki/Satellite_Awards_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Marion_Cotillard_Cabourg_2017.jpg","page_title":"Satellite Awards 2008","context_page_description":"12. ročník udílení Satellite Awards se konal dne 16. prosince 2007. Nejvíce cen získal film Juno, celkově 3. Nejvíce nominací získaly film Tahle země není pro starý a Východní přísliby, celkem 6. Nejvíce cen získal seriál Dexter, celkem 3. V oblasti televize získaly nejvíce nominací seriál Chirurgové a televizní film Lord Longford."},{"page_url":"https://ca.wikipedia.org/wiki/Eissendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Hamburg_Goehlbachtal_102.jpg","page_title":"Eissendorf","context_page_description":"Eissendorf o Eißendorf, en baix alemany Eißendörp, és un barri del districte d'Harburg al sud de l’estat d’Hamburg a Alemanya. A la fi de 2016 tenia 24324 habitants a una superfície de 3,5 km².\\nEl primer esment escrit data del 1332. El 1450 s'escriu Eytzendorpe, el que significa poble d'Eyzo. Era un conglomerat d'unes masies a l'entorn de la vall del Göhlbach, que pertanyia a la parròquia de Sinstorf.\\nEl poble va sofrir molt de l'ocupació francesa sota Napoleó. El 1811 l'ocupant va forçar la població a construir un camí militar per assegurar un ràpid transport de tropes. Però segons la crònica, els camperols s'haurien defensat en lloc d'homes forts enviaven «només nens, dones inconscients i persones miserables». El camí no obstant es va realitzar, no obstant això. Va connectar Harburg via Bremen a Wesel. Després de la guerra i fins a la construcció del ferrocarril als segle XIX i les autopistes al XX, va quedar un eix de transport important. Del 1813 a 1814 Eissendorf va patir de nou sota els ocupants i va ser cremat diverses vegades."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%96_4%D0%A54","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/VW_CrossTouran.JPG","page_title":"Автомобілі 4Х4","context_page_description":"Автомобілі 4Х4 — автомобілі, які мають повний привід."},{"page_url":"https://vec.wikipedia.org/wiki/Bonneville-la-Louvet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%C3%89glise_de_l%27Assomption_de_Notre-Dame_de_Bonneville-la-Louvet._Vue_sud-est.jpg","page_title":"Bonneville-la-Louvet","context_page_description":"Bonneville-la-Louvet el xé on comun de 756 abitanti del departemento de Calvados che el fa parte del rejon Normandia in Fransa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B4%D0%B5%D0%BA%D1%81_%D0%91%D0%BE%D1%80%D0%B4%D0%B6%D0%B8%D0%B0_(%D0%BC%D0%B5%D0%B7%D0%BE%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Codex_Borgia_page_64.jpg","page_title":"Кодекс Борджиа (мезоамериканский)","context_page_description":"Кодекс Борджиа — месоамериканский религиозный и пророческий манускрипт. Принято считать, что этот артефакт создан до завоевания Мексики конкистадорами в районе южной или западной части современного мексиканского штата Пуэбла. Кодекс отличается рисунками, выполненными в стиле, характерном для позднего постклассического периода Центральной Мексики.\\nКодекс Борджиа является частью и самой значительной книгой Группы манускриптов Борджиа, — в честь Кодекса Борджия группа и получила своё имя.\\nКодекс состоит из 39 листов, сделанных из шкур животных. Каждый лист представляет собой квадрат 27 см на 27 см, общая длина листов составляет почти 11 метров. Почти все листы покрыты рисунками с обеих сторон, — всего 76 страниц. Кодекс читается справа налево.\\nКодекс Борджиа назван в честь итальянского кардинала Стефано Борджиа, который владел кодексом до того, как он был приобретён библиотекой Ватикана."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%87%AA%E7%94%B1%E5%A5%B3%E7%A5%9E%E5%83%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Liberty_issue_17c_1971.JPG","page_title":"自由女神像","context_page_description":"自由女神像又名自由照耀世界，是位於美國紐約港自由島的巨型古典主義塑像，由弗里德利·奧古斯特·巴特勒迪設計，居斯塔夫·艾菲爾建造，1886年10月28日落成，是法國人民送給美國人民的禮物。塑像人物是身穿長袍的女子，代表羅馬神話中的自主神，她右手高舉火炬，左手的冊子上用羅馬數字寫有美國獨立宣言簽署日期：「JULY IV MDCCLXXVI」，腳下還有斷裂的鎖鏈。這座塑像是自由和美國的象徵，也是對外來移民的歡迎信號。\\n法國法學教授和政治家愛德華·勒內·德·拉沃拉葉曾於1865年提議，法國和美國人民應該共同製作美國獨立紀念品，他的構想可能是為紀念南北戰爭以北軍勝利、奴隸制壽終正寢結束。巴特勒迪正是受拉沃拉葉啟發而開始設計塑像，但由於當時法國的政治形勢陷入困境，因此塑像建造工作直到19世紀70年代初才展開。1875年，拉沃拉葉提出法國為塑像注資，美國提供場地並製造底座。巴特勒迪在雕塑設計完成前就做好頭部和高舉火炬的手臂，這些部分還在國際博覽會上宣傳展出。\\n1876年，神像舉起火炬的手臂在費城百年博覽會展出，再從1876到1882年在紐約麥迪遜廣場展出。籌款的進展非常緩慢，其中又以美國為甚，到1885年時，底座的建設仍然受到缺乏資金的威脅。《紐約世界報》出版商約瑟夫·普立茲發起捐款，雖然大部分捐獻金額都不到一美元，但吸引了超過12萬人捐助，這一項目才得以完成。塑像在法國建成，再裝船跋涉重洋運抵當時的貝德羅島，裝到已經完成的底座上。塑像完成之際，紐約舉行了歷史上的首次紙帶遊行，美國總統格羅弗·克利夫蘭主持了落成儀式。\\n自由女神像起初由美國燈塔委員會負責管理，1901年管理權移交戰爭部，1933年，美國國家公園管理局開始負責塑像的維護和管理工作。1938年的大部分時間裡，塑像都因翻新工程暫停向公眾開放。1980年代初，塑像出現嚴重老化，必須加以重大修復，因此塑像於1984年至1986年關閉，將火炬和大部分內部結構替換。2001年的九一一襲擊事件後，塑像出於安全和保安方面原因再度關閉，其底座於2004年重新開放，而塑像則要到2009年才開放，還對能夠登上王冠的遊客人數設了限制。包括底座和地基在內的整座塑像之後又關閉了一年，直到2012年10月28日再度開放，目的是安裝輔助樓梯等安全保障，自由島在這期間一直保持開放。不過就在塑像重新開放次日，自由島因颶風桑迪的影響導致關閉，於2013年7月4日再次開放。出於安全方面考量，火炬周圍的陽台自2016年起就不再面向公眾開放。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%96%D7%95%D7%90%D7%95%D7%92%D7%90%D7%95%D7%92%D7%A8%D7%A4%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Kea_-_New_Zealand_%2824402055657%29.jpg","page_title":"זואוגאוגרפיה","context_page_description":"זואוגאוגרפיה היא ענף בביוגאוגרפיה העוסק בתפוצה הגאוגרפית של מיני בעלי חיים ותכונותיהם. במילים אחרות, זואוגאוגרפיה היא חקר מגוון ביולוגי ביחס לזמן ולמרחב."},{"page_url":"https://fr.wikipedia.org/wiki/Membra_Jesu_nostri","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Membra_Jesu_nostri_-_Ad_pedes_-_Bass.jpg","page_title":"Membra Jesu nostri","context_page_description":"Membra Jesu nostri, BuxWV 75, est un cycle de sept cantates composées par Dietrich Buxtehude, sur des poésies spirituelles du Moyen Âge, déplorant l'une après l'autre les plaies du Christ."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%AA%E6%9E%9D%E8%97%BB%E7%B4%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Scytonemin_biosynthesis.png","page_title":"伪枝藻素","context_page_description":"伪枝藻素是一种生物色素，由许多蓝细菌合成，包括Calothrix sp.、Lyngbya aestuarii等，最早在1849被人发现，但直到1993年才解析了其结构。据信，伪枝藻素对细菌起到了防晒油的作用，在325-425 nm的有很大的吸收峰，并在250 nm的紫外波段有个独立的吸收峰，在暴露在紫外线的情况下才启动它的生物合成。"},{"page_url":"https://ceb.wikipedia.org/wiki/Villarrubio_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Villarrubio%2C_Iglesia_parroquial%2C_fachada_principal.jpg","page_title":"Villarrubio (munisipyo)","context_page_description":"Munisipyo ang Villarrubio sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Cuenca ug rehiyon sa Castilla-La Mancha, sa sentro nga bahin sa nasod, 90 km sa habagatan-sidlakan sa Madrid ang ulohan sa nasod. Adunay 241 ka molupyo.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 16 °C. Ang kinainitan nga bulan Hulyo, sa 30 °C, ug ang kinabugnawan Disyembre, sa 4 °C. Ang kasarangang pag-ulan 584 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 98 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 10 milimetro."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D0%B8%D1%85_%D0%BB%D1%96%D1%82%D0%B0%D0%BA%D1%96%D0%B2_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Fairchild_T-46-4.jpg","page_title":"Список військових літаків США","context_page_description":"Список військових літаків США — перелік військових літальних апаратів, у тому числі прототипів, передсерійних екземплярів та таких, що перебували на озброєнні у Повітряних силах Сполучених Штатів Америки."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Berge","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Kloster_Berge_1580.jpg","page_title":"Kloster Berge","context_page_description":"Das Kloster St. Johannes der Täufer auf dem Berge war eine bedeutende Benediktinerabtei in der Nähe der Stadt Magdeburg, bei Buckau. 1565 wandelte es sich in ein protestantisches Stift um. Als evangelische Klosterschule bestand es bis Anfang des 19. Jahrhunderts."},{"page_url":"https://ast.wikipedia.org/wiki/Hacksaw_Ridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Hacksaw_Ridge_Logo.png","page_title":"Hacksaw Ridge","context_page_description":"Hacksaw Ridge ye una película dramático y bélico estauxunidense del 2016, dirixida por Mel Gibson y escrita por Andrew Knight y Robert Schenkkan. La película ta protagonizada por Andrew Garfield, Vince Vaughn, Sam Worthington, Luke Bracey, Hugo Weaving, Ryan Corr, Teresa Palmer, Richard Pyros y Rachel Griffiths. El rodaxe empezó'l 5 de setiembre de 2015, en Nueva Gales del Sur, Australia."},{"page_url":"https://fr.wikipedia.org/wiki/Leonie_Ebert","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Leonie_Ebert_St_Maur_2015_eq_t112131.jpg","page_title":"Leonie Ebert","context_page_description":"Leonie Ebert est une escrimeuse allemande, spécialiste du fleuret."},{"page_url":"https://az.wikipedia.org/wiki/III_B%C3%B6y%C3%BCk_M%C9%99nu%C3%A7%C3%B6hr","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Nizami_ad%C4%B1na_%C6%8Fd%C9%99biyyat_Muzeyinin_binas%C4%B1n%C4%B1n_p%C9%99nc%C9%99r%C9%99sind%C9%99_F%C9%99l%C9%99ki_%C5%9Eirvani_r%C9%99smi_%281%29.JPG","page_title":"III Böyük Mənuçöhr","context_page_description":"III Mənuçöhr və ya Böyük Mənuçöhr — Şirvanşahlar dövlətinin on doqquzuncu hökmdarı, Şirvanşah I Əfridunun oğlu. III Mənuçöhr atası I Əfridunnin 1120-ci ildə vəfat etməsindən sonra taxta çıxmışdır. 40 il hakimiyyətdə olmuş III Mənuçöhr 1160-cı ildə anadan olduğu Şamaxı şəhərində vəfat etmişdir."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%90%D7%A8%D7%A7%D7%96_%D7%94%D7%99%D7%99%D7%A0%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/HaynesVenezia.jpg","page_title":"מארקז היינס","context_page_description":"מארקז היינס הוא כדורסלן אמריקאי בעל אזרחות גאורגית המשחק בעמדת הרכז והקלעי בקבוצת רייר ונציה המשחקת בליגת העל האיטלקית בכדורסל. גובהו 1.91 מטרים."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Ellingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Ellingen%2C_Wei%C3%9Fenburger_Stra%C3%9Fe_15%2C_13%2C_001.jpg","page_title":"Liste der Baudenkmäler in Ellingen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der mittelfränkischen Stadt Ellingen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 30. Juni 2016 wieder und enthält 173 Baudenkmäler."},{"page_url":"https://lt.wikipedia.org/wiki/Mohuras","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Gold_Mohur_des_Farrukh_Siyar.jpg","page_title":"Mohuras","context_page_description":"Mohuras, muchras – auksinė moneta, anksčiau kaldinta Indijos regione, kuri paprastai būdavo lygi 15 sidabrinių rupijų.\\nBritų Indijoje paskutinį kartą kaldinta 1918 m., bet kai kurios kunigaikštystės juos kaldino, kol buvo įjungtos į Indijos sudėtį.\\nBritų Indijoje buvo kaldinamo 2/3 mohuro ir 1/3 mohuro monetos, o kai kurios kunigaikštystės kaldino ir 1/2 mohuro monetas.\\nŽodį mohuras savo trumpo valdymo metu įvedė Šir Šahas Sūris, šiuo žodžiu vadino 169 granų masės aukso monetas. Jis taip pat ėmė leisti varines monetas damus ir sidabrines rupijas, kurios svėrė 178 granus.\\nVėliau Mogolų imperatoriai standartizavo savo monetų trimetalizmą visame Indostane, kad sutvirtintų pinigų sistemą."},{"page_url":"https://pl.wikipedia.org/wiki/Landstra%C3%9Fe_(Wiede%C5%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Kartewien3.png","page_title":"Landstraße (Wiedeń)","context_page_description":"Landstraße – trzecia dzielnica Wiednia.\\nDzielnica powstała w 1850 roku poprzez włączenie do miasta gmin znajdujących się na jego przedmieściach. Graniczy od południowego wschodu z pierwszą dzielnicą Wiednia-Innere Stadt. Na jej terenie znajduje się wiedeński Belweder, Hundertwasserhaus, arsenał oraz wiele ambasad."},{"page_url":"https://es.wikipedia.org/wiki/Rakovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Rakovice.jpg","page_title":"Rakovice","context_page_description":"Rakovice es una localidad del distrito de Písek en la región de Bohemia Meridional, República Checa, con una población estimada a principio del año 2018 de 215 habitantes.\\nSe encuentra ubicada al norte de la región, a poca distancia al sur de la ciudad de Praga, de la frontera con la región de Bohemia Central y de la orilla del río Moldava —el principal afluente del río Elba—.​"},{"page_url":"https://et.wikipedia.org/wiki/%C5%BDamys%C5%82a%C5%ADl","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/41_%D0%96%D0%B5%D0%BC%D1%8B%D1%81%D0%BB%D0%B0%D0%B2%D0%BB%D1%8C.JPG","page_title":"Žamysłaŭl","context_page_description":"Žamysłaŭl, ka Žemłasłaŭ on küla Valgevenes Hrodna oblastis Iŭje rajoonis Subotniki külanõukogus. Aastal 1861 oli külas 475 elanikku. Poola keeles on küla nimi Żemłosław. Küla asub Gauja jõe kaldal.\\nEsimest korda on Žamysłaŭli mainitud aastal 1587. Toona oli küla nimi Пятроўшчына ja seal asus Zenowiczitele kuulunud Kandraciški mõisa süda, mille ostsid Roskad.\\nPoola jagamisel läks Žamysłaŭl aastal 1795 Venemaa koosseisu. Aastal 1807 ehitas mõisa Kenewiczitelt ostnud krahv Umiastowski külasse lossi. Umiastowskite valdusse asula ka jäi.\\nKuni 1917. aastani oli Žamysłaŭl Venemaa Keisririigi koosseisus, 1919–1939 kuulus Poolale, 1939–1991 kuulus Nőukogude Liidu koosseisu."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B2%D0%B0%D0%BF%D1%81%D0%BA%D0%BE%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Novopskov_prapor.png","page_title":"Навапскоў","context_page_description":"Навапскоў — пасёлак гарадскога тыпу, адміністрацыйны цэнтр Навапскоўскага раёна Луганскай вобласці Украіны. Размешчаны пры ўпадзенні ракі Каменкі ў раку Айдар.\\nСамы высокі пункт — крэйдавая гара Прыстын."},{"page_url":"https://pl.wikipedia.org/wiki/Vittorio_Gregotti","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Universitaet-uni-kalabrien-ponte.jpg","page_title":"Vittorio Gregotti","context_page_description":"Vittorio Gregotti – włoski architekt i urbanista.\\nW 1952 roku ukończył studia na Politechnice Mediolańskiej i podjął pracę w czasopiśmie architektonicznym Casabella. Pracował tam jako redaktor w latach 1953–1955 potem do 1963 jako redaktor naczelny. Pracował dla grupy architektonicznej BBPR, gdzie jego mentorem był Ernesto Nathan Rogers.\\nW 1974 roku założył własne studio projektowe Gregotti Associati International. Projektował obiekty użyteczności publicznej, m.in. teatry i stadiony. Jako urbanista opracował koncepcję zagospodarowania poprzemysłowej dzielnicy Mediolanu Bicocca oraz Pujiang, dzielnicy Szanghaju.\\nW marcu 2020 stwierdzono u niego zakażenie SARS-CoV-2, zmarł na związane z tym zapalenie płuc."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%A1%D6%80%D5%BE%D5%AB%D5%BD_%D5%8E%D5%A1%D6%80%D5%B6%D5%A1%D5%A4%D5%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Jarvis_Varnado.jpg","page_title":"Ջարվիս Վարնադո","context_page_description":"Ջարվիս Լամար Վարնադո, ամերիկացի պրոֆեսիոնալ բասկետբոլիստ։ Ներկա պահին հանդես է գալիս Իտալիայի բասկետբոլի Ա սերիայի «Դինամո Սասսարի» ակումբում։"},{"page_url":"https://ko.wikipedia.org/wiki/SH-3_%EC%8B%9C_%ED%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/LACS_N950DF_Sea_King.jpg","page_title":"SH-3 시 킹","context_page_description":"시코르스키 SH-3 시 킹은 미국의 시코르스키 항공이 개발한 미국 해군의 대잠 헬리콥터이다. 1961년 실전배치된 이래, 2011년 현재 사용중이다. 영국과 이탈리아의 경항공모함인 인빈시블급 항공모함, 주세페 가리발디 항공모함의 주력 헬기이다."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_navale_di_Guadalcanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/KinugawaMaru1.jpg","page_title":"Battaglia navale di Guadalcanal","context_page_description":"La battaglia navale di Guadalcanal, a volte chiamata terza e quarta battaglia dell'Isola di Savo, la battaglia delle Salomone oppure, nelle fonti giapponesi, la terza battaglia del Mar delle Salomone, avvenne in due fasi tra il 12 e il 15 novembre 1942 e rappresentò lo scontro più importante della serie di battaglie navali combattute tra gli Stati Uniti e l'Impero giapponese durante la campagna di Guadalcanal.\\nGli Alleati erano sbarcati a Guadalcanal il 7 agosto 1942 occupando l'aeroporto che i giapponesi avevano iniziato a costruirvi; gli stati maggiori nipponici, colti di sorpresa, tentarono nei mesi seguenti di annientare le forze sbarcate e respingere la marina statunitense, senza però riuscire a cogliere alcun significativo successo. All'inizio di novembre l'Impero giapponese organizzò un grande convoglio navale, con a bordo 7 000 soldati e numeroso materiale, in un decisivo sforzo di riconquistare l'aeroporto: a copertura della flotta da trasporto fu schierata la massiccia 2ª Flotta del viceammiraglio Nobutake Kondō, con il compito principale di bombardare l'aeroporto nella notte del 12-13 novembre e neutralizzare così la Cactus Air Force."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B5%D0%B7%D0%B5%D0%BD%D1%82_%D0%9F%D0%BB%D0%B5%D1%98%D0%BD%D1%81_(%D0%8A%D1%83_%D0%8F%D0%B5%D1%80%D0%B7%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Pleasant_Plains%2C_NJ.jpg","page_title":"Плезент Плејнс (Њу Џерзи)","context_page_description":"Плезент Плејнс насељено је место без административног статуса у америчкој савезној држави Њу Џерзи."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_V%C3%B6cklabruck","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Regau_im_Bezirk_VB.png","page_title":"Bezirk Vöcklabruck","context_page_description":"Der Bezirk Vöcklabruck ist ein Politischer Bezirk des Landes Oberösterreich.\\nEr ist Teil des Hausruckviertels. Er grenzt im Nordwesten an den Bezirk Braunau am Inn, im Norden an die Bezirke Ried im Innkreis und Grieskirchen, im Nordosten an den Bezirk Wels-Land, im Osten an den Bezirk Gmunden und im Süden und Westen an das Land Salzburg beziehungsweise den Bezirk Salzburg-Umgebung.\\nSitz der Bezirkshauptmannschaft ist Vöcklabruck. Der Bezirk ist nach dem Bezirk Linz-Land der zweitbevölkerungsreichste und nach den Bezirken Gmunden und Kirchdorf an der Krems der flächenmäßig drittgrößte Bezirk in Oberösterreich."},{"page_url":"https://es.wikipedia.org/wiki/Volc%C3%A1n_Reclus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Amalia_Glacier.jpg","page_title":"Volcán Reclus","context_page_description":"El volcán Reclus es un estratovolcán del tipo cono de escoria, de aproximadamente 1.000 msnm, localizado al sur de Chile.\\nEstá ubicado en el campo de hielo Patagónico Sur, en la Región de Magallanes y de la Antártica Chilena. Su cráter, de alrededor de 1 km de diámetro, se encuentra desgastado por la acción del Glaciar Amalia y otros glaciares de la zona.\\nHasta el año 1987 era habitualmente confundido con el Cerro Mano del Diablo; en este último año se pudo determinar su ubicación exacta.​"},{"page_url":"https://sv.wikipedia.org/wiki/TV-kamera","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/TV-kamera_1955.jpg","page_title":"TV-kamera","context_page_description":"En TV-kamera eller elektronisk kamera är en kamera som på elektronisk väg upptar rörliga bilder som sedan sänds direkt till en TV-mottagare eller som lagras på olika medier som magnetband, DVD eller hårddisk. TV-kameran används professionellt huvudsakligen av TV-bolag och kan ses som en föregångare till videokameran.\\nTV-kamerans grundläggande princip går tillbaka till Nipkowskivan som patenterades 1883 av den tyske ingenjören Paul Nipkow. Nipkows mekaniska princip förbättrades 1925 av skotten John Logie Baird. TV-bilder med högre upplösning blev först möjliga med hjälp av katodstråleröret ikonoskop som Vladimir Zworykin patentansökte 1923.\\nPå 1980-talet ersattes elektronröret i TV-kameran av CCD-sensorer. Idag finns TV-kameror i medicinska instrument och som övervakningskamera."},{"page_url":"https://fr.wikipedia.org/wiki/Route_nationale_839","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/RD_939_entr%C3%A9e_de_Mainvilliers_depuis_Ch%C3%A2teauneuf.jpg","page_title":"Route nationale 839","context_page_description":"La route nationale 839 ou RN 839 était une route nationale française reliant Verneuil-sur-Avre à Angerville. À la suite de la réforme de 1972, elle a été déclassée en RD 839 dans l'Eure et en RD 939 en Eure-et-Loir et dans l'Essonne."},{"page_url":"https://cs.wikipedia.org/wiki/Novodomsk%C3%A9_ra%C5%A1elini%C5%A1t%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Novodomsk%C3%A9_ra%C5%A1elini%C5%A1t%C4%9B_2020-06-27_Prstnatec_Fuchs%C5%AFv.jpg","page_title":"Novodomské rašeliniště","context_page_description":"Novodomské rašeliniště je národní přírodní rezervace v Krušných horách. Nachází se mezi Horou Svatého Šebestiána a Kalkem v okrese Chomutov v Ústeckém kraji. Předmětem ochrany jsou přirozené lesní porosty tvořené společenstvy rašelinných smrčin, březin a vrchovišť s klečí a přirozená bezlesí tvořená společenstvy otevřených vrchovišť, vrchovištních šlenků a lučních pramenišť. Mezi ohrožené druhy rostlin v chráněném území patří bříza trpasličí, rosnatka okrouhlolistá nebo šicha černá a z živočichů například tetřívek obecný, netopýr černý nebo sýc rousný."},{"page_url":"https://hu.wikipedia.org/wiki/Demoscene","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/%C3%81rok_party_2015%2C_Ajkarendek_4.jpg","page_title":"Demoscene","context_page_description":"A demoscene nemzetközi underground számítástechnikai szubkultúra, amelynek célja különböző számítógépes digitális művészeti alkotások készítése. Ezen alkotások jellegzetessége, hogy valós időben futnak a számítógépeken, azaz nem a hagyományos értelemben vett előre renderelt animációkról van szó, amiket videoformátumban terjesztenek, hanem futtatható programokról, amik a futtatás során számolják ki a megjelenő látványt és hangokat. A kultúra több mint 30 éves múltra tekint vissza, és bár a gyökerei az első mikroszámítógépekre készített illegális programmásolatok bevezetőiben keresendők, mára a műfaj már neves filmfesztiválokon önálló művészeti ággá nőtte ki magát."},{"page_url":"https://en.wikipedia.org/wiki/Finchley_(UK_Parliament_constituency)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Finchley1918.png","page_title":"Finchley (UK Parliament constituency)","context_page_description":"Finchley was a constituency represented in the House of Commons of the Parliament of the United Kingdom. It elected one Member of Parliament by the first-past-the-post system of election; its best-known MP was Margaret Thatcher, Prime Minister from 1979 to 1990. Although boundary changes meant that she never again attained her large majority of 1959, she was nonetheless returned by comfortable majorities at general elections throughout her premiership.\\nThe seat was abolished in 1997 and split between the Finchley and Golders Green and Chipping Barnet constituencies."},{"page_url":"https://cs.wikipedia.org/wiki/K%C5%99%C3%AD%C5%BEov%C3%A1_cesta_(Krnov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Kostel_P._Marie_Sedmibolestn%C3%A9.jpg","page_title":"Křížová cesta (Krnov)","context_page_description":"Křížová cesta v Krnově v okrese Bruntál se nachází na poutním místě na vrchu Cvilín přibližně 1,6 kilometru jihovýchodně od centra města Krnova."},{"page_url":"https://es.wikipedia.org/wiki/Hospital_de_Bermeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Bermeo_hospital.JPG","page_title":"Hospital de Bermeo","context_page_description":"El Hospital de Bermeo es un hospital psiquiátrico que se encuentra en la localidad costera de Bermeo, España. Depende del Servicio Vasco de Salud. Está situado en el barrio de la Atalaya.\\nEl Centro de Salud de Bermeo se encuentra desde el 2 de mayo de 2009 en la parte baja del edificio."},{"page_url":"https://en.wikipedia.org/wiki/Hexagon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Isohedral_tiling_p6-11.png","page_title":"Hexagon","context_page_description":"In geometry, a hexagon is a six-sided polygon or 6-gon. The total of the internal angles of any simple hexagon is 720°."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Sklen%C3%A9_Teplice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Sklene_teplice_goetheho_kupelny_dom.jpg","page_title":"Liste der denkmalgeschützten Objekte in Sklené Teplice","context_page_description":"Die Liste der denkmalgeschützten Objekte in Sklené Teplice enthält die zehn nach slowakischen Denkmalschutzvorschriften geschützten Objekte in der Gemeinde Sklené Teplice im Okres Žiar nad Hronom."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BB%A3%E3%80%85%E6%9C%A8%E5%85%AB%E5%B9%A1%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Yoyogi-Hachiman-station2019.jpg","page_title":"代々木八幡駅","context_page_description":"代々木八幡駅は、東京都渋谷区代々木五丁目にある、小田急電鉄小田原線の駅である。駅番号はOH 04。"},{"page_url":"https://sv.wikipedia.org/wiki/Hyphesma_nitidiceps","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Hyphesma_nitidiceps_m.jpg","page_title":"Hyphesma nitidiceps","context_page_description":"Hyphesma nitidiceps är en biart som först beskrevs av Cockerell 1912. Hyphesma nitidiceps ingår i släktet Hyphesma och familjen korttungebin. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ckb.wikipedia.org/wiki/%DA%BE%DB%95%D8%B1%DB%95%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/All_Gizah_Pyramids.jpg","page_title":"ھەرەم","context_page_description":"ھەرەم یان ناوه چەند پاڵووێکە کە تەواوی پاڵەکانی بێجگە لە یەکێک لە یەک خاڵدا بە یەک دەگەن. بەرزی ھەرەم دووری ستوونییە لە نێوان لووتکە و بنکەکەی. یەکێک لە ھەڕەمەکان ناوی خۆفۆیە ٤٦٠٠ساڵ لەمەو بەر دروست کراوە لەلایەن خۆفۆ کە یەکێکە لە فیرعەونە گەورەکان لەسەر بنکەیەکی چوار گۆشەیە. ڕووبەری گشتی ٥٣٠٠٠ مەتر چوار گۆشەیە دوو میلیۆن و نیو بلۆکی تێدا بەکار ھێنراوە و ئێستا یەکێکە لە حەوت سەمەرەکەی جیھان."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B0%D1%81_(%D0%BA%D0%BD%D1%8F%D0%B7%D1%8C_%D0%9B%D0%B5%D0%B9%D0%BD%D1%96%D0%BD%D2%91%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Kirill_Vladimirovich.jpg","page_title":"Андреас (князь Лейнінґенський)","context_page_description":"Андреас, князь Лейнінґенський, — 8-й князь Лейнінґенський, син 7-го князя Лейнінгенського Еміха Кіріла, та принцеси Ольденбурзької Ейліки."},{"page_url":"https://af.wikipedia.org/wiki/Laloentjie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Momordica_balsamina19.jpg","page_title":"Laloentjie","context_page_description":"Die laloentjie is inheems aan Suid-Afrika, Eswatini, Botswana en Namibië. Op die SANBI-rooilys is dit as 'veilig' gelys.\\nDit is wydverspreid in die tropiese Afrika en Asië, Arabië, Indië en Australië."},{"page_url":"https://fr.wikipedia.org/wiki/Echinocereus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Echinocereus_pectinatus_3.JPG","page_title":"Echinocereus","context_page_description":"Echinocereus est un genre de la famille des cactus composé de 70 espèces environ.\\nLe nom vient du grec ancien \\"echinos\\" et du latin \\"cereus\\" car la surface de l'ovaire et les fruits eux-mêmes sont épineux."},{"page_url":"https://sh.wikipedia.org/wiki/Filmografija_Jennifer_Lopez","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/JenniferLopez.jpg","page_title":"Filmografija Jennifer Lopez","context_page_description":"Ovo je kronološka lista filmova u kojima se Jennifer Lopez pojavljuje.\\njennifer lopez is the best!!!"},{"page_url":"https://sk.wikipedia.org/wiki/Bernos-Beaulac","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Map_commune_FR_insee_code_33046.png","page_title":"Bernos-Beaulac","context_page_description":"Bernos-Beaulac je francúzska obec, ktorá sa nachádza v departemente Gironde, v regióne Akvitánsko."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Meudon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Esquisse_termin%C3%A9e_de_la_d%C3%A9molition_du_chateau_de_meudon_par_hubert_Robert.jpg","page_title":"Château de Meudon","context_page_description":"Le château de Meudon, dit château royal de Meudon, palais impérial de Meudon ou Domaine national de Meudon, est un château français situé à Meudon, dans le département des Hauts-de-Seine. Il est notamment la résidence de la duchesse d'Étampes, du cardinal de Lorraine, d'Abel Servien, de Louvois ainsi que de Monseigneur, dit le Grand Dauphin, qui lui adjoint en annexe le château de Chaville. Incendié en 1795 et en 1871, le Château-Neuf, dont la démolition est un temps envisagée, est conservé pour sa majeure partie. Il est transformé à partir de 1878 en observatoire servant de réceptacle à une lunette astronomique, avant d'être rattaché à l'Observatoire de Paris en 1927.\\nLe site du château, sur l'arête d'un plateau boisé, offre des vues sur la Seine et Paris, ainsi que sur le vallon de Chalais. Idéalement situé entre la capitale et Versailles, au cœur d'une abondante réserve de chasse, jouissant d'une topographie idéale pour de vastes jardins, il bénéficie d'aménagements somptueux de la part de ses propriétaires successifs, depuis la Renaissance jusqu'à la chute du Second Empire."},{"page_url":"https://nv.wikipedia.org/wiki/Ts%C3%ADdii_ha%C5%82b%C4%AF%CA%BC%C3%AD_%C5%82ichx%C3%AD%CA%BC%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Flame_Bower_Bird_%28Sericulus_ardens%29_%2848842332516%29.jpg","page_title":"Tsídii hałbįʼí łichxíʼígíí","context_page_description":"Tsídii hałbįʼí łichxíʼígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Chooyééł Dineʼé Bikéyahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Sericulus ardens\\" deiłníigo dayózhí."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%81%D0%B5%D1%83%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Grushevskiy.jpg","page_title":"Всеукраинский национальный съезд","context_page_description":"Всеукраинский национальный съезд — согласно концепции «Украинской национально-демократической революции», важнейшее событие её начального этапа, первый представительский форум украинского национального движения на территории Украины и первый шаг к созданию украинского национального государства.\\nПроведением Всеукраинского национального съезда завершился процесс формирования Украинской Центральной рады и превращения её в общеукраинский орган представительной власти и начался второй период её деятельности — борьба за национально-территориальную автономию Украины.\\nБолее восьмисот делегатов съезда от различных украинских политических, общественных, культурно-образовательных и профессиональных организаций обсудили вопросы национально-территориальной автономии Украины, приняли решение о создании органа государственной власти и выработке проекта автономного статута Украины и избрали новый состав Центральной рады. Михаил Грушевский был переизбран главой Центральной рады, его заместителями стали Сергей Ефремов и Владимир Винниченко, которые возглавили и исполнительный орган — Малую раду. Мандаты членов Рады получили известные украинские общественные и политические деятели: Д. Дорошенко, Н."},{"page_url":"https://gl.wikipedia.org/wiki/Pedipalpo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Oxyopes_salticus_Kaldari_05_crop.jpg","page_title":"Pedipalpo","context_page_description":"Denomínase pedipalpo a cada un dos dous apéndices dos merostomados e os arácnidos, que poden presentar forma de palpos ou de patas, ou terminar en pinzas para a prensión, e que poden desempeñar diversas funcións dependendo dos grupos.\\nConstan de seis artellos; o máis basal é a coxa, seguida do trocánter, fémur, patela, tibia e tarso. As coxas posúen con frecuencia expansións denominadas gnatobases, que se sitúan xunto á boca e actúan como pezas bucais adicionais xa que axudan a procesar o alimento.\\nOs pedipalpos mostráronse moi plásticos evolutivamente, e radiaron nunha gran variedade de formas e funcións."},{"page_url":"https://it.wikipedia.org/wiki/Presidenti_della_Regione_di_Murcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Pedro_Antonio_S%C3%A1nchez_en_la_Conferencia_de_Presidentes%2C_17_de_enero_de_2017.jpg","page_title":"Presidenti della Regione di Murcia","context_page_description":"Il Presidente della Regione di Murcia è il capo del governo della comunità autonoma spagnola della Regione di Murcia.\\nL'attuale titolare di questo ufficio è, dal 3 maggio 2017, Fernando López Miras del Partito Popolare."},{"page_url":"https://da.wikipedia.org/wiki/Lynge-Kronborg_Herred","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Lynge-Kronborg_Herred.png","page_title":"Lynge-Kronborg Herred","context_page_description":"Lynge-Kronborg Herred var et herred i Frederiksborg Amt beliggende i det nordøstlige hjørne af Sjælland. I middelalderen hørte herredet under Sjællands Østersyssel. Indtil 1862 hørte det sammen med Lynge-Frederiksborg Herred\\nI herredet ligger købstaden Helsingør samt følgende sogne:\\nAsminderød Sogn\\nBirkerød Sogn\\nBistrup Sogn\\nBlovstrød Sogn\\nEgebæksvang Sogn\\nGrønholt Sogn\\nGurre Sogn\\nHellebæk Sogn\\nHornbæk Sogn\\nHumlebæk Sogn\\nHørsholm Sogn\\nKarlebo Sogn\\nKokkedal Sogn\\nMørdrup Sogn\\nRungsted Sogn\\nSankt Mariæ Sogn\\nSankt Olai Sogn\\nSthens Sogn\\nTikøb Sogn\\nVestervang Sogn"},{"page_url":"https://de.wikipedia.org/wiki/Blumenthal_(Bremen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Amtsgericht_hinten_A65010.jpg","page_title":"Blumenthal (Bremen)","context_page_description":"Blumenthal ist ein Stadtteil von Bremen innerhalb des Stadtbezirks Nord."},{"page_url":"https://gl.wikipedia.org/wiki/Ciclo_tebano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Giovanni_Battista_Tiepolo_027.jpg","page_title":"Ciclo tebano","context_page_description":"Denomínase ciclo tebano ao conxunto de poemas que, datados na época Arcaica de Grecia, narraban a sucesión dos acontecementos ocorridos na lenda que ten como eixo central o personaxe de Edipo e a posterior guerra entre tebanos e arxivos.\\nOs poemas que comprendían este ciclo son tres: Edipodia, Tebaida e Epígonos. Discútese se outro poema perdido chamado Alcmeónida debe ser incluído no ciclo ou non.\\nNingún destes poemas se conservou, e deles só se coñecen uns poucos fragmentos, a partir dos cales pode facerse unha aproximación ao esquema básico coa axuda doutros poemas paralelos ou posteriores e das traxedias da época Clásica.\\nAs traxedias cuxos argumentos están baseados no ciclo tebano son:\\nOs sete contra Tebas.\\nEdipo Rei.\\nEdipo en Colono.\\nAntígona.\\nAs Suplicantes.\\nAs Fenicias."},{"page_url":"https://ca.wikipedia.org/wiki/Mol%C3%AD_de_Blancafort","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Casal_Blancafort_-IMG_3112.JPG","page_title":"Molí de Blancafort","context_page_description":"El Molí de Blancafort és un conjunt d'edificacions del municipi de la Garriga incloses en l'Inventari del Patrimoni Arquitectònic de Catalunya. Es troba al peu del riu Congost, al nord de la població."},{"page_url":"https://id.wikipedia.org/wiki/Kerajaan_Bosporos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Ancient_Greek_Colonies_of_N_Black_Sea.png","page_title":"Kerajaan Bosporos","context_page_description":"Kerajaan Bosporos atau Kerajaan Bosporos Kimmeria adalah sebuah negara kuno, yang terletak di Crimea selatan dan Semenanjung Taman di pesisir Bosporos Kimmeria. Negara ini dapat disebut sebagai negara 'Hellenistik' sejati pertama dalam artian negara pertama di luar Yunani yang penduduknya merupakan bangsa campuran non-Yunani namun menutrukan bahasa Yunani dan melaksanakan perdaban Yunani.\\nKerajaan Bosporos adalah kerajaan klien Romawi yang paling lama. Wilayah ini menjadi provinsi Romawi sejak tahun 63 sampai 68, di bawah kaisar Romawi, Nero. Abad pertama dan kedua Masehi adalah masa baru zaman kejayaan bagi Kerajaan Bosporos. Pada akhir abad kedua, raja Sauromates II memberikan kekalahan yang sangat kritis kepada bangsa Skyth dan merebut seluruh wilayah Crimea ke dalam negaranya.\\nKekayaan Kerajaan Bosporos diperoleh dari ekspor gandum, ikan, dan budak, dan perdagangan ini ditopang oleh satu kelas sosial."},{"page_url":"https://pt.wikipedia.org/wiki/O_Compromisso_do_Profissional_de_Computa%C3%A7%C3%A3o","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Engineering_plaza.jpg","page_title":"O Compromisso do Profissional de Computação","context_page_description":"O Compromisso do Profissional de Computação é uma organização sem fins lucrativos americana que visa promover a noção de computação como uma profissão reconhecida na graduação para estudantes de Ciência da Computação e cursos relacionados. O Compromisso é baseado na Ordem do Engenheiro."},{"page_url":"https://eu.wikipedia.org/wiki/Eskoziako_Idazleen_Museoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Makars%27_Court%2C_Sir_Walter_Scott.jpg","page_title":"Eskoziako Idazleen Museoa","context_page_description":"Eskoziako Idazleen Museoa Eskoziako Edinburgh hiriburuan dagoen museoa da. A mailako eraikina izendaturik dago."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%89%E0%AE%A4%E0%AE%95%E0%AF%88_%E0%AE%AA%E0%AF%87%E0%AE%B0%E0%AF%81%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AF%81_%E0%AE%A8%E0%AE%BF%E0%AE%B2%E0%AF%88%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Ooty_town_of_Tamil_Nadu_09.jpg","page_title":"உதகை பேருந்து நிலையம்","context_page_description":"உதகை பேருந்து நிலையம் ஊட்டி நகரத்தில் அமைந்துள்ள ஒரு பேருந்து நிலையமாகும். இதை உதகமண்டலம் மத்தியப் பேருந்து நிலையம் என்றும் அழைப்பார்கள். குன்னூர், கோத்தகிரி மற்றும் கூடலுர் நகரங்களில் பேருந்து நிலையங்கள் இருந்தாலும் நீலகிரி மாவட்டத்திற்கான முதன்மை பேருந்து நிலையமாக உதகை பேருந்து நிலையம் இயங்கி வருகிறது."},{"page_url":"https://en.wikipedia.org/wiki/Trinity_Great_Court","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Trinity_College%2C_Cambridge_-_Great_Gate.jpg","page_title":"Trinity Great Court","context_page_description":"Great Court is the main court of Trinity College, Cambridge, and reputed to be the largest enclosed courtyard in Europe.\\nThe court was completed by Thomas Nevile, master of the college, in the early years of the 17th century, when he rearranged the existing buildings to form a single court."},{"page_url":"https://it.wikipedia.org/wiki/Cerro_Branco","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Bandeira_Cerro_Branco.jpg","page_title":"Cerro Branco","context_page_description":"Cerro Branco è un comune del Brasile nello Stato del Rio Grande do Sul, parte della mesoregione Centro Oriental Rio-Grandense e della microregione di Cachoeira do Sul."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Neuss","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Stolperstein_Neuss_Innenstadt_B%C3%BCchel_31_Adolf_Cohen.jpg","page_title":"Liste der Stolpersteine in Neuss","context_page_description":"In der Liste der Stolpersteine in Neuss werden die vorhandenen Gedenksteine aufgeführt, die im Rahmen des Projektes Stolpersteine des Künstlers Gunter Demnig bisher in Neuss verlegt worden sind. Seit November 2005 sind an 34 Standorten in Neuss bislang 81 Stolpersteine verlegt worden, die letzten am 8. Mai 2017. Die wissenschaftliche Begleitung des Projekts liegt beim Stadtarchiv Neuss."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%A4%A7%E5%B1%B1%E9%9A%B1%E5%B2%90%E5%9C%8B%E7%AB%8B%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Cape_Hinomisaki_Izumo07bs4592.jpg","page_title":"大山隱岐國立公園","context_page_description":"大山隐岐国立公园，是位在日本鸟取县、岛根县、冈山县的国立公园。"},{"page_url":"https://es.wikipedia.org/wiki/Marip%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Flag_of_Marip%C3%AD.svg","page_title":"Maripí","context_page_description":"Maripí es un municipio colombiano ubicado en la provincia de Occidente en el departamento de Boyacá. Está situado a 41 km de la ciudad de Chiquinquirá, la capital de la provincia, y a 119 kilómetros de la ciudad de Tunja la capital del departamento. Hasta la década de 1990 su economía era de tipo agropecuario, pero desde entonces, se dio a conocer por el descubrimiento y explotación de yacimientos esmeraldiferos en su territorio."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%88%D9%84%D8%A7%D8%B1_%D8%A5%D9%85%D8%A8%D9%84%D8%B3_(%D8%B7%D8%A7%D8%A6%D8%B1%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Solar_Impulse_SI2_pilote_Bertrand_Piccard_Payerne_November_2014.jpg","page_title":"سولار إمبلس (طائرة)","context_page_description":"الطائرة سولار إمبلس ‏ هي طائرة خفيفة تجريبية من صنع \\"برتراند بيكارد\\" و\\"أندريه بورشبرج\\" السويسريين، وهي تعمل بالطاقة الشمسية. قامت الطائرة برحلتها يوم 5 يونيو 2012 لمدة 19 ساعة متواصلة عبر مسافة 830 كيلومتر من مدريد، إسبانيا إلى الرباط بالمغرب، وتعتبر تلك الرحلة أول رحلة عابرة لقارتين تقوم بها طائرة تسيرها الطاقة الشمسية. كما يبغي المخترعان القيام بدورة كاملة حول الكرة الأرضية خلال عام 2014.\\nوكان الغرض من تلك الرحلة تجهيز وسائل الاتصالات لتقنية جديدة، ومحاولة التوصل إلى نظام جديد للطيران يكون محافظًا على البيئة واقتصاديًا في نفس الوقت. ولم يكن إحراز رقم قياسي في الطيران بهذا النوع هو الحافز، وإنما يختص الحافز بالتوصل إلى تقنية محرك طائرة صديقة للبيئة، من دون استهلاك للوقود.\\nوتتصف الطائرة التجريبية من نوع HB-SIA بعرض جناحيها حيث يبلغ الجناح الواحد 64 متر ويبلغ وزنه 6و1 طن. وتبلغ مساحة الجهة العلوية من الطائرة نحو 200 متر مربع، مرصعة بنحو 12.000 خلية شمسية. وقد بدأ المخترعان بتصميم وبناء الطائرة الثانية من نوع HB-SIB الجديدة عام 2011، والتي يبغيان القيام بها بدورة كاملة حول الأرض.\\nخلال رحلة 2012 في شهر مايو إلى المغرب وصل ارتفاع الطائرة فوق جبل طارق إلى نحو 8500 متر، وهذا يضطر الطيار للبس قناع لاستنشاق الاكسجين من أنبوبة أعدت لذلك، حيث أن ضغط الهواء يقل بالارتفاع عن سطح الأرض."},{"page_url":"https://it.wikipedia.org/wiki/Artiodactyla","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Tragulus_javanicus_Ueno_Zoo_Tokyo.JPG","page_title":"Artiodactyla","context_page_description":"L'ordine degli Artiodattili, dal greco artios pari e dactylos dito, appartiene ai mammiferi euteri. La parentela prossima tra gli Ippopotamidi ed i Cetacei basata su analisi genetiche renderebbe quest'ordine non monofiletico. L'unione di Artiodattili e Cetacei forma l'ordine dei Cetartiodattili, questo sì monofiletico.\\nLa definizione tradizionale li presenta come ungulati che possiedono un numero pari di dita e la cui zampa è retta ugualmente dal terzo e quarto dito contrariamente ai perissodattili, che possiedono un numero dispari di dita e il cui peso è supportato essenzialmente dal terzo dito.\\nI più antichi fossili conosciuti di artiodattili datano da 50 a 60 milioni di anni inizio dell'Eocene. Nel tardo Eocene i tre sottordini moderni si erano già differenziati, attorno a 45 milioni di anni fa. Quest'ordine è diffuso in tutto il mondo, tranne che in Australia e in Nuova Zelanda, fatte salve le recenti importazioni di animali domestici. Comprende circa 300 specie, i due terzi delle quali di ruminanti.\\nCaratteristiche comuni a molte specie di artiodattili, ma non a tutte, sono l'alimentazione erbivora e, di conseguenza, la presenza di molari ben sviluppati, di corna e di zoccoli."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B3%D9%81%DB%8C%D8%AF_%D9%85%D8%B3_(I)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Cu3Pstructure.jpg","page_title":"فسفید مس (I)","context_page_description":"فسفید مس (I) با فرمول شیمیایی Cu۳P یک ترکیب شیمیایی با شناسه پاب‌کم ۱۵۹۳۹۹ است. که جرم مولی آن ۲۲۱٫۶۱۲۷ g/mol می‌باشد. شکل ظاهری این ترکیب، کریستال‌های خاکستری مایل به زرد است."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radeberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Radeberg-PulsnitzerStr-09.jpg","page_title":"Liste der Kulturdenkmale in Radeberg","context_page_description":"In der Liste der Kulturdenkmale in Radeberg sind die Kulturdenkmale der sächsischen Stadt Radeberg verzeichnet, die bis Juli 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BA%D0%BB%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Tecklenburg_in_ST.svg","page_title":"Текленбург","context_page_description":"Текленбург град је у њемачкој савезној држави Северна Рајна-Вестфалија. Једно је од 24 општинска средишта округа Штајнфурт. Према процјени из 2010. у граду је живјело 9.387 становника. Посједује регионалну шифру 5566088."},{"page_url":"https://sv.wikipedia.org/wiki/Trillium_cernuum","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Trilliumcernumm.jpg","page_title":"Trillium cernuum","context_page_description":"Trillium cernuum är en nysrotsväxtart som beskrevs av Carl von Linné. Trillium cernuum ingår i släktet treblad, och familjen nysrotsväxter. Inga underarter finns listade."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%82%BB%E3%83%95_(%E7%81%AB%E6%98%9F%E3%81%AE%E3%82%AF%E3%83%AC%E3%83%BC%E3%82%BF%E3%83%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Rockgusev.jpg","page_title":"グセフ (火星のクレーター)","context_page_description":"グセフは、火星の赤道付近南緯14.5度 東経175.4度に位置するクレーターである。直径は166kmで、約30億年~40億年前に形成されたと考えられている。このクレーターの名前は、1976年にロシアの19世紀の天文学者マトヴェイ・グセフから名づけられた。\\nグセフクレーターにはマーディム渓谷と名づけられた谷が接続しており、過去の火星において、液体の水か、水と氷がこのクレーターに流れ込んでいたと考えられている。当時クレーターはクレーター湖となっており、3,000 ft もの堆積物で満たされていたとみられる。いくつかの露出した地層により層状の構造があることが窺え、何人かの研究者はマーディム渓谷との接続部付近は地球で見られるような三角州であると主張している。このような三角州は地球では一万年から十万年といった時間をかけて形成されるもので、三角州の存在は水の流れが長期に渡り続いていたことを示唆している。軌道上からの映像でも、実際にマーディム渓谷から供給された水により、巨大な湖が存在していたことが読み取れる。しかし、その流れがゆっくり持続したものであったか、それとも爆発的で断続したものであったか、またはその組み合わせかまでは分かっていない。\\nまた、衛星写真からはグセフクレーターの底面に塵旋風の痕跡も確認されていた。後に着陸したスピリットは地上からの塵旋風の撮影に成功しており、その強風はローバーの太陽電池パネルの汚れをも吹き飛ばし、長期に渡る探索を支えた一因ともなった。\\n2004年1月3日、グセフクレーターにアメリカ航空宇宙局 の2機のマーズ・エクスプロレーション・ローバーの最初の機体、スピリットが着陸した。この付近のクレーターに早い時代の露出した堆積物があることを期待したものだったが、着陸地点周辺のクレーターは溶岩に覆われたものばかりで、研究のための基盤岩を欠く、期待はずれのものだった。探査機は最終的にコロンビア・ヒルズという丘に向かい、その岩石から、古代において少量ながら塩分濃度の高い水と相互作用があった痕跡を発見したが、スピリットに続く機体であるオポチュニティの着陸地点だったメリディアニ平原とは程遠い地点だった。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E5%AE%AE%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Site_of_Ch%C5%8Dsokabe_Morichika%27s_Position.jpg","page_title":"南宮山","context_page_description":"南宮山は、岐阜県大垣市、不破郡垂井町、関ケ原町、養老郡養老町にまたがる標高419 mの山。山頂は大垣市と垂井町の境界にある。山域は1970年12月28日に、揖斐関ヶ原養老国定公園の指定を受けている。別名が、「美濃ノ中山」。"},{"page_url":"https://nl.wikipedia.org/wiki/Ferdinand_Le_Drogo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Ferdinand_Le_Drogo.jpg","page_title":"Ferdinand Le Drogo","context_page_description":"Ferdinand Le Drogo was een Franse wielrenner."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%BC_%D0%B2_%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/20140620_Veliko_Tarnovo_130.jpg","page_title":"Список памятников русским в Болгарии","context_page_description":"В Болгарии установлено свыше 400 памятников русским. Многие улицы, города и сёла названы в честь русских общественных деятелей и полководцев, погибших или прославившихся в Русско-турецкую войну 1877—1878, когда Болгария снова приобрела свою свободу после пятивекового османского владычества."},{"page_url":"https://en.wikipedia.org/wiki/Miranda_de_Ebro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Miranda_on_the_Ebro.jpg","page_title":"Miranda de Ebro","context_page_description":"Miranda de Ebro is a city on the Ebro river in the province of Burgos in the autonomous community of Castile and León, Spain. It is located in the north-eastern part of the province, on the border with the province of Álava and the autonomous community of La Rioja. According to the 2008 census conducted by Spain's National Institute of Statistics, it has a population of 39,589 inhabitants, making it the second most populous city in the province after the capital, Burgos.\\nThe city has an industrial economy focusing on the chemical industry. It is an important transportation hub, especially as a railroad junction. Within 80 kilometres are the cities of Bilbao, Burgos, Logroño and Vitoria-Gasteiz."},{"page_url":"https://es.wikipedia.org/wiki/La_Puebla_del_R%C3%ADo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Custodia.png","page_title":"La Puebla del Río","context_page_description":"La Puebla del Río es un municipio español de la provincia de Sevilla, Andalucía. En 2018 contaba con 11 897 habitantes. Su extensión superficial es de 375,14 km² y tiene una densidad de 31,66 hab/km². Sus coordenadas geográficas son 37º 16' N, 6º 03' O. Se encuentra situada a una altitud de 20 metros y a 16,8 kilómetros de la capital de provincia, Sevilla. Tienen especial importancia sus cultivos de regadío, arroz, naranjos, maíz, algodón, girasol y trigo."},{"page_url":"https://fr.wikipedia.org/wiki/Findhorn_(rivi%C3%A8re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Long_Broom_pool%2C_River_Findhorn%2C_near_Logie_-_geograph.org.uk_-_646259.jpg","page_title":"Findhorn (rivière)","context_page_description":"Le Findhorn est un fleuve d'Écosse.\\nS'écoulant dans le nord-est de la nation, l'embouchure du Findhorn est située dans le Moray Firth, sur la côte nord. Son estuaire est l'un des plus grands d'Écosse qui ne soit pas un firth.\\nLe cours d'eau, l'un des plus longs d'Écosse, est poissonneux et est réputé pour la pêche au saumon et à la truite."},{"page_url":"https://it.wikipedia.org/wiki/Walter_Zenga","image_url":"https://upload.wikimedia.org/wikipedia/it/6/64/Mondiale_1990_-_Italia_vs_Argentina_-_Gol_di_Caniggia.JPG","page_title":"Walter Zenga","context_page_description":"Walter Zenga è un allenatore di calcio ed ex calciatore italiano, di ruolo portiere.\\nDistintosi come uno dei migliori portieri di sempre, ha legato il proprio nome all'Inter, con cui ha disputato 473 incontri, vincendo uno scudetto, una Supercoppa italiana e due Coppe UEFA.\\nIn nazionale ha totalizzato 58 presenze, prendendo parte a due campionati del mondo e a un campionato d'Europa. Durante il campionato del mondo 1990, concluso al terzo posto, ha mantenuto la porta inviolata per 517 minuti consecutivi, record assoluto della competizione. Ha inoltre disputato i Giochi olimpici di Los Angeles 1984 e, da fuoriquota, l'Europeo Under-21 del 1986.\\nA livello individuale, è stato eletto portiere dell'anno IFFHS per tre volte consecutive, classificandosi terzo in altre due occasioni; la stessa IFFHS lo ha nominato «miglior portiere del decennio» nel 1997 e collocato in 20ª posizione nell'elenco dei più forti portieri del XX secolo. Nel 1988 e nel 1990 si è classificato rispettivamente 17º e 12º nella corsa al Pallone d'oro. Il 9 marzo 2018, in concomitanza col 110º anniversario della fondazione dell'Inter, è stato il primo portiere a essere inserito nella Hall of Fame del club milanese."},{"page_url":"https://ro.wikipedia.org/wiki/Mandaguari","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Mandaguari.jpg","page_title":"Mandaguari","context_page_description":"Mandaguari este un oraș în Paraná, Brazilia."},{"page_url":"https://lt.wikipedia.org/wiki/Grau%C5%BEupis_(Veivir%C5%BEas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Grau%C5%BEupisJuodupioVyskuPlk4.jpg","page_title":"Graužupis (Veiviržas)","context_page_description":"Graužupis – upelis Vakarų Lietuvoje, pietinėje Klaipėdos rajono savivaldybės teritorijos dalyje, dešinysis Veiviržo intakas.\\nIštakos yra Kausteiklių kaimo šiaurės rytinėje dalyje. Aukštupyje teka pamiške, vakarų kryptimi. Kaimo šiaurinėje dalyje pasuka į pietus, o Trepkalniuose – į pietvakarius, kerta kelią 2213 Veiviržėnai–Brožiai–Vėžaičiai ir puslankiu aplenkia iš vakarų pusės Veiviržėnus. Į Veiviržą įteka Vyskupiškių šiaurės rytiniame pakraštyje, 0,54 km į pietus nuo tilto kelyje 2202 Klaipėda–Veiviržėnai–Endriejavas, 32,9 km nuo jos žiočių.\\nIntakai\\nJuodupis.\\nGyvenvietės\\nKausteikliai, Trepkalniai, Meiskiai, Juodupis, Vyskupiškiai.\\nUpėvardis kildinamas iš žodžio graužas."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E5%86%B6%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Red_Star_Lake%2C_Qinglongshan_Park.jpg","page_title":"大冶市","context_page_description":"大冶市位于中国湖北省东南部，长江中游南岸，现为县级市，由黄石市代管。面积1566.3平方公里，人口95万人。\\n大冶市地处湖北“冶金走廊”腹地及武汉城市经济圈内，是武汉城市圈冶金建材走廊的重要支点，是全国闻名的青铜文化故里，矿藏荟萃之乡和保健酒基地。\\n大冶以铁矿而著名。有“金汉口，银保安，破铜烂铁大冶县”的传言。其它矿藏有金、银、铜以及煤炭、石膏等非金属矿藏。\\n大冶被评为第五届全国文明城市。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%9B%D0%B0%D0%B2%D1%80%D0%B5%D0%BD%D1%82%D0%B8%D0%B9_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Chwanow.jpg","page_title":"Чванов, Лаврентий Андреевич","context_page_description":"Лаврентий Андреевич Чванов — советский офицер, танкист, в годы Великой Отечественной войны — лейтенант, командир роты 71-й механизированной бригады 9-го механизированного корпуса 3-й гвардейской танковой армии 1-го Украинского фронта, Герой Советского Союза."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E5%9C%B0%E3%83%89%E3%82%A4%E3%83%84%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Continental_West_Germanic_languages.png","page_title":"高地ドイツ語","context_page_description":"高地ドイツ語は、ドイツ語の言語変種。ドイツ語高地方言とも呼ばれる。また、第二次子音推移を受けていない低地ドイツ語との対比の意味で、標準ドイツ語のことを「高地ドイツ語」と呼ぶ場合もある。"},{"page_url":"https://eu.wikipedia.org/wiki/Kriebitzsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Kirche_Kriebitzsch.jpg","page_title":"Kriebitzsch","context_page_description":"Kriebitzsch Alemaniako udalerria da. Turingia estatuan kokatuta dago, Altenburger Land barrutian. 2014an 1.059 biztanle zituen 13,3 kilometro koadrotan banatuta."},{"page_url":"https://en.wikipedia.org/wiki/Curiosity_(rover)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Drawing-of-the-Mars-Science_Laboratory.png","page_title":"Curiosity (rover)","context_page_description":"Curiosity is a car-sized rover designed to explore Gale Crater on Mars as part of NASA's Mars Science Laboratory mission. Curiosity was launched from Cape Canaveral on November 26th, 2011, at 15:02 UTC and landed on Aeolis Palus inside Gale on Mars on August 6th, 2012, 05:17 UTC. The Bradbury Landing site was less than 2.4 km from the center of the rover's touchdown target after a 560 million km journey. The rover's goals include an investigation of the Martian climate and geology; assessment of whether the selected field site inside Gale has ever offered environmental conditions favorable for microbial life, including investigation of the role of water; and planetary habitability studies in preparation for human exploration.\\nIn December 2012, Curiosity's two-year mission was extended indefinitely, and on August 5th, 2017, NASA celebrated the fifth anniversary of the Curiosity rover landing. The rover is still operational, and as of August 21, 2020, Curiosity has been on the planet Mars for 2859 sols since landing on August 6th, 2012. The NASA/JPL Mars Science Laboratory/Curiosity Project Team was awarded the 2012 Robert J."},{"page_url":"https://et.wikipedia.org/wiki/Ruuge_p%C3%A4evaliilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/HemerocallisFulva1UME.jpg","page_title":"Ruuge päevaliilia","context_page_description":"Ruuge päevaliilia on tooneliilialiste sugukonda arvatud taimeliik.\\nTaime kasvatatakse Eestis ilutaime, harva taim metsistub."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Conon.jpg","page_title":"Конон","context_page_description":"Конон је био атински војсковођа. Био је главни заповедник када је уништена цела атинска флота у бици код Егоспотама. Као главни заповедник персијске флоте заслужан је за уништење спартанске флоте у бици код Книда 394. п. н. е. Захваљујући Конону за време Коринтскога рата поништени су главни резултати Пелопонеског рата, тј. Атина је поново добила флоту и изграђени су атински дуги зидови и утврђења у Пиреју."},{"page_url":"https://ca.wikipedia.org/wiki/Premis_Oscar_de_1941","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Oscar_Hammerstein_-_portrait.jpg","page_title":"Premis Oscar de 1941","context_page_description":"Els Premis Oscar de 1941 foren presentats el 26 de febrer de 1942 en una cerimònia realitzada al Biltmore Hotel de Los Angeles. La cerimònia presentada per Bob Hope."},{"page_url":"https://da.wikipedia.org/wiki/Refraktion","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/R-DSC00449-WMC.jpg","page_title":"Refraktion","context_page_description":"Bølgefænomener bevæger sig med en hastighed der afhænger af det medium, bølgerne færdes i. Bevæger en plan bølge sig fra et område med én udbredelseshastighed til et andet område med en anden udbredelseshastighed, ændres bølgens udbredelsesretning som følge af et fænomen der kaldes refraktion eller brydning.\\nLysets brydning i glas, vand og andre gennemsigtige stoffer er et eksempel på refraktion: Fordi lyset bevæger sig godt 30 % langsommere i glas end i den omgivende luft, tvinges det til at ændre retning når det rammer grænsefladen mellem glas og luft."},{"page_url":"https://sv.wikipedia.org/wiki/Wusterhausen/Dosse","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Wappen_Wusterhausen.png","page_title":"Wusterhausen/Dosse","context_page_description":"Wusterhausen/Dosse är en kommun och ort vid floden Dosse i Tyskland, belägen i Landkreis Ostprignitz-Ruppin i förbundslandet Brandenburg. Huvudort i kommunen är Wusterhausen/Dosse, som av historiska skäl kallas Stadt Wusterhausen/Dosse, även om kommunen sedan 1997 inte längre har stadsstatus."},{"page_url":"https://eu.wikipedia.org/wiki/Catchall_(Kornualles)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/The_Blind_Fiddler_Standing_Stone_-_geograph.org.uk_-_974553.jpg","page_title":"Catchall (Kornualles)","context_page_description":"Catchall, Ingalaterrako Kornualles konderriko herrixka bat da."},{"page_url":"https://de.wikipedia.org/wiki/Regierung_Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Stephen_Donnelly_2016.jpg","page_title":"Regierung Martin","context_page_description":"Die Regierung Martin ist seit dem 27. Juni 2020 die Regierung von Irland. Premierminister ist Micheál Martin. Sie löst die Regierung Varadkar ab.\\nLeo Varadkar kündigte nach der verlorenen Parlamentswahl 2020 an, dass er als Taoiseach zurücktreten werde, dass die Regierung jedoch gemäß den Bestimmungen von Artikel 28.11 der Verfassung ihre Aufgaben bis zur Ernennung ihrer Nachfolger weiterhin wahrnehme.\\nNach Verhandlungen einigten sich Fianna Fáil und Fine Gael mehr als vier Monate nach der Parlamentswahl mit den Grünen auf eine \\"historische Koalition\\". Der Posten des Taoiseach wird demnach zwischen den beiden bürgerlichen Parteien „rotieren“. Zunächst soll Micheál Martin bis 2022 Premier sein, dann würde Leo Varadkar erneut diese Position übernehmen.\\nAm 27. Juni debattierte der Dáil über Nominierungen für die Position von Taoiseach. Die Nominierung von Micheál Martin wurde vom Dáil genehmigt. Martin wurde anschließend von Präsident Michael D. Higgins zum Taoiseach ernannt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BC%D0%B5%D0%BB%D1%8C%D0%BA%D0%BE%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Yuri-Komelkov.jpg","page_title":"Комельков, Юрий Александрович","context_page_description":"Ю́рий Алекса́ндрович Комелько́в — украинский издатель, галерист, коллекционер. Учредитель рекламного агентства полного цикла «Атлант ЮЭмСи», основатель журнала «Ре! Zоны», основатель компании «Арт-блюз» и галереи «Арт-блюз», собственник галереи «Триптих», учредитель и главный редактор журнала «Аура», основатель интернет-платформы Cultprostir. Инициатор и руководитель благотворительного фонда художника Ивана Марчука и фундации «КультАура».\\nПочётная грамота Кабинета Министров Украины — «за высокие производственные достижения в развитии издательского и рекламного дела и значительный личный вклад в обеспечение успешного проведения в мае 2008 г. в г. Киеве ежегодных сборов Совета управляющих Европейского банка реконструкции и развития»."},{"page_url":"https://es.wikipedia.org/wiki/Mihla","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Wappen_Mihla.png","page_title":"Mihla","context_page_description":"Mihla es un municipio situado en el distrito de Wartburg, en el estado federado de Turingia, a una altitud de 200 metros. Su población a finales de 2016 era de unos 2 130 habitantes y su densidad poblacional, 68 hab/km².​​​\\nSe encuentra ubicado cerca de la ciudad de Eisenach y de la frontera con el estado de Hesse."},{"page_url":"https://en.wikipedia.org/wiki/2006_Maryland_Comptroller_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Maryland_Comptroller_Election%2C_2006.svg","page_title":"2006 Maryland Comptroller election","context_page_description":"The 2006 Maryland Comptroller election was held on November 7, 2006. Incumbent Democratic State Comptroller William Donald Schaefer ran for a third term, but was defeated in the Democratic primary by Peter Franchot, a State Delegate from Montgomery County. On the Republican side, Anne McCarthy, the former dean of the University of Baltimore business school, won a crowded primary and faced off against Franchot. In the general election, Franchot defeated McCarthy and became the next Comptroller of Maryland."},{"page_url":"https://de.wikipedia.org/wiki/Nordth%C3%BCringer_H%C3%BCgelland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Halde_Sondershausen.jpg","page_title":"Nordthüringer Hügelland","context_page_description":"Das Nordthüringer Hügelland ist eine Hügellandschaft im Norden von Thüringen in den Landkreisen Nordhausen, Kyffhäuser und mit einem geringen Anteil im Landkreis Eichsfeld.\\nEs liegt zwischen dem Harz im Norden, dem Kyffhäusergebirge im Osten und der Hainleite im Süden und gehört nach dem\\nHandbuch der naturräumlichen Gliederung Deutschlands zum Thüringer Becken.\\nDie Landschaft hebt sich von den meisten Nachbarlandschaften durch anstehenden Buntsandstein ab. Bekannteste Teillandschaft ist der Höhenzug Windleite im Südosten."},{"page_url":"https://pt.wikipedia.org/wiki/Banco_Central_da_R%C3%BAssia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Zhukovskij%2C_Julij_Galaktionovich.jpg","page_title":"Banco Central da Rússia","context_page_description":"O Banco Central da Federação Russa, também conhecido como Banco da Rússia é o banco central da Federação Russa, fundado em 1860 como Banco Estatal do Império Russo sede na Rua Neglinnaya, em Moscou. Suas funções são descritas na constituição russa e na lei federal especial."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%95%E0%B0%82%E0%B0%AA%E0%B1%8D%E0%B0%AF%E0%B1%82%E0%B0%9F%E0%B0%B0%E0%B1%8D_%E0%B0%B9%E0%B0%BE%E0%B0%B0%E0%B1%8D%E0%B0%A1%E0%B1%8D%E2%80%8C%E0%B0%B5%E0%B1%87%E0%B0%B0%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Quick_overview_of_pc_hardware.jpg","page_title":"కంప్యూటర్ హార్డ్‌వేర్","context_page_description":"హార్డ్‌వేర్‌ అనే మాటకి కంప్యూటర్ పరిభాషలో ఒక ప్రత్యేకమైన అర్ధం ఉంది. చేతితో ముట్టుకోడానికిగాని, పట్టుకోడానికికాని వీలైన భాగాలన్నీ స్థూలకాయం నిర్వచనంలో ఇముడుతాయి. ఉదాహరణకి, బల్ల మీద ఇమిడే సొంత కంప్యూటరు కొనగానే మన చేతులతో తడిమి చూడడానికి వీలైనవి ముఖ్యంగా మూడు: కంప్యూటర్‌ యొక్క అంతర్భాగాలన్నిటిని కప్పుతూ పైకి కనిపించే రేకు పెట్టె లాంటిది ఒకటి, మనం రాసేవి, చూసేవి కనపడడానికి వీలుగా ఒక గాజు తెర, దానితోపాటు టైపు చెయ్యడానికి వీలైన ఒక మీటల ఫలకము, వగైరా, వీటన్నిటిని అనుసంధించడానికి తీగలు. ఇవీ బయటకి కనిపించే స్థూలకాయం యొక్క ముఖ్య భాగాలు.\\nకంప్యూటర్ హార్డ్‌వేర్ అనునది కంప్యూటరుకు సంబంధించిన ఒక భౌతిక విభాగం. ఒక కంప్యూటరు లోని విడి భాగాలు, వాటిని కలిపే సాంకేతిక పరికరాల సముదాయమే హార్డ్‌వేర్. ఐతే ఇది కంప్యూటరు సాఫ్ట్‌వేర్కు పూర్తిగా భిన్నం. ఎందుకంటే సాఫ్ట్‌వేర్ అనేది హార్డ్‌వేర్ లోనే అంతర్గతంగా పనిచేస్తుంది. సాఫ్ట్‌వేర్ లోనే మరో రకం ఫర్మ్ వేర్. వీటిని ఎప్పటికప్పుడు మార్చవలసిన అవసరం ఉండదు. కాబట్టి ఇవి రీడ్-ఓన్లీ మెమోరీ లాంటి హార్డ్‌వేర్ భాగాల లోనే నిక్షిప్తం చేయబడతాయి.\\nకొన్ని మినహా చాలా వరకు కంప్యూటరు హార్డ్‌వేర్ సాధారణ ప్రజలు చూసి ఉండరు. ఎందుకంటే అవన్నీ సీపీయూ అని పిలువబడే ఒక క్యాబినెట్ లో ఉంటాయి."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%87%91%E8%8F%AF%E4%BF%A1%E8%99%9F%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Kanehana_station01.JPG","page_title":"金華信號場","context_page_description":"金华线路所是位于北海道北见市留边蘂町金华，隶属于北海道旅客铁道石北本线上的线路所，过往曾为客运车站，并由北见站管理的无人车站。由于使用人数偏低，JR北海道于2016年3月26日随全国铁路时间表改正时废站，降为线路所。\\n旧站名“奔无加”源自阿伊努语的“pon-mu-ka”，后来附近发现金矿，故取“金加”二字，再按同音汉字改为“金华”。\\n废站前是快速列车“北见”的停车站，每日共有8班下行及5班上行列车停靠，当中包括有3班由网走站及北见站开出、以本站为终站的区间车；同时，本站亦是其中一个列车交会站，但由于车站附近为过疏社区，2010年的人口调查发现整个金华地区只有5户共10名居民，而根据JR北海道的乘客调查显示，本站一日平均乘车人数更少于1人，因而最终作出废站决定。废站后，其中两班区间车改以西留边蘂站为终站，而另一班则取消。"},{"page_url":"https://sk.wikipedia.org/wiki/La_L%C3%A9ch%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Thermes_de_La_L%C3%A9ch%C3%A8re.JPG","page_title":"La Léchère","context_page_description":"La Léchère je francúzska obec, ktorá sa nachádza v departemente Savoie, v regióne Rhône-Alpes."},{"page_url":"https://simple.wikipedia.org/wiki/Official_residence","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Bratislava-grassalkovi%C4%8Dov_pal%C3%A1c.jpg","page_title":"Official residence","context_page_description":"An official residence is the house or home that a head of state or head of government lives in."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%99%D7%98%D7%9C_%D7%91%D7%99%D7%92%D7%94%D7%95%D7%A8%D7%9F_(%D7%A0%D7%94%D7%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bighornrivermap.jpg","page_title":"ליטל ביגהורן (נהר)","context_page_description":"נהר ליטל ביגהורן הוא יובל של נהר ביגהורן במדינות ויומינג ומונטנה בארצות הברית. הנהר מפורסם בעקבות קרב ליטל ביגהורן שהתרחש בקרבתו."},{"page_url":"https://en.wikipedia.org/wiki/H%C3%B6rselberg-Hainich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/H%C3%B6rselberg-Hainich_in_WAK.png","page_title":"Hörselberg-Hainich","context_page_description":"Hörselberg-Hainich is a municipality in the Wartburgkreis district of Thuringia, Germany. It was formed on 1 December 2007 combining the former municipalities of Behringen and Hörselberg."},{"page_url":"https://sk.wikipedia.org/wiki/Arlos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Arlos_%C3%A9glise.jpg","page_title":"Arlos","context_page_description":"Arlos je francúzska obec, ktorá sa nachádza v departemente Haute-Garonne, v regióne Midi-Pyrénées."},{"page_url":"https://fr.wikipedia.org/wiki/Satillieu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Satillieu_ch%C3%A2teau_et_clocher.jpg","page_title":"Satillieu","context_page_description":"Satillieu, en occitan Satilhau, est une commune française, chef-lieu de canton jusqu'en 2014, située dans le département de l'Ardèche en région Auvergne-Rhône-Alpes, à 14 kilomètres au sud d'Annonay."},{"page_url":"https://hsb.wikipedia.org/wiki/Lima","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Lima_Palacio_Gobierno.JPG","page_title":"Lima","context_page_description":"Lima je stolica južnoameriskeho Peruwa a z wulkim wotstawkom zdobom najwjetše město w kraju. Nadeńdźe so při brjoze Ćicheho oceana nad rěku Río Rímac na zapadźe Peruwa. Centrum města leži 160 metrow nad mórskej hładźinu, mjeztym zo sahaja so měšćanske dźěle hač do wysokosće wot 1000 metrow. W měsće samym bydli na přestrjeni wot 2672 kwadratnych kilometrow něhdźe dźewjeć milionow wobydlerjow. Hromadźe ze susodnym přistawnym městom Callao ma metropolowy region wjace hač 10 milionow wobydlerjow.\\nLima je wažne wobchadne křižowanišćo kaž tež najwuznamniši hospodarski a kulturny centrum Peruwa z uniwersitami, wysokimi šulemi, muzejemi a twarskimi pomnikami. Stare město słuša wot lěta 1991 do swětoweho herbstwa UNESCO."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Mainz-Oberstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Villa_An_der_Karlsschanze_7.JPG","page_title":"Liste der Kulturdenkmäler in Mainz-Oberstadt","context_page_description":"In der Liste der Kulturdenkmäler in Mainz-Oberstadt sind alle Kulturdenkmäler im Ortsbezirk Oberstadt der rheinland-pfälzischen Stadt Mainz aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://sv.wikipedia.org/wiki/Str%C3%A1%C5%BEkovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Strazkovice_CB_CZ.png","page_title":"Strážkovice","context_page_description":"Strážkovice är en ort i Tjeckien. Den ligger i länet Södra Böhmen, i den södra delen av landet, 130 km söder om huvudstaden Prag. Strážkovice ligger 541 meter över havet och antalet invånare är 342.\\nTerrängen runt Strážkovice är huvudsakligen platt. Strážkovice ligger uppe på en höjd. Den högsta punkten i närheten är Kohout, 869 meter över havet, 14,6 km söder om Strážkovice. Runt Strážkovice är det ganska tätbefolkat, med 86 invånare per kvadratkilometer. Närmaste större samhälle är České Budějovice, 10,8 km nordväst om Strážkovice. I omgivningarna runt Strážkovice växer i huvudsak blandskog.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 7 °C. Den varmaste månaden är juli, då medeltemperaturen är 18 °C, och den kallaste är januari, med -7 °C. Genomsnittlig årsnederbörd är 1 062 millimeter. Den regnigaste månaden är maj, med i genomsnitt 157 mm nederbörd, och den torraste är mars, med 36 mm nederbörd."},{"page_url":"https://nl.wikipedia.org/wiki/Katarzyna_Kiedrzynek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Katarzyna_Kiedrzynek_-_2015.jpg","page_title":"Katarzyna Kiedrzynek","context_page_description":"Katarzyna Kiedrzynek is een Pools doelvrouw. Ze komt sinds 2013 uit voor Paris Saint-Germain en daarvoor voor het vrouwenelftal van Górnik Łęczna. Daarnaast speelt ze voor het Poolse vrouwenvoetbalelftal."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D8%A7%D8%AB%D8%A7%D9%86_%D9%87%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Nathan_Hill_%282018%29.jpg","page_title":"ناثان هيل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nناثان هيل كاتب من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Des_Kaisers_neue_Kleider","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/B%C3%BCro-_und_Gesch%C3%A4ftshaus_Br%C3%BCckenstra%C3%9Fe_17_-_Detail_-7074.jpg","page_title":"Des Kaisers neue Kleider","context_page_description":"Des Kaisers neue Kleider ist ein bekanntes Kunstmärchen des dänischen Schriftstellers Hans Christian Andersen. Es erschien am 7. April 1837 in einer Ausgabe der Reihe „Märchen, für Kinder erzählt“.\\nNotizen Andersens in seinem Tagebuch verweisen auf eine Inspiration aus der Novellensammlung von Karl Eduard von Bülow. Dieser hat bei diesem Märchen eine Geschichte der spanischen Sammlung von Don Juan Manuel übersetzt, die 1337 im Buch „El Conde Lucanor“ erschien und die Täuschung des Königs und seines Hofstaats in einem maurischen Ambiente ansiedelt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%BE%D1%82%D0%BE%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%D0%9C%D0%BE%D0%BD%D0%BE%D1%82%D0%BE%D0%BD%D0%B8%D1%8F.png","page_title":"Монотония","context_page_description":"Монотония — это функциональное состояние сниженной работоспособности, возникающее в ситуациях однообразной работы с частым повторением стереотипных действий в обыденной внешней среде. Сопровождается переживаниями скуки, апатии, сонливостью и желанием сменить вид деятельности. Также характеризуется такими физиологическими и психологическими симптомами, как снижение тонуса, ослабление сознательного контроля, ухудшение внимания и памяти, стереотипизация действий."},{"page_url":"https://de.wikipedia.org/wiki/Liste_markanter_und_alter_Baumexemplare","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/ID_1040_Linde%21%21_00006.jpg","page_title":"Liste markanter und alter Baumexemplare","context_page_description":"Große und alte Bäume Mitteleuropas haben ein Alter zwischen 300 und 600 Jahren. Viele Dörfer haben sogenannte tausendjährige Eichen oder Linden, die bei näherer Untersuchung diesen Anspruch meist nicht erfüllen. Die Altersdaten beruhen meist auf Schätzung oder Überlieferung, nur wenige einzelne Bäume sind anhand von Quellen oder Kernbohrung verlässlich altersbestimmt. Darüber hinaus existieren einige Bäume, die schon deshalb besonders interessant sind, weil sie das älteste bekannt gewordene Exemplar einer Art oder das größte jemals bekannt gewordene Exemplar darstellen."},{"page_url":"https://es.wikipedia.org/wiki/Mario_Elie","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Mario_Elie.jpg","page_title":"Mario Elie","context_page_description":"Mario Antoine Elie es un exjugador de baloncesto estadounidense que disputó 11 temporadas en la NBA. Con 1,96 metros de altura, jugaba en la posición de escolta."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8E%E3%83%BC%E3%82%B9%E3%83%BB%E3%83%9D%E3%83%BC%E3%83%AB%E5%9B%BD%E9%9A%9B%E8%BB%8A%E4%B8%A1%E5%9F%BA%E5%9C%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/North_Pole_depot_trainshed.JPG","page_title":"ノース・ポール国際車両基地","context_page_description":"ノース・ポール国際車両基地は、イギリスのロンドン近郊にある車両基地である。\\n1994年にユーロスターの基地として開設され、2007年11月まで373形電車の保守管理・留置をしていた。2015年からは都市間高速鉄道計画向けの日立製作所製高速車両のノース・ポール車両基地として使用されている。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%8E%D0%BC%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/RR5514-0087r.JPG","page_title":"Тюменская область","context_page_description":"Тюме́нская о́бласть — субъект Российской Федерации, входит в состав Уральского федерального округа, располагается на юге Западной Сибири.\\nНа территории Тюменской области расположены Ханты-Мансийский автономный округ — Югра и Ямало-Ненецкий автономный округ, которые получили статус равноправных субъектов Российской Федерации в 1993 году, но территориально входят в состав Тюменской области.\\nТерриториально Тюменская область граничит на северо-западе с Архангельской областью, на западе — с Республикой Коми, на юго-западе со Свердловской и Курганской областями, на юге — с Северо-Казахстанской областью Казахстана, на юго-востоке — с Омской и Томской областями, на востоке и северо-востоке — с Красноярским краем; на севере омывается Карским морем. Тюменская область является единственным регионом России, простирающимся от морей Северного Ледовитого океана на севере и до государственной границы на юге.\\nПо площади является крупнейшей областью и занимает 3-е место среди всех субъектов РФ, уступая лишь Якутии и Красноярскому краю. Среди самых больших административно-территориальных единиц занимает 11-е место в мире и превосходит любое европейское государство."},{"page_url":"https://sh.wikipedia.org/wiki/Boyd,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/WIMap-doton-Boyd.png","page_title":"Boyd, Wisconsin","context_page_description":"Bojd je grad u američkoj saveznoj državi Viskonsin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BD%D1%89%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Wikiexpedition-Kolonschina-01.jpg","page_title":"Колонщина","context_page_description":"Коло́нщина — село, входит в Макаровский район Киевской области Украины.\\nНаселение по переписи 2001 года составляло 941 человек. Почтовый индекс — 08032. Телефонный код — 4578. Занимает площадь 0,304 км². Код КОАТУУ — 3222782601."},{"page_url":"https://de.wikipedia.org/wiki/Janet_Thornton","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Janet_Thornton_ISMB_ECCB_2017.jpg","page_title":"Janet Thornton","context_page_description":"Dame Janet Maureen Thornton DBE, ist eine britische Bioinformatikerin. Sie gehört zu den Pionieren der strukturellen Bioinformatik."},{"page_url":"https://vi.wikipedia.org/wiki/Qu%E1%BB%91c_h%E1%BB%99i_Vi%E1%BB%87t_Nam_kh%C3%B3a_XIII","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Emblem_of_Vietnam.svg","page_title":"Quốc hội Việt Nam khóa XIII","context_page_description":"Quốc hội Việt Nam khóa XIII có 500 đại biểu, được bầu vào ngày 22 tháng 5 năm 2011. Kỳ họp đầu tiên được tổ chức vào 21 tháng 7 đến 6 tháng 8 năm 2011."},{"page_url":"https://it.wikipedia.org/wiki/Cappelle_del_Sacro_Monte_di_Varallo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Varallo%2C_Sacra_monte%2C_Cappella_13-Temptations_of_Christ_in_the_Desert_03.JPG","page_title":"Cappelle del Sacro Monte di Varallo","context_page_description":"La struttura del Sacro Monte di Varallo - data dalla basilica dell'Assunta e da quarantacinque cappelle - è suddivisa in due zone: una prima si snoda in salita tra gli alberi di un bosco; la seconda si dispiega come una sorta di tessuto urbano di una città della Palestina al tempo di Gesù, denominata \\"la Nuova Gerusalemme\\".\\nOltrepassata la Porta Aurea si transita davanti ai palazzi con porticato, posti di fronte alla basilica ed attorno alla piazza del Tempio, la piazza religiosa raggiungibile anche dalla Scala Santa, ove è posta una fontana di inizio XVI secolo i cui zampilli ricordano simbolicamente le piaghe del Signore; poco distante si trova la piazza dei Tribunali, ovvero la piazza civile, con le corti di giustizia romane ed ebraiche.\\nLungo il percorso si snodano le seguenti quarantacinque cappelle:\\nIl Peccato originale\\nL'Annunciazione\\nLa Visitazione\\nIl sogno di san Giuseppe\\nI Magi a Betlemme\\nLa Natività\\nAdorazione dei pastori\\nPresentazione di Cristo al Tempio\\nL'Angelo avvisa san Giuseppe di fuggire in Egitto\\nLa fuga in Egitto\\nLa Strage degli innocenti\\nBattesimo di Gesù\\nLa tentazione di Cristo\\nLa samaritana\\nLa guarigione del paralitico"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%B4%E2%80%99%D0%AD%D1%80%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/%D0%91%D0%B0%D0%BD%D0%B4%D1%8D%D1%80%D0%BE%D1%81.jpg","page_title":"Банд’Эрос","context_page_description":"«Банд’Эрос» — российская музыкальная группа. Стала известной после выпуска сингла «Не зарекайся» в 2005 году."},{"page_url":"https://cy.wikipedia.org/wiki/Aderyn_ffrigad_mawr","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ascension_Frigatebird.jpg","page_title":"Aderyn ffrigad mawr","context_page_description":"Aderyn a rhywogaeth o adar yw Aderyn ffrigad mawr a adnabyddir hefyd gyda'i enw gwyddonol Fregata minor; yr enw Saesneg arno yw Great frigate bird. Mae'n perthyn i deulu'r Adar Ffrigad sydd yn urdd y Pelecaniformes.\\nTalfyrir yr enw Lladin yn aml yn F. minor, sef enw'r rhywogaeth."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D0%BC%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2,_%D0%A4%D0%B0%D1%80%D0%B8%D0%B4_%D0%9A%D0%B0%D0%BC%D0%B8%D0%BB%D1%8C_%D0%BE%D0%B3%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Ferid_Ismayilov.jpg","page_title":"Исмайлов, Фарид Камиль оглы","context_page_description":"Фарид Камиль оглы Исмайлов — азербайджанский борец вольного стиля, бронзовый призёр чемпионата мира по корешу, двукратный чемпион Татарстана по борьбе среди студентов, многократный призёр чемпионатов Азербайджана."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0_%D0%BD%D0%B0_%D0%A7%D0%B5%D0%BC%D0%BF%D1%96%D0%BE%D0%BD%D0%B0%D1%82%D1%96_%D1%81%D0%B2%D1%96%D1%82%D1%83_%D0%B7_%D0%B2%D0%BE%D0%B4%D0%BD%D0%B8%D1%85_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%81%D0%BF%D0%BE%D1%80%D1%82%D1%83_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Flag_of_Canada.svg","page_title":"Канада на Чемпіонаті світу з водних видів спорту 2015","context_page_description":"Канада взяла участь у Чемпіонаті світу з водних видів спорту 2015, який пройшов у Казані від 24 липня до 9 серпня."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%81%D1%82%D0%B5%D1%80_(%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Salon_du_Bourget_20090619_110.jpg","page_title":"Астер (ракета)","context_page_description":"Aster — семейство зенитных ракет, предназначенных для установок вертикального пуска, производится европейским консорциумом Eurosam, состоящий из MBDA Франции, MBDA Италии и Thales Group. Ракета предназначена для перехвата и уничтожения широкого спектра воздушных угроз, таких как сверхзвуковые противокорабельные ракеты на предельно малой высоте и высокоскоростных самолётов или ракет.\\nНазвание «Aster» происходит от мифического греческого лучника по имени Астерион, который предположительно получил своё имя от древнего греческого слова астер, что означает «звезда».\\n«Астер» состоит на вооружении Франции, Италии и Великобритании и является интегрированным компонентом для ЗРК PAAMS, известного в Королевском флоте как Sea Viper. В качестве основного оружия ПВО, «Астер» применяется на эсминцах типа 45 и фрегатах типа «Горизонт». Ракетами «Астер» также оснащают французские и итальянские многоцелевые фрегатов FREMM, хотя они не будут работать как часть системы PAAMS."},{"page_url":"https://fy.wikipedia.org/wiki/Dei-_en_Nachtbyld","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Dag_en_nachtbeeld.JPG","page_title":"Dei- en Nachtbyld","context_page_description":"'Dei- en Nachtbyld' is in keunstwurk yn Ljouwert dat makke waard troch keunstner Ids Willemsma.\\nIt keunstwurk yn de wyk Kammingabuorren waard makke yn opdracht fan it Provinsjaal Elektrisiteits Bedriuw. It is in oersetting fan enerzjy yn romme sin. It keunstwurk is fan de Anne Vondelingwei ôf te sjen."},{"page_url":"https://sv.wikipedia.org/wiki/Mussepiggbuske","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Ochna_serrulata_Gothenburg.JPG","page_title":"Mussepiggbuske","context_page_description":"Mussepiggbuske är en växt i familjen mussepiggbuskeväxter som förekommer i södra Afrika. Det svenska trivialnamnet syftar på de svarta stenfrukterna som tillsammans med de röda foderbladen liknar Musse Piggs ansikte."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9E%D0%B1%D0%B5%D1%80%D0%BD%D0%B1%D0%B5%D1%80%D0%B3-%D0%BD%D0%B0-%D0%91%D1%80%D0%B5%D0%BD%D0%BD%D0%B5%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Obernbergersee_06.jpg","page_title":"Обернберг-на-Бреннере","context_page_description":"Обернберг-на-Бреннере — Аустриядағы коммуна. Тироль федералды жеріне қарасты Инсбрук округінің құрамына енеді.\\nҚаланың тұрақты тұрғындарының саны 358 адамды құрайды. Алып жатқан жер аумағы 38.66 км² шамасында. Елді мекеннің автомобиль коды — IL, ресми идентификациялық коды — 7 03 36.\\n2004 жылғы сайлау нәтижесі бойынша коммунаның бургомистрі болып Петер Еневайн саналады."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B5%D1%80%D0%BD%D0%B0%D0%BD%D0%B4%D0%BE_I_%D0%BE%D0%B4_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Pante%C3%B3nSanIsidoroLe%C3%B3n.jpg","page_title":"Фернандо I од Леона","context_page_description":"Фернандо I од Леона, звани Велики био је гроф од Кастиље од 1029. и краљ Леона од 1037. све до смрти. Примио је помазање 22. јула 1038. Био је син Санча Гарсеса III од Памплоне, званог Старији, краља Памплоне, и Мунијадоне, сестре Гарсије Санчеза од Кастиље. Проглашен је за грофа од Кастиље 1029. године, иако је тек након очеве смрти, године 1035, у потпуности преузео власт.\\nПостао је краљ Леона венчањем са Санчом, сестром краља Бермуда III, против кога је подигао буну. Борећи се против Фернанда у бици код Тамарона, Бермудо III је погинуо, не оставивши наследнике.\\nПрвих шеснаест година владавине, Фернандо је провео решавајући унутрашње конфликте и реорганизујући своје краљевство. Гранични спорови са његовим братом Гарсијом III од Памплоне су 1054. прерасли у отворени рат. Леонске трупе су усмртиле владара Наваре у бици код Атапуерке.\\nЕнергично је спровео реконкисту, освојивши португалске градове Ламега, Висеа и Коимбру. Такође је потчинио више муслиманских краљевстава са подручја ел Андалуса, и натерао их да плаћају порез леонском краљевству.\\nПо традицији се сматрало да је Фернандо први краљ Кастиље и оснивач кастиљанске монархије, и многи историчари и даље подржавају ту тезу."},{"page_url":"https://ru.wikipedia.org/wiki/World_Bodypainting_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Demonic_body_painting_at_World_Bodypainting_Festival_2012.jpg","page_title":"World Bodypainting Festival","context_page_description":"World Bodypainting Festival — это международный боди-арт фестиваль, который проводится с 1998 года в Австрии. Фестиваль включает в себя не только соревнования художников, но и различные мастер-классы, лекции, выставки, концерты. До 2017 года фестиваль проводился в городе Пёрчах-ам-Вёртерзе. C 2017 года проводится в Клагенфурте. В фестивале принимают участие артисты из более чем 40 стран и его посещают более 30 000 зрителей."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%94_%D7%A1%D7%95%D7%98%D7%95_%D7%A7%D7%A1%D7%98%D7%95%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/49_DeSoto_%288772932825%29.jpg","page_title":"דה סוטו קסטום","context_page_description":"דה סוטו קסטום היא מכונית סלון שיוצרה על ידי חטיבת \\"דה סוטו\\" בבעלות יצרנית הרכב האמריקאית קרייזלר אשר יוצרה בין השנים 1952–1939 בארצות הברית"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%96%D2%AF%D0%B7%D1%96%D0%BC_%D1%88%D0%B0%D1%80%D1%83%D0%B0%D1%88%D1%8B%D0%BB%D1%8B%D2%93%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/%D0%90%D0%BB%D0%BC%D0%B0_%D0%BA%D3%A9%D1%88%D0%B5%D1%82%D1%96.JPG","page_title":"Жүзім шаруашылығы","context_page_description":"Жүзім шаруашылығы – ауыл шаруашылығының жүзім өсірумен айналысатын саласы.\\nЖүзім шаруашылығы халықты жас және кептірілген жүзіммен, шарап және консерві өнеркәсібін шикізатпен қамтамасыз етеді. Осыған байланысты Жүзім шарушылығының 4 өндірістік бағыты бар: асханалық Жүзім шаруашылығы - жергілікті тұтынуға, басқа жерлерге тасымалдауға және сақтауға арналған жүзім жемісін өсірумен айналысады; кептірілген жүзім өндірісін шикізатпен қамтамасыз ететін - Жүзім шаруашылығы мейізді, киш-мишті сұрыптарды өсіреді; шарап, шампан, коньяк өндіретін заттарды шикізатпен қамтамасыз ететін Жүзім шаруашылығы жүзімнің шараптық сұрыптарын өсіреді; Жүзім шаруашылығының төртінші бағыты шырын, сусын, тосап, маринад, т.б. алкогольсіз өнімдер өндіретін консерві өнеркәсібін шикізатпен қамтамасыз етеді. Қазақстанда жеміс-жүзім кеңшарлары 20 ғ-дың 20 – 30-жылдары құрыла бастады. Жүзімдіктер, негізінен, Оңтүстік Қазақстан, Алматы, Жамбыл облыстарында суармалы жерлерде орналасқан. 1941 жылы Қазақстандағы жүзімдіктер аумағы 1850 га болса, 1980 жылы 21 мың га-ға жетті. Жүзім сабақтарын қысқа қарай үсіктен сақтау үшін жылы жерлерде жабады, аязды жақтарда топыраққа көмеді;"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%84%D8%AA_(%D8%A7%DB%8C%D8%B3%D9%BE%D8%A7%D9%86%DB%8C%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Olot_urban_view_from_Montsacopa_volcano.jpg","page_title":"الت (ایسپانیا)","context_page_description":"الت (ایسپانیا) ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و خیرونا اوستانینده یئرلشیب. بۇ شهرین مساحتی ۲۹ کیلومتر موربّع دیر. ۴۴۳ متر دنیز سویه‌سیندن اۇجالیقی وار. سوْن نۆفوس تخمین‌لرینه گؤره ۳۳۹۴۴ نفر دیر."},{"page_url":"https://en.wikipedia.org/wiki/Smallnose_fanskate","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Sympterygia_bonapartii.jpg","page_title":"Smallnose fanskate","context_page_description":"The smallnose fanskate is a species of fish in the family Arhynchobatidae. It is found off the coasts of Argentina, Brazil, Chile, and Uruguay. Its natural habitats are open seas, shallow seas, and estuarine waters."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%8E%E4%BB%A3%E8%80%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Li_Dai_Geng.jpg","page_title":"李代耕","context_page_description":"李代耕，河南省林縣人。中華人民共和國政治人物、電力工程師。"},{"page_url":"https://gl.wikipedia.org/wiki/The_Jackson_5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Jackson_5_tv_special_1972.JPG","page_title":"The Jackson 5","context_page_description":"The Jackson 5, tamén escrito The Jackson Five, e nos últimos anos coñecido simplemente The Jacksons, foi un grupo de música estadounidense orixinario de Gary, Indiana formado baixo a tutela de Joseph Jackson, representante e fundador real do grupo, por cinco dos seus fillos: Jackie, Tito, Jermaine, Marlon e Michael\\nSucedeu a outro grupo formado en 1964 polos tres irmáns maiores chamado The Jackson Brothers e estivo activo ata 1990, desenvolvendo un repertorio de R&B, soul, pop e posteriormente disco. Con contrato con Motown Records desde 1968, foi un dos grandes fenómenos da música pop dos 70 e serviu como panca para lanzar as carreiras en solitario de Jermaine e Michael."},{"page_url":"https://vi.wikipedia.org/wiki/Daemonorops_draco","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Daemonorops_draco_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-023.jpg","page_title":"Daemonorops draco","context_page_description":"Daemonorops draco là loài thực vật có hoa thuộc họ Arecaceae. Loài này được Blume mô tả khoa học đầu tiên năm 1838."},{"page_url":"https://zh.wikipedia.org/zh-cn/S2_(%E6%81%86%E6%98%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Eso1622b.jpg","page_title":"S2 (恆星)","context_page_description":"S2，或称为S0—2 是一颗极为接近银河系中心无线电波源人马座A*的恒星，环绕的轨道周期是16.0518年，半长轴970天文单位，近拱点为17光时。S2的轨道周期只比木星绕太阳轨道长30%，但距离拱点不低于太阳和海王星距离的四倍。天文学家以欧洲南方天文台的观测资料推测S2最初形成时的质量约为14 M☉。基于S2光谱观测资料，该恒星的质量约为10至15倍太阳质量。\\n自1995年起，加利福尼亚大学洛杉矶分校和马克斯·普朗克地外物理学研究所长期对S2这颗位置明显变化的恒星进行观测，并且这些观测是收集银河系中心超大质量黑洞存在证据的一部分行动。已知的证据都显示人马座A*是超大质量黑洞。2008年天文学家已观测到S2环绕银河系中心的完整轨道。\\n主要由马克斯·普朗克地外物理学研究所的天文学家组成的团队观测S2环绕人马座A*的轨道动力学以量测地球到银河系中心的距离，结果是7940±420 秒差距，与先前使用其他方式测定的结果吻合。\\nS2于2018年5月接近人马座A*时被精准追踪，观测结果与广义相对论预测一致。"},{"page_url":"https://fi.wikipedia.org/wiki/The_Shins","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/The_Shins_live_20040708.jpg","page_title":"The Shins","context_page_description":"The Shins on vuonna 1997 perustettu yhdysvaltalainen indie rock -yhtye, joka yhdistelee rock-musiikkiinsa aineksia alternative countrysta folkiin. Eric Johnson on äskettäin liittynyt yhtyeeseen ja on myös Fruit Bats -yhtyeen jäsen. The Shins on perustettu Albuquerquessa New Mexicossa, mutta sen jäsenet vuonna 2002 muuttaneet Portlandiin Oregoniin.\\nThe Shinsin tunnetuimpia kappaleita ovat New Slang ja Caring is Creepy, jotka esitettiin muun muassa elokuvassa Garden State. Yhtye julkaisi ensimmäisen albuminsa Oh Inverted World vuonna 2001. Toinen albumi, Chutes Too Narrow, julkaistiin vuonna 2003 sekä kolmas ja viimeisin, Wincing the Night Away, vuonna 2007.\\nUusin albumi nousi Yhdysvaltojen ja Kanadan albumilistan toiselle sijalle. Myös yhdysvaltalaisen Billboard-listan toisen sijan yhtye saavutti 118 000 myydyllä albumillaan, mikä on historiallinen saavutus niin yhtyeelle kuin sen Sub Pop -levy-yhtiöllekin."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beelden_in_Hoorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Eenhoorn_gevel_Oud_Mannen_en_Vrouwenhuis%2C_Hoorn.jpg","page_title":"Lijst van beelden in Hoorn","context_page_description":"Dit is een chronologische lijst van beelden in Hoorn.\\nOnder een beeld wordt hier verstaan elk driedimensionaal kunstwerk in de openbare ruimte van de Nederlandse gemeente Hoorn, waarbij beeld wordt gebruikt als verzamelbegrip voor sculpturen, standbeelden, installaties, gedenktekens en overige beeldhouwwerken.\\nAan de Westerdijk bevindt zich een kunstroute met een aantal sculpturen die daar voor een periode van drie jaar staan. Een aantal sculpturen in die route staan er wel permanent.\\nZie voor een overzicht van gevelstenen de Lijst van gevelstenen in Hoorn. Voor een volledig overzicht van de beschikbare afbeeldingen zie de categorie Beelden in Hoorn op Wikimedia Commons."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%DB%8C%D9%88%D9%BE%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Nieuwpoort_-_Hendrik-Geeraertplein.jpg","page_title":"نیوپر","context_page_description":"شهر نیوپر در شهرستان ورن در استان فلاندری غربی در منطقه فلاندری در کشور بلژیک واقع شده‌است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%B2%D0%BE%D0%BD%D1%88%D0%B8%D1%80,_%D0%90%D0%BB%D0%B0%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Devonshire%2C_Alan.jpg","page_title":"Девоншир, Алан","context_page_description":"Алан Девоншир — английский футболист, играющий на позиции полузащитника, тренер футбольного клуба «Мейденхед Юнайтед»."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B2%A0%EB%8F%84%EB%AA%A8%ED%98%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Train_scale_4-4-0.JPG","page_title":"철도모형","context_page_description":"철도모형은 열차, 궤도, 승강장 등 철도 시설을 일정한 비율로 작게 축소한 스케일 모델이다. 기본적으로에 철도 차량을 작게만들어 레일에다 얹어 제어기기로 운전을 즐기는 놀이이지만, 열차 차량의 수집으로부터 철도모형 레이아웃의 제작까지 노는 방법은 많이 있다."},{"page_url":"https://de.wikipedia.org/wiki/Sechstagerennen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Charles_Miller_Cyclist.jpg","page_title":"Sechstagerennen","context_page_description":"Ein Sechstagerennen ist eine Veranstaltung im Bahnradsport, die aus Radrennen und unterhaltendem Rahmenprogramm besteht. Dabei finden über den Zeitraum von sechs Tagen verschiedene Wettbewerbe zwischen Mannschaften aus zwei männlichen Fahrern statt, unter anderem als Hauptwettbewerb das Zweier-Mannschaftsfahren.\\nIm Jahr 1875 fand das erste Sechstagerennen im britischen Birmingham statt, vier Jahre später erstmals eines in den USA. Diese Rennen wurden von einzelnen Fahrern an sechs Tagen rund um die Uhr bestritten, bis 1899 in New York das Rennen mit zwei Fahrern, die sich abwechseln, eingeführt wurde. 1909 fand in Berlin das erste Sechstagerennen in Kontinentaleuropa statt. Den Höhepunkt ihrer Popularität hatten Sechstagerennen in der Zeit zwischen den beiden Weltkriegen. Ab 1934 wurden in Deutschland keine Sechstagerennen mehr ausgetragen, weil die Nationalsozialisten die Regeln aus ideologischen Gründen derart veränderten, dass sowohl Fahrer als auch Publikum das Interesse verloren und schließlich kein Rennen mehr veranstaltet wurde. Ab 1949 fanden wieder Sechstagerennen in Deutschland statt, 1954 gab es die erste Schweizer Veranstaltung in Zürich."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8A%9C%E6%B9%96%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/No.11_Middle_School_in_Wuhu_2012-05.JPG","page_title":"芜湖市","context_page_description":"芜湖市是中华人民共和国安徽省下辖的地级市，位于安徽省东南部，城区位于长江南岸，青弋江与长江汇合处。芜湖是国家长三角城市群规划中的Ⅱ型大城市，皖江城市带承接产业转移示范区的核心城市，G60科创走廊、合芜蚌国家自主创新示范区、皖南国际文化旅游示范区、南京都市圈的重要成员，经济总量居安徽省第二位。2019年长江三角洲城市群会议在此举办。人口构成主要为汉族，市区通用芜湖话，部分地区使用吴语等。芜湖自古享有“江东名邑”、“吴楚名区”之美誉，近代为“江南四大米市”之首，是国家历史文化名城，被孙中山称为“长江巨埠，皖之中坚”。"},{"page_url":"https://ast.wikipedia.org/wiki/Julio_Argentino_Pascual_Roca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Julio_A._Roca_hijo.JPG","page_title":"Julio Argentino Pascual Roca","context_page_description":"Julio Argentino Pascual Roca, popularmente llamáu Julio Argentino Roca o Julito, por ser el fíu del xeneral Julio Argentino Roca, foi un abogáu y políticu arxentín, miembru del Partíu Demócrata de Córdoba, cuatro veces diputáu nacional por Córdoba, senador nacional por Córdoba, Gobernador de Córdoba, Vicepresidente de la República Arxentina, embaxador estraordinariu a Gran Bretaña para retribuir la visita del Príncipe de Gales en 1933, embaxador en Brasil y Ministru de Rellaciones Esteriores."},{"page_url":"https://en.wikipedia.org/wiki/Louise_Anne_de_Bourbon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/101RueDeGrenelle.jpg","page_title":"Louise Anne de Bourbon","context_page_description":"Louise Anne de Bourbon, Mademoiselle de Charolais was a French noblewoman, the daughter of Louis III de Bourbon, Prince of Condé. Her father was the grandson of le Grand Condé, while her mother, Louise Françoise de Bourbon, was the eldest surviving legitimised daughter of Louis XIV of France and his maîtresse-en-titre, Madame de Montespan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D1%80%D0%BF%D0%B5%D0%B4%D0%BE_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1,_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/%D0%A2%D1%80%D1%83%D0%B4_%D0%A2%D0%BE%D1%80%D0%BF%D0%B5%D0%B4%D0%BE_60.png","page_title":"Торпедо (футбольный клуб, Москва)","context_page_description":"«Торпе́до» — советский и российский профессиональный футбольный клуб из Москвы. Основан 17 августа 1924 года на базе футбольной команды РДПК. 3-кратный чемпион СССР, 6-кратный обладатель Кубка СССР, обладатель первого в новейшей истории Кубка России. Сейчас выступает в Футбольной национальной лиге."},{"page_url":"https://en.wikipedia.org/wiki/Hazal_Kaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Hazal_Kaya_%C4%B0stanbul_Ayd%C4%B1n_%C3%9Cniversitesi_%C4%B0leti%C5%9Fim_%C3%96d%C3%BClleri%E2%80%99nde_%282%29.jpg","page_title":"Hazal Kaya","context_page_description":"Leyla Hazal Kaya is a Turkish actress who is known for her acting role as Feriha Sarrafoglu in Adını Feriha Koydum, Bizim Hikaye, and other well-known Turkish shows. She has won many awards and accolades."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B4%D1%96%D0%B9%D0%BD%D0%B8%D0%B9_%D1%84%D0%BE%D0%BD%D0%B4_%D0%9A%D0%BE%D1%81%D1%82%D1%8F%D0%BD%D1%82%D0%B8%D0%BD%D0%B0_%D0%84%D1%84%D0%B8%D0%BC%D0%B5%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Franciszek_Ksawery_Branicki.jpg","page_title":"Благодійний фонд Костянтина Єфименка","context_page_description":"Благодійний фонд Костянтина Єфименка — українська благодійна організація, заснована підприємцем Костянтином Єфименком 2011 року у місті Біла Церква."},{"page_url":"https://pl.wikipedia.org/wiki/S%C3%A3o_Miguel_do_Igua%C3%A7u","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/BrasaoSaoMigueldoIguacu.jpg","page_title":"São Miguel do Iguaçu","context_page_description":"São Miguel do Iguaçu – miasto i gmina w Brazylii, w stanie Parana. Znajduje się w mezoregionie Oeste Paranaense i mikroregionie Foz do Iguaçu."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%9F%E3%83%AA%E3%83%BC%E3%83%BB%E3%82%AB%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/EmilyCarr.png","page_title":"エミリー・カー","context_page_description":"エミリー・カーはカナダの芸術家、作家。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E4%B8%BB%E6%95%99%E5%B8%83%E9%AD%AF%E6%97%A5%E6%95%99%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/BisdomBrugge.png","page_title":"天主教布魯日教區","context_page_description":"天主教布魯日教區是羅馬天主教在比利時的一個教教區，屬梅赫倫-布魯塞爾總教區。\\n教區位於西佛蘭德省。2011年，有960,000名教友，估轄區總人口81.8%，有362個堂區、786名司鐸、88名終身執事、323名修士、1,919名修女。現任教區主教為若瑟·德克塞爾。\\n教區成立於1559年5月12日，1801年根據《1801年教務專約》被撤銷，併入根特教區。1834年5月27日恢復至今。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E6%B3%A2%E7%BD%9715%E5%8F%B7%E5%9C%A8%E6%9C%88%E8%A1%A8%E7%9A%84%E6%B4%BB%E5%8A%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Apollo_15_actual_traverses_and_sample_stations.jpg","page_title":"阿波罗15号在月表的活动","context_page_description":"阿波罗15号月球表面活动是指1971年7月30日至8月2日期间，阿波罗15号指令长大卫·斯科特和登月舱驾驶员詹姆斯·艾尔文首次使用月球车，从位于哈德利月溪附近的亚平宁山脉基地着陆点出发，对周边地区进行的三次巡游探索。\\n他们在18.5小时中，从\\"猎鹰号\\"登月舱周边区采集了77千克的月表岩石。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A3%AE%E6%9D%91%E5%95%86%E4%BA%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Morimura_bros.jpg","page_title":"森村商事","context_page_description":"森村商事株式会社は、東京都港区虎ノ門に本社を置く、原材料の輸出入を中心とした総合貿易商社。"},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E8%88%87%E7%A7%98%E9%AD%AF%E9%97%9C%E4%BF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Voting_res_2758.png","page_title":"中華民國與秘魯關係","context_page_description":"中華民國與秘魯關係是指中華民國與秘魯共和國之間的關係。1913－1971年，兩國有官方外交關係，斷交後，於對方首都互設具大使館性質的代表機構。"},{"page_url":"https://es.wikipedia.org/wiki/Herbert_C._Swim","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Floribunda_-_Pinkie_2_%28cr%29.JPG","page_title":"Herbert C. Swim","context_page_description":"Herbert C. Swim fue horticultor rosalista estadounidense que creó nuevas razas de rosas con pétalos que no se desvanecen o se queman en el sol ardiente, y que, cuando la flor se marchita, caerán sus pétalos limpiamente. El follaje, también es duradero en el calor.​"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_circuitos_da_IndyCar_Series","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Edmonton_City_Airport_map_with_the_racing_road_course_map_overlaid.png","page_title":"Lista de circuitos da IndyCar Series","context_page_description":"A IndyCar Series, atualmente conhecida como NTT IndyCar Series por razões de patrocínio, é a principal categoria de automobilismo de monopostos sancionada da IndyCar. A temporada da IndyCar Seriesconsiste em uma série de corridas, geralmente realizadas em circuitos específicos e, em alguns casos, em pistas montadas em ruas fechadas de cidades.\\nEsta lista os circuitos que receberam corridas da IndyCar Series desde a cisão com a CART em 1996 até agora."},{"page_url":"https://id.wikipedia.org/wiki/Agama_di_Britania_Raya","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/SwaminarayanTemple-Neasden-London.JPG","page_title":"Agama di Britania Raya","context_page_description":"Britania Raya memiliki banyak keragaman ras dan Agama. Lebih dari setengah penduduk di Britania Raya memeluk agama Kristen. Mayoritas orang Kristen di Britania Raya adalah beraliran Protestanisme seperti Anglikan, Presbiterian, dan Metodis sebagian kecil lainnya beragama Katolik dan Kristen Ortodoks. Gereja Inggris adalah gereja dan agama resmi kerajaan. Gereja Inggris merupakan gereja induk dari seluruh komuni Anglikan di seluruh dunia. Meskipun gereja Anglikan mempunyai seorang Uskup Agung Cantebury sebagai pemimpin spritual tertinggi seluruh gereja Anglikan, tetapi gubernur tertinggi gereja Inggris adalah pemimpin monarki, yaitu untuk saat ini adalah Ratu Elizabeth II. Tidak seperti negara Eropa kebanyakan, Britania Raya memasukkan pertanyaan mengenai agama di sensus penduduk yang diselenggarakan setiap sepuluh tahun sekali. Selain sensus negara sepuluh tahunan tersebut, terdapat pula beberapa lembaga resmi yang melakukan survei di Britania Raya. Lembaga survei tersebut antara lain adalah Labour Force Survey, British Social Attitudes Survey dan European Social Survey."},{"page_url":"https://pl.wikipedia.org/wiki/Microsoft_Tag","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/High_Capacity_Color_Barcode.png","page_title":"Microsoft Tag","context_page_description":"Microsoft Tag to opracowany przez Microsoft Research nowy system kodów kreskowych, oficjalnie zaprezentowany na targach CES 2009. Kod należy do grupy kolorowych kodów dwuwymiarowych. Zgodnie z założeniami zawartość kodów ma być zorientowana przede wszystkim na klienta, tzn. mają one np. zawierać linki do stron internetowych producentów, dodatkowych materiałów, dane kontaktowe itp. Ich zadaniem jest rozszerzanie informacji na temat produktu przy czym dany kod się znajduje poprzez odwołanie do Internetu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BA%D0%B0%D1%86%D1%96%D1%8F_%D0%91%D0%B5%D0%B9%D0%BB%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Acacia_baileyana_seeds.jpg","page_title":"Акація Бейлі","context_page_description":"Ака́ція Бе́йлі — багаторічна рослина родини бобових, названа на честь австралійського ботаніка Фредеріка Менсона Бейлі. Декоративна і медоносна культура."},{"page_url":"https://hu.wikipedia.org/wiki/Eunice_aphroditois","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Eunice_aphroditois.jpg","page_title":"Eunice aphroditois","context_page_description":"Az Eunice aphroditois a soksertéjűek osztályának Eunicida rendjébe, ezen belül a palolo-férgek családjába tartozó faj.\\nNemének a típusfaja."},{"page_url":"https://en.wikipedia.org/wiki/Yacoub_Makzoume","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Yacoub_Makozume_Singapore_Daviscup.jpg","page_title":"Yacoub Makzoume","context_page_description":"Yacoub Makzoume is a Syrian tennis player. He is a member of the Syria Davis Cup team.\\nMakzoume has represented Syria at the Davis Cup, where he has a win-loss record of 11–9."},{"page_url":"https://en.wikipedia.org/wiki/French_Naval_Aviation","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/French_TBM-3E_of_Flotille_4F_in_flight_1950s.jpg","page_title":"French Naval Aviation","context_page_description":"French Naval Aviation is the naval air arm of the French Navy. The long-form official designation is Force maritime de l'aéronautique navale. Born as a fusion of carrier squadrons and the naval patrol air force, the Aéronavale was created in 1912. The force is under the command of a flag officer officially named Admiral of Naval Aviation with his headquarters at Toulon naval base. It has a strength of around 6,800 military and civilian personnel. It operates from four airbases in Metropolitan France and several detachments in foreign countries or French overseas territories. Carrier-borne pilots of the French navy do their initial training at Salon-de-Provence Air Base after which they undergo their carrier qualification with the US Navy."},{"page_url":"https://io.wikipedia.org/wiki/Abel_Pacheco","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Defense.gov_News_Photo_050511-D-9880W-053_Abel_Pacheco_cropped.jpg","page_title":"Abel Pacheco de la Espriella","context_page_description":"Abel Pacheco de la Espriella mediko, esis prezidanto di Kosta Rika de 8 di mayo 2002 til 8 di mayo 2006."},{"page_url":"https://en.wikipedia.org/wiki/Ruud_Lubbers","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ruud_Lubbers_1985.jpg","page_title":"Ruud Lubbers","context_page_description":"Rudolphus Franciscus Marie \\"Ruud\\" Lubbers was a Dutch politician and diplomat of the Catholic People's Party that merged to become the Christian Democratic Appeal party and businessman who served as Prime Minister of the Netherlands from 4 November 1982 to 22 August 1994 and as United Nations High Commissioner for Refugees from 1 January 2001 until 20 February 2005.\\nLubbers studied Economics at the Rotterdam School of Economics obtaining a Master of Economics degree and worked as a corporate director for the manufacturing company Hollandia in Rotterdam from April 1963 until May 1973 and as trade association executive for the Christian Employers'association from January 1965 until May 1973. After the election of 1972 Lubbers was appointed as Minister of Economic Affairs in the Cabinet Den Uyl taking office on 11 May 1973. Lubbers was elected as a Member of the House of Representatives after the election of 1977 serving from on 8 June 1977 until 8 September 1977."},{"page_url":"https://de.wikipedia.org/wiki/Marlow","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Marlow-Stadtkirche-16-08-2008-113.jpg","page_title":"Marlow","context_page_description":"Marlow ist eine amtsfreie Stadt im Westen des Landkreises Vorpommern-Rügen in Mecklenburg-Vorpommern. Die Stadt bildet für ihre Umgebung ein Grundzentrum."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9F%BA%E5%B1%B1%E5%81%9C%E8%BB%8A%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Kiyama_Bus_Stop_Kudari_01.jpg","page_title":"基山停車區","context_page_description":"基山停車區是位於佐賀縣三養基郡基山町與福岡縣筑紫野市的九州自動車道之休息區。"},{"page_url":"https://en.wikipedia.org/wiki/SM_UB-84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/UB_148_at_sea_2.jpeg","page_title":"SM UB-84","context_page_description":"SM UB-84 was a German Type UB III submarine or U-boat in the German Imperial Navy during World War I. She was commissioned into the German Imperial Navy on 31 October 1917 as SM UB-84. UB-84 was lost in a collision on 7 December 1917 in the Baltic Sea at 54°35′N 10°11′E.\\nShe was later raised and used as a training boat. On 26 November 1918 she was surrendered to the French in accordance with the requirements of the Armistice with Germany and broken up in Brest in 1921."},{"page_url":"https://war.wikipedia.org/wiki/Macabebe","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Ph_locator_pampanga_macabebe.png","page_title":"Macabebe","context_page_description":"An Macabebe usa nga ikatulo nga klase nga bungto ha lalawigan han Pampanga, Pilipinas. Sumala han census han tuig 2000, mayda ini populasyon nga 65,346 ka tawo ha 12,141 nga mga panimalay."},{"page_url":"https://de.wikipedia.org/wiki/Bonnanaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Bonnanaro%2C_panorama_%2801%29.JPG","page_title":"Bonnanaro","context_page_description":"Bonnanaro ist eine italienische Gemeinde in der Provinz Sassari auf Sardinien mit 977 Einwohnern. Die Gemeinde liegt etwa 30 Kilometer südöstlich von Sassari. Die Nachbargemeinden sind Bessude, Borutta, Mores, Siligo und Torralba."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%81%E6%B3%A2%E5%B8%82%E5%A2%83%E5%86%85%E7%9A%84%E6%B5%99%E6%B1%9F%E7%9C%81%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Tomb_of_Zhu_Bi_180217_123426.jpg","page_title":"宁波市境内的浙江省文物保护单位列表","context_page_description":"本列表是中华人民共和国浙江省文物保护单位的子列表，列举在宁波市境内的浙江省文物保护单位。不包括部分已成为全国重点文物保护单位的文物。"},{"page_url":"https://an.wikipedia.org/wiki/Richard_Garriott","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Richard_garriott_july_2008.jpg","page_title":"Richard Garriott","context_page_description":"Richard Allen Garriott, naixito de Cambridge lo 4 de chulio de 1961, ye ye un disenyador de videochuegos famoso por a suya serie Ultima.\\nO 12 d'octubre de 2008, Richard Garriott desapegó a bordo d'un Soyuz TMA-13 ent'a Estación Espacial Internacional como un turista espacial apoquinando 35 millons de dólars​ y tornando dimpués de 12 días."},{"page_url":"https://be.wikipedia.org/wiki/%D0%AD%D0%B4%D0%BC%D0%BE%D0%BD_%D0%90%D0%BC%D0%B0%D0%BD-%D0%96%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Edmond_Aman-Jean_autoportrait.jpg","page_title":"Эдмон Аман-Жан","context_page_description":"Эдмон Франсуа Аман-Жан — французскі мастак эпохі Fin de siècle."},{"page_url":"https://sv.wikipedia.org/wiki/Carl_M%C3%B6ller","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Gustaf_Adolfskyrkan_2010.JPG","page_title":"Carl Möller","context_page_description":"Carl Oskar Möller, född 20 april 1857 i Malmö, död den 4 december 1933 i Harpsund, var en svensk arkitekt och ämbetsman, sedan 1896 gift med Dagmar Bosse. Möller ritade bland annat ett flertal kyrkor i slutet av 1800-talet och i början av 1900-talet, såsom Sankt Johannes kyrka på Norrmalm i centrala Stockholm."},{"page_url":"https://en.wikipedia.org/wiki/Chuck_(engineering)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Old4jaw.jpg","page_title":"Chuck (engineering)","context_page_description":"A chuck is a specialized type of clamp used to hold an object with radial symmetry, especially a cylinder. In drills and mills it holds the rotating tool whereas in lathes it holds the rotating workpiece. On a lathe the chuck is mounted on the spindle which rotates within the headstock. For some purposes an additional chuck may be mounted on the non-rotating tailstock.\\nMany chucks have jaws, that are arranged in a radially symmetrical pattern like the points of a star. The jaws are tightened up to hold the tool or workpiece. Often the jaws will be tightened or loosened with the help of a chuck key, which is a wrench-like tool made for the purpose. Many jawed chucks, however, are of the keyless variety, and their tightening and loosening is by hand force alone. Keyless designs offer the convenience of quicker and easier chucking and unchucking, but have a lower gripping force to hold the tool or workpiece, which is potentially more of a problem with cylindrical than hexagonal shanks. Collet chucks, rather than having jaws, have collets, which are flexible collars or sleeves that fit closely around the tool or workpiece and grip it when squeezed."},{"page_url":"https://fr.wikipedia.org/wiki/Quai_de_l%27Universit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Spb_06-2012_University_Embankment_02.jpg","page_title":"Quai de l'Université","context_page_description":"Le quai de l'Université est un quai long de 1 200 mètres situé sur la rive droite de la rue Bolshaya Neva, sur l'Île Vassilievski à Saint-Pétersbourg, en Russie. Débutant à la pointe de l'Île Vassilievski, il s'étend entre le Pont du Palais et le Pont de l'Annonciation."},{"page_url":"https://fr.wikipedia.org/wiki/Tarn_(d%C3%A9partement)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Cath%C3%A9drale_St_Benoit.JPG","page_title":"Tarn (département)","context_page_description":"Le Tarn est un département français de la région Occitanie, traversé par la rivière Tarn qui lui a donné son nom. L'Insee et la Poste lui attribuent le code 81. Les habitants sont nommés les Tarnais et Tarnaises. La préfecture est Albi, et l'unique sous-préfecture est Castres. Le département fait partie de l'académie de Toulouse sur le plan scolaire et dépend de la cour d'appel de Toulouse sur le plan judiciaire.\\nLe département actuel résulte d'une longue histoire qui a précédé sa création en 1790. Commencée il y a 500 000 ans avec les plus anciennes traces humaines, elle se poursuit avec la tribu gauloise des Rutènes. Leur territoire est tour à tour intégré dans l'Empire romain, le Royaume wisigoth de Toulouse et le Royaume franc. Devenue vassale du comté de Toulouse, le territoire du Tarn, nommé Albigeois en référence à Albi sa capitale, est ravagé par les combats de la croisade des Albigeois. Il est intégré au domaine royal en 1270 et appartiendra désormais à la province du Languedoc. Il souffre de nombreux combats et massacres pendant les guerres de Religion. À la Révolution, il prend le nom du Tarn, la principale rivière qui le traverse."},{"page_url":"https://de.wikipedia.org/wiki/T%C3%BCrkische_K%C3%BCche","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Lahmacun.jpg","page_title":"Türkische Küche","context_page_description":"Die türkische Küche hat eine lange Geschichte und stellt eine Weiterentwicklung der ursprünglichen nomadischen Kochtradition der Turkvölker durch Vermischung mit der indischen, persischen, kurdischen Küche, islamisch-arabischen Küche sowie den Kochtraditionen der Völker des Mittelmeerraumes und des Kaukasus, wie zum Beispiel der armenischen und/oder aramäischen Küche dar. Die Übergänge zur orientalischen Küche oder zur Balkanküche sind fließend.\\nDiese Vielfalt der Einflüsse entwickelte sich durch die Jahrhunderte besonders unter der Prägung der osmanischen Kultur und Lebensweise zur heutigen charakteristischen türkischen Küche. Der kosmopolitische Aspekt der osmanischen Hofküche wird heute wieder betont zelebriert."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%8D%D1%81%D1%82%D0%BC%D1%96%D0%BD%D1%81%D1%82%D1%8D%D1%80%D1%81%D0%BA%D1%96_%D0%BC%D0%BE%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Westminster_Bridge_%26_Palace_of_Westminster.jpg","page_title":"Вэстмінстэрскі мост","context_page_description":"Вэстмінстэрскі мост — аркавы мост праз Тэмзу ў Лондане, які злучае Вэстмінстэр і Ламбет.\\nСучасны мост пабудаваны ў 1862 годзе па праекце Томаса Пейджа, замяніўшы стары мост, пабудаваны ў 1740-х і адкрыты ў 1750 годзе. Мост мае шэсць апор і сем арак, найбольшая колькасць з сучасных мастоў Лондана. Афарбаваны мост у зялёны колер, сімвалізуючы колер сядзенняў у Палаце обшчын."},{"page_url":"https://de.wikipedia.org/wiki/Windsor-Stuhl","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Swedish_Windsor_Chairs.jpg","page_title":"Windsor-Stuhl","context_page_description":"Der Windsor-Stuhl ist ein vor allem in Großbritannien und Nordamerika verbreiteter Stuhltyp. Er wurde im frühen 18. Jahrhundert in England entwickelt und wird bis heute produziert. Es handelt sich um einen sehr leichten Stuhl, der aus einer der menschlichen Körperform leicht angepassten Sitzfläche sowie gedrehten Stuhlbeinen und einer aus einzelnen, gleichfalls gedrehten Stäben gefertigten Rückenlehne besteht. Viele Windsor-Stühle haben außerdem Armlehnen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_gefl%C3%BCgelter_Worte/W","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Zaun_Legoland.JPG","page_title":"Liste geflügelter Worte/W","context_page_description":"Die Wacht am Rhein ist der Titel eines 1840/41 entstandenen patriotischen Gedichts von Max Schneckenburger, der den Text im November 1840 in Bern unter dem Eindruck der Gefahr eines neuen Krieges mit Frankreich dichtete.\\nDer Titel des Gedichts ist auch ein Teil des Kehrreims:\\n„Es braust ein Ruf wie Donnerhall,\\nWie Schwertgeklirr und Wogenprall:\\nZum Rhein, zum Rhein, zum deutschen Rhein,\\nWer will des Stromes Hüter sein?\\nLieb’ Vaterland, magst ruhig sein,\\nFest steht und treu die Wacht am Rhein!“\\nDas Gedicht erlangte in der 1854 entstandenen Vertonung von Carl Wilhelm volkstümliche Beliebtheit und erhielt durch seinen mobilisierenden Charakter besondere Aktualität im Deutsch-Französischen Krieg der Jahre 1870/71.\\nZu finden ist der Text des Liedes auch auf einer großen Schrifttafel auf der Schauseite des Sockels der Germania-Monumentalstatue, des Niederwalddenkmals oberhalb von Rüdesheim am Rhein. Der Blick der Germania geht in Richtung Frankreich.\\nIm Film Casablanca singen die deutschen Offiziere um Major Strasser dieses Lied in Rick’s Café Americain, werden dabei aber mehr und mehr durch die anderen Gäste übertönt, die als Antwort die Marseillaise anstimmen."},{"page_url":"https://sk.wikipedia.org/wiki/Heavymetalov%C3%A1_m%C3%B3da","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Hindvir_Gaulhammer_Fest_111008_01_C.jpg","page_title":"Heavymetalová móda","context_page_description":"Heavymetalová móda je štýl obliekania, telesných modifikácií, mejkapu a účesov, atď., používané fanúšikmi heavymetalovej hudby, lepšie známymi ako „metalisti“ alebo „metláci“. Napriek tomu, že tento štýl od 70. rokov až doteraz podliehal zmenám, niektoré kľúčové prvky ostávajú stále rovnaké - ako napríklad dlhé vlasy a kožené bundy. V 80. rokoch niektoré kapely začali nosievať elastan. Medzi ďalšie veci nosené metalistami patria džínsové či kožené vesty s nášivkami obľúbených kapiel, tričká s názvami skupín, vybíjané opasky či náramky s hrotmi."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Sa%C3%B4ne-et-Loire_(A-L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Four_Briques_Hautefond_5.jpg","page_title":"Liste des monuments historiques de Saône-et-Loire (A-L)","context_page_description":"Cet article recense une partie des monuments historiques de Saône-et-Loire, en France.\\nPour des raisons de taille, la liste est découpée en deux. Cette partie regroupe les communes débutant de M à Z. Pour les autres, voir la liste des monuments historiques de Saône-et-Loire."},{"page_url":"https://sv.wikipedia.org/wiki/Rafaela_Ottiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Rafaela_Ottiano_in_She_Done_Him_Wrong.jpg","page_title":"Rafaela Ottiano","context_page_description":"Rafaela Ottiano, född 4 mars 1888 i Venedig, Italien, död 18 augusti 1942 i Boston, Massachusetts, USA, var en italiensk-amerikansk skådespelare. Ottiano medverkade i runt 45 amerikanska filmer under åren 1924-1942."},{"page_url":"https://it.wikipedia.org/wiki/John_Ingleby","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Chirk_Church%2C_aquaduct_%26_castle%2C_Denbighshire%2C_1795.jpg","page_title":"John Ingleby","context_page_description":"John Ingleby è stato un pittore e miniaturista britannico, di origini gallesi."},{"page_url":"https://ro.wikipedia.org/wiki/Russula_vesca_(burete)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/2012-05-12_Russula_persicina_Krombh_218418.jpg","page_title":"Russula vesca (burete)","context_page_description":"Russula vesca din încrengătura Basidiomycota în familia Russulaceae și de genul Russula, denumită în popor holoptincă, bureți dobrești, bureți plăiești, pâinea pământului sau simplu vinețică, este o specie de ciuperci comestibile care coabitează, fiind un simbiont micoriza. Ea se poate găsi în România, Basarabia și Bucovina de Nord oriunde pe sol, izolată sau în grupuri mai mici, în păduri de foioase și de conifere, deseori și pe marginile lor. Buretele, care se dezvoltă din mai până în octombrie, crește în câmpie și la deal, dar mai rar în munți."},{"page_url":"https://uz.wikipedia.org/wiki/Makka","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Makkah-1910.jpg","page_title":"Makka","context_page_description":"Makka — Saudiya Arabistonining gʻarbiy qismidagi shahar, Qizil dengizdan 70 km uzoqdikda joylashgan. Hijoz viloyatining maʼmuriy markazi. Aholisi 1 mln. kishiga yaqin; haj vaqtida 2 mln.dan oshadi.\\nM. qad. shahar, asos solingan yili nomaʼlum. Dastlab Zamzam bulogʻi atrofida aholi turar joylari paydo boʻlgan. M. ilk bor Ptolemey asarlarida Makoraba deb qayd etilgan. Miloddan avvalgi 2—1ming yilliklarda M. arab qabilalari uchun muqaddas joy hisoblangan. Islom paydo boʻlishidan avval Sharq bilan Oʻrta dengiz boʻyi davlatlari oʻrtasidagi savdoda muhim oʻrin tutgan. Milodiy 5-asr oʻrtalarida M. quraysh qabilasi qoʻliga oʻtdi. Shu davrda quraysh qabilasining boshligʻi Zayd bin Kilob Kaʼba atrofidagi yerlarni oʻz qabiladoshlariga boʻlib berdi. Qusay va uning avlodlari oʻtkazgan islohotlar natijasida M. tez suratlar bilan oʻsdi, bozorlar koʻpayib, ziyoratchilar uchun yangi quduklar qazildi. 6-asr oxiri — 7-asr boshida shahar Arabiston ya.o.ning faqat savdo va diniy emas, balki siyosiy markaziga ham aylandi. Shunday vaziyatda M.da yakkaxudolik ga asoslangan islom dinining targʻiboti boshlandi. M.da Muhammad tugʻilgan, 7-asrdan musulmonlarning muqaddas shahri va ziyoratgohi."},{"page_url":"https://pt.wikipedia.org/wiki/Jean-Michel_Bony","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Jean-Michel_Bony.jpg","page_title":"Jean-Michel Bony","context_page_description":"Jean-Michel Bony é um matemático francês.\\nFoi palestrante convidado do Congresso Internacional de Matemáticos em Nice e em Varsóvia."},{"page_url":"https://en.wikipedia.org/wiki/Tsuga_canadensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Tsuga_canadensis_drawing.png","page_title":"Tsuga canadensis","context_page_description":"Tsuga canadensis, also known as eastern hemlock, eastern hemlock-spruce, or Canadian hemlock, and in the French-speaking regions of Canada as pruche du Canada, is a coniferous tree native to eastern North America. It is the state tree of Pennsylvania."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%82%B9%E3%83%BB%E3%83%A6%E3%83%8B%E3%83%90%E3%83%BC%E3%82%B91956","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Miss_Universe_1956_Map.PNG","page_title":"ミス・ユニバース1956","context_page_description":"ミス・ユニバース1956は1956年7月20日にアメリカ合衆国カリフォルニア州ロングビーチ市立公会堂で開催された。30か国の参加者が舞台に上り、19歳のキャロル・モリスがアメリカ代表「ミスUSA」として2人目の優勝者となった。彼女は大会の慣例通り、前年の優勝者であるスウェーデンのヒレヴィ・ロンビンから栄冠を授けられた。日本からは馬場祥江が参加した。"},{"page_url":"https://sv.wikipedia.org/wiki/Neocoenorrhinus_aequatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Neocoenorrhinus_aequatus.jpg","page_title":"Neocoenorrhinus aequatus","context_page_description":"Neocoenorrhinus aequatus är en skalbaggsart som först beskrevs av Carl von Linné 1767. Neocoenorrhinus aequatus ingår i släktet Coenorrhinus, och familjen rullvivlar. Arten är reproducerande i Sverige."},{"page_url":"https://it.wikipedia.org/wiki/Omar_Koroma","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/OJKoroma%40FGRFC.jpg","page_title":"Omar Koroma","context_page_description":"Omar Alieu Koroma è un calciatore gambiano, attaccante del Thróttur Reykjavík."},{"page_url":"https://la.wikipedia.org/wiki/Miamia-Dade_Comitatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Miami_Riverwalk.jpg","page_title":"Miamia-Dade Comitatus","context_page_description":"Miamia-Dade Comitatus est Floridae comitatus in Civitatibus Foederatis Americae 2,253,362 incolarum primus Floridae et octavus Civitatum Foedratarum Americae quod ad incolas pertinet. Comitatus, cuius caput est urbs Miamia, die 18 Ianuarii 1836 creatus est. In hoc comitatu maxima pars incolarum haud Anglice domu loquitur."},{"page_url":"https://pl.wikipedia.org/wiki/Cerralbo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Panor%C3%A1mica_de_Cerralbo.JPG","page_title":"Cerralbo","context_page_description":"Cerralbo – gmina w Hiszpanii, w prowincji Salamanka, w Kastylii i León, o powierzchni 51,59 km². W 2011 roku gmina liczyła 195 mieszkańców."},{"page_url":"https://pl.wikipedia.org/wiki/%C3%89tinehem","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Etinehem_%2810%29.JPG","page_title":"Étinehem","context_page_description":"Étinehem – miejscowość i dawna gmina we Francji, w regionie Hauts-de-France, w departamencie Somma. W 2013 roku populacja gminy wynosiła 383 mieszkańców.\\nW dniu 1 stycznia 2017 roku z połączenia dwóch ówczesnych gmin – Étinehem oraz Méricourt-sur-Somme – utworzono nową gminę Étinehem-Méricourt. Siedzibą gminy została miejscowość Étinehem."},{"page_url":"https://fr.wikipedia.org/wiki/Leroy_01","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Besancon_-_Musee_du_temps_-_Montre_a_complication.JPG","page_title":"Leroy 01","context_page_description":"La Leroy 01 ou Lucie est une des montres-horloges astronomiques d’exception les plus prestigieuses du monde, montre gousset chef-d'œuvre unique d'horlogerie et d'orfèvrerie de luxe, modèle mythique et emblème du savoir-faire horloger de L.Leroy de Paris « montre la plus compliquée du monde pendant près d’un siècle » considérée comme référence mondiale en matière « d'horlogerie française ultra-compliquée », grand prix spécial du jury de l'Exposition universelle de 1900 à Paris."},{"page_url":"https://nl.wikipedia.org/wiki/Blumenau_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Blumenau_SC_Collage.jpg","page_title":"Blumenau (gemeente)","context_page_description":"Blumenau is een stad en gemeente in de Braziliaanse deelstaat Santa Catarina.\\nBij de volkstelling van 2017 telde Blumenau 348.513 inwoners."},{"page_url":"https://nl.wikipedia.org/wiki/Ramla","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/RefugeesEscortedFromRamlaOperationDanny.jpg","page_title":"Ramla","context_page_description":"Ramla is een stad in Centraal-Israël, ongeveer negentien kilometer ten oosten van Tel Aviv gelegen.\\nIn 716 gesticht werd de stad in de 11e eeuw een belangrijke handelsstad; tijdens de tijd van de Kruistochten bisschopszetel. Weer later een tussenstation voor pelgrims naar Mekka. De stad heeft vooral Joodse wijken.\\nIn het zuidwesten van de stad ligt de Palestijnse wijk Juwarish. Hier hebben de straten Arabische namen. Er wonen zowel christelijke als islamitische Palestijnen. In 2016 had de stad bijna 75.000 inwoners.\\nBegin 1948 woonden er 15.000 Palestijnen. In de Arabisch-Israëlische oorlog van 1948 werden verreweg de meeste inwoners door de Hagana op bevel van David Ben Goerion etnisch gezuiverd.\\nIn 2002 woonden er 12.000 Palestijnse vluchtelingen uit de omgeving en hun nakomelingen evenals Bedoeïenen en hun nakomelingen die uit de Negev verjaagd waren. Onder de Joodse immigranten van na 1948 zijn 12.000 uit Emiraat Boechara en 7000 Falasja's uit Ethiopië."},{"page_url":"https://it.wikipedia.org/wiki/Mottalciata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Mottalciata_municipio.jpg","page_title":"Mottalciata","context_page_description":"Mottalciata è un comune italiano di 1 328 abitanti della provincia di Biella in Piemonte."},{"page_url":"https://pt.wikipedia.org/wiki/Armida_(Haydn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Rinaldo_e_Armida_by_Francesco_Hayez.jpg","page_title":"Armida (Haydn)","context_page_description":"Armida é uma ópera em três atos escrita por Joseph Haydn, com libreto de Nunziato Porta, baseada em um episódio da epopeia Gerusalemme Liberata, de Torquato Tasso. Estreou aos 16 de fevereiro de 1784, em Esterháza."},{"page_url":"https://en.wikipedia.org/wiki/Shiraitodai_Station","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Shiraitodai-station.JPG","page_title":"Shiraitodai Station","context_page_description":"Shiraitodai Station is a train station in Fuchū, Tokyo, Japan, operated by the private railway operator Seibu Railway."},{"page_url":"https://br.wikipedia.org/wiki/Carl_Gotthard_Langhans","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Carl_Gotthard_Langhans_alt.jpg","page_title":"Carl Gotthard Langhans","context_page_description":"Carl Gotthard Langhans a oa ur savour ha tisavour prusian. E oberennoù a vez renket el luskad nevezklasel. Brandenburger Tor Berlin eo e oberenn vrudetañ."},{"page_url":"https://es.wikipedia.org/wiki/La_Terrasse-sur-Dorlay","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Blason_ville_fr_La_Terrasse-sur-Dorlay_%28Loire%29.svg","page_title":"La Terrasse-sur-Dorlay","context_page_description":"La Terrasse-sur-Dorlay es una población y comuna francesa, situada en la región de Ródano-Alpes, departamento de Loira, en el distrito de Saint-Étienne y cantón de La Grand-Croix."},{"page_url":"https://es.wikipedia.org/wiki/Ra%C3%BAl_Celis_Montt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Intendente_Ra%C3%BAl_Celis_Montt.png","page_title":"Raúl Celis Montt","context_page_description":"Raúl Eduardo Celis Montt ​, es un abogado, académico y político chileno. Desde marzo de 2010 a marzo de 2014 se desempeñó como intendente de la Región de Valparaíso en el gobierno de Sebastián Piñera."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%96%D1%80%D0%BA%D0%BE%D0%BA%D0%B0%D1%88%D1%82%D0%B0%D0%BD_%D1%8F%D0%BF%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Aesculus_turbinata_in_Mount_Sanpokuzure.JPG","page_title":"Гіркокаштан японський","context_page_description":"Гіркокашта́н япо́нський — отруйна багаторічна рослина родини сапіндових. Ендемік Японських островів. Декоративна, технічна та харчова культура."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%96%D7%99%D7%9C%D7%99%D7%A7%D7%AA_%D7%A1%D7%9F_%D7%9E%D7%A8%D7%A7%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Interior_of_St._Mark%27s_Basilica_in_Venice_1.jpg","page_title":"בזיליקת סן מרקו","context_page_description":"בזיליקת סן מרקו היא קתדרלה בת המאה ה-9 הנמצאת בוונציה שבאיטליה. הבזיליקה היא אחת הדוגמאות החשובות ביותר של אדריכלות ביזנטית. הכנסייה צופה על כיכר סן מרקו, מרכז השלטון והמסחר העתיק של ונציה, ומחוברת בצדה הדרומי לארמון הדוג'ה של ונציה. הכנסייה אף משמשת כמקום מושבו של הפטריארך והארכיבישוף של ונציה מאז 1807, ועל פי המסורת הנוצרית קבור בה מרקוס הקדוש.\\nהבזיליקה, המכונה גם \\"כנסיית הזהב\\", ידועה בסגנון הביזנטי המרהיב שלה, בפסיפסים המוזהבים הרבים שבה ובאוצרות קונסטנטינופול הבזוזה המעטרים אותה, והיא מסמלת את עושרה של הרפובליקה של ונציה."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Ursin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/IfUrsin2.JPG","page_title":"Saint-Ursin","context_page_description":"Saint-Ursin est une ancienne commune française du département de la Manche et la région Normandie, associée à Saint-Jean-des-Champs depuis le 1ᵉʳ janvier 1973."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_oktober_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/CharlesNapierApr08.jpg","page_title":"Lijst van personen overleden in oktober 2011","context_page_description":"Dit is een lijst van personen die zijn overleden in oktober 2011."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A1%83%E5%9C%92%E5%B8%82%E7%AB%8B%E5%9C%96%E6%9B%B8%E9%A4%A8%E9%BE%8D%E5%B2%A1%E5%88%86%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Taoyuan_City_Library_Lunggang_Branch.jpg","page_title":"桃園市立圖書館龍岡分館","context_page_description":"桃园市立图书馆龙冈分馆位于桃园市中坜区台贸一街，启用于2015年12月10日。建筑为地下两层、地上四层，包括阅览室、多功能教室、藏书书库、儿童阅览区、儿童故事屋等，阅览室设有265个位置。建筑1楼右侧则为台贸社区活动中心。基地面积1,807平方米、建筑面积1,028平方米、总楼地板面积为6,414平方米。2016年共有40万人次进馆使用，占桃园市立图书馆第3名，仅次中坜分馆、芦竹分馆。"},{"page_url":"https://fr.wikipedia.org/wiki/Ziggurat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Ziggurats.png","page_title":"Ziggurat","context_page_description":"Une ziggurat est un édifice religieux mésopotamien à degrés, présent aussi en Élam, constitué de plusieurs terrasses supportant probablement un temple construit à son sommet. Le terme vient de l'akkadien ziqqurratu, dérivé du verbe zaqāru, « élever », « construire en hauteur ». On peut donc le traduire par « la très haute ». Il s'agit du monument le plus spectaculaire de la civilisation mésopotamienne, dont le souvenir a survécu bien après sa disparition grâce au récit biblique de la Tour de Babel, inspiré par la ziggurat de Babylone.\\nDepuis la mise au jour des grandes capitales mésopotamiennes, plusieurs de ces bâtiments ont pu être analysés, même s'il n'en reste plus d'intacts, beaucoup étant très délabrés et se présentant sous l'aspect de collines, tandis que d'autres ont complètement disparu. La civilisation mésopotamienne en a également laissé peu de descriptions, que ce soient des textes ou des images. Certaines ziggurats sont mentionnées par des auteurs grecs. Si leur aspect général est maintenant assez bien connu, il existe toujours des points d'ombre quant à leur signification et à leur fonction en l'absence de texte explicite à ce sujet."},{"page_url":"https://ga.wikipedia.org/wiki/Donald_Duck","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Tuska_2019_special_comic.jpg","page_title":"Donald Duck","context_page_description":"Carachtar ficseanúil is ea Donald Duck, a cruthaíodh sa bhliain 1934. Caitheann sé éadaí seoltóra agus cuachóige dearg nó dubh."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_Bucure%C8%99ti,_sector_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Bucuresti%2C_Romania%2C_Bd._Carol_I%2C_Imobil_nr._27%2C_sect._2%2C_%28B-II-m-B-18315%29.JPG","page_title":"Lista monumentelor istorice din București, sector 2","context_page_description":"Lista monumentelor istorice din sectorul 2 cuprinde monumentele istorice din sectorul 2 al municipiului București înscrise în Patrimoniul cultural național al României. Lista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, ultima versiune datând din 2015.\\nPuteți căuta monumente istorice din orice sector folosind formularul de mai jos:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%A0%D0%B0%D1%81%D1%82%D1%80%D0%B5%D0%BB%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Spb_June_2012_Views_from_Smolny_Bell_towers_05.jpg","page_title":"Площадь Растрелли","context_page_description":"Площадь Растре́лли — площадь в Санкт-Петербурге. Расположена на пересечении Шпалерной улицы, Таврического переулка, улицы Смольного, переулка Кваренги и Лафонской улицы."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_estatales_de_Nuevo_Le%C3%B3n_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Felipe_de_jesus_cantu_perfil.png","page_title":"Elecciones estatales de Nuevo León de 2015","context_page_description":"Las Elecciones estatales de Nuevo León de 2015 se llevaron a cabo el domingo 7 de junio de 2015, y en ellas se renovaron los titulares de los siguientes cargos de elección popular del estado mexicano de Nuevo León:\\nGobernador de Nuevo León: Titular del Poder Ejecutivo del estado, electo para un periodo de seis años no reelegibles en ningún caso. El candidato electo fue Jaime Rodríguez Calderón.\\n42 Diputados Estatales: Se eligieron 42 diputados estatales, 26 por medio de votación directa y los otros 16 elegidos bajo un sistema de representación proporcional.\\n51 Ayuntamientos. Formados por un Presidente Municipal y regidores que conforman el cabildo municipal, electos para un periodo de tres años, no reelegibles de manera consecutiva."},{"page_url":"https://fi.wikipedia.org/wiki/Robert_Hamerling","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Robert_hamerling.jpg","page_title":"Robert Hamerling","context_page_description":"Robert Hamerling oli saksalainen runoilija. Hän oli etevä varsinkin eepoksen alalla, mistä hienoja esimerkkejä ovat hänen eepoksensa Ahasver in Rom ja Der König von Sion. Hän on kirjoittanut myös näytelmiä, mutta niitä ei ole pidetty yhtä onnistuneina. Hänen murhenäytelmänsä Danton und Robespierre on pikemmin dialoginmuotoinen eepos. Hän oli kuitenkin myös etevä lyyrikko. Oiva Paloheimo on suomentanut Hamerlingin runon \\"Vain lapsoset tietää\\", joka on julkaistu Paloheimon kokoelmassa Runot."},{"page_url":"https://nl.wikipedia.org/wiki/Puntius_hemictenus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/FMIB_35656_Barbodes_hemictenus%2C_new_species_Type.jpeg","page_title":"Puntius hemictenus","context_page_description":"Puntius hemictenus is een straalvinnige vissensoort uit de familie van de eigenlijke karpers. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1908 door Jordan & Richardson."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_14_november","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Petrus_Bertius_by_Vinkeles_1787.jpg","page_title":"Lijst van personen geboren op 14 november","context_page_description":"Dit is een lijst van personen die geboren zijn op 14 november.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n1449 - Sidonia van Bohemen, prinses, aristocraat uit het Koninkrijk Bohemen bewerken\\n1501 - Anna van Oldenburg, gravin van Oost-Friesland, regent bewerken\\n1565 - Petrus Bertius, Nederlandse cartograaf, academisch docent en wiskundige bewerken\\n1567 - Maurits van Oranje, Prins van Oranje, politicus en officier uit de Republiek der Zeven Verenigde Nederlanden bewerken\\n1601 - Johannes Eudes, Franse rooms-katholiek priester bewerken\\n1641 - Albert Anton II van Schwarzburg-Rudolstadt, Duitse graaf bewerken\\n1650 - Willem III van Oranje, Nederlandse hertog van Normandië, Prins van Oranje, koning van Engeland en koning van Schotland bewerken\\n1668 - Johann Lukas von Hildebrandt, Oostenrijkse architect bewerken\\n1712 - Karel August van Baden-Durlach, Duitse markgraaf, regent, officier bewerken"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D1%82_%D0%A1%D1%82%D0%B0%D1%80_(%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Iceberg_in_North_Star_Bay%2C_Greenland.jpg","page_title":"Норт Стар (залив)","context_page_description":"„Залив Норт Стар“, а понекогаш именуван и како „Пристаниште Туле“ или „Залив Волстенхолме“, е залив во устието на фјордот Волстенхолме во Гренланд.\\nИмето на овој залив потекнува од името на британскиот брод „Норт Стар“ од 1824 година. На самиот раб на заливот се наоѓа Воздухопловната база Туле. Во самиот залив има два острова, Сондерс и Волстенхолме. Островот Сондерс и копното ги дели мореузот Бајлот."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Stadt_D%C3%BCsseldorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Wolfgang_Wilhelm_%28Pfalz-Neuburg%29.jpg","page_title":"Geschichte der Stadt Düsseldorf","context_page_description":"Dieser Artikel beschäftigt sich mit der Geschichte der Stadt Düsseldorf von der Urgeschichte bis in die Gegenwart auf dem heutigen Stadtgebiet. Die heutige Großstadt Düsseldorf hat sich aus mehreren Siedlungskernen entwickelt. Düsseldorf selbst wird erstmals 1159 schriftlich erwähnt. Als die damals bescheidene Siedlung Düsseldorf 1288 an der Mündung des Flüsschens Düssel zur Stadt erhoben wurde, bestanden in ihrem Umfeld bereits mehrere, damals bedeutendere Siedlungskerne. So beginnt die geschriebene Geschichte des Düsseldorfer Stadtgebiets mit einer Klostergründung in Kaiserswerth um das Jahr 700. Mit der Reichsstadt Kaiserswerth, dem Frauenstift in Gerresheim sowie der Freiheit Angermund gab es gleich vier unabhängige städtische Gründungen auf dem heutigen Stadtgebiet sowie mehrere Dörfer, Burgen und Schlösser, die im Laufe der Jahrhunderte zur heutigen Stadt verschmolzen sind. Die erst im 20. Jahrhundert eingemeindeten Städte Kaiserswerth und Gerresheim, die wesentlich älter als Düsseldorf selbst sind, haben jeweils über eintausend Jahre alte eigenständige Ortsgeschichten, die einer eigenen Darstellung bedürfen und hier nur in Kurzform angerissen werden."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D1%80%D0%B0%D0%BB_(%D1%80%D1%96%D1%87%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Bridge_%22Asia_-_Europe%22.jpg","page_title":"Урал (річка)","context_page_description":"Ура́л — річка в Європі, близько до межі Європи з Азією. Тече територією Росії та Казахстану. Довжина Уралу 2 428 км, це третя за довжиною річка Європи, а також 21-а за довжиною річка Євразії. Протягом тривалого часу Урал у середній течії вважався фізико-географічним кордоном між Європою та Азією, проте у результаті ландшафтно-історико-географічної експедиції 2010 р. Російського географічного товариства річку було позбавлено цього статусу через недоведеність висновків Татищева на місцевості у сучасних реаліях.\\nДавня назва Яїк. У цей час давня назва річки є офіційною в Казахстані, а також уживається в Башкортостані.\\nВздовж правого берега річки розташовувалися землі Уральського козацького війська, що зараз поділені між Росією та Казахстаном.\\nРічка була перейменована в 1775 за наказом Катерини II, після придушення Селянської війни під проводом Пугачова, у якій активну участь брали Яїцькі козаки.\\nБере початок у горах Південного Уралу. Впадає в Каспійське море."},{"page_url":"https://pl.wikipedia.org/wiki/Poch%C3%B3wek_antywampiryczny","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Anti-vampire_burial_in_the_Zamkowa_Street.png","page_title":"Pochówek antywampiryczny","context_page_description":"Pochówek antywampiryczny – zabiegi, których celem, zgodnie z dawnymi wierzeniami, rozpowszechnionymi zwłaszcza na obszarach słowiańskich, miało być zapobieżenie wyjścia z grobu osoby uznawanej za wampira lub upiora, strzygę."},{"page_url":"https://pl.wikipedia.org/wiki/14_Pu%C5%82k_Piechoty_Ziemi_Kujawskiej","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Trojan_kpt.jpg","page_title":"14 Pułk Piechoty Ziemi Kujawskiej","context_page_description":"14 Pułk Piechoty – oddział piechoty Wojska Polskiego II RP."},{"page_url":"https://nl.wikipedia.org/wiki/Mecosaspis_atripennis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Mecosaspis_atripennis_%28Hope%2C_1843%29_%2831788312395%29.png","page_title":"Mecosaspis atripennis","context_page_description":"Mecosaspis atripennis is een keversoort uit de familie van de boktorren. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd in 1843 door Hope."},{"page_url":"https://da.wikipedia.org/wiki/Slaget_ved_Grand_Gulf","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Approaches_to_Grand_Gulf.jpg","page_title":"Slaget ved Grand Gulf","context_page_description":"Slaget ved Grand Gulf blev udkæmpet den 29. april 1863 under den amerikanske borgerkrig. I Vicksburg kampagnen, som blev ledet af generalmajor Ulysses S. Grant, foretog en flådestyrke under kontreadmiral David Dixon Porter et angreb på konfødererede kanonbatterier ved Grand Gulf ved Mississippi floden nedenfor Vicksburg. Selv om de konfødererede modstod Unionens bombardement og forhindrede infanteri i at foretage landgang mod deres befæstelser, var deres sejr kun et mindre tilbageslag for Grants planer om at krydse Mississippifloden og rykke frem mod Vicksburg."},{"page_url":"https://da.wikipedia.org/wiki/Yuxi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Location_of_Yuxi_Prefecture_within_Yunnan_%28China%29.png","page_title":"Yuxi","context_page_description":"Yuxi er et bypræfektur i den kinesiske provinsen Yunnan."},{"page_url":"https://fr.wikipedia.org/wiki/Mur_de_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Berlinermauer.jpg","page_title":"Mur de Berlin","context_page_description":"Le mur de Berlin, « mur de la honte » pour les Allemands de l'Ouest et officiellement appelé par le gouvernement est-allemand « mur de protection antifasciste », est érigé en plein Berlin dans la nuit du 12 au 13 août 1961 par la République démocratique allemande, qui tente ainsi de mettre fin à l'exode croissant de ses habitants vers la République fédérale d'Allemagne.\\nLe mur, composante de la frontière intérieure allemande, sépare physiquement la ville en Berlin-Est et Berlin-Ouest pendant plus de vingt-huit ans, et constitue le symbole le plus marquant d'une Europe divisée par le rideau de fer. Plus qu'un simple mur, il s'agit d'un dispositif militaire complexe comportant deux murs de 3,6 mètres de haut, avec un chemin de ronde, 302 miradors et dispositifs d'alarme, 14 000 gardes, 600 chiens et des barbelés dressés vers le ciel. Un nombre indéterminé de personnes furent victimes des tentatives de franchissement du mur. En effet, des gardes-frontière est-allemands et des soldats soviétiques n'hésitèrent pas à tirer sur des fugitifs."},{"page_url":"https://fr.wikipedia.org/wiki/Globidens","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Globidens.jpg","page_title":"Globidens","context_page_description":"Globidens est un genre éteint de reptiles marins de la famille des Mosasauridae ayant vécu au Crétacé supérieur y il a entre 84,9 à 66 Ma."},{"page_url":"https://fr.wikipedia.org/wiki/Eura","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Euran_keskusta.JPG","page_title":"Eura","context_page_description":"Eura est une municipalité du sud-ouest de la Finlande, dans la province de Finlande occidentale et la région du Satakunta."},{"page_url":"https://en.wikipedia.org/wiki/Christopher_Newport","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Sylvester_Jordain_-_Discovery_of_the_Barmudas.jpg","page_title":"Christopher Newport","context_page_description":"Christopher Newport was an English seaman and privateer. He is best known as the captain of the Susan Constant, the largest of three ships which carried settlers for the Virginia Company in 1607 on the way to found the settlement at Jamestown in the Virginia Colony, which became the first permanent English settlement in North America. He was also in overall command of the other two ships on that initial voyage, in order of their size, the Godspeed and the Discovery.\\nHe made several voyages of supply between England and Jamestown; in 1609, he became Captain of the Virginia Company's new supply ship, Sea Venture, which met a hurricane during the Third Supply mission, and was shipwrecked on the archipelago of Bermuda.\\nChristopher Newport University in Newport News, Virginia, was named in his honor."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B1%D9%86%D8%B3%D8%AA_%D8%AA%D8%B1%D9%88%D8%A7%DA%A9%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Ernest_Truex_1.jpg","page_title":"ارنست ترواکس","context_page_description":"ارنست ترواکس هنرپیشه تئاتر، سینما و تلویزیون اهل کشور ایالات متحده آمریکا بود."},{"page_url":"https://en.wikipedia.org/wiki/Anti_Terrorism_Raju_Memorial_Sculpture","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Anti-Terrorism_Raju_Memorial_Sculpture_3.A.M.R.jpg","page_title":"Anti Terrorism Raju Memorial Sculpture","context_page_description":"Anti Terrorism Raju Memorial Sculpture is a sculpture located in University of Dhaka campus of Bangladesh. It was created by Shaymol Chowdhury and considered as one of the best sculptures in Bangladesh. It is dedicated to the memory of a student of Dhaka University named Moin Hossain Raju an activist of Bangladesh Students' Union who was killed while protesting against Terrorism. It was built in the late 1997s."},{"page_url":"https://de.wikipedia.org/wiki/Einkommensteuer_(Deutschland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Einkommensteuererkl%C3%A4rung_0176.jpg","page_title":"Einkommensteuer (Deutschland)","context_page_description":"Die Einkommensteuer in Deutschland ist eine Gemeinschaftssteuer, die auf das Einkommen natürlicher Personen erhoben wird.\\nRechtsgrundlage für die Berechnung und Erhebung der Einkommensteuer ist – neben weiteren Gesetzen – das Einkommensteuergesetz. Der Einkommensteuertarif regelt die Berechnungsvorschriften. Bemessungsgrundlage ist das zu versteuernde Einkommen.\\nIm Jahr 2017 nahm der deutsche Staat über 255 Milliarden Euro Einkommensteuer ein. Das entspricht knapp einem Drittel der gesamten Steuereinnahmen Deutschlands.\\nDer ebenfalls vorkommende Ausdruck Einkommenssteuer mit Fugen-s wird in der offiziellen Rechtssprache nicht verwendet."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_de_Magdebourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Cathedral_of_Magdeburg_Inside.jpg","page_title":"Cathédrale de Magdebourg","context_page_description":"La cathédrale de Magdebourg ou cathédrale Saint-Maurice-et-Sainte-Catherine est la première cathédrale gothique d'Allemagne, et aussi la plus vaste et la plus haute d'Allemagne centrale avec ses deux tours qui se dressent à 99,25 et 100,98 m. Magdebourg est la capitale du land de Saxe-Anhalt et sa cathédrale, qui est le siège épiscopal de l'Église évangélique depuis la Réforme, abrite le tombeau de l'empereur Othon Iᵉʳ."},{"page_url":"https://en.wikipedia.org/wiki/Yeoford_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Yeofordstation1.jpg","page_title":"Yeoford railway station","context_page_description":"Yeoford railway station is a rural station on the Tarka Line serving the village of Yeoford in Devon, England. It is served by trains between Barnstaple and Exeter."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%BCrgermeisterei_Burg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Solinger_Gemarkungen.svg","page_title":"Bürgermeisterei Burg","context_page_description":"Die Bürgermeisterei Burg war im 19. Jahrhundert eine Bürgermeisterei bis 1820 im Kreis Solingen anschließend bis 1929 im Kreis Lennep der preußischen Rheinprovinz. Sie ging aus dem mittelalterlichen bergischen Amt Solingen hervor, dass 1806 unter den Franzosen aufgelöst wurde und in eigenständige Kantone und Mairies unterteilt wurde. Unter Preußen wurde die Mairie Burg in die Bürgermeisterei Burg umgewandelt und erhielt als Burg an der Wupper das Stadtrecht. 1975 wurde das Stadtgebiet in die Stadt Solingen eingemeindet und bildet nun einen Teil des Stadtbezirks Burg/Höhscheid."},{"page_url":"https://it.wikipedia.org/wiki/G20_del_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Presidente_Macri_en_el_Sill%C3%B3n_de_Rivadavia_-_1.jpg","page_title":"G20 del 2016","context_page_description":"Il G20 del 2016 è stato l'undicesimo meeting del Gruppo dei Venti. Si è tenuto il 4 e 5 settembre 2016 nella città di Hangzhou, in Cina. È stato il primo vertice del G20 ospitato dalla Cina e il secondo ospitato da una nazione asiatica, dopo quello del 2010 in Corea del Sud. La riunione è stata guidata dal Presidente cinese Xi Jinping."},{"page_url":"https://en.wikipedia.org/wiki/OLAF_(Organization_to_solve_the_foreigner_question)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Alois_Stocher.jpg","page_title":"OLAF (Organization to solve the foreigner question)","context_page_description":"OLAF was a satirical art activism project launched in 2010 by Andreas Heusser, Christoph Nüssli and Christoph Oeschger to subvert the Swiss right-wing populist party's campaign on the deportation initiative. The project consisted of the creation of the \\"Organization to solve the foreigner question\\" and series of actions and pranks performed by the fictitious representatives, Dr. Alois B. Stocher and his assistant George Klein."},{"page_url":"https://fr.wikipedia.org/wiki/Andy_Shauf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Andy_Shauf.jpg","page_title":"Andy Shauf","context_page_description":"Andy Shauf est un chanteur multi-instrumentiste et auteur-compositeur canadien originaire de Regina, dans la province de Saskatchewan, né le 26 mai 1987. Il joue notamment de la guitare, du piano et de la clarinette. Andy Shauf est aussi membre du groupe Foxwarren."},{"page_url":"https://de.wikipedia.org/wiki/Nachbildung","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/A_copy_of_the_Thor%27s_hammer_from_Sk%C3%A5ne_-_Nachbildung_des_Thorshammers_von_Sk%C3%A5ne_02.jpg","page_title":"Nachbildung","context_page_description":"Eine Nachbildung ist ein nach einem Original bzw. Vorbild angefertigtes Werk. Ähnliche Bedeutung in verschiedenen Zusammenhängen haben Kopie, Replik, Replika und Replikat."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%B3%D8%B1_%D8%B1%D9%8A%D8%A7%D9%84%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Rialto_bridge_2011.jpg","page_title":"جسر ريالتو","context_page_description":"جسر ريالتو هو واحد من أربعة جسور تقطع القنال الكبير في البندقية، إيطاليا. ويعتبر أقدم جسر يقطع القناة، وكان الخط الفاصل بين منطقتي سان ماركو وسان بولو."},{"page_url":"https://it.wikipedia.org/wiki/ESCP_Business_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/ESCPinterieur.jpg","page_title":"ESCP Business School","context_page_description":"L'ESCP Business School o ESCP è una business school fondata a Parigi nel 1819. La scuola attraverso conseguenti fusioni con altre scuole come EAP e Novancia e partnernship locali si è sviluppata fino a sei campus europei: Berlino, Londra, Madrid, Parigi, Torino e Varsavia ed è riconosciuta della Camera di commercio e dell'industria di Parigi. Rientra nel 5% delle business school con triplo accreditamento AACSB, EQUIS e AMBA."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_de_M%C3%BCnster","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/NRW_rbmuenster.png","page_title":"Región de Münster","context_page_description":"Münster es uno de los cinco Regierungsbezirks de Renania del Norte-Westfalia, Alemania, localizado en el norte del estado, que recibe el nombre de su ciudad capital, Münster. Incluye el área que en tiempo medieval era conocida como el Dreingau.\\nRegierungsbezirk Münster cubre mayormente un territorio rural conocido como Münsterland, famoso por sus numerosos e importantes castillos. La región ofrece más de 100 castillos, enlazados todos ellos por el camino ciclista conocido como \\"Ruta de los 100 Castillos\\".\\nLas tres municipalidades más meridionales forman parte del Ruhrgebiet, densamente poblado y que todavía ofrece una variada industria. La historia del Regierungsbezirk retrocede hasta 1815, cuando fue uno de los 25 Regierungsbezirke originales creados como una subdivisión de las provincias de Prusia. La última reorganización de los distritos fue realizada en 1975, cuando el número de distritos fue reducido de 10 a 5, y el número de ciudades-libres de distrito de seis a tres."},{"page_url":"https://de.wikipedia.org/wiki/Hang_(Musikinstrument)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Panart-hang-erste-generation.jpg","page_title":"Hang (Musikinstrument)","context_page_description":"Das Hang ist ein Musikinstrument. Es besteht aus zwei miteinander verklebten Halbkugelsegmenten aus Pang, einem gasnitrierten Stahlblech. Auf der oberen Halbschale befinden sich Klangfelder, die – ähnlich wie bei der Steelpan – mit Hämmern ins Blech eingearbeitet sind.\\nDas Hang wird waagerecht oder senkrecht auf dem Schoß gehalten. Gespielt wird es mit den Fingern und Händen, was den Namen ergab: Hang ist Berndeutsch für Hand.\\nDas Instrument wurde im Jahr 2000 von Felix Rohner und Sabina Schärer in Bern erfunden. Ab 2001 wurde es in verschiedenen Entwicklungsstufen ausschließlich von der PANArt Hangbau AG gebaut. Ende 2013 wurde der Bau des Hang eingestellt. Seither widmet sich das Unternehmen der Entwicklung mehrerer neuer Instrumente aus Pangblech.\\nHang ist eine eingetragene Wortmarke der PANArt Hangbau AG.\\nDie hohe Nachfrage nach dem Hang, die das Angebot bei Weitem überstieg, führte zur Produktion ähnlicher Instrumente durch andere Hersteller, die heute zumeist mit dem Oberbegriff Handpan bezeichnet werden."},{"page_url":"https://en.wikipedia.org/wiki/Andr%C3%A9_Carrillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/CSKA_Sporting_%283%29_%28cropped%29.jpg","page_title":"André Carrillo","context_page_description":"André Martín Carrillo Díaz is a Peruvian professional footballer who plays for Saudi Arabian club Al-Hilal FC and the Peru national team as a winger or second striker.\\nCarrillo began his senior career in 2009 with Alianza Lima. Two years later, he moved to Sporting CP in Portugal and debuted for his country. In 2016, he joined crosstown rivals Benfica and went on winning the league, cup and super cup in his first season. He was then loaned out for two consecutive seasons, the first to English club Watford in the Premier League, and the second to Al-Hilal in the Saudi Professional League.\\nAt international level, he has obtained over 60 caps for Peru since making his debut in 2011, and has represented his nations at three editions of the Copa América and the 2018 FIFA World Cup."},{"page_url":"https://de.wikipedia.org/wiki/Balduin_I._(Lateinisches_Kaiserreich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Baudouin_de_Constantinople.JPG","page_title":"Balduin I. (Lateinisches Kaiserreich)","context_page_description":"Balduin der Konstantinopolitaner war seit 1194 ein Graf von Flandern und seit 1195 ein Graf von Hennegau. Ab 1202 war er einer der wichtigsten militärischen Führer des Vierten Kreuzzuges. Nach der Eroberung von Konstantinopel 1204 wurde er zum ersten Kaiser des Lateinischen Reiches gewählt."},{"page_url":"https://sv.wikipedia.org/wiki/Camille_Pissarro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Camille_Pissarro_040.jpg","page_title":"Camille Pissarro","context_page_description":"Camille Pissarro, född 10 juli 1830 i Charlotte Amalie i Saint Thomas i Danska Västindien, död 12 november 1903 i Paris, var en fransk målare inom impressionismen.\\nPissarro föddes på Saint Thomas dit hans far, en förmögen holländsk-judisk affärsman av spansk härkomst, hade flyttat. Redan som tolvåring kom han till Paris för att studera. När han återvände till Saint Thomas var meningen att han skulle arbeta i familjeföretaget. Men under inflytande av den danska konstnären Anton Melbye beslöt han att satsa på konsten. Han följde med Melbye till Venezuela och 1855 flyttade han till Paris."},{"page_url":"https://fr.wikipedia.org/wiki/Charles_Adolphe_Wurtz","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Charles-Adolphe_Wurtz.jpg","page_title":"Charles Adolphe Wurtz","context_page_description":"Charles Adolphe Wurtz, né à Strasbourg le 26 novembre 1817 et mort à Paris le 12 mai 1884, est un médecin et chimiste français d'origine alsacienne. Il fut professeur et doyen de la Faculté de médecine de Paris, professeur à la Sorbonne, et membre de l'Académie de Médecine."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D0%BD%D0%BE%D0%BD%D0%B5-%D0%B0%D0%BB%D1%8C-%D0%9B%D0%B0%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Spinone_vista_Monasterolo_110.jpg","page_title":"Спіноне-аль-Лаго","context_page_description":"Спіноне-аль-Лаго, Спіноне-аль-Лаґо — муніципалітет в Італії, у регіоні Ломбардія, провінція Бергамо.\\nСпіноне-аль-Лаго розташоване на відстані близько 480 км на північний захід від Рима, 65 км на північний схід від Мілана, 21 км на схід від Бергамо.\\nНаселення — 1018 осіб.\\nЩорічний фестиваль відбувається 4 листопада. Покровитель — San Carlo."},{"page_url":"https://ar.wikipedia.org/wiki/SEL1L","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/PBB_GE_SEL1L_202062_s_at_fs.png","page_title":"SEL1L","context_page_description":"SEL1L‏ هوَ بروتين يُشَفر بواسطة جين SEL1L في الإنسان."},{"page_url":"https://de.wikipedia.org/wiki/Liste_M%C3%BCnchner_Gr%C3%BCnfl%C3%A4chen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Hirschgarten_Muenchen-10.jpg","page_title":"Liste Münchner Grünflächen","context_page_description":"Diese Seite listet Grünanlagen, Parks und sonstige größere Grünflächen auf, die in dem Gebiet der bayerischen Landeshauptstadt München liegen oder im Besitz der Stadt sind. Waldgebiete und Friedhöfe sind in eigenen Listen erfasst. Es sollen in die Liste nur solche Grünanlagen aufgenommen werden, die – wenigstens zeitweise – öffentlich zugänglich sind."},{"page_url":"https://en.wikipedia.org/wiki/Joint_Expeditionary_Base_Fort_Story","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/A_16_inch_howitzer_at_Fort_Story%2C_VA_and_the_men_who_operate_it._-_NARA_-_196280.jpg","page_title":"Joint Expeditionary Base Fort Story","context_page_description":"Joint Expeditionary Base-Fort Story, commonly called simply Fort Story is a sub-installation of Joint Expeditionary Base Little Creek–Fort Story, which is operated by the United States Navy. Located in the independent city of Virginia Beach, Virginia at Cape Henry at the entrance of the Chesapeake Bay, it offers a unique combination of features including dunes, beaches, sand, surf, deep-water anchorage, variable tide conditions, maritime forest and open land. The base is the prime location and training environment for both Army amphibious operations and Joint Logistics-Over-the-Shore training events.\\nThe base includes 1,451 acres of sandy trails, cypress swamps, maritime forest, grassy dunes and soft and hard sand beaches. The western beaches are wide, gently sloped and washed by the waters of the Chesapeake Bay. Eastern beaches are exposed to the rougher waters of the Atlantic surf."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%87%E0%B8%A7%E0%B8%B1%E0%B8%A5%E0%B9%82%E0%B8%99%E0%B9%80%E0%B8%9A%E0%B8%A5%E0%B8%AA%E0%B8%B2%E0%B8%82%E0%B8%B2%E0%B9%80%E0%B8%84%E0%B8%A1%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Pauling.jpg","page_title":"รางวัลโนเบลสาขาเคมี","context_page_description":"รางวัลโนเบลสาขาเคมี เป็นรางวัลมอบโดยราชบัณฑิตยสถานด้านวิทยาศาสตร์แห่งสวีเดนเป็นประจำทุกปีแก่นักวิทยาศาสตร์ในสาขาต่าง ๆ ของเคมี รางวัลนี้เป็นหนึ่งในห้ารางวัลโนเบลซึ่งก่อตั้งจากความประสงค์ของอัลเฟรด โนเบลใน ค.ศ. 1895 เพื่อมอบให้แก่ผู้อุทิศตนอย่างโดดเด่นในสาขาเคมี ฟิสิกส์ วรรณกรรม สันติภาพ และสรีรวิทยาหรือการแพทย์ มูลนิธิโนเบลเป็นผู้รับผิดชอบรางวัลนี้ และผู้มอบรางวัลคือคณะกรรมการโนเบลอันประกอบด้วยสมาชิก 5 คนที่เลือกโดยราชบัณฑิตยสถานด้านวิทยาศาสตร์แห่งสวีเดน\\nรางวัลโนเบลสาขาเคมีครั้งแรกมอบในปี ค.ศ. 1901 แก่ยาโกบัส เฮนริกุส ฟานติฮุฟฟ์ จากประเทศเนเธอร์แลนด์ \\"สำหรับการค้นพบกฎของพลศาสตร์เคมีและแรงดันออสโมติกในสารละลาย\\" การมอบรางวัลจัดขึ้นในวันที่ 10 ตุลาคมของทุกปีที่สต็อกโฮล์มเพื่อระลึกถึงการเสียชีวิตของอัลเฟรด โนเบล"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E5%BD%A9%E9%95%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/NancaiWeizhiBj.jpg","page_title":"南彩镇","context_page_description":"南彩镇是中国北京市顺义区下辖的一个镇。"},{"page_url":"https://ast.wikipedia.org/wiki/Norelys_Rodr%C3%ADguez","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Norelys.jpg","page_title":"Norelys Rodríguez","context_page_description":"María Norelys Rodríguez Guillén ye una actriz, modelu, filántropa, diseñadora gráfica y animadora venezolana, conocida pol so trabayu como modelu, y siendo unu de los más conocíos el de les Moces Polar."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%96%87%E5%B8%9D%E8%A1%8C%E7%8E%BA%E9%87%91%E5%8D%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Wendi_xingxi_3.jpg","page_title":"文帝行玺金印","context_page_description":"「文帝行璽」金印是南越國文帝趙眜生前的皇帝璽印，為迄今最大的一枚西漢金印。該印於1983年在廣州解放北路發現的南越王墓內出土，現珍藏於西漢南越王博物館。\\n該印長3.1厘米、寬3厘米、高1.8厘米、重148.5克，含金量98％。呈方形，田字方格，陰刻「文帝行璽」4字，小篆體。龍形花紋，形態逼真，利用龍身拱起的橫穿以系組綬，也可作捉手。出土於墓主絲褸玉衣的胸部。它是中國考古發掘出土的首枚「皇帝」印璽，也是目前發現的最大西漢金印。"},{"page_url":"https://fr.wikipedia.org/wiki/Semperoper","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Dresden_Hoftheater_J_C_A_Richter.jpg","page_title":"Semperoper","context_page_description":"Le Semperoper de Dresde compte parmi les opéras les plus connus au monde.\\nLe nom de Semperoper désigne le bâtiment, alors que la compagnie est désignée par le nom de Sächsische Staatsoper Dresden, parfois abrégé simplement en Staatsoper Dresden.\\nSymbole de la ville de Dresde, il est utilisé en tant que symbole de la marque de bière locale Radeberger.\\nIl est aussi la maison de la Staatskapelle de Dresde."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%A8%ED%95%B4%ED%8A%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Municipal_Building_-_New_York_City.jpg","page_title":"맨해튼","context_page_description":"맨해튼은 미국 뉴욕주 뉴욕의 자치구 중 가장 인구 밀도가 높은 자치구로, 허드슨강에 있는 섬을 포함하여 본토의 몇 블록을 포함하는 지역을 가리킨다. 맨해튼은 뉴욕주의 뉴욕군과 동일한 영토를 가지고 있으며, 맨해튼섬을 비롯해 루스벨트섬, 랜들스아일랜드, 워즈섬, 거버너스섬, 리버티섬, 밀 록, 엘리스섬 등을 포함하고 있다. 브롱크스와 밀접해있는 지역인 마블힐 역시 맨해튼의 일부이다.\\n뉴욕군은 미국에서 가장 인구 밀도가 높은 군이며, 세계에서도 가장 인구 밀도가 높은 지역이다. 2010년 인구조사에 의하면, 인구는 1,585,874명이다. 또한, 미국의 군 중 가장 부유한 군으로, 2005년 기준으로 1인당 소득은 100,000달러를 넘었다. 맨해튼은 뉴욕의 자치구 중에서 3번째로 인구가 많으며, 면적으로는 제일 작다.\\n맨해튼은 미국에서 상업적, 재정적, 문화적으로 중요한 장소이다. 로어맨해튼에는 뉴욕 증권거래소와 NASDAQ이 있는 월 스트리트가 있다. 뉴스, 잡지, 책과 같은 여러 대중 매체의 출판업자들뿐만 아니라 미국에 있는 대부분의 주요한 라디오, 텔레비전, 통신 회사들이 이곳에 기반을 두고 있다.\\n맨해튼에는 유명한 랜드마크, 관광지, 박물관, 대학교가 많다. 또한 유엔 본부가 있는 곳이다. 맨해튼은 뉴욕과 뉴욕 대도시권의 중심지이며, 비즈니스, 엔터테인먼트 활동의 중심지이기도 하다. 그 결과, 뉴욕의 다른 자치구인 브루클린과 퀸스 지역 주민들은 맨해튼에 여행 가는 것을 종종 \\"도시로 간다.\\"라고 표현하기도 한다."},{"page_url":"https://ca.wikipedia.org/wiki/Arquitectura_de_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Palau_Lloc.JPG","page_title":"Arquitectura de Barcelona","context_page_description":"L'arquitectura de Barcelona ha tingut una evolució paral·lela a la de la resta de l'arquitectura catalana, i ha seguit de forma diversa les múltiples tendències que s'han anat produint en el context de la història de l'art occidental. Al llarg de la seva història, Barcelona ha acollit diverses cultures i civilitzacions, que han aportat el seu concepte de l'art i han deixat el seu llegat per a la posteritat, des dels primers pobladors ibers, passant pels colonitzadors romans, els visigots i un breu període islàmic, fins al sorgiment en l'edat mitjana de l'art, la llengua i la cultura catalana, amb una primera època d'esplendor per a l'art català, on el romànic i el gòtic van ser períodes molt fructífers per al desenvolupament artístic de la regió.\\nDurant l'edat moderna, època en què la ciutat comtal es va vincular a la Monarquia Hispànica, els principals estils van ser el Renaixement i el Barroc, desenvolupats a partir de les propostes provinents dels països difusors d'aquests estils, principalment Itàlia i França."},{"page_url":"https://cy.wikipedia.org/wiki/Nahwatleg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Nahuatl_in_Mexico.png","page_title":"Nahwatleg","context_page_description":"Iaith yn perthyn i deulu yr ieithoedd Uto-Aztecaidd yw Nahwatleg. Fe'i siaredir ym Mecsico yn bennaf, gyda rhai siaradwyr yn yr Unol Daleithiau a rhai o wledydd canolbarth America. Nahwatleg yw'r iaith frodorol gyda'r nifer fwyaf o siaradwyr ym Mecsico, gyda thua miliwn a hanner o siaradwyr. Mae'r rhan fwyaf o'r rhain yn ddwyieithog ynghyd â Sbaeneg. Ceir nifer o dafodieithoedd gwahanol.\\nNahwatleg oedd lingua franca Ymerodraeth yr Aztec o'r 13g hyd ei chwymp yn 1521. Parhaodd yr iaith i ledaenu hyd yn oed ar ôl y goncwest Sbaenaidd, oherwydd defnyddid hi gan genhadon ac eraill. Dechreuwyd defnyddio yr wyddor Ladin ar gyfer ysgrifennu'r iaith, a chyhoeddwyd y llyfr argarffedig cyntaf ynddi, Doctrina cristiana breve traducida en lengua mexicana, gan Alonso de Molina yn 1546.\\nDaw geiriau megis \\"tomato\\" a \\"siocled\\" o'r iaith Nahwatleg."},{"page_url":"https://de.wikipedia.org/wiki/Schlo%C3%9F_Hubertus_(1973)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Wasserschloss_Anif_03.jpg","page_title":"Schloß Hubertus (1973)","context_page_description":"Schloß Hubertus ist ein deutscher Heimatfilm von Harald Reinl aus dem Jahr 1973. Nach 1934 und 1954 war es die dritte Verfilmung des Romans Schloß Hubertus von Ludwig Ganghofer. Carl Lange ist in der Rolle des Familienoberhaupts Graf Egge Sennefeld besetzt, Robert Hoffmann spielt den gräflichen Jäger, Karlheinz Böhm ist als Tassilo Sennefeld, ältester Sohn des Grafen dabei, Klaus Löwitsch als Jäger Schipper, Evelyn Opela als Opernsängerin Anna Herwegh, Ute Kittelberger und Folker Bohnet als Grafenkinder Kitty und Robert, Gerhard Riedmann ist als Lenz Bruckner besetzt, Gerlinde Döberl als seine Tochter Mali und Sascha Hehn als jüngster Grafensohn Willy."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%86%D9%85%D9%BE%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Plumeria-0006-Zachi-Evenor.jpg","page_title":"چمپا","context_page_description":"چمپا کنیر ٹبر دی اک پھلوالی چاڑی اے۔ ایہدا اصل دیس میکسیکو وشکارلا امریکہ کولمبیا تے وینزویلا نین پر ہن ایہ ٹراپیکی دیساں دیاں پھلواریاں وچ عام اگاۓ جاندے نیں۔ ایھدا رکھ 7–8 میٹر اچائی تے گھیر وچ جاندے اے جیدے تے چٹے پیلے یا گلابی رنگاں دے خشبو والے پھل لکدے نیں۔"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D8%A7%D8%AF%D9%8A%D9%86_%D8%AF%D9%88%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Official_portrait_of_Ms_Nadine_Dorries_crop_2.jpg","page_title":"نادين دوريس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nنادين دوريس سياسيه من المملكه المتحده."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%A5%E0%A6%AE_%E0%A6%B0%E0%A6%BF%E0%A6%9A%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Church_of_Fontevraud_Abbey_Richard_I_effigy.jpg","page_title":"প্রথম রিচার্ড","context_page_description":"প্রথম রিচার্ড ৬ই জুলাই ১১৮৯ থেকে আমৃত্যু ইংল্যান্ডের রাজা ছিলেন। একই সময়ে তিনি ছিলেন নরমান্ডের ডিউক, অ্যাকুইটাইনের ডিউক, গাসকনির ডিউক, সাইপ্রাসের লর্ড, আনজুউয়ের কাউন্ট, মাইনের কাউন্ট, নান্তেসের কাউন্ট ও বিভিন্ন সময় ব্রিটানির ওভারলর্ড। তিনি ছিলেন ইংল্যান্ডের রাজা দ্বিতীয় হেনরির পঞ্চম পুত্র ও তার মাতা ছিলেন অ্যাকুইটাইনের এলিনর। তিনি ছিলেন সেনাবাহিনীর মহান নেতা ও যুদ্ধা; এজন্য তিনি সবার কাছে রিচার্ড লায়নহার্ট বা রিচার্ড কুয়ের দে লায়ন নামে পরিচিত ছিলেন। মুসলমানরা তাকে মালেক রিক বা মালেক আল-ইনকিতার নামে ডাকতেন।\\n১৬ বছর বয়সে তিনি তার সেনাবাহিনীর দায়িত্ব নেন ও পোইতুতে তার পিতা দ্বিতীয় হেনরির বিরুদ্ধে গড়ে উঠা বিদ্রোহ সাফল্যের সঙ্গে দমন করেন। ফ্রান্সের দ্বিতীয় ফিলিপের পর তৃতীয় ক্রুসেডের সময় তিনি ছিলেন প্রধান খ্রিস্টীয় কমান্ডার যিনি সালাউদ্দিনসহ তার অন্যান্য মুসলমান প্রতিদ্বন্দীর কাছ থেকে যুদ্ধ করে বিজয় ছিনিয়ে আনেন। যদিও তিনি সালাউদ্দিনের কাছ থেকে জেরুজালেম জয় করতে পারেন নি।\\nরিচার্ড ফরাসি উপভাষা ও ফ্রান্সের দক্ষিণাঞ্চলের রোমানিয়ান ভাষাসহ আশেপাশের অঞ্চলের কয়েকটি ভাষায় দক্ষ ছিলেন। তিনি ফ্রানের দক্ষিণ-পশ্চিমাঞ্চলের অ্যাকুইটাইনে বসবাস করতেন এবং ইংল্যান্ডে খুবই অল্পসময় কাটিয়েছেন।"},{"page_url":"https://vi.wikipedia.org/wiki/C%C3%A1_%C4%91u%E1%BB%91i_b%C6%B0%E1%BB%9Bm_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Gymnura_marmorata_huntington_beach.jpg","page_title":"Cá đuối bướm California","context_page_description":"Cá đuối bướm California là một loài cá đuối trong bọ Gymnuridae. Nó được tìm thấy tại Colombia, Costa Rica, Ecuador, El Salvador, Guatemala, Honduras, Mexico, Nicaragua, Panama, Peru, và Hoa Kỳ. Môi trường sống tự nhiên của chúng là biển nông, rạn san hô, cửa sông, đầm lầy thủy triều, và đầm phá ven biển."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A8%81%E5%BB%89%C2%B7%E5%8D%A1%E7%BA%B3%E9%87%8C%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Bundesarchiv_Bild_146-1979-013-43%2C_Wilhelm_Canaris.jpg","page_title":"威廉·卡纳里斯","context_page_description":"威廉·弗兰茨·卡纳里斯德国海军上将，曾担任纳粹德国时期军事情报机构阿勃维尔的负责人，反对希特勒的军官行动的主要参与者。第一次世界大战期间在海军服役。西班牙内战期间，负责德国对弗朗西斯科·佛朗哥的援助工作。他曾担任帕斯特里欧斯行动的首脑，还曾录用几名反希特勒密谋分子进入阿勃维尔，并掩护他们的活动，1944年2月他被调任军队的经济工作。1944年7月20日暗杀希特勒的计划失败后被捕，在弗洛森比格集中营被处死。"},{"page_url":"https://fr.wikipedia.org/wiki/Aubrac","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Doronic_Autriche.JPG","page_title":"Aubrac","context_page_description":"L'Aubrac est un haut plateau volcanique et granitique français situé dans le centre-sud du Massif central et aux confins des trois départements de l'Aveyron, du Cantal et de la Lozère. Il présente des ressemblances avec le Cézallier et on peut le rattacher comme lui aux hautes terres d'Auvergne. Il est bordé au nord-ouest par les monts du Cantal, à l'est par la Margeride et au sud par les plateaux calcaires des Grands Causses."},{"page_url":"https://az.wikipedia.org/wiki/Karib_monax_suiti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Cms-newyorkzoologicalsociety1910.jpg","page_title":"Karib monax suiti","context_page_description":"Karib monax suiti, və ya Tropik monax suiti, Vest-Hind monax suiti — Əsl suitilər fəsiləsinin Monax suitiləri cinsinə aid növ. Hazırda tükənmə təhlükəsi vardır. Hətta tükənmə ehtimalı vardır. Bədəninin uzunluğu 2,4 m təşkil edirdi. Rəngi bütünlüklə qəhvəyi olur."},{"page_url":"https://ru.wikipedia.org/wiki/Tetraponera","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Tetraponera_grandidieri_casent0409559_profile_1.jpg","page_title":"Tetraponera","context_page_description":"Tetraponera — род древесных муравьёв из подсемейства Pseudomyrmecinae. Обитают на деревьях, муравейники в ветках и домациях растений. Около 100 видов."},{"page_url":"https://sv.wikipedia.org/wiki/Brains","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Eglise_de_Brains%2C_Loire-Atlantique%2C_France.jpg","page_title":"Brains","context_page_description":"Brains är en kommun i departementet Loire-Atlantique i regionen Pays de la Loire i nordvästra Frankrike. Kommunen ligger i kantonen Bouaye som tillhör arrondissementet Nantes. År 2009 hade Brains 2 583 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Westsail_32","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Westsail_32_on_Stands.jpg","page_title":"Westsail 32","context_page_description":"The Westsail 32 was a production fiberglass sailboat built between the years of 1971 and 1980. Approximately 830 were built, about half of them in kit form. The \\"W32\\", as they are often referred to, was very heavily built and has taken many people on trouble-free voyages and several circumnavigations. Often thought of as a slow boat, the long waterline and incredible load carrying capabilities of this vessel make it an excellent cruising boat. The Westsail was directly derived from the earlier Kendall 32, of which only a few were made."},{"page_url":"https://it.wikipedia.org/wiki/Abbazia_di_Salem","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Unsere_Liebe_Frau_-_Salem.jpg","page_title":"Abbazia di Salem","context_page_description":"L'abbazia di Salem, conosciuto anche con il nome di Salmansweiler o con il termine latino Salomonis Villa, fu uno dei più importanti monasteri cistercensi in Germania, con sede a Salem, nel distretto di Bodensee a circa 10 km da Costanza, nel Baden-Württemberg, in Germania."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Hasselt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Hasselt_-_Huis_De_Gulden_Sadel.jpg","page_title":"Liste des monuments historiques de Hasselt","context_page_description":"Cette page regroupe l’ensemble du patrimoine immobilier de la ville belge de Hasselt."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%B0%E0%A7%80%E0%A6%9A%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Marichi%2C_a_Rishi_and_son_of_Brahma..jpg","page_title":"মরীচি","context_page_description":"ঋষি মারীচী বা Mareechi বা Marishi এর mindborn ছেলে ব্রাহ্ম এবং এক Saptarishi । তিনি কাশ্যপের পিতা এবং দেবগণ ও অসুরদের দাদুও ।\\nতিনি বেদান্তের প্রতিষ্ঠাতা। একটিকে 24 তীর্থঙ্কর মহাবীরের পূর্বের পুনর্জন্মগুলির একটি হিসাবে চিহ্নিত করা হয়।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Waiau","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Waiau_Presbyterian_Church_2011.JPG","page_title":"Liste der Baudenkmale in Waiau","context_page_description":"Die Liste der Baudenkmale in Waiau umfasst alle vom New Zealand Historic Places Trust als „Historic Place“ oder „Historic Area“ eingestuften Baudenkmale und Flächendenkmale der neuseeländischen Ortschaft Waiau. Die Angaben stammen aus dem Register des NZHPT. Die Bezeichnungen der Baudenkmale orientieren sich an diesem Register. In die Liste werden auch bekannte Wahi Tapu, kulturell und religiös bedeutsame Stätten und Gebiete der Māori, aufgenommen. Sie werden jedoch meist nicht publiziert."},{"page_url":"https://es.wikipedia.org/wiki/Baruch_Givoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Climograma_de_givoni_argentina.png","page_title":"Baruch Givoni","context_page_description":"Baruch Givoni fue un arquitecto israelí. Fue uno de los especialistas en arquitectura bioclimática más reconocidos del mundo, principalmente a partir de la publicación en 1969 de su libro Man, Climate and Architecture. Su campo de trabajo abarcó energía y edificios, atmósfera y clima urbano, y energía solar.​ Desarrolló el \\"Diagrama de Givoni\\" para el control y diseño bioclimático de edificios, usado en muchas escuelas de arquitectura del mundo."},{"page_url":"https://pl.wikipedia.org/wiki/69_Batalion_Ochrony_Pogranicza","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/By%C5%82e_koszary_WOP_w_G%C5%82ubczycach_04.jpg","page_title":"69 Batalion Ochrony Pogranicza","context_page_description":"Samodzielny Batalion Ochrony Pogranicza nr 69 – obecnie nieistniejący samodzielny pododdział Wojsk Ochrony Pogranicza."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%A1d_dubov%C3%A9_koruny","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Aug_Dumon-Dumortier.jpg","page_title":"Řád dubové koruny","context_page_description":"Řád dubové koruny je státní vyznamenání Lucemburského velkovévodství založené v roce 1841. Velmistrem řádu je lucemburský velkovévoda. Udílen je za civilní i vojenské zásluhy občanům Lucemburska i cizím státním příslušníkům."},{"page_url":"https://fr.wikipedia.org/wiki/Sumiyoshi_(m%C3%A9tro_de_Tokyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Sumiyoshi-Sta-Hanzomonline-Platform1.JPG","page_title":"Sumiyoshi (métro de Tokyo)","context_page_description":"Sumiyoshi est une station du métro de Tokyo sur les lignes Hanzōmon et Shinjuku dans l'arrondissement de Kōtō à Tokyo. Elle est exploitée conjointement par le Tokyo Metro et le Bureau des Transports de la Métropole de Tokyo."},{"page_url":"https://pl.wikipedia.org/wiki/Alberto_Terrile","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Alberto_Terrile.1994.Krzysztof_Kieslowsky.jpg","page_title":"Alberto Terrile","context_page_description":"Alberto Terrile – włoski fotograf.\\nZnany przede wszystkim we Francji, Włoszech i Stanach Zjednoczonych ze swojego cyklu o Aniołach, aktywny również w dziedzinach takich jak teatr, muzyka i reklama. W jego dorobku dominują czarno-białe portrety i to właśnie za nie otrzymał najwięcej nagród. Na jego najważniejszych portretach figurują – Corrado Rustici, Dee Dee Bridgewater i Ute Lemper. Swoje dzieła wystawił min w Mediolanie, Rzymie, Paryżu, Avignone, Chicago, Montrealu e Toronto."},{"page_url":"https://vi.wikipedia.org/wiki/Hasekura_Tsunenaga","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/HasekuraPrayer.jpg","page_title":"Hasekura Tsunenaga","context_page_description":"Hasekura Rokuemon Tsunenaga, theo các tài liệu châu Âu còn được đọc là Faxecura Rocuyemon phiên âm từ tiếng Nhật đương thời là một võ sĩ samurai người Nhật Bản và là phiên sỹ của Date Masamune - daimyō phiên Sendai.\\nTrong các năm từ 1613 tới 1620, Hasekura dẫn đầu một sứ bộ tới Vatican ở Roma, đi qua Tân Tây Ban Nha và ghé thăm nhiều địa điểm tại châu Âu. Sứ bộ này được lịch sử gọi Sứ tiết Keichō, tiếp nối Sứ tiết Tenshō năm 1582. Trên đường về, đoàn của Hasekura đi ngược lại theo con đường qua Mexico năm 1619, dong buồm từ Acapulco tới Manila rồi thăng buồm hướng bắc về Nhật Bản vào năm 1620. Ông thường được coi là sứ thần đầu tiên của Nhật Bản tới Châu Mỹ và châu Âu.\\nMặc dù sứ bộ của Hasekura Tsunenaga được đón tiếp thân tình tại châu Âu, chuyến đi này diễn ra vào giai đoạn Nhật Bản đang chuyển dần sang chính sách cấm đoán Công giáo. Do đó, các triều đình châu Âu như nhà vua Tây Ban Nha khước từ hiệp định thương mại mà Hasekura đề xuất. Hasekura trở về Nhật Bản năm 1620 và qua đời vì bệnh một năm sau đó, sứ bộ của ông trở về mà không đem lại mấy kết quả trong bối cảnh Nhật Bản ngày càng trở nên biệt lập."},{"page_url":"https://en.wikipedia.org/wiki/Hendrick_ter_Brugghen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/The_Concert_%281627%29_by_Hendrick_ter_Brugghen.jpg","page_title":"Hendrick ter Brugghen","context_page_description":"Hendrick Jansz ter Brugghen was a Dutch painter of genre scenes and religious subjects. He was a leading member of the Dutch followers of Caravaggio – the so-called Utrecht Caravaggisti. Along with Gerrit van Hondhorst and Dirck van Baburen, Ter Brugghen was one of the most important Dutch painters to have been influenced by Caravaggio."},{"page_url":"https://it.wikipedia.org/wiki/Shahrz%C4%81d","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Ali_Nasirian_in_Ghoghnos_Film_Festival.jpg","page_title":"Shahrzād","context_page_description":"Shahrzād è una serie televisiva iraniana sentimentale-storica, scritta da Hassan Fathi e Naghmeh Samini, e diretta dallo stesso Fathi. La trama ruota attorno al colpo di stato iraniano del 1953 organizzato dai governi britannico e statunitense. La serie è stata approvata dal Ministero della cultura e della guida islamica, ed è diffusa in tutto il paese in streaming attraverso il sito ufficiale e tramite la pubblicazione su CD, con un enorme successo di pubblico."},{"page_url":"https://cs.wikipedia.org/wiki/Datelovsk%C3%A1_str%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Datelovsk%C3%A1_str%C5%BE_%28001%29.jpg","page_title":"Datelovská strž","context_page_description":"Datelovská strž je přírodní rezervace ev. č. 2240 jihovýchodně od městyse Dešenice v okrese Klatovy. Oblast spravuje Správa NP a CHKO Šumava. Důvodem ochrany jsou dynamicky se vyvíjející bylinná a dřevinná společenstva."},{"page_url":"https://de.wikipedia.org/wiki/Ming-Chuan-Universit%C3%A4t","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Ming_Chuan_University_Jihe_Campus_20080426.jpg","page_title":"Ming-Chuan-Universität","context_page_description":"Ming Chuan University ist eine private Universität im Stadtbezirk Shilin von Taipeh. Im Jahr 2012/2013 belegte die Universität in dem QS Top 400 Asia Universities Ranking den Rang 301+, außerdem belegte sie im Jahr 2017 den Rang 801+ im Ranking des Times-Higher-Education-Magazins."},{"page_url":"https://pl.wikipedia.org/wiki/Clement_Claiborne_Clay","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Clement_Claiborne_Clay.jpg","page_title":"Clement Claiborne Clay","context_page_description":"Clement Claiborne Clay – amerykański polityk związany z Partią Demokratyczną. Reprezentował stan Alabama w Senacie Stanów Zjednoczonych.\\nUrodził się w Huntsville. W 1834 roku ukończył studia na Uniwersytecie Alabama, a następnie w 1839 roku prawo na Uniwersytecie Virginia. W 1840 roku został przyjęty do palestry i rozpoczął praktykę w Huntsville. Zasiadał w stanowej izbie reprezentantów w 1842, 1844 i 1845 roku. W latach 1848–1850 był sędzią w hrabstwie Madison.\\nW 1850 roku bez powodzenia brał udział w wyborach do Kongresu. 29 listopada 1853 roku został senatorem Stanów Zjednoczonych. W 1858 roku został wybrany na kolejną kadencję i piastował to stanowisko do 21 stycznia 1861 roku – do czasu ogłoszenia przez Alabamę secesji z Unii Amerykańskiej. W latach 1857–1861 był przewodniczącym senackiej Komisji ds. Handlu.\\nW latach 1861–1863 zasiadał w Senacie Konfederacji. W 1865 roku został aresztowany w związku podejrzeniem, że brał udział w zamach na Abrahama Lincolna. Osadzono go w Fort Monroe, gdzie przebywał około roku. Po zakończeniu wojny secesyjnej osiadł na swojej plantacji w hrabstwie Jackson. Zmarł w 1882 roku i został pochowany na cmentarzu Mapple Hill w Huntsville."},{"page_url":"https://cy.wikipedia.org/wiki/Titan_(lloeren)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Huygens_surface_color.jpg","page_title":"Titan (lloeren)","context_page_description":"Titan yw pymthegfed lloeren Sadwrn, hyd y gwyddom.\\nCylchdro: 1,221,630 km oddi wrth Sadwrn\\nTryfesur: 5150 km\\nCynhwysedd: 1.35e23 kg\\nYm mytholeg Roeg roedd y Titaniaid yn deulu o gewri, plant Wranws a Gaia. Cawsant eu gorchfygu gan deulu Zews.\\nDarganfuwyd y lloeren hon gan Huygens ym 1655.\\nYmddangosai Titan i fod y lloeren fwyaf o fewn Cysawd yr Haul ond mae ymchwil ddiweddar wedi dangos pa mor drwchus yw awyrgylch Titan a bod arwyneb solet y lloeren ychydig yn llai na Ganymede. Serch hynny mae tryfesur Titan yn fwy na thryfesur Mercher ac yn fwy o lawer na Phlwton.\\nUn o brif amcanion taith y chwiliedydd Voyager 1 oedd i astudio Titan. Daeth y chwiliedydd o fewn 4000 km o'i harwyneb a darganfod bod awyrgylch o gymylau trwchus oren gan y lloeren. Yn 2004 dechreuodd y cylchdroydd Cassini i anfon data am y lloeren yn ôl atom, ac ym mis Ionawr 2005 glaniodd y chwiliedydd Huygens ar y lloeren gan dynnu lluniau o arwyneb Titan.\\nY mis Ionawr 2005 disgynnodd chwiliedydd Huygens yr ESA trwy atmosffer Titan a danfon yn ôl atom luniau manwl o fyd sydd yn barhaol dan orchudd ei gymylau oren trwchus."},{"page_url":"https://fr.wikipedia.org/wiki/Francisco_J._Ayala","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Dr._Ayala.jpg","page_title":"Francisco J. Ayala","context_page_description":"Francisco José Ayala Pereda est un biologiste de l'évolution et philosophe espagnol et américain qui a longtemps enseigné à l'université de Californie à Irvine et à l'université de Californie à Davis. Il est un ancien prêtre dominicain ordonné en 1960 mais a quitté la prêtrise la même année. Après avoir obtenu son diplôme de l'université de Salamanque, il s'installe aux États-Unis en 1961 pour faire un doctorat à l'université Columbia. Là, il a étudié pour son doctorat sous la direction de Theodosius Dobjansky, diplômé en 1964. Il est devenu citoyen américain en 1971.\\nIl a été président et président du conseil d'administration de l'Association américaine pour le progrès de la science. À l'université de Californie à Irvine, il a pour nominations universitaires notamment Professeur d'université et Professeur Donald Bren de sciences biologiques, écologie et de biologie évolutive, professeur de philosophie, et professeur de logique et de la philosophie des sciences.\\nLe 1ᵉʳ juillet 2018, Francisco J. Ayala a officiellement démissionné de l'université de Californie à Irvine en raison de plaintes de harcèlement sexuel fondées."},{"page_url":"https://de.wikipedia.org/wiki/Carl_Horn_(Orgelbauer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Herschbach_%26_Girod_%26_Hundsangen_001.JPG","page_title":"Carl Horn (Orgelbauer)","context_page_description":"Carl Horn war ein deutscher Orgelbauer der Spätromantik.\\nEr war von ca. 1897 bis 1932 in Limburg an der Lahn ansässig und errichtete zwischen 70 und 80 Orgeln überwiegend in katholischen Kirchen des Bistums Limburg – unter anderem im Taunus, im Rheingau und gerade auch im Westerwald. Unterstützt wurde er dabei durch den aus Kransberg im Taunus stammenden, im Jahr 1899 zum Orgel- und Glockensachverständigen des Bistums berufenen Seminarlehrer Karl Walter in Montabaur, der den Bau der „neuen“ Orgel maßgeblich förderte. Während bei Horns Vorgänger in Limburg, den Gebrüdern Keller, in der Spätphase noch der Übergang von der hoch- zur spätromantischen Orgel spürbar ist, entsteht bei Carl Horn durchweg ein „spätromantischer“ Orgeltypus, der zwar auf den orgelbaulichen Errungenschaften der Hochromantik basiert, diesen aber sowohl klanglich wie technisch weiterentwickelt."},{"page_url":"https://es.wikipedia.org/wiki/Mnichov_(Cheb)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Mnichov_CH_CZ.png","page_title":"Mnichov (Cheb)","context_page_description":"Mnichov es una localidad del distrito de Cheb en la región de Karlovy Vary, República Checa, con una población estimada a principio del año 2018 de 399 habitantes.\\nSe encuentra ubicada al oeste de la región, cerca de la orilla del río Ohře —un afluente izquierdo del río Elba— y de la frontera con Alemania.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Hammelburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/UntereschenbachBildstockKreuzigung.jpg","page_title":"Liste der Baudenkmäler in Hammelburg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Stadt Hammelburg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 249 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/List_of_statues_of_presidents_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Flickr_-_USCapitol_-_Thomas_Jefferson_Statue.jpg","page_title":"List of statues of presidents of the United States","context_page_description":"This is a list of statues and busts of Presidents of the United States."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%BF%D1%96%D0%BB%D0%B5%D0%BD%D0%B3%D0%BB%D1%96%D0%BA%D0%BE%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/PropyleneGlycol-stickAndBall.png","page_title":"Пропіленгліколь","context_page_description":"Пропіленгліколь, також 1,2-пропандіол — органічна сполука з формулою C₃H₈O₂. При звичайних умовах безбарвна, майже без запаху, прозора, в'язка з слабким солодким смаком, гігроскопічна рідина. Змішується з водою, ацетоном, і хлороформом."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BC%D1%83_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/LamuFort.jpg","page_title":"Ламу (город)","context_page_description":"Ламу — небольшой город на острове Ламу, который, в свою очередь, является частью архипелага Ламу в Кении. Город Ламу является административным центром округа Ламу, а также объектом Всемирного наследия ЮНЕСКО."},{"page_url":"https://cy.wikipedia.org/wiki/Necropolis_Giza","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Great_Sphinx_of_Giza_-_20080716a.jpg","page_title":"Necropolis Giza","context_page_description":"Mae Necropolis Giza yn safle archeolegol ar Lwyfandir Giza, ar gyrion Cairo, Yr Aifft. Mae'r casgliad o henebion ar y safle yn cynnwys y tri cyfadeilad o byramidiau a elwir y Pyramidiau Fawr, y cerflun anferth a adweinir fel y Sffincs Mawr, nifer o fynwentydd, pentref gweithwyr a safle diwydiannol. Mae wedi ei leoli tua 9 km i mewn i'r anialwch o dref hynafol Giza ar yr Afon Nîl, a thua 25 o gilomedrau i'r de orllewin o ganol dinas Cairo\\nRoedd y pyramidiau yn boblogaidd yn y cyfnod Helenistaidd, rhestrwyd y Pyramid Mawr gan Antipater o Sidon fel un o Saith Rhyfeddod y Byd, bellach dyma'r unig un o'r saith ryfeddod hynafol sy'n dal i fodoli."},{"page_url":"https://nl.wikipedia.org/wiki/Susanna_Foster","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Susanna_Foster_1943.JPG","page_title":"Susanna Foster","context_page_description":"Susanna Foster, geb. Susanna DeLee Flanders Larson, was een Amerikaanse filmactrice.\\nZij startte haar zang- en acteerloopbaan toen zij 12 jaar was. Haar filmdebuut volgde in 1939. Zij werd vooral bekend door de film The Phantom of the Opera uit 1943. In 1945 trok zij zich terug als actrice. 47 jaar later, in 1992 had zij een korte comeback met de film Detour. Susanna Foster was van 1948 tot 1956 gehuwd met de acteur Wilbur Evans. Het paar kreeg twee zoons."},{"page_url":"https://pt.wikipedia.org/wiki/Le%C3%A3o-das-cavernas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Lions_painting%2C_Chauvet_Cave_%28museum_replica%29.jpg","page_title":"Leão-das-cavernas","context_page_description":"O chamado leão-das-cavernas, ou leão-das-cavernas europeu é uma subespécie extinta de leão. Essa espécie foi identificada através de fósseis e diversos exemplos de arte pré-histórica."},{"page_url":"https://cs.wikipedia.org/wiki/Fotografie_ve_Vietnamu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Th%C3%ADch_Qu%E1%BA%A3ng_%C4%90%E1%BB%A9c_self-immolation.jpg","page_title":"Fotografie ve Vietnamu","context_page_description":"Fotografie ve Vietnamu je hluboce zakořeněna v jedinečné a rychle se měnící historii země. Jako v mnoha zemích byl vývoj techniky, řemesla a umění fotografie mimo jiné důsledkem změny technologie, zlepšování ekonomických a politických podmínek a míry uznání fotografie jako svéprávné formy umění. Fotografie se ve Vietnamu vyvíjela za spoluúčasti a zájmu od počátků tohoto umění k úspěchům některých Vietnamců ve světě fotografie do dnešních dní."},{"page_url":"https://cy.wikipedia.org/wiki/Cwpanllys_cyffredin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Moos_5772.jpg","page_title":"Cwpanllys cyffredin","context_page_description":"Un o lysiau'r afu mwyaf cyffredin yw llysiau'r afu palmwyddog. Mae'n tyfu ar bridd a chreigiau mewn amrywiaeth o gynefinoedd llaith, gan gynnwys gerddi a thai gwydr. Mae'n rhywogaeth fawr sy'n cyrraedd 10 cm o hyd. Mae'n cynhyrchu strwythurau atgenhedlu o siâp palmwydden neu barasol.\\nMae’r rhywogaeth hon i’w chanfod yng Nghymru."},{"page_url":"https://en.wikipedia.org/wiki/Paccharaju","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Huascaran_park_Ishinca_Tocllaraju_panormica.jpg","page_title":"Paccharaju","context_page_description":"Paccharaju is a mountain of 5,744 m of elevation in the Cordillera Blanca in the Andes of Peru. In other maps it is shown as comprising two peaks: Rocotuyo of 5,749 m and Rayococha of 5,460 m. It is located between the provinces of Asunción Province and Carhuaz, in Ancash; southwest of mount Tarush Kancha, inside Huascarán National Park.\\nRocotuyo is a lake at 9°16′53″S 77°27′12″W south of the mountain."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Lahnstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Lahnstein%2C_Jozefkapel_%28Josefskapelle%29.jpg","page_title":"Liste der Kulturdenkmäler in Lahnstein","context_page_description":"In der Liste der Kulturdenkmäler in Lahnstein sind alle Kulturdenkmäler der rheinland-pfälzischen Stadt Lahnstein mit den Stadtteilen Niederlahnstein und Oberlahnstein aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://es.wikipedia.org/wiki/Pithecophaga_jefferyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Pithecophaga_jefferyi.jpg","page_title":"Pithecophaga jefferyi","context_page_description":"El águila monera​ es una especie de ave accipitriforme de la familia Accipitridae. Es la mayor rapaz de las selvas de Filipinas y una de las especies tropicales de águila más grandes. Es el ave nacional de Filipinas, donde se le denomina simplemente como águila filipina. No se reconocen subespecies.​"},{"page_url":"https://lt.wikipedia.org/wiki/Smulkia%C5%BEied%C4%97_gegu%C5%BEraib%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Orchis_ustulata_wiki_mg-k03.jpg","page_title":"Smulkiažiedė gegužraibė","context_page_description":"Smulkiažiedė gegužraibė – gegužraibinių šeimos augalas, įrašytas į Lietuvos raudonąją knygą."},{"page_url":"https://da.wikipedia.org/wiki/Frederik_af_Slesvig-Holsten-S%C3%B8nderborg-Gl%C3%BCcksborg_(1814-1885)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Gottorf.jpg","page_title":"Frederik af Slesvig-Holsten-Sønderborg-Glücksborg (1814-1885)","context_page_description":"Hertug Frederik til Slesvig-Holsten-Sønderborg-Glücksborg var hertug af Slesvig-Holsten-Sønderborg-Glücksborg fra 1878 til 1885.\\nHan var søn af Hertug Vilhelm af Slesvig-Holsten-Sønderborg-Glücksborg og Louise Karoline af Hessen-Kassel og storebror til Kong Christian 9. af Danmark."},{"page_url":"https://simple.wikipedia.org/wiki/Council_Bluffs,_Iowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Council_Bluffs%2C_Iowa%2C_Old_Town.jpg","page_title":"Council Bluffs, Iowa","context_page_description":"Council Bluffs is a city in southwest Iowa in the United States, near Omaha, Nebraska."},{"page_url":"https://ast.wikipedia.org/wiki/Reinos_xerm%C3%A1nicos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Anneau_sigillaire_Alaric_II.jpg","page_title":"Reinos xermánicos","context_page_description":"Los reinos xermánicos, reinos romanu-xermánicos o monarquíes xermániques fueron los estaos qu'establecieron a partir del sieglu V nel antiguu territoriu del Imperiu romanu d'Occidente los pueblos xermánicos procedentes de la Europa del Norte y del Este. Atopar nun estáu de desenvolvimientu económicu, social y cultural inferior al del Imperiu romanu, que percibíen admirativamente. Les sos instituciones polítiques peculiares, en concretu l'asamblea de guerreros llibres y la figura del rei, recibieron la influencia de les tradiciones institucionales del Imperiu y la civilización grecorromana, y fuéronse afaciendo a les circunstancies del so asentamientu nos nuevos territorios, sobremanera a l'alternativa ente imponese como minoría dirixente sobre una mayoría de población llocal o fundise con ella.\\nLos nuevos reinos xermánicos conformaron la personalidá d'Europa Occidental mientres la Edá Media, evolucionaron en monarquíes feudales y monarquíes autoritaries, y col tiempu, dieron orixe a los estaos-nación que se fueron construyendo en redol a elles."},{"page_url":"https://pnb.wikipedia.org/wiki/%DB%81%D8%A7%D9%84%D8%B4%D9%B9%D8%A7%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Hallstatt-Blick-auf-See.jpg","page_title":"ہالشٹاٹ","context_page_description":"ہالشٹاٹ آسٹریا دے صوبے اتلا آسٹریا دا اک پنڈ اے ۔ ایدی لوک گنتی 2001 دے سعاب نال 946 اے۔ اے ہالشتاتر جھیل دے کنڈے تے وس ریا اے۔"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Premierminister_von_British_Columbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Edward_Gawler_Prior.jpg","page_title":"Liste der Premierminister von British Columbia","context_page_description":"Diese Liste führt die Premierminister der kanadischen Provinz British Columbia auf. British Columbia besitzt ein Einkammernparlament mit einer auf dem Westminster-System basierenden parlamentarischen Regierung. Dabei ist der Premierminister zugleich Vorsitzender jener Partei, die in der Legislativversammlung die meisten Sitze hält. Der Premierminister tritt als Regierungschef auf, während das Staatsoberhaupt, der kanadische Monarch, durch einen Vizegouverneur vertreten wird. Außerdem stellt der Premierminister aus den Reihen der gewählten Abgeordneten die als Exekutivrat bezeichnete Regierung zusammen und steht dieser vor. Vor 1903 gab es keine Parteien."},{"page_url":"https://ms.wikipedia.org/wiki/Miss_Universe_1980","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Miss_Universe_1980_Map.PNG","page_title":"Miss Universe 1980","context_page_description":"Miss Universe 1980, pertandingan Miss Universe ke-29, telah diadakan pada 8 Julai 198 di Pusat Kebudayaan Sejong di Seoul, Korea Selatan. Shawn Weatherly dari Amerika Syarikat telah dimahkotai oleh Maritza Sayalero dari Venezuela. Enam puluh sembilan peserta bertanding pada tahun ini."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%AB%E0%A6%97%E0%A6%BE%E0%A6%A8%E0%A6%BF%E0%A6%B8%E0%A7%8D%E0%A6%A4%E0%A6%BE%E0%A6%A8%E0%A7%87%E0%A6%B0_%E0%A6%B6%E0%A6%BF%E0%A6%95%E0%A7%8D%E0%A6%B7%E0%A6%BE%E0%A6%AC%E0%A7%8D%E0%A6%AF%E0%A6%AC%E0%A6%B8%E0%A7%8D%E0%A6%A5%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Afghan_school_girls_in_2002.jpg","page_title":"আফগানিস্তানের শিক্ষাব্যবস্থা","context_page_description":"আফগানিস্তানে শিক্ষা কিন্ডারগার্টেন থেকে ১২তম শ্রেনি পরিচালনার জন্য আফগানিস্তান এর কাবুলে শিক্ষা মন্ত্রণালয় রয়েছে এবং উচ্চ শিক্ষার জন্য উচ্চ শিক্ষা মন্ত্রণালয় রয়েছে। আফগানিস্তান এখন দেশব্যাপী পুনঃনির্মাণ এর কাজ চলছে, পিছুটান থাকার সত্বেও শিক্ষার প্রতিষ্ঠান গুলো দেশব্যাপী শিক্ষাপ্রতিষ্ঠান গুলো নতুনভাবে নির্মাণ করা হচ্ছে। ২০১৩ নাগাদ ১০.৫ মিলিয়ন শিক্ষার্থী আফগানিস্তানের স্কুল গুলোতে অংশগ্রহণ করে। দেশ, জনসংখ্যা প্রায় ২৭.৫ মিলিয়ন।"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Dayton,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Bimm_Fireproof_Warehouse.jpg","page_title":"National Register of Historic Places listings in Dayton, Ohio","context_page_description":"This is a list of the National Register of Historic Places listings in Dayton, Ohio.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Dayton, Ohio, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 152 properties and districts listed on the National Register in Montgomery County, including 7 National Historic Landmarks. The city of Dayton is the location of 110 of these properties and districts, including 5 National Historic Landmarks; they are listed here, while the remaining properties and districts are listed separately. A single property, the Miami Valley Golf Course and Clubhouse, is split between Dayton and other parts of the county, and it thus appears on both lists. Another 2 properties in Dayton were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted April 10, 2020."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B8%D0%B1%D0%B8%D0%BB%D0%B0_%D1%84%D0%BE%D0%BD_%D0%91%D0%B0%D0%B4%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bh_Stadtkirche_Innen_Altar.jpg","page_title":"Сибила фон Баден","context_page_description":"Сибила фон Баден е принцеса и титулувана маркграфиня от Баден и чрез женитба графиня на Ханау-Лихтенберг.\\nТя е третата дъщеря на маркграф Христоф I фон Баден и Отилия фон Катценелнбоген, внучка на граф Филип I фон Катценелнбоген.\\nСибила фон Баден се омъжва на 24 януари 1505 г. в Баден за граф Филип III фон Ханау-Лихтенберг. Тя донася 5000 флоринти в брака. Тя подарява олтар на градската църква Св. Николаус в Бабенхаузен в Хесен. Сибила умира на 10 юли 1518 г. и е погребана в тази църква.\\nДвамата имат децата:\\nЙохана, омъжена 1522 г. за граф Вилхелм IV фон Еберщайн\\nХристофора, от ноември 1526 монахиня и по-късно абатеса на манастир Мариенборн, светска след закриването на манастира 1559.\\nАмалия, от ноември 1526 монахиня в манастир Мариенборн, светска след закриването на манастира 1559.\\nФелицитас\\nФилип IV, граф на Ханау-Лихтенберг; женен 1538 г. за Елеонора фон Фюрстенберг\\nФелицитас, от ноември 1526 монахиня в манастир Мариенборн"},{"page_url":"https://sv.wikipedia.org/wiki/North_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/North_Hill%2C_village_street_-_geograph.org.uk_-_1221962.jpg","page_title":"North Hill","context_page_description":"North Hill är en by och en civil parish i Cornwall i England. Orten har 964 invånare."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%92%E8%8D%89%E7%81%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Sin_Fat_Road_from_Sceneway.JPG","page_title":"晒草灣","context_page_description":"晒草灣，又名茜草灣，是香港九龍觀塘區茶果嶺及藍田之間的海灣，其附近一帶的山丘地區亦被稱為晒草灣。藍田站興建在晒草灣山坡內，藍田站D出口穿過晒草灣山坡直接到達滙景花園第17座旁匯景道及茜發道步行前往滙景花園及麗港城。\\n晒草灣跟「曬草灣」有別，雖然粵語發音相同，但因為繁體字彙中的「晒」字，字意跟「曬」不同，前者意解「全」、「都」的意思。晒草灣意思為「長滿草的海灣」。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8A%B1%E5%89%8C%E5%AD%90%E6%A8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Khwarezmian_Empire_1190_-_1220_%28AD%29.PNG","page_title":"花剌子模","context_page_description":"花剌子模，是一个位于中亚西部阿姆河三角洲地区的大型绿洲。它的南部为卡拉库姆沙漠，北部是曾经的咸海，西部为乌斯秋尔特高原，东部是克孜勒库姆沙漠。在中世纪曾建立一个强大的帝国——花剌子模帝国。现今为乌兹别克斯坦、哈萨克斯坦和土库曼斯坦的一部分。"},{"page_url":"https://pt.wikipedia.org/wiki/Expedi%C3%A7%C3%A3o_24","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Expedition_24_crew_portrait.jpg","page_title":"Expedição 24","context_page_description":"Expedição 24 foi a 24ª expedição de longa duração à Estação Espacial Internacional, realizada entre 1 de junho e 25 de setembro de 2010. Ela foi composta de seis astronautas, três russos e três norte-americanos.\\nForam realizadas três caminhadas espaciais já previstas e uma adicional, para realizar um conserto de emergência numa bomba de refrigeração externa da estação. A tripulação foi lançada ao espaço em datas diferentes, nas naves russas Soyuz TMA-18 e Soyuz TMA-19."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%95%D7%9C_%D7%A9%D7%99%D7%9E%D7%A0%D7%95%D7%91%D7%A1%D7%A7%D7%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Katowice_-_Karol_Szymanowski.jpg","page_title":"קרול שימנובסקי","context_page_description":"קרול מאצ'יי קורווין-שימנובסקי היה מלחין ופסנתרן פולני."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9serve_naturelle_Laguna_de_Apoyo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/ApoyoHurleur_04.jpg","page_title":"Réserve naturelle Laguna de Apoyo","context_page_description":"La Réserve naturelle Laguna de Apoyo est situé à cheval sur la frontière entre les départements de Masaya et de Granada, au Nicaragua. Elle a été déclaré réserve naturelle en 1991 par le ministère de l'Environnement et des Ressources naturelles et c'est l'une des 78 zones protégées du Nicaragua.\\nLa réserve de 34 km² englobe la caldeira du volcan Apoyo, le lac endoréique qui s'y est créé et une partie de son bassin de drainage. Le plan d'eau d'une superficie de 19,44 km² est à égale distance des lacs Cocibolca et de Masaya.\\nLe lac d'Apoyo est improprement appelé lagune à cause d'une traduction littérale du mot espagnol laguna qui signifie lagon, ce dernier terme étant également inapproprié car associé à l'océan et aux atolls."},{"page_url":"https://en.wikipedia.org/wiki/Philippe_Honor%C3%A9_(cartoonist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Signature_honore.png","page_title":"Philippe Honoré (cartoonist)","context_page_description":"Philippe Honoré, known by the pen-name Honoré, was a French cartoonist and a long-time staff member of Charlie Hebdo.\\nHonoré was among five cartoonists assassinated on 7 January 2015, during the shooting attack on the Charlie Hebdo newspaper office."},{"page_url":"https://en.wikipedia.org/wiki/Bull_Kearley","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bull_Kearley.png","page_title":"Bull Kearley","context_page_description":"Richard Irven \\"Bull\\" Kearley was a college football player."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%A4%AA%E7%A7%A6%E5%BB%A3%E9%9A%86%E5%AF%BA%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Keifuku_Uzumasa_stn.jpg","page_title":"太秦廣隆寺站","context_page_description":"太秦广隆寺站位于京都府京都市右京区太秦组石町，是京福电气铁道岚山本线的铁路车站。车站编号为A7。"},{"page_url":"https://pl.wikipedia.org/wiki/%C5%A0koda_Octavia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Skoda_Octavia_1.8_TSI_Green_tec_Elegance_%28III%29_%E2%80%93_Heckansicht%2C_14._April_2013%2C_D%C3%BCsseldorf.jpg","page_title":"Škoda Octavia","context_page_description":"Škoda Octavia – samochód osobowy klasy kompaktowej produkowany pod czeską marką Škoda od 1996 roku. Od 2019 roku produkowana jest czwarta generacja modelu."},{"page_url":"https://pt.wikipedia.org/wiki/Miss%C3%B5es_diplom%C3%A1ticas_da_Fran%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/French_Consulate_P5240008.JPG","page_title":"Missões diplomáticas da França","context_page_description":"A França possui uma grande influência na rede diplomática internacional. A seguir está a lista das missões diplomáticas do país espalhadas pelo mundo."},{"page_url":"https://de.wikipedia.org/wiki/Apotropaion","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/P%C3%ADseck%C3%A1_br%C3%A1na%2C_od_severu%2C_v%C3%BDzdoba.jpg","page_title":"Apotropaion","context_page_description":"Ein Apotropaion oder Apotropäum ist ein magischer Gegenstand oder ein Bild zum Schutz gegen böse Kräfte."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%99%D0%BE%D1%85%D0%B0%D0%BD_I_%D1%84%D0%BE%D0%BD_%D0%A5%D0%B5%D0%BB%D1%84%D0%B5%D0%BD%D1%89%D0%B0%D0%B9%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Helfenstein_1840.jpg","page_title":"Йохан I фон Хелфенщайн","context_page_description":"Йохан I (II) фон Хелфенщайн е граф на Хелфенщайн-Визенщайг, граф на Гюсенберг и Калтенбург.\\nТой е син на граф Улрих III фон Хелфенщайн и първата му съпруга Аделхайд фон Грайзбах, дъщеря на граф Бертхолд III фон Грайзбах и Елизабет фон Хиршберг. Майка му е сестра на Гебхард III фон Грайзбах"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%BE%D0%B0%D0%BD_%D0%A8%D0%B0%D0%BD%D0%B7%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Antoine_Chanzy_circa_1880.jpg","page_title":"Антоан Шанзи","context_page_description":"Антоан Шанзи био је француски генерал.\\nУчествовао је у немачко-француском рату као командант корпуса, а затим као командант новоформиране 2. лоарске армије, којом је вешто маневрисао и успоравао наступање немачких снага. Противио се закључењу уговора о миру са Немачком у Франкфурту на Мајни. Написао је мемоарске дело о дејствима 2. лоарске армије."},{"page_url":"https://de.wikipedia.org/wiki/Ersatzschaltbild","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Quelle_U-Ersatz.svg","page_title":"Ersatzschaltbild","context_page_description":"Ein Ersatzschaltbild ist die graphische Darstellung einer Ersatzschaltung, die sich elektrisch genauso verhält wie die ursprüngliche elektrische Schaltung. An die Stelle einer unübersichtlichen, eventuell unbekannten Originalschaltung soll das Ersatzschaltbild mit einer leicht überschaubaren Darstellung treten, die eine Berechenbarkeit ermöglicht."},{"page_url":"https://it.wikipedia.org/wiki/Regno_di_Napoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Giambattista_Basile.jpg","page_title":"Regno di Napoli","context_page_description":"Regno di Napoli è il nome con cui è conosciuto nella storiografia moderna l'antico Stato esistito dal XIV al XIX secolo ed esteso a tutto il meridione continentale italiano. Il suo nome ufficiale era Regnum Siciliae citra Pharum, vale a dire Regno di Sicilia al di qua del Faro e si contrapponeva al contemporaneo Regnum Siciliae ultra Pharum, che si estendeva sull'intera isola di Sicilia. Utilizzato dagli storici fu anche il nome Regno di Puglia, che trova la sua origine in età normanna, allorquando il territorio era parte integrante del Regno normanno di Sicilia. Quest'ultimo Stato fu istituito nel 1130, con il conferimento a Ruggero II d'Altavilla del titolo di Rex Siciliae dall'antipapa Anacleto II, titolo confermato nel 1139 da papa Innocenzo II. Il nuovo Stato insisteva così su tutti i territori del Mezzogiorno, attestandosi come il più ampio degli antichi Stati italiani.\\nAlla stipula della Pace di Caltabellotta seguì la formale divisione del regno in due: Regnum Siciliae citra Pharum e Regnum Siciliae ultra Pharum. Pertanto questo trattato può essere considerato l'atto di fondazione convenzionale dell'entità politica oggi nota come Regno di Napoli."},{"page_url":"https://pl.wikipedia.org/wiki/Chic","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Chicgf.JPG","page_title":"Chic","context_page_description":"Chic – amerykańska grupa muzyczna grająca muzykę disco-funk. Założona została w 1976 roku przez gitarzystę Nile'a Rodgersa i basistę Bernarda Edwardsa. Ich najbardziej znane utwory to: „Le Freak”, „Good Times”, „I Want Your Love”, „My Forbidden Lover”, „Everybody Dance”."},{"page_url":"https://hu.wikipedia.org/wiki/Szabadka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%D0%A1%D1%83%D0%B1%D0%BE%D1%82%D0%B8%D1%86%D0%B0.jpg","page_title":"Szabadka","context_page_description":"Szabadka város és község Szerbiában, a Vajdaság északi részén, az Észak-bácskai körzetben, Magyarország déli határától 10 km távolságban. Az Észak-bácskai körzet adminisztratív központja.\\nÚjvidék mögött a Vajdaság második legnépesebb városa, lakosainak száma 97 910, a környező településekkel együtt megközelíti a 150 000 főt. A város a vajdasági magyarok, a vajdasági horvátok és bunyevácok szellemi, kulturális és politikai szervezeteinek központja, valamint számos nemzetiségi nyelven működő közép- és felsőfokú oktatási intézménynek is otthont ad."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_du_Champ","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Borne_d%27Altier.svg","page_title":"Château du Champ","context_page_description":"Le château du Champ est une maison forte devenue château située à Altier en Lozère, en France."},{"page_url":"https://fr.wikipedia.org/wiki/Albert_Emon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/EmonAlbert.jpg","page_title":"Albert Emon","context_page_description":"Albert Emon, né le 24 juin 1953 à Berre-l'Étang, est un footballeur international puis entraîneur français qui évoluait au poste d'attaquant."},{"page_url":"https://fr.wikipedia.org/wiki/Triumph_TR6_Trophy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/TR6Csmall.JPG","page_title":"Triumph TR6 Trophy","context_page_description":"La TR6 Trophy est une moto fabriquée par Triumph à Meriden de 1956 à 1973, date à laquelle elle a été remplacée par la Triumph Tiger TR7V 750 cm³ à cinq vitesses. Durant toute sa commercialisation ce fut un modèle apprécié, particulièrement aux États-Unis. La variante de compétition, connue sous le nom de « desert sled », remporta de nombreuses compétitions de la fin des années 1950 jusqu'aux années 1960. L’apparition de la moto dans La Grande Évasion et le penchant de Steve McQueen pour ce modèle sont connus."},{"page_url":"https://it.wikipedia.org/wiki/USS_Hornet_(CV-8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Japanese_aircraft_attack_USS_Hornet_%28CV-8%29_during_the_Battle_of_the_Santa_Cruz_Islands_on_26_October_1942_%2880-G-33947%29.jpg","page_title":"USS Hornet (CV-8)","context_page_description":"La settima USS Hornet (CV-8) della United States Navy fu una portaerei classe Yorktown della seconda guerra mondiale, famosa per aver trasportato i bombardieri dell'incursione aerea su Tokyo, come partecipante alla battaglia delle Midway e per azioni nelle Salomone prima di essere affondata nella battaglia delle isole Santa Cruz.\\nVenne varata il 14 dicembre 1940 dal cantiere di Newport News Shipbuilding di Newport News, Virginia, battezzata da Annie Reid Knox ed entrò in servizio a Norfolk il 20 ottobre 1941, al comando del capitano Marc Mitscher.\\nDurante l'inquieto periodo che precedette l'Attacco a Pearl Harbor, la Hornet si addestrò al largo della base navale di Norfolk. Un indizio della futura missione occorse il 2 febbraio 1942 quando salpò da Norfolk con due bombardieri medi B-25 Mitchell della Army Air Force sul ponte. Una volta in mare gli aerei vennero lanciati tra lo stupore dell'equipaggio. I suoi uomini furono inconsapevoli del significato dell'esperimento e la Hornet rientrò a Norfolk pronta a salpare per la zona di combattimento e il 4 marzo iniziò a costeggiare la costa occidentale diretta al canale di Panama."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_na_Hrad%C4%8Danech","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/SpitalSvAntonina.JPG","page_title":"Seznam kulturních památek na Hradčanech","context_page_description":"Tento seznam nemovitých kulturních památek v části Hradčany v hlavním městě Praze vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nStaré Město, Nové Město, Malá Strana, Hradčany, Josefov, Vyšehrad a z malé části Vinohrady, Holešovice, Podolí a Smíchov jsou od roku 1971 jako Pražská památková rezervace městskou památkovou rezervací."},{"page_url":"https://ceb.wikipedia.org/wiki/Dactyloctenium_radulans","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Dactyloctenium_radulans_%286822849406%29.jpg","page_title":"Dactyloctenium radulans","context_page_description":"Espesye sa balili nga una nga gihulagway ni Robert Brown, ug nga gihatagan sa eksakto nga ngalan ni Ambroise Marie François Joseph Palisot de Beauvois ang Dactyloctenium radulans. Ang Dactyloctenium radulans sakop sa kahenera nga Dactyloctenium sa kabanay nga Poaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/La_Mesa_Ecopark","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Short_Bike_Loop%2C_La_Mesa_Ecopark_-_panoramio.jpg","page_title":"La Mesa Ecopark","context_page_description":"The La Mesa Ecopark is a public park situated in Quezon City, Metro Manila, Philippines.\\nEcopark a short form of Ecological Park. It is exploited as an amusement park without hampering its natural environment so that the bio-diversity remains unaffected there. Generally a particular area of a forest is demarcated and brought under intensive management for this purpose."},{"page_url":"https://pl.wikipedia.org/wiki/Rebecca_Nurse","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/RebeccaNurse-inChains.jpg","page_title":"Rebecca Nurse","context_page_description":"Rebecca Towne Nurse została stracona za czary przez rząd prowincji Massachusetts Bay w Nowej Anglii podczas procesów czarownic z Salem w 1692 roku. Była żoną Francisa Nurse'a. Miała kilkoro dzieci oraz wnucząt i była szanowaną członkinią lokalnej społeczności. Ponieważ istniały przeciwko niej dowody widmowe, została oskarżona o bycie czarownicą i powieszona 19 lipca 1692 roku. Nastąpiło to w czasie, gdy kolonia Massachusetts została opanowana przez histerię dotyczącą czarów i obecności Szatana w kolonii. Jej siostry, Mary oraz Sarah, również zostały oskarżone o czary. Mary również została stracona po uznaniu jej za winną, natomiast Sarah uwolniono od zarzutów."},{"page_url":"https://cy.wikipedia.org/wiki/Mercer_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Mercer_County_Courthouse_Pennsylvania_2010.jpg","page_title":"Mercer County, Pennsylvania","context_page_description":"Sir yn nhalaith Pennsylvania, Unol Daleithiau America yw Mercer County. Cafodd ei henwi ar ôl Hugh Mercer. Sefydlwyd Mercer County, Pennsylvania ym 1803 a sedd weinyddol y sir yw Mercer, Pennsylvania.\\nMae ganddi arwynebedd o 1,768 cilometr sgwâr. Allan o'r arwynebedd hwn, y canran o ffurfiau dyfrol, megis llynnoedd ac afonydd, yw 1.5%. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 115,195. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Crawford County, Venango County, Butler County, Lawrence County, Mahoning County, Trumbull County. Cedwir rhestr swyddogol o henebion ac adeiladau cofrestredig y sir yn: National Register of Historic Places listings in Mercer County, Pennsylvania.\\nCeir sawl sir o’r un enw gan gynnwys:\\nMercer County, Gogledd Dakota\\nMercer County, Gorllewin Virginia\\nMercer County, Illinois\\nMercer County, Kentucky\\nMercer County, Missouri\\nMercer County, New Jersey\\nMercer County, Ohio\\nMercer County, Pennsylvania"},{"page_url":"https://no.wikipedia.org/wiki/Guignol","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Guignol_in_Lyon_1.jpg","page_title":"Guignol","context_page_description":"Guignol er den best kjente figuren i fransk dukketeatertradisjon. Hans fulle navn er Jean Siflavio Guignol, men bare etternavnet brukes, bortsett fra når innholdet i teaterstykket krever at han registrerer seg hos myndighetene. Han er den komiske helten i Guignol-forestillingene, som spilles med hanskedukker. I Frankrike brukes «Théatre Guignol» også som navn på denne figurteaterformen, og substantivet «guignoliste» betegner en dukkespiller som benytter dukker av denne typen.\\nGuignol ble skapt i Lyon tidlig på 1800-tallet av den arbeidsledige silkearbeideren Laurent Mourguet. Guignol er en typisk «gône de Lyon», et folkelig navn på en person fra Lyon. Oversatt til norsk er det en skøyer, eller ramp. Han snakker Lyon-dialekt, og bruker saftige uttrykk for å påpeke sosial urettferdighet og ta parti for mannen i gata. Dette har gjort ham svært populær i perioder av de rundt 200 årene han har eksistert.\\nGuignol-teatret var opprinnelig ment for et voksent publikum. Dagsaktuelle saker ble tatt opp og øvrighetspersoner latterliggjort i forestillingene, som i hovedsak ble improvisert frem i de første tiårene."},{"page_url":"https://fr.wikipedia.org/wiki/Brocourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Brocourt%2C_Somme%2C_France.JPG","page_title":"Brocourt","context_page_description":"Brocourt est une commune française située dans le département de la Somme en région Hauts-de-France."},{"page_url":"https://it.wikipedia.org/wiki/Friedrich_Wilhelm_Schnitzler","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Friedrich_Wilhelm_Schnitzler_1984_Bundesverdienstkreuz_der_BRD.jpg","page_title":"Friedrich Wilhelm Schnitzler","context_page_description":"Friedrich Wilhelm Schnitzler è stato un politico tedesco.\\nÈ stato politico dell'Unione Cristiano Democratica."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AE%D9%84%DB%8C%D9%81%D9%87_%D8%A8%D9%86_%D8%B3%D9%84%D9%85%D8%A7%D9%86_%D8%A2%D9%84_%D8%AE%D9%84%DB%8C%D9%81%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Khalifa_ibn_Salman_Al_Khalifa.jpg","page_title":"خلیفه بن سلمان آل خلیفه","context_page_description":"خلیفه بن سلمان آل خلیفه بیر شاهزاده ایدی. آتاسی سلمان بن حمد آل‌خلیفه دیر."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D1%96%D0%B2_%D0%A2%D0%B0%D1%80%D0%B0%D1%81%D0%BE%D0%B2%D1%96_%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/TarasShevchenko-Skopje.JPG","page_title":"Список пам'ятників Тарасові Шевченку","context_page_description":"Пам'ятники Тарасові Григоровичу Шевченкові встановлені в усіх обласних центрах України, багатьох містах і селах держави, а також у численних столицях і містах за кордоном.\\nПерший пам'ятник Т. Шевченку відкрито у 1881 році до 20-річчя від дня смерті митця у м. Форт-Шевченко під керівництвом І. О. Ускова, який був комендантом Новопетровського укріплення, коли Шевченко перебував там на засланні.\\nВ Україні перший пам'ятник Шевченку встановлено у Харкові у садибі Алчевських у 1881 році.\\nЗагалом, в Україні та світі є 1384 пам'ятники Кобзареві, з них 1256 — в Україні та 128 — за кордоном у 35 країнах. Це найбільша у світі кількість монументів, встановлених діячеві культури. В Україні найбільше пам'ятників встановлено на Прикарпатті."},{"page_url":"https://ca.wikipedia.org/wiki/Regio_I_(Pompeia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Casa_del_Labrum_Dipinto_1.JPG","page_title":"Regio I (Pompeia)","context_page_description":"Llista dels monuments presents a la Regio I de les excavacions arqueològiques de Pompeia. Comprèn la part central del sud de la ciutat, a l'est del Fòrum. Està limitada al nord per la via de l'Abundància, al sud per la muralla entre les portes d'Estàbia i de Nucèria, a l'est per la via de Nucèria i a l'oest per la via Estabiana."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9A%94%EB%82%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Jonah.jpg","page_title":"요나","context_page_description":"요나는 BC 8세기 경 북쪽 이스라엘 왕국의 예언자로 히브리어 성경에 기록된 이름이며, 요나서의 중심 인물로 번역에 따라 다르지만 물고기 또는 고래에 삼켜진 것으로 유명하다. 요나에 대한 성경 이야기는 꾸란에서도 똑같이 나타난다."},{"page_url":"https://en.wikipedia.org/wiki/Alonzo_Horton","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Alonzo_Horton.jpg","page_title":"Alonzo Horton","context_page_description":"Alonzo Erastus Horton was an American real estate developer in the nineteenth century. The Horton Plaza mall in downtown San Diego is named for him."},{"page_url":"https://fr.wikipedia.org/wiki/Eug%C3%A9nie_Basti%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Versailles_-_Eug%C3%A9nie_Basti%C3%A9_-_1.jpg","page_title":"Eugénie Bastié","context_page_description":"Eugénie Bastié, née le 18 novembre 1991 à Toulouse, est une journaliste, polémiste et essayiste française.\\nEmployée au Figaro, elle est également membre fondatrice de la revue d'écologie intégrale d'inspiration chrétienne Limite avant de s'en éloigner. En 2016, elle fait paraître un essai critique du féminisme, Adieu mademoiselle. Conservatrice, elle fait partie d'une génération de jeunes intellectuels catholiques."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_(Schweiz)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Karte_Bezirke_und_Kreise_der_Schweiz_farbig_1990.png","page_title":"Bezirk (Schweiz)","context_page_description":"In der föderalistisch aufgebauten Schweiz ist der Teilstaat völlig frei in seiner internen Organisation. So gibt es auch eine Vielfalt an Organisationsstrukturen und Bezeichnungen für eine Ebene zwischen Kanton und Gemeinde, die auch fehlen kann. Oft wird sie Bezirk, in gewissen Kantonen auch Verwaltungsregion, Verwaltungskreis, Wahlkreis, Amtei oder Amt, im französischsprachigen Landesteil district, im italienischen Landesteil distretto, im rätoromanischen Landesteil districts genannt. Der Leiter eines Bezirksamtes heisst Bezirksammann, Bezirksamtmann, Statthalter oder Regierungsstatthalter.\\nDer Bezirk dient in der Regel lediglich der Dezentralisierung der kantonalen Verwaltung und der Gerichtsorganisation. Im Kanton Schwyz sind dagegen die Bezirke aus historischen Gründen eigene Rechtssubjekte mit Steuerhoheit und teilweiser eigener Landsgemeinde. Eine vergleichbare Rolle spielten früher im Kanton Graubünden die Kreise. Im Kanton Appenzell Innerrhoden ist Bezirk die Bezeichnung für die unterste Verwaltungseinheit, also die politische Gemeinde."},{"page_url":"https://en.wikipedia.org/wiki/Pseudoalcippe","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/African_Hill_Babbler_-_Kenya_S4E9067_%2819493757201%29.jpg","page_title":"Pseudoalcippe","context_page_description":"Pseudoalcippe is a genus of passerine birds in the family Sylviidae that are found in Africa.\\nThe genus was erected by the English ornithologist David Armitage Bannerman in 1923. The type species is the Ruwenzori hill babbler.\\nThe genus contains two species:\\nAfrican hill babbler\\nRwenzori hill babbler\\nThese two species were previously considered as members of the family Timaliidae but molecular phylogenetic studies have shown that they are closely related to species belonging to the genus Sylvia in the family Sylviidae. Some taxonomists now place both species in Sylvia."},{"page_url":"https://de.wikipedia.org/wiki/St._Georg_(L%C3%BCbeck)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/StGeorgL%C3%BCbeckTaufe.jpg","page_title":"St. Georg (Lübeck)","context_page_description":"St. Georg ist eine backsteingotische Dorfkirche in Genin, einem im Landgebiet der Hansestadt Lübeck gelegenen Dorf, das heute als Ortsteil zum Stadtteil Lübeck-St. Jürgen gehört."},{"page_url":"https://id.wikipedia.org/wiki/Distrik_Qingshan,_Wuhan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/%E9%9D%92%E5%B1%B1%E5%85%AC%E5%9B%AD1.JPG","page_title":"Distrik Qingshan, Wuhan","context_page_description":"Distrik Qingshan merupakan salah satu dari urban inti dan 13 distrik di kota setingkat prefektur Wuhan, ibu kota Provinsi Hubei, Tiongkok. Di tepi kanan Sungai Yangtze, berbatasan dengan distrik Wuchang di barat daya dan Hongshan di timur dan selatan, kecuali Pulau Tianxing yang terletak di utara Qingshan; di seberang Sungai Yangtze berbatasan dengan Jiang'an.\\nTahun 2015, Distrik Qingshan membawahi sepuluh subdistrik, satu komite administratif dan satu Kawasan Ekonomi Khusus."},{"page_url":"https://de.wikipedia.org/wiki/Ada-Christen-Gasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Ada-Christen-Gasse_01.JPG","page_title":"Ada-Christen-Gasse","context_page_description":"Die Ada-Christen-Gasse befindet sich im 10. Wiener Gemeindebezirk Favoriten innerhalb der Per-Albin-Hansson-Siedlung Ost. Sie wurde 1968 nach der österreichischen Dichterin Ada Christen benannt."},{"page_url":"https://ca.wikipedia.org/wiki/Mare_de_D%C3%A9u_de_la_Trobada","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Mare_de_D%C3%A9u_de_La_Trobada.JPG","page_title":"Mare de Déu de la Trobada","context_page_description":"La Mare de Déu de la Trobada és una ermita del poble de Montferrer, del municipi Montferrer i Castellbò. Està situada a la vora del riu del seu mateix nom. Està protegida com a bé cultural d'interès local."},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_Congres_van_Chili","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/C%C3%A1mara_de_Senadores_de_Chile-1918.jpg","page_title":"Nationaal Congres van Chili","context_page_description":"Het Congreso Nacional de Chile is de benaming van het parlement van de Republiek Chili en vormt als zodanig de wetgevende macht van het land.\\nHet Congres werd op 4 juli 1811 gesticht en bestaat uit de Cámara de Diputados met 120 leden en de Senado met 38 leden.\\nDe organisatie van het Nationaal Congres en haar bevoegdheden worden geregeld in de artikelen 42 t/m 59 van de huidige grondwet en de Constitutionele Organieke Wet No. 18.918. Het Congres komt samen in het gebouw dat tijdens de laatste jaren van de regering van Pinochet werd gebouwd in Valparaíso, de belangrijkste havenstad van het land. Valparaíso is echter niet de hoofdstad van het land, dat is Santiago, waar het parlement tot 1990 vergaderde, waar thans nog het voormalige neoclassicistische parlementsgebouw uit 1901 staat."},{"page_url":"https://en.wikipedia.org/wiki/The_Hunt_of_the_Unicorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/The_Hunt_of_the_Unicorn_Tapestry_1.jpg","page_title":"The Hunt of the Unicorn","context_page_description":"The Hunt of the Unicorn or the Unicorn Tapestries is one of the most famous and spectacular but enigmatic survivors of the late Middle Ages. This series of seven tapestries now in The Cloisters in New York was possibly made – or at least designed – in Paris at the turn of the sixteenth century. They are one of the canonical works of Late Middle Ages/Early Renaissance art and show a group of noblemen and hunters in pursuit of a unicorn through an idealised French landscape. The tapestries were woven in wool, metallic threads, and silk. The vibrant colours, still evident today, were produced from dye plants: weld, madder, and woad.\\nFirst recorded in 1680 in the Paris home of the de la Rochefoucauld family, the tapestries were looted at the French Revolution. Rediscovered in a barn in the 1850s, they were hung at the family's Château de Verteuil. Since then they have been the subject of intense scholarly debate about the meaning of their iconography, the identity of the artists who designed them, and the sequence in which they were meant to be hung."},{"page_url":"https://en.wikipedia.org/wiki/Urraca_of_Zamora","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/C%C3%A1liz_de_Do%C3%B1a-Urraca.jpg","page_title":"Urraca of Zamora","context_page_description":"Urraca of Zamora was a Leónese infanta, one of the five children of Ferdinand I the Great, who received the city of Zamora as her inheritance and exercised palatine authority in it. Her story was romanticized in the cantar de gesta called the Cantar de Mio Cid, and Robert Southey's Chronicle of the Cid."},{"page_url":"https://cs.wikipedia.org/wiki/Volby_do_Poslaneck%C3%A9_sn%C4%9Bmovny_Parlamentu_%C4%8Cesk%C3%A9_republiky_2017","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Petr_Mach%2C_200901%2C_Svobodn%C3%AD%2C_12.jpg","page_title":"Volby do Poslanecké sněmovny Parlamentu České republiky 2017","context_page_description":"Volby do Poslanecké sněmovny Parlamentu České republiky v roce 2017 se uskutečnily 20. a 21. října. Ve volbách zvítězilo hnutí ANO 2011, které získalo 29,64 % hlasů a 78 mandátů. Na druhém místě skončila ODS, jež získala 11,32 % a 25 poslanců. Následovaná byla na třetím místě Českou pirátskou stranou s 10,79 % a na čtvrtém místě SPD s 10,64 %. Obě tyto strany získaly shodně 22 mandátů. V poslanecké sněmovně ještě zasedli zástupci KSČM, ČSSD, KDU-ČSL, TOP 09 a Starostů a nezávislých. Volební účast činila 60,84 % z celkového počtu 8 374 501 registrovaných voličů.\\nObčané České republiky, kteří dosáhli 18 let a nebyli omezeni ve svéprávnosti k výkonu volebního práva, zvolili 200 poslanců do Poslanecké sněmovny, dolní komory Parlamentu České republiky, pomocí systému poměrného zastoupení. Obyvatelé ČR mohli volit i mimo místo svého trvalého bydliště, museli si ale včas vyřídit voličský průkaz.\\nOd roku 1996 šlo o sedmé volby do Poslanecké sněmovny. Kandidovalo 31 stran a hnutí, tedy o 7 více, než při minulých předčasných volbách v roce 2013. Celkem bylo navrženo 7 524 kandidátů a 2 154 z nich byly ženy. Do sněmovny se nakonec dostalo 9 uskupení."},{"page_url":"https://en.wikipedia.org/wiki/Cure_Cottages_of_Saranac_Lake","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Smith_Cottage%2C_Saranac_Lake%2C_NY.jpg","page_title":"Cure Cottages of Saranac Lake","context_page_description":"Between 1873 and 1945, Saranac Lake, New York became a world-renowned center for the treatment of tuberculosis, using a treatment that involved exposing patients to as much fresh air as possible under conditions of complete bed-rest. In the process, a specific building type, the \\"Cure Cottage\\", developed, built by residents seeking to capitalize on the town's fame, by physicians, and often by the patients themselves. Many of these structures are extant, and their historic value has been recognized by listing on The National Register of Historic Places."},{"page_url":"https://sv.wikipedia.org/wiki/Orhei","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/AIRM_-_Roman_Catholic_church_in_Orhei_-_nov_2012_-_04.jpg","page_title":"Orhei","context_page_description":"Orhei är en stad i distriktet Orhei i Moldavien. Den hade 21 065 invånare. Staden ligger omkring 40 kilometer norr om Chișinău.\\nOrdet Orhei betyder fästning på rumänska, men namnet härstammar troligen från ungerskans Őrhely, då det var ungrarna som först lät befästa området under 1200-talet."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8A%A4%EC%9B%A8%EB%8D%B4%EC%9D%98_%EA%B5%AD%EC%9E%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Great_coat_of_arms_of_Sweden.svg","page_title":"스웨덴의 국장","context_page_description":"스웨덴의 국장은 1448년에 제정되었으며 현재의 국장은 1905년 11월 17일에 수정되었다.\\n왕관이 올려진 망토 가운데에는 방패가 그려져 있다. 방패 왼쪽 상단과 오른쪽 하단에는 스웨덴의 소형 국장이 그려져 있으며 방패 위에는 왕관이 올려져 있다. 방패 양쪽에는 두 마리의 사자가 그려져 있으며 방패 가운데에는 스웨덴 왕실의 문장이 그려져 있다."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Saumur","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Saumur_Maison-du-roi.JPG","page_title":"Liste des monuments historiques de Saumur","context_page_description":"Cet article recense les monuments historiques de Saumur, en France."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AC%AC%E6%AF%94%E5%88%A9%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Tbilisi_sunset-6.jpg","page_title":"第比利斯","context_page_description":"第比利斯，是今日格鲁吉亚的首都，也是外高加索地区的著名古都。据2010年统计数字，第比利斯市区人口达1,152,500人。"},{"page_url":"https://ca.wikipedia.org/wiki/Mihai_Eminescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Mihai_Eminescu_signature.png","page_title":"Mihai Eminescu","context_page_description":"Mihai Eminescu. De nom original Mihail Eminovici, va ser un poeta romàntic tardà, el més conegut i influent poeta romanès, admirat tant a Romania com a Moldàvia. Entre els poemes més famosos s'hi troben Luceafărul, Odă în metru antic, i cinc Scrisori. Eminescu fou actiu participant de la societat literària Junimea, i treballà també com a editor de Timpul, el diari oficial del partit conservador."},{"page_url":"https://sv.wikipedia.org/wiki/Syngrapha_selecta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Syngrapha_selecta.jpg","page_title":"Syngrapha selecta","context_page_description":"Syngrapha selecta är en fjärilsart som beskrevs av Walker 1857. Syngrapha selecta ingår i släktet Syngrapha och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://vi.wikipedia.org/wiki/Vii%C8%99oara,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Biserica_reformata_din_Viisoara_%285%29.JPG","page_title":"Viișoara, Cluj","context_page_description":"Viișoara là một xã thuộc hạt Cluj, România. Dân số thời điểm năm 2002 là 5870 người."},{"page_url":"https://sl.wikipedia.org/wiki/Fornebu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Fornebu.jpg","page_title":"Fornebu","context_page_description":"Fornebu je polotok na zahodnem delu norveškega glavnega mesta Oslo.\\nNa polotoku so v letih 1939 in 1940 zgradili letališče, z nazivom letališče Oslo, Fornebo. Med drugo svetovno vojno so letališče, v ostrem spopadu z norveško vojsko, zavzeli nemški padalci. Tega je vse do konca vojne uporabljala nemška Luftwaffe. Po vojni je bilo predano v civilno uporabo. Letališče je služilo svojemu namenu vse do 7. oktobra 1998, ko so ga zaradi pomanjkanja prostora zaprli, letalski promet pa preselili na novo zgrajeno letališče Gardermoem.\\nNa prehodu v novo tisočletje so letališče na polotoku porušili prostor pa namenili za razvoj informacijske tehnologije in telekomunikacijski industriji."},{"page_url":"https://tr.wikipedia.org/wiki/%C3%87ankaya_(%C4%B0zmir_metrosu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/%C3%87ankaya_metro_station_01.jpg","page_title":"Çankaya (İzmir metrosu)","context_page_description":"Çankaya Metro İstasyonu, İzmir metrosu'nun M1 hattında yer alan ve 22 Mayıs 2000 tarihinde hizmete giren metro istasyonudur.\\nİstasyon, İzmir'in merkezi konumundaki Konak ilçesi sınırlarında yer almaktadır. İstasyonun giriş/çıkış noktaları Fevzi Paşa Bulvarı üzerinde olup, istasyonun yakınlarında İzmir Agorası, Tarihi Kemeraltı Çarşısı ve Yeni Kavaflar Çarşısı yer almaktadır. İstasyonun inşaatı sırasında bulunan bazı arkeolojik kalıntılar istasyonun içinde sergilenmektedir.\\nİstasyon, gelecekte yapımı planlanan M3 Metro Hattı'na da hizmet verecektir."},{"page_url":"https://fr.wikipedia.org/wiki/Marine_de_guerre_hell%C3%A9nique","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/RHS_Lemnos.jpg","page_title":"Marine de guerre hellénique","context_page_description":"La marine de guerre hellénique est la force navale des forces armées grecques, fondée de facto en 1821 et officiellement en 1828, en tant que force officielle de l’État.\\nLa marine grecque moderne prend ses racines dans les forces maritimes des différentes îles de la mer Égée, qui ont combattu durant la guerre d'indépendance grecque. Pendant les périodes de la monarchie, elle portait le nom de Marine Royale.\\nCependant, l'histoire de la marine grecque existe déjà dans les récits d'Homère, \\"l'Iliade et l’Odyssée\\", datés du VIᵉ siècle av. J.-C.. En effet, à l'occasion de la guerre de Troie, il est fait état d'une expédition qui est « la première expédition navale panhellénique ».\\nLa devise de la marine grecque est « Μέγα το της θαλάσσης κράτος ». Il s'agit d'une citation de Thucydide rapportant le discours prononcé par Périclès à la veille de la guerre du Péloponnèse, signifiant « C'est une chose importante que la maîtrise de la mer ». L'emblème de la marine hellénique se compose d'une ancre sur laquelle se croisent la croix chrétienne et le trident : la croix symbolisant l'orthodoxie grecque et le trident symbolisant Poséidon, le dieu de la mer dans la mythologie grecque."},{"page_url":"https://hu.wikipedia.org/wiki/William_Gibson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/William_Gibson_60th_birthday_portrait.jpg","page_title":"William Gibson","context_page_description":"William Ford Gibson amerikai–kanadai író.\\nJelenleg Kanadában, Vancouverben él. Írói hírnevét az 1980-as évek közepén tudományos-fantasztikus irodalomban szerezte meg mára már kultikusnak számító regényével, a Neurománccal. Az ezredforduló utáni műveiben a tudományos-fantasztikus eszközök helyett inkább kortárs megoldásokat alkalmaz. Munkásságát egyedien részletdús, kifinomult ábrázolások, erőteljes víziók, szerteágazó és egymásba fonódó cselekményszálak és a technológiai-társadalmi kölcsönhatások több rétegű elemzése és újrafogalmazása jellemzi."},{"page_url":"https://en.wikipedia.org/wiki/G350.1-0.3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/G350.1-0.3_%28NASA%29.jpg","page_title":"G350.1-0.3","context_page_description":"G350.1-0.3 is a supernova remnant which is located in the constellation Scorpius. It is in the Milky Way, and possibly associated with a neutron star formed in the same supernova explosion. The object was formerly mistakenly classified as a distant galaxy.\\nG350.1-0.3, a bright radio source in the inner Milky Way, was initially identified by comparing observations from the Molonglo Observatory Synthesis Telescope and Parkes Observatory and classified as a supernova remnant in publications from 1973 and 1975. However, later higher-resolution images in the mid-80s revealed an unexpected irregular morphology that differed substantially from other supernova remnant sources. It was then argued that G350.1-0.3 was a radio galaxy or a galaxy cluster, resulting in a reclassification in which supernova remnant catalogues downgraded the object to \\"supernova remnant candidate\\" or dropped it completely; G350.1-0.3 was subsequently \\"forgotten\\".\\nResearch published in 2008 combined archival data and new images from XMM-Newton, the European Space Agency's orbiting x-ray telescope, to demonstrate that G350.1-0.3 is a supernova remnant."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BD%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%D0%9D%D0%B0%D1%86%D1%8B%D1%8F%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B_%D0%B0%D0%BA%D0%B0%D0%B4%D1%8D%D0%BC%D1%96%D1%87%D0%BD%D1%8B_%D0%92%D1%8F%D0%BB%D1%96%D0%BA%D1%96_%D1%82%D1%8D%D0%B0%D1%82%D0%B0%D1%80_%D0%BE%D0%BF%D1%8D%D1%80%D1%8B_%D1%96_%D0%B1%D0%B0%D0%BB%D0%B5%D1%82%D1%83_%D0%B3._%D0%9C%D0%B5%D0%BD%D1%81%D0%BA_2.jpg","page_title":"Менск","context_page_description":"Менск — сталіца і найбольшае места Беларусі, на рацэ Сьвіслачы пры ўтоку ў яе ракі Нямігі. Адміністрацыйны цэнтар Менскай вобласьці і Менскага раёну, аднак не ўваходзіць у іх склад. Геаграфічныя каардынаты: 53° 54' 8\\" пн. ш., 27° 33' 41\\" у. д. Плошча 348,85 км². Насельніцтва на 2020 год — 2 020 600 чалавек. Знаходзіцца за 70 км на паўночны захад ад геаграфічнага цэнтру Беларусі. Вузел чыгунак на Берасьце, Вільню, Гомель, Маскву, аўтамабільных дарог на Воршу, Віцебск, Лагойск, Маладэчна, Ашмяны, Берасьце, Слуцак, Гомель, Магілёў і іншыя.\\nМенск — даўняе маґдэбурскае места і цэнтар гістарычнага рэґіёну. Належыць да ліку старадаўніх местаў Усходняй Эўропы. Сталіца ўдзельнага княства, найбольшага ў Вялікім Княстве Літоўскім ваяводзтва і Беларускай Народнай Рэспублікі. У наш час палітычны, эканамічны, сацыяльны, культурны і навуковы цэнтар Беларусі."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Tropez","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Sainttropez-4-big.jpg","page_title":"Saint-Tropez","context_page_description":"Saint-Tropez es una localidad y comuna francesa ubicada en el departamento de Var, en la región de Provenza-Alpes-Costa Azul. Es uno de los centros turísticos más importantes de la Costa Azul."},{"page_url":"https://de.wikipedia.org/wiki/Bravest_Warriors","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bravest_Warriors_Promo_Poster.png","page_title":"Bravest Warriors","context_page_description":"Bravest Warriors ist eine US-amerikanische Zeichentrickserie von Pendleton Ward. Die Serie, die im Jahr 3085 spielt, folgt vier jugendlichen Helden, die durch das Universum fliegen und mit der Kraft ihrer Emotionen außerirdische Wesen und ihre Welten retten."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%99%BD%E5%AE%AB%E5%9C%B0%E5%9B%BE%E5%AE%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/WHGmap.png","page_title":"白宫地图室","context_page_description":"白宫地图室是一个位于美国总统府白宫内西翼地下的房间。地图室命名于二次世界大战。当时的总统富兰克林·罗斯福使用这个房间摆放地图，以观察战局发展。相对于白宫的椭圆形办公室，地图室是一个非正式的办公室，并通常作电视录影、茶聚及社交用途。"},{"page_url":"https://hu.wikipedia.org/wiki/Camptosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/CamptoSkull.jpg","page_title":"Camptosaurus","context_page_description":"A Camptosaurus a csőrős növényevő dinoszauruszok egyik neme, amely a késő jura és kora kréta időszakban élt."},{"page_url":"https://nl.wikipedia.org/wiki/Gyrodactylus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Gyrodactylus_sp.jpg","page_title":"Gyrodactylus","context_page_description":"Gyrodactylus is een parasitaire platworm uit het fylum van de platwormen en de klasse Monogenea. Gyrodactylus komt veel voor bij vijvervissen zoals Koi en goudvissen. Men treft deze parasiet meestal in vervuilde of overbezette vijvers aan.\\nGyrodactylus is een soort uit het geslacht van levendbarende huidwormen. Dit geslacht kan worden verward met verwante parasieten uit het geslacht Dactylogyrus uit de familie Dactylogyridae. Deze soorten zijn niet levendbarende maar eierleggende wormen, die kieuwwormen genoemd worden. Met behulp van een goede microscoop en de juiste vergroting kan men tot 4 generaties in de worm waarnemen, om de 20 minuten wordt er een worm geboren. Men komt hem tegen op de huid van de vis maar vooral rond de kieuwen."},{"page_url":"https://es.wikipedia.org/wiki/Axel_Kicillof","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Firma_Axel_Kicillof_transparente.png","page_title":"Axel Kicillof","context_page_description":"Axel Kicillof​ es un economista, político, docente e investigador argentino de carácter keynesiano.​​ Desde el 11 de diciembre de 2019 es el gobernador de la provincia de Buenos Aires por la coalición electoral Frente de Todos. Anteriormente ejerció como ministro de Economía de la Nación Argentina entre 2013 y 2015. Además, se desempeñó como diputado nacional por la Ciudad de Buenos Aires.\\nPreviamente fue designado por la entonces presidenta Cristina Fernández de Kirchner para el cargo de secretario de Política Económica y Planificación del Desarrollo del Ministerio de Economía y Finanzas Públicas. Fue sub-interventor de YPF hasta la sanción de la Ley de Soberanía Hidrocarburífera y desde junio de 2012, tras la recuperación de la empresa por parte del Estado nacional, se desempeñó como director titular de clase «A».​ Presidió también la comisión de Planificación y Coordinación Estratégica del Plan Nacional de Inversiones Hidrocarburíferas, e integró el Comité Ejecutivo del Programa PROCREAR. Desde julio de 2009, fue CEO de Aerolíneas Argentinas y a partir de 2011, subgerente general.​"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%98%D9%88%D8%A6%D9%84_%D8%AF%DB%8C%DA%A9%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/PR_0044_JoelDicker_crop.JPG","page_title":"ژوئل دیکر","context_page_description":"ژوئل دیکر یک نویسنده، و رمان‌نویس اهل سوئیس است. وی برنده جوایزی همچون جایزه بزرگ رمان فرهنگستان فرانسه شده‌است.\\nاز میان آثار وی، رمانهای «حقیقت ماجرای هری کبر» و «ماجرای ناپدید شدن استفانی ملر» توسط چند مترجم به فارسی برگردانده شده‌است."},{"page_url":"https://lt.wikipedia.org/wiki/Douglas_Holding","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Douglas_Logo_Aqua.png","page_title":"Douglas Holding","context_page_description":"Douglas Holding AG – Vokietijos mažmeninės prekybos parfumerijos bendrovė. Būstinė – Hagenas. Tinklas vienija apie 1 528 parduotuvių."},{"page_url":"https://pt.wikipedia.org/wiki/Adolf_von_Donndorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Charles_Augustus_statue.jpg","page_title":"Adolf von Donndorf","context_page_description":"Adolf von Donndorf foi um escultor alemão."},{"page_url":"https://ro.wikipedia.org/wiki/Ariano_Irpino","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Ariano_Irpino-Stemma.png","page_title":"Ariano Irpino","context_page_description":"Ariano Irpino este o comună din provincia Avellino, regiunea Campania, Italia, cu o populație de 23.134 de locuitori și o suprafață de 186.74 km²."},{"page_url":"https://en.wikipedia.org/wiki/Santa_Ana_River","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/SAR-Mainstem-Map_med.jpg","page_title":"Santa Ana River","context_page_description":"The Santa Ana River is the largest river entirely within Southern California in the United States. It rises in the San Bernardino Mountains and flows for most of its length through San Bernardino and Riverside Counties, before cutting through the northern Santa Ana Mountains via Santa Ana Canyon and flowing southwest through urban Orange County to drain into the Pacific Ocean. The Santa Ana River is 96 miles long, and its drainage basin is 2,650 square miles in size.\\nThe Santa Ana drainage basin has a diversity of terrain, ranging from high peaks of inland mountains in the north and east, to the hot, dry interior and semi-desert basins of the Inland Empire, to the flat coastal plain of Orange County. Although it includes areas of alpine and highland forest, the majority of the watershed consists of arid desert and chaparral environments. Due to low regional rainfall, the river carries only a small flow except during the brief winter season, when it is prone to massive flash floods. The San Jacinto River, which drains the southern half of the watershed, rarely reaches the Santa Ana except in extremely wet years."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_im_Hopfengarten_(Magdeburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Birkenweg_7_%28Magdeburg%29.jpg","page_title":"Liste der Kulturdenkmale im Hopfengarten (Magdeburg)","context_page_description":"In der Liste der Kulturdenkmale im Hopfengarten sind alle Kulturdenkmale des zur Stadt Magdeburg gehörenden Stadtteils Hopfengarten aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 erstellt und seither laufend ergänzt wurde."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A7%9A%E5%8D%83%E6%88%B8%E5%B1%AF%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Flag_of_the_People%27s_Republic_of_China.svg","page_title":"姚千戸屯駅","context_page_description":"姚千戸屯駅は中華人民共和国遼寧省瀋陽市蘇家屯区にある、中国鉄路総公司瀋丹線の駅。1905年に開業。瀋陽駅から47km、丹東駅から223kmの位置にある。瀋陽鉄道局所属の四等駅に設定されている。"},{"page_url":"https://es.wikipedia.org/wiki/Santa_Gertrudis_Cop%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Santa_Gertrudis_Cop%C3%B3%2C_Yucat%C3%A1n_%2801%29.JPG","page_title":"Santa Gertrudis Copó","context_page_description":"Santa Gertrudis Copó es una subcomisaría del municipio de Mérida en el estado de Yucatán localizado en el sureste de México."},{"page_url":"https://cy.wikipedia.org/wiki/Oblast_Sakhalin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Sakhalin_in_Russia_%28claimed%29.svg","page_title":"Oblast Sakhalin","context_page_description":"Un o oblastau Rwsia yw Oblast Sakhalin. Ei chanolfan weinyddol yw dinas Yuzhno-Sakhalinsk. Poblogaeth: 497,973.\\nLleolir Oblast Sakhalin yn ardal weinyddol Dosbarth Ffederal y Dwyrain Pell. Mae'r oblast yn cynnwys ynys Sakhalin a'i hynysoedd llai, yn cynnwys Ynysoedd Kuril, oddi ar arfordir Dwyrain Pell Rwsia. I'r de-orllewin ceir Môr Okhotsk tra mae'r Cefnfor Tawel yn ymestyn i'r dwyrain. Ceir sawl llosgfynydd yn yr oblast.\\nSefydlwyd yr oblast yn 1947 yn yr hen Undeb Sofietaidd,"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Recorded_Texas_Historic_Landmarks_(Hunt-Martin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Giddings-tx2016-12%28fletcher-home%29.jpg","page_title":"List of Recorded Texas Historic Landmarks (Hunt-Martin)","context_page_description":"The following is a partial list of Recorded Texas Historic Landmarks arranged by county as designated by the Texas Historical Commission and local county historical commissions in Texas. This page includes RTHLs in the following counties: Hunt, Hutchinson, Irion, Jack, Jackson, Jasper, Jeff Davis, Jefferson, Jim Hogg, Jim Wells, Johnson, Jones, Karnes, Kaufman, Kendall, Kenedy, Kent, Kerr, Kimble, King, Kinney, Kleberg, Knox, La Salle, Lamar, Lamb, Lampasas, Lavaca, Lee, Leon, Liberty, Limestone, Lipscomb, Live Oak, Llano, Loving, Lubbock, Lynn, Madison, Marion, and Martin.\\nKEY\\nLandmarks with multiple historic designations are colored according to their highest designation within the following hierarchy."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%9B%9B%E6%87%89%E6%9C%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Sheng_Yingqi.jpg","page_title":"盛應期","context_page_description":"盛应期，字思征，南直隶苏州府吴江县人。明朝政治人物。弘治六年进士，历仕三朝，几经起落。官至右副都御史。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%D7%9E%D7%99%D7%93%D7%99_%D7%97%D7%91%D7%A8%D7%95%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Normal_Pattern_friendship_bracelet.gif","page_title":"צמידי חברות","context_page_description":"צמיד חברות הוא צמיד שניתן לאדם כסמל לחברות. על אף שהגדרה זו אינה כוללת את האופן בו צמיד נעשה או את החומר ממנו עשוי, לרוב מדובר בעבודת מקרמה שנעשית בחוטי רקמה. צמידים אלו יכולים להיות בכל רוחב, עשויים מכל סוגי החוטים וקשורים בטכניקות שונות. לעיתים מכילים הצמידים חרוזים וכפתורים, ולעיתים מוצרים אחרים כמו מחזיקי מפתחות, תיקים וחגורות נוצרים בהתבסס על שיטות הקשירה האופייניות לצמידים."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%84%E0%B8%82%E0%B9%88%E0%B8%9F%E0%B8%B2%E0%B9%81%E0%B8%9A%E0%B8%A3%E0%B9%8C%E0%B9%80%E0%B8%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Cloveregg2.jpg","page_title":"ไข่ฟาแบร์เช","context_page_description":"ไข่ฟาแบร์เช คือหนึ่งในงานตกแต่งอัญมณีรูปไข่ที่สร้างโดยห้องงานอัญมณีฟาแบร์เช ระหว่างปี ค.ศ. 1885 จนถึงปี ค.ศ. 1917 งานส่วนใหญ่เป็นงานชิ้นเล็กที่เหมาะกับการให้เป็นของขวัญสำหรับเทศกาลอีสเตอร์\\nแต่ไข่ฟาแบร์เชที่มีชื่อเสียงที่สุดที่สร้างโดยห้องงานอัญมณีเป็นงานชิ้นใหญ่ที่สร้างให้แก่ซาร์อเล็กซานเดอร์ที่ 3 และ ซาร์นิโคลัสที่ 2 แห่งรัสเซีย ที่มีด้วยกันทั้งหมด 50 ชิ้น และ 43 ชิ้นได้ค้นพบแล้ว อีกสองชิ้นสร้างแล้วเสร็จ 1 ใบ อีกใบยังไม่เสร็จ ได้แก่ กลุ่มดาวสีน้ำเงินแห่งซาเรวิช และ คาเรเลียนเบิร์ช สำหรับปี ค.ศ. 1917\\nไข่ใบใหญ่เจ็ดใบสร้างให้แก่นักอุตสาหกรรมอเล็กซานเดอร์ เคลช์แห่งมอสโก\\nไข่ทำจากโลหะมีค่าหรือหินแข็งตกแต่งด้วยอัญมณีและการลงยา คำว่า “ไข่ฟาแบร์เช” มีความหมายเดียวกับความหรูหรา และถือกันว่าเป็นงานอัญมณีชั้นหนึ่ง “ไข่ฟาแบร์เช” ของราชวงศ์รัสเซียถือว่าเป็นกลุ่มงานศิลปะชิ้นเอก ที่ได้รับการจ้างชิ้นสุดท้าย"},{"page_url":"https://es.wikipedia.org/wiki/Museo_provincial_de_Estocolmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Stockholms_l%C3%A4ns_museum_utst%C3%A4llning_2014a.jpg","page_title":"Museo provincial de Estocolmo","context_page_description":"El Museo provincial de Estocolmo – en sueco: Stockholms läns museum – es un museo dirigido a ”mostrar a la herencia cultural, el arte y la historia de la provincia de Estocolmo”. Está situado en la ciudad de Estocolmo.​\\nEl museo dispone de una exposición permanente y exhibe exposiciones temporales en varias localidades de la provincia, con la salvedad de la propia ciudad de Estocolmo.​​\\nEstá en curso una reorganización completa del museo, con el abandono del edificio actual, la concentración de exposiciones itinerantes y el aumento de actividades digitales.​"},{"page_url":"https://fr.wikipedia.org/wiki/Suria_KLCC","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/SuriaKLCC-Park.JPG","page_title":"Suria KLCC","context_page_description":"Suria KLCC est un centre commercial de Kuala Lumpur, en Malaisie. Il est situé au pied des tours Petronas."},{"page_url":"https://de.wikipedia.org/wiki/Krautheim_(Volkach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/1_Brauerei_D%C3%BCll%2C_Krautheim_2.jpg","page_title":"Krautheim (Volkach)","context_page_description":"Krautheim ist ein Ortsteil der Stadt Volkach im bayerischen Landkreis Kitzingen in Unterfranken. Krautheim war bis zum freiwilligen Zusammenschluss mit Volkach am 1. Januar 1977 eine selbstständige Gemeinde. Historisch war das Dorf lange Zeit Teil der Grafschaft Castell. Die Casteller Grafen führten im 16. Jahrhundert die Reformation ein und Krautheim ist bis heute überwiegend evangelisch-lutherisch.\\nKrautheim liegt abseits der großen Touristen-Zentren an der Volkacher Mainschleife. Nur wenige Baudenkmäler haben sich erhalten. Neben der Kirche steht ein kleines Schloss, das von den Herren von Buttlar bewohnt wurde. Anders als in der Umgebung spielt der Weinbau nur eine untergeordnete Rolle, in Krautheim gibt es die Privatbrauerei Friedrich Düll"},{"page_url":"https://hu.wikipedia.org/wiki/TEP70","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/DieselLoco_tep70-0294.jpg","page_title":"TEP70","context_page_description":"A TEP70 szovjet Co'Co' tengelyelrendezésű személyvonati dízelmozdonysorozat. Összesen kb. 350 db épült belőle 1973 és 2006 között a Kolomnai mozdonygyárban. Jelenleg Oroszországban, Kazahsztánban, Fehéroroszországban, Ukrajnában, Lettországban, Litvániában és Észtországban használják."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BD%94%EB%93%9C_39","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Code_3_of_9.svg","page_title":"코드 39","context_page_description":"코드 39는 가변 길이의 개별 바코드 입니다.\\n코드 39 는 대문자, 숫자 및 특수 문자 로 구성된 43자를 정의합니다. 추가 글자는 시작 구분 기호와 종료 구분 문자 모두에 사용됩니다. 각 문자는 9 개의 요소로 구성됩니다: 5 개의 막대와 4 개의 공백. 각 문자의 9 개 요소 중 3 개는 넓고 6 개 요소는 좁습니다. 너비와 너비 간의 너비 비율은 중요하지 않으며 1: 2에서 1: 3 사이에서 선택할 수 있습니다.\\n바코드 자체에는 확인 숫자가 포함되지 않지만, 잘못 해석 된 단일 막대가 다른 유효한 문자를 생성 할 수 없다는 이유로 자체 검사로 간주 될 수 있습니다. 코드 39의 가장 심각한 단점은 낮은 데이터 밀도입니다. 예를 들어 코드 128보다 코드 39에서 데이터를 인코딩하는 데 더 많은 공간이 필요합니다. 즉, 아주 작은 제품에는 코드 39 기반 바코드로 레이블을 지정할 수 없습니다. 그러나, 비록 코드 39는 여전히 몇몇 우편 서비스에 의해 사용됩니다., 거의 모든 바코드 리더 로 디코드 할 수 있습니다.. 코드 39의 장점 중 하나는 체크 디지트를 생성 할 필요가 없기 때문에 바코드 글꼴을 시스템이나 프린터에 추가 한 다음 해당 글꼴로 원시 데이터를 인쇄하여 기존 인쇄 시스템에 쉽게 통합 할 수 있다는 것입니다.\\nCode 39는 1974 년 David Allais 와 Intermec의 Ray Stevens가 개발했습니다. 그들의 원래 디자인은 두 개의 넓은 막대와 각 문자에 하나의 넓은 공간을 포함하여 40 개의 가능한 문자를 만들었습니다. 이 문자 중 하나를 시작 및 중단 패턴으로 남겨두면 39 자가 남았습니다.이 문자는 Code 39라는 이름의 기원이었습니다. 나중에 4 개의 구두점 문자가 추가되어 넓은 막대와 3 개의 넓은 공백을 사용하지 않고 문자 세트를 43 자로 확장했습니다. Code 39는 나중에 ANSI MH 10.8 M-1983 및 MIL-STD-1189로 표준화되었습니다. 그리고 MIL-STD-1189는 취소되고 ANSI / AIM BC1 / 1995, 통일 기호 표준 - 코드 39로 대체되었습니다."},{"page_url":"https://de.wikipedia.org/wiki/Stadtbefestigung_Nienburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Stadt_und_Festung_Nienburg_um_1650.png","page_title":"Stadtbefestigung Nienburg","context_page_description":"Die Stadtbefestigung Nienburg war ein System von Verteidigungsanlagen der Stadt Nienburg/Weser, das sie vom Mittelalter bis Anfang des 19. Jahrhunderts vor Angriffen schützte. Dazu gehörten eine mittelalterliche Stadtmauer mit Stadttoren sowie Wälle und Wassergräben. Einbezogen in die Befestigungsanlage war die von den Grafen von Hoya als Wasserburg erbaute Nienburg, die später zum Schloss Nienburg umgestaltet wurde. Im 17. Jahrhundert wurde Nienburg zu einer Bastionärsbefestigung ausgebaut und in eine Landesfestung des Fürstentums Lüneburg und späteren Kurfürstentums Hannover umgewandelt. In den napoleonischen Kriegen ging die Festung im Jahr 1806 an französische Truppen über und wurde auf Napoleons Befehl geschleift. Hauptsächliche Überbleibsel der Festungsanlagen sind Wälle, Wasserläufe sowie Reste von Stein- und Erdwerken."},{"page_url":"https://en.wikipedia.org/wiki/Daphnella_ornata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Daphnella_ornata_001.jpg","page_title":"Daphnella ornata","context_page_description":"Daphnella ornata is a species of sea snail, a marine gastropod mollusk in the family Raphitomidae."},{"page_url":"https://cs.wikipedia.org/wiki/AY-3-8912","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/YM2149_01.jpg","page_title":"AY-3-8912","context_page_description":"AY-3-891x je řada zvukových čipů vyvinutých v 80. letech 20. století firmou General Instruments. Později výrobu převzala firma Microchip a ještě později, na přelomu 20.-21. století, pak firma Micrel. Pod označením YM2149 jej také vyráběla firma Yamaha. Obvody AY se používaly pro generování hudby v herních konzolích a také v počítačích ZX Spectrum 128K, TS 2068, Amstrad CPC a Atari ST. Dalším ekvivalentem je obvod M5255 japonské firmy OKI. U tohoto obvodu je zajímavé, že obsah vnitřních registrů není vynulován signálem RESET, také zde nelze softwarově vyčíst obsah registrů hlasitosti, díky čemuž např. nefungují různé efektní indikátory v hudebních demech na počítači ZX Spectrum."},{"page_url":"https://et.wikipedia.org/wiki/Jumestuskunstnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/A_pretty_woman_in_studio.jpg","page_title":"Jumestuskunstnik","context_page_description":"Jumestuskunstnik kujundab jumestuse abil inimeste välimust. Tavaliselt on tema ülesanne tuua esile inimese isikupära, kuid ka korrigeerida iluvead; samuti võib jumestuskunstnik aidata inimese välimust muuta.\\nKuna jumestuskunstnik kavandab ja teeb jumestust, peab ta tundma tänapäevaseid jumestustooteid ja -tehnikaid ning moesuundi. Tihti korraldavad jumestuskunstnikud näitlikke esitlusi ja koolitusi, tutvustavad jumestustooteid ning nõustavad kliente.\\nPaljud jumestuskunstnikud töötavad teatris, televisioonis, filmis, ajakirjades, reklaamis ja moetööstuses. Samas kasutavad jumestuskunstnike teenuseid sageli pruudid, poliitikud ja teised inimesed, kes valmistuvad pidulikeks puhkudeks, kus nende välimusele pööratakse suurt tähelepanu."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%DB%8C%D9%BE%D8%B3%D8%AA%D9%88%D9%86%D8%8C_%D9%85%DB%8C%D9%86%D9%87%E2%80%8C%D8%B3%D9%88%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Main_Street_Pipestone_MN.jpg","page_title":"پایپستون، مینه‌سوتا","context_page_description":"پایپستون، مینه‌سوتا یک شهر در ایالات متحده آمریکا است که در شهرستان پایپستون، مینه‌سوتا واقع شده‌است."},{"page_url":"https://simple.wikipedia.org/wiki/Terry_Gilliam","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Terry_Gilliam_KVIFF.jpg","page_title":"Terry Gilliam","context_page_description":"Terry Gilliam is an American-British cartoonist and filmmaker. He was born in Minnesota and grew up in California, but he now lives in England and is a British citizen.\\nHe was a member of the British comedy team Monty Python. He designed animated sequences and acted in both their TV show and movies. He also directed the movies Jabberwocky, Time Bandits, Brazil, Baron Münchhausen, Fisher King, 12 Monkeys, Fear and Loathing in Las Vegas, and The Brothers Grimm."},{"page_url":"https://en.wikipedia.org/wiki/2013%E2%80%9314_York_City_F.C._season","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Lanre_Oyebanjo_24-08-2013_1.jpg","page_title":"2013–14 York City F.C. season","context_page_description":"The 2013–14 season was the 92nd season of competitive association football and 77th season in the Football League played by York City Football Club, a professional football club based in York, North Yorkshire, England. Their 17th-place finish in 2012–13 meant it was their second consecutive season in League Two. The season ran from 1 July 2013 to 30 June 2014.\\nNigel Worthington, starting his first full season as York manager, made eight permanent summer signings. By the turn of the year York were only above the relegation zone on goal difference, before a 17-match unbeaten run saw the team finish in seventh-place in the 24-team 2013–14 League Two. This meant York qualified for the play-offs, and they were eliminated in the semi-final by Fleetwood Town. York were knocked out of the 2013–14 FA Cup, League Cup and Football League Trophy in their opening round matches.\\n35 players made at least one appearance in nationally organised first-team competition, and there were 12 different goalscorers. Defender Ben Davies missed only five of the 52 competitive matches played over the season."},{"page_url":"https://oc.wikipedia.org/wiki/Lengas_muscog%C3%A8as","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Muskogean_langs.png","page_title":"Lengas muscogèas","context_page_description":"Las lengas muscogèas son una familha de lengas amerindianas parladas al sud-èst dels Estats Units e uèi tamben en Oklahoma per las populacions muscogèas."},{"page_url":"https://es.wikipedia.org/wiki/Kurt_Fearnley","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/301000_-_Athletics_wheelchair_racing_Kurt_Fearnely_waves_-_3b_-_2000_Sydney_race_photo.jpg","page_title":"Kurt Fearnley","context_page_description":"Kurt Harry Fearnley, AO ​ ​ es un corredor de silla de ruedas australiano. Tiene un trastorno congénito llamado agenesia sacra que impidió el desarrollo prenatal de ciertas partes de su columna vertebral inferior y todo su sacro. En los eventos paralímpicos se encuentra en la clasificación T54. Se centra en carreras de sillas de ruedas de larga y media distancia, y también ha ganado medallas en relevos de velocidad. Participó en los Juegos Paralímpicos de 2000, 2004, 2008 y 2012. Terminó su carrera en los Juegos Paralímpicos con medallas de plata y bronce en los Juegos Paralímpicos de Río 2016.​ ​ ​ Ganó una medalla de oro y plata en los Juegos de la Mancomunidad de 2018 y fue el abanderado de Australia en la ceremonia de clausura."},{"page_url":"https://hr.wikipedia.org/wiki/Zlatni_listi%C4%87i","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Burnishing.jpg","page_title":"Zlatni listići","context_page_description":"Zlatni listići proizvode se od zlata koje je posebnim čekićem raskovano do ekstremne tankoće. Listići su tako tanki da propuštaju svijetlo, te se u pravilu koriste za pozlaćivanje. Osim kod izrade novih predmeta koriste se i u konzervaciji restauraciji umjetnina. Proizvode se u velikom broju boja te finoća, a najčešće se koriste 22 karatni listići.\\nOsim listića od zlata proizvode se i listići od bakrenih slitina koje imitiraju boju čistog zlata, te listići od srebra.\\nPozlaćivanje pomoću listića izvodi se najčešće ili uz pomoć ljepljivog laka na bazi lanenog ulja ili na polimentu - posebnoj podlozi koja postaje ljepljiva nakon što je se dovede u dodir sa alkoholom ili vodom. Kod polimentne pozlate se listići na kraju još i ispoliraju pomoću posebno oblikovanog alata od ahata.\\nDanas se zlatni listići nadalje koriste i u kulinarstvu te u alkoholnim pićima."},{"page_url":"https://sk.wikipedia.org/wiki/Subaru_Legacy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Subaru_Legacy_Station_front_20080225.jpg","page_title":"Subaru Legacy","context_page_description":"Legacy je automobil strednej triedy, ktorý od roku 1989 vyrába japonská automobilka Subaru. Model je známy štandardným použítím permanentného náhonu všetkých kolies 4x4. Legacy využíval ploché motory typu boxer."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_antieke_bouwwerken_in_Rome","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Roma%2C_Piazza_di_Pietra_-_Tempio_di_Adriano.JPG","page_title":"Lijst van antieke bouwwerken in Rome","context_page_description":"Dit is een lijst van bouwwerken uit de oudheid in Rome, ingedeeld naar type gebouw.\\nDe lijst bevat de meest bekende gebouwen uit de periode die van het Romeinse Koninkrijk tot de late keizertijd in de 5e eeuw n.Chr. loopt. In deze laatste eeuw werd de laatste Romeinse keizer afgezet en waren christelijke kerken vrijwel de enige monumentale gebouwen die nog werden gebouwd.\\nEen aantal gebouwen is geheel of gedeeltelijk bewaard gebleven, zoals het Pantheon en het Colosseum. De meeste gebouwen zijn echter in de middeleeuwen verdwenen, maar zijn nog bekend uit vermeldingen in antieke of middeleeuwse bronnen."},{"page_url":"https://sv.wikipedia.org/wiki/Gy%C3%B6rgy_Ged%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Gy%C3%B6rgy_Ged%C3%B3.jpg","page_title":"György Gedó","context_page_description":"György Gedó, född den 23 april 1949, är en ungersk boxare som tog OS-guld i lätt flugviktsboxning 1972 i München. Han deltog i hela 4 olympiska spel."},{"page_url":"https://nl.wikipedia.org/wiki/Hyalurga_vinosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Hyalurga_vinosa.JPG","page_title":"Hyalurga vinosa","context_page_description":"Hyalurga vinosa is een beervlinder uit de familie van de spinneruilen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1773 door Drury."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/%D0%97%D0%BD%D0%B0%D1%87%D0%BE%D0%BA_%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80%D0%B0_%D0%A9%D0%98%D0%A2-82.JPG","page_title":"Организация Варшавского договора","context_page_description":"Варша́вский догово́р от 14 мая 1955 года — документ, оформивший создание военного союза европейских социалистических государств при ведущей роли СССР — Организации Варшавского договора и закрепивший биполярность мира на 36 лет. Заключение договора явилось ответной мерой на присоединение ФРГ к НАТО.\\nДоговор подписан Албанией, Болгарией, Венгрией, ГДР, Польшей, Румынией, СССР и Чехословакией 14 мая 1955 года на Варшавском совещании европейских государств по обеспечению мира и безопасности в Европе.\\nЧисленность Вооружённых сил Организации Варшавского договора на 1985 год составила 7 562 987 военнослужащих. В 1990 году численность Организации уменьшилась до 6 960 700 военнослужащих.\\nДоговор вступил в силу 5 июня 1955 года. 26 апреля 1985 года, ввиду истечения срока действия, был продлён на 20 лет.\\nПосле смещения в 1989—1990 годах коммунистических режимов в странах Центральной и Восточной Европы существование Организации Варшавского договора как военно-политического альянса стран социализма потеряло смысл. 25 февраля 1991 года государства-участники ОВД упразднили её военные структуры, а 1 июля 1991 года в Праге подписали Протокол о полном прекращении действия Договора."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8F%B4%EB%9E%80%EB%93%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/%C5%81a%C5%84ctut_Zamek.jpg","page_title":"폴란드","context_page_description":"폴란드 공화국, 약칭 폴란드는 중앙유럽에 있는 나라이다. 폴란드는 16개 주로 나뉘며 수도는 바르샤바이다. 인구는 38,562,189명으로, 유럽 연합 에서 6번째로 인구가 많은 국가이다. 또한 유럽에서 면적이 넓은 국가 중 하나이기도 한데 면적은 312,679 제곱킬로미터이다. 주요 종교는 로마 가톨릭이다. 폴란드의 주요 관광 중심지는 크라쿠프이며 브로츠와프, 그단스크, 포즈난과 같은 다른 도시들이다.\\n북위 46°~54˚, 동경 14°~24°에 걸쳐 중앙유럽의 대평원 지역에 위치하고, 동쪽으로는 벨라루스, 우크라이나, 리투아니아 및 러시아, 남쪽으로는 체코 및 슬로바키아, 서쪽으로는 독일 등 7개국과 접하고 있으며, 북쪽으로는 발트 해에 접한다.\\n폴란드의 역사는 폴란드 공작이 기독교로 개종한 966년에 시작되었다. 폴란드의 첫 번째 왕이 1025년에 선출되었고, 피아스트 왕조가 부상했다. 피아스트 왕조는 1370년에 끝나고, 리투아니아와 정치적으로 연합하게 되면서 야기에우워 왕조가 시작되었다. 1569년 루블린 조약으로 폴란드-리투아니아 연방이 창설되면서 폴란드는 당대 유럽에서 가장 크고 인구가 많은 국가 중 하나로 떠오르며 번영했다. 폴란드는 오랫동안 강력한 국가였으나, 점차 쇠퇴하면서 결국 1795년 프로이센, 러시아, 오스트리아에 의해 완전히 분할되었다. 폴란드인은 제1차 세계 대전 이후 1918년 11월 11일에 독립을 되찾았다. 종교적 관용 때문에 폴란드는 매우 다문화 국가였지만 독일과 긴장된 외교 관계를 유지했다. 제2차 세계 대전은 1939년 9월 1일 나치독일이 폴란드를 침략하면서 시작되었다. 이 전쟁으로 폴란드의 유대인 인구를 포함하여 폴란드 국민 600만 명이 사망했다. 전쟁이 끝나고 폴란드에 공산주의 정부가 설립되었다. 1989년 공산주의의 붕괴 이후 폴란드는 자유민주주의 공화국이다.\\n폴란드는 지역 강국이다. 역동적인 경제를 가지고 있으며 GDP의 PPP는 1.2 조 달러로 추산된다. 바르샤바에 소재한 증권 거래소는 중앙 유럽에서 가장 큰 증권거래소이다. 이 나라는 매우 높은 생활 수준, 삶의 질과 안전을 유지하고 있다. 폴란드는 오랜 역사 속에서 독특한 문화 유산을 발전시켰으며 16개의 유네스코 세계 문화 유산을 보유하고 있다."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%A5%E5%96%84%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Ny%C5%ABzen_Station%289%29.jpg","page_title":"入善駅","context_page_description":"入善駅は、富山県下新川郡入善町入膳にある、あいの風とやま鉄道線の駅である。"},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B9%9D%E5%B3%B0%E5%85%AC%E5%9B%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/%E6%96%B9%E5%B1%B1%E5%8F%8C%E5%A1%94%E8%BF%9C%E6%99%AF.PNG","page_title":"九峰公园","context_page_description":"九峰公园是浙江省台州市黄岩区的一座公园，现占地112万平方米，是国家AA级景点。"},{"page_url":"https://sv.wikipedia.org/wiki/Parajulis_poecilepterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/%E3%82%AD%E3%83%A5%E3%82%A6%E3%82%BB%E3%83%B3%EF%BC%88%E3%82%B9%E3%82%BA%E3%82%AD%E7%9B%AE%E3%83%99%E3%83%A9%E4%BA%9C%E7%9B%AE%E3%83%99%E3%83%A9%E7%A7%91%E3%82%AD%E3%83%A5%E3%82%A6%E3%82%BB%E3%83%B3%E5%B1%9E%EF%BC%896233622.JPG","page_title":"Parajulis poecilepterus","context_page_description":"Parajulis poecilepterus är en fiskart som först beskrevs av Temminck och Schlegel, 1845. Parajulis poecilepterus ingår i släktet Parajulis och familjen läppfiskar. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D1%80%D0%B0%D0%BD_2.01","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Buran_2.01_2011_in_Gromov_Flight_Research_Institute.jpg","page_title":"Буран 2.01","context_page_description":"Виріб 2.01, Буран 2.01 — третій льотний екземпляр орбітального корабля, створений в рамках радянської космічної програми «Буран». Для корабля призначалася назва «Байкал», але до нанесення його на борт справа не дійшла. Будівництво було не завершено через недостатнє фінансування та закриття програми багаторазової транспортно-космічної системи в 1993, коли ступінь готовності виробу оцінювався в 30-50 %."},{"page_url":"https://ca.wikipedia.org/wiki/Bugni%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Map_commune_FR_insee_code_52082.png","page_title":"Bugnières","context_page_description":"Bugnières és un municipi francès, situat al departament de l'Alt Marne i a la regió del Gran Est. L'any 2007 tenia 152 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Autoroute_401_(Ontario)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Hwy404DVP401.jpg","page_title":"Autoroute 401 (Ontario)","context_page_description":"L'autoroute 401 est une autoroute de la série-400 majeure, située dans la province de l'Ontario, au Canada. La 401 est située dans le sud-ouest, le sud et l'est de l'Ontario, traversant la région la plus peuplée de la province et du pays, passant notamment par les villes de Windsor, London, le grand Toronto et Kingston. Elle constitue, avec l'autoroute 20, l'épine dorsale du réseau routier du corridor Windsor-Québec. La 401 traverse un bassin de population avoisinant les 12 millions d'habitants.\\nD'une longueur de 823 kilomètres, entièrement située dans l'Ontario, elle est la plus longue autoroute ontarienne, ainsi que la plus longue sous la même juridiction dans une même province au pays. En date de 2020, l'autoroute 401 n'est toujours pas terminée à l'Ouest, à Windsor, alors que le lien autoroutier vers le Michigan est en construction. Depuis juin 2015, les kilomètres 5 à 12 ont été mis en service, et les kilomètres 0 à 5, soit la fin de la Herb Gray Parkway et le pont Gordie Howe qui rejoindra l'Interstate 75, sont en construction.\\nL'autoroute est désignée comme étant l'autoroute MacDonald-Cartier sur toute sa longueur, en l'honneur des pères de la confédération."},{"page_url":"https://lv.wikipedia.org/wiki/%C4%8C%C4%81rlzs_Henrijs_Stenlijs","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Stanley-Turner-L%C3%B6wenthal1850.jpg","page_title":"Čārlzs Henrijs Stenlijs","context_page_description":"Čārlzs Henrijs Stenlijs bija Lielbritānijas un ASV šahists."},{"page_url":"https://ms.wikipedia.org/wiki/San_Carlos_de_Bariloche","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Bariloche-_Argentina.jpg","page_title":"San Carlos de Bariloche","context_page_description":"San Carlos de Bariloche, biasanya dikenali sebagai Bariloche, adalah sebuah bandar di, terletak di kaki bukit Andes. Dikelilingi oleh tasik dan gunung, San Carlos de Bariloche adalah destinasi pelancongan utama antarabangsa dengan jumlah penduduk kekal melebihi 130,000. Hal ini terkenal untuk bermain ski, tetapi juga dikenali untuk melihat-lihat, sukan air, trekking dan mendaki. Gunung Cerro Catedral adalah salah satu pusat ski yang paling penting dalam Amerika Selatan."},{"page_url":"https://de.wikipedia.org/wiki/Nieder%C3%B6sterreichische_Landesnervenklinik_Gugging","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Institute_of_Science_and_Technology_Austria.JPG","page_title":"Niederösterreichische Landesnervenklinik Gugging","context_page_description":"Die NÖ Landes-Irrenanstalt Kierling Gugging in Maria Gugging war ein Krankenhaus der Psychiatrie. Dieses wurde 1885 als Irrenanstaltsfiliale Gugging-Kierling in Betrieb genommen und 2007 als NÖ Landesnervenklinik Ost – Klosterneuburg-Gugging aufgelöst. Die Institution wurde im Laufe der Zeit mehrfach umbenannt."},{"page_url":"https://en.wikipedia.org/wiki/Vasco_da_Gama,_Goa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Vasco_Martyrs_Memorial.jpg","page_title":"Vasco da Gama, Goa","context_page_description":"Vasco da Gama, often shortened to Vasco is a city in the state of Goa on the west coast of India. It is named after the Portuguese explorer Vasco da Gama. It is the headquarters of the Mormugão taluka. The city lies on the western tip of the Mormugao peninsula, at the mouth of the Zuari River, about 30 kilometres from Panaji, Goa's capital, and about 5 kilometres from Dabolim Airport.\\nThe city was founded in 1543 and remained in Portuguese hands until 1961, when Goa ceased to be a Portuguese territory. The 1888 constructed Mormugao Port remains a busy shipping route in Asia. It is one of the major ports of independent India. The ship-building area of Goa Shipyard Limited that builds Navy and Coast Guard vessels was also built here in 1957. Initially built around the city's harbour as the barge-repair yard Estaleiros Navais de Goa, the area has now expanded to include more related activities. The Indian Navy also has a presence in Mormugao, with its vast campuses, which include the naval base INS Hansa that shares control over the Dabolim Airport enclave."},{"page_url":"https://it.wikipedia.org/wiki/Target_instant_payment_settlement","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/TIPS_Launch_event.png","page_title":"Target instant payment settlement","context_page_description":"TIPS è il servizio paneuropeo di regolamento per i pagamenti istantanei per l'Eurozona, realizzato e gestito dalla Banca d'Italia ed attivo dal 30 novembre 2018."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D9%84%D8%B2_%D8%AC%D9%88%D9%86%DB%8C%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/CarlsJrGreenBurrito.jpg","page_title":"کارلز جونیور","context_page_description":"رستوران کارلز جونیور با مسئولیت محدود یک رستوران فست فود زنجیره‌ای است که توسط شرکت هولدینگ رستوران‌های سی‌کی‌ئی اداره می‌شود و اغلب شعبه‌های آن در غرب و جنوب غربی ایالات متحده واقع است.\\nدر سال ۲۰۱۶ نشریه اینترپرتر کارلز جونیور را در رتبه ۵۴ از لیست ۵۰۰ شرکت برتر قرار داد. در این رتبه‌بندی همه شرکت‌ها در همه زمینه‌ها در سراسر ایالات متحده از نظر قدرت مالی، ثبات و نرخ رشد بررسی شده بود.\\nدر مارس سال ۲۰۱۶ شرکت سی‌کی‌ئی در مجموع ۳٬۶۶۴ حق امتیاز یا شرکت و رستوران در ۴۴ ایالت آمریکا و ۳۸ کشور دیگر داشته‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Mod%C3%A8le_CGHS","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Repr%C3%A9sentation_1%2B1D.jpg","page_title":"Modèle CGHS","context_page_description":"Le modèle Callan–Giddings–Harvey–Strominger ou CGHS est un modèle-jouet de physique théorique développé au début des années 1990 et appliquant la relativité générale à un espace-temps constitué d'une dimension d'espace et d'une de temps.\\nCette théorie a notamment permis d'ouvrir la porte pour la résolution du problème de la perte de l'information lors de l'évaporation des trous noirs."},{"page_url":"https://en.wikipedia.org/wiki/Juxta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Antispila_oinophylla_-_Phallus_and_juxta.png","page_title":"Juxta","context_page_description":"In insect anatomy, the juxta is an organ in the males of most Lepidoptera that supports the aedeagus, the organ used for reproduction in insects. The juxta is located between the two valvae.\\nThe term comes from the Latin iuxta, meaning alongside. The biological use of the term should not be confused with the more general use of juxta- as a prefix."},{"page_url":"https://de.wikipedia.org/wiki/Domingo_de_la_Calzada","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Santo_Domingo_de_la_Calzada_-_Catedral%2C_sepulcro_del_santo_03.jpg","page_title":"Domingo de la Calzada","context_page_description":"Domingo García, später Santo Domingo de la Calzada war ein Förderer der Pilgerfahrt nach Santiago de Compostela in der Rioja, Spanien."},{"page_url":"https://en.wikipedia.org/wiki/Louise-Th%C3%A9r%C3%A8se_de_Montaignac_de_Chauvance","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Louise_Th%C3%A9r%C3%A8se_de_Montaignac.jpg","page_title":"Louise-Thérèse de Montaignac de Chauvance","context_page_description":"Louise-Thérèse de Montaignac de Chauvance was a French Roman Catholic who established the Oblates of the Heart of Jesus and was known for her staunch devotion to the Sacred Heart. Her life witnessed her catering to catechetical formation and promoting the Sacred Heart in France.\\nShe was beatified on 4 November 1990."},{"page_url":"https://en.wikipedia.org/wiki/1997_in_the_United_Kingdom","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/John_Kendrew_Nobel.jpg","page_title":"1997 in the United Kingdom","context_page_description":"Events from the year 1997 in the United Kingdom. This year is noted for a landslide general election victory for the Labour Party under Tony Blair; the transfer of Hong Kong, the largest remaining British colony, to China; and the death of Diana, Princess of Wales."},{"page_url":"https://de.wikipedia.org/wiki/Alte_Mainbr%C3%BCcke","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Statue_of_Saint_Bruno_-_Alte_Mainbr%C3%BCcke%2C_W%C3%BCrzburg_-_DSC02933.JPG","page_title":"Alte Mainbrücke","context_page_description":"Die Alte Mainbrücke ist die älteste Brücke über den Main in Würzburg und ein Wahrzeichen der Stadt. Das im 12. Jahrhundert begonnene Bauwerk war bis 1886 Würzburgs einziger Flussübergang. Die Brücke, Teil der Ost-West-Passage, verbindet bei Mainkilometer 252,32 die Altstadt am rechten Mainufer mit der gegenüberliegenden Festung Marienberg. Sie wird vom Fußgänger- und Radverkehr genutzt. Mit ihren stadtbildprägenden Steinfiguren setzte die Alte Mainbrücke im 18. Jahrhundert wie die Prager Karlsbrücke eine in Rom mit der Engelsbrücke begonnene Tradition fort."},{"page_url":"https://en.wikipedia.org/wiki/Cleavage_furrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Unk.cilliate.jpg","page_title":"Cleavage furrow","context_page_description":"In cell biology, the cleavage furrow is the indentation of the cell's surface that begins the progression of cleavage, by which animal and some algal cells undergo cytokinesis, the final splitting of the membrane, in the process of cell division. The same proteins responsible for muscle contraction, actin and myosin, begin the process of forming the cleavage furrow, creating an actomyosin ring. Other cytoskeletal proteins and actin binding proteins are involved in the procedure."},{"page_url":"https://simple.wikipedia.org/wiki/Naomie_Harris","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/NaomieHarris10TIFF.jpg","page_title":"Naomie Harris","context_page_description":"Naomie Melanie Harris is a British movie, stage, voice, and television actress. She is known for her role as Tia Dalma/Calypso in Pirates of the Caribbean: Dead Man's Chest and in Pirates of the Caribbean: At World's End. She was born in London, England on September 6, 1976 to a Jamaican mother and a Trinidadian father. Harris played Winnie Mandela in the 2013 movie Mandela: Long Walk to Freedom."},{"page_url":"https://hu.wikipedia.org/wiki/Sk%C3%B3cia_szigeteinek_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Tiree%2C_Balephuil_Bay.jpg","page_title":"Skócia szigeteinek listája","context_page_description":"Skócia szigeteinek listája a Skóciához tartozó 790 sziget gyűjteményes listája. Ezen szigetek nagy része négy nagy szigetcsoporthoz sorolható, melyek: az Orkney, a Shetland és a Külső- és Belső-Hebridák. Ezeken kívül található még néhány kisebb sziget a Firth of Clyde, a Firth of Forth, a Solway Forth vizeiben, valamint néhány édesvízű tóban is, mint például a Loch Lomondban és a Loch Mareeben.\\nA szigetek közül sok van kitéve az árapály hatásainak, a világ harmadik legnagyobb örvénye is itt található, a Corryvreckan-öbölben, Scarba és Jura között. Egy másik nagy árapályos hely a Pentland Firth a szárazföldi Skócia és Orkney-szigetek között, valamint a „Szürke Kutya” Scarba és Lunga között.\\nGeológiailag és geomorfológiailag a szigetek különbözőek. Némelyikük, pl. Skye és Mull hegyvidéki jellegű, míg mások, pl. Tiree és Sanday viszonylag alacsonyak. Alapkőzetük általában archaikumi lewisi gneisz, mely kb. 3 milliárd évvel ezelőtt keletkezett. Shapinsay és más Orkney-szigeteki sziget vörös homokkőből áll; ez a képződmény mintegy 400 millió éves. De találhatunk vulkanikus származású szigeteket is, ilyen pl. Rùm, mely harmadidőszaki vulkáni eredetű."},{"page_url":"https://ro.wikipedia.org/wiki/Joseph_von_Sonnenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Joseph_von_Sonnenfels.jpg","page_title":"Joseph von Sonnenfels","context_page_description":"Joseph Freiherr von Sonnenfels a fost un jurist și scriitor austriac și german. A fost printre liderii mișcării Illuminati din Austria și un prieten apropiat și unul dintre susținătorii lui Mozart. Este, de asemenea, cel căruia Ludwig van Beethoven i-a dedicat Sonata pentru Pian Nr. 15, Op. 28, care a fost publicată în 1801."},{"page_url":"https://sl.wikipedia.org/wiki/Fulko_Neuillyjski","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Fulk_of_Neuilly.png","page_title":"Fulko Neuillyjski","context_page_description":"Fulko Neuillyjski, francoski pridigar za četrto križarsko vojno in od leta 1191 duhovnik v Neuilly-sur-Marne, † 2. maj 1202.\\nKot duhovnik v Neuillyju je v Parizu obiskoval predavanja teologa Petra Kantorja. Začel je pridigati in zaslovel zaradi svoje pobožnosti in govorništva. Papež Inocenc III. ga je zato leta 1199 povabil, naj pridiga za četrto križarsko vojno.\\nFulko Neuillyjski je imel velik vpliv na leicesterskega grofa Simona Montfortskega, ki je nekaj časa sodeloval v četrtem križarskem pohodu in je bil pomemben voditelj albižanskega križarskega pohoda in njegovo ženo Alix Montmorencyjsko.\\nNjegovo navdušenje pri opravljanju njegovega poslanstva je sprožilo govorice, da si je prisvojil velike vsote denarja, ki ga je zbral za križarski pohod. Umrl je še preden se je križarski pohod preusmeril proti Konstantinoplu."},{"page_url":"https://eu.wikipedia.org/wiki/Moss_Beach_(Kalifornia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Moss_Beach_Shoreline%2C_April_2007.jpg","page_title":"Moss Beach (Kalifornia)","context_page_description":"Moss Beach Ameriketako Estatu Batuetako erroldak esleitutako leku bat da. San Mateo konderrian kokatuta dago, Kalifornia estatuan. 3.103 biztanle ditu, 5,811039 kilometro koadroko azaleran banatuta."},{"page_url":"https://fr.wikipedia.org/wiki/Murviel-l%C3%A8s-Montpellier","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Murviel_l%C3%A8s_Montpellier_usuel_du_compoix_1600_-_Archives_d%C3%A9partementales_de_l%E2%80%99H%C3%A9rault_-_FRAD034-0155-PUB-0001-00015.jpg","page_title":"Murviel-lès-Montpellier","context_page_description":"Murviel-lès-Montpellier est une commune française située dans le département de l'Hérault en région Occitanie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D0%B0%D1%83%D1%80%D0%B5%D0%B0%D1%82%D0%BE%D0%B2_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D0%B8_%D0%BF%D0%BE_%D1%85%D0%B8%D0%BC%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Robert_Curl_crop_2009_CHAO.jpg","page_title":"Список лауреатов Нобелевской премии по химии","context_page_description":"Нобелевская премия по химии — одна из пяти Нобелевских премий, ежегодно вручаемая Нобелевским фондом награда за научные достижения в области химии."},{"page_url":"https://nl.wikipedia.org/wiki/Andr%C3%A9_Auffray","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Andr%C3%A9_Auffray.jpg","page_title":"André Auffray","context_page_description":"André Auffray was een Frans wielrenner.\\nSchilles won tijdens de Olympische Zomerspelen 1908 samen met Maurice Schilles de gouden medaille op de tandem en individueel brons op de 5 km."},{"page_url":"https://de.wikipedia.org/wiki/Tunnel_Grunertstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Tunnel_Grunertstra%C3%9Fe_Aqualand_165923.jpg","page_title":"Tunnel Grunertstraße","context_page_description":"Der Tunnel Grunertstraße befindet sich im Essener Stadtteil Frohnhausen. Er ist ein Durchlass unter der Haupteisenbahnstrecke und diente im Zweiten Weltkrieg als Lager für Kriegsgefangene."},{"page_url":"https://ca.wikipedia.org/wiki/Museu_de_l%27Aixecament_de_Vars%C3%B2via","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Sala_Ma%C5%82ego_Powsta%C5%84ca_MPW_04.JPG","page_title":"Museu de l'Aixecament de Varsòvia","context_page_description":"El Museu de l'Aixecament de Varsòvia és un museu dedicat a l'Aixecament de Varsòvia de 1944."},{"page_url":"https://de.wikipedia.org/wiki/1900","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Bremen_um_1900.jpg","page_title":"1900","context_page_description":"Das Jahr 1900 ist ein Säkularjahr. Es hat 365 Tage. Drei Ereignisse prägen das Jahr 1900 besonders: Die Weltausstellung in Paris, der Zweite Burenkrieg in Südafrika und der Beginn des Boxeraufstandes in China."},{"page_url":"https://af.wikipedia.org/wiki/Monargie_van_die_Verenigde_Koninkryk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Elizabeth_II_greets_NASA_GSFC_employees%2C_May_8%2C_2007_edit.jpg","page_title":"Monargie van die Verenigde Koninkryk","context_page_description":"Die monargie van die Verenigde Koninkryk is die grondwetlike monargie van die Verenigde Koninkryk en sy oorsese gebiede. Die monarg se titel is \\"koning\\" of \\"koningin\\". Koningin Elizabeth II is sedert Februarie 1952 die monarg. Sy het die troon na die dood van daar vader, koning George VI bestyg.\\nDie monarg onderneem verskeie amptelike, seremoniële, diplomatieke en verteenwoordigende pligte. Omrede die monargie grondwetlik is, is die monarg beperk tot nie-partydige funksies, soos die toeken van ordes en die aanstel van die Eerste Minister. Die monarg is, volgens tradisie, die hoof van die Britse gewapende magte. Die monarg is ook die hoof van die Kerk van Engeland, alhoewel die werklike gesag by die aartsbiskop van Canterbury lê.\\nOmdat die Britse monarg die hoof van die Britse Statebond is, is hy/sy ook die staatshoof van verskeie lidlande, insluitende: Antigua en Barbuda, Australië, Bahamas, Barbados, Belize, Kanada, Grenada, Jamaika, Nieu-Seeland, Papoea-Nieu-Guinee, St. Kitts en Nevis, St. Lucia, St. Vincent en die Grenadines, Solomoneilande en Tuvalu."},{"page_url":"https://sv.wikipedia.org/wiki/Betelgeuse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Betelgeuse_position_in_Orion.png","page_title":"Betelgeuse","context_page_description":"Betelgeuse [ˈbeːtɛlˌjøːs] är en superjätte i stjärnbilden Orion. Sett från jorden räknas den som den 10:e starkast lysande stjärnan, även om det varierar något då dess ljusstyrka är variabel."},{"page_url":"https://en.wikipedia.org/wiki/Pudozhsky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Rural-area-Pudozhsky_District-karelia-republic-june-2005.jpg","page_title":"Pudozhsky District","context_page_description":"Pudozhsky District is an administrative district, one of the fifteen in the Republic of Karelia, Russia. It is located in the southeast of the republic. The area of the district is 12,700 square kilometers. Its administrative center is the town of Pudozh. As of the 2010 Census, the total population of the district was 21,659, with the population of Pudozh accounting for 44.8% of that number."},{"page_url":"https://vi.wikipedia.org/wiki/Calceolaria_biflora","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Calceolaria_biflora_Lam..jpg","page_title":"Calceolaria biflora","context_page_description":"Calceolaria biflora là một loài thực vật có hoa trong họ Calceolariaceae. Loài này được Lam. mô tả khoa học đầu tiên năm 1785."},{"page_url":"https://fr.wikipedia.org/wiki/Santa_Mar%C3%ADa_Huatulco","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Huatulco_%283%29.JPG","page_title":"Santa María Huatulco","context_page_description":"Santa María Huatulco, ou simplement Huatulco, est une ville et une municipalité à Oaxaca dans le sud-ouest du Mexique. Il fait partie du district de Pochutla. La municipalité couvre une superficie de 579,22 km² à une moyenne de 220 mètres au-dessus du niveau de la mer. C'est en son lieu que se forme et commence la rivière Huatulco.\\nLa municipalité abrite le parc national de Huatulco. La zone urbaine est desservie par l'aéroport international Bahías de Huatulco."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B0%D8%A7_%D9%83%D9%84%D8%A7%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/20080116_The_Clare_%40_The_Water_Tower.jpg","page_title":"ذا كلاري","context_page_description":"ذا كلاري هو الشاهقة كبار المجتمع معيشة مستقلة تقع في حرم جامعة لويولا في شيكاغو برج المياه في جولد كوست في شيكاغو في راش شارع وشارع بيرسون. وهو مجتمع التقاعد الرعاية المستمرة. تم تصميم المبنى من طابق و 53 من بيركنز وويل، ويعد واحدا من أطول المباني المخصصة لكبار السن في العالم. ويشمل هذا المبنى أيضا 50,000 قدم مربع من مساحة الفصول الدراسية في أسفل ل استبدال اثنين من مباني الفصول الدراسية صغيرة تابعة ل جامعة لويولا في شيكاغو.\\nحتى نوفمبر 2011، تعود ملكية كلير والتي تديرها راهبات الفرنسيسكان في شيكاغو vفي 15 نوفمبر 2011، رفعت كلير للحماية من الإفلاس من الدائنين بعد أن فشلت في تقديم مدفوعات الديون At the time, the building was only 34% occupied. The property was sold in a bankruptcy auction to Senior Care Development LLC, a هارريسون-based non-denominational senior care company. The property is managed by Life Care Services"},{"page_url":"https://sq.wikipedia.org/wiki/Oradea","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/OradeaCrisulRepedeRemake.jpg","page_title":"Oradea","context_page_description":"Oradea është qytet në veriperëndim të Rumanisë. Qyteti ndodhet 12 kilometra larg kufirit me Hungarinë. Qyteti ka pasur 196,367 banorë më 2011."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D0%B4%D0%BE%D0%BC%D1%8F%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Pudomyagi1939.jpg","page_title":"Пудомяги","context_page_description":"Пудомя́ги — деревня в Гатчинском районе Ленинградской области, административный центр Пудомягского сельского поселения."},{"page_url":"https://az.wikipedia.org/wiki/%22R%C9%99%C5%9Fad%C9%99t%22_ordeni","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Az%C9%99rbaycan_Respublikas%C4%B1n%C4%B1n_%E2%80%9CR%C9%99%C5%9Fad%C9%99t%E2%80%9D_ordeni_%283-c%C3%BC_d%C9%99r%C9%99c%C9%99%29.jpg","page_title":"\\"Rəşadət\\" ordeni","context_page_description":"\\"Rəşadət\\" ordeni — Azərbaycan Respublikasının ordenlərindən biri.\\n“Rəşadət\\" ordeni ilə Azərbaycan Silahlı Qüvvələrinin hərbi qulluqçuları\\nAzərbaycanın müstəqilliyinin, ərazi bütövlüyünün və təhlükəsizliyinin təmin edilməsində xüsusi xidmətlərinə;\\nəhəmiyyətli və ya strateji ərazinin, yaşayış məntəqəsinin, rayonun və ya şəhərin düşmən işğalından azad olunması ilə nəticələnmiş döyüş əməliyyatları zamanı hərbi hissə və birləşmələrə yüksək peşəkarlıqla rəhbərlik etdiklərinə;\\nVətənin müdafiəsi zamanı düşmən hücumunun qarşısının alınmasında, işğal edilmiş ərazilərin azad olunmasında, düşmənin canlı qüvvəsinin və döyüş texnikasının məhv edilməsində igidlik və mərdlik nümunəsi göstərdiklərinə;\\nhəyat və sağlamlıq üçün real təhlükə şəraitində xidməti borcu və hərbi qulluq vəzifəsini yerinə yetirərkən mərd və qətiyyətli hərəkətlərinə;\\nfövqəladə hallarda və ya ekstremal şəraitdə insanların xilas edilməsində xüsusi xidmətlərinə;\\nhəmçinin dövlət sərhədinin mühafizəsinin təmin edilməsində xüsusi xidmətlərinə görə təltif edilirlər.\\n\\"Rəşadət\\" ordeninin 3 dərəcəsi var. Orden döşün sol tərəfinə, Azərbaycanın digər ordenləri olduqda \\"Azərbaycan bayrağı\\" ordenindən sonra taxılır."},{"page_url":"https://it.wikipedia.org/wiki/Oficina_Musicum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/FOTO_MAGGIO_2008_DELICIAE_MEAE_009.jpg","page_title":"Oficina Musicum","context_page_description":"Oficina Musicum è un ensemble strumentale e vocale italiano specializzato nella musica barocca e classica fondato nel 2005 a Casoni di Mussolente dal clavicembalista e organista Riccardo Favero, che ne è attualmente il direttore."},{"page_url":"https://et.wikipedia.org/wiki/Rzeczpospolita_ajalugu_(1648%E2%80%931764)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/PL_Battle_of_Chocim_1673.JPG","page_title":"Rzeczpospolita ajalugu (1648–1764)","context_page_description":"Rzeczpospolita ajalugu (1648–1764) katab perioodi Poola ja Leedu suurvürstiriigi ajaloost alates ajast, kui nende ühisriik muutus suures ulatuses 17. sajandi keskel võideldud sõdade ja invasioonide teatriks, kuni ajani just enne Rzeczpospolita viimase kuninga Stanisław August Poniatowski valimist.\\n17. sajandist alates koges aadlidemokraatia laastavaid sõdu ning langes sisemisse korratusse ja siis anarhiasse ja liikus selle tulemusena allamäge. Kord võimas liitriik oli muutunud sisevõitlustes ja välisinterventsioonis haavatavaks. 1648. aastal haaras kasakas Bogdan Hmelnõtskõi ülestõus tohutu Poola-Leedu riigi lõuna- ja idaosa ning varsti järgnes Rootsi invasioon, mis raevutses läbi Poola südamaa. Võitlus kasakate ja Venemaaga jagas Ukraina; liitriigi poolt kaotatud idaosa muutus Vene tsaaririigi sõltlaseks. Jan III Sobieski, kes võitles pikaleveninud sõdades Osmanite riigi vastu, taaselustades taas kord liitriigi sõjalise võimu. Ühe otsustava osalemisega aitas ta aastal 1683 vabastada Viini Türgi rünnakutest.\\nSellest hoolimata järgnes edasine lagunemine."},{"page_url":"https://tr.wikipedia.org/wiki/Cihat_Levent","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Cihat_Levent.jpg","page_title":"Cihat Levent","context_page_description":"Cihat Levent, spor yöneticisi, sivil toplum kuruluşu aktivisti, eski Türk millî basketbolcu."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Aluni%C8%99,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/PruneniCJ2011_%28112%29.jpg","page_title":"Comuna Aluniș, Cluj","context_page_description":"Aluniș este o comună în județul Cluj, Transilvania, România, formată din satele Aluniș, Corneni, Ghirolt, Pruneni și Vale. Se află la vest de orașul Gherla, alcătuită din cinci sate."},{"page_url":"https://en.wikipedia.org/wiki/Regional_Military_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Lambang_Kodam_Udayana.png","page_title":"Regional Military Command","context_page_description":"The Indonesian Regional Military Command are Indonesian military districts."},{"page_url":"https://fr.wikipedia.org/wiki/Saison_2018_de_l%27%C3%A9quipe_cycliste_Movistar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/JVG_Acosta_TR_2011.jpg","page_title":"Saison 2018 de l'équipe cycliste Movistar","context_page_description":"La saison 2018 de l'équipe cycliste Movistar est la trente-neuvième de cette équipe."},{"page_url":"https://en.wikipedia.org/wiki/List_of_castles_in_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Alcazaba_y_Pe%C3%B1a_de_los_Enamorados.jpg","page_title":"List of castles in Spain","context_page_description":"The castles in Spain were built mainly for the country's defense, particularly with respect to fortification. During the Middle Ages, northern Christian kingdoms had to secure their borders with their Muslim southern neighbours, thus forcing both Christian and Muslim kings to grant border fiefs to their liege noblemen so as to keep and maintain defensive fortresses. When the Reconquista advanced, those border castles lost their initial purpose, and, as in the rest of medieval Europe, they were used as noble residences and fief-keeps. Sporadic threats of war maintained their initial military purposes as enemy invasions were common. In some locations, such as the Basque country, fiefdoms did not exist as such, and noble families could not afford nor did they need huge fortresses, giving rise to many tower houses. In Muslim Spain many castle-palaces were built: the petty taifa kingdoms that arose after the fall of the Caliphate of Córdoba were militarily weak thus castles began taking on a more aesthetic purpose."},{"page_url":"https://en.wikipedia.org/wiki/Southampton_Citybus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Ecobus.jpg","page_title":"Southampton Citybus","context_page_description":"Southampton Citybus was a bus operator which operated local services throughout the English city of Southampton. It was formed in 1898 as Southampton Corporation Transport. In 1986, as a result of deregulation an 'arms-length' limited company was formed in the name of Southampton Citybus and the coat of arms of the City of Southampton was removed, and replaced with the new branding. The company was owned by the town council until 1954, and the city council until 1993. It was then bought by its employees, in 1997 it was purchased by FirstGroup and is now part of First Hampshire & Dorset."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9D%A2%E5%8C%85%E5%8E%86%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Peasants_breaking_bread.jpg","page_title":"面包历史","context_page_description":"面包至少有3万年的历史。第一个面包很可能是偶然情况下弄熟的谷物面糊，也可能是史前人类用早期面粉和水做实验的结果。类似的面饼现在还能在世界各地找到，制作面饼的材料可以是任何谷物，例如墨西哥薄饼、印度的馕、中东的皮塔饼、中国的煎饼。这种扁平面饼是人类早期文明中常见的主食，苏美尔人常吃大麦烙饼，公元前12世纪的古埃及人可以在街上买到叫做“ta”的面饼。古希腊人用精粉、油脂和葡萄酒做的面包祭祀地神克托尼俄斯。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%84%D9%8A%D8%AC_%D8%B3%D8%A7%D9%86%D8%AA%D8%A7_%D9%83%D8%A7%D8%AA%D8%A7%D9%84%D9%8A%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Laguna_Beach_CA_Sunset_winter07.JPG","page_title":"خليج سانتا كاتالينا","context_page_description":"خليج سانتا كاتالينا ويعرف أيضاً بـخليج كاتالينا، وهو خليج في المحيط الهادئ، والذي يقع على الساحل الشرقي من أمريكا الشمالية. يعود الساحل الغربي للخليج إلى ولاية كاليفورنيا التابعة للولايات المتحدة الأمريكية وولاية باها كاليفورنيا التابعة للولايات المتحدة المكسيكية، حيث تعتبر سان دييغو أكبر مدينة تقع على ضفة شاطئها. تشمل جزر الخليج على عدة جزر منها جزيرة سانتا كاتالينا. ويقع الخليج في منطقة نشطة زلزالياً."},{"page_url":"https://zh.wikipedia.org/zh-tw/2012%E5%B9%B4%E5%A4%A7%E8%A5%BF%E6%B4%8B%E9%A3%93%E9%A3%8E%E5%AD%A3%E6%97%B6%E9%97%B4%E8%BD%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Rafael_2012_track.png","page_title":"2012年大西洋飓风季时间轴","context_page_description":"2012年大西洋颶風季與2010和2011年大西洋颶風季一樣，形成了19場獲得命名的風暴。颶風季從2010年6月1日正式開始，同年11月30日結束，傳統上這樣的日期界定了一年中絕大多數熱帶氣旋在大西洋盆地形成和發展的時間段。不過本季的前兩場風暴——阿爾貝托和熱帶風暴貝里爾——分別於5月19和26日形成，均早於颶風季正式開始的時間，是繼1908年以來首次出現這種情況。熱帶風暴托尼是全季最後一場風暴，於10月25日消散，不過在托尼之前形成的上一個熱帶氣旋颶風桑迪卻還要再過4天才會消散。\\n全季一共產生了19個熱帶氣旋，並且全部都達到熱帶風暴強度，10場成為颶風，不過只有兩場達到大型颶風標準。本季的風暴給大範圍地區造成了災難性的打擊，其中導致人員傷亡和破壞程度最高的兩場風暴分別是颶風艾薩克和颶風桑迪。其中艾薩克於8月12日以一級颶風強度從路易斯安那州登岸，其存在期間一共奪走了41人的生命。颶風桑迪是全季第二場、也是最後一場大型颶風，其覆蓋範圍創下大西洋颶風的新紀錄，直徑超過了1800公里。這一天氣系統於10月下旬以溫帶氣旋形式從紐澤西州南海岸登陸。桑迪作為熱帶氣旋期間一共導致了至少680億美元損失和285人喪生。截至2013年，桑迪仍是有紀錄以來造成損失數額第二高的大西洋颶風，僅次於2005年的颶風卡特里娜。\\n2012年大西洋颶風季時間軸中記錄了全年大西洋所有熱帶或亞熱帶氣旋形成、增強、減弱、登陸、轉變成溫帶氣旋以及消散的具體信息。還包括實際操作中沒有發布的信息，如美國國家颶風中心在風暴過後進行的回顧。包括最大持續風速、位置、距離在內的所有數字都是經四捨五入換算成整數。"},{"page_url":"https://it.wikipedia.org/wiki/Monte_Arayat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mt.Arayat_from_air.JPG","page_title":"Monte Arayat","context_page_description":"Il Monte Arayat è uno stratovulcano estinto delle Filippine che si eleva per 1 026 m.s.l.m. nel territorio della municipalità di Arayat, nella regione del Luzon Centrale, nella parte settentrionale dello Stato asiatico.\\nIl vulcano, interamente coiperto di foresta e principalmente costituito di basalto e andesite, svetta sulla pianura centrale dell'isola di Luzon a nord-est di Angeles, nella provincia di Pampanga, circa 50 km a Est del vulcano Pinatubo. Un largo cratere fratturato sommitale sembrerebbe essere la sorgente di una vasta frana collinosa composta di vari materiali eruttivi a Ovest e Nord-ovest del vulcano.\\nLe varie attività eruttive del passato hanno creato un duomo di lava in andesite conosciuto come White Rocks che si erge sui bordi dell'anfiteatro formatosi dopo lo sprofondamento dell'edificio. Non vi sono notizie di attività vulcaniche negli ultimi duemila anni, se non alcune attività fumaroliche che hanno origine nei pressi del cratere.\\nL'Arayat è compreso nel territorio del Parco nazionale del Monte Arayat, area naturale protetta istituita nel 1937."},{"page_url":"https://pl.wikipedia.org/wiki/Obrona_Pragi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Rzez_Pragi2.jpg","page_title":"Obrona Pragi","context_page_description":"Obrona Pragi – ostatnie starcie zbrojne insurekcji kościuszkowskiej, a zarazem ostatnia bitwa Rzeczypospolitej Obojga Narodów, stoczona w obronie Warszawy 4 listopada 1794 roku.\\nWarszawska Praga była w okresie insurekcji kościuszkowskiej strategicznym punktem obrony miasta przed atakującymi od wschodu wojskami rosyjskimi. Siły nacierające pod dowództwem Aleksandra Suworowa liczyły ok. 23 tys. żołnierzy i 104 armaty, podczas gdy obrońcy, dowodzeni przez gen. Józefa Zajączka, mogli wystawić ok. 13 tys. ludzi, rozmieszczonych wzdłuż fortyfikacji przygotowanych pod kierunkiem inżyniera Jana Bakałowicza."},{"page_url":"https://lt.wikipedia.org/wiki/Vokietijos_federalinis_prezidentas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Roman_Herzog.jpg","page_title":"Vokietijos federalinis prezidentas","context_page_description":"Vokietijos federalinis prezidentas – Vokietijos Federacinės Respublikos valstybės vadovas. Atstovauja šaliai užsienyje. Galios nominalios. Realios valdžios neturi. Valstybę valdo Vyriausybė. Įgaliojimai veikti Vokietijos vidaus politikoje riboti. Svarbiausios yra atstovavimo funkcijos. Reikšmingos galios – teisė paleisti Vokietijos Bundestagą. Be to, Prezidentui tenka svarbus vaidmuo, sudarant mažumos vyriausybę. Federalinis prezidentas Vokietijoje priskiriamas vykdomajai valdžiai. Tiesa, be vykdomosios valdžios galių jis taip pat turi ir kitokių valdingų įgalinimų. Dėl to jis iš dalies laikomas esančiu „virš“ visų trijų valdžios šakų arba „neutraliąja valdžia“. Prezidento statusą įtvirtino 1949 metų Vokietijos Konstitucija. Konstitucija federaliniam prezidentui nesuteikia veto teisės. Nors federalinis prezidentas ir patvirtina federalinio parlamento nutarimus ir Vyriausybės pasiūlytus ministrus, iš tiesų, jis tik patikrina, ar šie procesai vyko laikantis Pagrindinio įstatymo nuostatų.\\nVokietijos prezidentą penkerių metų kadencijai renka Federalinis susirinkimas. Tas pats asmuo Federacinės Respublikos Prezidentu gali būti renkamas ne daugiau kaip du kartus iš eilės."},{"page_url":"https://ast.wikipedia.org/wiki/Villafranca_Montes_de_Oca","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Ermita_de_Oca.JPG","page_title":"Villafranca Montes de Oca","context_page_description":"Villafranca Montes de Oca ye una llocalidá y un conceyu español de la provincia de Burgos na comunidá de Castiella y Llión, partíu xudicial de Briviesca, contorna de Montes de Oca."},{"page_url":"https://en.wikipedia.org/wiki/Dutch_elm_disease","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/David_Elm_with_DED_2.jpg","page_title":"Dutch elm disease","context_page_description":"Dutch elm disease is caused by a member of the sac fungi affecting elm trees, and is spread by elm bark beetles. Although believed to be originally native to Asia, the disease was accidentally introduced into America and Europe, where it has devastated native populations of elms that did not have resistance to the disease. It has also reached New Zealand. The name \\"Dutch elm disease\\" refers to its identification in 1921 and later in the Netherlands by Dutch phytopathologists Bea Schwarz and Christine Buisman who both worked with Professor Johanna Westerdijk. The disease affects species in the genera Ulmus and Zelkova; therefore it is not specific to the Dutch elm hybrid."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B3%D0%BE%D1%82%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/%D0%93%D1%80%D0%B0%D0%B4%D0%B8%D0%BD%D0%BA%D0%B0_%D0%B2%D0%BE_%D0%9D%D0%B5%D0%B3%D0%BE%D1%82%D0%B8%D0%BD%D0%BE_1.JPG","page_title":"Неготино","context_page_description":"Неготино — град во средишниот дел на Македонија, сместен во средното Повардарие, од двете страни на реката Вардар и зазема значителен простор во Тиквешката Котлина. Од Скопје, Неготино е оддалечено 95 км, а најблизок град е Кавадарци, кој е на растојание од 10 км.\\nГрадот претставува административно седиште на истоимената општина, која опфаќа уште и 12 села.\\nКлимата и почвата се идеални за одгледување на грозје и добивање на вино."},{"page_url":"https://hu.wikipedia.org/wiki/Nijon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Nijon.jpg","page_title":"Nijon","context_page_description":"Nijon település Franciaországban, Haute-Marne megyében. Nijon Bourmont, Graffigny-Chemin, Outremécourt, Soulaucourt-sur-Mouzon és Vaudrecourt községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_%C4%8Cerven%C3%BD_Hr%C3%A1dek","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Rothenhaus3.jpg","page_title":"Schloss Červený Hrádek","context_page_description":"Das Schloss Červený Hrádek liegt etwa anderthalb Kilometer nördlich des Stadtzentrums von Jirkov im Kreis Chomutov in der Aussiger Region, auf einer Anhöhe am südlichen Hang des Erzgebirges in Tschechien. Das Schloss steht unter Denkmalschutz und ist für die Öffentlichkeit zugänglich.\\nDie gleichnamige Ortschaft Červený Hrádek liegt östlich unterhalb vom Schloss."},{"page_url":"https://sv.wikipedia.org/wiki/Ren%C3%A9_Gu%C3%A9non","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Rene-guenon-1925.jpg","page_title":"René Guénon","context_page_description":"René Guénon, född 15 november 1886 i Blois i Loir-et-Cher, död 7 januari 1951 i Kairo i Egypten, var en fransk religionsfilosof och metafysiker, och författare till en rad uppmärksammade böcker om traditionell religion och philosophia perennis. René Guénon brukar räknas som grundare av den Traditionella skolan och har utövat en betydande inflytande på senare företrädare för philosophia perennis, där den schweiziske religionsfilosofen Frithjof Schuon intar en särplats."},{"page_url":"https://es.wikipedia.org/wiki/Zingiber_spectabile","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Zingiber_spectabile-IMG_0799.JPG","page_title":"Zingiber spectabile","context_page_description":"Zingiber spectabile es una especie de jengibre verdadero, nativa del archipiélago malayo. Se cultiva principalmente en Occidente como planta ornamental, ​ aunque se utiliza en el sudeste asiático como hierba medicinal.​\\nEs conocida en Occidente con el nombre común de \\"jengibre de colmena\\", debido a la forma de sus inflorescencias que se asemejan a una colmena de abejas. Otros nombres comunes son flor de maraca, hierba de jengibre o jengibre de Malasia."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%95%D6%80%D5%A5%D5%B6%D5%BB_%D5%A2%D5%B8%D5%B8%D6%82%D5%AC_%D5%B4%D5%A1%D6%80%D5%A6%D5%A1%D5%A4%D5%A1%D5%B7%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Orange_Bowl.jpg","page_title":"Օրենջ բոուլ մարզադաշտ","context_page_description":"Մայամի օրենջ բոուլ մարզադաշտը մարզադաշտ էր ԱՄՆ-ի Ֆլորիդա նահանգի Մայամի քաղաքում, որը նախատեսված էր ռեգբիի և ֆուտբոլային հանդիպումների անցկացման համար։ Մարզադաշտը տեղավորում էր ավելի քան 74 հազար հանդիսականի։ 2005 թ. Օրանժ Բոուլը խիստ տուժեց Վիլմա փոթորկի պատճառով, և 2008 թ. մայիսի 14-ին քանդման ենթարկվեց։ 2009 թ. հուլիսի 1-ից քանդված մարզադաշտի տարածքում սկսվեց նոր բեյսբոլային մարզադաշտի կառուցման շինարարությունը։"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_im_Bezirk_Innsbruck-Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Buchen_im_Halltal.jpg","page_title":"Liste der Naturdenkmäler im Bezirk Innsbruck-Land","context_page_description":"Die Liste der Naturdenkmäler im Bezirk Innsbruck-Land listet alle als Naturdenkmal ausgewiesenen Objekte im Bezirk Innsbruck-Land im Bundesland Tirol auf. Unter den 61 bestehenden Naturdenkmälern befinden sich 45 Bäume oder Baumgruppen, 14 Gewässer, eine Felsformation und ein Alpenrosenvorkommen. Die Gemeinde Volders weist mit zehn Naturdenkmälern die höchste Denkmalzahl im Bezirk auf."},{"page_url":"https://sv.wikipedia.org/wiki/Gr%C3%A5nackad_siska","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Cape_Canary_%28Serinus_canicollis%29.jpg","page_title":"Grånackad siska","context_page_description":"Grånackad siska är en fågel i familjen finkar inom ordningen tättingar."},{"page_url":"https://en.wikipedia.org/wiki/Warabi_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Warabi_Station.JPG","page_title":"Warabi Station","context_page_description":"Warabi Station is a railway station on the Keihin-Tōhoku Line in the city of Warabi, Saitama, Japan, operated by East Japan Railway Company."},{"page_url":"https://fr.wikipedia.org/wiki/Zenzizenzizenzic","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Whetstone-of-Witte-pp-150-151.jpg","page_title":"Zenzizenzizenzic","context_page_description":"Zenzizenzizenzic est la forme obsolète de la notation mathématique du XVIᵉ siècle anglais représentant la huitième puissance d'un nombre.\\nLe zenzizenzizenzic d'un nombre x est la puissance x⁸.\\nDatant d'une époque où les mathématiques étaient rédigées en termes rhétoriques, ce mot a été proposé par Robert Recorde, mathématicien du XVIᵉ siècle gallois, dans The Whetstone of Wit, publié en 1557.\\nSon orthographe était zenzizenzizenzike. Il provient de l'allemand, zenzic, qui est l'orthographe germanique de l'italien médiéval censo.\\nCe mot, qui en algèbre rhétorique sert à désigner le carré, fournit le carré d'un carré d'un nombre par redoublement. Pour Recorde, zenzizenzic est donc naturellement une forme condensée de l'Italien Di Censo censo, utilisée par Léonard de Pise, dans son célèbre livre Liber Abaci de 1202. De même, comme la sixième puissance d'un nombre est égale au carré de son cube, Recorde utilise le mot zenzicubike pour l'exprimer ; et par suite, zenzizenzizenzike désigne chez lui."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%88%D9%84_%D8%B3%D8%A7%D8%A8%D8%A7%D8%AA%D9%8A%D9%8A%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Paul_Sabatier_en_1905.jpg","page_title":"بول ساباتييه","context_page_description":"بول ساباتييه كان عالم لاهوت و مؤرخ و استاذ جامعى من فرنسا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BA%D1%82%D0%B0%D0%BB%D1%8B_(%D0%9C%D0%B0%D0%BA%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/%D0%9F%D0%B0%D1%81%D0%BF%D0%BE%D1%80%D1%82_%D1%81%D0%B5%D0%BB%D0%BE_%D0%9C%D0%B0%D1%85%D1%82%D0%B0%D0%BB%D1%8B.jpg","page_title":"Макталы (Макталинский сельский округ)","context_page_description":"Макталы — село в Мактааральском районе Туркестанской области Казахстана. Административный центр Макталинского сельского округа. Код КАТО — 514479100."},{"page_url":"https://oc.wikipedia.org/wiki/Ella_Fitzgerald","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ella_Fitzgerald_1940.jpg","page_title":"Ella Fitzgerald","context_page_description":"Ella Jane Fitzgerald foguèt una importanta cantaira americana de jazz, e tanben de divèrses autres estils: bop, bossa nova, samba, gospel, calypso, blues e swing. Per sa granda qualitat artistica foguèt recompensada maites còps e recebèt 13 Grammy Awards demest totes los prèmis que li foguèron donats."},{"page_url":"https://pl.wikipedia.org/wiki/1_Pu%C5%82k_Strzelc%C3%B3w_Konnych_(II_RP)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Prop_dow_1psk.png","page_title":"1 Pułk Strzelców Konnych (II RP)","context_page_description":"1 Pułk Strzelców Konnych – oddział kawalerii Armii Polskiej we Francji, Wojska Polskiego II RP i Armii Krajowej.\\nJednostka nieoficjalnie nosiła imię Cesarza Napoleona i nazwę wyróżniającą „Raszyńskich”.\\nPrzed 1939 stacjonowała w Garwolinie, w dawnych koszarach 13 pułku dragonów carskiej armii.\\nŚwięto pułkowe obchodzono 9 maja w rocznicę przekroczenia granicy polskiej w 1919 przez 4 pułk szwoleżerów.\\nOddział nawiązywał do tradycji 1\\npułku strzelców konnych Księstwa Warszawskiego i 1 pułku strzelców konnych Królestwa Kongresowego."},{"page_url":"https://sv.wikipedia.org/wiki/North_Crawley","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/North_Crawley%2C_St_Firmin.JPG","page_title":"North Crawley","context_page_description":"North Crawley är en civil parish i Milton Keynes i Storbritannien. Det ligger i grevskapet Buckinghamshire och riksdelen England, i den södra delen av landet, 70 km nordväst om huvudstaden London.\\nKustklimat råder i trakten. Årsmedeltemperaturen i trakten är 9 °C. Den varmaste månaden är juli, då medeltemperaturen är 18 °C, och den kallaste är december, med 0 °C."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Fran%C3%A7on","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/France_biarritz_domaine_francon6_DSC_8846.JPG","page_title":"Château de Françon","context_page_description":"Le château de Francon est un édifice dont la construction, dans le dernier quart du XIXᵉ siècle, fut confiée aux architectes Ralph Selden Wornum et Edward Salomo. Il est situé à Biarritz, dans les Pyrénées-Atlantiques.\\nSon propriétaire, Lord Pennington Mellor était un armateur fortuné qui voulu sortir de l'Angleterre pour s'installer en France; selon lui pour faciliter son commerce nautique.\\nIl a été situé par les architectes pour sa vue panoramique sur l'océan Atlantique et son air iodé avec vertus thérapeutiques.\\nCertaines pièces du château sont classées par les monuments historiques depuis 1999 alors que tous les éléments bâtis sont inscrits par arrêté du 31 décembre 1993, modifié par arrêté du 20 juin 1994.\\nLe château de Françon a été vendu à la Caisse nationale des allocations familiales en 1948, et a été transformé en centre d'accueil en 1985. Il est désormais sous la gestion locative de VTF. La Caisse d'allocations familiales de la Gironde restant propriétaire."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Stadtfeld_West","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Klinik_st_marienstift_magdeburg.jpg","page_title":"Liste der Kulturdenkmale in Stadtfeld West","context_page_description":"In der Liste der Kulturdenkmale in Stadtfeld West sind alle Kulturdenkmale des zur Stadt Magdeburg gehörenden Stadtteils Stadtfeld West aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 erstellt und seither laufend ergänzt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Untersiemau","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Untersiemau-Wasserschloss.jpg","page_title":"Untersiemau","context_page_description":"Untersiemau is a municipality in the district of Coburg in Bavaria in Germany."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BA%D1%81%D1%8C%D0%B9%D0%BE%D0%BD_%D0%9F%D0%B0%D0%BB%D1%83%D0%B0%D0%B7_(%D1%80%D0%B5%D0%B3%D0%B1%D1%96%D0%B9%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Tom_Potter_Rugby.jpg","page_title":"Сексьйон Палуаз (регбійний клуб)","context_page_description":"Сексьон Палуаз або просто По — французький регбійний клуб, який виступає у вищому дивізіоні національного чемпіонату. Команда розташовується в місті По та проводить домашні матчі на арені Стад дю Амо, здатному вмістити 18 тисяч глядачів. Колектив входить в структуру великого клубу Сексьон Палуаз, що включає, крім регбі, підрозділи: дзюдо, джіу-джитсу, боксу, фехтування, карате, кендо, настільного тенісу, пелоту.\\nПалуаз є триразовим чемпіоном Франції з регбі. У сезоні 1999/2000 року французам підкорився Європейський кубок з регбі. За підсумками сезону 2005/2006 року команда покинула вищий дивізіон і до сезону 2014/2015 виступала в Про Д2, доки не виграла першість і повернулась у Топ-14."},{"page_url":"https://sv.wikipedia.org/wiki/Sk%C3%A4nninge_konvent","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Runsten_vid_Sankta_Ingrids_kloster.jpg","page_title":"Skänninge konvent","context_page_description":"Skänninge konvent är ett samlingsnamn på två dominikanska konvent, ett manligt och ett kvinnligt, som låg i Skänninge i Östergötland. Konventet anlades som landets andra under 1200-talet, och Sankta Ingrids reliker skrinlades här 1507."},{"page_url":"https://fr.wikipedia.org/wiki/Stade_toulousain","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Ugo_MOLA_-_Nouvel_entraineur_du_Stade_Toulousain_%2820019094082%29.jpg","page_title":"Stade toulousain","context_page_description":"Le Stade toulousain est un club de rugby à XV français fondé en 1907 et basé à Toulouse. C'est la principale section du club omnisports du même nom. Le club est présidé par Didier Lacroix, qui a succédé à René Bouscatel, à la tête du club de 1992 à 2017. L'équipe première, entraînée par Ugo Mola depuis 2015, après l'avoir été par Guy Novès pendant plus de vingt ans, évolue en Top 14 et en Coupe d'Europe.\\nLe Stade toulousain est domicilié au stade Ernest-Wallon. Le club a remporté vingt fois le championnat de France de rugby à XV, il est aussi quadruple champion d'Europe, ce qui fait de lui le club français et européen le plus titré avec le Leinster. Sa philosophie de jeu « jeu de main, jeu de Toulousain » est reconnue par le monde du rugby comme proche du rugby total pratiqué notamment par les All Blacks."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_obras_de_arte_p%C3%BAblica_da_Madeira","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Funchal_Jaime_Moniz.JPG","page_title":"Lista de obras de arte pública da Madeira","context_page_description":"Este artigo tenciona fazer o inventário das obras de arte pública da Região Autónoma da Madeira, em Portugal. Todas as obras listadas são visíveis de ou estão em espaços públicos e são estátuas, bustos, esculturas abstratas, murais, fontenários e afins. A lista está organizada pelos municípios do arquipélago."},{"page_url":"https://en.wikipedia.org/wiki/2015%E2%80%932016_New_Zealand_flag_referendums","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/NZ_flag_design_Raranga_by_Pax_Zwanikken.jpg","page_title":"2015–2016 New Zealand flag referendums","context_page_description":"Two New Zealand flag referendums were held by the New Zealand Government in November/December 2015 and March 2016 and resulted in the retention of the current flag of New Zealand.\\nShortly after the referendum announcement, party leaders reviewed draft legislation and selected candidates for a Flag Consideration Panel. The purpose of this group was to publicise the process, seek flag submissions and suggestions from the public, and decide on a final shortlist of options. Open consultation and design solicitation garnered 10,292 design suggestions from the public, later reduced to a longlist of 40 designs and then a shortlist of four designs to contend in the first referendum.\\nThe first referendum took place between 20 November and 11 December 2015 and asked, \\"If the New Zealand flag changes, which flag would you prefer?\\" Voters were presented with several options selected by the Flag Consideration Panel. The black, white, and blue silver fern flag by Kyle Lockwood advanced to the second referendum.\\nThe second referendum took place between 3 and 24 March 2016 and asked voters to choose between the selected alternative and the existing New Zealand flag."},{"page_url":"https://ja.wikipedia.org/wiki/Red_Orchestra:_Ostfront_41-45","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Red_Orchestra_universalcarrier.jpg","page_title":"Red Orchestra: Ostfront 41-45","context_page_description":"『Red Orchestra: Ostfront 41-45』は、Tripwire Interactive社が開発したファーストパーソン・シューティングゲーム。"},{"page_url":"https://nl.wikipedia.org/wiki/Dominic_Sherwood","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Dominic_Sherwood_%2822429006997%29.jpg","page_title":"Dominic Sherwood","context_page_description":"Dominic Anthony Sherwood is een Brits acteur. Hij heeft onder meer gespeeld in Vampire Academy en de Netflixserie Shadowhunters, waarin hij de rol van Jace Wayland speelt. Sherwood poseert ook als model, onder meer voor Calvin Klein. Een van zijn ogen is blauw en de andere is driekwart bruin."},{"page_url":"https://hsb.wikipedia.org/wiki/W%C3%B3lby_do_sakskeho_krajneho_sejma_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Frauke-Petry-20130820.jpg","page_title":"Wólby do sakskeho krajneho sejma 2014","context_page_description":"Wólby do sakskeho krajneho sejma 2014 wotměchu so dnja 31. awgusta 2014 a běchu šeste wólby po znowazałoženju swobodneho stata Sakskeje w lěće 1990. Wólby termin bě posledni dźeń lětnych prózdnin, dwě njedźeli pozdźišo wotměchu so tež wólby w Braniborskej a Durinskej. Wólbne wobdźělenje wučinješe jenož 49,1 %, štož bě dotal najniši wuslědk w Sakskej."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%A8%D7%9B%D7%94_%D7%A4%D7%95%D7%9C%D7%93_(%D7%90%D7%95%D7%A0%D7%99%D7%99%D7%AA_%D7%9E%D7%A2%D7%A4%D7%99%D7%9C%D7%99%D7%9D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/%D7%90%D7%95%D7%A0%D7%99%D7%99%D7%AA_%D7%94%D7%9E%D7%A2%D7%A4%D7%99%D7%9C%D7%99%D7%9D_%D7%91%D7%A8%D7%9B%D7%94_%D7%A4%D7%95%D7%9C%D7%93_-_%D7%9E%D7%A1%D7%9C%D7%95%D7%9C.jpg","page_title":"ברכה פולד (אוניית מעפילים)","context_page_description":"ברכה פולד הייתה אוניית מעפילים שארגנה \\"ההגנה\\". נקראה על שם ברכה פולד מפקדת בפלמ\\"ח שנהרגה מאש בריטית בליל וינגייט."},{"page_url":"https://no.wikipedia.org/wiki/Theodor_Fr%C3%B8lich","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Theodor_Frolich_01.jpg","page_title":"Theodor Frølich","context_page_description":"Theodor Christian Brun Frølich var en norsk lege og professor i medisin som i 1938 ble nominert til Nobelprisen i medisin for sine banebrytende arbeider om Vitamin C og den fryktede skjørbuk."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%94%94%EC%A6%88%EB%8B%88_XD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Disney_XD_HD.png","page_title":"디즈니 XD","context_page_description":"디즈니 XD는 월트 디즈니 텔레비전의 자회사인 ABC 케이블 네트웍스 그룹에서 운영하고 있는 미국의 디지털 케이블 및 위성 텔레비전 방송국이다. 어린이를 주시청자로 하여 직접 또는 디즈니 채널에서 제작한 실사 및 애니메이션 등의 텔레비전 프로그램과 영화를 방송한다.\\n디즈니 XD는 채널 공급업체를 통한 스페인어 방송을 실시하는데, 기존의 채널에 음성 다중으로 스페인어 음성을 제공하거나 별도의 스페인어 채널을 통해 방송한다."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%87%BC%EB%82%98%EC%96%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Wikipedia-logo-v2-sn.png","page_title":"쇼나어","context_page_description":"쇼나어는 짐바브웨의 쇼나족이 사용하는 모어로서 가장 흔히 쓰이는 반투어이다. 이 용어는 중앙쇼나어 중 하나를 사용하는 민족을 식별하기 위해 사용하기도 한다."},{"page_url":"https://en.wikipedia.org/wiki/Monterey_Peninsula_Country_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Pebblebeach_par3.jpeg","page_title":"Monterey Peninsula Country Club","context_page_description":"The Monterey Peninsula Country Club is a golf club located in Pebble Beach, California."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D1%85%D1%96%D0%BD%D0%BE%D0%BA%D0%B0%D0%BA%D1%82%D1%83%D1%81_%D0%93%D1%80%D1%83%D0%B7%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Mammillaria_geminispina_%26_Golden_barrel_cactus%2C_echinocactus_grusonii%2C_Huntington_Library_Desert_Garden%2C_0275.jpg","page_title":"Ехінокактус Грузона","context_page_description":"Ехінока́ктус Грузо́на — вид роду ехінокактус. Описаний Генріхом Гільдманном у 1886 році."},{"page_url":"https://fr.wikipedia.org/wiki/Bafoussam","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Tam-tam_Boys.jpg","page_title":"Bafoussam","context_page_description":"Bafoussam est une ville du Cameroun, le chef-lieu de la région de l'Ouest, le chef-lieu du département de la Mifi et l'un des trois arrondissements du département de la Mifi. Elle a été érigée en Communauté urbaine de Bafoussam en 2008. Située en pays Bamiléké, Bafoussam est à la fois ville et village du peuple du même nom."},{"page_url":"https://nl.wikipedia.org/wiki/Palmse","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Wachsstein_palmse.jpg","page_title":"Palmse","context_page_description":"Palmse is een plaats in de Estlandse gemeente Haljala, provincie Lääne-Virumaa. De plaats heeft 61 inwoners en heeft de status van dorp.\\nPalmse ligt in het Nationaal park Lahemaa. Het dorp is vooral bekend vanwege zijn landhuis, dat als museum in gebruik is. In het park rond het landhuis ligt het meer Oruveski järv, 3,5 hectare groot."},{"page_url":"https://fr.wikipedia.org/wiki/K%C3%A4lbelespitze","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Kastenkopf_Kaelbelespitze_from_Lahnerkopf.JPG","page_title":"Kälbelespitze","context_page_description":"La Kälbelespitze est une montagne culminant à 2 135 m d'altitude dans les Alpes d'Allgäu."},{"page_url":"https://ceb.wikipedia.org/wiki/Hylurgus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Hylurgus_ligniperda.jpg","page_title":"Hylurgus","context_page_description":"Henero sa mga bakukang ang Hylurgus. Ang Hylurgus sakop sa kabanay nga Curculionidae."},{"page_url":"https://de.wikipedia.org/wiki/Eifel-H%C3%B6hen-Route","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Urfttalsperre.JPG","page_title":"Eifel-Höhen-Route","context_page_description":"Die Eifel-Höhen-Route ist ein Radwanderweg, der auf einem 230 Kilometer langen Rundkurs durch die Nordeifel führt. Dabei umrundet er den Nationalpark Eifel mit seinen großen Stauseen, durchquert den Naturpark Hohes Venn-Eifel und stattet den Flüssen Ahr, Urft, Kyll und Rur einen Besuch ab. Der Routenverlauf ist geprägt durch die Naturlandschaften der Eifel, bietet aber auch einige historische Orte wie Monschau und Blankenheim sowie die ehemalige NS-Ordensburg Vogelsang.\\nDie Route verläuft vorwiegend auf Rad- und Wirtschaftswegen, teilweise aber auch auf kleineren Straßen. Für Rennräder ist die Route nur abschnittsweise geeignet. Von den konditionellen Anforderungen wird sie als \\"sportlich\\" beschrieben. Die Route ist in beide Richtungen einheitlich mit dem Radwege-Logo beschildert."},{"page_url":"https://fr.wikipedia.org/wiki/Tramway_de_Moscou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Tatra_T7B5_MSK.jpg","page_title":"Tramway de Moscou","context_page_description":"Le tramway de Moscou est le réseau de tramways de la ville de Moscou, en Russie. Il comporte 50 lignes. Construit à partir de 1872, il est officiellement mis en service le 7 juillet 1899.\\nL'exploitation du réseau de tramways est assurée par Mosgortrans, un établissement public qui gère également le réseau de bus et de trolleybus de Moscou.\\nCe réseau est complémentaire au réseau de métro de la ville."},{"page_url":"https://hu.wikipedia.org/wiki/Karoling_m%C5%B1v%C3%A9szet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/M%C3%9CSTAIR_P1040767xyz.jpg","page_title":"Karoling művészet","context_page_description":"Karoling művészetnek nevezzük a Nagy Károly és közvetlen utódai uralkodása alatt készült műalkotások együttesét. A karoling művészet virágkora körülbelül száz évig tartott, a 8. század végétől a 9. század végéig. Nagy Károly aacheni udvarában művészek és tudósok gyülekeztek, másolták a római irodalmi műveket, templomokat építettek, mozaikokkal és freskókkal díszítették őket, a könyveket miniatúrákkal ékesítették, s elefántcsontot faragtak. Tanulmányozták a természettudományokat csakúgy, mint a világi irodalmat és az egyházatyák munkásságát. A lemásolt szövegek biztosították a latin irodalom fennmaradását. A Római Birodalom bukása után ez volt az első kísérlet, hogy Nyugat-Európában újjáélesszék az antik hagyományokat. A karoling művészet vívmányait az utána következő Ottó-kori művészet, majd később a román stílusú művészet fejlesztette tovább."},{"page_url":"https://fr.wikipedia.org/wiki/Wellington","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Wellington_photo_montage.jpg","page_title":"Wellington","context_page_description":"Wellington est la capitale de la Nouvelle-Zélande. Deuxième ville la plus peuplée du pays après Auckland avec 412 000 habitants en 2017, elle est située à l'extrémité sud de l'île du Nord, dans la région de Wellington. Cette situation en fait la capitale la plus australe au monde depuis 1865 et l'obtention de son statut. L'aire urbaine de Wellington s'étend au-delà des frontières de son administration territoriale. Le Grand Wellington ou la région de Wellington comprend toute l'aire urbaine ainsi que les villes, les régions rurales, la côte Kapiti, la chaîne des monts Remutaka et la Wairarapa.\\nLes principales institutions financières néo-zélandaises sont réparties entre la capitale et Auckland ; certaines organisations ont des bureaux dans les deux villes. Wellington est en revanche le centre politique de la Nouvelle-Zélande, le siège des institutions parlementaires, des ministères et des départements d'État. Son centre-ville dense est le foyer d'une scène artistique, d'une culture des cafés et d'une vie nocturne que pourraient lui envier bon nombre de villes de taille similaire."},{"page_url":"https://et.wikipedia.org/wiki/George_Herbert_Mead","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/George_Herbert_Mead.jpg","page_title":"George Herbert Mead","context_page_description":"George Herbert Mead oli ameerika filosoof, sotsioloog ja psühholoog.\\nMead töötas Chicago Ülikoolis ning filosoofilistelt vaadetelt kuulus pragmatistide hulka. Ta on üks sotsiaalpsühholoogia rajajaid, samuti ameerika sotsioloogia alusepanijaid. George Herbert Meadi peetakse üheks sümbolilise interaktsionismi rajajaks."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Zentralafrikanischen_Republik","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Zentralafrikanische-republik-karte-politisch.png","page_title":"Geschichte der Zentralafrikanischen Republik","context_page_description":"Die Geschichte der Zentralafrikanischen Republik ist geprägt von der französischen Kolonialzeit seit dem 19. Jahrhundert, der Unabhängigkeit 1960, dem Zentralafrikanischen Kaiserreich unter Bokassa und seit den 1990er Jahren von Demokratisierungsversuchen und Bürgerkriegen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D8%B7%D8%A8_%D8%B3%D9%81%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/%28%28%28_%D9%86%D9%85%D8%A7%DB%8C%DB%8C_%D8%A7%D8%B2_%D8%B1%D9%88%D8%B3%D8%AA%D8%A7%DB%8C_%D8%AE%D8%B7%D8%A8_%D9%85%D8%B1%D8%A7%D8%BA%D9%87%29%29%29_-_panoramio_%281%29.jpg","page_title":"خطب سفلي","context_page_description":"خطب سفلي هي قرية في مقاطعة مراغة، إيران. عدد سكان هذه القرية هو 167 في سنة 2006."},{"page_url":"https://pl.wikipedia.org/wiki/Kattara","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/The_Qattara_Depression%2C_Egypt%2C_Matruh_Governate.png","page_title":"Kattara","context_page_description":"Kattara – depresja w północno-zachodnim Egipcie na Pustyni Libijskiej, w muhafazie Matruh, głębokość 133 m p.p.m., powierzchnia 18,0 km². Jest to najniższy punkt w Egipcie.\\nPrzesiąkanie słonych wód z Morza Śródziemnego sprawia powstawanie na dnie depresji Kattara słonych bagien, które całkowicie uniemożliwiają uprawy rolnicze."},{"page_url":"https://de.wikipedia.org/wiki/Vopli_Vidopliassova","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Voplimuenchen.JPG","page_title":"Vopli Vidopliassova","context_page_description":"Vopli Vidopliassova ist eine ukrainische Band, die Jazz, Folk, Hardcore Punk und andere Stile in ihre Musik kombiniert. Ihr Lied „Den Narodschennja“ ist in dem Film Der Bruder des russischen Regisseurs Alexei Balabanow und dessen Fortsetzung vertreten. Bandmitglied Oleh Skrypka hat selbst mehrere Soloalben veröffentlicht.\\nDie Band war im Februar 2010 zum ersten Mal auf einer Tour in Deutschland."},{"page_url":"https://lt.wikipedia.org/wiki/Dobrinkos_gele%C5%BEinkelio_stotel%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Dobrynka.JPG","page_title":"Dobrinkos geležinkelio stotelė","context_page_description":"Dobrinkos geležinkelio stotelė – geležinkelio stotelė Dobrinkos kaime, rytų Lenkijoje, Liublino vaivadijoje, Palenkės Bialos apskrityje, Piščaco valsčiuje. Stotelė priklauso Varšuva-Terespolis geležinkelio linijai. Iki Malaševiče Poludniovės geležinkelio stoties yra 5,1 km ir iki Chotiluvo geležinkelio stoties yra 5,9 km."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A4%D1%80%D1%8B%D0%B4%D1%80%D1%8B%D1%85_%D0%A8%D1%8B%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Nationaltheater_Mannheim.jpg","page_title":"Фрыдрых Шылер","context_page_description":"Ё́ган Кры́стаф Фры́дрых фон Шы́лер — нямецкі паэт, філёзаф, гісторык і драматург, прадстаўнік рамантычнага кірунку ў літаратуры. Увайшоў у гісторыю сусьветнае літаратуры як палымяны абаронца чалавечае асобы. Цягам часу апошніх сямнаццаці гадоў яго жыцьця, Шылер сябраваў з ужо вядомым і ўплывовым Ёганам Вольфґанґам Ґётэ, зь якім ён абмяркоўваў пытаньні па эстэтыцы і натхняў Ґётэ на заканчэньне яго твораў, пакінутых у чарнавым варыянце. Гэты пэрыяд сяброўства двух паэтаў і іхнае літаратуразнаўчае палемікі ўвайшоў у нямецкую літаратуру пад назвай ваймарскі клясыцызм."},{"page_url":"https://ga.wikipedia.org/wiki/Gealacha_Galileo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ganymede%2C_moon_of_Jupiter%2C_NASA.jpg","page_title":"Gealacha Galileo","context_page_description":"Tá an dúrud de ghealacha ag timpeallú Iúpatair, nó sa bhliain 2006, bhí níos mó ná trí scór acu tugtha faoi deara. Is gnách gealacha Galileo a thabhairt ar an gceithre cinn is mó acu, nó b'é Galileo Galilei ba thúisce a chuir sonrú iontu, mar atá, thiar sa bhliain 1610. Briseadh mór a bhí ann i stair na réalteolaíochta Iartharaí, nó go dtí sin, bhí an bharúil sách coitianta go mbeadh gach rinn neimhe eile ag timpeallú an Domhain, agus nach mbeidís aon réad eile a fhithisiú ar aon nós. Thaispeáin fionnachtain na ngealach seo nárbh amhlaidh in aon chor.\\nTugtar Io, Europa, Ganymede agus Callisto ar ghealacha Galileo. Rothlú sioncrónach atá fúthu go léir, is é sin, tá siad á gcasadh ar a n-aiseanna de réir is mar atá siad ag dul timpeall Iúpatair, i gcruth is go bhfuil an aghaidh chéanna orthu an t-am ar fad, de réir mar a d'fheicfeadh an breathnóir ar dhromchla Iúpatair iad. Is féidr iad a fhéiceáil ón Domhan le teileascóp beag agus iad ag dul trasna aghaidh an phláinéid."},{"page_url":"https://lv.wikipedia.org/wiki/Johans_L%C4%93berehts_Eginks","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Ivan_Krylov_by_Eggink.jpg","page_title":"Johans Lēberehts Eginks","context_page_description":"Johans Lēberehts Eginks bija vēstures ainu gleznotājs un portretists, kurš darbojās tagadējā Latvijas teritorijā 19. gadsimta sākumā. Viens no slavenākajiem Eginka darbiem ir \\"Odisejs un Nausikaja\\", ar Latvijas vēsturi visciešāk saistīta glezna \\"Aleksandrs I dāvina brīvību Baltijas provinču zemniekiem\\". J.L.Eginks tiek uzskatīts par pirmo latviešu izcelsmes gleznotāju, kurš ieguva akadēmiķa grādu."},{"page_url":"https://la.wikipedia.org/wiki/Tarabel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Map_commune_FR_insee_code_31551.png","page_title":"Tarabel","context_page_description":"Tarabel est commune Francicum 363 incolarum praefecturae Garunnae Superioris in regione australi Meridiano et Pyrenaeis."},{"page_url":"https://es.wikipedia.org/wiki/Barranco_de_la_Hoz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Barranco_de_la_Hoz.jpg","page_title":"Barranco de la Hoz","context_page_description":"El Barranco de la Hoz es un cañón fluvial labrado por el río Gallo a la altura del municipio español de Corduente. Está ubicado en el Sistema Ibérico y forma parte del parque natural del Alto Tajo. Está propuesto como «Global Geosite» por el Instituto Geológico y Minero de España por su interés estratigráfico.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%B5%D1%87%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D1%82%D0%BE%D1%87%D0%BA%D0%B8_%D1%82%D1%80%D0%B5%D1%83%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Triangle.Orthocenter.svg","page_title":"Замечательные точки треугольника","context_page_description":"Замечательные точки треугольника — точки, местоположение которых однозначно определяется треугольником и не зависит от того, в каком порядке берутся стороны и вершины треугольника.\\nОбычно они расположены внутри треугольника, но и это не обязательно. В частности, точка пересечения высот может находиться вне треугольника.\\nДругие замечательные точки треугольника см. в энциклопедии центров треугольника."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B1%A5%E8%9E%BA%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Cr%C3%A9pidules_groupe.jpg","page_title":"履螺屬","context_page_description":"履螺属是海螺的一属，属于舟螺科的海洋腹足纲软体动物。\\n履螺属可能是舟螺科下最为人所知的一属。其下多个物种在发育、生态及行为方面都有不少研究。\\n它们一直是海洋无脊椎动物突发性别转变研究的主要焦点，并已用于证明性别转变可经由环境介导的。\\n大西洋舟螺及拖鞋舟螺最常用于海洋栖息地的入侵物种的研究"},{"page_url":"https://nn.wikipedia.org/wiki/Caracas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/EstatuaDelLibertadorEnLaPlazaBolivar2004-6.jpg","page_title":"Caracas","context_page_description":"Caracas er hovudstaden i Venezuela, og har rundt 1,7 millionar innbyggjarar, 3,6 millionar medrekna byar og tettstader omkring. Byen ligg nord i landet, nær det karibiske havet.\\nCaracas er fødebyen til Francisco de Miranda og El Libertador, Simón Bolívar."},{"page_url":"https://lt.wikipedia.org/wiki/Pl%C4%97%C5%A1riablak%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Reduvius_personatus.JPG","page_title":"Plėšriablakės","context_page_description":"Plėšriablakės sin. blakės plėšrūnės – plėšri blakių šeima.\\nŠiai šeimai priklauso 7–40 mm ilgio, dažniausiai tamsūs, rečiau ryškiai raštuoti, tvirto sudėjimo vabzdžiai. Dažniausiai jų kūnas yra gana platus, pailgas, o kojos stiprios. Tačiau yra ir tokių rūšių, kurioms būdingas ypač siauras kūnelis, o kojos yra ilgos ir siūliškos. Galva cilindriška, pailga. Straubliukas trumpas, storas ir sulenktas, dažniausiai sudarytas iš 3, kartais iš 4 narelių. Antenų nareliai maždaug vienodo storio, ilgi, ploni, dažniausiai iš 4 narelių. Prieškrūtinėlė su randuotu grioveliu, kuris veikia kaip garsinis aparatas, skleidžiantis girgždantį garsą.\\nŠios blakės gyvena ant medžių, tarp žolių, dirvos paviršiuje, o kai kada ir paukščių lizduose, graužikų urvuose, po akmenimis. Pastebėta, kad jos labai aktyvios naktį, o dieną dažniausiai slepiasi. Šios blakės yra plėšrios ir labai ėdrios: užpuola kitus vabzdžius, straubliuku įduria, nužudo bei išsiurbia. Didesnių plėšriablakių įdūrimas žmogui labai skausmingas. Kai kurios šios šeimos atstovės yra kraujasiurbės ir Centrinėje bei Pietų Amerikoje platina žmogui labai pavojingą Čagaso ligą."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E9%98%BF%E8%8A%92%E4%BB%A3%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Barrage_Maury_retenue_Selves.jpg","page_title":"圣阿芒代科","context_page_description":"圣阿芒代科，法国阿韦龙省的一个市镇，位于该省北部偏东，属于罗德兹区，其市镇面积为41.51平方公里，2017年1月1日时人口数量为754人。\\n圣阿芒代科是欧布拉克、卡尔拉代兹和维亚代讷市镇公共社区的组成部分。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E4%B8%AD%E5%B8%82%E5%8C%97%E5%B1%AF%E5%8D%80%E5%9B%9B%E7%B6%AD%E5%9C%8B%E6%B0%91%E5%B0%8F%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/%E5%8F%B0%E4%B8%AD%E5%B8%82%E5%9B%9B%E7%B6%AD%E5%9C%8B%E5%B0%8F.JPG","page_title":"臺中市北屯區四維國民小學","context_page_description":"台中市北屯区四维国民小学位于台中市北屯区，创立于1992年2月1日，邻近于二分埔、大坑口。该校于2006年3月创建台湾少数拥有的“客语教学资源中心”。兴建中的台中捷运绿线将在学校旁设置四维国小站。学校后方为北屯儿童馆以及北屯儿童公园，有供校内学生行走的天桥相连。"},{"page_url":"https://fr.wikipedia.org/wiki/Base_antarctique_Machu_Picchu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/EXPEDICIONARIOS_PERUANOS_CONTIN%C3%9AAN_LABORES_EN_LA_ANT%C3%81RTIDA_%2816412593696%29.jpg","page_title":"Base antarctique Machu Picchu","context_page_description":"La base antarctique Machu Picchu est une base péruvienne sur l'île du Roi-George au nord de la péninsule Antarctique. Située au fond de la baie de l'Amirauté, elle est voisine de la base brésilienne Comandante Ferraz et de la base polonaise Henryk Arctowski.\\nElle est nommée en hommage à Machu Picchu, lieu inscrit au patrimoine mondial de l'UNESCO.\\nLa base est administrée par l'Institut antarctique du Pérou."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B0%D0%BD%D0%B4%D0%B0%D1%80%D1%8F%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D0%B4%D0%BE%D1%85%D1%80%D0%B0%D0%BD%D0%B8%D0%BB%D0%B8%D1%89%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Spandaryanresvoir.jpg","page_title":"Спандарянское водохранилище","context_page_description":"Спандаря́нское водохрани́лище — второе по водным запасам водохранилище в Армении. Спандарянское водохранилище расположено на юге Армении, на севере Сюникской области, построено на реке Воротан.\\nОбъём водохранилища составляет 257 млн м³.\\nБлиз водохранилища расположены села: Горайк, Цчук, Сарнакунк, Спандарян."},{"page_url":"https://de.wikipedia.org/wiki/Argentinien","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Monumento_Caidos_Malvinas.jpg","page_title":"Argentinien","context_page_description":"Argentinien ist eine Republik im Süden Südamerikas. Sie grenzt im Westen an Chile, im Norden an Bolivien und Paraguay, im Nordosten an Brasilien und Uruguay und wird im Osten durch den Atlantischen Ozean begrenzt.\\nDer Landesname leitet sich von der lateinischen Bezeichnung für Silber – argentum – ab und stammt aus der spanischen Kolonialzeit, als man hier Edelmetalle zu finden hoffte. Bis zu seiner Unabhängigkeit 1816 war es Teil des spanischen Kolonialreiches. Politisch ist Argentinien eine präsidentielle Bundesrepublik, in der die einzelnen Provinzen weitreichende Kompetenzen haben.\\nMit einer Fläche von knapp 2,8 Mio. km² ist Argentinien der achtgrößte Staat der Erde und der zweitgrößte des südamerikanischen bzw. der viertgrößte des amerikanischen Doppelkontinentes. Wegen seiner großen Nord-Süd-Ausdehnung hat das Land Anteil an mehreren Klima- und Vegetationszonen. Im Hinblick auf die Einwohnerzahl steht es mit rund 44 Millionen Einwohnern in Südamerika an dritter und in ganz Amerika an fünfter Stelle."},{"page_url":"https://it.wikipedia.org/wiki/Brickell","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Miami_FL_Fire_Station_4-01.jpg","page_title":"Brickell","context_page_description":"Brickell è un quartiere residenziale di Miami, nella Contea di Miami-Dade della Florida, negli Stati Uniti d'America. L'area della zona è di 3,1 km² e la popolazione nel 2011 di 31.759 abitanti.\\nBrickell fa parte di Downtown Miami ed è il maggiore distretto finanziario di Miami e della Florida meridionale."},{"page_url":"https://nl.wikipedia.org/wiki/Lantaarnconsoles_in_de_Utrechtse_Binnenstad","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Console_Unie_van_Utrecht.JPG","page_title":"Lantaarnconsoles in de Utrechtse Binnenstad","context_page_description":"De lantaarnconsoles in de Utrechtse Binnenstad zijn ongeveer 330 gebeeldhouwde consoles aangebracht onder lantaarnpalen langs de grachten in de Utrechtse Binnenstad. Deze zijn vanaf 1953 met de grootschalige restauraties van de stadsbinnengrachten met de werfkelders, werven en bruggen aangebracht. Ook zijn gebeeldhouwde consoles te vinden langs de Stadsbuitengracht."},{"page_url":"https://fr.wikipedia.org/wiki/Marine_%C3%A9quatorienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/DN-SN-97-01703.jpg","page_title":"Marine équatorienne","context_page_description":"La Marine équatorienne est une composante des Forces armées équatoriennes."},{"page_url":"https://fr.wikipedia.org/wiki/J%C3%BAnior_Moreno","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/J%C3%BAnior_Moreno_2019-06-09_%28cropped%29.jpg","page_title":"Júnior Moreno","context_page_description":"Júnior Moreno est un footballeur international vénézuélien né le 20 juillet 1993 à San Cristóbal. Il évolue au poste de milieu de terrain au D.C. United en MLS."},{"page_url":"https://sl.wikipedia.org/wiki/Rjavi_pajek_samotar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Brown-recluse-coin-edit.jpg","page_title":"Rjavi pajek samotar","context_page_description":"Rjavi pajek samotar je strupeni pajek iz družine Sicariidae, katerega ugriz lahko povzroči obsežno nekrozo tkiva v območju ugriza. Lahko so rjave, sive ali temno rumene barve, na hrbtni strani glavoprsja pa navadno poteka črni pas v obliki violine, katere vrat je usmerjen proti zadku. Zaradi tega nosi pajek različne vzdevke, kot sta violinski pajek ali goslarski pajek. Prebiva na vzhodnem območju ZDA do Mehiškega zaliva."},{"page_url":"https://it.wikipedia.org/wiki/Provincia_di_Ifugao","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Ph_seal_ifugao.png","page_title":"Provincia di Ifugao","context_page_description":"Ifugao è una provincia delle Filippine, situata nella parte centrale di Luzon nella Regione Amministrativa Cordillera.\\nIl capoluogo è Lagawe."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CF%85%CE%BC%CF%80%CF%84%CF%83%CF%8C%CE%B2%CF%83%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Rubcovsk-Lenin.jpg","page_title":"Ρουμπτσόβσκ","context_page_description":"Το Ρουμπτσόβσκ είναι πόλη στο Κράι Αλτάι της Ρωσίας, που βρίσκεται στον ποταμό Αλέι 281 χιλιόμετρα νοτιοδυτικά του Μπαρναούλ. Ο πληθυσμός ήταν 147.002 άτομα στην απογραφή του 2010. Το 2002 είχε πληθυσμό 163.063 κατοίκων, και στην απογραφή του 1989 είχε πληθυσμό 171.792 κατοίκων. Το 1975 είχε πληθυσμό 167.000 κατοίκων, το 1959 είχε πληθυσμό 111.000 κατοίκων και το 1939 είχε πληθυσμό 38.000 κατοίκων."},{"page_url":"https://en.wikipedia.org/wiki/Queen%27s_Police_Medal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Politiemedailles_van_het_Verenigd_Koninkrijk_Elizabeth_II.jpg","page_title":"Queen's Police Medal","context_page_description":"The Queen's Police Medal is awarded to police officers in the United Kingdom and Commonwealth of Nations, for gallantry or distinguished service. It was created on 19 May 1954, when it replaced the King's Police and Fire Services Medal, which itself replaced the King's Police Medal in 1940. The KPM was introduced by a Royal Warrant of 7 July 1909, initially inspired by the need to recognise the gallantry of the police officers involved in the Tottenham Outrage."},{"page_url":"https://fi.wikipedia.org/wiki/Venezuelan_kansallispuistot","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Caminata_en_la_sierra_de_perija.jpg","page_title":"Venezuelan kansallispuistot","context_page_description":"Venezuelan kansallispuistot ovat luonnonsuojelualueita Venezuelassa. Ne kattavat yli viidesosan maan pinta-alasta. Canaiman kansallispuisto on myös Unescon maailmanperintökohde.\\n2000-luvun talouskriisin aikana puistojen tila on huonontunut hälyttävästi, kun puistot menettävät sekä budjettirahoitusta että matkailutuloja. Puistoja tuohoavat laiton kaivostoiminta, metsänhakkuut, maanviljelys ja tienrakennus. Etenkin Yapacanan kansallispuisto on huonossa kunnossa kullankaivajien jäljiltä. Sissijoukot ja huumeiden salakuljettajat käyttävät joitakin puistoja suojapaikkoinaan."},{"page_url":"https://en.wikipedia.org/wiki/Toyota_Alphard","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/2015_Toyota_Vellfire_ZA.jpg","page_title":"Toyota Alphard","context_page_description":"The Toyota Alphard is a minivan produced by the Japanese automaker Toyota since 2002. It is available as a seven- or eight-seater with petrol and hybrid engine options. Hybrid variants have been available since 2003 and it incorporates Toyota's Hybrid Synergy Drive technology. The vehicle was named after Alphard, the brightest star in the constellation Hydra.\\nThe Alphard is marketed as a luxury van and is primarily made for the Japanese market, but is also sold in Bangladesh, Belarus, Russia, The Middle East, Greater China and Southeast Asia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%83%D1%8D%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Rauener_Steine_I.jpg","page_title":"Рауэн","context_page_description":"Рауэн — коммуна в Германии, в земле Бранденбург.\\nВходит в состав района Одер-Шпре. Подчиняется управлению Шпренхаген. Население составляет 1948 человек. Занимает площадь 21,38 км². Официальный код — 12 0 67 408."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%99%E1%83%A3%E1%83%9E%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/10_000_%D0%BA%D1%83%D0%BF%D0%BE%D0%BD%D0%BE%D0%B2_%D0%BB%D0%B0%D1%80%D0%B8._1._1993.jpg","page_title":"ქართული კუპონი","context_page_description":"ქართული კუპონი — საქართველოს ფულის ერთეული 1993 წლის 5 აპრილიდან 1995 წლის 2 ოქტომბრამდე. 1993 წლის 20 აგვისტოდან წარმოადგენდა გადახდის ერთადერთ კანონიერ საშუალებას საქართველოს ტერიტორიაზე. თავდაპირველად კურსი რუბლის თანაბარი იყო, სწორედ რომლის შემცვლელიც იყო ეს ვალუტა. გამოდიოდა მხოლოდ ბანკნოტები, რაოდენობით 1-დან 1 000 000 კუპონამდე. კუპონი ჰიპერ ინფლაციის ქვეშ ექცეოდა და შეცვლილი იყო ახალი ეროვნული ვალუტის მიერ — ლარი კოეფიციენტით 1 000 000: 1."},{"page_url":"https://en.wikipedia.org/wiki/Klundert","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Klundert%2C_de_Johannes_de_Doperkerk_foto6_2015-05-24_18.10.jpg","page_title":"Klundert","context_page_description":"Klundert is a city in the Dutch province of North Brabant. It is located close to the Hollands Diep, about 3 km northwest of Zevenbergen. It received city rights in 1357.\\nKlundert was a separate municipality until 1997, when it became a part of Moerdijk."},{"page_url":"https://nl.wikipedia.org/wiki/Minysynchiropus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/HimeTG.jpg","page_title":"Minysynchiropus","context_page_description":"Minysynchiropus is een monotypisch geslacht van straalvinnige vissen uit de familie van pitvissen."},{"page_url":"https://ru.wikipedia.org/wiki/Blues_Company","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Blues_Company_250710_0790000.jpg","page_title":"Blues Company","context_page_description":"«Blues Company» — немецкая блюз-группа, образованная в 1976 году в Оснабрюке.\\nОни вместе с группами Frankfurt City Bluesband, Pee Wee Bluesgang и Band Das dritte Ohr были зачинателями блюзовой музыки в Германии."},{"page_url":"https://az.wikipedia.org/wiki/M%C3%BCq%C9%99dd%C9%99s_Antoninin_%C9%99zablar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/The_Torment_of_Saint_Anthony_%28Michelangelo%29.jpg","page_title":"Müqəddəs Antoninin əzabları","context_page_description":"Müqəddəs Antoninin əzabları - İtaliya rəssamı Mikelancelo tərəfindən 1488-ci ildə tamamlanmış rəsm əsəri. Hazırda ABŞ-ın Texas ştatının Fort-Uort şəhərində yerləşən Kimbell İncəsənət Muzeyində sərgilənir."},{"page_url":"https://pt.wikipedia.org/wiki/Convair_240","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Convair_340_by_NASA.jpg","page_title":"Convair 240","context_page_description":"O Convair foi uma aeronave de passageiros produzida pela Consolidated Vultee de 1947 até 1956. O projeto tomou forma como uma solicitação da American Airlines para uma aeronave pressurizada para substituir o clássico Douglas DC-3."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%95%D0%A6_%D0%9A%D1%80%D1%8A%D1%88%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/NE-Krsko.JPG","page_title":"АЕЦ Кръшко","context_page_description":"АЕЦ Кръшко е атомна елекрическа централа в град Кръшко, Словения.\\nЦентралата започва работа на 15 януари 1983 г. Построена е по проект на Хърватия и Словения, които по онова време са съюзни републики в Югославия. Планираната дата за прекратяване на дейността на централата е 14 януари 2023 г.\\nВ момента е активен само 1 реактор на централата, който произвежда 730 MW енергия. Собственик на централата е смесената словенско-хърватска компания „Нуклеарна електрарна Кръшко“."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D1%84%D0%B5%D0%BA%D1%82_%D0%B2%D0%BE%D0%BB%D0%BE%D0%B4%D1%96%D0%BD%D0%BD%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/ValunFunProspectTheory2.png","page_title":"Ефект володіння","context_page_description":"В поведінковій економіці, ефект володіння — це гіпотеза, що люди надають більшої цінності речам лише тому, що володіють ними. Ефект демонструється тим, що люди готові сплатити більше за щось, чим володіють, ніж за те, чим володіє хтось інший, навіть якщо в них не має причин для прив'язаності або вони це отримали лише декілька хвилин тому."},{"page_url":"https://af.wikipedia.org/wiki/Verenigde_State_van_Amerika","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/USA_Squad_Photo_2017.jpg","page_title":"Verenigde State van Amerika","context_page_description":"Die Verenigde State van Amerika, in die omgangstaal ook net Amerika genoem, is 'n federale republiek in die Westelike Halfrond wat uit vyftig deelstate, 'n federale distrik, vyf groter selfregerende gebiede en enkele kleiner eilandbesittings in die Stille Oseaan en die Karibiese See bestaan. 48 van sy deelstate en die federale distrik lê in Sentraal-Noord-Amerika tussen die Stille Oseaan in die weste en die Atlantiese Oseaan in die ooste en word in die noorde deur Kanada en in die suide deur Meksiko begrens. Die deelstaat Alaska lê in die noordweste van die Noord-Amerikaanse vasteland en grens in die ooste aan Kanada, terwyl dit in die weste deur die Beringstraat van die Russiese Federasie geskei word. Die deelstaat Hawaii is 'n eilandgroep in die middel van die Stille Oseaan.\\nDie Verenigde State beslaan altesaam veertig persent van die Noord-Amerikaanse vasteland. Met meer as 9,8 miljoen vierkante kilometer en 'n bevolking van sowat 325,7 miljoen is die VSA die derde grootste land ter wêreld ten opsigte van sy oppervlakte en bevolking. Sy grondgebied strek oor nege amptelike tydsones."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8D%B0%EB%A6%AD_%EC%8B%A4%EB%9F%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Derek_Theler_%28cropped%29.jpg","page_title":"데릭 실러","context_page_description":"데릭 실러는 미국의 배우, 모델이다. 시트콤 《베이비 대디》의 주연 대니 역이 대표 배역이다. 밸리언트 코믹스 원작의 실사 웹 드라마 《닌잭 대 밸리언트 유니버스》에 히어로 XO 맨오워 역으로 캐스팅되었다."},{"page_url":"https://id.wikipedia.org/wiki/Pesawat_terbang","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Bell_X-1_in_the_belly_of_a_B-29.jpg","page_title":"Pesawat terbang","context_page_description":"Pesawat terbang adalah pesawat udara yang lebih berat dari udara, bersayap tetap, dan dapat terbang dengan tenaga sendiri. Secara umum istilah pesawat terbang sering juga disebut dengan pesawat udara atau kapal terbang atau cukup pesawat dengan tujuan pendefenisian yang sama sebagai kendaraan yang mampu terbang di atmosfer atau udara. Namun dalam dunia penerbangan, istilah pesawat terbang berbeda dengan pesawat udara, istilah pesawat udara jauh lebih luas pengertiannya karena telah mencakup pesawat terbang dan helikopter."},{"page_url":"https://hu.wikipedia.org/wiki/Szent_Gy%C3%B6rgy-fatemplom_(Sz%C3%A1ka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Saca_BH.bis_lemn.SE.jpg","page_title":"Szent György-fatemplom (Száka)","context_page_description":"A szákai Szent György-fatemplom műemlékké nyilvánított épület Romániában, Bihar megyében. A romániai műemlékek jegyzékében a BH-II-m-B-01192 sorszámon szerepel."},{"page_url":"https://pl.wikipedia.org/wiki/Javornice","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Javornice-RK-obecn%C3%AD-%C3%BA%C5%99ad-kostel-sv-Ji%C5%99%C3%AD-2012a.jpg","page_title":"Javornice","context_page_description":"Javornice – gmina w Czechach, w powiecie Rychnov nad Kněžnou, w kraju hradeckim. Według danych z dnia 1 stycznia 2014 liczyła 985 mieszkańców."},{"page_url":"https://pt.wikipedia.org/wiki/Macedo_do_Mato","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bandeira_de_Macedo_do_Mato.jpg","page_title":"Macedo do Mato","context_page_description":"Macedo do Mato é uma aldeia e freguesia portuguesa do concelho de Bragança, com 15,54 km² de área e 208 habitantes. A sua densidade populacional é de 13,4 hab/km².\\nFez parte do concelho de Izeda até à sua extinção em 1855."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B6%E5%B0%94%E5%A4%9A%E6%96%AF%C2%B7%E6%96%AF%E6%A2%85%E6%89%98%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Yeldos_Smetov_2016_stamp_of_Kazakhstan.jpg","page_title":"叶尔多斯·斯梅托夫","context_page_description":"|-\\n| style=\\"text-align:center;vertical-align:middle;\\" | || style=\\"text-align:center;vertical-align:middle;\\" | 2013年曼谷|| style=\\"text-align:center;vertical-align:middle;\\" | –60 kg}}\\n叶尔多斯·巴基巴依·斯梅托夫，哈萨克斯坦柔道运动员，参加60公斤级比赛。他赢得了2014年亚运会和2015年世界柔道锦标赛冠军，并在2016年奥运会上获银牌。\\n斯梅托夫于2010年和2011年在世界杯青年组比赛中分别获得金牌和铜牌。2012年，他成为国家队队员。他在2013年亚洲柔道冠军获铜牌，萨姆松大奖赛及比利斯欧洲杯表演赛上获两块银牌，并在华沙举办的欧洲杯公开赛上获柔道金牌。斯梅托夫的第一教练是Akhmet Zhumagulov。\\n斯梅托夫生于塔拉兹，父亲是商人，母亲是家庭主妇，哥哥是职业柔道运动员。他曾在哈萨克国立大学主修生物技术。5岁跟随他的哥哥第一次练柔道。 他曾经练过拳击、跆拳道、摔跤、Sambo，最后专攻柔道，成为职业运动员。"},{"page_url":"https://zh.wikipedia.org/wiki/LG_V30","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/LG_V30_%28cropped%29.jpg","page_title":"LG V30","context_page_description":"LG V30是由LG電子製造的一款Android智慧型手機，於2017年8月31日發布，為LG V20的後續機種，跟G系列不同的地方在於，V系列為主打搭載 Hi-Fi DAC 音質的大螢幕手機。V30對比上代V20，放棄右上輔助次螢幕，並把螢幕比例拉到18:9，尺寸提升到6吋，材質改為自家的P-OLED，增加了IP68防水防塵。並有儲存空間為128G的V30+，台灣引進為此版本，於2017年12月底上市。韓國團體TWICE代言該手機。同期最大的競爭對手為三星Galaxy Note 8、Sony Xperia XZ1、HTC U11+、Apple iPhone X、小米Mix2、華碩Zenfone 4 Pro、Nokia 8、和LG代工的規格類似的機種Google Pixel 2 XL。"},{"page_url":"https://vi.wikipedia.org/wiki/Mimusops_caffra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Mimusops_caffra_green_fruit.JPG","page_title":"Mimusops caffra","context_page_description":"Mimusops caffra là một loài thực vật có hoa trong họ Hồng xiêm. Loài này được E.Mey. ex A.DC. mô tả khoa học đầu tiên năm 1844."},{"page_url":"https://it.wikipedia.org/wiki/Melbury_Osmond","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Melbury_Osmond_parish_church%2C_tower_detail_-_geograph.org.uk_-_518482.jpg","page_title":"Melbury Osmond","context_page_description":"Melbury Osmond è un villaggio e parrocchia civile dell'Inghilterra, appartenente alla contea del Dorset."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8F%D0%B5%D0%BD%D0%B5-%D0%92%D1%96%D1%80%D1%83%D0%BC%D0%B0%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Vihula_m%C3%B5isa_peahoone_2012.jpg","page_title":"Ляене-Вірумаа","context_page_description":"Ля́ене-Ві́румаа — повіт в Естонії, розташований в північно-східній частині країни. З півночі омивається водами Фінської затоки. Межує з повітами Іда-Вірумаа на сході, Йиґевамаа на півдні і Гар'юмаа і Ярвамаа на заході. Адміністративний центр — місто Раквере. Повіт в адміністративному відношенні поділяється на 2 міста і 13 волостей. Південна частина повіту лежить у межах Пандівереської височини. Там розташовується обширна карстова зона, звідки беруть початок багато річок."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%92%B0%E5%B3%B61%E5%8F%B7%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%E6%96%B0%E7%AB%B9%E6%B5%B7%E4%B9%8B%E8%81%B2_%2831365901370%29.jpg","page_title":"環島1号線","context_page_description":"環島1号線は台湾の本島を一周する台1線と台9線で構成される環島公路を基本にいくつかの一般省道、県道、サイクリングロードで形成された総延長968km の自転車道。"},{"page_url":"https://eo.wikipedia.org/wiki/Sruby_(V%C5%A1eruby)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Sruby_-_rota_-_panoramio_%286%29.jpg","page_title":"Sruby (Všeruby)","context_page_description":"Sruby estas pereinta vilaĝo en Ĉeĥio, parto de kampurbo Všeruby, en distrikto Domažlice. Ĝi troviĝis sudoriente de Všeruby. En la jaro 2011 ĉi tie daŭre vivis neniu loĝanto.\\nSruby situas en katastra teritorio Sruby na Šumavě kun areo 4,81 km ². En la katastra teritorio Sruby na Šumavě situas ankaŭ Pomezí."},{"page_url":"https://vec.wikipedia.org/wiki/Sermaises","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Sermaises_-_%C3%89glise_Saint-Loup_-_1.jpg","page_title":"Sermaises","context_page_description":"Sermaises el xé on comun de 1 646 abitanti del departemento de Loiret che el fa parte del rejon Sentro-Vałe de ła Loira in Fransa."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D0%B8%D1%82-%D0%A4%D0%BE%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Petite-For%C3%AAt_%28Nord%2C_Fr%29_city_limit_sign.JPG","page_title":"Петит-Форе","context_page_description":"Петит-Форе — Францин гӀала-коммуна, лаьтта О-де-Франс регионехь. Коммунан департамент — Нор. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BA%D0%B8%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Agave_fields_hill.jpg","page_title":"Текила","context_page_description":"Текила је алкохолно пиће које се производи околини Текиле, града у Мексичкој савезној држави Халиско. Прави се од биљке плаве агаве и садржи 35—55% алкохола. Пиће је у Текили први пут произведено у 16. веку. Но већ су Астеци, прије доласка конкистадора 1521, правили ферментирано пиће од агаве које су звали октли, а које је касније добило популарније име - пулке. Кад су Шпанци исцрпили залихе брендија, почели су дестилисати астечко пиће.\\nОко 1600, Дон Педро Санчез од Тагле, маркиз од Алтамира, почео је са интензивном производњом текиле у првој „фабрици“ у модерном Халиску. Године 1608. колонијални гувернер је увео порез на овај производ. Текила какву данас познајемо почела је да се производи почетком 19. века у Гвадалахари, а у 20. веку постала је популарна широм света. Поља плаве агаве и древне дестилерије у околици Текиле данас су на попису светске баштине. Неке се врсте текиле и даље производе у породичним дестилеријама, док се најпознатије производе у великим мултинационалним корпорацијама. У Мексику преко 100 дестилерија производи 600 врста текиле, док је укупно регистровано преко 2000 врста текиле."},{"page_url":"https://id.wikipedia.org/wiki/Yasuyuki_Konno","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Yasuyuki_Konno_-_2.jpg","page_title":"Yasuyuki Konno","context_page_description":"Yasuyuki Konno merupakan seorang pemain sepak bola berkebangsaan Jepang yang kini bermain untuk klub Gamba Osaka. Berposisi sebagai gelandang. Dia pertama kali bermain di timnas Jepang sejak tahun 2005.\\nBertinggi badan 178 cm."},{"page_url":"https://ceb.wikipedia.org/wiki/Fr%C3%B6slunda","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Fr%C3%B6slunda_kyrka.jpg","page_title":"Fröslunda","context_page_description":"Parokya ang Fröslunda sa Sweden. Nahimutang ni sa munisipyo sa Enköpings Kommun ug lalawigan sa Uppsala län, sa habagatang bahin sa nasod, 60 km sa amihanan-kasadpan sa Estokolmo ang ulohan sa nasod. Adunay 983 ka molupyo.\\nAng klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -10 °C."},{"page_url":"https://de.wikipedia.org/wiki/English_Democrats","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/English_Democrats_Renault_Kangoo_van.jpg","page_title":"English Democrats","context_page_description":"Die English Democrats sind eine regionalistische politische Partei in England. Das politische Hauptziel der Partei ist die Etablierung eines eigenständigen Parlaments für England. Die English Democrats können als eine Art englisches Gegenstück zu den Regionalparteien von Schottland und Wales aufgefasst werden. Im Gegensatz zu diesen beiden Parteien, die eher dem Mitte-links-Spektrum angehören, vertreten die English Democrats rechtskonservative bis rechtspopulistische Standpunkte."},{"page_url":"https://cs.wikipedia.org/wiki/Henry_Petty-Fitzmaurice,_3._mark%C3%BDz_z_Lansdowne","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Lansdowne3.JPG","page_title":"Henry Petty-Fitzmaurice, 3. markýz z Lansdowne","context_page_description":"Henry Petty-Fitzmaurice, 3. markýz z Lansdowne byl britský státník ze starobylého šlechtického rodu Petty-Fitzmaurice, syn premiéra 1. markýze z Lansdowne. Více než půl století patřil k významným osobnostem liberálů ve Sněmovně lordů, během své kariéry zastával několik vládních postů, byl ministrem financí, vnitra a zahraničí."},{"page_url":"https://hu.wikipedia.org/wiki/G%C3%B6r%C3%B6g_gyarmatos%C3%ADt%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/G%C3%B6r%C3%B6g_gyarmatok_a_Fekete-tengern%C3%A9l_i_e_6_sz%C3%A1zad.svg","page_title":"Görög gyarmatosítás","context_page_description":"A görög gyarmatosítás során a görög poliszok és hellén nyelvű népek a Balkán-félszigeten kívül hoztak létre településeket. Fő időszaka a Kr. e. 8-6. századra esett, és elsősorban Dél-Itáliában, a Márvány-tenger és a Fekete-tenger partjain volt megfigyelhető. Hatására fellendült a görög gazdaság és a kultúra, amit a Mediterráneum távolabbi területeire is eljuttatott a megélénkülő kereskedelem."},{"page_url":"https://pt.wikipedia.org/wiki/Prepona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Prepona_amydon_-_iNaturalist.org.jpg","page_title":"Prepona","context_page_description":"Prepona é um gênero, proposto por Jean-Baptiste Alphonse Dechauffour de Boisduval em 1836, de borboletas neotropicais da família Nymphalidae e subfamília Charaxinae, distribuídas do México à região sul do Brasil, em floresta tropical e subtropical úmida; se alimentando de substâncias vegetais fermentadas, como em frutos do solo, ou em exsudação, ou até mesmo em cadáveres de peixes ou estrume de mamíferos, mas também absorvendo umidade mineralizada do solo; com lagartas que se alimentam de folhas de plantas dos gêneros Andira, Erythroxylum, Hirtella, Inga, Ouratea, Quiina e Vantanea. Estão entre os Lepidoptera diurnos mais vividamente marcados e belos do mundo, com tonalidades de vermelho ou vermelho-rosado, laranja, amarelo e tons esverdeados, combinando com um intenso azul ou negro-amarronzado; ou apenas em azul e negro-amarronzado e, neste caso, recebendo a denominação de Canoa. Também são reconhecidas pelas suas fortes asas estampadas por baixo, por vezes em tons arenosos, raramente as abrindo quando em repouso e, em muitos casos, apresentando visíveis e moderadamente grandes ocelos."},{"page_url":"https://en.wikipedia.org/wiki/St_Ives_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Yellow_Sweater.jpg","page_title":"St Ives School","context_page_description":"The St Ives School refers to a group of artists living and working in the Cornish town of St Ives. The term is often used to refer to the 20th century groups which sprung up after the First World War around such artists as Borlase Smart, however there was considerable artistic activity there from the late 19th Century onwards."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_G%C3%BCtersloh","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Isselhorst-Hochkreuz.jpg","page_title":"Liste der Baudenkmäler in Gütersloh","context_page_description":"Die Liste der Baudenkmäler in Gütersloh enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Gütersloh im Kreis Gütersloh in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Gütersloh eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nDrei Baudenkmäler wurden bereits als Denkmal des Monats in Westfalen-Lippe ausgezeichnet: im November 2002 die Holtkämperei in Isselhorst, im Dezember 2009 die Weihnachtskrippe der Martin-Luther-Kirche und im Dezember 2011 das Veerhoffhaus am Alten Kirchplatz."},{"page_url":"https://en.wikipedia.org/wiki/Eden_Prairie,_Minnesota","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Flailing_Out_Beans_at_Cummins_Farm.jpeg","page_title":"Eden Prairie, Minnesota","context_page_description":"Eden Prairie is a city 12 miles southwest of downtown Minneapolis in Hennepin County, and the 12th-largest city in the State of Minnesota. It is the 7th-largest suburb in the Twin Cities, with a population of 60,797 at the 2010 census. The city is on the north bank of the Minnesota River, upstream from its confluence with the Mississippi River.\\nEden Prairie is a suburb with a mixed-income city model. It is home to 7,213 firms, municipal and regional parks, conservation areas, trails, and recreational facilities.\\nThere are walking trails around Purgatory Creek and Staring Lake, and the Minnesota River Bluffs Regional Trail. The city has more than 170 miles of multi-use trails, 2,250 acres of parks, and 1,300 acres of open space. It is home to the headquarters of SuperValu, C.H. Robinson Worldwide, SABIS, and MTS Systems Corporation. It contains the Eden Prairie Center and is the hub for SouthWest Transit, providing public transportation to three adjacent suburbs. KMSP and WFTC are also based in Eden Prairie.\\nEden Prairie and nearby suburbs form the southwest portion of Minneapolis–Saint Paul, the 15th-largest metropolitan area in the United States, with about 3.6 million residents."},{"page_url":"https://ca.wikipedia.org/wiki/Ploubalay","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Map_commune_FR_insee_code_22209.png","page_title":"Ploubalay","context_page_description":"Ploubalay és un municipi francès, situat a la regió de Bretanya, al departament de Costes del Nord. L'any 2006 tenia 2.488 habitants."},{"page_url":"https://en.wikipedia.org/wiki/St_Peter%27s_Church,_Streatham","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/St_Peter%2C_Leigham_Court_Road_-_geograph.org.uk_-_1742977.jpg","page_title":"St Peter's Church, Streatham","context_page_description":"St Peter's Church is an Anglican church in the London Borough of Lambeth. It is a Grade II* listed building and occupies a prominent position in Leigham Court Road, Streatham."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D1%96%D0%BD%D0%BD%D1%8F_%D0%BF%D1%80%D0%BE%D1%94%D0%BA%D1%82%D0%B0%D0%BC%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/1_UA_VA_IT_Project_Management_Framework.png","page_title":"Управління проєктами","context_page_description":"Управління проєктами — область знань з планування, організації та управління ресурсами з метою успішного досягнення цілей та завершення завдань проєкту. Іноді ототожнюється з управлінням програмами, але програма — це фактично вищий рівень: група пов'язаних та взаємозалежних проєктів.\\nПроєкт — це обмежений часовими рамками процес, що має визначений початок та кінець, зазвичай обмежений датою, але також може обмежуватися фінансуванням або досягненням результатів, який здійснюється для реалізації унікальних цілей та завдань, зазвичай, щоб призвести до вигідних змін або створення доданої вартості. Тимчасова природа проєктів контрастує з бізнесом, які є повторюваною, постійною або частково постійною діяльністю з виробництва продуктів або послуг. На практиці, управління вищезазначеними двома системами часто різниться і таким чином вимагає розвитку окремих технічних навичок та використання розподіленого управління ними.\\nГоловним завданням проєктного управління є досягнення всіх цілей та виконання завдань проєкту, одночасно виконуючи зобов'язання щодо наперед визначених обмежень проєкту. Типовими обмеженнями є межі та зміст проєкту, час, бюджет."},{"page_url":"https://fr.wikipedia.org/wiki/Avenue_de_Lamballe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Plaque_Bao_Da%C3%AF%2C_13_avenue_de_Lamballe%2C_Paris_16e.jpg","page_title":"Avenue de Lamballe","context_page_description":"L'avenue de Lamballe est une voie du 16ᵉ arrondissement de Paris, en France."},{"page_url":"https://sv.wikipedia.org/wiki/Strongylognathus_caeciliae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Strongylognathus_caeciliae_mb619-2_dorsal_1.jpg","page_title":"Strongylognathus caeciliae","context_page_description":"Strongylognathus caeciliae är en myrart som beskrevs av Auguste-Henri Forel 1897. Strongylognathus caeciliae ingår i släktet Strongylognathus och familjen myror. IUCN kategoriserar arten globalt som sårbar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ca.wikipedia.org/wiki/Granges_decorades_de_H%C3%A4lsingland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Bommars_02.JPG","page_title":"Granges decorades de Hälsingland","context_page_description":"Les granges de Hälsingland o Hälsingegård són granges, o antigues granges, herència cultural i un exemple de la manera de construir tradicional sueca a la vella societat campestre de Hälsingland. Hi ha al voltant de 1000 granges de Hälsingland a la província, amb els seus valors històric-culturals intactes. Set d'elles varen ser incloses com a Patrimoni de la Humanitat de la UNESCO l'any 2012."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AB%E3%82%AB%E3%83%88%E3%83%A9%E3%82%BA%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/San_Francisco_Bay_aerial_view.jpg","page_title":"アルカトラズ島","context_page_description":"アルカトラズ島は、アメリカ合衆国カリフォルニア州のサンフランシスコ湾内、サンフランシスコ市から2.4kmのところに浮かぶ、面積0.076km²の小島である。昔は灯台、軍事要塞、軍事監獄、そして1963年まで連邦刑務所として使用され、ザ・ロック、監獄島とも呼ばれている。1972年、国立レクリエーション地域となり、1976年及び1986年にランドマークの指定を受けた。\\n現在、この島は、アメリカ合衆国国立公園局が運営するゴールデンゲート国立レクリエーション地域の歴史地区となっており、一般観光客に公開されている。観光客は、サンフランシスコのフィッシャーマンズワーフ近くのピア33からフェリーで島に渡ることができる。\\nカモメを始めとした海鳥の生息地としても知られる。"},{"page_url":"https://fr.wikipedia.org/wiki/Gouvernement_Henri_Queuille_(3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Rene_Mayer.jpg","page_title":"Gouvernement Henri Queuille (3)","context_page_description":"Le troisième gouvernement Henri Queuille a été le gouvernement de la France du 10 mars 1951 au 10 juillet 1951."},{"page_url":"https://oc.wikipedia.org/wiki/Leitora","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Lectoure-SalleIllustres.jpg","page_title":"Leitora","context_page_description":"Leitora es ua comuna gascoa de Lomanha dens lo comtat d'Armanhac administrada peu departament francés de Gers dens la region d'Occitània, ancianament de Miègjorn-Pirenèus.\\nQu'ei la patria deus escrivans gascons Alcèu Deurriu, Pèir de Garròs e Joan Francés Bladèr, deu marescau d'Empèri Jean Lannes e de generaus de la Revolucion Francesa e de l'Empèri."},{"page_url":"https://en.wikipedia.org/wiki/The_Storyteller_(sculpture)","image_url":"https://upload.wikimedia.org/wikipedia/en/5/55/Storyteller_%28Ken_Kesey%29_sculpture_in_Eugene%2C_Oregon.jpg","page_title":"The Storyteller (sculpture)","context_page_description":"The Storyteller, also known as the Ken Kesey Memorial, is an outdoor bronze sculpture by Pete Helzer, installed at Kesey Square in Eugene, Oregon, in the United States. Unveiled in 2003, it depicts American novelist, essayist, and countercultural figure Ken Kesey reading to his three grandchildren, Kate Smith, Caleb Kesey and Jordan Smith. Plaques on the base of the sculpture contain excerpts from Kesey's novels One Flew Over the Cuckoo's Nest and Sometimes a Great Notion."},{"page_url":"https://fr.wikipedia.org/wiki/Captain_America","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/CapShield04.jpg","page_title":"Captain America","context_page_description":"Steven « Steve » Rogers, alias Captain America est un super-héros évoluant dans l'univers Marvel de la maison d'édition Marvel Comics. Créé par le scénariste Joe Simon et le dessinateur Jack Kirby, le personnage de fiction apparaît pour la première fois dans le comic book Captain America Comics #1 en décembre 1940.\\nConçu à l'origine comme une figure patriotique américaine en réaction au régime nazi, le personnage devient actif avant même l'entrée en guerre officielle des États-Unis dans la Seconde Guerre mondiale. Dès le début de sa publication, il est perçu comme le porte-drapeau des valeurs démocratiques de son pays et comme un défenseur du monde libre contre les totalitarismes, notamment le Troisième Reich.\\nDoté d'une condition physique au summum du potentiel humain, Captain America est un combattant hors pair, un chef-né et un stratège militaire accompli. Il porte un costume reconnaissable entre tous, inspiré du drapeau américain et est équipé d'un bouclier quasi indestructible, composé d'un alliage d'acier et du fictif vibranium, qu'il utilise comme une protection ainsi que comme une arme."},{"page_url":"https://br.wikipedia.org/wiki/Courmemin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Courmemin_-_Iliz.jpg","page_title":"Courmemin","context_page_description":"Courmemin a zo ur gumun e departamant Loir-et-Cher, e kanton Chambord, e rannvro Centre-Val de Loire."},{"page_url":"https://fr.wikipedia.org/wiki/Exp%C3%A9dition_47_(ISS)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/ISS_Expedition_48_Patch.png","page_title":"Expédition 47 (ISS)","context_page_description":"L'Expédition 47 est la 47ᵉ mission de longue-durée à bord de la Station spatiale internationale (ISS)."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D0%B5%D1%82%D1%80%D0%B0%D0%B2%D0%B0%D1%8F_%D1%88%D1%8B%D0%B1%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Studebaker-light-six.jpg","page_title":"Ветравая шыба","context_page_description":"Ветравая шыба, або лабавая шыба — кузаўны элемент, выкананы са шкла, які ўстанаўліваецца ў пярэдні аконны праём транспартнага сродку для абароны кіроўцы і пасажыраў ад атмасферных ападкаў, сустрэчнага патоку паветра, дробнага дарожнага смецця і г. д. Акрамя таго, ветравая шыба — элемент, які ўносіць значны ўклад у фарміраванне аэрадынамічных характэрыстык аўтамабіля, а канструкцыя праёму аказвае вялікі ўплыў на жорсткасць кузава аўтамабіля ў цэлым."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%90%9C%E7%8B%97%E6%8B%BC%E9%9F%B3%E8%BE%93%E5%85%A5%E6%B3%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Sougou_Double_Pinyin_Scheme.png","page_title":"搜狗拼音输入法","context_page_description":"搜狗拼音輸入法是2006年6月由搜狐公司推出的一款漢語拼音輸入法。搜狗輸入法從一開始偏向於詞語輸入特性，發展到後來配備雲輸入功能的以整句輸入為優勢的輸入法，是中國大陸市場主流的漢語拼音輸入法。根據極光大數據的《2018年輸入法app行業研究報告》搜狗輸入法app的滲透率為69.8%，月活躍用戶人數為4.6億。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BA%9A%E8%BF%90%E6%9D%91%E8%A1%97%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Yayuncun.jpg","page_title":"亚运村街道","context_page_description":"亞運村街道是隸屬於北京市朝陽區的街道。"},{"page_url":"https://hu.wikipedia.org/wiki/Centrobranchus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Centrobranchus_choerocephalus.jpg","page_title":"Centrobranchus","context_page_description":"A Centrobranchus a sugarasúszójú halak osztályának Myctophiformes rendjébe, ezen belül a gyöngyöshalfélék családjába tartozó nem."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B2%E0%A5%88%E0%A4%82%E0%A4%B8%E0%A4%A1%E0%A4%BE%E0%A4%89%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Lansdownesnow2.JPG","page_title":"लैंसडाउन","context_page_description":"लैंसडाउन उत्तराखण्ड राज्य के पौड़ी गढ़वाल जिले में एक छावनी शहर है। उत्तराखण्ड के गढ़वाल में स्थित लैंसडाउन बेहद खूबसूरत पहाड़ी है। समुद्र तल से इसकी ऊँचाई 1706 मीटर है। यहाँ की प्राकृतिक छटा सम्मोहित करने वाली है। यहाँ का मौसम पूरे साल सुहावना बना रहता है। हर तरफ फैली हरियाली आपको एक अलग दुनिया का एहसास कराती है। दरअसल, इस जगह को अंग्रेजों ने पहाड़ों को काटकर बसाया था। खास बात यह है कि दिल्ली से यह हिल स्टेशन काफी नजदीक है। आप 5-6 घंटे में लैंसडाउन पहुँच सकते हैं। अगर आप बाइक से लैंसडाउन जाने की योजना बना रहे हैं तो आनंद विहार के रास्ते दिल्ली से उत्तर प्रदेश में प्रवेश करने के बाद मेरठ, बिजनौर और कोटद्वार होते हुए लैंसडाउन पहुँच सकते हैं।"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BC%D0%B0%D1%88%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_(%D1%81%D0%B5%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%86%D0%BE%D0%B0%D0%BD%D0%BD%D0%BE-%D0%91%D0%BE%D0%B3%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0.JPG","page_title":"Томашгород (село)","context_page_description":"Тома́шгород — село в Україні, в Рокитнівському районі Рівненської області. На даний час в селі проживає до 2000 осіб. Центр сільської ради. Лежить на лівому березі річки Льви, за 21 км від районного центру, за 8 км від залізничної станції селища Томашгород. З'єднане з Рокитним автошляхом."},{"page_url":"https://en.wikipedia.org/wiki/European_route_E134","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Folgefonna_39910_C36_%28North_of_Roldalfjelltunnel%29.jpg","page_title":"European route E134","context_page_description":"European highway E 134 is a European highway that crosses Norway starting at Haugesund Airport, Karmøy near the city of Haugesund on the west coast, heading over Haukeli, passing the city of Drammen, and ending in Vassum on the east side of the Oslofjord Tunnel.\\nWith the highest point at 1,085 metres above sea level, the road is sensitive to snow conditions and foul weather during the winter season, during which the mountainous sections, especially near Haukelifjell skiing center, may be closed in short periods. The stretch of road through the mountains is called Haukelifjell."},{"page_url":"https://de.wikipedia.org/wiki/Pippau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Crepis_acuminata_%284045140329%29.jpg","page_title":"Pippau","context_page_description":"Die Pippau bilden eine Pflanzengattung in der Familie der Korbblütler. Die etwa 200 Arten sind in Nordamerika, Eurasien und Afrika weitverbreitet. Der Trivialname Pippau kommt aus dem Slawischen und galt für den verwandten Löwenzahn."},{"page_url":"https://az.wikipedia.org/wiki/Elbrus_%C4%B0sayev","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Elbrus_Isayev_14.jpg","page_title":"Elbrus İsayev","context_page_description":"Elbrus Saleh oğlu İsayev — Naxçıvan Dövlət Universitetinin rektoru, “Beynəlxalq münasibətlər” kafedrasının dosenti, tarix üzrə fəlsəfə doktoru."},{"page_url":"https://sk.wikipedia.org/wiki/Geografia_Rumunska","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Romania-relief.png","page_title":"Geografia Rumunska","context_page_description":"Tento článok popisuje geografické pomery v Rumunsku."},{"page_url":"https://sv.wikipedia.org/wiki/Hunte","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Oldenburg_Autobahnbr%C3%BCcke_Hunte.JPG","page_title":"Hunte","context_page_description":"Hunte är en flod i Niedersachsen, Tyskland. Den är med sina 189 km det näst längsta biflödet till Weser. Den största staden längs Hunte är Oldenburg.\\nAvsnittet närmast ovanför Oldenburg är populärt som paddelled. I sitt övre lopp genomflyter Hunte sjön Dümmer."},{"page_url":"https://la.wikipedia.org/wiki/Lucingiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Lucinges_Church.JPG","page_title":"Lucingiae","context_page_description":"Lucingiae sunt communia 1500 incolarum praefecturae Sabaudiae Superioris in Franciae orientalis regione Rhodano et Alpibus."},{"page_url":"https://it.wikipedia.org/wiki/El_Grullo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Escudogrullo.jpg","page_title":"El Grullo","context_page_description":"El Grullo è un comune del Messico, situato nello stato di Jalisco, il cui capoluogo è la località omonima."},{"page_url":"https://nn.wikipedia.org/wiki/Pave_Klemens_XI","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Clement_XI.jpg","page_title":"Pave Klemens XI","context_page_description":"Pave Klemens XI var pave frå 1700 til 1721. Han er best kjent for den pavelege bullen Unigenitus som gjekk ut mot viktige sider av den kyrkjelege situasjonen i Frankrike, og for at han greip inn i ritestriden i Kina der han forbaud dei fleste av dei omstridde tilpassingane til kinesiske skikkar som jesuittane hadde fått igjennom."},{"page_url":"https://de.wikipedia.org/wiki/August_von_Werder","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/August_von_Werder_BNF_Gallica.jpg","page_title":"August von Werder","context_page_description":"Karl Friedrich Wilhelm Leopold August Graf von Werder war ein preußischer General der Infanterie."},{"page_url":"https://es.wikipedia.org/wiki/Portugu%C3%A9s_europeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Portugu%C3%A9s_europeo.png","page_title":"Portugués europeo","context_page_description":"Portugués europeo es la designación que se da al conjunto de dialectos de la lengua portuguesa hablados en el Portugal continental y en las regiones insulares de Portugal.\\nTambién se llama norma del portugués europeo a la norma estándar del portugués que es usada en los países lusófonos, con excepción de Brasil. Esta norma tiene como base principal —aunque no única— los dialectos centromeridionales del centro litoral de Portugal, hablados en Lisboa y en la Universidad de Coímbra.\\nEl portugués brasileño posee algunas diferencias ortográficas, aunque las diferencias más significantes se dan en el vocabulario y la pronunciación. Es perfectamente comprensible una conversación entre hablantes de ambas variantes, tal como sucede entre hablantes del inglés estadounidense y del británico o entre un hispanoparlante de España y otro de Latinoamérica."},{"page_url":"https://sl.wikipedia.org/wiki/Paune","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Selo_Paune_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_Panorama_24.jpg","page_title":"Paune","context_page_description":"Paune je naselje v Srbiji, ki upravno spada pod Mesto Valjevo; slednja pa je del Kolubarskega upravnega okraja."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%91%9E%E9%BE%8D%E5%AF%BA_(%E5%B2%90%E9%98%9C%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/%E9%B6%B4%E6%A3%B2%E9%99%A2-%E7%91%9E%E9%BE%8D%E5%AF%BA_%28%E5%B2%90%E9%98%9C%E5%B8%82%29_zuiryoji_kakuseiin001.jpg","page_title":"瑞龍寺 (岐阜市)","context_page_description":"瑞龍寺は、岐阜県岐阜市寺町にある臨済宗妙心寺派の寺院である。山号は金寶山。\\n臨済宗妙心寺派の坐禅修行の出来る専門道場であり、雲水の修行の場である。\\n総門を入ると参道の右に瑞雲院、鶴棲院、臥雲院。左に、天澤院、開善院、雲龍院の6つの寺がある。一番奥には雲水の修行道場である僧堂がある。\\n境内には、斎藤妙椿、土岐成頼、悟渓国師の墓がある。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%8A%D9%88%D8%AF%D8%A7%D8%AF_%D9%83%D9%88%D9%84%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Ciudad_Colon_Costa_Rica_april_2016%2C_aerial_image.jpg","page_title":"سيوداد كولون","context_page_description":"سيوداد كولون هي مقاطعة في كانتون مورا، محافظة سان خوسيه، كوستاريكا.\\nهي مدينة صغيرة تقع غرب سانتا آنا. وهي عاصمة كانتون مورا،. تشتهر بمناخها الدافئ، وقربها من الطبيعة والجبال المحيطة بها، والتقاليد الفولكلورية، وركوب الخيل، والتعددية الثقافية."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D1%81%D0%B0%D1%85%D1%87%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Flag_of_Starosakhchinskoe_rural_settlement.png","page_title":"Старосахчинское сельское поселение","context_page_description":"Староса́хчинское се́льское поселе́ние — муниципальное образование в составе Мелекесского района Ульяновской области. Административный центр — село Старая Сахча."},{"page_url":"https://sv.wikipedia.org/wiki/Mini%C3%A8resbunn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Eisebunnsbr%C3%A9ck_an_der_Entr%C3%A9e_vun_Zowaasch%2C_CR176A-101.jpg","page_title":"Minièresbunn","context_page_description":"Minièresbunn är en museijärnväg i Luxemburg och Frankrike. Den går mellan Fond-de-Gras i kommunen Differdange i Luxemburg och Saulnes i Frankrike, via Lasauvage i Luxemburg.\\nJärnvägen var en industrijärnväg för transport av järnmalm. Den har spårvidden 700 millimeter.\\nBanan drivs av Föreningen Minièresbunn, som disponerar över en samling ång-, diesel- och ellokomotiv från gruvepoken, varav en del från Arbeds tidigare gruva på platsen. De två ångloken är av fabrikat Krauss & Cie, tillverkade 1895 respektive 1897. Föreningen arrangerar turisttrafik på hela sträckan, varav mittenbiten mellan Dhoil och Lasauvage körs med elektriska tåg 1,4 kilometer i gruvtunnlar."},{"page_url":"https://tt.wikipedia.org/wiki/%D3%A8%D0%BD%D1%81%D3%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%D0%9C%D0%B5%D1%87%D0%B5%D1%82%D1%8C_%D0%98%D0%BD%D1%81%D1%8F.jpg","page_title":"Өнсә","context_page_description":"Өнсә — Татарстан Республикасының Биектау районындагы торак пункт. Әлегә муниципаль статусы — село.\\nХалык саны — 344 тирәсендә. Вакыт зонасы — MSK яки UTC+3. Почта индексы — 422712."},{"page_url":"https://fr.wikipedia.org/wiki/Robert_Browning","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Robert_Browing_manuscrit_original_de_The_Ring_and_the_Book.jpeg","page_title":"Robert Browning","context_page_description":"Robert Browning, né à Camberwell, Surrey, le 7 mai 1812 et mort à Venise le 12 décembre 1889, est un poète et dramaturge britannique, reconnu comme l'un des deux plus grands créateurs poétiques de l'Angleterre victorienne, l'égal, quoique dans un style tout différent, de Tennyson.\\nIl passe son enfance et sa jeunesse dans une famille éprise des lettres et des arts. L'accès illimité à des ouvrages de haut niveau et sa grande curiosité intellectuelle lui permettent d'acquérir un immense savoir et de cultiver son goût pour la poésie. Comme il ne supporte pas d'être scolarisé, ses tentatives d'études secondaires puis supérieures laissent vite place à un parcours intellectuel éclectique.\\nToutes ses œuvres sont ambitieuses, souvent longues et écrites en une langue parfois difficile. Le public, comme la critique, sont, à l'occasion, déroutés par son originalité, qui se manifeste aussi dans sa vie personnelle. Ébloui par la lecture de poèmes publiés par Elizabeth Barrett, cloîtrée en sa chambre, il lui écrit pour lui dire son admiration."},{"page_url":"https://en.wikipedia.org/wiki/Unterseen","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Unterseen.jpg","page_title":"Unterseen","context_page_description":"Unterseen is a historic town and a municipality in the Interlaken-Oberhasli administrative district in the canton of Bern in Switzerland.\\nUnterseen literally means Lower Lake, which is correct, since Unterseen is located on the flat area on the eastern shore of Lake Thun between the two creek Lombach below the Chienberg to the north and the Aare to the south, which both flow into Lake Thun. The historic town however is mainly found at the northern bank of the Aare, which flows here from Lake Brienz to Lake Thun. Just across the Aare is the town of Interlaken. Both municipalities are located on the flat alluvial land among steep mountains, which is also called the Bödeli.\\nUnterseen belongs to the Small Agglomeration Interlaken with 23,300 inhabitants.\\nAlong with Interlaken, Unterseen is an important tourist center in the Bernese Highlands, and from the town one can see the mountains Eiger, Mönch and Jungfrau."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_virreis_de_Nova_Espanya","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Pedro_de_Castro_y_Figueroa.jpg","page_title":"Llista de virreis de Nova Espanya","context_page_description":"Pels successius governants de Mèxic vegeu Caps d'estat de Mèxic"},{"page_url":"https://fr.wikipedia.org/wiki/Tagomago","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Tagomago-Eivissa.jpg","page_title":"Tagomago","context_page_description":"Tagomago est un îlot situé à l'extrémité nord-est de l'île d'Ibiza, à la hauteur de la municipalité de Santa Eulària des Riu, dans l'archipel des Baléares."},{"page_url":"https://pnb.wikipedia.org/wiki/2016%D8%A1_%DA%AF%D8%B1%D9%85%D8%A7%D8%A6%DB%8C_%D8%A7%D9%88%D9%84%D9%85%D9%BE%DA%A9%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Rio_de_Janeiro_2016_street_advertisement.jpg","page_title":"2016ء گرمائی اولمپکس","context_page_description":"2016ء گرمائی اولمپکس، اس دا اولمپکس کمیٹی دا سرکاری ناں Games of the XXXI Olympiad اے۔ایہ اولمپکس مقابلے 2016 چ برازیل دے شہر ریو دے جینیرو چ منعقد ہوں گے۔ایہ اکتیویں اولمپکس مقابلے ہیں۔"},{"page_url":"https://ru.wikipedia.org/wiki/Newport_News_Shipbuilding","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/CVN-78_Artist_Image.jpg","page_title":"Newport News Shipbuilding","context_page_description":"«Newport News Shipbuilding» Ньюпорт-Ньюс Шипбилдинг; полное название Northrop Grumman Shipbuilding Newport News — американская верфь, расположенная в городе Ньюпорт-Ньюс (шт. Виргиния).\\nС 2001 года входит в корпорацию «Northrop Grumman». Является крупнейшей частной верфью в США. Одна из двух верфей (наряду с Electric Boat корпорации General Dynamics), производящих и ремонтирующих все типы атомных подводных лодок, и единственная верфь, способная строить атомные авианосцы. Верфи принадлежит крупнейший в западном полушарии мостовой кран грузоподъёмностью 1050 т и крупнейший в западном полушарии 600-метровый док. Верфь сотрудничает с расположенной рядом верфью Norfolk Naval Shipyard в Портсмуте. С момента своего создания компания построила 264 военно-морских корабля и 543 торговых судна."},{"page_url":"https://vec.wikipedia.org/wiki/Castelforte","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Castelforte%28LT%29.JPG","page_title":"Castelforte","context_page_description":"Castelforte el xe on comun n'te la provincia de Latina chel fa parte de la rejon Lasio"},{"page_url":"https://pl.wikipedia.org/wiki/Ludomir_Janowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/President_of_Poland_Gabriel_Narutowicz.PNG","page_title":"Ludomir Janowski","context_page_description":"Ludomir Antoni Janowski – polski malarz portrecista."},{"page_url":"https://hu.wikipedia.org/wiki/Henryk_Wieniawski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Henryk_Wieniawski_three_quarters_length_%28cropped%29.jpg","page_title":"Henryk Wieniawski","context_page_description":"Henryk Wieniawski lengyel hegedűvirtuóz és zeneszerző."},{"page_url":"https://pl.wikipedia.org/wiki/Osiedle_na_Zatorzu_(%C5%BBary)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Osiedle_Na_Zatorzu_bloki.jpg","page_title":"Osiedle na Zatorzu (Żary)","context_page_description":"Osiedle Na Zatorzu - drugie pod względem wielkości żarskie osiedle mieszkalne położone w zachodniej części dzielnicy Zatorze, blisko obwodnicy miejskiej i głównych dróg, co znacznie ułatwia dojazd i poprawia łączność komunikacyjną z innymi dzielnicami miasta."},{"page_url":"https://vi.wikipedia.org/wiki/Pseudobalistes_flavimarginatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Pseudobalistes_flavimarginatus2.jpg","page_title":"Pseudobalistes flavimarginatus","context_page_description":"Pseudobalistes flavimarginatus, thường được gọi là cá bò viền vàng, là một loài cá biển thuộc chi Pseudobalistes trong họ Cá nóc gai. Loài này được mô tả lần đầu tiên vào năm 1829."},{"page_url":"https://hsb.wikipedia.org/wiki/Lis%C4%87ina_sto%C5%82pow_a_swjatych_k%C5%99i%C5%BEow_we_wokrjesu_Budy%C5%A1in","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Hronow_%E2%80%93_swjaty_k%C5%99i%C5%BE_p%C5%99i_dr%C3%B3ze_1.jpg","page_title":"Lisćina stołpow a swjatych křižow we wokrjesu Budyšin","context_page_description":"Stołpy a swjate křiže we wokrjesu Budyšin w Sakskej pochadźeja hłownje ze 17. do 20. lětstotka a namakaja so we wsach abo jich wokolinje. W Sakskej su mnoho nabožnych małopomnikow w serbskej katolskej kónčinje Hornjeje Łužicy zdźeržane, kotrež su přewažnje serbsce popisane.\\nNaličuja so tež postawy swjatych, dalokož woni charakter stołpow maja, to rěka na swójskim spódku a nic we wukuće twarjenja nastajene njejsu."},{"page_url":"https://hr.wikipedia.org/wiki/Samuilovo_Carstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Ohrid_in_Macedonia2.jpg","page_title":"Samuilovo Carstvo","context_page_description":"Samuilovo carstvo je efemerna državna tvorevina koja je nastala ustankom četvorice komitopula prvog, u nizu od tri, slavenska ustanka protiv Bizanta u 10. i 11. stoljeću. Svoj vrhunac dosegla je za vladavine cara Samuila. Nakon poraza na Bjelasici i Samuilove smrti, njegov nećak Ivan Vladislav ubojstvima uže Samuilove obitelji preuzeo je vlast. Bizant je nakon toga uspio pobijediti ustanike, te nakon Vladislavove smrti, prilikom obrane Drača, pobjednički ući u Ohrid i srušiti Makedonsko carstvo.\\nDržavne tradicije Samuilovog carstva dizale su se još dva puta iz pepela:\\n1040. - pod Petrom Deljanom\\n1072. - pod Jurjem Vojtehom"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%88%D8%B3%D9%8A%D9%87_%D8%A5%D9%8A%D8%B2%D9%8A%D8%AF%D9%88%D8%B1%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Isidoro_%28betis%29.jpg","page_title":"خوسيه إيزيدورو","context_page_description":"خوسيه إيزيدورو ‏ هو لاعب كرة قدم إسباني، ولد في 1 أغسطس 1986 في Pedrera في إسبانيا. لعب مع بولونيا وارسو وريال بيتيس ونادي إلتشي ونومانسيا."},{"page_url":"https://hu.wikipedia.org/wiki/S%C3%ADugr%C3%A1s","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Calgary.jpg","page_title":"Síugrás","context_page_description":"A síugrás olyan téli sport, amelyben a síelők lesiklanak a sáncon, majd a végén, a „sáncasztalon” elrugaszkodnak, és megpróbálnak olyan messzire repülni, amennyire csak lehetséges. Az ugrás hosszára kapott ponthoz hozzáadódik az ugrás stílusára kapott pont, amit öt versenybíró oszt ki. A síugráshoz hosszú és széles sílécet használnak. A síugrásnak ma már van műfüves változata is. Része a téli olimpiák műsorának is."},{"page_url":"https://es.wikipedia.org/wiki/Larajasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Map_commune_FR_insee_code_69110.png","page_title":"Larajasse","context_page_description":"Larajasse es una comuna francesa situada en el departamento de Ródano, de la región de Auvernia-Ródano-Alpes."},{"page_url":"https://bar.wikipedia.org/wiki/Ahnlkuit","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Totem_pole_%28js%29_3.jpg","page_title":"Ahnlkuit","context_page_description":"Ahnlkuit oda Manismus is a Kuit ba dem de doudn Voafoahrn vaeaht wean.\\nDa Ahnlkuit wead fost imma mid an Opfarituai praktiziad. Beispuisweis mid an Drangl-, Speisn- oda Brandopfa. Friaa aa mid Menschnopfa.\\nAhnlkuit hods in olln Kuituan af da ganzn Wejd gebn und gibts aa no heit. Im oidn Egyptn is des bis af de Spitzn triebn worn.\\nIn da boarischn Kuitua san Halloween und Ollaseejn Ibableibls vom Ahnlkuit.\\nIn de indianischn Kuituan wors Totem as wichtigste Medium fian Ahnlkuit und hod fia vui no heit no a Bedeitung. As Totem wor a Symboi fias Uaahnl und fia a Oart Schutzengl. Des hod aa a Viech sei kina, oft a Odla. A da Totempfhoi wor a Ausdruck vom Ahnlkuit.\\nIn de afrikanischn Kuituan is de Bedeitung vom Ahnlkuit in de leztn Joarzehnt teiweis wieda gstiegn."},{"page_url":"https://fr.wikipedia.org/wiki/Marcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/TRAIANUS_PATER_RIC_II_764-711445_2.jpg","page_title":"Marcia","context_page_description":"Marcia est l'épouse de Marcus Ulpius Traianus et la mère de l’empereur Trajan. Elle est peut-être aussi la demi-sœur aînée de Marcia Furnilla, la seconde épouse de Titus, et la tante de Julia Titi."},{"page_url":"https://sh.wikipedia.org/wiki/Roger_Glover","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Glover_025.jpg","page_title":"Roger Glover","context_page_description":"Roger David Glover, britanski je bas gitarist, klavijaturista, skladatelj i producent snimanja. Glover je najpoznatiji po svom djelovanju kao skladatelj i basista u hard rock skupini Deep Purple, kao i po svom djelovanju u sastavu Rainbow."},{"page_url":"https://nl.wikipedia.org/wiki/Marcillac-la-Croze","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Map_commune_FR_insee_code_19126.png","page_title":"Marcillac-la-Croze","context_page_description":"Marcillac-la-Croze is een gemeente in het Franse departement Corrèze en telt 210 inwoners. De plaats maakt deel uit van het arrondissement Brive-la-Gaillarde."},{"page_url":"https://fr.wikipedia.org/wiki/Gola_(entreprise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Gola_Harrier_navy_beige_mens_trainers.JPG","page_title":"Gola (entreprise)","context_page_description":"Gola est une entreprise de confection d'articles de sport principalement connue pour ses chaussures. Elle a été créée en 1905 à Leicester, Royaume-Uni."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D9%88%D8%AF%D8%B2%D9%87%D8%A7%DB%8C%D9%85_%D8%A2%D9%85_%D8%B1%D8%A7%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Br%C3%B6mserhof_R%C3%BCdesheim.jpg","page_title":"رودزهایم آم راین","context_page_description":"رودزهایم آم راین آلمانین هسن ایالتینده یئر آلان بیر شهردیر و ۱۸۶ متر دنیز سوییه‌سیندن اۇجالیقی وار. بۇ شهرین ۵۱ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://fr.wikipedia.org/wiki/Mentor_(satellite)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/NROL-32b_ULA_21NOV2010.jpg","page_title":"Mentor (satellite)","context_page_description":"Mentor, également connu sous l'appellation Advanced Orion, est une famille de satellites américains de renseignement d'origine électromagnétique mis en œuvre par le National Reconnaissance Office et développés avec la contribution de la Central Intelligence Agency. En date de juin 2016, sept exemplaires de cette famille de satellites ont été placés en orbite depuis 1995 par des lanceurs Titan et Delta IV. Ces satellites qui ont remplacé la série des Magnum/Orion interceptent des signaux électroniques depuis l'orbite géostationnaire."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%B2%D0%B0%D0%BD_%D0%92%D1%80%D0%B4%D0%BE%D0%BB%D1%8F%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/I_vrdoljak.jpg","page_title":"Іван Врдоляк","context_page_description":"Іван Врдоляк — хорватський політик, міністр будівництва і міністр економіки в лівоцентристському уряді Зорана Мілановича та голова Хорватської народної партії у квітні 2016 — червні 2017 та з 17 грудня 2017. За освітою інженер-електротехнік."},{"page_url":"https://eu.wikipedia.org/wiki/Salins-les-Bainsko_gatzaga","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Salins-les-Bains_roue.jpg","page_title":"Salins-les-Bainsko gatzaga","context_page_description":"Salins-les-Bainsko gatzaga Jura departamentuko Salins-les-Bains udalerrian dagoen gatzaga da. Jadanik Erdi Aroan eta ziur asko aurretik erabilitako gatzaga hauek 2009an UNESCOk Arc-et-Senansko errege gatzagaren babesa luzatuz Gizateriaren Ondare izendatu zuen."},{"page_url":"https://tr.wikipedia.org/wiki/Hola_(dergi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Revista_%C2%A1HOLA%21.png","page_title":"Hola (dergi)","context_page_description":"'¡Hola!', Madrid, İspanya ve diğer 15 ülkede, Arjantin, Brezilya, Kanada, Şili, Yunanistan'da yerel basımlarla yayınlanan ünlü haberlerde uzmanlaşmış haftalık bir İspanyolca dergisi, Endonezya, Meksika, Pakistan, Peru, Filipinler, Porto Riko, Tayland, İngiltere, Amerika Birleşik Devletleri ve Venezuela. İspanya'da Pronto dan sonra en popüler ikinci dergi. Başlık anlamına gelir \\"Merhaba!\\" İngilizce ve İngilizce dil Merhaba! ve Merhaba! Kanada ve Hola! ABD."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%98%E1%83%91%E1%83%9D%E1%83%9B%E1%83%9D%E1%83%A0%E1%83%98%E1%83%94%E1%83%9A%E1%83%94%E1%83%91%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Limule%28dD%29.jpg","page_title":"კიბომორიელები","context_page_description":"კიბომორიელები — ამომწყდარი ველიცერიანი ფეხსახსრიანები. აერთიანებს ევრიპტერიდებსა და ხმალკუდებს. სახელწოდება „კიბომორიელები“ ამჟამად იშვიათად იხმარება."},{"page_url":"https://sv.wikipedia.org/wiki/Besk_trattskivling","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Clitocybe.amarescens.-.lindsey.jpg","page_title":"Besk trattskivling","context_page_description":"Besk trattskivling är en svampart som beskrevs av Harmaja 1969. Besk trattskivling ingår i släktet Clitocybe och familjen Tricholomataceae. Arten är reproducerande i Sverige. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://bs.wikipedia.org/wiki/Bamja_(rod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Abelmoschus_esculentus.jpg","page_title":"Bamja (rod)","context_page_description":"Abelmoschus je rod sa oko 15-ak vrsta cvjetnica iz porodice Malvaceae, koje prirodno rastu u tropskoj Africi, Aziji i sjevernoj Australiji. Ranije su bile uključene u rod Hibiscus, ali su sada preklasificirane u odvojen rod.\\nRod se sastoji od jednogodišnjih i višegodišnjih zeljastih biljaka, koje narastu do visine od oko 2 m. Listovi su dugački 10–40 cm i široki, dlanovito rebrasti, sa 3-7 režnjeva. Režnjevi su po dubini vrlo promjenjivi, od jedva jajastih, do urezanih gotovo do osnove lista. Cvjetovi su promjera 4–58&nbsp cm, s pet bijelih do žutih latica, često s crvenom ili ljubičastom mrljom na dnu. Plod je kapsula, dug 5–20 cm, sa brojnim sjemenkama.\\nVrste roda Abelmoschus su hrana larvama nekih vrsta Lepidoptera, uključujući Chionodes hibiscella, koja je nađena na A. moschatus.\\nOdabrane vrste\\nAbelmoschus angulosus\\nAbelmoschus caillei –. Abelmoschus caillei\\nAbelmoschus crinitus –\\nAbelmoschus esculentus –.\\nAbelmoschus ficulneus –\\nAbelmoschus manihot –\\nAbelmoschus moschatus –"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84%E3%82%AD%E3%83%8F58%E7%B3%BB%E6%B0%97%E5%8B%95%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Kiha283019.0605.jpg","page_title":"国鉄キハ58系気動車","context_page_description":"キハ58系気動車は、日本国有鉄道が1961年に開発した急行形気動車である。\\n1969年まで大量に増備され、1960年代から1980年代にかけて幹線・ローカル線を問わず、日本全国で急行列車を中心に投入された。\\nなお、本項の「キハ58系」という表現は、同一の設計思想により製造された気動車を便宜的に総称したもので、制式のものではない。広義には、北海道用の「キハ56系」、碓氷峠通過仕様の「キハ57系」を含むが、本項では、主に狭義の「キハ58系」について記述する。具体的には、キロ28形・キロ58形・キハ28形・キハ58形・キユ25形の5形式およびこれらの改造車を指す。\\nまた、本項では富士急行の自社発注車や他社譲渡車についても解説する。"},{"page_url":"https://en.wikipedia.org/wiki/1953_Virginia_gubernatorial_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Virginia_Governor_Election_Results_by_County%2C_1953.svg","page_title":"1953 Virginia gubernatorial election","context_page_description":"In the 1953 Virginia gubernatorial election, incumbent Governor John S. Battle, a Democrat, was unable to seek re-election due to term limits. Virginia State Senator Theodore Roosevelt Dalton was nominated by the Republican Party to run against former Democratic U.S. Representative Thomas B. Stanley."},{"page_url":"https://en.wikipedia.org/wiki/List_of_windmills_in_Lower_Saxony","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Blender_Windm%C3%BChle.JPG","page_title":"List of windmills in Lower Saxony","context_page_description":"A list of windmills in the German state of Lower Saxony."},{"page_url":"https://en.wikipedia.org/wiki/Pronghorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Antelope1.jpg","page_title":"Pronghorn","context_page_description":"The pronghorn is a species of artiodactyl mammal indigenous to interior western and central North America. Though not an antelope, it is often known colloquially in North America as the American antelope, prong buck, pronghorn antelope, prairie antelope, or simply antelope because it closely resembles the true antelopes of the Old World and fills a similar ecological niche due to parallel evolution. It is the only surviving member of the family Antilocapridae.\\nDuring the Pleistocene epoch, about 12 antilocaprid species existed in North America. Three other genera existed when humans entered North America but are now extinct.\\nAs a member of the superfamily Bovoidea, the pronghorn's closest living relatives are, among others. The Bovoidea are in turn members of the infraorder Pecora making pronghorns more distant relatives of the Cervidae, Moschidae and Giraffoidea.\\nThe pronghorn is the symbol of the American Society of Mammalogists."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%93%A6%E4%BC%AF%E8%A5%BF%E5%AD%B8%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Wabash_College_Seal.png","page_title":"瓦伯西學院","context_page_description":"瓦伯西学院是一个位于美国印第安纳州克劳福兹维尔的小型私立文理学院、男子学院，于1832年由达特茅斯学院的数名毕业生和美国中西部领袖成立。根据《美国新闻与世界报道》，它排在美国文理学院中的第61位， 现在是美国仅有的三所四年制男子文理学院之一，另外两所分别是汉普登-悉尼学院和莫尔豪斯学院。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_unidentified_decedents_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Newton_County_GA_Allison_Doe_Reconstruction_6_Hair_Up.jpg","page_title":"List of unidentified decedents in the United States","context_page_description":"An unidentified decedent, or UID, is a deceased person whose legal identity is unable to be determined by law enforcement. Although the majority of individuals are identified soon after their bodies are recovered, it is not uncommon for bodies to remain unidentified for years or even decades. There are approximately 40,000 unidentified decedents in the United States at any given time.\\nA deceased body can be identified in several different ways. Most commonly, a relative of the deceased identifies the body by sight. However, if a body is decomposed, skeletal, or unrecognizable due to severe facial trauma at the time of recovery, other methods must be used. Some common modes of identification include fingerprint comparison, dental records, chest x-rays and comparing the deceased's DNA to the DNA sequence of relatives such as a parent or sibling. Since identification of a deceased individual is a legal matter, officials require a high degree of certainty in order to make a formal identification."},{"page_url":"https://de.wikipedia.org/wiki/Umgebindehaus_W%C3%BCrdenhain","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Fachwerkhaus_W%C3%BCrdenhain_2.jpg","page_title":"Umgebindehaus Würdenhain","context_page_description":"Das Umgebindehaus ist ein Baudenkmal, das sich in der Dorfstraße 10 im Ortsteil Würdenhain der Gemeinde Röderland im südbrandenburgischen Landkreis Elbe-Elster befindet. Im örtlichen Denkmalverzeichnis ist es unter der Erfassungsnummer 09135406 verzeichnet. Sein Standort ist etwa 200 Meter östlich der örtlichen Dorfkirche zu finden, welche ebenfalls unter Denkmalschutz steht.\\nBei dem Gebäude handelt sich um ein aus der ersten Hälfte des 18. Jahrhunderts stammendes und mit einem Satteldach versehenes eingeschossiges Wohnstallhaus mit Giebelgebinde.\\nDer Würdenhainer Bauer Jost soll das Haus um 1780 nach einem Brand auf seinem Hof errichtet haben. Der Sage nach träumte er bei der nächtlichen Hirsewache vom Brand und eilte nach Hause um Frau und Kind zu retten. Der einstige Ortschronist Rudolf Matthies berichtete, Jost habe aus Dankbarkeit die nicht mehr erkennbaren Worte „Ein Traum steht auch in Gottes Hand, sonst wären mir Weib und Kind verbrannt“ in die Giebelbalken des Hauses hauen lassen.\\nDas Gebäude ist das einzige erhaltene Umgebindehaus im Landkreis Elbe-Elster und das älteste Bauernhaus des Dorfes. Seit dem Jahr 2009 befindet es sich im Besitz der Gemeinde Röderland."},{"page_url":"https://es.wikipedia.org/wiki/Alex_Barrera_(baloncestista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/CJB_14_15_ALEX_BARRERA_DGL0507.jpg","page_title":"Alex Barrera (baloncestista)","context_page_description":"Alex Barrera Pasan es un jugador de baloncesto español. Con 1.96 metros de estatura, juega en la posición de escolta. Actualmente juega en el San Pablo Inmobiliaria Burgos."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D1%81%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD%D0%B8%D0%BA%D0%B0_%D0%BA%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B5_%D1%83_%D0%9F%D0%BE%D0%B4%D1%83%D0%BD%D0%B0%D0%B2%D1%81%D0%BA%D0%BE%D0%BC_%D0%BE%D0%BA%D1%80%D1%83%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Crkva_Sv.Petra_i_Pavla_u_Lozoviku.JPG","page_title":"Списак споменика културе у Подунавском округу","context_page_description":"Следи списак споменика културе у Подунавском округу."},{"page_url":"https://de.wikipedia.org/wiki/Dunkles_R%C3%BCsselh%C3%BCndchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Rhynchocyon_stuhlmanni_distribution_map.png","page_title":"Dunkles Rüsselhündchen","context_page_description":"Das Dunkle Rüsselhündchen ist eine Säugetierart aus der Familie der Rüsselspringer. Es kommt hauptsächlich in Zentralafrika vor und bewohnt dort die tropischen Regenwälder des Kongobeckens. Wie alle Rüsselspringer zeichnet sich die Art durch ihre rüsselartig verlängerte Nase und die schlanken Gliedmaßen aus, wobei die Hinterbeine länger als die Vorderbeine sind. Die Fellfärbung ist variabel und reicht von helleren bis dunkleren Brauntönen, charakteristisch erscheint die gefleckte Rückenstreifung. Über die Lebensweise des Dunklen Rüsselhündchens liegen nur wenige Informationen vor. Die Art wurde im Jahr 1893 wissenschaftlich eingeführt. In der zweiten Hälfte des 20. Jahrhunderts und zu Beginn des 21. Jahrhunderts galt das Dunkle Rüsselhündchen als Unterart des Gefleckten Rüsselhündchens, genetische Untersuchungen aus dem Jahr 2017 weisen es wieder als eigenständig aus."},{"page_url":"https://hr.wikipedia.org/wiki/D%C5%BEentlmenski_sporazum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Dorothy_McGuire_in_Gentleman%27s_Agreement_trailer_cropped.jpg","page_title":"Džentlmenski sporazum","context_page_description":"Džentlmenski sporazum je film Elije Kazana iz 1947. s Gregoryjem Peckom u ulozi novinara koji se lažno predstavlja kao Židov kako bi istražio antisemitizam u New Yorku i njegov utjecaj na zajednicu Darien, Connecticut. Film je u svoje vrijeme bio kontroverzan jer je tematski bio sličan filmu Unakrsna vatra, koji je objavljen iste godine te također bio nominiran za Oscara za najbolji film. Džentlmenski sporazum temeljen je na istoimenom romanu Laure Z. Hobson iz 1947."},{"page_url":"https://ru.wikipedia.org/wiki/Faded","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Tallinn_Linnahall_%287952398934%29.jpg","page_title":"Faded","context_page_description":"«Faded» — песня норвежского диджея и продюсера Алана Уокера. Релиз песни должен был состояться 25 ноября 2015 года, но был отложен и выпущен 3 декабря 2015 года из-за авиакатастрофы в Египте. Трек был очень успешен, заняв первое место в чартах более чем 10 стран и войдя в топ-10 более тридцати различных чартов.\\nПервое живое исполнение «Faded» Алана Уокера и норвежской вокалистки Изелин Солхейм состоялось 27 февраля 2016 года на Всемирных экстремальных играх. Выступление транслировалось в эфире норвежского телевидения."},{"page_url":"https://it.wikipedia.org/wiki/Awashimaura","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Flag_of_Awashima_Niigata.jpg","page_title":"Awashimaura","context_page_description":"Awashimaura è un villaggio giapponese della prefettura di Niigata."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27%C3%A9lections_en_2003","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/OP13.JPG","page_title":"Liste d'élections en 2003","context_page_description":"Cet article recense les élections ayant eu lieu durant l'année 2003. Il inclut les élections législatives et présidentielles nationales dans les États souverains, ainsi que les référendums au niveau national.\\nL'année est marquée notamment par des référendums dans neuf États d'Europe centrale et orientale, où les citoyens s'expriment en faveur de leur entrée dans l'Union européenne. Ceci aboutit au cinquième élargissement de l'Union européenne, l'année suivante.\\nParmi les États démocratiques, huit connaissent une alternance au pouvoir en raison d'élections en 2003. À Chypre, le président sortant Gláfkos Klirídis est battu par Tássos Papadópoulos en février. Au Guatemala de même, la droite d'opposition succède à la droite au pouvoir à l'issue de l'élection présidentielle en novembre et décembre. À Monaco, le parti Union nationale et démocratique, qui exerce une prépondérance quasi-monolithique au parlement depuis 1963, est très largement battu par une coalition de partis d'oppositions de centre-droit aux élections législatives en février."},{"page_url":"https://pl.wikipedia.org/wiki/Port_lotniczy_Buochs","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Miragevortor.jpg","page_title":"Port lotniczy Buochs","context_page_description":"Port lotniczy Buochs – szwajcarski wojskowy port lotniczy położony w miejscowości Buochs, w kantonie Nidwalden."},{"page_url":"https://es.wikipedia.org/wiki/Historia_del_estado_de_Morelos","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Mexico_xochicalco_pyramids.JPG","page_title":"Historia del estado de Morelos","context_page_description":"El estado de Morelos fue creado por decreto presidencial el 16 de abril de 1869 formando parte anteriormente del estado de México. El territorio que comprende el actual estado de Morelos fue habitado en la antigüedad por la cultura olmeca y fue influenciado por las culturas maya, teotihuacana y mixteco-zapoteca. Después de la conquista, los grupos indígenas de la región se dividieron en dos cacicazgos, el de Cuernavaca y el de Oaxtepec.​ Durante la guerra de independencia, el estado fue testigo de uno de los hechos más memorables de la guerra en 1812 llamado el sitio de Cuautla en que José María Morelos logró vencer el cerco impuesto por el ejército realista durante 72 días.​"},{"page_url":"https://es.wikipedia.org/wiki/Robert_Piris_da_Motta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Flamengo_v_Vasco_September_2018_IMG_4439_%2843805135645%29.jpg","page_title":"Robert Piris da Motta","context_page_description":"Robert Ayrton Piris da Motta Mendoza es un futbolista paraguayo. Juega de mediocampista defensivo y su equipo actual es el Clube de Regatas do Flamengo del Campeonato Brasileño de Serie A."},{"page_url":"https://it.wikipedia.org/wiki/Miomir_Kecmanovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Kecmanovic_RG19_%2842%29_%2848199200981%29.jpg","page_title":"Miomir Kecmanović","context_page_description":"Miomir Kecmanović è un tennista serbo.\\nOttiene il miglior ranking nel circuito ATP il 1º luglio 2019 in singolare col 47º posto e nel doppio col 211º."},{"page_url":"https://de.wikipedia.org/wiki/Guillermo_St%C3%A1bile","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Guillermo_St%C3%A1bile_%281930%29.jpg","page_title":"Guillermo Stábile","context_page_description":"Guillermo „El Filtrador“ Stábile war ein argentinischer Fußballspieler und Torschützenkönig bei der ersten Fußball-Weltmeisterschaft 1930. Auf Vereinsebene wurde er Meister mit CA Huracán und spielte in Italien beim Genoa CFC. Als Trainer gewann er mit Argentinien sechs Mal die Copa América. Zudem trainierte er Hurácan und den Racing Club, den er zu drei Landesmeisterschaften führte."},{"page_url":"https://eo.wikipedia.org/wiki/Ko%C5%82obrzeg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Kolobrzeg_Ratuszowy_Square_from_NW_2007-05.jpg","page_title":"Kołobrzeg","context_page_description":"Kołobrzeg [prononcu: Koŭobĵeg] estas urbo en provinco Okcidenta Pomerio en Pollando. Ĝi apartenas al komunumo Kołobrzeg en distrikto Kołobrzeski."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Fischingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Fischingen_Hauptstrasse_28.jpg","page_title":"Liste der Kulturgüter in Fischingen","context_page_description":"Die Liste der Kulturgüter in Fischingen enthält alle Objekte in der Gemeinde Fischingen im Kanton Thurgau, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://de.wikipedia.org/wiki/Barnett_Janner,_Baron_Janner","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Barnett_Janner_%281970%29.jpg","page_title":"Barnett Janner, Baron Janner","context_page_description":"Barnett Janner, Baron Janner war ein litauischstämmiger britischer Politiker, der als Mitglied der Liberalen Mitglied des Parlaments wurde und später zu Labour wechselte, für die er auch weiterhin einen Parlamentssitz innehatte."},{"page_url":"https://nl.wikipedia.org/wiki/Zdenko_Vukasovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Zdenko_Vukasovi%C4%87.jpg","page_title":"Zdenko Vukasović","context_page_description":"Zdenko Vukasović is een Kroatisch gewezen voetballer. Hij speelde als doelman in België voor onder meer RSC Anderlecht, Cercle Brugge en KSC Lokeren."},{"page_url":"https://br.wikipedia.org/wiki/Brissago_(Ticino)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Brissago_P1130153.jpg","page_title":"Brissago (Ticino)","context_page_description":"Brissago a zo ur gumun eus kanton Ticino e Suis."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B5%D1%81%D0%BB%D0%B0%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B5%D0%BC%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/%D0%92%D0%B0%D0%BB%D1%8B-3.jpg","page_title":"Переславский кремль","context_page_description":"Переславский кремль — центральная часть древнерусского города Переславль-Залесский."},{"page_url":"https://de.wikipedia.org/wiki/Auerochse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Heck_cattle_male.jpg","page_title":"Auerochse","context_page_description":"Der Auerochse oder Ur ist eine in ihrer Wildform ausgerottete Art der Rinder. Nach neueren Genforschungen gelten nahöstliche Populationen als Stammform des taurinen Hausrindes, das damit eine domestizierte Form des Eurasischen Auerochsen darstellt. Das indische Zebu stammt von der indischen Subspezies des Urs ab, welche von manchen Autoren auch in einer eigenen Art, Bos namadicus, geführt wurde. Das vermutlich letzte Exemplar der ehemals weit verbreiteten Wildform des Rindes starb im Jahre 1627.\\nVerwandte dieses Wildrinds sind Gaur, Banteng und der wahrscheinlich ausgerottete Kouprey."},{"page_url":"https://fi.wikipedia.org/wiki/Kuohij%C3%A4rvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Lake_Kuohij%C3%A4rvi%2C_H%C3%A4meenlinna%2C_Finland_%28Feb_2017%29.jpg","page_title":"Kuohijärvi","context_page_description":"Kuohijärvi on Kanta-Hämeessä Hämeenlinnassa ja Pirkanmaalla Pälkäneellä sijaitseva järvi."},{"page_url":"https://fi.wikipedia.org/wiki/Pyh%C3%A4n_Mikaelin_ritarikunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Michel-eyquem-de-montaigne_1.jpg","page_title":"Pyhän Mikaelin ritarikunta","context_page_description":"Pyhän Mikaelin ritarikunta oli Ranskan kuningaskunnan korkea-arvoinen kunniamerkkejä myöntänyt ansioritarikunta. Se oli perustettu vuonna 1469."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E5%AF%8C%E6%B1%97%E9%A4%83%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Vegetarian_ashak_at_The_Helmand.jpg","page_title":"阿富汗餃子","context_page_description":"阿富汗餃子是一種阿富汗食物，通常以義大利麵麵皮包覆蝦夷蔥，上頭加上番茄沙司、優格和乾燥的薄荷。準備肉醬的時間通常耗時較長。該道料理時常於假日或聚會時供應。"},{"page_url":"https://en.wikipedia.org/wiki/Outline_of_the_European_Union","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Europe_satellite_orthographic.jpg","page_title":"Outline of the European Union","context_page_description":"The following outline is provided as an overview of and topical guide to the European Union:\\nThe European Union is an economic and political union of 27 member states, located primarily in Europe. Committed to regional integration, the EU was established by the Treaty of Maastricht on 1 November 1993 upon the foundations of the pre-existing European Economic Community. With 500 million citizens, the EU combined generates an estimated 30% share of the nominal gross world product. The EU has seven principal decision making bodies known as the Institutions of the European Union, while the adoption of laws and coordination of EU policies is the role of the Council of the European Union which currently meets in ten different configurations."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B5%D8%B1_%D8%A7%D9%84%D8%B3%D9%84%D8%A7%D9%85_(%D9%87%D9%88%D9%84%D9%86%D8%AF%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Loder_Palais_de_la_Paix_Peace_Palace_Den_Haag_The_Hague_La_Haye.jpg","page_title":"قصر السلام (هولندا)","context_page_description":"قصر السلام هو عبارة عن مبنى إداري في لاهاي، هولندا. وغالباً ما يطلق عليه مقر القانون الدولي لأنه يضم محكمة العدل الدولية، ومحكمة التحكيم الدائمة، وأكاديمية لاهاي للقانون الدولي، ومكتبة قصر السلام الشاملة. بالإضافة إلى استضافة هذه المؤسسات، وقصر هو أيضا مكانا منتظما للمناسبات الخاصة في السياسة الدولية والقانون الدولي. قصر افتتح رسميا في 28 آب 1913، وبنيت أصلا لتوفير منزل رمزي للمحكمة التحكيم الدائمة، خلقت محكمة لانهاء الحرب التي أنشئت بموجب معاهدة في [لاهاي [اتفاقيتا 1899 و1907]]. أندرو ديكسون وايت، الذين كان لهم دور فعال في خلق هذه المحكمة وتأمين التمويل اللازم لتوفير ذلك مع \\"أماكن تستحق\\" الجهود، كتب عن فكرة لصديقه أندرو كارنجي، الذين قدموا في نهاية المطاف 1.5 مليون دولار لبناء قصر السلام:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gemeinden_im_D%C3%A9partement_Aisne","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Aisne-Position.png","page_title":"Liste der Gemeinden im Département Aisne","context_page_description":"Das Département Aisne liegt in der Region Hauts-de-France in Frankreich. Es untergliedert sich in fünf Arrondissements mit 800 Gemeinden.\\nSiehe auch: Liste der Kantone im Département Aisne"},{"page_url":"https://en.wikipedia.org/wiki/Port-Cartier%E2%80%93Sept-%C3%8Eles_Wildlife_Reserve","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Rivi%C3%A8re_MacDonald_03.jpg","page_title":"Port-Cartier–Sept-Îles Wildlife Reserve","context_page_description":"The Port-Cartier-Sept-Îles Wildlife Reserve is a wildlife reserve in the province of Quebec, Canada."},{"page_url":"https://pl.wikipedia.org/wiki/Plac_Stanis%C5%82awa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Nancy_Place_Stanislas_BW_2015-07-18_13-50-15.jpg","page_title":"Plac Stanisława","context_page_description":"Plac Stanisława – największy plac francuskiego miasta Nancy.\\nZostał zaprojektowany i wykonany w latach 1752–1755 przez Emmanuela Héré. Inicjatorem budowy był dawny król Polski, ówczesny książę Lotaryngii i Baru – Stanisław Leszczyński. Cały projekt zakładał połączenie starego miasta z nowym, wybudowanym za czasów księcia Karola III Wielkiego.\\nNa środku placu stał pomnik króla Ludwika XV, usunięty przez rewolucjonistów. W 1831 w tym miejscu stanęła statua Stanisława Leszczyńskiego.\\nPlac Stanisława ma długość 125 metrów i szerokość 106 metrów. Do głównych obiektów architektonicznych na placu zalicza się:\\nHôtel de Ville\\nbudynek opery i teatru\\nMuzeum Sztuk Pięknych\\nłuk triumfalny\\nfontanny Amfitryty i Neptuna\\npomnik Stanisława Leszczyńskiego\\nW 1983 Plac Stanisława wraz z sąsiednimi placami Place de la Carrière oraz Place d’Alliance został zapisany na liście światowego dziedzictwa UNESCO, ze względu na nowatorskie i niespotykane nigdzie indziej jak na owe czasy rozwiązania architektoniczne."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_7001","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/NGC_7001.png","page_title":"NGC 7001","context_page_description":"NGC 7001 is een spiraalvormig sterrenstelsel in het sterrenbeeld Waterman. Het hemelobject werd op 21 juli 1827 ontdekt door de Britse astronoom John Herschel."},{"page_url":"https://de.wikipedia.org/wiki/Nationalpark_M%C3%A9danos_del_Chaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Aspidosperma_quebracho-blanco-_Soriano%2C_Palmar%2C_Bosque_parque_al_margen_del_Arroyo_Vera_45.jpg","page_title":"Nationalpark Médanos del Chaco","context_page_description":"Der Nationalpark Médanos del Chaco liegt im Norden Paraguays an der bolivianischen Grenze im Departamento Boquerón und Departamento Alto Paraguay. Es ist der zweitgrößte Nationalpark des Landes. Er wurde am 12. August 2003 gegründet und am 1. Dezember 2016 auf die Fläche von 7063 km² erweitert."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A1diz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/FFG_en_dique_seco.jpg","page_title":"Cádiz","context_page_description":"Cádiz es una ciudad y municipio de España, capital de la provincia homónima, en la comunidad autónoma de Andalucía. Con 116 979 habitantes empadronados en 2018, ​ es la ciudad más poblada de la bahía de Cádiz y la tercera de la provincia tras Jerez de la Frontera y Algeciras. Forma parte del Área metropolitana de la Bahía de Cádiz-Jerez, tercera área metropolitana de Andalucía, detrás de las de Sevilla y Málaga, y la undécima de España.\\nSituada al sur de la península ibérica, en el extremo suroccidental de la Europa continental, ​​ conforma junto con los municipios de Chiclana, El Puerto de Santa María, Jerez, Puerto Real, Rota y San Fernando la llamada Mancomunidad de Municipios Bahía de Cádiz.​\\nCádiz es una isla que se separa del continente por un estrecho canal llamado Caño de Sancti Petri que atraviesa las marismas. La ciudad se sitúa frente al estuario del río Guadalete, e inmersa en el parque natural de la Bahía de Cádiz, a 122 km de la capital autonómica, Sevilla.​ El conjunto formado por Cádiz y San Fernando está separado de la península ibérica por el mencionado Caño de Sancti Petri."},{"page_url":"https://en.wikipedia.org/wiki/Amissville,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/GeologicalMapRappahannockCountyVA.jpg","page_title":"Amissville, Virginia","context_page_description":"Amissville is an unincorporated community in Rappahannock County in the U.S. state of Virginia. It is located on U.S. Route 211 about halfway between Warrenton and the small town of Washington, Virginia.\\nThe Locust Grove/R.E. Luttrell Farmstead and Meadow Grove Farm are listed on the National Register of Historic Places."},{"page_url":"https://en.wikipedia.org/wiki/Turbine_Legend","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/TurbineLegend.jpg","page_title":"Turbine Legend","context_page_description":"The Turbine Legend is an American sports monoplane designed by Performance Aircraft for sale as a kit for amateur construction."},{"page_url":"https://nl.wikipedia.org/wiki/VV_Stevensweert","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Accommodatie_VV_Stevensweert.jpg","page_title":"VV Stevensweert","context_page_description":"RKVV Stevensweert is een op 27 oktober 1940 opgerichte amateurvoetbalvereniging uit Stevensweert, gemeente gemeente Maasgouw, Limburg, Nederland."},{"page_url":"https://ko.wikipedia.org/wiki/1984%EB%85%84_(%EC%86%8C%EC%84%A4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/1984_fictious_world_map.png","page_title":"1984년 (소설)","context_page_description":"《1984년》은 1949년 출판된 조지 오웰의 디스토피아 소설이다. 1984년을 전체주의가 극도화된 사회로 상정하고 쓴 미래 소설인 작품 속에서 세계는 거대한 초국가들로 분화되어 있고 이들은 영구적인 전쟁 상태이다. 작품의 배경이 되는 곳은 영국으로 소설 속에선 \\"제1공대\\"로 불리며 오세아니아에 포함되어 있다. 오세아니아는 전체주의 정치 이데올로기인 영사의 지배를 받으며 최고위 지배자는 대형이다. 소설 속 국가는 기록을 조작하고, 개인의 일거수 일투족을 감시하며, 언어와 사고를 통제하여 영구적인 집권을 기획한다. 소설은 이러한 세계관을 바탕으로 기록조작을 담당하던 주인공이 전체주의와 갈등하는 이야기를 다룬다.\\n《1984년》은 올더스 헉슬리의 《멋진 신세계》, 예브게니 이바노비치 자먀찐의 《우리들》과 더불어 디스토피아를 다룬 소설 가운데 대표작으로 꼽히며, 이후 많은 예술작품에 영향을 주었다. 소설의 영향으로 사회나 국가 시스템에 의문을 제기하고 전체주의, 권위주의와 같은 비민주적 정치체제에 반기를 드는 사람을 오웰족이라고 부른는 경우도 있다. 1989년 집계 당시 《1984년》은 65개 언어로 번역되었다. 이는 조사 당시 다른 어떤 영국 소설 보다 많은 숫자이다.\\n작품의 제목인 1984는 작가가 작품을 탈고한 1948년의 뒷자리 년도를 뒤집은 것이다."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%94%9F%E7%89%A9%E9%B9%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Papaver_somniferum_01.jpg","page_title":"生物鹼","context_page_description":"生物鹼是一種主要包含鹼性氮原子，天然存在於大自然動植物及蕈類的化合物。一些化學合成但結構與生物鹼相似的化合物有時也被稱作生物鹼。除了碳，氫和氮，生物鹼也可以含有氧，硫，甚或其他元素，如氯，溴，和磷。\\n很多的生物鹼都對人或動物有藥理反應。生物鹼大都是胺基酸的衍生物，嚐起來有苦澀味。它們常以次生代謝物的形式出現於植物、動物及蕈類。大部份的生物鹼皆能由它們的植物提取液中以酸－鹼萃取獲得。生物鹼的英文為「alkaloid」，這個字由「alkaline」一字衍生而成。原本「alkaloid」泛指一切含有氮的鹼基。\\n雖然大部份的生物鹼對於人體有毒，但也有些能入藥。主要有鎮痛或麻醉的作用，以嗎啡及可待因的作用尤其顯著。\\n生物鹼是被大量的各種生物體產生，包括細菌，真菌，植物和動物。它們可以從通過酸鹼萃取這些生物體的粗提物進行純化。\\n古代的毒藥大多為強烈的有毒生物鹼，據傳說犀牛角只要碰到生物鹼就會整個支離破碎，因此古代的國王或是皇帝都會利用犀牛角來做酒杯，以避免被毒殺。"},{"page_url":"https://en.wikipedia.org/wiki/H%C3%B6llental_(Black_Forest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/54%2C_Falkenstein_-_H%C3%B6llental.JPG","page_title":"Höllental (Black Forest)","context_page_description":"The Höllental in the Black Forest is a deep valley - in places like a gorge - in the state of Baden-Württemberg in Germany. The valley, which is about 9 km long, is located in the southern part of the Southern Black Forest Nature Park about 18 km southeast of Freiburg im Breisgau between Hinterzarten and Buchenbach-Himmelreich. The Rotbach stream runs through the valley. \\"Hölle\\" is the German word for \\"hell\\". In the narrow, dark valley, travellers almost felt like moving underground. The valley was the locale of the Battle of Emmendingen in 1796, part of the French Revolutionary Wars."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A8ge_Longchamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/College-longchamp-portail.jpg","page_title":"Collège Longchamp","context_page_description":"Initialement construit pour accueillir les sœurs du Sacré-Cœur, le futur collège Longchamp, situé au 23, rue Jean-de-Bernardy, à Marseille, est devenu en 1906 un lycée de jeunes filles, à la suite de la suppression de l'enseignement confessionnel.\\nCe n'est que durant les années 1980 qu'il prit son statut actuel de collège.\\nSes locaux connurent plusieurs vies, ainsi que les affres des deux guerres mondiales."},{"page_url":"https://id.wikipedia.org/wiki/Pertempuran_Eurymedon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Eurymedon_Bridge%2C_Aspendos%2C_Turkey._Pic_01.jpg","page_title":"Pertempuran Eurymedon","context_page_description":"Pertempuran Eurymedon adalah pertempuran ganda, berlangsung di darat dan laut, antara Liga Delos pimpinan Athena beserta sekutu-sekutunya melawan Kekasiaran Persia pimpinan Xerxes I. Pertempuran ini kemungkinan terjadi pada tahun 469 atau 466 SM, di sekitar mulut Sungai Eurymedon di Pamfilia, Asia Kecil. Pertempuran ini merupakan bagian dari Peperangan Liga Delos, sekaligus merupakan bagian dari Perang Yunani-Persia.\\nLiga Delos dibentuk oleh Athena bersama banyak negara kota di Aigea untuk melanjutkan perang melawan Persia, yang dimulai sejak invasi pertama dan kedua Persia ke Yunani. Setelah Pertempuran Plataia dan Pertempuran Mykale, yang mengakhiri invasi kedua Persia, giliran Persekutuan Yunani yang mengambil langkah ofensif, mengepung kota Sestos dan Byzantion. Liga Delos mengambil alih tanggung jawab untuk perang, dan melanjutkan menyerang basis-basis Persia di Aigea selama dekade berikutnya.\\nKemungkinan pada tahun 469 atau 466 SM, Persia mulai mengumpulkan pasukan dan armada besar untuk melancarkan serangan besar-besaran ke Yunani. Berkumpul di dekat Eurymedon, barangkali tujaun ekspedisi ini adalah bergerak ke pesisir Asia Kecil, menaklukan tiap kota di sana."},{"page_url":"https://el.wikipedia.org/wiki/R%C4%ABgas_Vagonb%C5%ABves_R%C5%ABpn%C4%ABca","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/LG_AR2-001_Vilnius_01.JPG","page_title":"Rīgas Vagonbūves Rūpnīca","context_page_description":"Η Rīgas Vagonbūves Rūpnīca είναι ένα από τα μεγαλύτερα εργοστάσια κατασκευής μηχανών στη Λετονία, το οποίο ιδρύθηκε το 1895 από τον επιχειρηματία Όσκαρ Φρέιγουιρθ με το όνομα Phoenix. Η RVR εδρεύει στη Ρίγα και για πολλά χρόνια ήταν ο μεγαλύτερος παραγωγός ηλεκτρικής τρένων και τρένων ντίζελ, καθώς και των τραμ στην πρώην Σοβιετική Ένωση. Τα πιο γνωστά μοντέλα της είναι τα ηλεκτρικά τρένα ER1, ER2, ER7 και ER9, πολλά από τα οποία είναι ακόμα σε λειτουργία σήμερα. Μεταξύ του 1973 και του 1988 κατασκεύαζε το τρένο υψηλής ταχύτητας ER200, και πιο πρόσφατα, συμμετείχε στην ανακαίνιση των μονάδων που διαχειρίζεται η λετονική εταιρεία σιδηροδρόμων Pasažieru Vilciens."},{"page_url":"https://de.wikipedia.org/wiki/Ageratum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Ageratum_houstonianum_01.JPG","page_title":"Ageratum","context_page_description":"Ageratum ist eine Pflanzengattung in der Familie der Korbblütler. Diese Gattung ist mit etwa 40 Arten neotropisch verbreitet. Bekannteste Art ist der Gewöhnliche Leberbalsam, der mit einigen Sorten als Zierpflanze in Parks, Gärten und Balkonkästen verwendet wird."},{"page_url":"https://fr.wikipedia.org/wiki/N%C3%A9cropole_punique_de_Puig_des_Molins","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Hipogeo_Puig_des_Molins1.jpg","page_title":"Nécropole punique de Puig des Molins","context_page_description":"La nécropole punique de Puig des Molins est un site utilisé comme nécropole par les phénico-puniques à proximité de la cité d'Ibiza, dans les Baléares. Par la durée de son utilisation et le matériel archéologique trouvé lors des fouilles, il constitue la source principale de notre connaissance de l'emprise de la civilisation carthaginoise sur cette île."},{"page_url":"https://en.wikipedia.org/wiki/Joci_P%C3%A1pai","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Joci_P%C3%A1pai_Kyiv_2017_2.jpg","page_title":"Joci Pápai","context_page_description":"József \\"Joci\\" Pápai is a Hungarian singer, voice actor, rapper and guitarist of Romani descent. He represented Hungary at the Eurovision Song Contest 2017 with the song \\"Origo\\" finishing in 8th place. He represented Hungary again at the Eurovision Song Contest 2019 with the song \\"Az én apám\\". However he failed to qualify for the grand final being the first Hungarian entry not to since returning in 2011."},{"page_url":"https://en.wikipedia.org/wiki/Psilocarphus_tenellus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Psilocarphus_tenellus.jpg","page_title":"Psilocarphus tenellus","context_page_description":"Psilocarphus tenellus is a species of flowering plant in the aster family known by the common names slender woollyheads and slender woolly marbles. It is native to western North America from far southwestern British Columbia to Baja California, where it grows in seasonally wet habitat, such as vernal pools, as well as coastline and disturbed areas."},{"page_url":"https://ru.wikipedia.org/wiki/China_Resources_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/HK_Wan_Chai_CRB_%E8%8F%AF%E6%BD%A4%E5%A4%A7%E5%BB%88_China_Resources_Building_covered_walkway_visitors_May-2013.JPG","page_title":"China Resources Building","context_page_description":"China Resources Building — 48-этажный гонконгский небоскрёб. Расположен в округе Ваньчай, на оживлённой улице Харбор-роуд. Построен в 1983 году по проекту компании WMKY. Имеется три подземных этажа.\\nВ здании расположены штаб-квартиры многочисленных дочерних структур многопрофильного конгломерата China Resources, в том числе компании China Resources Land.\\nРанее в вестибюле здания находилась керамическая «Стена девяти драконов» — точная копия старинного пекинского оригинала, также признаваемая экспертами произведением искусств."},{"page_url":"https://ro.wikipedia.org/wiki/Gara_Luton_Airport_Parkway","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Luton_AP_Concourse.jpg","page_title":"Gara Luton Airport Parkway","context_page_description":"Gara Luton Airport Parkway este o gară pe Magistrala Midland din Anglia, care deservește sudul orașului Luton și Aeroportul Luton din Bedfordshire. Aceasta este situată în Park Town, Luton, la 47 km de Londra St Pancras, între Harpenden și Luton. Codul gării este LTN, care este și codul IATA al aeroportului.\\nGara este deservită de trenuri operate de Thameslink pe ruta Thameslink și de East Midlands Trains pe Magistrala Midland.\\nGara Luton Airport Parkway este situată la aproximativ 1,6 km vest de aeroport, de care este legat printr-un un serviciu de transfer cu autobuzul tarifat suplimentar."},{"page_url":"https://en.wikipedia.org/wiki/Kagoshima-Ch%C5%AB%C5%8D_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Nishi-Kagoshima_Station_1959.jpg","page_title":"Kagoshima-Chūō Station","context_page_description":"Kagoshima-Chūō Station is a major railway station in Kagoshima, Japan, operated by Kyushu Railway Company. It is the main railway terminal serving Kagoshima, the southern terminus of the Kyushu Shinkansen and is located on the Kagoshima Main Line and Ibusuki-Makurazaki Line. Before the Kyushu Shinkansen opened in 2004, the station was called Nishi-Kagoshima Station."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B5_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Blanzac_N%C3%A9_Rices1_2012.jpg","page_title":"Не (река)","context_page_description":"Не је река у Француској. Дуга је 66 km. Улива се у Шарант."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D1%85%D0%BE%D0%BF%D1%83%D1%82%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/9P149_Shturm-S_Tank_Destroyer.jpg","page_title":"Сухопутные войска Армении","context_page_description":"Сухопутные войска Армении — один из видов вооружённых сил Армении, предназначенный для ведения боевых действий преимущественно на суше."},{"page_url":"https://ro.wikipedia.org/wiki/Bibliografia_lui_Ray_Bradbury","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Ray_Douglas_Bradbury.jpg","page_title":"Bibliografia lui Ray Bradbury","context_page_description":"Aceasta este o listă a lucrărilor scrise de Ray Bradbury."},{"page_url":"https://vec.wikipedia.org/wiki/Les_Autels-Villevillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Eglise_Notre-Dame_de_Villevillon.jpg","page_title":"Les Autels-Villevillon","context_page_description":"Les Autels-Villevillon el xé on comun de 156 abitanti del departemento de Eure-et-Loir che el fa parte del rejon Sentro-Vałe de ła Loira in Fransa."},{"page_url":"https://it.wikipedia.org/wiki/Bad_Colberg-Heldburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Rathaus_Heldburg.JPG","page_title":"Bad Colberg-Heldburg","context_page_description":"Bad Colberg-Heldburg è una ex città di 2.118 abitanti della Turingia, in Germania; dal 2019 è parte della città di Heldburg.\\nAppartiene al circondario di Hildburghausen e, come comune, era parte della comunità amministrativa di Heldburger Unterland."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D1%88%D0%BA%D0%B8%D0%BB%D0%B5%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/%D0%84%D1%88%D0%BA%D1%96%D0%BB%D1%94%D0%B2_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80.jpg","page_title":"Ешкилев, Владимир Львович","context_page_description":"Влади́мир Льво́вич Е́шкилев — украинский прозаик, поэт, эссеист. Идеолог «станиславского феномена»."},{"page_url":"https://eo.wikipedia.org/wiki/Val-de-Charmey","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Cerniat%2C_vu_sur_Charmey.jpg","page_title":"Val-de-Charmey","context_page_description":"Val-de-Charmey estas urbo kaj komunumo en la distrikto Grejerco en Kantono Friburgo, Svislando. Ĝi havis 2844 loĝantojn laŭ la ciferoj de la malnovaj komunumoj Cerniat kaj Charmey de la 31-a de decembro 2012."},{"page_url":"https://io.wikipedia.org/wiki/Brookwood,_Alabama","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/ALMap-doton-Brookwood.PNG","page_title":"Brookwood, Alabama","context_page_description":"Brookwood esas urbeto en la komtio Tuscaloosa, Alabama, Usa. Segun la demografiala kontado di 2000, ol havis 1,483 habitanti."},{"page_url":"https://pt.wikipedia.org/wiki/Casa_de_Baden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Baden-Baden_10-2015_img16_view_to_Burg_Hohenbaden.jpg","page_title":"Casa de Baden","context_page_description":"A Casa de Baden ou, na sua forma portuguesa, de Bade pertence há séculos à nobreza alemã. Sendo a linha mais jovem da Casa de Zähringen. O primeiro marquês de Baden foi Hermann II, neto de Berthold I, Duque de Zähringen e Caríntia. Ele começou a reinar em 1074 e tomou o título de marquês em 1112. A família tem raízes em Breisgau, o Ortenaukreis, Baar, o Hegau e o Thurgau. Já no início da idade média através do ancestral comum de Zähringen e mais tarde Casa de Baden nas áreas mencionadas lhes deu direitos dinásticos e, portanto, foram uma das principais famílias no sudoeste do Ducado da Suábia.\\nSeus Estados repetidamente foram compartilhadas entre seus descendentes, que deu origem a vários ramos. Hermann V de Baden e Henrique I de Baden-Hachberg, filho de Hermann IV de Baden, como resultado de uma divisão que ocorreu em 1190, tornou-se o tronco de duas novas linhas, aqueles de:\\nBaden - Baden,\\nBaden-Hachberg."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%93%E0%A4%9C%E0%A5%8B%E0%A4%A8_%E0%A4%B9%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Radiative-forcings.svg","page_title":"ओजोन ह्रास","context_page_description":"ओजोन ह्रास या ओजोन अवक्षय दो अलग लेकिन सम्बंधित प्रेक्षणों का वर्णन करता है; 1970 के दशक के बाद से पृथ्वी के समतापमंडल में ओजोन की कुल मात्रा में प्रति दशक लगभग चार प्रतिशत की धीमी लेकिन स्थिर कमी आ रही है;और समान अवधि के दौरान पृथ्वी के ध्रुवीय क्षेत्रों के ऊपर समतापमंडल की ओजोन में अधिक लेकिन मौसमी कमी आ रही है। बाद वाली घटना को सामान्यतः ओजोन छिद्र के रूप में जाना जाता है। इस जाने माने संताप मंडलीय ओजोन रिक्तीकरण के अलावा, क्षोभ मंडलीय ओजोन रिक्तीकरण की घटनाएँ भी पाई गई हैं, जो बसंत ऋतु के दौरान ध्रुवीय क्षेत्रों की सतह के पास होता है।\\nविस्तृत क्रियाविधि जिसके द्वारा ध्रुवीय ओजोन छेद, मध्य अक्षांश रिक्तीकरण से भिन्नता रखता है, लेकिन दोनों प्रवृतियों में सबसे महत्वपूर्ण प्रक्रिया है परमाणु क्लोरीन और ब्रोमीन द्वारा ओजोन का अपघटनी विनाश. समताप मंडल में इन हेलोजन परमाणुओं का मुख्य स्रोत है क्लोरो फ्लोरो कार्बन योगिकों का प्रकाश अपघटन, ये योगिक सामान्यतः फ़्रेयोन कहलाते हैं, साथ ही ब्रोमो फ्लोरो कार्बन योगिकों का प्रकाश अपघटन भी इसका कारण है जो हेलोन कहलाते हैं। इन योगिकों का समतापमंडल में स्थानांतरण सतह पर उत्सर्जित होने के बाद होता है। सी एफ सी और हेलोन की वृद्धि होने पर ओजोन रिक्तीकरण क्रियाविधि में भी वृद्धि होती है।"},{"page_url":"https://hu.wikipedia.org/wiki/Oszm%C3%A1n_Birodalom","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Mustafa3.jpg","page_title":"Oszmán Birodalom","context_page_description":"Az Oszmán Birodalom, az egyik legnagyobb és a legtovább fennálló iszlám világbirodalom, amely évszázadokon át megkerülhetetlen hatalmi tényező volt az európai erőviszonyok alakulásában. A 13. század elején, a rúmi szeldzsukok uralta anatóliai területen létrejött törzsi szövetség a 16–17. századra a maga korában egyedülálló államszervezetet hozott létre, amely rendkívül jól szervezett közigazgatási rendszerével, erőforrásainak bőségével és az ezekre épülő fejlett katonai erejével megszerezte a hegemóniát a közel-keleti térségben, és hódításaival már az európai államok létét veszélyeztette.\\nA keresztény világ ellentámadásának hatására a területeit fokozatosan feladni kényszerülő birodalom, belső ellentmondásainak is köszönhetően, a 19. századra már nem tudott lépést tartani Európa politikai és gazdasági fejlődésével, és válságok sorozatát élte meg, „Európa beteg emberének” nevezték, gyakorlatilag félgyarmati sorba került. Az első világháború után területét az imperialista nyugati hatalmak érdekszférákra osztották, és már úgy tűnt, hogy anatóliai területeit is veszély fenyegeti."},{"page_url":"https://fi.wikipedia.org/wiki/Vjat%C5%A1eslav_Molotov","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Molotov%2C_Stalin_and_Voroshilov%2C_1937.jpg","page_title":"Vjatšeslav Molotov","context_page_description":"Vjatšeslav Mihailovitš Molotov oli neuvostoliittolainen poliitikko ja diplomaatti. Molotov oli Aleksandra Kollontain ja Josif Stalinin itsensä ohella ainoita bolševikkien johtohahmoja, jotka selvisivät hengissä 1930-luvun suurista puhdistuksista."},{"page_url":"https://de.wikipedia.org/wiki/Alsen_(J%C3%A4mtland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Alsen%2CKyrkan1.JPG","page_title":"Alsen (Jämtland)","context_page_description":"Alsen ist eine Kirchengemeinde in der nordschwedischen Gemeinde Krokom. Die Kirchengemeinde Alsen gehört zum Bistum Härnösand und liegt etwa 50 Kilometer nordwestlich von der jämtländischen Hauptstadt Östersund."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B7%D0%BE%D1%82%D0%B8%D1%81%D1%82%D0%B0%D1%8F_%D0%BA%D0%B8%D1%81%D0%BB%D0%BE%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Cis-nitrous-acid-3D-balls.png","page_title":"Азотистая кислота","context_page_description":"Азо́тистая кислота HNO₂ — слабая одноосновная кислота, существует только в разбавленных водных растворах, окрашенных в слабый голубой цвет, и в газовой фазе. Кислота весьма токсична. Соли азотистой кислоты называются нитритами или азотистокислыми. Нитриты гораздо более устойчивы, чем HNO₂, многие из них - токсичны, канцерогенны."},{"page_url":"https://it.wikipedia.org/wiki/Ponte_di_Rande","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Puente_de_Rande.JPG","page_title":"Ponte di Rande","context_page_description":"Il ponte di Rande è un ponte strallato autostradale a due carreggiate che attraversa lo Stretto di Rande, nella provincia di Pontevedra in Spagna. Fu progettato dall'ingegnere italiano Fabrizio de Miranda con Alfredo Passaro e con lo spagnolo Florencio del Pozo e costruito dall'Impresa spagnola Cubiertas y Tejados e Mzov che aveva vinto l'appalto concorso internazionale. Il ponte fu ultimato nel 1978. Il suo tracciato fa parte della rete delle Autopistas del Atlántico.\\nMisura 1558 m di lunghezza, le pile che lo sostengono hanno un'altezza di 148 m e la luce centrale misura 400 m. Alla data della costruzione era uno dei più grandi ponti strallati del mondo. Nel 1979 a Montreaux i progettisti hanno ricevuto il premio europeo ECCS-CECM per il valore dell'Opera.\\nIl ponte, che unisce i comuni di Redondela e Moaña attraverso lo stretto di Rande, è tuttora uno dei ponti strallati più grandi della Spagna ed è un'opera di ingegneria che caratterizza la ria di Vigo.\\nAttualmente sopporta un traffico di oltre 50.000 veícoli al giorno."},{"page_url":"https://de.wikipedia.org/wiki/Ch%C3%A1_Gorreana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ch%C3%A1Gorreana360.jpg","page_title":"Chá Gorreana","context_page_description":"Chá Gorreana ist eine Tee-Fabrik in Gorreana auf der portugiesischen Azoren-Insel São Miguel.\\nChá Gorreana ist neben dem nahe gelegenen Chá Porto Formoso die einzige Teefabrik Portugals. Zusammen mit einer Fabrik bei Truro im Englischen Cornwall sind dies die drei einzigen Teefabriken innerhalb der Europäischen Union. Die Plantagen liegen auf der Insel-Nordseite im Kreis von Ribeira Grande.\\nDie Teekultur kam im Jahr 1878 durch zwei Chinesen aus Macau auf die Azoren. Es gibt aber Vermutungen, dass die Camellia sinensis bereits um 1750 nach São Miguel gebracht wurde. Dokumentiert ist die Einfuhr von Samen der Teepflanze aus Brasilien für das Jahr 1820 durch den Miguelenser Jacinto Leite. Das milde Klima der Insel mit über das ganze Jahr verteiltem Regen ohne Frost und wenig zu intensivem Sonnenschein ist ideal.\\nIm Bereich Gorreana gibt es saure Lehmböden, Voraussetzung für duftenden Tee mit angenehmem Nachgeschmack. Das Anwesen umfasst 32 Hektar. Produziert wird ökologisch ohne Verwendung von Pestiziden, Herbiziden und Fungiziden.\\nDie Vermarktung erfolgt überwiegend auf dem Festland Portugals."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A7%D8%AA%DA%A9%D9%88_%D8%B1%D9%88%D8%AF%DB%8C%DA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ratko_Rudi%C4%87_kolovoz_2012_%28cropped%29.jpg","page_title":"راتکو رودیچ","context_page_description":"راتکو رودیچ بازیکن واترپلو اهل جمهوری فدرال سوسیالیستی یوگسلاوی است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D1%82%D1%83%D1%80_ATP_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Grand_Slam_men%27s_singles_champions_2010.jpg","page_title":"Мировой тур ATP 2010","context_page_description":"Мировой тур ATP 2010 — элитный мировой тур теннисистов профессионалов, проводимый Ассоциацией Теннисистов Профессионалов с января по ноябрь. В 2010 году он включает:\\n4 турнира Большого шлема;\\n9 турниров в серии Мировой тур ATP Мастерс 1000;\\n11 турниров в серии Мировой тур ATP 500;\\n40 турниров в серии Мировой тур ATP 250;\\nКомандный кубок мира;\\nКубок Дэвиса;\\nФинал мирового тура ATP."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BB%D0%B5%D0%B7%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Telizi1885.jpg","page_title":"Телези","context_page_description":"Те́лези — деревня в Русско-Высоцком сельском поселении Ломоносовском районе Ленинградской области."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B2%B4%EB%A0%88%ED%86%A0%EB%94%94%EC%8A%A4%ED%8F%B4%EB%A0%88%ED%86%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/CERRETO_DI_SPOLETO.jpg","page_title":"체레토디스폴레토","context_page_description":"체레토디스폴레토는 이탈리아 움브리아주 페루자도에 위치한 코무네다. 영어 단어인 charlatan가 이곳에서 뿌리를 두고 있다는 주장이 있다."},{"page_url":"https://sv.wikipedia.org/wiki/Michel_Mercier","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bayrou_Bercy_2007-04-18_n35.jpg","page_title":"Michel Mercier","context_page_description":"Michel Mercier, född 7 mars 1947 i Bourg-de-Thizy i departementet Rhône, är en fransk politiker som mellan 2010 och 2012 var Frankrikes justitieminister. Sedan 2007 representerar han det konservativa partiet Union pour un Mouvement Populaire. Dessförinnan stod han François Bayrou nära och var medlem i mittenpartierna Union pour la Démocratie Française och dess efterföljare Mouvement démocrate.\\nMercier är jurist med examen från Institut d'études politiques de Lyon. Han var ledamot av nationalförsamlingen 1993-1995 och senaten 1995-2009, invald för departementet Rhône. Därefter inträdde han i François Fillons regering som minister med ansvar för regionutvecklingsfrågor. Året därpå efterträdde han Michèle Alliot-Marie som justitieminister. Han har i omgångar varit borgmästare och haft en mängd poster i Thizy i Rhône."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B1%D0%B8%D0%BB%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%9E%D0%BC%D0%B5%D0%BB%D1%8F%D0%BD_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/uk/7/71/%D0%9E%D0%BC%D0%B5%D0%BB%D1%8F%D0%BD_%D0%9A%D0%BE%D0%B1%D0%B8%D0%BB%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B7_%D1%83%D1%87%D0%BD%D1%8F%D0%BC%D0%B81.jpg","page_title":"Кобилянський Омелян Миколайович","context_page_description":"Кобилянський Омелян Миколайович — український художник, педагог."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_5_oktober","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/WFReitz_CHM_VA0957.jpg","page_title":"Lijst van personen geboren op 5 oktober","context_page_description":"Dit is een lijst van personen die geboren zijn op 5 oktober.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n954 - Malcolm II van Schotland, koning, koning van Schotland uit het Koninkrijk Schotland bewerken\\n1319 - Peter IV van Aragón, schrijver uit de Kroon van Aragón bewerken\\n1377 - Lodewijk II van Napels, Franse heer van Guisa, monarch bewerken\\n1409 - Karel VIII van Zweden, Zweedse koning bewerken\\n1494 - Jan Adornes, geboren de la Coste, politicus bewerken\\n1546 - Rudolph Snel van Royen, Nederlandse rector magnificus van de Universiteit Leiden, wiskundige, taalkundige, academisch docent en theoloog bewerken\\n1600 - Thomas Goodwin, theoloog uit het Koninkrijk Engeland bewerken\\n1624 - Gaspar de Witte, kunstschilder uit de Zuidelijke Nederlanden bewerken\\n1625 - Eduard van de Palts, Duitse prins, aristocraat bewerken\\n1626 - George II van Württemberg-Mömpelgard, graaf, aristocraat bewerken"},{"page_url":"https://es.wikipedia.org/wiki/Acueductos_de_Roma","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/RomaAcquedottoTraCelioePalatino.JPG","page_title":"Acueductos de Roma","context_page_description":"Los romanos construyeron numerosos acueductos para proporcionar agua a las ciudades y lugares industriales en su imperio. Estos acueductos estaban entre los mayores logros de ingeniería del mundo antiguo y establecieron un estándar no igualado durante más de mil años tras la caída de Roma. Hoy en día muchas ciudades mantienen y usan los antiguos acueductos aunque los canales abiertos han sido, normalmente, reemplazados por tuberías.\\nLa misma ciudad de Roma, por ser la ciudad más grande, tenía la mayor concentración de acueductos, con agua proporcionada por once acueductos construidos a lo largo de un período de quinientos años. Los estudiosos han llegado a predecir el tamaño de la ciudad por su abastecimiento de agua.\\nProporcionaban agua potable, numerosos baños y fuentes en la ciudad y, finalmente, se vaciaban en serrerías, donde desempeñaban su última función, la de remover los desperdicios. Los métodos para la construcción fueron bien descritos por Vitruvio en su obra De Architectura, escrita en el siglo I a. C. Su libro fue de gran ayuda para Frontino, un general que fue nombrado, a finales del siglo I, para administrar los muchos acueductos de Roma."},{"page_url":"https://en.wikipedia.org/wiki/William_Foster_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/AndoverMA_WilliamFosterHouse.jpg","page_title":"William Foster House","context_page_description":"The William Foster House is a historic house at 96 Central Street in Andover, Massachusetts. The core of this house is a three-bay two-story late First Period structure built c. 1720. It was added onto about 1750, adding a two-story one-room ell to the southwest corner of the house. A new chimney core was added on the north side late in the 18th century, and a second two-story wing was added on the northwest. Although the house is traditionally dated to c. 1660, the stylistic construction techniques indicate a later construction date.\\nThe house is also notable for housing a boys' school in the later years of the 18th century, operated by William Foster for students who could not qualify for Phillips Academy. It was listed on the National Register of Historic Places in 1990."},{"page_url":"https://el.wikipedia.org/wiki/%CE%94%CE%B9%CE%B1%CE%BC%CE%B5%CF%81%CE%AF%CF%83%CE%BC%CE%B1%CF%84%CE%B1_%CF%84%CE%BF%CF%85_%CE%92%CE%BF%CF%81%CE%B3%CE%AF%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Matthew_and_Hosea.jpg","page_title":"Διαμερίσματα του Βοργία","context_page_description":"Τα Διαμερίσματα του Βοργία είναι σύνολο δωματίων στο Αποστολικό Παλάτι στο Βατικανό, που προσαμόστηκαν για προσωπική χρήση του Πάπα Αλεξάνδρου ΣΤ΄ Βοργία. Στο τέλος του 15ου αι. ανέθεσε τη διακόσμησή τους με τοιχογραφίες στον Ιταλό ζωγράφο Πιντουρίκκιο και στο εργαστήριό του.\\nΟι νωπογραφίες, που εκτελέστηκαν το διάστημα 1492-94, έχουν πολύπλοκη θεματολογία: εμπνέονται από μεσαιωνικές εγκυκλοπαίδειες, προσθέτουν εσχατολογικές αναφορές και θριαμβολογούν στην υποτιθέμενη θεϊκή καταγωγή των Βοργία. Πρόσφατη συντήρηση της τοιχογραφίας Η Ανάσταση αποκάλυψε μία σκηνή, που ζωγραφίστηκε δύο μόλις έτη μετά την επιστροφή του Χρ. Κολόμβου από τον Νέο Κόσμο και παριστά ιθαγενείς Αμερικανούς· πιστεύεται ότι είναι η πρώτη τους απεικόνιση στην Ευρώπη."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A5%D2%AF%D0%BD%D0%BD%D2%AF_%D1%83%D0%BB%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Hotosho-1.jpg","page_title":"Хүннү улс","context_page_description":"Хүннү гүрэн нь МЭӨ 209? – МЭ 93 онд оршиж байсан Өвөг Монголчуудын улс юм."},{"page_url":"https://en.wikipedia.org/wiki/Astrobrachion_adhaerens","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Astrobrachion_adhaerens_-_Catalogue_of_recent_ophiurans_%28Plate_1%29_BHL32500486_%28cropped%29.jpg","page_title":"Astrobrachion adhaerens","context_page_description":"Astrobrachion adhaerens is a basket star in the Euryalidae family. Along with Astrobrachion constrictum, it is one of only two species in the genus Astrobrachion. Both species live in association with black corals in moderately deep water. It is endemic to the west, north and east coasts of Australia, the Kermadec Islands and Lord Howe Island."},{"page_url":"https://tr.wikipedia.org/wiki/Assisi_nak%C4%B1%C5%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Butterfly_in_modern_Assisi_work.jpg","page_title":"Assisi nakış","context_page_description":"Assisi nakış, antik İtalyan geleneğine dayalı sayılı iplik nakışının bir formu olup, ana motifler boş bırakılarak arka planın nakış dikişiyle doldurularak ana temanın ortaya çıkarılması yöntemidir. Bu isim İtalya'nın Assisi kasabasından türemektedir."},{"page_url":"https://vi.wikipedia.org/wiki/Vi%C3%B6l","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Vioel_Wappen.png","page_title":"Viöl","context_page_description":"Viöl là một đô thị thuộc huyện Nordfriesland, bang Schleswig-Holstein, Đức."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%83%BC%E3%83%95%E3%83%86%E3%83%B3_(%E6%88%A6%E8%BB%8A)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Bovington_154_Conqueror_1.jpg","page_title":"チーフテン (戦車)","context_page_description":"チーフテン は、イギリスで開発された第二次世界大戦後第2世代の主力戦車。\\n「チーフテン」は「族長」もしくは「酋長」の意味で、イギリスで「Chieftain」と言った場合、特にスコットランド高地氏族をはじめとする大英帝国隷下の族長や酋長を指す。"},{"page_url":"https://nl.wikipedia.org/wiki/2e_congresdistrict_van_Arkansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Arkansas-second-congressional-district.svg","page_title":"2e congresdistrict van Arkansas","context_page_description":"Het 2e congresdistrict van Arkansas is een kiesdistrict voor het Amerikaanse Huis van Afgevaardigden. Het district ligt in het centrum van de staat en bevat de hoofdstad Little Rock. Momenteel is Republikein French Hill de afgevaardigde voor het district."},{"page_url":"https://fr.wikipedia.org/wiki/Paul_Naschy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Paul_Naschy_as_Alaric_de_Marnac.jpg","page_title":"Paul Naschy","context_page_description":"Paul Naschy, de son vrai nom Jacinto Molina, est un acteur, réalisateur et scénariste espagnol spécialisé dans le film d'horreur, né le 6 septembre 1934 à Madrid et mort le 30 novembre 2009 dans la même ville."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D1%85%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Daniel_Schultz_the_Younger_-_Family_Portrait_-_WGA21066.jpg","page_title":"Крымское ханство","context_page_description":"Кры́мское ха́нство, самоназвание — Улуг Орда ве Дешт-и Кипчак, в европейской географии и историографии Нового времени — Малая Татария — государство в Крыму, Северном Причерноморье и на прилегающих территориях, возникшее на территории Крымского улуса в результате распада Золотой Орды и просуществовавшее с 1441 по 1783 годы. Государство было основано в 1441 году ханом чингизидом Хаджи Гераем и рассматривалось своими ханами как прямой наследник Золотой Орды и Дешт-и-Кипчака.\\nПомимо степной и предгорной части собственно Крыма занимало земли между Дунаем и Днепром, Приазовье и большую часть современного Краснодарского края России. Основную часть населения составляли крымские татары, наря­ду с ни­ми про­жи­ва­ли зна­чительные об­щи­ны ка­раи­мов, италь­ян­цев, ар­мян, гре­ков и других. В начале XVI века под власть крым­ских ха­нов пе­ре­шла часть но­га­ев, ко­то­рые ко­че­ва­ли за пре­де­ла­ми Крым­ско­го полуострова, пе­ре­се­ля­ясь ту­да в пе­рио­ды за­сух и бес­кор­ми­цы. Ханство являлось вассалом Османской империи. В 1783 году Российская империя завоёвывает территорию Крымского ханства и годом позднее образует в крымской части занятых территорий Таврическую область."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Kirchdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Inzersdorf_im_Kremstal_im_Bezirk_KI.png","page_title":"Bezirk Kirchdorf","context_page_description":"Der Bezirk Kirchdorf ist ein politischer Bezirk des Landes Oberösterreich.\\nEr liegt südlich von Wels und grenzt im Uhrzeigersinn von Norden aus an die oberösterreichischen Bezirke Wels-Land, Linz-Land und Steyr-Land, an den steirischen Bezirk Liezen sowie an den oberösterreichischen Bezirk Gmunden."},{"page_url":"https://pt.wikipedia.org/wiki/Padre_Pio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Pietrelcina_-_Centro_Storico_-_Veduta_del_%22Morgione%22.jpg","page_title":"Padre Pio","context_page_description":"Padre Pio de Pietrelcina, nascido Francesco Forgione, OFM Cap foi um frade e sacerdote católico italiano, da Ordem dos Frades Menores Capuchinhos, elevado a santo pela Igreja Católica como São Pio de Pietrelcina.\\nFoi, ainda em vida, alvo de uma veneração popular de grandes proporções, principalmente em razão de muitos carismas e dons espirituais que lhe são atribuídos: o dom da bilocação, o dom da levitação, das curas milagrosas, dos perfumes que exalava, entre outros."},{"page_url":"https://en.wikipedia.org/wiki/List_of_rifles","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Winchester_M1895.jpg","page_title":"List of rifles","context_page_description":"A rifle is a firearm designed to be fired from the shoulder, with a barrel that has a helical groove or pattern of grooves cut into the barrel walls. The raised areas of the rifling are called \\"lands,\\" which make contact with the projectile, imparting spin around an axis corresponding to the orientation of the weapon.\\nThere are various types of rifles, most notably the Automatic rifle, the Bolt action rifle, the Lever-action rifle and the Semi-automatic rifle."},{"page_url":"https://hr.wikipedia.org/wiki/Zmaj","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Stockholm-Gamla_Stan-6.jpg","page_title":"Zmaj","context_page_description":"Zmaj je u mnogim svjetskim mitologijama čudovište nalik golemoj zmiji ili kakvom drugom gmazu, s magičnim osobinama. Mitološka stvorenja koja posjeduju slične osobine vrlo se često pojavljuju u različitim svjetskim kulturama."},{"page_url":"https://es.wikipedia.org/wiki/Khndzoresk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Knzoresk_gyuxatexi_2015_aug_pic_23.JPG","page_title":"Khndzoresk","context_page_description":"Khndzoresk o Kndzoresk, es una comunidad rural en el sudeste de Armenia, en la provincia de Syunik. El pueblo está localizado a la derecha de la carretera que sale de Goris hacia Stepanakert, a unos 16 km de Goris, en las empinadas vertientes de Khor Dzor. Cruzando el puente en la entrada del pueblo, la carretera continúa hacia las ciudades de Lachin y Stepanakert. El área habitada actual, Nuevo Khndzoresk, se construyó en los años 1950. El pueblo está localizado a 1.580 m de altitud y ocupa 6.772,8 ha. Según el ARMSTAT, la oficina del censo de Armenia, en 2011, la población era de 2.260 hab.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AB%98%E7%BA%A7%E8%BD%AF%E5%8D%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/China_Railway_RW19T_passenger_coaches_20100725_365.jpg","page_title":"高级软卧","context_page_description":"高级软卧又称高包软卧、高包，是中华人民共和国铁路客运中次高等级的卧铺席别。不同车型的高级软卧设施略有不同。每节车厢分为八至十余个包厢，包厢内设有两个或四个铺位，以及沙发、衣柜，部分具有独立卫生间等设施。K3/4次国际联运快速列车的高级软卧为上下铺双人布置，带沙发一个，衣柜一个，两个软卧包厢共用一个卫生间。高级软卧车厢有RW18、RW19T、RW19K等型号，部分卧铺动车组也设置高级软卧车厢。\\n高级软卧车内设施优于其他席别，票价也较贵。仅有少部分列车设有此席别，国际联运列车的国内回转车并不发售高级软卧，仅有部分较远国际区段发售本席别。"},{"page_url":"https://de.wikipedia.org/wiki/Portr%C3%A4t_Heinrichs_VIII.","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Henry_VIII_Belvoir_Castle.jpg","page_title":"Porträt Heinrichs VIII.","context_page_description":"Das Porträt Heinrichs VIII. nach Hans Holbein ist eines der berühmtesten Bilder eines britischen Monarchen und das bekannteste Porträt Heinrichs VIII. Das originale Wandbild zeigte außer dem König auch seine Frau Jane Seymour und seine Eltern. Dieses Wandbild ist 1698 bei einem Brand des Palace of Whitehall zerstört worden. Überliefert wurde es in einer Kopie aus dem Jahr 1667. Nach dem Porträt Heinrichs auf dem Familienbild sind schon zu seinen Lebzeiten eine Reihe von Fassungen entstanden, die in europäischen und amerikanischen Sammlungen aufbewahrt werden."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E5%B7%B418P%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/6030_at_Belcher_Bay_%2820181103154549%29.jpg","page_title":"新巴18P線","context_page_description":"新巴18P線是新巴18線的全日特快班次，來往堅尼地城及北角，途經林士街天橋，來回程不經上環。此外，亦可選乘更快速的路線18X。"},{"page_url":"https://en.wikipedia.org/wiki/Zinc_iodide","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/ZnI2structure.jpg","page_title":"Zinc iodide","context_page_description":"Zinc iodide is a chemical compound of zinc and iodine, ZnI₂. The anhydrous form is white and readily absorbs water from the atmosphere. It can be prepared by the direct reaction of zinc and iodine in refluxing ether. or by reacting zinc with iodine in aqueous solution:\\nZn + I₂→ ZnI₂\\nAt 1150 °C, zinc iodide vapour dissociates into zinc and iodine.\\nIn aqueous solution the following have been detected, octahedral Zn(H₂O)₆²⁺, [ZnI(H₂O)₅]⁺ and tetrahedral ZnI₂(H₂O)₂, ZnI₃⁻ and ZnI₄²⁻.\\nThe structure of crystalline ZnI₂ is unusual, and while zinc atoms are tetrahedrally coordinated, as in ZnCl₂, groups of four of these tetrahedra share three vertices to form “super-tetrahedra” of composition {Zn₄I₁₀}, which are linked by their vertices to form a three-dimensional structure. These \\"super-tetrahedra\\" are similar to the P₄O₁₀ structure.\\nMolecular ZnI₂ is linear as predicted by VSEPR theory with a Zn-I bond length of 238 pm."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_Lu%C4%8Denci","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Park_-_Jegorova_ul._3_-_Opatov%C3%A1.jpg","page_title":"Zoznam kultúrnych pamiatok v Lučenci","context_page_description":"Toto je zoznam kultúrnych pamiatok v meste Lučenec v okrese Lučenec.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D1%8C-%D0%B4%D0%B5-%D0%A1%D0%B0%D0%BD-%D0%9B%D0%BE%D1%80%D0%B5%D0%BD%D1%81%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Val_de_San_Lorenzo.JPG","page_title":"Валь-де-Сан-Лоренсо","context_page_description":"Валь-де-Сан-Лоренсо — муниципалитет в Испании, входит в провинцию Леон, в составе автономного сообщества Кастилия и Леон. Занимает площадь 49,79 км². Население — 584 человека."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D5%BA%D5%A4%D5%A5%D5%BA%D5%A5%D6%80%D5%A1_(%D5%A1%D5%B4%D6%80%D5%B8%D6%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Castell_de_Capdepera_3637.png","page_title":"Կապդեպերա (ամրոց)","context_page_description":"Կապդեպերա, ամրոց Իսպանիայի Մալյորկա կղզում՝ Կապդեպերա համայնքում: Կառուցվել է 14-րդ դարում: Տեղակայված է կղզու հյուսիս-արևելքում գտնվող լեռան վրա՝ Մալյորկան ու Մենորկան բաժանող նեղուցի ափից 2,5 կմ հեռավորության վրա:"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BE%B7%E5%9B%BD%E9%93%81%E8%B7%AF481%E5%9E%8B%E7%94%B5%E5%8A%9B%E5%8A%A8%E8%BD%A6%E7%BB%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/S-Bahn_Berlin_getrennter_Zug_Bw_Sch%C3%B6neweide.JPG","page_title":"德国铁路481型电力动车组","context_page_description":"德國鐵路481型電力動車組是柏林城鐵的一款電力動車組車型。\\n這款車型目前是柏林城鐵最新的一款車型，也是最常見的一款車型。在1990年開始，柏林柏林公共運輸公司和德國國營鐵路一道，就發展一款新的電力動車組展開了討論。1993年時發表了一款模型並公開亮相。"},{"page_url":"https://de.wikipedia.org/wiki/Evolutionsmuseum_Warschau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Deinocheirus_Warsaw.jpg","page_title":"Evolutionsmuseum Warschau","context_page_description":"Das Evolutionsmuseum des Instituts für Paläobiologie der Polnischen Akademie der Wissenschaften ist ein naturhistorisches Museum in Warschau. Es befindet sich im Kulturpalast Warschaus im Stadtbezirk Śródmieście."},{"page_url":"https://hu.wikipedia.org/wiki/SB2U_Vindicator","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/USS_Wasp_%28CV-7%29_in_San_Diego_Harbor%2C_1942.jpg","page_title":"SB2U Vindicator","context_page_description":"Az SB2U Vindicator amerikai repülőgép-hordozón üzemeltethető zuhanóbombázó volt az 1930-as években, melyet a Vought fejlesztett ki és gyártott. A repülőgép a U.S. Navy számára kifejlesztett első egyfedelű zuhanóbombázó volt, a második világháború kitörésekor már elavult, a midwayi csatában megfelelő számú korszerű gép hiányában még szolgálatban volt, de 1943 folyamán az összes megmaradt gépet a pilótaképzésre irányították át, helyüket az SBD Dauntless-ek vették át egy időre. A Brit Királyi Haditengerészetnél neve Chesapeake volt."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_avtobusov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Heuliez_GX_427_2011_-_RNTP_3.JPG","page_title":"Seznam avtobusov","context_page_description":"Seznam avtobusov:"},{"page_url":"https://en.wikipedia.org/wiki/Premchand","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Munshi_Premchand_half_bust_statue.jpg","page_title":"Premchand","context_page_description":"Dhanpat Rai Shrivastava 31 July 1880 - 8 October 1936, better known by his pen name Munshi Premchand, was an Indian writer famous for his modern Hindustani literature. He is one of the most celebrated writers of the Indian subcontinent, and is regarded as one of the foremost Hindi writers of the early twentieth century. His novels include Godaan, Karmabhoomi, Gaban, Mansarovar, Idgah. He published his first collection of five short stories in 1907 in a book called Soz-e Watan.\\nHe began writing under the pen name \\"Nawab Rai\\", but subsequently switched to \\"Premchand\\", Munshi being an honorary prefix. A novel writer, story writer and dramatist, he has been referred to as the \\"Upanyas Samrat\\" (\\"Emperor among Novelists\\") by writers. His works include more than a dozen novels, around 300 short stories, several essays and translations of a number of foreign literary works into Hindi."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%90%D7%A9_%D7%9E%D7%9E%D7%A9%D7%9C%D7%AA_%D7%9E%D7%9C%D7%98%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Malta_-_Floriana_-_Triq_Sarria_-_The_Mall_31_ies.jpg","page_title":"ראש ממשלת מלטה","context_page_description":"ראש ממשלת מלטה הוא התפקיד הביצועי הבכיר ביותר בפוליטיקה של מלטה."},{"page_url":"https://eu.wikipedia.org/wiki/Sardinella_gibbosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Sardinella_gibbosa.jpg","page_title":"Sardinella gibbosa","context_page_description":"Sardinella gibbosa Sardinella generoko animalia da. Arrainen barruko Clupeidae familian sailkatzen da."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Penguasa_Anjou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Phil6france.jpg","page_title":"Daftar Penguasa Anjou","context_page_description":"Gelar Comte Anjou pertama kali diberikan pada abad kesembilan kepada Ingelger, seorang viscount yang memegang kekuasaan di wilayah sekitar Orléans dan Angers. Keturunannya, yang termasuk beberapa Raja Inggris, terus memegang gelar-gelar dan properti tersebut sampai penguasa Prancis mendapatkan kendali atas wilayah itu. Setelah itu gelar-gelar Comte Anjou dan, setelah tahun 1360, Adipati Anjou diberikan beberapa kali, biasanya untuk anggota-anggota wangsa pemimpin Prancis yang memerintah Valois dan Bourbon.\\nGelar tersebut dipegang oleh Philippe, cucu laki-laki Raja Louis XIV, sampai ia naik tahta Spanyol sebagai Philippe V dari Spanyol. Sejak itu, beberapa pewaris sah Spanyol atas tahta Prancis memiliki gelar tersebut bahkan sampai sekarang, begitu juga kerabat pejuang Orléan."},{"page_url":"https://sv.wikipedia.org/wiki/J%C3%A4rntorget,_G%C3%B6teborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Wilson_%26_Co.jpg","page_title":"Järntorget, Göteborg","context_page_description":"Järntorget, eller Jerntorget fram till åtminstone år 1900, är ett torg i stadsdelarna Haga och Masthugget i centrala Göteborg. Det är ett av stadens viktigaste torg och en knutpunkt för kollektivtrafiken i västra delen av staden. Vid torget finns bland annat Folkets hus och flera tidigare redaktionshus för tidningar. Idag är Järntorget även en livlig del av nöjeslivet i Göteborg, i direkt anslutning till butiksgator i Haga och Masthugget. Järntorget fick sitt namn 1867 efter Nya Järnvågen, då en del av verksamheten i den närbelägna Göteborgs hamn. Fram till omkring 1902, kallades torget även Masthuggstullen, Möbeltorget och Trätorget samt Bierhalleplatsen. Fram till 1923 låg torget i stadens Elfte Rote i Masthugget."},{"page_url":"https://en.wikipedia.org/wiki/Phoxinus_apollonicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Phoxinus_apollonicus.jpeg","page_title":"Phoxinus apollonicus","context_page_description":"Phoxinus apollonicus is a species of small cyprinid fish from Montenegro and Albania."},{"page_url":"https://fr.wikipedia.org/wiki/Gen%C3%AAts","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Gen%C3%AAts_%2850%29_Henri_M%C3%A9nardais.jpg","page_title":"Genêts","context_page_description":"Genêts est une commune française, située dans le département de la Manche en région Normandie, peuplée de 435 habitants."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B3_%D0%A8%D0%B5%D1%80%D0%B8%D0%B4%D0%B0%D0%BD_(%D0%9D%D0%B5%D0%B1%D1%80%D0%B0%D1%81%D0%BA%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Map_of_Nebraska_highlighting_Sheridan_County.svg","page_title":"Округ Шеридан (Небраска)","context_page_description":"Округ Шеридан је округ у америчкој савезној држави Небраска."},{"page_url":"https://fr.wikipedia.org/wiki/Polyn%C3%A9sie_fran%C3%A7aise","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mangue_Tahiti.jpg","page_title":"Polynésie française","context_page_description":"La Polynésie française est une collectivité d'outre-mer de la République française composée de cinq archipels regroupant 118 îles dont 76 habitées : l'archipel de la Société avec les îles du Vent et les îles Sous-le-Vent, l'archipel des Tuamotu, l'archipel des Gambier, l'archipel des Australes et les îles Marquises. Elle est située dans le sud de l'océan Pacifique, à environ 6 000 kilomètres à l’est de l’Australie. Elle inclut aussi les vastes espaces maritimes adjacents. La Polynésie française est un territoire non autonome relevant de l’article 73 de la Charte des Nations unies.\\nLes premiers habitants de ces îles, des Austronésiens, proviennent selon toute vraisemblance de migrations en provenance d'Asie du Sud-Est vers l'an 300 ou peu avant. La rencontre avec les navigateurs européens entraîne à la fin du XVIIIᵉ siècle des épidémies qui déciment les populations autochtones. Les campagnes d'évangélisation et l'introduction de l'alcool achèvent la destruction des savoirs de chaque île. La France impose progressivement son protectorat, à compter de 1842, contrant ainsi l'influence britannique."},{"page_url":"https://en.wikipedia.org/wiki/Koya_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/University_of_Koya.JPG","page_title":"Koya University","context_page_description":"Koya University is located in Koy Sanjaq, near Erbil, capital of the Erbil Governorate in the Iraqi Kurdistan region of Iraq. It was established in 2003."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BD%97%E7%84%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Olga_Lomov%C3%A1_%282017%29.jpg","page_title":"罗然","context_page_description":"奥尔加·洛莫娃，又译奥尔佳·罗莫娃，中文名罗然，是捷克汉学家，翻译家。曾任布拉格查理大学东方研究所所长，中文系系主任。\\n她长期致力于中国文学的翻译与研究。主要研究中国文学史、中国现代文学与文化观、史记研究等，著有《风景的信息：王维诗歌对自然的呈现》、《唐诗读本》和《中国文学史导论》等著作，并将《史记》以及《美食家》等现当代小说翻译为捷克文。"},{"page_url":"https://en.wikipedia.org/wiki/Cystic_fibrosis_transmembrane_conductance_regulator","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Protein_CFTR_PDB_1xmi.png","page_title":"Cystic fibrosis transmembrane conductance regulator","context_page_description":"Cystic fibrosis transmembrane conductance regulator is a membrane protein and chloride channel in vertebrates that is encoded by the CFTR gene.\\nThe CFTR gene codes for an ABC transporter-class ion channel protein that conducts chloride ions across epithelial cell membranes. Mutations of the CFTR gene affecting chloride ion channel function lead to dysregulation of epithelial fluid transport in the lung, pancreas and other organs, resulting in cystic fibrosis. Complications include thickened mucus in the lungs with frequent respiratory infections, and pancreatic insufficiency giving rise to malnutrition and diabetes. These conditions lead to chronic disability and reduced life expectancy. In male patients, the progressive obstruction and destruction of the developing vas deferens and epididymis appear to result from abnormal intraluminal secretions, causing congenital absence of the vas deferens and male infertility."},{"page_url":"https://pl.wikipedia.org/wiki/Halina_Skibniewska","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Halina_Skibniewska.jpg","page_title":"Halina Skibniewska","context_page_description":"Halina Skibniewska z domu Erentz – polska architekt i urbanistka, profesor doktor inżynier architektury, działaczka państwowa, posłanka na Sejm PRL IV, V, VI, VII i VIII kadencji, w latach 1971–1985 wicemarszałek Sejmu V, VI, VII i VIII kadencji.\\nŻona architekta i posła na Sejm PRL I kadencji Zygmunta Skibniewskiego."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_San_Esteban_(Murcia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Iglesia_de_san_esteban_.jpg","page_title":"Palacio de San Esteban (Murcia)","context_page_description":"El Palacio de San Esteban es la sede de la Presidencia de la Región de Murcia y del Consejo de Gobierno de esta comunidad autónoma, situado en el antiguo Colegio de San Esteban de la ciudad de Murcia, conjunto monumental edificado por los Jesuítas en el siglo XVI, declarado Monumento Nacional en 1931.​\\nSe encuentra en el centro de la capital, entre la calle de Acisclo Díaz y el jardín de San Esteban."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_D%C3%A2ng%C4%83u_Mic","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/RO_CJ_Dangau_Mic_2011.11.jpg","page_title":"Biserica de lemn din Dângău Mic","context_page_description":"Biserica de lemn din Dângău Mic, comuna Căpușu Mare, județul Cluj, datează din secolul XVIII. Are hramul „Pogorârea Sfântului Duh”. Biserica se află pe noua listă a monumentelor istorice sub codul cod LMI CJ-II-m-B-07592."},{"page_url":"https://pl.wikipedia.org/wiki/Roberto_Dinamite","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Roberto_Dinamite.jpg","page_title":"Roberto Dinamite","context_page_description":"Carlos Roberto de Oliveira – brazylijski piłkarz noszący przydomek Roberto Dinamite. W czerwcu 2007 roku wystąpił gościnnie w towarzyskim meczu jubileuszowym Sonny’ego Andersona."},{"page_url":"https://sv.wikipedia.org/wiki/Cheirodendron_trigynum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Starr_020925-0085_Cheirodendron_trigynum.jpg","page_title":"Cheirodendron trigynum","context_page_description":"Cheirodendron trigynum är en araliaväxtart som först beskrevs av Charles Gaudichaud-Beaupré, och fick sitt nu gällande namn av Amos Arthur Heller. Cheirodendron trigynum ingår i släktet Cheirodendron och familjen Araliaceae."},{"page_url":"https://sk.wikipedia.org/wiki/M26_Pershing","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Tanks_at_the_USS_Alabama_-_Mobile%2C_AL_-_001.jpg","page_title":"M26 Pershing","context_page_description":"M26 Pershing bol americký tank nasadený na konci druhej svetovej vojny a neskôr v kórejskej vojne. Pomenovaný na počesť gen. Johna J. Pershinga, ktorý viedol americký expedičný zbor v 1. svetovej vojne. Ako jediný západný tank prekonal všetky parametre nemeckých tankov Panther a Tiger."},{"page_url":"https://pl.wikipedia.org/wiki/Arnaud_Nouvel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Arnaud_Novel.jpg","page_title":"Arnaud Nouvel","context_page_description":"Arnaud Nouvel – francuski kardynał, wuj papieża Benedykta XII."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Granzin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Granzin_Kriegerdenkmal_1914-18.jpg","page_title":"Liste der Baudenkmale in Granzin","context_page_description":"In der Liste der Baudenkmale in Granzin sind alle Baudenkmale der Gemeinde Granzin und ihrer Ortsteile aufgelistet."},{"page_url":"https://mg.wikipedia.org/wiki/Richard_Oetzel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Richard_Oetzel_Wahlplakat.jpg","page_title":"Richard Oetzel","context_page_description":"Richard Oetzel dia injeniera, mpiantoka, mpanao politika mizaka ny zom-pirenen'i Alemaina teraka ny 12 Jolay 1901 ary maty ny 9 Martsa 1985 tao Witten"},{"page_url":"https://en.wikipedia.org/wiki/Joachim_Pissarro","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/West_Building_Hunter_College_CUNY.jpg","page_title":"Joachim Pissarro","context_page_description":"Joachim Pissarro is an art historian, theoretician, curator, educator, and director of the Hunter College Galleries and Bershad Professor of Art History at Hunter College of the City University of New York. Since 2002, Pissarro has served as the Editorial Director of Wildenstein Publications. His latest book, authored with art critic David Carrier, is called Wild Art. Pissarro was curator at the Museum of Modern Art's Department of Painting and Sculpture from 2003 to 2007."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Salamanca","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Salamanca_-_Estacion_05.JPG","page_title":"Estación de Salamanca","context_page_description":"Salamanca es una estación ferroviaria española situada en la ciudad homónima, en la comunidad autónoma de Castilla y León. Constituye la principal estación ferroviaria de la provincia de Salamanca. Forma parte de la red de Adif.\\nDispone de servicios de viajeros de Media y Larga Distancia. También cumple funciones logísticas.​\\nHistóricamente, la capital charra ha constituido un importante nudo ferroviario donde confluían varias líneas férreas: Medina del Campo-Salamanca, Salamanca-Portugal, Ávila-Salamanca y Plasencia-Astorga. Debido a ello, la estación de Salamanca dispuso de importantes instalaciones ferroviarias, así como de un intenso tráfico de pasajeros y mercancías."},{"page_url":"https://no.wikipedia.org/wiki/Bladteger","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Miridae_fg08.jpg","page_title":"Bladteger","context_page_description":"Bladteger tilhører tegene, en gruppe av nebbmunner.\\nDet er i Norge funnet omtrent 150 arter av bladteger."},{"page_url":"https://nl.wikipedia.org/wiki/Aspasia_Annia_Regilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Tomb_of_Annia_regilla2.JPG","page_title":"Aspasia Annia Regilla","context_page_description":"Aspasia Annia Regilla, volledige naam Appia Annia Regilla Atilia Caucidia Tertulla, was een rijke aristocratische, Romeinse vrouw die gehuwd was met Herodes Atticus."},{"page_url":"https://es.wikipedia.org/wiki/Jibacoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Bi-plantas_%28two_storey_buildings%29_in_Jibacoa%2C_Manicaragua%2C_Cuba.jpg","page_title":"Jibacoa","context_page_description":"Jibacoa es un pueblo que se encuentra en el municipio de Manicaragua, provincia de Villa Clara, Cuba. Específicamente enclavado en las montañas del Escambray. Fue fundado durante la Revolución Cubana en 1961, aunque su historia se remonta a inicios del siglo XX.\\nEn su \\"Diccionarion Cubano, Etimológico, Razonado y Comprensivo\\";​ José Miguel Macías describe que Jiba es nombre Taino dado a las plantas del género erythroxylum, \\"arbustos silvestres que abundan a orillas de rios, lagunas y tierras anegadizas... la semilla la comen el sinsonte, cao, cotorra, torcaz, zorzal real y aves domésticas\\" y Coa es punta, término, esquina final, por ejemplo en la lanza de palo con punta endurecida para labrar la tierra. Así pues Jibacoa se cree significa \\"Muerte de la Jiba\\" o más comprensivamente \\"El lugar donde terminan/se acaban/o tienen sus puntas las plantas de Jibas\\".\\nSu actividad económica fundamental es el Café.\\nEl Plan turquino Manatí al cual pertenece Jibacoa, cuenta con una extensión territorial de 309 km² y una población de 9505 habitantes, del cual el 88,7% es rural, la urbana se localiza en el poblado de Jibacoa."},{"page_url":"https://pt.wikipedia.org/wiki/Igreja_de_S%C3%A3o_Pedro_de_Rates","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Igreja_Romanica_portal.JPG","page_title":"Igreja de São Pedro de Rates","context_page_description":"A Igreja de São Pedro de Rates, também referida como Igreja Românica de Rates, localiza-se em São Pedro de Rates, concelho da Póvoa de Varzim, distrito do Porto, em Portugal. Constitui um dos mais importantes monumentos românicos medievais no então emergente reino de Portugal, dada a relevância das formas arquitectónicas e escultóricas.\\nSituada junto à bacia do rio Ave, é um dos mais importantes mosteiros beneditinos clunicenses e está ligado à lenda de São Pedro de Rates, mítico primeiro bispo de Braga, \\"primaz das Espanhas\\", hipótese que remonta essencialmente ao século XVI."},{"page_url":"https://en.wikipedia.org/wiki/Nicolai_Abildgaard","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Nicolai_Abildgaard_-_Klismos_chair.jpg","page_title":"Nicolai Abildgaard","context_page_description":"Nicolai Abraham Abildgaard was a Danish neoclassical and royal history painter, sculptor, architect, and professor of painting, mythology, and anatomy at the New Royal Danish Academy of Art in Copenhagen, Denmark. Many of his works were in the royal Christiansborg Palace, Fredensborg Palace, and Levetzau Palace at Amalienborg."},{"page_url":"https://de.wikipedia.org/wiki/Elztal_(Odenwald)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Wappen_von_Elztal-Rittersbach.png","page_title":"Elztal (Odenwald)","context_page_description":"Elztal ist eine Gemeinde im Neckar-Odenwald-Kreis in Baden-Württemberg, die 1973 durch die Vereinigung der Orte Auerbach, Dallau, Muckental und Neckarburken entstand und in die 1975 auch der Ort Rittersbach eingemeindet wurde. Sie gehört zur europäischen Metropolregion Rhein-Neckar."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%83%E8%91%89%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Chiba_map_circa_1930.PNG","page_title":"千葉公園","context_page_description":"千葉公園は、千葉県千葉市中央区にある都市公園である。名所として千葉市の「市の花」である大賀ハスの鑑賞地となっている。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%85%95%E5%B0%BC%E9%BB%91%E5%B7%A5%E4%B8%9A%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/050322-tumuenchen-parabeln.jpg","page_title":"慕尼黑工业大学","context_page_description":"慕尼黑工业大学，校园坐落于德国南部巴伐利亚州首府慕尼黑，是德国的一所著名大学，亦是是德国最古老的工业大学 之一，属TU9成员，于2006年10月被选为德国首批三所精英大学之一。德国科研联合会 在2006年、2012年和2019年连续三度授予慕尼黑工业大学“精英大学”的称号，是德国政府“未来计划”中重点资助和扶植的对象。截止2017年，共有19位校友及教职工曾获得诺贝尔奖。"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B7%B9%E7%8B%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Choensai_eishin_falconer.jpg","page_title":"鷹狩","context_page_description":"鷹狩は、飼いならした鷹を山野に放って行う狩猟の一種。鷹狩でいう「鷹」とは猛禽類の総称のことである。タカ科のイヌワシ、オオタカ、ハイタカ、およびハヤブサ科のハヤブサ等を訓練し、鳥類や哺乳類を捕らえさせ、餌とすりかえる。鷹野、放鷹とも言う。\\nこうして鷹を扱う人間は、鷹匠と呼ばれる。日本語の古語においては鳥狩、鷹田、放鷹、鷹野などとも称する。また、鷹を訓練する場所は鷹場と称される。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%B3%D0%B5%D1%80,_%D0%94%D0%B6%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Berlinger_ITD_Promise_Shoot.jpg","page_title":"Берлингер, Джо","context_page_description":"Джо Берлингер — американский режиссер и продюсер, фильмы и сериалы которого сфокусированы на реальных преступлениях. Его творчество привлекает внимание к вопросам социальной справедливости в США и других странах в таких фильмах, как: «Потерянный рай», «Нефть», «Уайти: США против Джеймса Дж. Балджера» и «Намерение уничтожить». В статье интернет-издания «HuffPost» от 2017 года говорится, что «Хранитель брата» и трилогия «Потерянный рай» помогли создать стиль документального кинопроизводства в недавней настоящей сенсационной работе «Netflix» — «Making a Murderer», в которой имеется сочетание искусной кинематографии, вызывающий волнение музыкальный саундтрек и драматическая структура повествования, столь же убедительная, как и любой сценарий фильма.\\nДжо Берлингер руководил двумя проектами в 2019 году, посвященными всемирно известному серийному убийце Теду Банди: «Беседы с убийцей: Записи Теда Банди», показанным в онлайн-кинотеатре «Netflix» и драматический фильм «Красивый, плохой, злой», в котором в главной роли снялся Зак Эфрон."},{"page_url":"https://it.wikipedia.org/wiki/Protocollo_di_Needham-Schroeder","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Symetric_Needham-Schroeder-Protocol_%E2%80%93_linear.svg","page_title":"Protocollo di Needham-Schroeder","context_page_description":"Con il termine generico di protocollo di Needham-Schroeder si possono identificare due protocolli di comunicazione progettati per permettere comunicazioni cifrate su reti non sicure.\\nI protocolli furono proposti da Roger Needham e Michael Schroeder nel 1978.\\nIl protocollo di Needham-Schroeder a chiave segreta è basato sulla crittografia simmetrica ed è alla base del protocollo Kerberos. Il protocollo permette di stabilire una chiave di sessione utilizzabile da due entità di rete per proteggere le successive comunicazioni.\\nIl protocollo di Needham-Schroeder a chiave pubblica è invece basato sulla crittografia asimmetrica e permette di assicurare la mutua autenticazione tra due entità di rete. Nella sua forma proposta non è sicuro."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A3%E3%83%BC%E3%83%B4%E3%82%A3%E3%82%B9_(J%E7%B4%9A%E9%A7%86%E9%80%90%E8%89%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/The_Royal_Navy_during_the_Second_World_War_A8313.jpg","page_title":"ジャーヴィス (J級駆逐艦)","context_page_description":"ジャーヴィス は、イギリス海軍の駆逐艦。J級。艦名はナポレオン戦争時の海軍大臣、初代セント・ヴィンセント伯爵ジョン・ジャーヴィスにちなむ。\\nジャーヴィスは第二次世界大戦において、軽巡洋艦オライオン及び駆逐艦ヌビアンと共に戦艦ウォースパイトの14個に次ぐ13個の戦闘名誉章 を受章した武勲めでたい艦として知られる。戦争期間中主要な戦いの多くに参加したにもかかわらず、一人も戦死者を出さなかった幸運と活躍から「ラッキー・ジャーヴィス」の渾名で呼ばれた。"},{"page_url":"https://fr.wikipedia.org/wiki/Horloge_Saint-Nicolas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Salle_des_horloges_Saint-Nicolas-_Mus%C3%A9e_de_l%27horlogerie_de_Saint-Nicolas_d%27Aliermont.JPG","page_title":"Horloge Saint-Nicolas","context_page_description":"L’horloge Saint-Nicolas est une horloge de parquet à pendule court fabriquée en Normandie, et plus particulièrement autour de Saint-Nicolas d'Aliermont, village dont elle tire son nom. Elle a été fabriquée de la fin du XVIIᵉ siècle jusqu'en 1914 environ. Un essai de relance de ce type d'horloge a eu lieu dans les années 1975, sans grand succès.\\nLes horloges Saint-Nicolas sont parfois connues sous d'autres appellations : \\"les élégantes\\", les \\"horloges à têtes fleuries\\"."},{"page_url":"https://war.wikipedia.org/wiki/Macquaria_australasica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Macquarie_perch.jpg","page_title":"Macquaria australasica","context_page_description":"An Macquaria australasica in uska species han Actinopterygii nga ginhulagway ni Cuvier hadton 1830. An Macquaria australasica in nahilalakip ha genus nga Macquaria, ngan familia nga Percichthyidae. Ginklasipika han IUCN an species komo kulang hin datos. Waray hini subspecies nga nakalista."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D1%83%D0%BB%D1%8C%D0%BF%D1%82%D1%83%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Gold_monster.jpg","page_title":"Скульптура","context_page_description":"Скульпту́ра — вид изобразительного искусства, произведения которого имеют объёмную форму и выполняются из твёрдых материалов методом высекания, удаления лишнего из начальной массы каменного или иного блока. Лепка из мягких материалов основана на противоположном способе формосложения, поскольку мастер в этом виде искусства прибавляет, наращивает пластичный материал на каркас. Эти способы в теории и методике преподавания искусства принято разделять; в творчестве отдельных художников они существуют обособленно, но другие их совмещают: например лепят модель из глины, гипса или воска, а затем переводят в твердые материалы либо отливают в бронзе или в фарфоре. Поэтому в широком значении скульптура — это искусство создавать из глины, воска, камня, металла, дерева, кости и других материалов изображение человека, животных и других предметов природы в осязательных, телесных формах.\\nХудожник, посвятивший себя искусству скульптуры, называется скульптором или ваятелем. Его главную задачу составляет передача человеческой фигуры в реальном или идеализированном виде, изображения животных играют в скульптуре второстепенную роль, а прочие предметы имеют второстепенное, вспомогательное значение."},{"page_url":"https://ro.wikipedia.org/wiki/Ripoll%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Localitzaci%C3%B3_del_Ripoll%C3%A8s_2.png","page_title":"Ripollès","context_page_description":"Ripollès este o comarcă, din provincia Girona în regiunea Catalonia."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_mosqu%C3%A9es_d%27Allemagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Nuur-ud-Din-Moschee.jpg","page_title":"Liste de mosquées d'Allemagne","context_page_description":"Cet article répertorie les mosquées en Allemagne par land, elle ne se veut pas exhaustive."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%84lvsunda_herrg%C3%A5rd","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Elfsunda_%C3%A4gor_1801.jpg","page_title":"Älvsunda herrgård","context_page_description":"Älvsunda är en herrgård och ett tidigare säteri öster om Edssjön i Eds socken, Upplands-Väsby kommun, Stockholms län."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lighthouses_in_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Port_of_Livorno_Diga_Marzocco_light_01_%40chesi.JPG","page_title":"List of lighthouses in Italy","context_page_description":"The following is a list of active lighthouses in Italy, sorted by region."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Afrikan_suurimmista_metropolialueista","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Hargskyl1.jpg","page_title":"Luettelo Afrikan suurimmista metropolialueista","context_page_description":"Tämä on luettelo Afrikan suurimmista metropolialueista. Luettelossa on myös huomioitu hallinnollisen alueen tiedot."},{"page_url":"https://en.wikipedia.org/wiki/List_of_aircraft_carriers_of_the_United_States_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/USS_America_%28CV-66%29_underway_in_the_Indian_Ocean_on_24_April_1983.jpg","page_title":"List of aircraft carriers of the United States Navy","context_page_description":"Aircraft carriers are warships that act as airbases for carrier-based aircraft. In the United States Navy, these consist of ships commissioned with hull classification symbols CV, CVA, CVB, CVL, CVN. Beginning with the Forrestal-class, all carriers commissioned into service are classified as supercarriers. The United States Navy has also used escort aircraft carriers and airship aircraft carriers. This list does not include various amphibious warfare ships which can operate as carriers.\\nThe first aircraft carrier commissioned into the United States Navy was USS Langley on 20 March 1922. The Langley was a converted Proteus-class collier"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2-90%D0%90%D0%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Engineering_Technologies_-_2012_%281-23%29.jpg","page_title":"Т-90АМ","context_page_description":"Т-90АМ или «Прорыв» — проект модернизации основного танка Т-90А, работа над которой была начата по инициативе Уральского конструкторского бюро транспортного машиностроения в 2004 году, по теме НИОКР «Прорыв-2».\\nВ настоящее время принят на вооружение.\\nВ ноябре 2019 года было заявлено, что Т-90М поступит в вооруженные силы в 2020 году. В апреле 2020 года Западный военный округ получил первую партию модернизированных танков Т-90М «Прорыв».\\nВ октябре 2019 года «Уралвагонзавод» заявил, что модернизированный танк Т-90М «Прорыв» может стать основным боевым танком в ВC России.\\nЭкспортная версия этой модификации танка известна под наименованием Т-90MC."},{"page_url":"https://en.wikipedia.org/wiki/Paratilapia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Paratilapia_polleni.jpg","page_title":"Paratilapia","context_page_description":"Paratilapia is a genus of cichlids generally restricted to Madagascar. These are large, dark cichlids densely covered in light spots. An additional very poorly known species from the Congo River basin in mainland Africa is sometimes also placed in the genus, but this is highly questionable and arguably it is better placed in the \\"wastebasket genus\\" Haplochromis for the time being."},{"page_url":"https://en.wikipedia.org/wiki/Woodwind_quartet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Ensemble_layout_-_woodwind_quartet.png","page_title":"Woodwind quartet","context_page_description":"A woodwind quartet, sometimes casually called wind quartet, is an ensemble of four woodwind instruments, or music written for four instruments. The usual scoring is flute, oboe, clarinet and bassoon.\\nThe instruments in a woodwind quartet usually have different ranges that allow for rich harmonies with high and low tones. Since these four instruments are from different subgroups of the instrument family, wind quartet music has timbral variety from each instrument's resonance.\\nIn addition to its use as a chamber ensemble, the woodwind quartet may function as a concertino group in a concerto grosso. Examples are the Quadruple Concerto for woodwind quartet and orchestra by Jean Françaix, and the Concerto Grosso for woodwind quartet and wind ensemble by Heitor Villa-Lobos. Paul Hindemith added a harp to the woodwind quartet in his Concerto for flute, oboe, clarinet, bassoon, harp, and orchestra."},{"page_url":"https://es.wikipedia.org/wiki/Alistair_Cragg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Alistair_Cragg_Great_South_Run_2011.jpg","page_title":"Alistair Cragg","context_page_description":"Alistair Cragg es un atleta irlandés de origen sudafricano especializado en la prueba de 3000 m, en la que consiguió ser campeón europeo en pista cubierta en 2005.​"},{"page_url":"https://az.wikipedia.org/wiki/%C4%B0qtisad%C3%A7%C4%B1_QVK","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Voleybol_026.jpg","page_title":"İqtisadçı QVK","context_page_description":"\\"İqtisadçı\\" Qadın Voleybol Klubu — Azərbaycanın paytaxtı Bakı şəhərini təmsil edən, 2014-cü ilin oktyabrna qədər fəaliyyət göstərmiş voleybol klubu. Azərbaycanın universitetlərindən olan Azərbaycan Dövlət İqtisad Universitetinin rəsmi komandasıdır. Azərbaycan voleybolunun \\"Rabitə\\", \\"Azərreyl\\", \\"Lokomotiv\\", \\"Azəryol\\"la yanaşı ən güclü 5 komandasından biri hesab olunurdu. Komanda ev oyunlarını 2000 izləyici tutumuna malik Azərbaycan Voleybol Mərkəzində oynayırdı. 2014-cü ilin mart ayından etibarən Kristal Zalında da oyunlarını keçirmişdir."},{"page_url":"https://pl.wikipedia.org/wiki/Purbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/On_dancing_ledge_isle_of_purbeck_dorset.jpg","page_title":"Purbeck","context_page_description":"Purbeck – półwysep w Anglii, w Dorset, w dystrykcie Purbeck."},{"page_url":"https://en.wikipedia.org/wiki/Martin_R%C3%B8nne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Sydpolmedaljen.jpg","page_title":"Martin Rønne","context_page_description":"Martin Richard Rønne was a Norwegian sail maker and polar explorer.\\nRønne was born in Hamar. He took part in Roald Amundsen's expedition to Antarctica in 1910–1912, where he was one of those that remained behind on the Fram while the overwintering group disembarked in the Bay of Whales to prepare for the journey to the South Pole. From 1918 to 1920 he participated in Amundsen's expedition through the Northeast Passage in the Maud, and in 1925 and 1926 he was in Ny-Ålesund, where he helped Amundsen plan his flying boat expedition. He also participated in Richard E. Byrd's first Antarctic expedition from 1928 to 1930.\\nRønne was the father of the polar explorer Finn Ronne, who emigrated to the United States in 1923. Rønne was awarded the South Pole Medal."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_344","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/NGC_0344_DSS.jpg","page_title":"NGC 344","context_page_description":"NGC 344 galaxia espiral bat da, Cetus konstelazioan. Frank Mullerek aurkitu zuen 1886ko urtarrilaren 1an."},{"page_url":"https://ceb.wikipedia.org/wiki/Cs%C3%A1kv%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Csakv%C3%A1r_-_Palace.jpg","page_title":"Csákvár","context_page_description":"Lungsod ang Csákvár sa Ungariya. Nahimutang ni sa lalawigan sa Fejér megye, sa kasadpang bahin sa nasod, 40 km sa kasadpan sa Budapest ang ulohan sa nasod. 143 metros ibabaw sa dagat kahaboga ang nahimutangan sa Csákvár, ug adunay 5,259 ka molupyo.\\nAng yuta palibot sa Csákvár kay patag sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 331 ka metro ug 2.0 km sa kasadpan sa Csákvár. Dunay mga 45 ka tawo kada kilometro kwadrado sa palibot sa Csákvár medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Oroszlány, 15.6 km sa amihanan-kasadpan sa Csákvár. Hapit nalukop sa kaumahan ang palibot sa Csákvár. Sa rehiyon palibot sa Csákvár, mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 23 °C, ug ang kinabugnawan Disyembre, sa -5 °C. Ang kasarangang pag-ulan 870 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 94 milimetro nga ulan, ug ang kinaugahan Abril, sa 47 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Protein_tyrosine_phosphatase","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/1xm2.jpg","page_title":"Protein tyrosine phosphatase","context_page_description":"Protein tyrosine phosphatases are a group of enzymes that remove phosphate groups from phosphorylated tyrosine residues on proteins. Protein tyrosine phosphorylation is a common post-translational modification that can create novel recognition motifs for protein interactions and cellular localization, affect protein stability, and regulate enzyme activity. As a consequence, maintaining an appropriate level of protein tyrosine phosphorylation is essential for many cellular functions. Tyrosine-specific protein phosphatases catalyse the removal of a phosphate group attached to a tyrosine residue, using a cysteinyl-phosphate enzyme intermediate. These enzymes are key regulatory components in signal transduction pathways and cell cycle control, and are important in the control of cell growth, proliferation, differentiation, transformation, and synaptic plasticity."},{"page_url":"https://de.wikipedia.org/wiki/Sternhaus_(Steyr)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Stadtplatz_12_Steyr_DSC_2764w.jpg","page_title":"Sternhaus (Steyr)","context_page_description":"Das Sternhaus am Steyrer Stadtplatz 12 ist ein im Kern mittelalterliches Bürgerhaus mit spätbarocker Fassade."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9B%A8%E3%81%AE%E5%AE%AE%E5%8F%A4%E5%A2%B3%E7%BE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ame2_zenpobu_2010.jpg","page_title":"雨の宮古墳群","context_page_description":"雨の宮古墳群は、能登半島中央部、石川県鹿島郡中能登町にある古墳の集まりをいう。国の史跡に指定されている。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1977","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Anne_chris-1552485808.jpg","page_title":"Lijst van personen geboren in 1977","context_page_description":"Dit is een lijst van personen die geboren zijn in 1977.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://war.wikipedia.org/wiki/Homalomena_lauterbachii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Homalomena_lauterbachii_DPR.png","page_title":"Homalomena lauterbachii","context_page_description":"An Homalomena lauterbachii in uska species han Liliopsida nga ginhulagway ni Adolf Engler. An Homalomena lauterbachii in nahilalakip ha genus nga Homalomena, ngan familia nga Araceae. Waray hini subspecies nga nakalista."},{"page_url":"https://pl.wikipedia.org/wiki/Skrzek","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Skrzek_sznury.jpg","page_title":"Skrzek","context_page_description":"Skrzek – jedna z form składania jaj przez płazy, charakteryzująca się tym, że jaja składane są grupowo, co zapewnia ich ochronę, przede wszystkim przed wysychaniem i wrogami naturalnymi. Formy skrzeku mogą być różne:\\nU płazów ogoniastych są to:\\ngrona,\\nsznury,\\ntorebki jajowe,\\nkłęby;\\nU płazów bezogonowych są to:\\npakiety,\\nkłęby,\\nsznury.\\nSkrzek może stanowić zgrupowanie wszystkich jaj produkowanych przez samicę w danym sezonie rozrodczym lub może zawierać tylko część jaj produkowanych przez samicę. Z reguły obecność skrzeku wskazuje na zapłodnienie zewnętrzne, jednak u części płazów ogoniastych występuje składanie jaj w postaci skrzeku przy zapłodnieniu wewnętrznym.\\nFormy skrzeku płazów polskich:\\npakiety,\\nkłęby,\\nsznury:\\ndługie, cienkie,\\nkrótkie, grube.\\nNależy jeszcze nadmienić, że wyjątkowo żaba wodna tworzy skrzek w postaci sznura, a traszki czasami składają jaja zlepione w krótkie sznurki."},{"page_url":"https://sv.wikipedia.org/wiki/B%C3%A4cken","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Rana_skeleton.png","page_title":"Bäcken","context_page_description":"Bäcken är, i människans skelett, den kraftiga och skålformade benring som bär ryggradens rörliga ryggkotor och vilar mot lårbenen. Bäckenet består hos en fullvuxen människa av fyra ben: Höger och vänster höftben som utgör bäckenets ventrala och laterala delar och korsbenet och svansbenet som utgör bäckenets dorsala del.\\nBäckenet uppdelas av ett vinklat plan som skär genom bäckenets förstärkta \\"midja\\", linea terminalis, i en övre och en undre del:\\nStora bäckenet som utgör de övre och främre delarna ovanför linea terminalis.\\nLilla bäckenet, delarna under och bakom linea terminalis som består av bäckenhålan vars övre öppning kallas bäckeningången eller övre bäckenöppningen och nedre kallas bäckenutgången eller nedre bäckenöppningen."},{"page_url":"https://fr.wikipedia.org/wiki/Consoles_de_jeux_vid%C3%A9o_de_sixi%C3%A8me_g%C3%A9n%C3%A9ration","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Xbox-Console-Set.png","page_title":"Consoles de jeux vidéo de sixième génération","context_page_description":"Dans l'histoire des consoles de jeux vidéo, la sixième génération représente les jeux vidéo sur les consoles de salon et les consoles portables. L'appellation « ère des consoles 128 bits » est trompeuse, la performance des consoles dépendant dorénavant surtout d'autres facteurs : à partir d'un certain nombre de bits, le gain obtenu en allongeant les mots devient en effet mineur. Les principales plates-formes sont la PlayStation 2, la Xbox, la GameCube et la Dreamcast. Cette génération commence en 1998 et s'est terminée en janvier 2013 avec l'arrêt de la distribution de la PlayStation 2."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8_%D0%B7%D0%B0_%D1%81%D0%B8%D0%BB%D0%BD%D0%B0_%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/MIR_2005_DSB.png","page_title":"Демократи за силна България","context_page_description":"Демократи за силна България е националноконсервативна политическа партия в България. Тя е създадена през 2004 г. от група, отделила се от Съюза на демократичните сили.\\nДевизът на партията е „За силна България в Обединена Европа“. Символ на партията е изображението на пламтящ факел, издигнат от дясна ръка на тъмносин фон."},{"page_url":"https://fr.wikipedia.org/wiki/Malus_sylvestris","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Abild.JPG","page_title":"Malus sylvestris","context_page_description":"Le Boquettier, le Pommier sauvage ou Pommier des bois est une espèce d'arbres de la famille des Rosacées, spontanée dans toute l'Europe et parfois cultivé.\\nAutrefois, on pensait qu'il s'agissait de l'ancêtre du pommier domestique, mais on sait maintenant que le génome de celui-ci vient principalement d’une espèce d’Asie centrale, M. sieversii sauf pour quelques cultivars issus d'hybridations entre ces deux espèces comme la Granny Smith."},{"page_url":"https://pl.wikipedia.org/wiki/Hotel_Polski_we_W%C5%82oc%C5%82awku","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/W%C5%82oc%C5%82awek-Rozbicki_Hotel%2C_view_from_Wolno%C5%9Bci_Square_%285%29.jpg","page_title":"Hotel Polski we Włocławku","context_page_description":"Hotel Polski we Włocławku – zabytkowy, klasycystyczny zespół budynków, pełniący funkcje hotelowe oraz handlowo-usługowe. Najstarszy gmach kompleksu został wzniesiony w drugiej połowie XVIII wieku. Obecnie mieści się tu 4-gwiazdkowy Hotel Rozbicki wraz z pracownią cukierniczą."},{"page_url":"https://it.wikipedia.org/wiki/Borussia_Verein_f%C3%BCr_Leibes%C3%BCbungen_1900_M%C3%B6nchengladbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Gladbach_Fans_in_Kurve.JPG","page_title":"Borussia Verein für Leibesübungen 1900 Mönchengladbach","context_page_description":"Il Borussia Verein für Leibesübungen 1900 Mönchengladbach e. V., noto internazionalmente come Borussia Mönchengladbach, abbreviato in Borussia M'Gladbach o Gladbach, e talvolta, per ragioni di grafica televisiva, anche in Borussia MGB, è una società polisportiva tedesca di Mönchengladbach nota al grande pubblico internazionale per la sua sezione calcistica, tra le più blasonate di tutta la Germania. È, infatti, l'unica squadra tedesca assieme al Borussia Dortmund che può esporre sulla propria tenuta ufficiale due stelle, in questo seconda solo al Bayern Monaco, che ne vanta quattro.\\nFondata nel 1900, giocò a lungo nei campionati minori e ottenne il suo primo successo nel 1960 conquistando la Coppa di Germania. Conobbe il suo massimo splendore negli anni settanta, quando insieme al Bayern dominò la scena nazionale ed europea vincendo cinque campionati tedeschi, una Coppa di Germania e due Coppe UEFA. Artefici di questi successi furono l'allenatore Hennes Weisweiler e la sua squadra formata da giovani fuoriclasse, per questo motivo chiamata Fohlen-Elf, in grado di esprimere un nuovo calcio altamente spettacolare e spiccatamente offensivo."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A0%89%EC%8B%B1%ED%84%B4_%EC%BD%A9%EC%BD%94%EB%93%9C_%EC%A0%84%ED%88%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Battle_of_Lexington%2C_1775.png","page_title":"렉싱턴 콩코드 전투","context_page_description":"렉싱턴 콩코드 전투는 1775년 4월 19일에 일어난 ‘미국 독립 전쟁’의 포문을 연 영미 간의 전투이다. 영국군이 보스턴 북서쪽에 위치한 콩코드에 있던 미국 식민지 민병대 무기고 접수 작전을 실시했다. 그 조치에 반발하여 움직였던 식민지 민병대와 무력으로 충돌, 렉싱턴과 콩코드에서 영국군과 민병대의 격렬한 전투를 벌여 식민지군이 영국군을 격파했다. 규모는 작지만 미국 독립 전쟁의 서전을 장식한 의미있는 전투가 되었다."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A5%D5%B8%D6%80%D5%A3%D5%AB_%D4%BF%D5%B8%D5%B6%D5%BD%D5%BF%D5%A1%D5%B6%D5%BF%D5%AB%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Gheorghe-constantin_vintage.jpg","page_title":"Գեորգի Կոնստանտին","context_page_description":"Գեորգի Կոնստանտին, Ռումինիայի ֆուտբոլի ազգային հավաքականի նախկին ֆուտբոլիստ, հետագայում նաև մարզիչ։ Վերջին ֆուտբոլային ակումբը, որում հանդես է եկել Գեորգի Կոնստանտինը եղել է Բուխարեստ քաղաքի Ստյաուան։"},{"page_url":"https://de.wikipedia.org/wiki/Do%C8%99tat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/ROU_AB_Dostat_CoA.png","page_title":"Doștat","context_page_description":"Doștat ist eine rumänische Gemeinde im Kreis Alba in Siebenbürgen.\\nDer Ort ist bekannt auch unter den deutschen Bezeichnungen Langenthal oder Langendorf und den rumänischen Telecu oder Telcu."},{"page_url":"https://vi.wikipedia.org/wiki/Air_Force_Two","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Shaikh_Khalifa_and_Dick_Cheney_walk_in_a_red_carpet_in_an_arrival_ceremony_in_Abu_Dhabi_March_16_2002.jpg","page_title":"Air Force Two","context_page_description":"Air Force Two là số hiệu điều khiển không lưu được dùng để gọi bất kì một chiếc phi cơ phản lực nào của Không quân Hoa Kỳ đang chuyên chở Phó Tổng thống Hoa Kỳ giống như Không Lực Một của Tổng thống, ngoại trừ không có Tổng thống trên khoang; ngoài ra Tổng thống và Phó Tổng thống hoàn toàn không bao giờ được phép bay cùng một chiếc máy bay. Air Force Two thường xuyên sử dụng loại máy bay Boeing C-32A - một phiên bản của Boeing 757. Các loại máy bay khác của Không đoàn Không vận số 89 như chiếc Boeing C-40 Clipper, C-20B, C-37A, và C-37B cũng đã từng sử dụng làm Air Force Two cho Phó Tổng thống. Ngoài ra, Phó Tổng thống cũng có thể sử dụng loại máy bay chỉ thường dùng cho Tổng thống là Boeing VC-25A, làm Air Force Two.\\nNgoài ra Phó Tổng thống Hoa Kỳ còn được Thủy quân Lục chiến Hoa Kỳ chuyên chở bằng Trực thăng, còn được gọi là Marine Two, sử dụng cùng một loại trực thăng đã chuyên chở Tổng thống cũng như chiếc UH-1N Twin Huey của Không lực Hoa Kỳ, với số hiệu Air Force Two."},{"page_url":"https://nl.wikipedia.org/wiki/Haringteller","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Mesdag%2C_Preparations_for_departure.jpg","page_title":"Haringteller","context_page_description":"Een haringteller was een manspersoon die zich tot even voorbij het midden van de negentiende eeuw in deeltijd bezighield met – zoals de naam al aanduidt – het tellen van eerder aangevoerde haring. De aangeduide persoon maakte deel uit van een eenheid van haringtelders, zoals deze lieden officieel werden aangeduid. Een dergelijke eenheid was gefundeerd op wetgevingen met betrekking tot de voornoemde bezigheid. Deze eenheden zullen ongetwijfeld een duidelijke mate van bestaansrecht hebben gekend in alle Zijdse - en Zuiderzeedorpen van waaruit men visserij op haring bedreef. De hier weergegeven omschrijving is overigens beperkt tot wat daarover bekend is bij dorpen aan de Noordzeekust."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%85s_f%C3%B6rsamling,_%C3%96lands_kontrakt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/As_kyrka_View1.jpg","page_title":"Ås församling, Ölands kontrakt","context_page_description":"Ås församling var en församling i Ölands södra kontrakt i Växjö stift, Mörbylånga kommun i Kalmar län. Församlingen uppgick 2002 i Sydölands församling."},{"page_url":"https://hu.wikipedia.org/wiki/Mindennapi_%C3%A9let_az_%C3%B3kori_Egyiptomban","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/TombofNebamun-2.jpg","page_title":"Mindennapi élet az ókori Egyiptomban","context_page_description":"Az ókori Egyiptom civilizációja ötezer évvel ezelőtt fejlődött ki, és mintegy háromezer éven át virágzott a Nílus völgyében. Az egyiptomi kultúra ez alatt a hosszú időszak alatt sokat fejlődött, különösen a nagy építkezések alakulása szembetűnő, ugyanakkor a mindennapi élet fő vonásai a fokozatos fejlődés mellett nagyfokú stabilitást mutattak. Ez a civilizáció történetének egyik csúcspontját az i. e. 13. században, II. Ramszesz fáraó korában érte el, Egyiptom ekkor a világ vezető hatalma volt. A régészek gazdag leletanyagából a történészek sok érdekes részletet tártak elénk az ókori Egyiptom hétköznapjairól is, nem csak a fáraók életéről. A cikk elsősorban a II. Ramszesz korából származó információkra épül, de kitekintéssel az egész egyiptomi ókorra."},{"page_url":"https://war.wikipedia.org/wiki/Ceranemota_improvisa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ceranemota_improvisa_01.jpg","page_title":"Ceranemota improvisa","context_page_description":"An Ceranemota improvisa in uska species han Lepidoptera nga ginhulagway ni Edwards hadton 1873. An Ceranemota improvisa in nahilalakip ha genus nga Ceranemota, ngan familia nga Drepanidae. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/Electric_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Electric_Castle_2017_-_Castle_view.jpg","page_title":"Electric Castle","context_page_description":"Electric Castle is an annual music festival held on the Transylvanian domain of the Bánffy Castle, near Cluj-Napoca in Romania, and combines music, technology and alternative arts. It features many genres of music including rock, indie, hip hop, electronic, techno, and drum and bass as well as art installations.\\nIn the seventh edition, the festival has received the award for the Best Medium Sized Festival at the European Festival Awards, where Electric Castle has been nominated since its existence. On its past editions, the festival had confirmed names such as Florence + the Machine, Thirty Seconds to Mars, The Prodigy, Nils Frahm, Skrillex, Bring me the Horizon, Deadmau5, alt-J, Franz Ferdinand, Fatboy Slim, Sigur Ros, Bastille, Rudimental, Thievery Corporation, Die Antwoord and many other artists that performed on one of its ten stages."},{"page_url":"https://en.wikipedia.org/wiki/Caldera,_Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Close-up_on_orbicular_granite%2C_Caldera%2C_Chile.JPG","page_title":"Caldera, Chile","context_page_description":"Caldera is a port city and commune in the Copiapó Province of the Atacama Region in northern Chile. It has a harbor protected by breakwaters, being the port city for the productive mining district centering on Copiapó to which it is connected by the first railroad constructed in Chile."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D9%85%DB%8C%D9%86%D8%A7_%DA%AF%D9%88%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Kamienna_G%C3%B3ra%2C_gmach_S%C4%85du_Rejonowego_-_6_marca_2010_r..jpg","page_title":"کامینا گورا","context_page_description":"کامینا گورا یک منطقهٔ مسکونی در لهستان است که در شهرستان کامینا گورا واقع شده‌است. کامینا گورا ۱۷٫۹۷ کیلومتر مربع مساحت و ۲۱٬۴۴۰ نفر جمعیت دارد."},{"page_url":"https://sv.wikipedia.org/wiki/Sinea_spinipes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Assassin_Bug_-_Sinea_spinipes%2C_Julie_Metz_Wetlands%2C_Woodbridge%2C_Virginia.jpg","page_title":"Sinea spinipes","context_page_description":"Sinea spinipes är en insektsart som först beskrevs av Herrich-schaeffer 1846. Sinea spinipes ingår i släktet Sinea och familjen rovskinnbaggar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Rani_Karnaa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Kathak_3511900193_986f6440f6_b_retouched.jpg","page_title":"Rani Karnaa","context_page_description":"Rani Karnaa was an Indian classical dancer, known for her proficiency in the Indian dance form of Kathak, and regarded by many as one of the greatest exponents of the art form. She was honoured by the Government of India, in 2014, by bestowing on her the Padma Shri, the fourth highest civilian award, for her services to the field of dance."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Blankenberghe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/BE-blankenberge-Descampsstraat_10-erfgoed-nr.44862-2.jpeg","page_title":"Liste des monuments historiques de Blankenberghe","context_page_description":"Cette page regroupe l'ensemble des monuments classés de la ville de Blankenberghe."},{"page_url":"https://sh.wikipedia.org/wiki/Arhimedov_pu%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Turbina_Archimedesa_MEW_Goryn.jpg","page_title":"Arhimedov puž","context_page_description":"Arhimedov puž, takođe poznat kao pužna turbina, je turbina za vodu, koja se koristi za prenos potencijalne energiju od gornjeg nivoa vode u realnu energiju. Može se uporediti sa vodeničarskim točkom odnosno točakom na vodu. Međutim, u odnosu na točak za vodu, pužna turbina ima mnogo veću efikasnost. Turbina se sastoji od rotora u obliku Arhimedovog puža, koji rotira u polukružnom koritu. Voda teče kroz turbinu i njena težina pritiska na dole lopatice turbine, koja zauzvrat primorava turbinu da se okreće. Voda teče slobodno kroz turbinu nazad u reku. Gornji kraj pužne turbine je povezan sa generatorom preko menjača."},{"page_url":"https://en.wikipedia.org/wiki/Wroc%C5%82aw_Zoo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Agapornis_roseicollis_and_Agapornis_fischeri_%28Wroclaw_zoo%29-1.JPG","page_title":"Wrocław Zoo","context_page_description":"The Wrocław Zoological Garden, known simply as the Wrocław Zoo, is a zoo on Wróblewskiego Street in Wrocław, Poland. It is the oldest zoo in Poland, having been opened in 1865 as the Breslau Zoological Garden while the city was part of Prussia. It is also the largest zoo in Poland. The zoo covers 33 hectares in downtown Wrocław. It is home to about 10,500 animals representing about 1,132 species. In terms of the number of animal species it is the third largest zoological garden in the world.\\nThe Wrocław Zoo is the most visited zoo in Poland and the fifth most visited zoo in Europe.\\nThe zoo is an accredited member of the European Association of Zoos and Aquaria and the World Association of Zoos and Aquariums."},{"page_url":"https://nl.wikipedia.org/wiki/V%C3%A9rteskethely","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/V%C3%A9rteskethely_-_Katolikus_templom.jpg","page_title":"Vérteskethely","context_page_description":"Vérteskethely is een plaats en gemeente in het Hongaarse comitaat Komárom-Esztergom. Vérteskethely telt 551 inwoners."},{"page_url":"https://it.wikipedia.org/wiki/Francesco_Antommarchi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Antommarchi.png","page_title":"Francesco Antommarchi","context_page_description":"Francesco Carlo Antommarchi è stato un medico francese di origine italiana."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E8%A5%BF%E6%B4%8B%E8%81%AF%E5%90%88%E5%AD%B8%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Atlantic_Union_College%2C_Lancaster%2C_MA.jpg","page_title":"大西洋聯合學院","context_page_description":"大西洋聯合學院 是基督復臨安息日會位於美國麻薩諸塞州的一所私立學院。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E7%95%8C%E5%8D%80%E5%B0%88%E7%B7%9A%E5%B0%8F%E5%B7%B4403A%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/GN403ARtMap.png","page_title":"新界區專線小巴403A線","context_page_description":"新界區專線小巴403A線為香港一條來往安蔭至沙田市中心的小巴路線，為403線的分拆路線。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%A4%E5%B8%8C%E8%87%98%E7%A5%9E%E5%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Segesta%2C_Tempio_greco.jpg","page_title":"古希臘神廟","context_page_description":"希臘神廟，也名為希臘神殿。在古希臘宗教中的希臘聖所內是為安座眾神神像的神聖建築結構。神廟內部不是做為集會的空間，因為奉獻給諸尊神明的供奉與儀式是在神廟外面舉行得。神廟常常必須使用到祈願奉獻物（Votive offering）。在希臘建築中祂們是具有很重要的地位以及很廣泛普及的建築形式。此外西亞以及北非在希臘化時代中的王國，一座神廟搭建完成的宗教意向通常是為了延續遵循著當地的文化傳統。甚至連在當地的一個希臘人所受到當地文化的影響力也是明顯可見得，像這樣的建築結構一般認為是與希臘神廟分屬不同的建築系統。這些不同於希臘神廟建築採納的典範方面，譬如說，關於希臘─帕提亞（Graeco-Parthian）以及巴克特里亞的神廟即是，或是關於埃及托勒密時代的神廟之典範，埃及托勒密時代的神廟祂是遵循古埃及宗教（Ancient Egyptian religion）的傳統。還有一個重點是很多傳統的希臘神廟方位都是朝向著東方的天象。"},{"page_url":"https://en.wikipedia.org/wiki/Adelaide","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Kaurnaland.png","page_title":"Adelaide","context_page_description":"Adelaide AD-ə-layd, is the capital city of the state of South Australia, and the fifth-most populous city of Australia. The demonym Adelaidean is used to denote the city and the residents of Adelaide.\\nAdelaide is situated on the Adelaide Plains north of the Fleurieu Peninsula, between the Gulf St Vincent in the west and the Mount Lofty Ranges in the east. Its metropolitan area extends 20 km (12 mi) from the coast to the foothills of the Mount Lofty Ranges, and stretches 96 km (60 mi) from Gawler in the north to Sellicks Beach in the south.\\nNamed in honour of Queen Adelaide, consort to King William IV, the city was founded in 1836 as the planned capital for the only freely-settled British province in Australia. Colonel William Light, one of Adelaide's founding fathers, designed the city centre and chose its location close to the River Torrens, in the area originally inhabited by the Kaurna people and known as Tarndanyangga (\\"place of the red kangaroo\\"). Light's design, now listed as national heritage, set out the city centre in a grid layout known as \\"Light's Vision\\", interspaced by wide boulevards and large public squares, and entirely surrounded by parklands."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%BE%D0%B3%D0%BE%D1%80%D0%BB%D0%B0%D1%8F_%D1%82%D0%B8%D0%B3%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D1%86%D0%B0%D0%BF%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bare-throated_Tiger-heron_%28Tigrisoma_mexicanum%29_%286941076536%29.jpg","page_title":"Гологорлая тигровая цапля","context_page_description":"Гологорлая тигровая цапля — вид птиц из семейства цаплевых, широко распространённый в Центральной Америке."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EC%8B%A4_%EC%BC%88%EB%A6%AC_%EC%9E%84%EA%B3%84%EC%82%AC%EA%B3%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/KelleyCriticalityVessel1.png","page_title":"세실 켈리 임계사고","context_page_description":"세실 켈리 임계사고는 1958년 12월 30일 미국 뉴멕시코주 로스앨러모스 국립 연구소에서 일어난 임계사고이다. 역사상 원자로 외부에서 일어난 임계사고 10건 중 하나이다. 1958년 사고 당시에는 6월 16일 미국 테네시주 오크리지의 Y-12 국립보안구역 임계사고, 10월 15일 유고슬라비아 베오그라드의 빈차 핵연구소 임계사고에 이어 역사상 3번째로 일어난 임계사고이다. 액체 시약에 용해된 플루토늄 화합물에 임계 반응이 일어나 사고로 화학자 세실 켈리가 급성방사선증후군으로 35시간만에 사망했다."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%89%E6%B2%B3%E7%95%94%E6%B2%99%E5%B0%94%E8%AF%BA%E5%85%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Map_commune_FR_insee_code_01088.png","page_title":"安河畔沙尔诺兹","context_page_description":"安河畔沙尔诺兹，是法国东部安省的一个市镇。面积 6.62平方公里，人口810，人口密度122.36人／平方公里。"},{"page_url":"https://en.wikipedia.org/wiki/Bushpig","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Southern_Bush_Pig.jpg","page_title":"Bushpig","context_page_description":"The bushpig is a member of the pig family that is endemic to forests, woodland, riverine vegetation and reedbeds in East and Southern Africa. Probably introduced populations are also present in Madagascar. There have also been unverified reports of their presence on the Comoro island of Mayotte. Bushpigs are mainly nocturnal. There are several subspecies.\\nAdult bushpigs stand from 66 to 100 cm at the shoulder, and weigh from 55 to 150 kg. They resemble the domestic pig, and can be identified by their blunt, muscular snouts, small eyes, pointed, tufted ears and buckled toes. Their colour varies from reddish brown to dark brown and becomes darker with age. Both sexes have a lighter-coloured mane which bristles when the animal becomes agitated. The upper parts of the face and ears are also lighter in colour. Their sharp tusks are fairly short and inconspicuous. Unlike warthogs, bushpigs run with their tails down. Males are normally larger than females.\\nThe bushpig is closely related to the red river hog, with which it can interbreed. The bushpig is distinguished by its less colourful markings, coarser hair, and larger size."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Ehrenb%C3%BCrger_von_Memmingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Bismarck_pickelhaube.jpg","page_title":"Liste der Ehrenbürger von Memmingen","context_page_description":"Die Ehrenbürgerwürde ist die höchste kommunale Auszeichnung der Stadt Memmingen. Mit ihr werden Bürger ausgezeichnet, die sich besondere Verdienste für die Stadt erworben haben. Rechtliche Grundlage ist die jeweilige Gemeindeordnung. Neben der Ehrenbürgerschaft vergibt die Stadt auch einen Ehrenring.\\nSeit 1866, soweit nach Akten feststellbar, wurden folgende Personen zu Ehrenbürgern ernannt.\\nHinweis: Die Auflistung erfolgt chronologisch nach Datum der Zuerkennung."},{"page_url":"https://en.wikipedia.org/wiki/Nash_Statesman","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Nash_Statestman_Super_Airflyte_1951_%2818686938540%29.jpg","page_title":"Nash Statesman","context_page_description":"The Nash Statesman is a full-sized automobile that was built by Nash Motors for the 1950–1956 model years. The Statesman was the mid-level product of Nash Motors' automobile series and was positioned below the top-line Nash Ambassador, but above the Nash Rambler."},{"page_url":"https://it.wikipedia.org/wiki/Pezza_onorevole","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Araldiz_cantone.jpg","page_title":"Pezza onorevole","context_page_description":"In araldica col termine pezze onorevoli si indicano tutti quei carichi araldici che hanno una posizione predeterminata, e di norma invariabile, sul campo dello scudo. La posizione rimane la stessa anche quando le pezze sono inserite su partizioni dello scudo che, in tal caso, vengono considerate come se fossero uno scudo intero.\\nRientrano fra questi carichi anche le pezze diminuite cioè quelle che derivano dalle pezze onorevoli, di cui hanno la forma ma con dimensioni ridotte per consentirne la presenza sullo scudo in numero superiore all'unità. In genere le pezze diminuite, nel loro insieme, occupano lo stesso spazio occupato dalla pezza onorevole da cui derivano\\nIn linea di massima le pezze onorevoli sono figure formate da linee di partizione. Sono il palo, la fascia, la banda, la sbarra, la croce, il decusse, la pergola, lo scaglione, il capo.\\nLe pezze onorevoli, dette anche pezze di primo ordine, costituiscono una parte delle pezze araldiche e formano un elenco variabile a seconda degli autori.\\nUna possibile suddivisione delle pezze onorevoli ne prende in esame le forme base e quelle derivate e può essere rappresentata da:\\nforme semplici"},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_the_City_of_Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Lawrence_Beck_%281990%29_%22Lloyd_Rees%22.jpg","page_title":"List of public art in the City of Sydney","context_page_description":"Public art in the City of Sydney in New South Wales, Australia includes a wide range of works across a range of genres and for a range of purposes or combination of purposes. Some are purely artistic, some are commemorative, some are both. Some are monuments or memorials; some are also fountains and some are site-specific and in some buildings, such as Australia Square and Grosvenor Place by Harry Seidler and Aurora Place by Renzo Piano, the art is a component of the architect's intentions. Occasionally, works are removed or repositioned. The City of Sydney has a Public Art Policy and conservation work is carried on from time to time to maintain the works.\\nThe materials used vary widely but include traditional marble and bronze as well as steel, concrete and newer materials like aluminium. In the 21st century, kinetic, musical, and conceptual works began to appear.\\nNotable sculptors from around the world are represented in works on public display in Sydney."},{"page_url":"https://fy.wikipedia.org/wiki/Katedraal_fan_Oloron","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Oloron-Sainte-Marie_-_Cath%C3%A9drale_Sainte-Marie_-_Chevet_-2.jpg","page_title":"Katedraal fan Oloron","context_page_description":"De Katedraal fan Sint Marije fan Oloron is in tsjerke yn Oloron-Sainte-Marie yn it Frânske departemint Pyrénées-Atlantiques. De katedraal is sûnt 1939 in histoarysk monumint en waard yn 1998 ynskreaun as wrâlderfgoed fan UNESCO as ûnderdiel fan de pylgerrûtes nei Santiago de Compostella.\\nDe bou fan de tsjerke sette yn de 12e iuw útein yn opdracht fan Gaston IV, greve fan Béarn. It wie oant 1801 de sit fan it bisdom fan Oloron, doe't it bisdom mei it konkordaat fan 1801 waard opheven.\\nDe tsjerke helle it wrâldnijs yn 2019, nei't de tsjerke yn de iere moarn fan 4 novimber skeind waard troch in raamynbraak. De dieven ramden mei in persoane-auto in midsiuwske houten doar fan de monumintale katedraal en stielen in monstrâns, sulveren tsjelken, krusen en liturgyske gewaden. Dêrnjonken fernielden de dieven it hek dat de tsjerkeskat beskerme, in stânbyld en in faas.\\nDe oanfal op de katedraal yn Olongron wie ien yn in weach fan oerfallen op katolike tsjerken yn Frankryk. Yn 2018 waarden der yn it lân 129 gefallen fan tsjeafte en 877 gefallen fan fernielerij rapportearre, yn tsien jier tiid in tanimming fan 400%."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%A5%D6%84%D5%AB_%D4%B3%D5%AC%D5%AB%D5%BD%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Publicity_photo_young_gleason.jpg","page_title":"Ջեքի Գլիսոն","context_page_description":"Ջեքի Գլիսոն, ամերիկացի կատակերգական դերասան և երաժիշտ, որը ձայնագրվել է «Criteria Studios» ստուդիայում:"},{"page_url":"https://pt.wikipedia.org/wiki/Defeito_cristalogr%C3%A1fico","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Defecttypes.png","page_title":"Defeito cristalográfico","context_page_description":"Sólidos cristalinos exibem uma estrutura cristalina periódica. As posições dos átomos ou moléculas ocorre com a repetição de distâncias fixas, determinadas pelos parâmetros da célula unitária. Entretanto, o arranjo de átomos ou moléculas na maior parte dos materiais cristalinos não é perfeita. Os padrões são interrompidos por defeitos cristalográficos."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%B3%E8%94%B5%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/FujizukaInariMatsudo.jpg","page_title":"徳蔵院","context_page_description":"徳蔵院は、千葉県松戸市日暮にある真言宗豊山派の寺院。"},{"page_url":"https://eu.wikipedia.org/wiki/Abenduaren_8","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Julen_Aguinagalde_07.jpg","page_title":"Abenduaren 8","context_page_description":"Abenduaren 8a gregoriotar egutegiaren urteko hirurehun eta berrogeita bigarren eguna da, 343.a bisurteetan. 23 egun falta dira urtea amaitzeko."},{"page_url":"https://es.wikipedia.org/wiki/Campeonato_Mundial_de_Hockey_sobre_Hielo_Masculino_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/2015_IIHF_World_Championship_%E2%80%93_DEN_vs_FIN_%288%29.jpg","page_title":"Campeonato Mundial de Hockey sobre Hielo Masculino de 2015","context_page_description":"El LXXIX Campeonato Mundial de Hockey sobre Hielo Masculino se celebró en la Praga y Ostrava entre el 1 y el 17 de mayo de 2015 bajo la organización de la Federación Internacional de Hockey sobre Hielo y la Federación Checa de Hockey sobre Hielo.​\\nUn total de 16 selecciones nacionales compitieron por el título mundial, cuyo anterior portador era el equipo de Rusia, vencedor del Mundial de 2014.\\nEl equipo de Canadá conquistó el título mundial al derrotar en la final a la selección de Rusia con un marcador de 6-1. En el partido por el tercer lugar el conjunto de Estados Unidos venció al de la República Checa."},{"page_url":"https://pt.wikipedia.org/wiki/Ingoldingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Aerials_BW_16.06.2006_12-37-47.jpg","page_title":"Ingoldingen","context_page_description":"Ingoldingen é um município da Alemanha, no distrito de Biberach, na região administrativa de Tubinga, estado de Baden-Württemberg."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_statues_%C3%A9questres_de_Hongrie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Esztergom_-_Botty%C3%A1n_J%C3%A1nos_szobra.JPG","page_title":"Liste de statues équestres de Hongrie","context_page_description":"Cet article recense les statues équestres en Hongrie."},{"page_url":"https://sv.wikipedia.org/wiki/Pepi_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/WLA_brooklynmuseum_Statuette_of_Queen_Ankhnesmeryre_II_and_her_Son_3.jpg","page_title":"Pepi II","context_page_description":"Pepi II var den femte faraonen under Egyptens sjätte dynasti) och regerade omkring 2245–2180 f. Kr. Han besteg tronen redan som barn och regerade exceptionellt länge."},{"page_url":"https://no.wikipedia.org/wiki/Fugletelg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Gymnocarpium_dryopteris_AT.JPG","page_title":"Fugletelg","context_page_description":"Fugletelg er en art av bregner innenfor småtelgslekten i storburknefamilien. Den kan danne hybrider med både kalktelg og finntelg.\\nFugletelg er en liten krypende bregne på 10-30 cm, med en tynn, opprett stengel. Bladplaten er 2-3-dobbelt fliket, og primærflikene er trekantede og ordnet som tre litt atskilte, like store plater på hver sin bladstilk. Alternativt kan man uttrykke det som at de bladplaten nederst har to primærfliker som er dobbelt fliket, og at det øverst er en dobbelt fliket bladplate. Småflikene kan være grovt tannet innerst mot primærflikens midtnerve.\\nBladskaftene er gjennomskinnelige, og brekker lett. Bladplatene kan ha noen lysebrune eller brungule skjell, og være svarte nederst. Bladet er ellers lyst grønt og uten skjell eller hårdekke.\\nFugletelg vokser i skog, myrlandskap og i åpen eng og hei opp til fjellet over tregrensen. Den vokser i hele Norge, opp til 1.600 moh. i Ulvik i Hardanger. Ellers vokser den på hele den nordlige halvkulen.\\nDet er registrert to sterile hybrider i Norge – Gymnocarpium dryopteris x robertianum med kalktelg, samt hybriden Gymnocarpium continentale x dryopteris med finntelg."},{"page_url":"https://sr.wikipedia.org/wiki/Nikotinamid","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Nicotinamide-from-xtal-2011-Mercury-3D-sf.png","page_title":"Nikotinamid","context_page_description":"Nikotinamid je amid nikotinske kiseline. Nikotinamid je u vodi rastvorni vitamin i deo je grupe vitamina B. Nikotinska kiselina, takođe poznata kao niacin, se konvertuje do nikotinamida in vivo, i mada su ova dva jedinjenja identična u pogledu njihovih vitaminskih funkcija, nikotinamid nema ista farmakološka i toksična dejstva kao niacin. Nikotinamid ne redukuje holesterol, niti uzrokuje crvenilo. On može da bude toksičan za jetru pri dozama iznad 3 g/dan kod odraslih. U ćelijama, niacin je inkorporiran u nikotinamid adenin dinukleotid i nikotinamid adenin dinukleotid fosfat. Metabolički putevi za nikotinamid i nikotinsku kiselinu su veoma slični. NAD+ i NADP+ su koenzimi u velikom broju enzimatskih oksidaciono-redukcionih reakcija. Nikotinamid se formira u vodenoj aminolizi 3-cijanopiridina i naknadnom kristalizacijom."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BA%D1%81%D0%B5%D0%BB%D1%8C%D0%B4%D0%B5%D0%B3%D1%96_%D0%9A%D0%B8%D1%80%D1%85%D0%B1%D0%B5%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Kirchberg_am_Wechsel_Panorama.jpg","page_title":"Вексельдегі Кирхберг","context_page_description":"Вексельдегі Кирхберг — Аустриядағы жәрмеңке. Төменгі Аустрия федералды жеріне қарасты Нойнкирхен округінің құрамына енеді.\\nҚаланың тұрақты тұрғындарының саны 2475 адамды құрайды. Алып жатқан жер аумағы 51.17 км² шамасында. Елді мекеннің автомобиль коды — NK, ресми идентификациялық коды — 3 18 14.\\n2005 жылғы сайлау нәтижесі бойынша коммунаның бургомистрі болып Виллибальд Фукс саналады."},{"page_url":"https://pl.wikipedia.org/wiki/Quyang_Lu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Quyang_Road_Station.jpg","page_title":"Quyang Lu","context_page_description":"Quyang Lu – stacja początkowa metra w Szanghaju, na linii 8. Zlokalizowana jest pomiędzy stacjami Siping Lu i Hongkou Zuqiuchang. Została otwarta 29 grudnia 2007."},{"page_url":"https://nl.wikipedia.org/wiki/Torricella-Taverne","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Karte_Gemeinde_Torricella-Taverne_2012.png","page_title":"Torricella-Taverne","context_page_description":"Torricella-Taverne is een gemeente en plaats in het Zwitserse kanton Ticino, en maakt deel uit van het district Lugano. Torricella-Taverne telt 2947 inwoners."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D8%B3%D8%A7%DB%8C_%D9%88%D8%A7%D9%86%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Vank_Cathedral_Isfahan_Aarash_%2827%29.jpg","page_title":"کلیسای وانک","context_page_description":"کلیسای وانک یا کلیسای نجات دهنده مقدس، نام کلیسایی است در محله جلفا، که از نام کلیسای «سورپ آمنا پرکیچ وانک» جوغا در نخجوان گرفته شده‌است. این کلیسا از کلیساهای تاریخی ارمنی‌های اصفهان می‌باشد و در زمان شاه عباس دوم ساخته شده‌است. وانک در زبان ارمنی به معنی صومعه است."},{"page_url":"https://de.wikipedia.org/wiki/Filstalbr%C3%BCcke_(Neubaustrecke_Wendlingen%E2%80%93Ulm)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Baustelle_Filstalbr%C3%BCcke-pjt2.jpg","page_title":"Filstalbrücke (Neubaustrecke Wendlingen–Ulm)","context_page_description":"Die Filstalbrücke ist eine im Bau befindliche, rund 485 m lange, Eisenbahnüberführung der Neubaustrecke Wendlingen–Ulm. Sie wird zwischen der Gemeinde Mühlhausen im Täle und der Stadt Wiesensteig das Tal der Fils in einer Höhe von bis zu circa 85 m überspannen. Sie wird damit, nach der Müngstener Brücke und der Rombachtalbrücke, die dritthöchste Eisenbahnbrücke in Deutschland sein.\\nDie Brücke wird aus zwei eingleisigen, parallelen Bauwerken bestehen. Das Bauwerk ist als semi-integrale Spannbetonbrücke geplant. Die Feste Fahrbahn auf dem Bauwerk soll auch von Rettungsfahrzeugen befahren werden können. Die größte Spannweite zwischen den V-förmig ausgebildeten Stützen wird bei etwa 150 m liegen.\\nZusammen mit dem sich westlich anschließenden Boßlertunnel sowie dem östlich folgenden Steinbühltunnel bildet das im Baukilometer 48 liegende Bauwerk einen Planfeststellungsabschnitt, in dem die Strecke die Hochebene der Schwäbischen Alb erreichen wird. In einer kontinuierlichen Steigung von rund 25 Promille steigt die Strecke dabei auf einer Länge von rund 14 km von rund 400 m ü. NN auf etwa 750 m ü. NN an."},{"page_url":"https://fr.wikipedia.org/wiki/Convention_de_Chuanbi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Convention_of_Chuenpee_2.png","page_title":"Convention de Chuanbi","context_page_description":"La Convention de Chuanbi, est un des traités inégaux signé entre la Chine impériale de la dynastie Qing, représenté par Qishan et l'Empire britannique, représenté par le ministre plénipotentiaire Charles Elliot, en 1841, pendant la première guerre de l'opium. Elle n'aura finalement pas été ratifiée en raison de la désapprobation des gouvernements des deux Empires. Les deux signataires seront renvoyés de leur postes par leurs gouvernements respectifs."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B7%D1%96%D0%BD_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD_%D0%A2%D0%B8%D0%BC%D0%BE%D1%84%D1%96%D0%B9%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Stiepan_Riazin.jpg","page_title":"Разін Степан Тимофійович","context_page_description":"Степан Тимофійович Разін — очільник повстанців під час Селянської війни 1667—1671 у Московському царстві. Батько Степана належав до козацької старшини Війська Донського, мати, швидше за все, була кримською татаркою, хресним батьком був військовий отаман Корнило Яковлєв."},{"page_url":"https://id.wikipedia.org/wiki/Fatmawati","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Fatmawati_Soekarno_%281966%29.jpg","page_title":"Fatmawati","context_page_description":"Fatmawati yang bernama asli Fatimah adalah istri dari Presiden Indonesia pertama Soekarno. Ia menjadi Ibu Negara Indonesia pertama dari tahun 1945 hingga tahun 1967 dan merupakan istri ke-3 dari Presiden Pertama Indonesia, Soekarno. Ia juga dikenal akan jasanya dalam menjahit Bendera Pusaka Sang Saka Merah Putih yang turut dikibarkan pada upacara Proklamasi Kemerdekaan Indonesia di Jakarta pada tanggal 17 Agustus 1945."},{"page_url":"https://ca.wikipedia.org/wiki/Baga_del_Marcet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Granera._Baga_del_Marcet.svg","page_title":"Baga del Marcet","context_page_description":"La Baga del Marcet, és una obaga del terme municipal de Granera, a la comarca del Moianès.\\nÉs a la part central-oriental del terme, al sud-est del Marcet i de les Rovires. És a l'esquerra del torrent de les Tutes, a prop i a migdia de la Cova de les Tutes. Forma tot el vessant nord-est de la Carena del Marcet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%90%D7%A8%D7%A0%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/%D0%94%D0%BE%D1%89_%D0%BF%D1%80%D0%BE%D0%B9%D1%88%D0%BE%D0%B2%D1%81%D1%8F_%D0%BF%D0%BE_%D0%B2%D1%83%D0%BB%D0%B8%D1%86%D1%8F%D1%85_%D0%A1%D0%B0%D1%80%D0%BD.jpg","page_title":"סארני","context_page_description":"סארני היא עיר במחוז רובנו, בחבל ווהלין שבצפון-מערב אוקראינה, ציר דרכים ושיט ראשי. תרגום השם סארני מאוקראינית הוא \\"איילות\\", על שמן של האיילות הרבות שחיו ביערות שהקיפו את העיר. איילה הוא גם סמלה של העיר."},{"page_url":"https://pt.wikipedia.org/wiki/One_Hundred_Steps","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Ohs_danny2.JPG","page_title":"One Hundred Steps","context_page_description":"One Hundred Steps, também conhecidos por OHS, são uma banda de rock com traços de screamo. são oriundos de setúbal"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%AA%D9%8A_%D8%A3%D9%84%D9%8A%D8%BA%D9%8A%D9%8A%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Paradise_%28Paradiso%29_II.jpg","page_title":"دانتي أليغييري","context_page_description":"دانتي أليغييري Dante Alighieri ويعرف عادة باسم دانتي وهو شاعر إيطالي من فلورنسا، أعظم أعماله: الكوميديا الإلهية المكونة من ثلاثة أقسام الجحيم، المطهر والفردوس، يعتبر البيان الأدبي الأعظم الذي أنتجه أوروبا أثناء العصور الوسطى، وقاعدة اللغة الإيطالية الحديثة. فهي واحدة من الأعمال الرئيسية لعملية الانتقال من العصور الوسطى إلى عصر النهضة الفكر. وتعتبر تحفة من الأدب الإيطالي وواحدة من قمم الأدب العالمية. ومعروف دانتي في الأدب الإيطالي بالشاعر الأعلى. ويسمى أيضا دانتي \\"أبو اللغة\\" الإيطالية. وقد كتب جيوفاني بوكاتشيو أول سيرة ذاتية لدانتي، في تراتاتيلو في مرتبة الشرف لدانتي.\\nشارك بحماس في الصراع السياسي الذي كان يوجد في وقته، وتم نفيه من مسقط رأسه. فكان مؤيدا نشطا للوحدة الإيطالية. وقال انه كتب العديد من الأطروحات اللاتينية في الأدب والسياسة والفلسفة. فقام بعمل الأطروحة اللاتينية دي الموناركية، في عام 1310، وهي عرض مفصل لأفكاره السياسية، من بينها الحاجة إلى وجود الإمبراطورية الرومانية المقدسة والفصل بين الكنيسة والدولة. وحارب ضد الغيبلينيين من أرزو. لكن تاريخ ميلاد دانتي مازال غير معروف بدقة حتى الآن، على الرغم من أنه يعتقدون عموما أن يكون تقريبا عام 1265. هذا يمكن استخلاصه من تلميحات السيرة الذاتية الموجودة في لا فيتا نوفا."},{"page_url":"https://pt.wikipedia.org/wiki/Regi%C3%A3o_geoecon%C3%B4mica_Nordeste_do_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Bahia_Brazil_Barreiras_em_2017.jpg","page_title":"Região geoeconômica Nordeste do Brasil","context_page_description":"A região geoeconômica do Nordeste do Brasil é a área de povoamento europeu mais antigo e atualmente é a segunda do país em população e em PIB. Tem uma área de aproximadamente 1.542.271 km², o que representa 20% do território brasileiro. Inclui todo o Nordeste da divisão oficial e o norte de Minas Gerais, onde se localizam as mesorregiões mineiras Norte de Minas e Vale do Jequitinhonha.\\nA maior parte de seu território é formada por extenso planalto, antigo e aplanado pela erosão. Em função das diferentes características físicas que apresenta, a região encontra-se dividida em quatro sub-regiões: meio-norte, sertão, agreste e zona da mata, tendo níveis muito variados de desenvolvimento humano ao longo de suas zonas geográficas.\\nEsta região já representou por séculos mais da metade da demografia e economia do país, mas acabou perdendo espaço."},{"page_url":"https://en.wikipedia.org/wiki/Boronia_heterophylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Boronia_heterophylla_foliage_and_flowers.jpg","page_title":"Boronia heterophylla","context_page_description":"Boronia heterophylla, commonly known as red boronia or Kalgan boronia, is a plant in the citrus family Rutaceae and is endemic to the south-west of Western Australia. It is an erect, slender shrub with trifoliate leaves and deep pink to red, four-petalled flowers arranged singly in leaf axils."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%83%D0%B7%D0%B5,_%D0%9A%D0%B0%D1%80%D0%BB_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B0%D0%BD_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/KCF_Krause.jpg","page_title":"Краузе, Карл Христиан Фридрих","context_page_description":"Краузе, Карл Христиан Фридрих нем. Krause — немецкий философ."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%A9%D7%A8%D7%93_%D7%9C%D7%9E%D7%A6%D7%91%D7%99_%D7%97%D7%99%D7%A8%D7%95%D7%9D_%D7%95%D7%94%D7%92%D7%A0%D7%94_%D7%90%D7%96%D7%A8%D7%97%D7%99%D7%AA_%D7%A9%D7%9C_%D7%A8%D7%95%D7%A1%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%D0%A0%D1%8F%D0%B4%D0%BE%D0%B2%D0%BE%D0%B9_%D0%9C%D0%A7%D0%A1.png","page_title":"המשרד למצבי חירום והגנה אזרחית של רוסיה","context_page_description":"המשרד לענייני הגנה אזרחית, מצבי חירום וחיסול תוצאות אסונות טבע של רוסיה הוא המשרד הממשלתי ברוסיה הממונה על מבצעי חילוץ ברוסיה ומחוצה לה. המשרד מופקד גם על יחידות כיבוי האש של רוסיה, המקבילות לשירותי הכבאות וההצלה בישראל והוא הגוף הממשלתי העיקרי בתחום הכבאות וההצלה."},{"page_url":"https://de.wikipedia.org/wiki/Gemeinden_des_Kantons_Freiburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Karte_Gemeinden_des_Kantons_Freiburg_farbig_1999.png","page_title":"Gemeinden des Kantons Freiburg","context_page_description":"Der Kanton Freiburg umfasst 133 politische Gemeinden. Hauptort ist Freiburg. Bezirkshauptorte sind fett hervorgehoben."},{"page_url":"https://sv.wikipedia.org/wiki/Roxy_(biograf,_%C3%96rebro)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Roxy_%C3%96rebro.jpg","page_title":"Roxy (biograf, Örebro)","context_page_description":"Roxy är en biograf som är belägen i Centralpalatset på Olaigatan i Örebro. Biografen invigdes 1913 och är sålunda en av Sveriges äldsta biografer. Premiärfilmen var Enrico Guazzonis \\"Quo vadis?\\". Under de första åren gick den under namnet Röda kvarn, men bytte namn i samband med en renovering 1928. År 1947 gjordes lokalerna om igen och fick det utseende som den till stora delar bär än idag, med paneler av ädelträ i foajén och salongen. Armaturer med glas från Orrefors glasbruk installerades även då.\\nÅr 1965 tog Svensk Filmindustri över lokalerna och bedrev där verksamhet fram till 1989, då SF flyttade över verksamheten till Filmstaden i nya lokaler på Drottninggatan. Verksamheten på Olaigatan övertogs samma år av Örebro kommun. Roxy är en av få kommunalt ägda biografer i Sverige och där visas kvalitetsfilmer; både nya och gamla. Digitala visningar inleddes i december 2008. Med premiär 21 februari 2009 genomfördes Örebros första digitala 3D-visningar med U2 3D. Den 1 juli 2011 invigdes salong 2 om 30 platser i källaren. Lokalerna står också till förfogande för konferensverksamhet."},{"page_url":"https://vi.wikipedia.org/wiki/Samsung_Galaxy_S_III","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Galaxy_Nexus_and_Galaxy_S_III_side_by_side.PNG","page_title":"Samsung Galaxy S III","context_page_description":"Samsung Galaxy S III là mẫu điện thoại thông minh chạy nền hệ điều hành Android được thiết kế, phát triển và bán ra thị trường bởi tập đoàn Samsung. Galaxy S3 là sự kế thừa từ mẫu điện thoại di động Samsung Galaxy S II.\\nThiết bị được phát hành ở châu Âu vào ngày 29 tháng 05 năm 2012, và ở Mỹ vào tháng 6, ở Ấn Độ vào ngày 31 tháng 5 năm 2012 và ở Đài Loan vào ngày 1 tháng 6 năm 2012.\\nGalaxy S III sử dụng trợ lý ảo cá nhân, khả năng theo dõi chuyển động mắt, và tăng bộ nhớ lưu trữ. Mặc dù hãng có công bố là SIII sẽ có phiên bản có sạc không dây, điều đó đã không bao giờ trở thành hiện thực. Tùy thuộc vào quốc gia, với 4,8-inch điện thoại thông minh đi kèm với bộ xử lý khác nhau và khả năng bộ nhớ RAM, và hỗ trợ 4G LTE. Thiết bị được phát hành với Android 4.0.4 \\"Ice Cream Sandwich\\" cài sẵn, sau đó được cập nhật lên Android 4.3 \\"Jelly Bean\\", và cũng có thể được cập nhật lên Android 4.4 \\"KitKat\\" trên các biến thể có 2 GB RAM. Kế nhiệm nó, Samsung Galaxy S4, được công bố vào ngày 14 tháng 3 năm 2013 và được phát hành một tháng sau đó.\\nSau giai đoạn phát triển kéo dài 18 tháng, Samsung ra mắt chiếc S III vào ngày 3 Tháng 5 năm 2012."},{"page_url":"https://es.wikipedia.org/wiki/Neus%C3%A4%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Neusaess_kobelkirche.jpg","page_title":"Neusäß","context_page_description":"Neusäß es una ciudad en Baviera en el Distrito de Augsburgo."},{"page_url":"https://fr.wikipedia.org/wiki/George_Johann_Scharf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Schmidtmeyer-_Paroissien%2C_James_%26_Scharf%2C_G_-_The_Mint_of_Santiago_-JCB_Library_f1.3.jpg","page_title":"George Johann Scharf","context_page_description":"George Johann Scharf est un peintre, aquarelliste, lithographe et illustrateur scientifique qui a passé l'essentiel de sa carrière en Grande-Bretagne."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A3%D8%B9%D8%B6%D8%A7%D8%A1_%D8%A7%D9%84%D8%A8%D9%88%D9%86%D8%AF%D8%B3%D8%AA%D8%A7%D8%BA_%D8%A7%D9%84%D8%A3%D9%84%D9%85%D8%A7%D9%86%D9%8A_(%D8%A7%D9%84%D8%AF%D9%88%D8%B1%D8%A9_%D8%A7%D9%84%D8%AA%D8%B4%D8%B1%D9%8A%D8%B9%D9%8A%D8%A9_%D8%A7%D9%84%D8%AA%D8%A7%D8%B3%D8%B9%D8%A9_%D8%B9%D8%B4%D8%B1%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/2014-09-12_-_B%C3%A4rbel_Bas_MdB_-_8733.jpg","page_title":"قائمة أعضاء البوندستاغ الألماني (الدورة التشريعية التاسعة عشرة)","context_page_description":"تقدم هذه القائمة نظرة عامة على جميع نواب البوندستاغ الألماني في الدورة البرلمانية التاسعة عشرة بعد الانتخابات الاتحادية لعام 2017. بدأت فترة ولاية النواب بالاجتماع التأسيسي في 24 أكتوبر 2017"},{"page_url":"https://ms.wikipedia.org/wiki/Plaza_Gwanghwamun","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Yi_Sun-sin_statue_and_12.23_Fountain.JPG","page_title":"Plaza Gwanghwamun","context_page_description":"Plaza Gwanghwamun adalah ruang awam terbuka di Sejongno, Jongno-gu di Seoul, Korea Selatan. Plaza ini dibuka pada 1 Ogos 2009 oleh Kerajaan Metropolitan Seoul dan merupakan sebahagian daripada rancangan Bandar tersebut untuk projek pengubahsuaian yang mesra alam seperti Anak Sungai Cheonggye dan Plaza Seoul. Ia juga secara signifikannya bersejarah sebagai lokasi bangunan pentadbiran diraja, yang dikenali sebagai Yukjo-geori atau Jalan Enam Kementerian; dan menampilkan tugu Laksamana Yi Sun-sin dari Dinasti Joseon dan Raja Sejong Agung Joseon. Matlamat pembukaan dan pembinaan semula plaza ini menjadikan plaza sebagai tempat bersejarah dan budaya untuk rakyat."},{"page_url":"https://fr.wikipedia.org/wiki/Patient_Protection_and_Affordable_Care_Act","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Barack_Obama_and_Ted_Kennedy_in_Hartford%2C_February_4%2C_2008.jpg","page_title":"Patient Protection and Affordable Care Act","context_page_description":"Le Patient Protection and Affordable Care Act, surnommée « Obamacare », est une loi votée par le 111ᵉ Congrès des États-Unis et promulguée par le président Barack Obama le 23 mars 2010. Elle constitue le principal volet de la réforme du système de protection sociale aux États-Unis, avec le Health Care and Education Reconciliation Act."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Vr%C3%A2ncioaia,_Vrancea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/RO_VN_Vrancioaia_28.jpg","page_title":"Comuna Vrâncioaia, Vrancea","context_page_description":"Vrâncioaia este o comună în județul Vrancea, Moldova, România, formată din satele Bodești, Muncei, Ploștina, Poiana, Spinești și Vrâncioaia."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%87%D8%AF%D8%A7%D9%81%D9%8A_%D9%83%D8%A3%D8%B3_%D8%A7%D9%84%D8%A3%D9%85%D9%85_%D8%A7%D9%84%D8%A3%D9%81%D8%B1%D9%8A%D9%82%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Asamoah_Gyan_%282014%29.jpg","page_title":"قائمة هدافي كأس الأمم الأفريقية","context_page_description":"هذه قائمة هدافي كأس الأمم الأفريقية لكرة القدم وهي البطولة الأبرز في أفريقيا الموجهة للمنتخبات الوطنية، ويعد الكاميروني صامويل إيتو الهداف التاريخي لكأس الأمم الأفريقية برصيد 18 هدف"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B4%D0%BC%D0%B0%D1%80%D0%B5%D0%BD%D0%BD%D0%B8%D0%BA_%D0%BD%D0%B5%D1%81%D0%BF%D1%80%D0%B0%D0%B2%D0%B6%D0%BD%D1%96%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Galium_spurium_var._echinospermum_sl9.jpg","page_title":"Підмаренник несправжній","context_page_description":"Підмаренник несправжній — вид рослин родини Маренові, поширений у Європі, Африці, Азії, Канаді."},{"page_url":"https://en.wikipedia.org/wiki/Merei","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Merei_jud_Buzau.png","page_title":"Merei","context_page_description":"Merei is a commune in Buzău County, Muntenia, Romania. It is composed of eleven villages: Ciobănoaia, Dealul Viei, Dobrilești, Gura Sărății, Izvoru Dulce, Lipia, Merei, Nenciulești, Ogrăzile, Sărata-Monteoru and Valea Puțului."},{"page_url":"https://fr.wikipedia.org/wiki/Milium_(m%C3%A9decine)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Milia_big.png","page_title":"Milium (médecine)","context_page_description":"En médecine, le milium, ou grutum ou acné miliaire désigne une forme d'éruption cutanée se présentant sous la forme de petits grains blancs jaunâtres, de la taille d'une tête d'épingle, siégeant le plus souvent sur le visage et notamment sur le pourtour du nez. Ces grains de milium correspondent à des petits amas de cellules sébacées suite à l'obstruction des canaux. Sans gravité, ils disparaissent spontanément chez les enfants au bout de quelques semaines ou mois. Cet aspect est fréquent chez le nouveau-né et les enfants. Ils peuvent également se rencontrer à l'adolescence ou à l'âge adulte."},{"page_url":"https://de.wikipedia.org/wiki/Alexander_T%C3%B6r%C3%B6k_von_Szendr%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Albrecht_Adam_-_Schlacht_bei_Novara.jpg","page_title":"Alexander Török von Szendrő","context_page_description":"Alexander Török Graf von Szendrő war ein k. k. wirklicher Kämmerer sowie Divisionär und Feldmarschallleutnant."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%AD%90%E9%99%BD%E5%8A%8D%E8%8F%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%E7%B6%A0%E5%B3%B6%E4%BA%BA%E6%AC%8A%E6%96%87%E5%8C%96%E5%9C%92%E5%8D%80%E6%96%B0%E7%94%9F%E8%A8%93%E5%B0%8E%E8%99%95%E7%AC%AC%E4%B8%89%E5%A4%A7%E9%9A%8A%E5%B1%95%E7%A4%BA%E5%8D%80%E7%9A%84%E9%83%A8%E5%88%86%E5%9B%9A%E7%8A%AF%E7%85%A7%E7%89%872.jpg","page_title":"歐陽劍華","context_page_description":"欧阳剑华，福建福州人，书画家、台湾白色恐怖时期受难者，因为言论而入狱多年，出狱后画有许多政治犯被刑求的画作。"},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%AA_t%C3%AA_Java","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/T%C3%AA_t%C3%AA_Java.JPG","page_title":"Tê tê Java","context_page_description":"Tê tê Java, danh pháp hai phần: Manis javanica, còn gọi là trút Java là loài động vật có vú thuộc Bộ Tê tê với bản địa Đông Nam Á bao gồm Thái Lan, Indonesia, Philippines, Việt Nam, Lào, Campuchia, Malaysia và Singapore.\\nTại Việt Nam, tê tê Java sinh sống ở miền Nam trở ra đến vùng Quảng Nam."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E4%BA%AC%E8%A5%BF%E8%B7%AF1418%E5%8F%B7%E9%83%AD%E6%B0%8F%E5%85%84%E5%BC%9F%E6%A5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/201907_1418_Nanjing_Road_West.jpg","page_title":"南京西路1418号郭氏兄弟楼","context_page_description":"南京西路1418号郭氏兄弟楼是位于上海市静安区南京西路1400-1418号的两幢历史建筑，原为郭沛勋家族的成员，永安百货的创办人，上海永安公司老板郭乐和上海永安纺织公司经理郭顺兄弟的住宅，建于1926年。现为上海市人民政府外事办公室。\\n郭氏兄弟楼位于上海公共租界西区的主干道静安寺路1400-1418号，西侧毗邻哈同路，静安寺路对面是英国籍犹太地产大亨哈同的豪宅，著名的爱俪园，西侧不远处是华人地产大王程霖生的产业--南京西路1522弄住宅，以及静安寺路1550号的程霖生公馆。郭氏兄弟楼由公和洋行设计，陶桂记营造厂承建。采用法国文艺复兴风格，立面三层分别采用塔式干、爱奥尼和科林斯三种柱式，天花板饰有彩绘。花园占地广阔，设有雕塑喷泉。\\n1994年，该建筑列为第二批上海市优秀历史建筑。2014年4月4日， 南京西路1400－1418号住宅被列为第八批上海市文物保护单位。"},{"page_url":"https://de.wikipedia.org/wiki/Marcillac-Vallon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Marcillac_13.JPG","page_title":"Marcillac-Vallon","context_page_description":"Marcillac-Vallon ist eine französische Gemeinde im Département Aveyron in der Region Okzitanien mit 1.683 Einwohnern. Die Gemeinde gehört zum Arrondissement Rodez und zum Kanton Vallon. Die Einwohner werden Marcillacois genannt."},{"page_url":"https://pl.wikipedia.org/wiki/Uniwersytet_Aleksandra_Jana_Cuzy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Ia%C5%9Fi_%2C_%22Alexandru_Ioan_Cuza%22_University_3.JPG","page_title":"Uniwersytet Aleksandra Jana Cuzy","context_page_description":"Uniwersytet Aleksandra Jana Cuzy – rumuńska publiczna uczelnia wyższa, zlokalizowana w Jassach.\\nUczelnia została założona przez księcia Aleksandra Jana Cuzę po doprowadzeniu przez niego do zjednoczenia Mołdawii i Wołoszczyzny. Uniwersytet składał się z czterech wydziałów: Wydziału Filozofii i Literatury, Wydziału Prawa, Wydziału Nauk Ścisłych i Wydziału Medycznego.\\nW październiku 1897 roku oddano do użytku nową siedzibę uczelni. Budynek został zaprojektowany przez rumuńskiego architekta Louisa Blanca w stylu stanowiącym kombinację klasycyzmu i baroku. W uroczystym otwarciu wzięli udział król Karol I oraz jego żona królowa Elżbieta.\\nW 1937 roku Wydział Nauk Ścisłych został przekształcony w Szkołę Politechniczną, w 1993 przemianowaną na Uniwersytet Techniczny Gheorghe Asachi w Jassach. W 1948 roku Wydział Medyczny został przekształcony w Instytut Medycyny i Farmacji, z którego w 1991 roku powstał Uniwersytet Medycyny i Farmacji Grigore T. Popa.\\nW 1968 roku uczelnia składała się z ośmiu wydziałów:\\nWydział Matematyki i Mechaniki\\nWydział Fizyki\\nWydział Chemii\\nWydział Biologii i Geografii\\nWydział Prawa\\nWydział Historii i Filozofii\\nWydział Ekonomiczny"},{"page_url":"https://hu.wikipedia.org/wiki/J%C3%BAlia-borbolya","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Berberis_julianae_E.jpg","page_title":"Júlia-borbolya","context_page_description":"A Júlia-borbolya a boglárkavirágúak rendjébe sorolt borbolyafélék családjában a névadó borbolya nemzetség egyik faja."},{"page_url":"https://it.wikipedia.org/wiki/Acquedotti_di_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/I_Fontanoni_dell%27acqua_Paola.jpg","page_title":"Acquedotti di Roma","context_page_description":"Gli acquedotti di Roma sono gli acquedotti che, a partire dall'età romana, rifornivano o tuttora riforniscono di acqua la città di Roma, per un totale di 16: 11 antichi e 5 moderni."},{"page_url":"https://sv.wikipedia.org/wiki/Ruellia_brevifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Starr_010728-9001_Ruellia_brevifolia.jpg","page_title":"Ruellia brevifolia","context_page_description":"Ruellia brevifolia är en akantusväxtart som först beskrevs av Johann Baptist Emanuel Pohl, och fick sitt nu gällande namn av C. Ezcurra. Ruellia brevifolia ingår i släktet Ruellia och familjen akantusväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%BF%D0%B8%D1%80%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87,_%D0%9C%D1%8D%D1%82%D1%82%D1%8C%D1%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Matthew_%C5%A0piranovi%C4%87.jpg","page_title":"Шпиранович, Мэттью","context_page_description":"Мэ́ттью То́мас Шпира́нович — англо-австралийский футболист хорватского происхождения, защитник клуба «Ханчжоу Гринтаун» и сборной Австралии. Участник Олимпиады-2008 в Пекине."},{"page_url":"https://hu.wikipedia.org/wiki/Rebecq","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Rebecq_050813_%284%29.jpg","page_title":"Rebecq","context_page_description":"Rebecq város és azonos nevű járás a vallóniai Vallon-Brabant tartományban, Nivelles körzetben található. A városnak 10 241 lakosa van, területe 39.08 km², népsűrűsége 262 fő/km².\\nA város a francia kulturális közösséghez tartozik, lakosainak anyanyelve a francia. A járáshoz tartozó területen található Bierghes település lakosai flamand nyelvűek.\\nA város Brüsszeltől délnyugatra, mintegy 27 kilométerre található a Senne-folyó völgyében, Vallónia hegyes-völgyes, vidékies részén.\\nA járás 1977-ben alakult meg, amikor számos környező települést egy közigazgatási egységbe vontak össze. A járás mai részei Rebecq-Rognon, Quenast és Bierghes. Ebben az időpontban a szomszédos Wisbecq falu területének egy részét Bierghes-hez csatolták."},{"page_url":"https://pt.wikipedia.org/wiki/Maria_Ondina_Braga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Maria_Ondina_Braga.JPG","page_title":"Maria Ondina Braga","context_page_description":"Maria Ondina Braga, foi uma escritora e tradutora portuguesa."},{"page_url":"https://fr.wikipedia.org/wiki/Wat_Arun","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Wat_Arun_temple_Photo_D_Ramey_Logan.jpg","page_title":"Wat Arun","context_page_description":"Le Wat Arun est un temple bouddhiste de Bangkok, Thaïlande.\\nLe temple est situé dans le quartier de Bangkok Yai, sur la rive droite du fleuve Chao Phraya. Son nom complet est Wat Arunratchawararam Ratchaworamahavihara.\\nLe temple doit son nom au dieu Hindou Aruna, symbole de l'aurore."},{"page_url":"https://sk.wikipedia.org/wiki/Pot%C3%A1plica_bielozob%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Yellow-billed_Loon.jpg","page_title":"Potáplica bielozobá","context_page_description":"Potáplica bielozobá je stredne veľký druh potáplice. Obýva holarktídu. Na Slovensku bola zistená do roku 1999 iba dva krát, na rieke Orave v roku 1884 a na rieke Dunaj v roku 1997 od 8. januára do 13. februára. V zozname vzácnych ornitologických pozorovaní podliehajúcich hláseniu Faunistickej komisii nie sú žiadne novšie záznamy\\nPodľa Medzinárodnej únie na ochranu prírody a prírodných zdrojov potáplica bielozobá patrí medzi takmer ohrozené druhy, trend celkovej populácie je klesajúci, chýbajú cielené prieskumy ale na základe sčítaní na zimoviskách v Beringovom mori a vychádzajúc z informácií o zmenšení ich areálu výskytu v Rusku sa predpokladá rýchlosť poklesu stavov o 1 – 19% za obdobie troch generácií. Tento predpoklad je potrebné doložiť cieleným prieskumom."},{"page_url":"https://gl.wikipedia.org/wiki/Crocodilo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Crocodylus_cataphractus_faux-gavial_d%27Afrique2_white_background.JPG","page_title":"Crocodilo","context_page_description":"Crocodilo pode ser calquera das 13 ou 14 especies existentes dos réptiles da familia Crocodylidae. O termo tamén é usado ás veces sensu lato para incluír todos os membros da orde Crocodilia. Discútese se o xénero Tomistoma pertence a Crododylidae ou a Gavialidae. O maior réptil hoxe na face da terra que pertence a esta familia é o crocodilo de auga salgada, que se encontra desde a India a Australia.\\nAs diferenzas externas máis obvias entre os crocodilos e os aligátores son visibles na cabeza. Os crocodilos teñen cabezas máis estreitas e máis longas, e os morros teñen máis forma de V que de U. A mandíbula superior do aligátor é máis ancha que a inferior, e os dentes da mandíbula inferior encaixan en pequenas depresións da mandíbula superior. As mandíbulas superior e inferior dos crocodilos son da mesma anchura, e os dentes da mandíbula inferior quedan ao bordo ou pola parte externa da mandíbula superior cando pechan a boca. Nos crocodilos, cando pechan a boca o longo cuarto dente da mandíbula inferior encaixa nunha amosega da parte externa da mandíbula superior, polo que é moi visible."},{"page_url":"https://es.wikipedia.org/wiki/Centro_de_Estudios_Joan_Bardina","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Mesa-libros-A.jpg","page_title":"Centro de Estudios Joan Bardina","context_page_description":"El Centro de Estudios Joan Bardina es una asociación creada el 25 de octubre de 1984 por Agustí Chalaux, Lluís Maria Xirinacs, Magadalena Grau Figueras, ​ Joan Parés Grahit, ​ Miquel Chicano i Colodrero, ​ Martí Olivella Solé​​ y otras varias personas, tomando el nombre del pedagogo catalán Joan Bardina i Castarà."},{"page_url":"https://nl.wikipedia.org/wiki/Arabische_goudvleugelvink","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Rhynchostruthus_percivali_from_RhynchostruthusRiebeckiSmit.jpg","page_title":"Arabische goudvleugelvink","context_page_description":"De Arabische goudvleugelvink is een zangvogel uit de familie Fringillidae."},{"page_url":"https://cs.wikipedia.org/wiki/Suchoj_Su-7","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Su-7-JH01.jpg","page_title":"Suchoj Su-7","context_page_description":"Suchoj Su-7 byl sovětský proudový taktický bombardér, který vznikl v padesátých letech 20. století. První prototyp vzlétl roku 1955 a letoun se začal sériově vyrábět od roku 1957. Původně byl zamýšlen jako taktický stroj určený pro manévrový vzdušný souboj, ale v této roli se neujal. Na druhou stranu se brzy objevila verze Su-7B, která se v 60. letech stala hlavním sovětským stíhacím bombardérem a útočným letounem. Su-7 byl ve své jednoduchosti robustní, ale mezi jeho nedostatky patřily krátký dolet a slabší výzbroj. Bylo počítáno s tím, že tento stroj bude schopný provádět jaderné útoky a že budou muset operovat z nezpevněných vzletových ploch. Proto byl podvozek vybaven koly s nízkotlakými pneumatikami a doplněn hydraulicky vysouvatelnými ližinami.\\nLetouny Suchoj Su-7 byly i ve výzbroji Československé lidové armády."},{"page_url":"https://eo.wikipedia.org/wiki/Distrikto_Bad_D%C3%BCrkheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Bad_D%C3%BCrkheimer_Kurhaus_und_Kurpark_21-04-2005_cropped.jpg","page_title":"Distrikto Bad Dürkheim","context_page_description":"La distrikto Bad Dürkheim [Bad Dujrkhajm] situas en la sudo de la germana federacia lando Rejnlando-Palatinato. Ĝia administra sidejo estas la samnoma urbo Bad Dürkheim.\\nLa Schindhübel estas 571m alta monto meze de la Palatinata Arbaro en la distrikto Bad Dürkheim."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AA%E0%A7%81%E0%A6%9E%E0%A7%8D%E0%A6%9A%E0%A6%BE%E0%A6%95_%E0%A6%9C%E0%A6%BE%E0%A6%AF%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Puncakjaya.jpg","page_title":"পুঞ্চাক জায়া","context_page_description":"পুঞ্চাক জায়া ইন্দোনেশিয়ার সর্বোচ্চ পর্বতশৃঙ্গ। এটি নিউ গিনি দ্বীপের পশ্চিমাংশে পাপুয়া প্রদেশে অবস্থিত। \\"পুঞ্চাক জায়া\\"- অর্থ \\"বিরাট পর্বতশৃঙ্গ\\"। পর্বতটি সুদিরমান পর্বতশ্রেণীর পশ্চিম প্রান্তে অবস্থিত, যেটি আবার মাওকে পর্বতমালার একটি শাখা। পর্বতটি ৪, ৮৮৪ মিটার উঁচু এবং ক্রান্তীয় অঞ্চলে অবস্থিত হলেও এর চূড়া সবসময় বরফাবৃত থাকে। এর আশেপাশের পর্বতশ্রেণী অত্যন্ত রুক্ষ এবং অনেকগুলি উঁচু পর্বতশৃঙ্গের একটি প্রাচীর পুঞ্চাক জায়াকে ঘিরে রেখেছে। তবে দক্ষিণের জলাময় নিম্নভূমি এবং দূরের সাগর থেকে পর্বতটিকে পরিষ্কার দেখতে পাওয়া যায়। পর্বতের কাছেই রয়েছে অনেকগুলি ক্ষুদ্র হিমবাহ। পর্বতটির আশেপাশের অঞ্চল তামাতে সমৃদ্ধ। কাছেই একটি বড় তামার খনি ও খনিসংলগ্ন শহর তেমবাগাপুরা অবস্থিত। পুঞ্চাক জায়া পর্বতটি অতীতে কার্স্টেনস পর্বত নামে পরিচিত ছিল।"},{"page_url":"https://en.wikipedia.org/wiki/Alpine_skiing_at_the_1960_Winter_Olympics_%E2%80%93_Men%27s_downhill","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Squaw-Valley-1960-Ski-Venues.jpg","page_title":"Alpine skiing at the 1960 Winter Olympics – Men's downhill","context_page_description":"The Men's downhill competition of the 1960 Winter Olympics was held at Squaw Valley on Monday, February 22. The race was postponed from February 19 because of heavy snow fall.\\nThe race was run on Squaw Peak, with a starting elevation of 2,707 m above sea level; the course length was 3.095 km, with a vertical drop of 758 m.\\nThe defending world champion was Toni Sailer of Austria, who did not compete.\\nJean Vuarnet, the bronze medalist at the world championships two years earlier, won by a half-second in the only Olympic event of his career. It was the first time an Olympic race was won on metal skis. Vuarnet's winning time of 126.0 seconds yielded an average speed of 88.429 km/h, with an average vertical descent rate of 6.016 m/s."},{"page_url":"https://en.wikipedia.org/wiki/Eschenau","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/AUT_Eschenau_COA.png","page_title":"Eschenau","context_page_description":"Eschenau is a town in the district of Lilienfeld in the Austrian state of Lower Austria."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%93%D1%80%D1%83%D1%98%D0%B8%D1%9B%D0%B0_%D0%BE%D1%80%D0%B0%D1%85_(%D0%A2%D0%B5%D0%BA%D0%B8%D1%98%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Zapis-0662-Tekija-Grujica-orah_20160623_1148.jpg","page_title":"Запис Грујића орах (Текија)","context_page_description":"Запис Грујића орах (Текија) се налази на парцели чији је власник Грујић Радул."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%D8%A7%D9%85%DA%AF%D8%A7%D9%87_%D8%B4%DB%8C%D8%AE_%DB%8C%D9%88%D8%B3%D9%81_%D8%B3%D8%B1%D9%88%D8%B3%D8%AA%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Tomb_of_Sheikh_Yoosof_Sarvestani5.jpg","page_title":"آرامگاه شیخ یوسف سروستانی","context_page_description":"آرامگاه شیخ یوسف سروستانی یکی از بقعه‌های تاریخی شهر سروستان درشهرستان سروستان و استان فارس است. در این بنا بقعهٔ «شیخ یوسف سروستانی» و «محمد بن حسن‌علی البیظاوی» قرار گرفته‌است."},{"page_url":"https://cs.wikipedia.org/wiki/North_Carolina_Film_Critics_Association_Award_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Gary_Oldman_%2813925515511%29_%28cropped%29.jpg","page_title":"North Carolina Film Critics Association Award 2017","context_page_description":"6. ročník předávání cen asociace North Carolina Film Critics Association se konal dne 2. ledna 2018. Nominace byly oznámeny dne 26. prosince 2017."},{"page_url":"https://la.wikipedia.org/wiki/Basilius_Deg%C3%B3rski","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/CasimirandBasil.jpg","page_title":"Basilius Degórski","context_page_description":"Basilius Degórski est presbyter Catholicus, necnon hieromonachus ritus byzantini, hieromonachus Ordinis S. Pauli Primi Eremitae.\\nNomen monasticum vulgo: \\"Bazyli\\"; nomina polonica in baptismate ei data: Remigiusz Stefan [Latine: Remigius Stephanus]."},{"page_url":"https://en.wikipedia.org/wiki/Palais_des_papes_of_Sorgues","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Palais_des_papes_de_Sorgues_Laincel_1.jpg","page_title":"Palais des papes of Sorgues","context_page_description":"The Palais des papes of Sorgues is the first papal residence built by Avignon Papacy to XIVth siecle. Its construction was ordered by John XXII and preceded in 18 years to the Palais des papes. This luxurious residence had served as a model for the construction of residences of cardinals in Avignon. It remains today as ruins, because the palace was dismantled during the French Revolution by the builders that the town of Sorgues had sold."},{"page_url":"https://en.wikipedia.org/wiki/Malvern_St_James","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Malvern_St_James.jpg","page_title":"Malvern St James","context_page_description":"Malvern St James is an independent school for girls in Great Malvern, Worcestershire, England. Founded in 1893 as Malvern Girls' College, it was renamed Malvern St James following a merger in 2006 with St James' School in West Malvern. It continues to occupy the same campus as the former college, which includes as its main building the former Imperial Hotel, taken over for use as a school by Malvern Girls' College in 1919.\\nThe school comprises three sections: a Prep Department for girls aged 4–11, a Senior School for girls aged 11–18, and a Sixth Form."},{"page_url":"https://fr.wikipedia.org/wiki/Brooks_Orpik","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Brooks_Orpik_2018-02-04_1.jpg","page_title":"Brooks Orpik","context_page_description":"Brooks Orpik est un joueur professionnel américain de hockey sur glace évoluant au poste de défenseur. Il joue au niveau universitaire avec les Eagles de Boston College et il remporte le titre du championnat universitaire américain en 2001. Il est un choix de premier tour des Penguins de Pittsburgh lors du repêchage d'entrée de la Ligue nationale de hockey en 2000.\\nEn 2008-2009, il fait partie de l'équipe des Penguins de Pittsburgh qui remporte la Coupe Stanley dans la Ligue nationale de hockey. Quelques mois plus tard, il remporte avec l'Équipe des États-Unis la médaille d'argent aux Jeux olympiques d'hiver. Il demeure avec les Penguins jusqu'à la fin de la saison 2013-2014 où il rejoint les Capitals de Washington."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Laval","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Lambris_grande_salle_Vieux-Ch%C3%A2teau_Laval.jpg","page_title":"Château de Laval","context_page_description":"Le château de Laval est un château situé à Laval, dans le département français de la Mayenne. Sa fondation au XIᵉ siècle a permis la naissance de la ville. Monument emblématique de Laval, il occupe un promontoire rocheux au-dessus de la rivière Mayenne. Il est composé de deux ensembles distincts : le Vieux-Château, qui correspond au château-fort médiéval, et le Château-Neuf, galerie de la Renaissance transformée en palais de justice au XIXᵉ siècle. Ces deux monuments figurent sur la liste des 1 034 premiers monuments historiques français classés en 1840.\\nL'histoire du château de Laval est intimement liée à celle de la maison de Laval, apparue avec Guy Iᵉʳ, fondateur du château. Le monument témoigne des multiples alliances contractées par cette famille, ainsi que de sa puissance qui croît du XIᵉ siècle jusqu'à sa disparition à la fin de la Renaissance. Le Vieux-Château est remarquable pour sa chapelle du XIIᵉ siècle ainsi que pour son imposante tour maîtresse, coiffée d'un hourd en bois du XIIIᵉ siècle, exemple exceptionnel d'architecture militaire du Moyen Âge."},{"page_url":"https://it.wikipedia.org/wiki/Azeglio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Carnevale_in_piazza.jpg","page_title":"Azeglio","context_page_description":"Azeglio è un comune italiano di 1 258 abitanti della città metropolitana di Torino, in Piemonte. Adagiato nell'estremo lembo nord-orientale del Canavese, dista ben 53 chilometri a nord-est dal capoluogo e a soli 3 km a ovest dal Lago di Viverone, al confine con la Provincia di Biella.\\nLo studioso Giandomenico Serra sostenne che l'etimologia del toponimo derivasse da in agellis, ovvero \\"nei campicelli\\", ipotesi che risale a tracce evidenti di centuriazione romana. Altri, più aderenti alla tradizione, ritengono che il nome derivi da asylum, una particolare colonia penitenziaria risalente agli antichi romani."},{"page_url":"https://it.wikipedia.org/wiki/James_Hanson_(rugbista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/JAMES_HANSON_1.jpg","page_title":"James Hanson (rugbista)","context_page_description":"James Hanson è un rugbista a 15 australiano che gioca come tallonatore per Gloucester in English Premiership."},{"page_url":"https://pt.wikipedia.org/wiki/Francesca_Caccini","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Francesca_Caccini.jpg","page_title":"Francesca Caccini","context_page_description":"Francesca Caccini foi uma compositora, cantora, lutenista, poetisa e professora de música italiana do início do período Barroco. Ela também era conhecida pelo apelido de \\"La Cecchina\\", dado a ela pelos Florentinos e, provavelmente, um diminutivo de \\"Francesca\\". Ela era filha de Giulio Caccini. Sua única ópera sobrevivente é La liberazione di Ruggiero."},{"page_url":"https://en.wikipedia.org/wiki/2009_Guinea-Bissau_presidential_election","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Malam_Bacai_Sanh%C3%A1.jpg","page_title":"2009 Guinea-Bissau presidential election","context_page_description":"Presidential elections were held in Guinea-Bissau on 28 June 2009 following the assassination of President João Bernardo Vieira on 2 March 2009. As no candidate won a majority in the first round, a second round was held on 26 July 2009 between the two leading candidates, Malam Bacai Sanhá of the governing African Party for the Independence of Guinea and Cape Verde and opposition leader Kumba Ialá. Sanhá won with a substantial majority in the second round, according to official results."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%B4%D0%B4,_%D0%9A%D0%BB%D1%8D%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/CredDoddFootlightParade33Trailer.jpg","page_title":"Додд, Клэр","context_page_description":"Клэр Додд — американская киноактриса."},{"page_url":"https://eu.wikipedia.org/wiki/Qajar_dinastia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Map_Iran_1900-en.png","page_title":"Qajar dinastia","context_page_description":"Qajar dinastia Azerbaijandar jatorriko leinu turkiar musulmanak Persia gobernatu zuen XVIII. mendearen amaieratik XX. mendearen hasiera arte. 1789an ez ofizialki eta 1796an ofizialki koroatua izan zen Aqa Muhammad Khan, Qajar dinastiako lehen xah, Afxarid dinastiako azken monarkari tronua kendu ondoren. Halaber, 1925an Irango parlamentuak eraginda, Pahlavi dinastiak ordezkatu zuen agintean."},{"page_url":"https://de.wikipedia.org/wiki/Annemieke_van_Dam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Annemieke_van_Dam.jpg","page_title":"Annemieke van Dam","context_page_description":"Annemieke van Dam ist eine niederländische Musicaldarstellerin, die seit 2005 im deutschsprachigen Raum tätig ist."},{"page_url":"https://fr.wikipedia.org/wiki/Libellula_forensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/North_America_Range_Libellula_forensis.svg","page_title":"Libellula forensis","context_page_description":"Libellula forensis est une espèce de libellules de la famille des Libellulidae appartenant à l'ordre des odonates. Elle est appelée Eight-spotted Skimmer par les anglophones pour les huit points noirs de ses ailes, ce qui la différencie de Libellula pulchella ayant trois taches noires sur chaque aile."},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D0%B0%D1%80%D1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Dar%C3%A8.jpg","page_title":"Дарэ","context_page_description":"Дарэ — камуна ў Італіі, размяшчаецца ў рэгіёне Трэнціна — Альта-Адыджэ, падпарадкоўваецца адміністрацыйнаму цэнтру Трэнта.\\nНасельніцтва складае 234 чалавек, шчыльнасць насельніцтва складае 234 чал./км². Займае плошчу 1 км². Паштовы індэкс — 38080. Тэлефонны код — 0465.\\nЗаступнікам населенага пункта лічыцца святы."},{"page_url":"https://fr.wikipedia.org/wiki/Verrerie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Venezia%2C_coppa_barovier%2C_in_vetro_blu_dipinto_a_smalti%2C_con_busti_maschile_e_famminile_tra_cavalcata_e_bagno_alla_fonte_dell%27amore_e_giovinezza%2C_1460_ca._07.jpg","page_title":"Verrerie","context_page_description":"La verrerie est l’art de la fabrication du verre et désigne aussi l’atelier du verrier.\\nDepuis l’Égypte ancienne, le verre fascine par ses propriétés étranges. Translucide ou transparent, il se travaille au feu, un peu comme un métal. Fragile, il est aussi très dur une fois figé dans la forme qu’on lui a donnée."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%90%E5%8A%A8%E5%85%AC%E5%9B%AD%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/YUNDONG_GONGYUAN_sta.JPG","page_title":"运动公园站","context_page_description":"运动公园站位于西安市未央区，是西安地铁2号线的一个车站。"},{"page_url":"https://lt.wikipedia.org/wiki/Fuku%C5%A1ima","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Fukushima_City_with_a_view_of_Fukushima_Station.jpg","page_title":"Fukušima","context_page_description":"Fukušima – miestas Fukušimos prefektūroje, Japonijoje. Prefektūros administracinis centras. Čia gyvena apie 289 tūkst. gyventojų.\\nMiestas įkurtas 1907 m. balandžio 1 d."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B5%86%E0%B5%BD_%E0%B4%93%E0%B4%AB%E0%B5%8D_%E0%B4%B8%E0%B4%BE%E0%B4%99%E0%B5%8D%E0%B4%B5%E0%B5%8B%E0%B5%BB%E0%B4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%EC%83%81%EC%9B%90%EC%82%AC%EB%8F%99%EC%A2%85_02.jpg","page_title":"ബെൽ ഓഫ് സാങ്വോൻസ","context_page_description":"ബെൽ ഓഫ് സാങ്വോൻസ ദക്ഷിണ കൊറിയയുടെ ദേശീയ നിധിയായിട്ടാണ് ഈ വെങ്കല മണി # 36 കാണപ്പെടുന്നത്. ഗാങ്വൺ പ്രവിശ്യയിലെ പായോങ്ചാങ്ങ് കൗണ്ടിയിലെ സാങ്വോൻസ ക്ഷേത്രത്തിലാണ് ഇത് സ്ഥിതി ചെയ്യുന്നത്."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%B0%D0%BB%D0%B5%D0%BD%D0%BE%D0%BF%D1%81%D0%B8%D1%81_%D0%B0%D0%BC%D0%B1%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Phalaenopsis_amboinensis_Orchi_169.jpg","page_title":"Фаленопсис амбонський","context_page_description":"Фалено́псис амбо́нський - епіфітна трав'яниста рослина родини орхідних.\\nВид не має усталеної української назви, в українськомовних джерелах зазвичай використовується наукова назва Phalaenopsis amboinensis."},{"page_url":"https://en.wikipedia.org/wiki/List_of_predecessors_of_sovereign_states_in_Europe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Estandarte_de_la_Corona_de_Aragon.png","page_title":"List of predecessors of sovereign states in Europe","context_page_description":"This is a list of all present sovereign states in Europe and their predecessors. The borders of Europe are difficult to define. The borders between Europe and Asia are generally agreed to be the Caucasus Mountains, the Ural Mountains, the Bosphorus and the Dardanelles."},{"page_url":"https://ru.wikipedia.org/wiki/Gang_of_Four","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Gang_of_Four_in_Bergen.jpg","page_title":"Gang of Four","context_page_description":"Gang Of Four — британская рок-группа, образовавшаяся в 1977 году в Лидсе, Англия, и исполнявшая политизированный панк-рок, насыщенный элементами фанка, даба и регги. Характерными особенностями раннего стиля группы были сдержанно-агрессивный речитатив Джона Кинга, отрывистые, взрывные гитарные партии Энди Гилла и мощная работа ритм-секции, придававшая даже самым жёстким, шумовым трекам танцевальный привкус. Многие группы 1980-х годов переняли внешние атрибуты стиля ранних GO4; их основными последователями считаются Franz Ferdinand, Rage Against The Machine, Minutemen и Fugazi, по-своему развившие музыкальные, эстетические и интеллектуальные идеи британской группы. После распада в 1984 году Gang Of Four воссоединялись трижды; последний раз — в 2005 году, когда был выпущен Return the Gift."},{"page_url":"https://fi.wikipedia.org/wiki/Bijelo_Dugme","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Bijelo_dugme.png","page_title":"Bijelo Dugme","context_page_description":"Bijelo Dugme oli jugoslavialainen rockyhtye. Sarajevosta kotoisin ollut yhtye julkaisi yhdeksän albumia ja toimi vuosina 1974–1989."},{"page_url":"https://et.wikipedia.org/wiki/M%C3%B5lajas_leht","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Corn_salad%2C_spring%2C_close_up.JPG","page_title":"Mõlajas leht","context_page_description":"Mõlajas leht on leht, mille laba kõige laiem koht on tipu ligidal ja mis aluse poole järsult aheneb."},{"page_url":"https://ca.wikipedia.org/wiki/Art_cristi%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Cristo_crucificado.jpg","page_title":"Art cristià","context_page_description":"L'art cristià és l'art religiós del cristianisme, les obres d'art inspirades per sentiments religiosos cristians, o creades per il·lustrar, suplementar i representar en una forma tangible el missatge cristià.\\nEn ser el cristianisme la religió dominant en la civilització occidental des del segle iv, l'art cristià s'identifica amb la major part de les produccions artístiques de l'edat mitjana a Europa i va seguir sent molt important durant tota l'Edat Moderna, a més d'estendre's geogràficament. La secularització de la societat ha restringit a l'art cristià dins dels principals corrents artístics de l'Edat Contemporània.\\nCom art sacre, el fi essencial que té l'art cristià pels creients és el culte. Edificis, imatges i objectes litúrgics es consagren, amb el qual deixen de ser simples obres d'art. Des del cristianisme primitiu, i sobretot a l'edat mitjana, els temples i monestirs s'identificaven amb les relíquies dels sants i màrtirés que contenien i que els denominaven."},{"page_url":"https://gl.wikipedia.org/wiki/26%C2%AA_edici%C3%B3n_dos_%C3%93scar","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Fred_Zinnemann_1940s.jpg","page_title":"26ª edición dos Óscar","context_page_description":"A 26.ª entrega dos premios Óscar tivo lugar o día 25 de marzo de 1954 no RKO Pantages Theatre dos Ánxeles e no NBC Century Theatre de Nova York. Os mestres de cerimonias foron Donald O’Connor nos Ánxeles e Fredric March en Nova York."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AA%D9%86%D8%B2%D9%87_%D8%BA%D8%B1%D8%A7%D9%86%D8%AF_%D8%AA%D9%8A%D8%AA%D9%88%D9%86_%D8%A7%D9%84%D9%88%D8%B7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Oxbow_Bend_outlook_in_the_Grand_Teton_National_Park.jpg","page_title":"متنزه غراند تيتون الوطني","context_page_description":"متنزه غراند تيتون الوطني هو متنزه وطني بالولايات المتحدة، يقع في شمال غرب ولاية وايومنغ. تبلغ مساحة المتنزّه نحو 130,000 هكتار، وتقع ضمن حدوده القمم العالية لسلسلة جبال تيتون البالغ طولها 64 كيلومتراً، بالإضافة إلى أغلب الأجزاء الشمالية من وادي هوة جاكسون. يقع متنزه غراند تيتون على مسافة 16 كيلومتراً فحسب جنوب متنزه يلوستون الوطني، وهما موحَّدان إدارياً تحت إدارة المتنزهات الوطنية، حيث يتولَّى إدارتهما جون باركوي. وعندما تلحق بها الغابات الوطنية المجاورة، تصبح مساحة هذه المحميات الثلاث معاً نحو 7,300,000 هكتار، لتشكل نظام يلوستون الكبير البيئي، وهو أحد أكبر الأنظمة البيئية المعتدلة التي لا زالت سليمةً في العالم.\\nيعود تاريخ الاستيطان البشري في منطقة حديقة غراند تيتون الوطنية إلى ما لا يقلّ عن 11,000 عام، عندما وصل أوائل الهنود قبل التاريخيّين البدو الصيَّادين، وأخذوا يهاجرون إلى المنطقة في الشهور الحارَّة سعياً وراء الطعام والغذاء. خلال القرن التاسع عشر وصل الأوروبيون إلى المنطقة وبدؤوا الاحتكاك مع السكان الأصليّين من قومية الشوشون. وسرعان أصبحت المنطقة بؤرةً لتجارة الفرو بين عامي 1810 و1840، حيث تهافتت إليها شركات الفرو وتنافست للسيطرة على تجارة جلود الدببة بالمنطقة."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%86%A0%E6%81%90%E9%B3%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Gastornis.jpg","page_title":"冠恐鳥","context_page_description":"冠恐鳥，又名加斯頓鳥或戈氏鳥，是一屬已滅絕及不懂飛行的大型鳥類，生存於古新世晚期至始新世。\\n冠恐鳥的學名是以其發現者賈斯頓·普蘭特來命名，其首個化石於1855年在德國的蓋塞特發現。於1876年，愛德華·德林克·科普在北美洲發現另一組化石，並取名為不飛鳥。牠們是極接近的近親，學者現時相信牠們是屬於同一類。"},{"page_url":"https://it.wikipedia.org/wiki/Venterol_(Alpi_dell%27Alta_Provenza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Venterol_%28Alpes-de-Haute-Provence%29%2C_le_ch%C3%A2teau_et_l%27%C3%A9glise.jpg","page_title":"Venterol (Alpi dell'Alta Provenza)","context_page_description":"Venterol è un comune francese di 253 abitanti situato nel dipartimento delle Alpi dell'Alta Provenza nella regione della Provenza-Alpi-Costa Azzurra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%B7%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%B7%D0%BD%D0%B0%D0%BA%D0%B8_%D1%80%D0%B0%D0%B7%D0%BB%D0%B8%D1%87%D0%B8%D1%8F_%D0%B2_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8_%D0%A1%D0%A1%D0%A1%D0%A0_1943%E2%80%941955","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/1943tech-pf15.png","page_title":"Воинские звания и знаки различия в армии СССР 1943—1955","context_page_description":"С учётом возрастающего количества артиллерийских, авиационных, танковых соединений, а также других видов технических войск, для высшего командного состава этих войск вводятся дополнительные воинские звания\\nв январе 1943 года:\\nмаршал авиации,\\nмаршал артиллерии,\\nмаршал бронетанковых войск;\\nв октябре 1943 года:\\nглавный маршал авиации,\\nглавный маршал артиллерии,\\nглавный маршал бронетанковых войск,\\nмаршал войск связи,\\nглавный маршал войск связи,\\nмаршал инженерных войск и\\nглавный маршал инженерных войск."},{"page_url":"https://en.wikipedia.org/wiki/Yamam","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/YAMAM-Israel-CT-unit-0052.jpg","page_title":"Yamam","context_page_description":"The Yamam in English, is an Israeli counter-terrorism unit, one of four special units of the Israel Border Police. The Yamam is capable of both hostage-rescue operations and offensive take-over raids against targets in civilian areas. Besides military duties, it also performs SWAT duties and undercover police work."},{"page_url":"https://en.wikipedia.org/wiki/Pompeia_Plotina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Plotina_-_sestertius_-_RIC_0740.jpg","page_title":"Pompeia Plotina","context_page_description":"Pompeia Plotina Claudia Phoebe Piso, or simply Pompeia Plotina was a Roman Empress and wife of Roman Emperor Trajan. She was renowned for her interest in philosophy, and her virtue, dignity and simplicity. She was particularly devoted to the Epicurean philosophical school in Athens, Greece. She is often viewed as having provided Romans with fairer taxation, improved education, assisted the poor, and created tolerance in Roman society."},{"page_url":"https://en.wikipedia.org/wiki/Rheinmetall_KZO","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rheinmetall_KZO_-_ILA_2010_%282%29.jpg","page_title":"Rheinmetall KZO","context_page_description":"KZO is an unmanned aerial vehicle with stealth characteristics manufactured by Airbus Defence and Space Airborne Solutions GmbH of Germany. Airbus Defence and Space Airborne Solutions GmbH is a joint venture of Airbus Defence and Space and Rheinmetall.\\nA KZO system consists of 10 UAVs and 2 ground units, consisting of one control station, one radio, one launch, one maintenance vehicle with a refuelling facility for the UAVs and one recovery vehicle.\\nThe UAV is launched with a booster rocket directly out of its container. Landing is done with a parachute.\\nThe KZO's main objective is to locate mobile threats and provide target locations for artillery. KZO replaced the German Army's other main UAV, Drohne CL 289.\\nThe Taifun attack drone was a concept of an armed variant fitted with an intelligent millimeter-wave radar seeker that perform search and destroy attacks autonomously. It destroys its target with a hollow-charge warhead. However, the German Army decided against this concept in favor of the IAI Harop.\\nTwo electronic warfare variants have also been developed as the Mücke and the Fledermaus.\\nThe initial system has been sold to China."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%90%E1%83%9C%E1%83%A2%E1%83%90%E1%83%A0%E1%83%9D_(%E1%83%9B%E1%83%93%E1%83%98%E1%83%9C%E1%83%90%E1%83%A0%E1%83%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Rio_Mantaro_511.jpg","page_title":"მანტარო (მდინარე)","context_page_description":"მანტარო - მდინარე სამხრეთ ამერიკაში, პერუში. ენეს მარცხენა შენაკადი. კეჩუას ენაზე მდინარის სახელწოდება ითარგმნება, როგორც „დიდი მდინარე“.\\nუანაკაველიკის რეგიონში მდინარეზე აშენებულია ჰიდროელექტროსადგური, რომელიც გამოიმუშავებს პერუს ელექტოენერგიის 50 %–ს.\\nსიგრძე 724 კმ.\\nაუზის ფართობი 15410 კმ²."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_J%C3%A4mtland_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Fr%C3%B6s%C3%B6n%2C_Sommarhagen.jpg","page_title":"Listed buildings in Jämtland County","context_page_description":"There are 95 listed buildings in Jämtland County."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A1%E0%B8%B2%E0%B8%A3%E0%B8%B5%E0%B9%82%E0%B8%AD_%E0%B8%95%E0%B8%B2%E0%B8%A1%E0%B8%B1%E0%B8%8D%E0%B9%82%E0%B8%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Day_Ananta_Samakhom.jpg","page_title":"มารีโอ ตามัญโญ","context_page_description":"มารีโอ ตามัญโญ เป็นสถาปนิกชาวอิตาลี เกิดที่เมืองตูริน ประเทศอิตาลี เข้ารับราชการในกระทรวงโยธาธิการแห่งประเทศสยามเมื่อปี พ.ศ. 2443 โดยมีสัญญาว่าจ้างเป็นเวลา 25 ปี\\nนายมารีโอ ตามัญโญ มีผลงานออกแบบสถาปัตยกรรมในประเทศไทยที่สำคัญหลายแห่ง ในสมัยรัชกาลที่ 5 ทั้ง สะพานมัฆวานรังสรรค์, พระที่นั่งอนันตสมาคม, วังปารุสกวัน, ท้องพระโรงวังสวนกุหลาบ, สถานีรถไฟกรุงเทพ, บ้านพิษณุโลก, พระตำหนักเมขลารุจี ภายในพระราชวังพญาไท, ตึกไทยคู่ฟ้าทำเนียบรัฐบาล, ห้องสมุดนีลเซนเฮส์ เป็นต้น"},{"page_url":"https://da.wikipedia.org/wiki/Vega%C3%B8erne","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Omn%C3%B8ya.jpg","page_title":"Vegaøerne","context_page_description":"Vegaøerne er en 163 km² stor kommune og øområde langs Helgelandskysten, i Nordland fylke i det nordlige Norge, lidt syd for polarkredsen. Øerne som har ca. 1270 indbyggere, har været beboet siden stenalderen. Øerne har været på UNESCOs verdensarvsliste siden 2004 for at vise hvordan fiskerne/landmændene over 1.500 år har kunnet opretholde et samfund på en unik måde, bl.a. ved indsamling af dun fra edderfugle, hvor de enkelte husstande sørger for faste redepladser til fuglene.\\nHovedøen er den ca. 15 gange 15 km store ø Vega med hovedbyen Gladstad. Her ligger blandt andet rådhuset, Vega Bygdemuseum og Vega kirke, som er en langkirke fra 1864.\\nVegas sydlige del er domineret af det ca. 800 m høje fjeld Trolltinden, den nordlige del er overvejende et moselandskab. Øerne Hysvær og Søla er en del sf det fredede naturområde Hysvær/Søla. Foruden Vega er også øerne Ylvingen og Omnøy beboet. Andre fredede områder er naturreservaterne Eidemsliene og Lånan/Skjærvær. Vegaåøernen består af omkring 6000 øer og skær.\\nFra gammel tid var fiskeri den dominerende næringsgren. Vega er en typisk primærkommune baseret på landbrug og fiskeri. Den vigtigste del af landbrugsproduktionen er mælk og kød."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B5%86%E0%B4%A6%E0%B5%86%E0%B4%B2%E0%B5%8D%E0%B4%AF_%E0%B4%AA%E0%B5%86%E0%B4%9F%E0%B5%8D%E2%80%8C%E0%B4%95%E0%B5%8B%E0%B4%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Nedelya_Petkova.JPG","page_title":"നെദെല്യ പെട്‌കോവ","context_page_description":"ഒരു പ്രമുഖ ബൾഗേറിയൻ വിദ്യാഭ്യസ പ്രവർത്തകയായിരുന്നു നെദെല്യ പെട്‌കോവ ബൾഗേറിയൻ: Неделя Петкова) (1826 - 1894)\\n1859ൽ പെൺകുട്ടികൾക്ക് വിദ്യാഭ്യാസം നൽകാനായി ഒരു പാഠശാല സമ്പ്രദായം ആരംഭിച്ചു. ഓട്ടോമൻ സാമ്രാജ്യത്തിന് ഭാഗമായിരുന്ന ബൾഗേറിയയിൽ ഉടനീളമുള്ള പെൺകുട്ടികൾ വിദ്യാഭ്യാസം നൽകി. നൂറുകണക്കിന് വിദ്യാർഥികൾ ഇവരുടെ ക്ലാസുകളിൽ പങ്കെടുത്തു. ഗ്രാന്റ്മാ നെദെല്യ, ബാബ നെദെല്യ എന്നീ പേരുകളിൽ ഇവർ അറിയപ്പെടുന്നുണ്ട്.\\nബൽകൻ പർവ്വതനിരകളുടെ തെക്ക് ഭാഗത്ത് സ്ഥിതിചെയ്യുന്ന ബൾഗേറിയയിലെ റോസ് വാലിയുടെ പടിഞ്ഞാറൻ ഭാഗത്ത് സ്ഥിതിചെയ്യുന്ന പ്ലോഡിവ് പ്രവിശ്യയിൽപെട്ട സൊപോട് പട്ടണത്തിലുള്ള ഹോളി പ്രസന്റേഷൻ ഓഫ് ബ്ലെസ്ഡ് വേർജിൻ കോൺവെന്റ് സ്‌കൂളിൽ നിന്നാണ് ഇവർ പഠിച്ചത്."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%B0%D1%87%D0%BA%D0%BE%D0%B2%D0%BE_(%D0%92%D0%B6%D0%B5%D1%81%D1%96%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%96%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Pa%C5%82ac_w_Ko%C5%82aczkowie.JPG","page_title":"Колачково (Вжесінський повіт)","context_page_description":"Колачково — село в Польщі, у гміні Колачково Вжесінського повіту Великопольського воєводства.\\nНаселення — 888 осіб.\\nУ 1975-1998 роках село належало до Познанського воєводства."},{"page_url":"https://it.wikipedia.org/wiki/Chatchai_Budprom","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Chatchai_Budprom_20191401.jpg","page_title":"Chatchai Budprom","context_page_description":"Chatchai Budprom è un calciatore tailandese, portiere del Bangkok Glass."},{"page_url":"https://es.wikipedia.org/wiki/Catedral_de_Roskilde","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Roskilde_domkirke_west_fassade.jpg","page_title":"Catedral de Roskilde","context_page_description":"La catedral de Roskilde es una de las atracciones principales de la ciudad de Roskilde, en Dinamarca, con 150.000 visitantes al año. Fue inscrita, junto con su entorno, en la lista del patrimonio mundial en 1995, con los criterios C. Era la iglesia principal de la antigua diócesis de Roskilde antes de la aparición del luteranismo.\\nEsta catedral, de estilo gótico, se construyó en la Edad Media entre el siglo XII y el siglo XIII. Enteramente construida en ladrillo rojo, fue la causa de la propagación de este estilo en el Norte de Europa.\\nAquí tienen sepultura la mayoría de los reyes y reinas de Dinamarca, y fue por esto adaptada a los gustos de los distintos tiempos hasta el siglo XX, mediante ampliaciones laterales menores: porches y capillas. Eso hace de esta catedral un friso cronológico de la evolución de la arquitectura de los edificios cristianos en la Europa del Norte.\\nA partir de 1413, los monarcas daneses se enterraron en esta catedral. En total, hay 20 reyes y 17 reinas, en cuatro diferentes capillas, en el corazón de la catedral, o también en tumbas exteriores.\\nLa catedral de Roskilde fue declarada Patrimonio de la Humanidad por la Unesco en 1995.​"},{"page_url":"https://fr.wikipedia.org/wiki/Salvadora_bairdi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Salvadora_bairdi_5.jpg","page_title":"Salvadora bairdi","context_page_description":"Salvadora bairdi est une espèce de serpents de la famille des Colubridae."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%90%D0%AD%D0%A1_%D0%BC%D0%B8%D1%80%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Kkw_muehleberg.jpg","page_title":"Список АЭС мира","context_page_description":"В 31 стране мира эксплуатируется 190 атомных электростанций с 442 энергоблоком общей электрической мощностью около 391 685 МВт. 53 энергоблока находятся в стадии строительства. 189 энергоблоков закрыты.\\nВ списке приведены в алфавитном порядке все атомные станции мира, разделённые по странам, а также исследовательские центры и другие площадки, на которых располагаются или располагались энергетические реакторы, то есть реакторы, предназначенные для коммерческой выработки электроэнергии. Список включает в себя реакторы действующие, строящиеся и закрытые.\\nВ таблицах списка приведена следующая информация: тип реактора и его модель; статус; годы начала строительства, энергетического пуска и закрытия; электрическая мощность брутто; эксплуатирующая организация, поставщик ядерной паропроизводящей установки и компании, снабжающие реакторы ядерным топливом в виде готовых изделий.\\nСписок основан на данных Международного агентства по атомной энергии и Всемирной ядерной ассоциации. Основные источники приведены в разделах Литература и Ссылки, дополнительные — в разделе Примечания."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8A%E5%B9%B3%E4%BA%95%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Kamihirai-Bridge.jpg","page_title":"上平井橋","context_page_description":"上平井橋は、中川に架かる東京都道450号新荒川葛西堤防線の橋である。右岸 の東京都葛飾区東四つ木一丁目と左岸 の西新小岩三丁目および五丁目の間を結んでいる。現在の橋は、1965年竣工の橋である。"},{"page_url":"https://ast.wikipedia.org/wiki/George_O%27Hara","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/George_O%27Hara_-_January_1921_Fun_Film.jpg","page_title":"George O'Hara","context_page_description":"George O'Hara foi un actor y guionista cinematográficu de nacionalidá estadounidernse, activu principalmente mientres la dómina del cine mudu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_University_of_Manchester_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Ernest_Rutherford2.jpg","page_title":"List of University of Manchester people","context_page_description":"This is a list of University of Manchester people. Many famous or notable people have worked or studied at the Victoria University of Manchester and the University of Manchester Institute of Science and Technology institutions, which combined in 2004 to form the University of Manchester.\\nThe following list includes the names of all 25 Nobel prize laureates among them."},{"page_url":"https://eu.wikipedia.org/wiki/Anton%C3%ADn_Slav%C3%AD%C4%8Dek","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Antonin_Slavicek_-_cervnovy_den_%281898%29.jpg","page_title":"Antonín Slavíček","context_page_description":"Antonín Slavíček Txekiako margolari inpresionista izan zen. Bere lan gehienak paisaiak izan ziren."},{"page_url":"https://zh.wikipedia.org/zh-tw/6-%E7%A3%B7%E9%85%B8%E8%91%A1%E7%B3%96%E9%85%B8%E5%86%85%E9%85%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/6-Phosphogluconolactone-anion-3D-spacefill.png","page_title":"6-磷酸葡糖酸内酯","context_page_description":"6-磷酸葡糖酸內酯是磷酸戊糖途徑中的一種中間代謝產物。\\n這種物質是由葡萄糖-6-磷酸脫氫酶催化葡萄糖-6-磷酸脫氫而產出的。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B0%D0%BD_%D0%9C%D0%B0%D1%83%D0%BD%D1%82%D0%B1%D0%B5%D1%82%D1%82%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/British_Indian_Empire_1909_Imperial_Gazetteer_of_India.jpg","page_title":"План Маунтбеттена","context_page_description":"План Маунтбеттена — план раздела британских колониальных владений на полуострове Индостан. Был предложен последним вице-королём Индии Луисом Маунтбеттеном.\\nПлан был изложен в заявлении британского правительства от 3 июня 1947 года. Впоследствии план Маунтбеттена был утверждён королём Великобритании Георгом VI в качестве закона о независимости Индии.\\nСогласно плану на месте Британской Индии создавалось государство индусов — Индийский Союз и мусульманское государство Пакистан, им обоим предоставлялись права британских доминионов. Часть территорий являлась изначально спорными. Поэтому вопрос о вхождении в одно из создаваемых государств Северо-Западной пограничной провинции и Силхетского округа Ассама решался путём референдума, Синда — путём голосования в его законодательном собрании. Для Пенджаба и Бенгалии вопрос решался путём раздельного голосования в Законодательном собрании депутатов от округов с преобладающим мусульманским населением и депутатами от округов с преобладающим индусским населением. Каждому из индийских княжеств предоставлялось право принять самостоятельное решение о вхождении в одно из новых государств или же право остаться в прежнем статусе."},{"page_url":"https://sh.wikipedia.org/wiki/Brommat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Brommat_-_Mairie.JPG","page_title":"Brommat","context_page_description":"Broma je naselje i opština u južnoj Francuskoj u regionu Središnji-Pirineji, u departmanu Averon koja pripada prefekturi Rodez.\\nPo podacima iz 1999. godine u opštini je živelo 781 stanovnika, a gustina naseljenosti je iznosila 18 stanovnika/km². Opština se prostire na površini od 43,28 km². Nalazi se na srednjoj nadmorskoj visini od 648 metara."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B7%D1%96_%D0%BA%D0%BB%D0%B5%D0%BF%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D1%86%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/We_Can_Do_It%21.jpg","page_title":"Розі клепальниця","context_page_description":"«Розі Клепальниця» – узагальнений образ американської жінки-робітниці часів Другої світової війни, що пішла працювати на військове виробництво задля перемоги над ворогом.\\nВ 1941 році в пропагандистському заохочувальному фільмі було показано заводську клепальницю Розі. Згодом образ підхопили журналісти, музиканти та художники. Найбільш відомою стала картина Нормана Роквелла з конкретною назвою «Розі клепальниця».\\n«Розі клепальниця» стала феміністською іконою і до сьогодні є символом спроможності, витривалості та професіоналізму жінок, надихаючи на подолання гендерних стереотипів про \\"нежіночі\\" професії, посади та заняття."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8D%B0%EB%9D%BC%ED%95%98%EB%9D%BC_%ED%95%98%EC%95%BC%ED%86%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/HAWKS11-TERAHARA.jpg","page_title":"데라하라 하야토","context_page_description":"데라하라 하야토는 일본의 프로 야구 선수이며, 현재 퍼시픽 리그인 후쿠오카 소프트뱅크 호크스의 소속 선수이다."},{"page_url":"https://lb.wikipedia.org/wiki/Peau_de_banane","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Quai_Maurice_Tess%C3%A9_%E2%80%94_Martigues_%28Bouches-du-Rh%C3%B4ne%2C_France%29.JPG","page_title":"Peau de banane","context_page_description":"Peau de banane ass e franséisch-italieenesche Film vum Marcel Ophüls aus dem Joer 1963 no engem Roman vum Charles Williams."},{"page_url":"https://es.wikipedia.org/wiki/Avenida_Abraham_Lincoln","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Abraham_Lincoln.jpg","page_title":"Avenida Abraham Lincoln","context_page_description":"La Avenida Abraham Lincoln es una de las avenidas más importantes del poligono central del Distrito Nacional en la República Dominicana. Esta avenida se ubica entre las Avenida John F. Kennedy y Avenida George Washington. Es una de las más transitadas del país diariamente y atraviesa algunas de las zonas más exclusivas de la ciudad de Santo Domingo."},{"page_url":"https://de.wikipedia.org/wiki/Max_Graham","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/MaxGraham.jpg","page_title":"Max Graham","context_page_description":"Max Graham ist ein britischer Trance-DJ und -Produzent."},{"page_url":"https://de.wikipedia.org/wiki/Berlin-Prenzlauer_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Berlin_C_Legien_Sodtkestr_19.jpg","page_title":"Berlin-Prenzlauer Berg","context_page_description":"Prenzlauer Berg ist ein Ortsteil im Berliner Bezirk Pankow. Von seiner Gründung im Jahr 1920 bis zur Fusion mit den benachbarten Bezirken Weißensee und Pankow bei der Verwaltungsreform 2001 war er ein eigenständiger Bezirk."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A3%E1%83%94%E1%83%9A%E1%83%A1%E1%83%98%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%98%E1%83%9C%E1%83%AA%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Prince_of_Wales%27s_feathers_Badge.svg","page_title":"უელსის პრინცი","context_page_description":"უელსის პრინცი — ტიტული გაერთიანებულ სამეფოში, რომელსაც მეფის/დედოფლის უფროსი ვაჟი და ტახტის პირველი მემკვიდრე ატარებს. დღეს უელსის პრინცის ტიტულს დედოფალ ელისაბედ II-ის უფროსი ვაჟი, პრინცი ჩარლზი ატარებს.\\nროგორც წესი, უელსის პრინცის უფროსი ვაჟი კემბრიჯის ჰერცოგის ტიტულს ატარებს და უელსის პრინცის ტახტზე ასვლის შემდეგ, სწორედ კემბრიჯის ჰერცოგი იღებს ამ ტიტულს.\\nპირველად უელსის პრინცის ტიტული XIII საუკუნეში ჩნდება, როცა უელსი დაპყრობილი ჰყავდათ ნორმანებს."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%80%D0%B1%D0%BE%D0%B2%D0%B8_%D1%80%D0%B5%D1%98%D0%BE%D0%BD%D0%B0_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B5_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Gerb-Teikovo.jpg","page_title":"Грбови рејона Ивановске области","context_page_description":"Грбови рејона Ивановске области обухвата галерију грбова административних јединица руске области — Ивановске области, са статусом градских округа и рејона, те њихове историјске грбове.\\nВећина грбова настала је након успостављања Руске Федерације и Ивановске области, као њеног саставног субјекта."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B6%D0%BD%D0%B5%D0%B4%D0%BD%D0%B5%D1%81%D1%82%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%D0%94%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%BE.jpg","page_title":"Нижнеднестровский национальный природный парк","context_page_description":"Нижнеднестровский национальный природный парк — национальный парк, расположенный на территории Белгород-Днестровского, Беляевского и Овидиопольского районов. Создан 13 ноября 2008 года. Площадь — 21 311,1 га.\\nСеверная часть Днестровского лимана, что в составе парка, имеет статус водно-болотных угодий международного значения, согласно Рамсарской конвенции с особым охранным режимом.\\nВ территорию парка входят земли, данные парку в постоянное пользование. А также 17611,1 га земель, которые включены в его состав без изъятия у землепользователей, на которых осуществляется традиционная хозяйственная деятельность при выполнении общих требований охраны окружающей среды.\\nБлижайший населённый пункт — село Маяки Беляевского района, где находится административное здание № 2 Нижнеднестровского НПП. Маяки расположены на левом берегу реки Днестр на расстоянии 40 км от города Одессы."},{"page_url":"https://de.wikipedia.org/wiki/Stock-Flow_Consistent_Model","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/James_Tobin.png","page_title":"Stock-Flow Consistent Model","context_page_description":"Stock-Flow Consistent Models, auch accounting models, auf Deutsch etwa bestands- und flussgrößenkonsistente Modellierung, dient als Sammelbegriff für verschiedene dynamische volkswirtschaftliche Modelle, welche die Dynamik der Bestands- und Flussgrößen in den Bilanzen der Wirtschaftssektoren einer Volkswirtschaft beschreiben. Sie werden dem accounting oder balance sheet approach zugerechnet."},{"page_url":"https://fr.wikipedia.org/wiki/Ogun_(divinit%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Statue_of_Ogun_shrine_at_the_Sacred_Grove_Of_Oshun.jpg","page_title":"Ogun (divinité)","context_page_description":"Ogun, Ogoun, ou Ogou, ou Gou, est au départ un orisha dans la mythologie yoruba, et un lwa du vaudou haïtien, qui se présente sous plusieurs aspects.\\nIl préside au feu, au fer et à la guerre. Comme tel, il est le patron des forgerons. Il est le frère de Shangô."},{"page_url":"https://en.wikipedia.org/wiki/Roelof_Kruisinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Vergadering_CDA-fractie_over_kabinetsformatie_nr_8%2C_9_Kruisinga_%28l%29_met_Van_Ag%2C_Bestanddeelnr_929-3810.jpg","page_title":"Roelof Kruisinga","context_page_description":"Roelof Johannes Hendrik Kruisinga was a Dutch politician of the defunct Christian Historical Union party and later the Christian Democratic Appeal party and physician.\\nKruisinga attended a Gymnasium in Zutphen from June 1935 until June 1939 and applied at the University of Groningen in June 1941 majoring in Medicine. In May 1942 Kruisinga was arrested by the Sicherheitsdienst and detained in the ilag of Sint-Michielsgestel and was released in July 1944. Following the end of World War II Kruisinga returned to the University of Groningen and obtaining an Bachelor of Medical Sciences degree in June 1946 and worked as a student researcher before graduating with an Master of Medicine degree on 12 October 1950. Kruisinga worked as a medical researcher of otorhinolaryngology at the University Medical Center Groningen from January 1950 until November 1955. Kruisinga was conscripted in the Royal Netherlands Army serving as a Sergeant from November 1951 until November 1953."},{"page_url":"https://nl.wikipedia.org/wiki/Grote_kaardebol","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Dipsacus_fullonum3.jpg","page_title":"Grote kaardebol","context_page_description":"De grote kaardebol of wilde kaardebol, behoort tot de kaardebolfamilie, in de 22e druk van de Heukels, of tot de kamperfoeliefamilie, in de 23e druk van de Heukels. De ondersoort D. f. subsp. sativus wordt ook wel weverskaarde genoemd.\\nDe grote kaardebol komt oorspronkelijk uit Noord-Afrika, Voor-Azië en Europa, maar komt tegenwoordig overal in de gematigde streken voor. In Nederland is de plant vanaf 1 januari 2017 niet meer wettelijk beschermd.\\nDe plant is tweejarig en kan 70–250 cm hoog worden. De bladeren zijn twee aan twee tegenoverstaand en de vergrote bladvoet werkt als opvangbakje voor water.\\nDe lila bloempjes zijn klein en ongesteeld en staan bij elkaar op een hoge ineengedrongen tros. Ze hebben een 5–9 cm lange gemeenschappelijke 'kelk'. Elk bloempje heeft naast een eigen vergroeidbladig omwindseltje ook nog een kelk van stijve haren. Een bloempje heeft vier meeldraden, één stamper en een onderstandig vruchtbeginsel met één zaadknop.\\nDe bloei begint vanuit het midden van de bloeiwijze en bloeit tegelijk naar boven en beneden. Hierdoor zijn twee bloeiende ringen te zien.\\nDe kaardebol produceert veel nectar en trekt daarom veel insecten zoals solitaire bijen en hommels."},{"page_url":"https://sh.wikipedia.org/wiki/Djimon_Hounsou","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Djimon_Hounsou_push_premiere_%28cropped%29.jpg","page_title":"Djimon Hounsou","context_page_description":"Džimon Hansu je američki glumac i maneken, rođen 24. aprila 1964. u Kotonuu. Najpoznatiji je po ulozi Cinquea, vođe pobunjenih robova u filmu Amistad."},{"page_url":"https://en.wikipedia.org/wiki/Showa_Museum_of_Art","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/The_Showa_Museum_110118.jpg","page_title":"Showa Museum of Art","context_page_description":"The Showa Museum of Art is a private art museum located in the Shiomi-chō area of Shōwa-ku, Nagoya, central Japan."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D1%80%D0%BE%D0%B7%D1%80%D1%96%D0%B7%D0%BD%D0%B5%D0%BD%D0%BD%D1%8F_%D0%A3%D0%BA%D1%80%D0%B7%D0%B0%D0%BB%D1%96%D0%B7%D0%BD%D0%B8%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/USSR_Railways_Ranks_Insignia_12.jpg","page_title":"Знаки розрізнення Укрзалізниці","context_page_description":"Знаки розрізнення залізничників — посадові знаки розрізнення співробітників залізничного транспорту. Використовуються також співробітниками метрополітенів.\\nВ сучасному вигляді існують з 1996 року."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wien/Margareten","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Wienreinprechtsdorferbr.jpg","page_title":"Liste der denkmalgeschützten Objekte in Wien/Margareten","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wien-Margareten enthält die 70 denkmalgeschützten, unbeweglichen Objekte des 5. Wiener Gemeindebezirks Margareten."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E7%8E%8B%E5%AD%90%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/JRF_DE10-1666_Kita_OjiLine_20140314.jpg","page_title":"北王子線","context_page_description":"北王子線は、東京都北区の田端信号場駅と同区の北王子駅を結んでいた日本貨物鉄道の鉄道路線の通称である。正式には東北本線の貨物支線である。かつては、途中から同じく貨物線の須賀線が分岐していた。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D0%B0%D1%81%D1%82%D0%B0%D1%81%D0%B8%D0%BE%D1%81_%D0%9F%D0%B0%D0%BF%D1%83%D0%BB%D0%B0%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Anastasios_Papulas.jpg","page_title":"Анастасиос Папулас","context_page_description":"Анастасиос Папулас е гръцки висш офицер и революционер, деец на гръцката въоръжена пропаганда в Македония."},{"page_url":"https://pl.wikipedia.org/wiki/Kalendarium_historii_Opola","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Oppeln_F.B._Werner.png","page_title":"Kalendarium historii Opola","context_page_description":"Kalendarium historii Opola"},{"page_url":"https://ceb.wikipedia.org/wiki/Sankt_Ulrich_im_M%C3%BChlkreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/St.Ulrich_Kapelle_-_Au%C3%9Fen.jpg","page_title":"Sankt Ulrich im Mühlkreis","context_page_description":"Munisipyo ang Sankt Ulrich im Mühlkreis sa Ostriya. Nahimutang ni sa distrito sa Politischer Bezirk Rohrbach ug estado pederal sa Oberösterreich, sa amihanang bahin sa nasod, 170 km sa kasadpan sa Vienna ang ulohan sa nasod. Adunay 632 ka molupyo.\\nHapit nalukop sa kaumahan ang palibot sa Sankt Ulrich im Mühlkreis. Dunay mga 70 ka tawo kada kilometro kwadrado sa palibot sa Sankt Ulrich im Mühlkreis medyo hilabihan populasyon. Ang klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -7 °C. Ang kasarangang pag-ulan 1,298 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 174 milimetro nga ulan, ug ang kinaugahan Marso, sa 51 milimetro."},{"page_url":"https://cs.wikipedia.org/wiki/Opera_v_Oslu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Full_Opera_by_night.jpg","page_title":"Opera v Oslu","context_page_description":"Nová budova Opery v Oslu, nazývaná také Grand Opera, je moderní operní dům, otevřený 12. dubna 2008 za účasti norského krále Haralda V.. Stojí u zálivu Bjørvika nedaleko od centra Osla a je dominantou panoramatu města směrem od Oslofjordu. Je sídlem Norské státní opery a baletu. Byla jednou z pěti oceněných staveb, které získaly v roce 2009 cenu za architekturu Mies van der Rohe Award."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BB%CE%BC%CF%80%CE%B5%CF%81%CE%B2%CE%AF%CE%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/%C3%89glise_Saint-Grat_de_Conflans_%28Savoie%29.jpg","page_title":"Αλμπερβίλ","context_page_description":"Η Αλμπερβίλ είναι γαλλική κοινότητα στο νομό Σαβοΐας στην περιοχή Ωβέρνη-Ρον-Αλπ, στη νοτιοανατολική Γαλλία. Βρίσκεται στις Γαλλικές Άλπεις.\\nΗ σύγχρονη πόλη Αλμπερβίλ δημιουργήθηκε το 1836 από τον βασιλιά Κάρολο Αλβέρτο της Σαρδηνίας, ο οποίος συγχώνευσε τη μεσαιωνική πόλη Κονφλάν, η οποία έχει κτίρια που χρονολογούνται από τον 14ο αιώνα, με την πόλη Λ'Οπιτάλ. Από τότε, η Αλμπερβίλ έχει αναπτύξει το εμπόριο μεταξύ Γαλλίας, Ιταλίας και Ελβετίας. Βιομηχανίες όπως οι χαρτοβιομηχανίες και η υδροηλεκτρική βρίσκονται κατά μήκος του ποταμού.\\nΗ πόλη είναι γνωστή για τη φιλοξενία των χειμερινών Ολυμπιακών Αγώνων του 1992.\\nΟι κάτοικοι ονομάζονται Αλμπερβιλουά."},{"page_url":"https://it.wikipedia.org/wiki/Lunar_Orbiter_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Lunar_Orbiter_2.jpg","page_title":"Lunar Orbiter 2","context_page_description":"Il Lunar Orbiter 2 fu il secondo satellite lunare appartenente al Programma Lunar Orbiter. Il suo scopo era quello di ottenere foto della Luna che permettessero di scegliere adeguati siti per gli atterraggi delle sonde Surveyor e per le missioni Apollo."},{"page_url":"https://hu.wikipedia.org/wiki/Sz%C5%B1z_M%C3%A1ria,_az_Isteni_Gondvisel%C3%A9s_Anyja-templom_(Pilisszentiv%C3%A1n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Inner_parts_of_the_Catholic_Church_of_Pilisszentiv%C3%A1n_2.JPG","page_title":"Szűz Mária, az Isteni Gondviselés Anyja-templom (Pilisszentiván)","context_page_description":"A Szűz Mária, az Isteni Gondviselés Anyja-templom a Pest megyei Pilisszentiván egyetlen római katolikus temploma. Tervezője Nöpauer Máté, a magyarországi késő barokk építészet egyik jelentős templomépítésze volt, mai formáját az épület az 1914-es átalalakítással nyerte el. Belső festése viszonylag dísztelen; két nagy méretű festményét Feszty Masa festőművész alkotta 1950-ben."},{"page_url":"https://it.wikipedia.org/wiki/Gladys_Leslie","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Gladys_Leslie_trading_card.jpg","page_title":"Gladys Leslie","context_page_description":"Gladys Leslie è stata un'attrice statunitense dell'epoca del muto, attiva tra gli anni dieci e venti.\\nSebbene meno ricordata di stelle come Mary Pickford, ebbe una serie di ruoli da protagonista dal 1917 ai primi anni venti ed è stata, ai suoi tempi una delle giovani dive dello schermo."},{"page_url":"https://eu.wikipedia.org/wiki/Schreibers_saguzar","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Miniopterus_schreibersii_dasythrix.jpg","page_title":"Schreibers saguzar","context_page_description":"Schreibers saguzarra edo koba-saguzarra Euskal Herrian topatu daitekeen saguzar bat da. Schreiber saguzarra, koba-saguzar izenez ere ezagutzen dena, leize-zulotan gorde ohi den espeziea da. Miniopterus generoko Europako espezie bakarra da, eta Euskal Herriko lurralde guztian aurki daiteke. Talde handiak osatu ohi ditu kobazuloen barruan, gehienetan beste hainbat espezietako saguzarrekin batera, eta migrazio nahiko luzeak egiteko gai da. Bere kontserbazio-egoera ez da txarra, baina azken urteotan populazioek beherako joera hartu dutela ikusi da."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D0%B4%D0%B0%D0%BC_%D0%93%D0%BB%D1%91%D0%B1%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Adam_Globus.jpg","page_title":"Адам Глёбус","context_page_description":"Ада́м Глёбус — беларускі пісьменьнік, мастак, выдавец, удзельнік таварыства «Тутэйшыя»."},{"page_url":"https://en.wikipedia.org/wiki/Zawisza_Bydgoszcz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bydgoszcz_-_Stadion_Zawiszy.jpg","page_title":"Zawisza Bydgoszcz","context_page_description":"Zawisza Bydgoszcz is a sports club from Bydgoszcz, Poland, founded in 1946. Its name commemorates a legendary Polish 15th-century knight, Zawisza Czarny. The club holds many sections: football, track and field athletics, boxing, rowing, canoeing, weightlifting, gymnastics, shooting, and parachuting ones."},{"page_url":"https://eo.wikipedia.org/wiki/Benzila_tioformiato","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Formamide-3D-balls.png","page_title":"Benzila tioformiato","context_page_description":"Benzila tioformiato aŭ C₈H₈OS estas kemia kombinaĵo, apartenanta al la funkcia grupo de la esteroj de la tioformiata acido kaj benzila alkoholo. Benzila tioformiato estas kemia reakciaĵo, uzata kiel gustigagento kaj odorigagento en la nutrondustrio kaj en la fabrikado de kosmetikaĵoj kaj farmaciaĵoj. Kutime ĝi estiĝas per kondensiĝa reakcio aŭ per esterigo de Fischer-Speyer kun sulfata acido kiel katalizilo. Benzila tioformiato estas malmulte solvebla en akvo, sed tute solvebla en alkoholo, duetila etero, kloroformo kaj plejmulto el la organikaj solvantoj. Benzila tioformiato reakcias kun fortaj oksidigagentoj kaj fortaj bazoj kaj posedas antifungajn kaj antibakteriajn proprecojn."},{"page_url":"https://es.wikipedia.org/wiki/28_de_mayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Kylie_Minogue_Cannes.jpg","page_title":"28 de mayo","context_page_description":"El 28 de mayo es el 148.º día del año en el calendario gregoriano y el 149.º en los años bisiestos. Quedan 217 días para finalizar el año."},{"page_url":"https://vi.wikipedia.org/wiki/Ablepharus_rueppellii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ablepharus_rueppellii_distribution_%28colored%29.png","page_title":"Ablepharus rueppellii","context_page_description":"Ablepharus rueppellii là một loài thằn lằn trong họ Scincidae. Loài này được Gray mô tả khoa học đầu tiên năm 1839."},{"page_url":"https://pl.wikipedia.org/wiki/TKS","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/TKS_in_the_Kubinka_Tank_Museum.jpg","page_title":"TKS","context_page_description":"TKS – polska tankietka z okresu przed II wojną światową. Obok czołgu 7TP był podstawową bronią polskich sił pancernych podczas kampanii wrześniowej 1939."},{"page_url":"https://de.wikipedia.org/wiki/Schwungradspeicherung","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Flybrid_Systems_Kinetic_Energy_Recovery_System.jpg","page_title":"Schwungradspeicherung","context_page_description":"Schwungradspeicherung ist eine Methode der mechanischen Energiespeicherung, bei der ein Schwungrad auf eine hohe Drehzahl beschleunigt und Energie als Rotationsenergie gespeichert wird. Die Energie wird zurückgewonnen, indem der Rotor induktiv an einen elektrischen Generator gekoppelt und dadurch abgebremst wird.\\nBenutzt werden sie meist zum Ausgleich von Spitzenlasten, Glätten von Leistungsspitzen, Rekuperation bei Elektrofahrzeugen und auch als Anlage zur unterbrechungsfreien Stromversorgung in Krankenhäusern und Industrieanlagen."},{"page_url":"https://oc.wikipedia.org/wiki/Dumbarton","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Old_Bridge_Dumbarton_-_geograph.org.uk_-_366274.jpg","page_title":"Dumbarton","context_page_description":"Dumbarton en anglés, o Dùn Breatann en gaelic escocés, que significa \\"fòrt dels britons\\", es una vila d'Escòcia, centre administratiu del council area de West Dunbartonshire."},{"page_url":"https://cs.wikipedia.org/wiki/K%C5%99ivou%C5%A1_ko%C5%99enuj%C3%ADc%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Red_flowers_bgiu.jpg","page_title":"Křivouš kořenující","context_page_description":"Křivouš kořenující je druh rostliny z čeledi trubačovité."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Oberndorf_bei_Salzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Verschiedenes_051.JPG","page_title":"Pfarrkirche Oberndorf bei Salzburg","context_page_description":"Die Pfarrkirche hl. Nikolaus ist eine römisch-katholische Kirche in der Gemeinde Oberndorf bei Salzburg im Bezirk Salzburg-Umgebung im Land Salzburg. Sie steht unter Denkmalschutz."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D1%81%D0%BA%D0%B0_%D0%B3%D0%BE%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Bayerischer_wald1.jpg","page_title":"Баварска гора","context_page_description":"Баварската гора е средно висока планинска верига в Бавария, Южна Германия. Обхваща района Оберпфалц. Дължина около 90 км.\\nНационалният парк „Баварска гора“ заема голяма част от централните планини. Той е първият национален парк в Германия, създаден през 1970 г."},{"page_url":"https://fr.wikipedia.org/wiki/Pel-et-Der","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Pel_et_Der_%281%29.jpg","page_title":"Pel-et-Der","context_page_description":"Pel-et-Der est une commune française, située dans le département de l'Aube en région Grand Est."},{"page_url":"https://en.wikipedia.org/wiki/Marcus_Rohd%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F_%D0%A7%D0%9C_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_2018_%28cropped%29.jpg","page_title":"Marcus Rohdén","context_page_description":"Marcus Christer Rohdén is a Swedish footballer who plays as a midfielder, mainly central but can be used as a winger. He plays in Italy for Frosinone. A Swedish international since 2015, he was a squad player for Sweden at the 2018 FIFA World Cup."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%A7%80%E4%B8%96%E9%9F%B3%E8%8F%A9%E8%96%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/%E5%8D%97%E6%B5%B7%E8%A7%82%E9%9F%B3%E5%83%8F.jpg","page_title":"觀世音菩薩","context_page_description":"观世音菩萨，汉语音译“阿婆卢吉低舍婆罗”、“阿缚卢枳低湿伐逻”，名号意为“观察世间音声觉悟有情”，又译为观音菩萨、观自在菩萨、光世音菩萨，手持莲花的观音菩萨也被称为莲花手菩萨或持莲观音，在大中华地区佛教自唐代开始主要是以莲华部母白衣观音为所有观世音菩萨的本尊；在民间信仰中常被尊称观音佛祖、观音大士、观音娘娘、观音妈、白衣大士。在密教中，祂为莲华部尊，在净土宗则是西方净土的大菩萨，与大势至菩萨分别为阿弥陀佛的左、右胁侍菩萨，并称“西方三圣”，同时祂也是四大菩萨之一。"},{"page_url":"https://fr.wikipedia.org/wiki/Atlas_(mythologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Atlas_Schloss_Linderhof.JPG","page_title":"Atlas (mythologie)","context_page_description":"Atlas est un des Titans hésiodiques du mythe fondateur de la mythologie grecque et de la Grèce antique, père des Pléiades, des Hyades, des Hespérides et de Calypso. À la suite de sa défaite dans la guerre des Titans contre les dieux de l'Olympe et Zeus pour régner sur le monde, ce dernier le condamne à porter le monde pour l'éternité sur ses épaules. Il est pétrifié par Persée avec la tête de Méduse et métamorphosé en chaîne de montagnes Atlas d'Afrique du Nord."},{"page_url":"https://es.wikipedia.org/wiki/Fairfax_(California)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/DowntownFairfaxCAShot1.jpg","page_title":"Fairfax (California)","context_page_description":"Fairfax, fundado en 1931, es un pueblo ubicado en el condado de Marin en el estado estadounidense de California. En el año 2000 tenía una población de 7.319 habitantes y una densidad poblacional de 1.330,7 personas por km²."},{"page_url":"https://cs.wikipedia.org/wiki/Muzeum_Olomouck%C3%A9_pevnosti","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Pevnost%2C_Olomouc_%2802%29.jpg","page_title":"Muzeum Olomoucké pevnosti","context_page_description":"Občanské sdružení Muzeum Olomoucké pevnosti bylo založeno 14. 5. 2007. Vzniklo za účelem rekonstrukce a revitalizace památkově chráněného areálu Korunní pevnůstky v Olomouci."},{"page_url":"https://es.wikipedia.org/wiki/Vaquer%C3%ADa_(fiesta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Vaquer%C3%ADa_San_Fabian_de_Yucat%C3%A1n.jpg","page_title":"Vaquería (fiesta)","context_page_description":"La vaquería, en Yucatán, México, es una fiesta popular cuyo origen se remonta a la época colonial, cuando los españoles que habían conquistado la región y que se dedicaban a la crianza de ganado vacuno en sus haciendas, convocaban a sus trabajadores para \\"la hierra\\" de sus vacadas y ofrecían, o permitían, un festejo o baile colectivo a manera de ceremonia como preludio al herraje que implicaba un esfuerzo físico considerable."},{"page_url":"https://es.wikipedia.org/wiki/Eduardo_V_de_Inglaterra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/DelarocheKingEdward.jpg","page_title":"Eduardo V de Inglaterra","context_page_description":"Eduardo V de Inglaterra era el primogénito varón del rey Eduardo IV y de Isabel Woodville. Nació en la Abadía de Westminster, donde su madre se había refugiado de las huestes de Enrique VI. Fue Rey de Inglaterra a la muerte de su padre Eduardo IV el 9 de abril de 1483, hasta la adhesión de su tío Ricardo III el 26 de junio de 1483 confirmada por la Ley titulada Titulus Regius, que denunció cualquier otra reclamación a través de los herederos de su padre. No se lo consideraba con la edad suficiente para ser coronado rey, su reinado de 86 días fue dominado por la influencia de su tío y protector que le sucedió. Él y su hermano menor Ricardo, Duque de York, fueron los “príncipes en la torre”, que desaparecieron después de ser enviados a los alojamientos reales fuertemente custodiados en la Torre de Londres. La responsabilidad de su muerte se atribuye al rey Ricardo, pero los eventos tienen relatos de la época controvertidos y contradictorios que sugieren también otros cuatro sospechosos principales."},{"page_url":"https://fr.wikipedia.org/wiki/Deuxi%C3%A8me_bataille_du_Bourget_(1870)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Drancy_Chateau_de_Ladoucette_1871.jpg","page_title":"Deuxième bataille du Bourget (1870)","context_page_description":"La deuxième bataille du Bourget eut lieu le 21 décembre 1870, pendant la guerre franco-prussienne."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_al_Parlamento_de_Catalu%C3%B1a_de_1984","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Ciu_1980s.png","page_title":"Elecciones al Parlamento de Cataluña de 1984","context_page_description":"El domingo 29 de abril de 1984 tuvieron lugar las segundas elecciones al Parlamento de Cataluña tras la recuperación de la democracia en España, y el restablecimiento de la Generalidad de Cataluña en 1979. Fueron convocadas a votar 4.501.851 personas mayores de 18 años y con derecho a voto en Cataluña. Las elecciones sirvieron para escoger a los 135 parlamentarios de la segunda legislatura democrática. Acudieron a votar 2.892.987 personas, lo que dio una participación del 64,26 por ciento, tres puntos por encima de la participación de cuatro años antes.\\nLas elecciones fueron anticipadas veinte días, ya que estaba previsto que se celebraran el sábado 19 de mayo de 1984.\\nEl partido más votado fue, de nuevo, Convergència i Unió que, con 1.346.729 votos, obtuvo 72 escaños, 29 más que en las anteriores elecciones, y 31 más que la segunda fuerza política, el Partido de los Socialistas de Cataluña. CiU venció esta vez, por tanto, por mayoría absoluta.\\nTras la formación del Parlamento de Cataluña, el candidato de Convergència i Unió, Jordi Pujol, fue investido Presidente de la Generalidad de Cataluña, por segunda vez consecutiva."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_Tettamancy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/F._TETTAMANCY_en_La_revoluci%C3%B3n_gallega_de_1846_%282%C2%AA_ed._1909%29_%28cropped%29.jpg","page_title":"Francisco Tettamancy","context_page_description":"Francisco Tettamancy Gastón fue un escritor en lengua gallega y castellana. ​"},{"page_url":"https://es.wikipedia.org/wiki/Esfera_celeste","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Celestial-sphere-ES.svg","page_title":"Esfera celeste","context_page_description":"La esfera celeste es una esfera ideal, sin radio definido, concéntrica con el globo terrestre, en la cual aparentemente se mueven los astros. Permite representar las direcciones en que se hallan los objetos celestes; así es como el ángulo formado por dos direcciones será representado por un arco de círculo mayor sobre esa esfera.\\nTeóricamente se considera que el de la Tierra es el Eje del mundo, y que el ojo del observador es coincidente con el centro de la Tierra. Es un modelo que constituye uno de los conceptos fundamentales de la astronomía, especialmente para poder representar las observaciones celestes.​​"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%90%D1%82_%D1%82%D3%A9%D1%81%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Kevin_Tornado_Zlosyn_2005.jpg","page_title":"Ат төсе","context_page_description":"Ат төсе — атның төк капламы, шулай ук тире һәм күзләренең төсе. Күп төсләрдә аксыл һәм карасу төсмерләре бар."},{"page_url":"https://ko.wikipedia.org/wiki/HK_4.6%C3%9730mm","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/4%2C6_x_30.jpg","page_title":"HK 4.6×30mm","context_page_description":"HK 4.6×30mm 카트리지는 주로 개인방어화기인 헤클러&코흐 MP7의 탄약으로 사용된다. 무게를 최소화 하는 대신 반동을 키워 관통력을 늘렸다. 생김새는 쇠를 황동으로 감싼 탄두와 병목형태의 탄피로 이루어졌다."},{"page_url":"https://fr.wikipedia.org/wiki/Los_Angeles","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Sunset_at_Venice_Beach_-_LA_-_panoramio.jpg","page_title":"Los Angeles","context_page_description":"Los Angeles est la deuxième ville des États-Unis en nombre d'habitants après New York. Située dans le Sud de l'État de Californie, sur la côte du Pacifique, la ville est le siège du comté de Los Angeles.\\nSelon une estimation, la population de la commune est de 3 976 322 habitants en 2016, alors qu'elle n'était que de 11 500 en 1887. Le comté rassemble 10 179 716 habitants tandis que l'aire urbaine de Los Angeles compte environ 18,5 millions d’habitants, ce qui en fait la deuxième agglomération des États-Unis après celle de New York. La commune de Los Angeles est cependant relativement restreinte face à son agglomération, même si elle est plus grande que New York ou Chicago.\\nLos Angeles est une ville olympique : elle accueille les Jeux olympiques d'été deux fois — en 1932 et 1984 — et les accueillera de nouveau en 2028. Mondialement connue pour son activité culturelle, elle a un statut de ville-région mondiale ; cosmopolite, elle demeure l'un des points d'entrée d'immigrants les plus importants aux États-Unis."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Monona_County,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/MONONA_COUNTY_COURTHOUSE%2C_ONAWA%2C_IOWA.JPG","page_title":"National Register of Historic Places listings in Monona County, Iowa","context_page_description":"This is intended to be a complete list of the properties and districts on the National Register of Historic Places in Monona County, Iowa, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 10 properties and districts listed on the National Register in the county, including one National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted October 4, 2018."},{"page_url":"https://en.wikipedia.org/wiki/Henry_Le_Cren","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Pegasus_Arms_36.jpg","page_title":"Henry Le Cren","context_page_description":"Henry John Le Cren was a New Zealand merchant. Born in London, he was an early settler in Lyttelton and traded both in the port town and central Christchurch. He moved to Timaru in 1858 and is regarded as one of the town's pioneers. Companies owned by him or his eldest son are predecessors to the New Zealand agricultural supply business PGG Wrightson."},{"page_url":"https://it.wikipedia.org/wiki/Honda_CBR","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Honda_CBR150R_Repsol.jpg","page_title":"Honda CBR","context_page_description":"Con la sigla CBR o CBR-F o CBR-R o CBR-RR la casa motociclistica giapponese Honda produce motociclette di vario tipo e cilindrata. La prima presentazione di un modello di questa serie risale al 1983."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_ulic_v_T%C5%99eb%C3%AD%C4%8Di","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/T%C5%99eb%C3%AD%C4%8D%2C_Jihlavsk%C3%A1_br%C3%A1na%2C_Komensk%C3%A9ho_n%C3%A1m%C4%9Bst%C3%AD%2C_sm%C4%9Br_V._Nezvala.jpg","page_title":"Seznam ulic v Třebíči","context_page_description":"Seznam pojmenovaných ulic a náměstí v Třebíči"},{"page_url":"https://no.wikipedia.org/wiki/%C3%98stbyfaret_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%C3%98stbyfaret_8._november_2015.jpg","page_title":"Østbyfaret (Oslo)","context_page_description":"Østbyfaret er en vei på Ulsrud i bydel Østensjø i Oslo. Den går fra Kringkollen til Aagots vei.\\nNaven ble vedtatt i 1938 og henspiller på at veien ligger i østre del av «villabyen» Ulsrud.\\nVeien har bl.a. tre rekkehus i OBOS-borettslaget Østbyfaret."},{"page_url":"https://en.wikipedia.org/wiki/Rolling_stock_of_the_Watercress_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/BR_S4823_Second_Open.png","page_title":"Rolling stock of the Watercress Line","context_page_description":"The Watercress Line operates a wide variety of locomotives and other stock as part of its preserved operations. A comprehensive bank of information about the railway's locomotives and rolling stock can be found on the Watercress Line's website in the \\"Rolling Stock\\" section."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%96%A2%E5%B1%8B%E9%A7%85_(%E6%96%B0%E6%BD%9F%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/20060625_sekiya_temp.jpg","page_title":"関屋駅 (新潟県)","context_page_description":"関屋駅は、新潟県新潟市中央区関屋大川前二丁目にある、東日本旅客鉄道越後線の駅である。"},{"page_url":"https://fr.wikipedia.org/wiki/Art_social","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Paris-FR-75-Expo_1925_Arts_d%C3%A9coratifs-pavillon_de_l%27Art_appliqu%C3%A9_aux_M%C3%A9tiers.jpg","page_title":"Art social","context_page_description":"L'Art social est un concept apparu à la fin du XIXᵉ siècle en France dans la foulée des revendications sociales portées par des groupes d'intellectuels anarchistes et de politiciens solidaristes. Cette idée s'inscrit dans une démarche moderniste en occident valorisant les arts utiles à la société et s'opposant au concept de l'Art pour l'Art et de l'Art académique. Quelques artistes des avant-gardes s'associent au concept sur le plan théorique et éducatif. Les architectes et les artistes-artisans des métiers de l'art sont les principaux intervenants aux développements des différents mouvements artistiques et propositions esthétiques transformant le cadre de vie sociale de 1890 à 1960. La fin de la modernité et des avant-gardes artistiques et l'avènement d'un espace public hautement esthétisé au milieu du XXᵉ siècle ouvrent de nouvelles voies artistiques. L'une dite Art contemporain rompt avec la tradition des beaux-arts, applique les idées de Marcel Duchamp appuyé par les institutions académiques, les musées et galeries d'art, les collectionneurs et le marché de l'art."},{"page_url":"https://sv.wikipedia.org/wiki/Nagoya","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Nagoya_uitzicht.jpg","page_title":"Nagoya","context_page_description":"Nagoya är Japans fjärde största stad och den administrativa huvudorten för prefekturen Aichi. Den är belägen vid Stillahavskusten i Chūburegionen på centrala Honshū. Folkmängden uppgår till cirka 2,3 miljoner, med nästan 9 miljoner invånare i storstadsområdet. Nagoya är en av Japans viktigaste hamnstäder tillsammans med Tokyo, Ōsaka, Kōbe, Yokohama, Chiba och Fukuoka."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D0%BB%D1%83%D1%86%D0%BA%D0%B0%D1%8F_%D0%B1%D1%80%D0%B0%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Nia%C5%9Bvi%C5%BE%2C_S%C5%82uckaja_brama%2C_Kaplica._%D0%9D%D1%8F%D1%81%D1%8C%D0%B2%D1%96%D0%B6%2C_%D0%A1%D0%BB%D1%83%D1%86%D0%BA%D0%B0%D1%8F_%D0%B1%D1%80%D0%B0%D0%BC%D0%B0%2C_%D0%9A%D0%B0%D0%BF%D0%BB%D1%96%D1%86%D0%B0_%281937%29.jpg","page_title":"Слуцкая брама","context_page_description":"Слуцкая брама — помнік архітэктуры XVI—XVIII стагодзьдзяў у Нясьвіжы. Знаходзіцца ў пачатку Слуцкай вуліцы, на дамбе паміж Замкавым і Дзявочым ставамі, аддзяляе Старое Места ад Новага. Твор архітэктуры барока. Аб’ект Дзяржаўнага сьпісу гістарычна-культурных каштоўнасьцяў Беларусі."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%AC%E8%92%82%E5%8E%84%E6%96%B9%E7%A8%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Figura_Mathieu1.PNG","page_title":"馬蒂厄方程","context_page_description":"馬蒂厄方程式是一種有週期係數的線性二階微分方程。 這位法國數學家埃米爾·倫納德馬蒂厄於1868年在他的\\"橢圓模振動紀錄\\"中第一次提到這種微分方程式，也就是現在所說的馬蒂厄方程式。\\"馬蒂厄方程式可以適應很廣大變動的物理現象，像是繞射、振幅失真、倒立擺、漂浮物體的穩定性、射頻四極和振動\\""},{"page_url":"https://vo.wikipedia.org/wiki/Risch-Rotkreuz","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Karte_Lage_Kanton_Zug_2008_Risch-Rotkreuz.png","page_title":"Risch-Rotkreuz","context_page_description":"Risch-Rotkreuz binon zif in kanton: Zug, in Jveizän. Risch-Rotkreuz topon videtü 47°8’ N e lunetü 8°28’ L.\\nSürfat ela Risch binon mö 22,9 km².\\nRisch-Rotkreuz labon belödanis 8 730."},{"page_url":"https://en.wikipedia.org/wiki/Macmillan_4x4_UK_Challenge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Jaye_Griffiths_training_in_a_Land_Rover_Defender_prior_to_competing_in_the_2013_Mac_4x4.jpg","page_title":"Macmillan 4x4 UK Challenge","context_page_description":"The Macmillan 4x4 UK Challenge is an annual navigational endurance challenge event. It is open to any road legal 4x4 vehicle in aid of Macmillan Cancer Support. The event has been run since 2002 over one weekend in March each year and consists of a series of on road treasure hunts interspersed with off-road challenges. The event covers up to 1,000 miles and raises up to in excess of £100,000 for Macmillan Cancer Support each year.\\nNo special vehicle modifications are required to enter, any sensibly equipped 4x4 should be able to complete the event. Each team has a minimum sponsorship to raise all of which goes to Macmillan. All event costs are covered out of the entry fee except fuel which competitors pay for as they go.\\nCompetitors only know where they are starting from, the route being kept secret till roadbooks are handed out along the way. It generally ends in Cheshire where there is a prize-giving dinner and accommodation for the night at a hotel."},{"page_url":"https://nl.wikipedia.org/wiki/Clairefontaine-en-Yvelines","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Map_commune_FR_insee_code_78164.png","page_title":"Clairefontaine-en-Yvelines","context_page_description":"Clairefontaine-en-Yvelines is een gemeente in het Franse departement Yvelines en telt 800 inwoners. De plaats maakt deel uit van het arrondissement Rambouillet."},{"page_url":"https://pl.wikipedia.org/wiki/Diecezja_rzymska","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Pope_Francis_in_March_2013.jpg","page_title":"Diecezja rzymska","context_page_description":"Diecezja rzymska – rzymskokatolicka diecezja z katedrą w Rzymie, na Lateranie. Drugą, starożytną i uroczystą nazwą diecezji jest Święty Kościół Rzymski. Diecezja Rzymu wchodzi w skład rzymskiej prowincji kościelnej. Ordynariuszem diecezji a także zwierzchnikiem prowincji jest Biskup rzymski - papież, widzialna głowa Kościoła katolickiego, prymas Włoch, metropolita prowincji rzymskiej i głowa Państwa Watykan. Do 2006 do papieża należał tytuł patriarchy Zachodu, lecz Benedykt XVI zrezygnował z tego tytułu. Rzeczywiste obowiązki ordynariusza pełni wikariusz generalny diecezji rzymskiej w randze kardynała. Wikariusz rzymski jest od 1966 z urzędu administratorem apostolskim suburbikarnej diecezji Ostii, której administracja jest scalona z Wikariatem rzymskim.\\nDiecezja rzymska jest jedyną diecezją rzymskokatolicką na świecie, której biskup nie jest mianowany przez papieża lecz wybierany przez jej własne duchowieństwo. Diecezja ta wyróżnia się także tym, że posiada dwa prezbiteria - tytularne i rzeczywiste."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D9%85%D9%8A%D9%84%D9%8A_%D8%AF%D9%8A_%D8%AA%D9%88%D9%84%D9%8A%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Camille_de_Toledo_-_Mantovani%C2%A9Gallimard.jpg","page_title":"كاميلي دي توليدو","context_page_description":"كاميلي دي توليدو ‏ هو كاتب ومصور ورسام فرنسي، ولد في 25 يونيو 1976 في ليون في فرنسا."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%B1%CE%B4%CE%B9%CE%BF%CE%BC%CE%AD%CE%B3%CE%B1%CF%81%CE%BF,_%CE%9C%CF%80%CE%AD%CE%BB%CF%86%CE%B1%CF%83%CF%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/BBC_Northern_Ireland_Belfast.jpg","page_title":"Ραδιομέγαρο, Μπέλφαστ","context_page_description":"Το Ραδιομέγαρο είναι η έδρα του BBC Βόρεια Ιρλανδία και από εκεί εκπέμπουν πολλές υπηρεσίες του φορέα. Το κτήριο βρίσκεται στο κέντρο του Μπέλφαστ, στη διασταύρωση της Ormeau Avenue με την Bedford Street. Στο κτήριο γίνονται ξεναγήσεις για το κοινό."},{"page_url":"https://hu.wikipedia.org/wiki/N%C3%B3gr%C3%A1d_megye_m%C5%B1eml%C3%A9keinek_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Nepomuki_Szent_J%C3%A1nos-szobor_%286773._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29.jpg","page_title":"Nógrád megye műemlékeinek listája","context_page_description":"Ez a lista Nógrád megye műemlékeit tartalmazza. A megye műemlékekben leggazdagabb települése a világörökség része Hollókő. A községben 52 védett objektum található."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%B4%EB%B0%80_%EC%84%A4%EB%A6%AC%EB%B0%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/CamilleSullivanTIFFSept2011.jpg","page_title":"카밀 설리반","context_page_description":"카밀 설리반은 캐나다의 배우, 연극 배우, 영화배우이다.\\n토론토에서 태어났다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%B7%D0%BC_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Wiki_pogodinskaya_izba_moscow.jpg","page_title":"Историзм в России","context_page_description":"Историзм в России — разнообразные направления историзма в архитектуре России. Начиная с 1720 годов барокко и позже классицизм в России эволюционировали в направлении архитектуры сентиментальной, романтической, эклектической и историчной. Первыми появились исторические стили: египтизирующий, неоготика и шинуазри. Затем разработаны стили: псевдорусский, неовизантийский, неомавританский, неоренессанс, необарокко, элементы которых часто свободно комбинировались друг с другом. Некоторые стили, например неороманский, использовались редко. В XIX веке появились также эклектицизм и неоромантические тенденции в архитектуре, а в начале XX века так называемый ретроспективизм. Последним доминирующим направлением в русском историзме иногда рассматривается архитектура соцреализма.\\nНеорусский, неовизантийский и соцреалистический стили, наряду с классицизмом, получили официальный статус в истории России. Некоторые исторические стили нашли своё отражение также и в остальных областях искусства и ремёсел в России, в частности, скульптуре, живописи, графике, мебели, золочении, керамике."},{"page_url":"https://fr.wikipedia.org/wiki/Route_nationale_11_(Afrique_du_Sud)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Majuba_Hill-01_Nov_2008.jpg","page_title":"Route nationale 11 (Afrique du Sud)","context_page_description":"La N11 est une des Routes nationales d'Afrique du Sud. La N11 commence au Grobler's Bridge à la frontière avec le Botswana jusqu'à la connexion avec la Route nationale N3 à proximité de Ladysmith au KwaZulu-Natal."},{"page_url":"https://uz.wikipedia.org/wiki/Saint-Sauveur_(Oise)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Map_commune_FR_insee_code_60597.png","page_title":"Saint-Sauveur (Oise)","context_page_description":"Saint-Sauveur Fransiyaning Pikardiya mintaqasida joylashgan kommunadir. Oise departamenti Compiègne tumani tarkibiga kiradi."},{"page_url":"https://it.wikipedia.org/wiki/Arco_vulcanico","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Oceanic-continental_convergence_Fig21oceancont_i18.gif","page_title":"Arco vulcanico","context_page_description":"Un arco vulcanico è una catena di isole vulcaniche o montagne che si formano quando una placca subduce sotto un'altra, creando un insieme di vulcani più o meno allineati lungo una curva.\\nCi sono due tipi di arco vulcanico: arco insulare e arco continentale. Il primo si forma quando una porzione di crosta oceanica subduce sotto altra crosta oceanica, mentre il secondo caso si ha quando una porzione di crosta oceanica subduce sotto crosta continentale. In alcuni casi una singola zona di subduzione può mostrare entrambi gli aspetti lungo il suo margine.\\nDue classici esempi di arco insulare sono le Isole Marianne nell'Oceano Pacifico occidentale e le Piccole Antille nell'Oceano Atlantico occidentale. Le Ande rappresentano invece un esempio di arco continentale.\\nIl miglior esempio di arco doppio è invece l'arco aleutino, che comprende le Isole Aleutine, l'Alaska e la Kamčatka.\\nUn insieme di vulcani più o meno allineati ma che non formano una curva come nel caso degli archi è chiamato cintura vulcanica."},{"page_url":"https://de.wikipedia.org/wiki/Daniel_Herman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Daniel_Herman_Praha_2014.JPG","page_title":"Daniel Herman","context_page_description":"Daniel Herman ist ein laisierter katholischer Priester und tschechischer Politiker. Es ist Mitglied der christdemokratischen Partei Křesťanská a demokratická unie – Československá strana lidová und war Minister für Kultur in der Regierung Bohuslav Sobotka."},{"page_url":"https://pl.wikipedia.org/wiki/Mariusz_Zaruski","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Zakopane-schronisko.jpg","page_title":"Mariusz Zaruski","context_page_description":"Mariusz Zaruski – pionier polskiego żeglarstwa i wychowania morskiego, generał brygady Wojska Polskiego, taternik.\\nPostać wszechstronna – fotografik, malarz, poeta i prozaik. Marynarz, żeglarz i podróżnik. Konspirator, zesłaniec, legionista, ułan, wreszcie generał brygady i adiutant generalny prezydenta RP. Taternik, grotołaz, ratownik górski, instruktor i popularyzator narciarstwa i turystyki górskiej. Założyciel Tatrzańskiego Ochotniczego Pogotowia Ratunkowego. Instruktor harcerski ZHP i wychowawca młodzieży.\\nPrzez całe życie poświęcał się intensywnej działalności państwowej i społecznej. Również przez całe życie intensywnie ćwiczył, zachowując wysportowaną sylwetkę do późnej starości."},{"page_url":"https://de.wikipedia.org/wiki/Bank_von_Thailand","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Seal_of_the_Bank_of_Thailand.png","page_title":"Bank von Thailand","context_page_description":"Die Bank von Thailand ist die Zentralbank des Königreiches Thailand."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BC%D1%8B%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/2._%D0%9A%D0%BE%D0%BB%D0%BE%D0%BC%D0%B8%D1%8F_.%D0%BF%D0%BB._%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%B0%2C_26.JPG","page_title":"Коломыя","context_page_description":"Коломы́я — город на реке Прут в Ивано-Франковской области Украины, административный центр Коломыйского района, в состав которого не входит. Культурная столица Покутья. Известна как город со времен Галицко-Волынского княжества."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D0%B4%D1%80%D0%BE%D0%BC_%D0%B2%D0%B0%D0%BD_%D0%91%D0%BE%D0%B3%D0%B0%D1%80%D1%82%D0%B0_%E2%80%94_%D0%A8%D0%B5%D1%80%D0%B5%D1%80%D0%B0_%E2%80%94_%D0%AD%D0%BF%D1%88%D1%82%D0%B5%D0%B9%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Mitochondria%2C_mammalian_lung_-_TEM.jpg","page_title":"Синдром ван Богарта — Шерера — Эпштейна","context_page_description":"Синдро́м ван Богарта — Шерера — Эпште́йна — редкое аутосомно-рецессивное наследственное заболевание, проявляющееся расстройством липидного обмена, которое приводит к накоплению липидов в клетках. Причиной заболевания является мутация в гене CYP27A1, кодирующего митохондриальный фермент стерол-27-гидроксилазу."},{"page_url":"https://pl.wikipedia.org/wiki/Zak%C5%82ad_Karny_Nr_1_we_Wroc%C5%82awiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Zaklad_Karny_Wroclaw.JPG","page_title":"Zakład Karny Nr 1 we Wrocławiu","context_page_description":"Zakład Karny Nr 1 we Wrocławiu – więzienie przy ul. Kleczkowskiej we Wrocławiu, zbudowane w 1895 według projektu Maxa Lebena i Heinricha Butza.\\nW latach 1917–1918 była tu więziona Róża Luksemburg.\\nW III Rzeszy poza lokalnymi więźniami przebywali tu kolejno: Czesi po aneksji 1939, Polacy z terenów wcielonych do Rzeszy i ukarani robotnicy przymusowi, obywatele krajów Europy Zachodniej. Do 1945 w więzieniu wykonywano wyroki śmierci. Podczas wojny zginęło tu 869 osób, w tym wielu Czechów i Słowaków, np. aresztowanych jesienią 1939, oraz Polaków. Ciała zakopywano w Rędzinie lub na dziedzińcu więziennym.\\nPo wojnie w więzieniu przetrzymywano członków organizacji niepodległościowych, z których wielu rozstrzelano, część zmarła z powodu złych warunków. Ich groby znajdują się na Cmentarzu Osobowickim na polach 120 i 81a. Od 1945 do 1989 wykonywano tu wyroki śmierci, m.in. 18 lipca 1946 w magazynie więzienia rozstrzelano Helenę Motykę, Edwarda Szemberskiego, Romana Roszowskiego i Idziego Piszczałka, natomiast 15 kwietnia 1947 rozstrzelano kapitana Eugeniusza Werensa. 24 kwietnia 1953 wykonano egzekucję na Włodzimierzu Pawłowskim i Józefie Radłowskim."},{"page_url":"https://en.wikipedia.org/wiki/Mahasthangarh","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/%E0%A6%AE%E0%A6%B9%E0%A6%BE%E0%A6%B8%E0%A7%8D%E0%A6%A5%E0%A6%BE%E0%A6%A8%E0%A6%97%E0%A6%A1%E0%A6%BC_%2839%29.jpg","page_title":"Mahasthangarh","context_page_description":"Mahasthangarh is one of the earliest urban archaeological sites so far discovered in Bangladesh. The village Mahasthan in Shibganj thana of Bogra District contains the remains of an ancient city which was called Pundranagara or Paundravardhanapura in the territory of Pundravardhana. A limestone slab bearing six lines in Prakrit in Brahmi script recording a land grant, discovered in 1931, dates Mahasthangarh to at least the 3rd century BC. It was an important city under the Maurya Empire .The fortified area was in use until the 8th century AD."},{"page_url":"https://no.wikipedia.org/wiki/Haltichellinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Proconura.jpg","page_title":"Haltichellinae","context_page_description":"Haltichellinae er en gruppe som hører til blant parasittvepsene og er en underfamilie i ordenen Vepser. Gruppen omfatter rundt 560 kjente arter fordelt på 55 slekter. De er mest artsrike i tropene."},{"page_url":"https://de.wikipedia.org/wiki/Rosa_Quarzit","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Rosa-quarzit.jpg","page_title":"Rosa Quarzit","context_page_description":"Rosa Quarzit, auch Flamenco oder Lencois-Quarzit, ist der Handelsname eines feinkörnigen Quarzits aus Brasilien, der im Bundesstaat Bahia bei Lencois gebrochen wird."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A9myslice","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Kostel_Narozen%C3%AD_P._Marie_V%C3%A9myslice.jpg","page_title":"Vémyslice","context_page_description":"Vémyslice est une commune du district de Znojmo, dans la région de Moravie-du-Sud, en République tchèque. Sa population s'élevait à 398 habitants en 2019."},{"page_url":"https://es.wikipedia.org/wiki/Pseudoc%C3%B3digo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Condicional.png","page_title":"Pseudocódigo","context_page_description":"En ciencias de la computación, y análisis numérico, el pseudocódigo​ es una descripción de alto nivel compacta e informal​ del principio operativo de un programa informático u otro algoritmo.\\nUtiliza las convenciones estructurales de un lenguaje de programación real, ​ pero está diseñado para la lectura humana en lugar de la lectura mediante máquina​, y con independencia de cualquier otro lenguaje de programación​. Normalmente, el pseudocódigo omite detalles que no son esenciales para la comprensión humana del algoritmo, tales como declaraciones de variables, código específico del sistema y algunas subrutinas. El lenguaje de programación se complementa, donde sea conveniente, con descripciones detalladas en lenguaje natural, o con notación matemática compacta. Se utiliza pseudocódigo pues este es más fácil de entender para las personas que el código del lenguaje de programación convencional, ya que es una descripción eficiente y con un entorno independiente de los principios fundamentales de un algoritmo."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%B0%D1%98%D0%B0%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/%D0%9F%D1%80%D0%B5%D0%B4%D0%B5%D0%BE_%D0%BD%D0%B0%D1%80%D0%BE%D1%87%D0%B8%D1%82%D0%B5_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%BD%D0%B5_%D0%BB%D0%B5%D0%BF%D0%BE%D1%82%D0%B5_%D0%A0%D0%B0%D1%98%D0%B0%D1%86_3.JPG","page_title":"Рајац","context_page_description":"Рајац је планински предео, део планине Сувобор, у оквиру Ваљевског комплекса планина. Налази се на територији општине Љиг, на 10km од Љига, на 25 km од Горњег Милановца, на 45 km од Аранђеловца, на 50 km од Ваљева, односно око 90 km јужно од Београда. Надморска висина Рајца креће се од 600 до 849 m.\\nМада се у појединим описима Рајац дефинише као посебна планина, он не поседује све елементе планине, као што су превоји, клисуре, тако да у географском смислу Рајац представља само предео, чији је највиши врх Рајац један од врхова Сувобора.\\nНа подручју Рајца постоји више пећина и јама, а најзначајнија је Рајачка пећина, укупне дужине канала 286 m. Преовлађују шуме букве, храста, брезе, јасена, цера, док на већим висинама има четинари: јеле и бора. Од животињских врста може наићи на фазане, срндаће, лисице, дивље свиње, зечеве, грлице."},{"page_url":"https://de.wikipedia.org/wiki/Friedrich_Gustav_K%C3%B6gel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Gustav_K%C3%B6gel_Gedenkstein_Pressel.jpg","page_title":"Friedrich Gustav Kögel","context_page_description":"Friedrich Gustav Kögel war der erste Globetrotter.\\nNach seiner Schulzeit erlernte er den Beruf eines Schneiders und wanderte schon frühzeitig nach Amerika aus. In einer bedeutenden Zeitung in San Francisco wurde die Wette Wer schafft eine Reise zu Fuß um die ganze Welt? ausgeschrieben. Kögel nahm mit seinem Freund Fred Thörner diese Wette an. Innerhalb von 2 Jahren von 1894 bis 1896 wanderten die beiden auf einer vorgeschriebenen Route um die Erde und waren damit die allerersten Weltumwanderer. Sie verdienten ihren Lebensunterhalt mit Zeitungsberichten, Vorträgen und Fotografien. Die Leistung erlebte damals ein weltweites Echo in den Medien.\\nIm Juni 1900 lernte Kögel in Beirut den Abenteuerschriftsteller Karl May kennen, welcher ihm darauf ein Gedicht schenkte und seine Begegnung mit Kögel später in seinen Tagebuchaufzeichnungen festhielt."},{"page_url":"https://cs.wikipedia.org/wiki/Diopsid","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Naturkundemuseum_Berlin_-_Diopsid_%28Violan%29%2C_St._Marcel%2C_Valle_d%27Aosta%2C_Italien.jpg","page_title":"Diopsid","context_page_description":"Diopsid je důležitý horninotvorný minerál ze skupiny monoklinických pyroxenů. Často se vyskytuje ve formaci s hedenbergitem a augitem. Jeho barva se různí na základě zastoupení chemických prvků hořčíku nebo vápníku a proto lze najít od bezbarvé variety až po krásně sytě zelenou. Jeho jméno pocházející z řečtiny je složeno ze dvou slov dis a òpsè, což doslovně znamená dvě tváře. Toto pojmenování odkazuje na schopnost orientace ve dvou rovinách {100} a {001}. Diopsid byl poprvé objeven a popsán okolo roku 1800 brazilským státníkem a přírodovědcem Jose Bonifacio de Andrada e Silvou."},{"page_url":"https://fr.wikipedia.org/wiki/Barrage_de_la_Grande-Dixence","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Vue_plongeante_depuis_le_haut_de_la_grande_dixence.JPG","page_title":"Barrage de la Grande-Dixence","context_page_description":"Le barrage de la Grande-Dixence est le plus haut barrage poids du monde, et le plus massif d'Europe. Situé dans le val des Dix sur la commune d'Hérémence en Valais, il mesure 285 mètres de haut. Il fait partie d'une vaste installation hydroélectrique nommée Cleuson Dixence ou Grande Dixence, d'une puissance de 2 000 MW qui l'associe notamment au barrage de Cleuson.\\nConstruit entre 1953 et 1961, à l'emplacement d'un verrou glaciaire, le barrage constitué de six millions de mètres-cubes de béton bloque le cours de la Dixence. Son lac d'accumulation, le lac des Dix, mesure 5 km de long.\\nSur la même rivière, en amont, se situait le barrage de la Dixence, barrage voûte construit dans les années 1930. Ce barrage a été noyé lors de la mise en eau du barrage de la Grande-Dixence et peut encore être aperçu lorsque le niveau du lac est bas."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9F%B4%E4%BA%94%E9%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Shiba_goro_2.jpg","page_title":"柴五郎","context_page_description":"柴 五郎は、日本の陸軍軍人。軍事参議官・台湾軍司令官・東京衛戍総督・第12師団長を歴任し、階級は陸軍大将勲一等功二級に至る。\\n義和団の乱の防衛戦で賞賛を浴び、欧米各国から数々の勲章を授与された。『タイムズ』の記者ジョージ・アーネスト・モリソンの報道も相俟ってリュウトナンコロネル・シバは欧米で広く知られる最初の日本人となった。\\n陸軍部内きっての中国通としても知られ、事ある毎に中国へ派遣された。義和団の乱において総指揮を取ったイギリス公使クロード・マクドナルドは、共に戦った柴と配下の日本兵の勇敢さと礼儀正しさに大いに心を動かされ深く信頼するようになり、1901年の夏の賜暇休暇中に英国首相ソールズベリー侯爵と何度も会見し、7月15日には日本公使館に林董を訪ねて日英同盟の構想を述べ、以後の交渉全てに立ち会い日英同盟締結の強力な推進者となった。このことから柴は日英同盟のきっかけをつくった影の立役者として評価されている。\\n東海散士の筆名を持つ農商務次官・外務参政官、柴四朗は兄。養嗣子の柴平四郎は陸軍少将、娘は西原一策陸軍中将に嫁いだ。嫡孫の柴由一郎は1937年時点で陸軍士官学校本科生徒である。"},{"page_url":"https://en.wikipedia.org/wiki/Sam_Jeffries","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sam_Jeffries_2014_Rising.jpg","page_title":"Sam Jeffries","context_page_description":"Sam Jeffries is an Australian rugby union player who currently plays as a lock for the Melbourne Rebels in the Super Rugby competition."},{"page_url":"https://tr.wikipedia.org/wiki/Sergey_Prokudin-Gorski","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/General_view_of_Artvin_from_the_small_town_of_Svet%2C_Prokudin-Gorsky.jpg","page_title":"Sergey Prokudin-Gorski","context_page_description":"Sergey Prokudin-Gorskii, fotoğrafçılık tarihinin en önemli isimlerinden biridir. Rusya'da Murom'da doğan Produkin-Gorskii kimya eğitimi almıştır. Ünlü bilim insanlarıyla Sankt-Peterburg, Berlin ve Paris'te çalışarak, renkli fotoğrafların ilk tekniklerini geliştirmiştir."},{"page_url":"https://de.wikipedia.org/wiki/Richardson-Halsbandlemming","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Richardson%27s_Collared_Lemming_Dicrostonyx_richardsoni_distribution_map.png","page_title":"Richardson-Halsbandlemming","context_page_description":"Der Richardson-Halsbandlemming oder Manitoba-Halsbandlemming ist ein Nagetier in der Familie der Wühler, das in zentralen Gebieten Kanadas vorkommt."},{"page_url":"https://en.wikipedia.org/wiki/Viceroy_of_Liangjiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/%E9%AB%98%E5%85%B6%E5%80%AC.jpg","page_title":"Viceroy of Liangjiang","context_page_description":"The Viceroy of Liangjiang or Viceroy of the Two Jiangs, fully referred to in Chinese as the Governor-General of the Two Yangtze Provinces and Surrounding Areas Overseeing Military Affairs, Provisions and Funds, Manager of Waterways, Director of Civil Affairs, was one of eight regional Viceroys in China proper during the Qing dynasty. The Viceroy of Liangjiang had jurisdiction over Jiangsu, Jiangxi and Anhui provinces. Because Jiangsu and Anhui were previously part of a single province, Jiangnan, they were thus known, along with Jiangxi, as the two jiangs, hence the name \\"Liangjiang\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BA%D1%81-%D0%90%D0%BC%D1%84%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Fox-Amphoux.jpg","page_title":"Фокс-Амфу","context_page_description":"Фокс-Амфу — коммуна на юго-востоке Франции в регионе Прованс — Альпы — Лазурный берег, департамент Вар, округ Бриньоль, кантон Флейоск.\\nПлощадь коммуны — 40,76 км², население — 415 человек с тенденцией к росту: 483 человека, плотность населения — 12,0 чел/км²."},{"page_url":"https://en.wikipedia.org/wiki/The_Other_Place_(theatre)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Courtyard_Theatre_Stratford_upon_Avon.jpg","page_title":"The Other Place (theatre)","context_page_description":"The Other Place is a black box theatre on Southern Lane, near to the Royal Shakespeare Theatre in Stratford-upon-Avon, England. It is owned and operated by the Royal Shakespeare Company. In 2006, an earlier version of the theatre closed and reopened as the temporary and larger Courtyard Theatre, while the Royal Shakespeare and Swan Theatres were redeveloped. In March 2016, The Other Place, designed by Ian Ritchie Architects, was reinstated as a 200-seat studio theatre."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%A9%E8%86%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Sclera.PNG","page_title":"巩膜","context_page_description":"鞏膜屬於眼球纖維膜，在眼球內，約占眼球纖維膜的5/6，為乳白色不透明的纖維膜，起保護眼球內容物和維持眼球形態的作用。\\n鞏膜前緣接角膜緣，後方與視神經的硬膜鞘相延續。\\n鞏膜與角膜交界處外面稍內陷，稱作鞏膜溝。\\n靠近角膜緣處的虹膜基質內，有環形的鞏膜靜脈竇，它是房水流出的通道。\\n鞏膜正常呈乳白色，呈現黃色是黃疸的重要體徵。老年人的鞏膜略呈黃色，先天性薄鞏膜呈蔚藍色。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A4%D7%9C%D7%92%D7%AA_%D7%94%D7%A8%D7%A7%D7%95%D7%9C%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/MiznakLOP1.png","page_title":"הפלגת הרקולס","context_page_description":"הפלגת הרקולס היה השם שניתן למבצע הקפת יבשת אפריקה על ידי שתי פריגטות של חיל הים הישראלי, מזירת הים התיכון לזירת הים האדום במסלול של כ-13,000 מייל ימי. הפריגטות אח\\"י מזנק ואח\\"י מבטח הפליגו מחיפה לשארם א-שייח' אחת אחרי השנייה מסביב ליבשת אפריקה. משך המבצע היה כחודשיים, מ-12 בנובמבר 1956, כאשר יצאה אח\\"י מזנק מחיפה, עד 16 ינואר 1957, כאשר אח\\"י משגב חזרה לחיפה."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BC%9D%E6%89%BF%E6%8A%98%E3%82%8A%E7%B4%99%E3%81%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/PaperCranes.jpg","page_title":"伝承折り紙の一覧","context_page_description":"伝承折り紙の一覧は、折り紙の伝承作品の一覧である。"},{"page_url":"https://en.wikipedia.org/wiki/Alan_Shepard","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Alan_Shepard%27s_105th_Sortie_with_F4U-4_on_USS_Franklin_D._Roosevelt.jpg","page_title":"Alan Shepard","context_page_description":"Rear Admiral Alan Bartlett Shepard Jr. was an American astronaut, naval aviator, test pilot, and businessman. In 1961, he became the first American to travel into space, and in 1971, he walked on the Moon.\\nA graduate of the United States Naval Academy at Annapolis, Shepard saw action with the surface navy during World War II. He became a naval aviator in 1946, and a test pilot in 1950. He was selected as one of the original NASA Mercury Seven astronauts in 1959, and in May 1961 he made the first crewed Project Mercury flight, Mercury-Redstone 3, in a spacecraft he named Freedom 7. His craft entered space, but was not capable of achieving orbit. He became the second person, and the first American, to travel into space, and the first space traveler to manually control the orientation of his craft. In the final stages of Project Mercury, Shepard was scheduled to pilot the Mercury-Atlas 10, which was planned as a three-day mission. He named Mercury Spacecraft 15B Freedom 7 II in honor of his first spacecraft, but the mission was canceled."},{"page_url":"https://sco.wikipedia.org/wiki/Pape_Honorius_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Interior_of_Santi_Giovanni_e_Paolo_%28Venice%29_-_Honorius_III_by_Leandro_Bassano.jpg","page_title":"Pape Honorius III","context_page_description":"Pape Honorius III, born as Cencio Savelli, wis Pape frae 18 Julie 1216 tae his daith in 1227."},{"page_url":"https://en.wikipedia.org/wiki/Ouvrage_Rimplas","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Bloc_B5_de_Rimpla_%282%29.JPG","page_title":"Ouvrage Rimplas","context_page_description":"Ouvrage Rimplas is a work of the Maginot Line's Alpine extension, the Alpine Line, known also as the Little Maginot Line. The ouvrage consists of one entry block, two infantry blocks and three artillery blocks at an altitude of 986 metres. It was the first ouvrage of any portion of the Maginot Line to be completed, in 1928. The ouvrage features an aerial tram entrance.\\nLocated on a height to the southwest of Rimplas, the position was originally called Ouvrage de la Madeleine. While it was a prototype for later work, it is not entirely typical of Maginot fortifications, with large expanses of wall armored with 20 cm steel plate and other sections overlaid with stone masonry. The construction encountered problems with soil consistency and water infiltration. The underground portion of the ouvrage, containing the ammunition magazines, living quarters, command spaces, generating plant and communication galleries between the combat blocks covers three levels. Rimplas stands on a prominent height above the Tinée and Valdeblore valleys before their streams join to form the river Var."},{"page_url":"https://de.wikipedia.org/wiki/Paul_Grimault","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/B.Fi%C3%A9v%C3%A9-G%C3%A9meaux_1.jpg","page_title":"Paul Grimault","context_page_description":"Paul Grimault war einer der bedeutendsten französischen Zeichentrickfilmer und Regisseure.\\nBekannt wurde er ab 1937 durch seine Kinder- und Märchenfilme, die zunächst als Kurzfilme, später als Trickfilme produziert wurden.\\nSein Kurzfilm Der kleine Soldat nach einem Märchen von Hans Christian Andersen, zu dem Jacques Prévert das Drehbuch schrieb, bekam den Preis des besten Zeichentrickfilms beim Festival von Venedig 1948, gemeinsam mit Melody Time von Walt Disney.\\nSein bekanntestes und auch persönlichstes Werk ist Der König und der Vogel. Der französische Meister des Trickfilmes arbeitete seit 1947 an Andersens Die Hirtin und der Schornsteinfeger. Nachdem sein Werk 1953 in einer, laut Grimault, verunstalteten Fassung aufgeführt worden war, erwarb er 1966 die Rechte am Zeichentrickfilm und gestaltete als 75-Jähriger seine persönliche Fassung. Die Neufassung, welche Dialoge und Chansontexte von Jacques Prévert beinhaltet, wurde mehrfach international ausgezeichnet.\\n1979 gewann Paul Grimault den Louis-Delluc-Preis für Der König und der Vogel. 1989 bekam er den Ehrenpreis des französischen Filmpreises César verliehen."},{"page_url":"https://nl.wikipedia.org/wiki/Grote_moskee_van_Damascus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Omayyad_mosque.jpg","page_title":"Grote moskee van Damascus","context_page_description":"De Grote moskee van Damascus, ook wel de Omajjadenmoskee genoemd, is de belangrijkste moskee van de Syrische hoofdstad Damascus. De moskee is een belangrijk gebouw, zowel wat betreft de architectuur als de religieuze betekenis van dit heiligdom. Na de Arabische verovering van Damascus in 634 werd de moskee tussen 706 en 715 gebouwd door de Omajjadenkalief al-Walid I op de plaats van een christelijke basiliek toegewijd aan Johannes de Doper. Bijzonder is dat het hoofd van Johannes de Doper er als relikwie bewaard zou zijn. Johannes de Doper wordt zowel door de christenen als door de moslims als profeet beschouwd."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mammals_of_North_Macedonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Wildkatze_002.jpg","page_title":"List of mammals of North Macedonia","context_page_description":"This list shows the IUCN Red List status of the 56 mammal species occurring in North Macedonia. Nine are vulnerable and three are near threatened.\\nThe following tags are used to highlight each species' status as assessed on the respective IUCN Red List published by the International Union for Conservation of Nature:\\nSome species were assessed using an earlier set of criteria. Species assessed using this system have the following instead of near threatened and least concern categories:"},{"page_url":"https://ceb.wikipedia.org/wiki/Tanana_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/PostcardTananaAlaska1910.jpg","page_title":"Tanana (lungsod)","context_page_description":"Lungsod ang Tanana sa Tinipong Bansa. Ang Tanana nahimutang sa kondado sa Yukon-Koyukuk Census Area ug estado sa Alaska, sa amihanan-kasadpang bahin sa nasod, 5,500 km sa kasadpan sa ulohang dakbayan Washington, D.C. 63 metros ibabaw sa dagat kahaboga ang nahimutangan sa Tanana, ug adunay 246 ka molupyo.\\nAng yuta palibot sa Tanana kay patag sa habagatan, apan sa amihanan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 229 ka metro ug 3.2 km sa sidlakan sa Tanana. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Tanana. Hapit nalukop sa durowan ug kabugangan ang palibot sa Tanana. Sa rehiyon palibot sa Tanana, kapuloan talagsaon komon.\\nAng klima boreal. Ang kasarangang giiniton -5 °C. Ang kinainitan nga bulan Hulyo, sa 14 °C, ug ang kinabugnawan Enero, sa -23 °C."},{"page_url":"https://nl.wikipedia.org/wiki/Pet%C5%99vald_(okres_Karvin%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Radnice%2C_Pet%C5%99vald_%28Karvin%C3%A1%29.JPG","page_title":"Petřvald (okres Karviná)","context_page_description":"Petřvald is een Tsjechische stad in de regio Moravië-Silezië, en maakt deel uit van het district Karviná.\\nPetřvald telt 6999 inwoners."},{"page_url":"https://fi.wikipedia.org/wiki/Gran_Canaria","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Las_Canteras_Beach_Avenue-Las_Palmas_Gran_Canaria.jpg","page_title":"Gran Canaria","context_page_description":"Gran Canaria on Espanjalle kuuluva saari Atlantin valtamerellä. Se on kolmanneksi suurin Kanariansaarista. Saari sijaitsee noin 210 kilometrin päässä Pohjois-Afrikan rannikosta. Saaren pinta-ala on 1 530 km² ja korkein kohta 1 949 metriä. Saari on pyöreä ja halkaisijaltaan noin 50 kilometriä. Gran Canaria on syntynyt kuumasta kohdasta muiden Kanariansaarten tapaan.\\nSaaren väkiluku oli 850 391 vuonna 2011 ja asukkaista 381 123 asui pääkaupungissa Las Palmas de Gran Canariassa."},{"page_url":"https://de.wikipedia.org/wiki/Kantate","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Guerre_des_Paysans_Freyheit_1525.jpg","page_title":"Kantate","context_page_description":"Die Kantate bezeichnet in der Musik eine Formenfamilie von mehrsätzigen Werken für eine oder mehrere Gesangsstimmen und Instrumentalbegleitung. Rezitative, Arien, Ariosi, Chorsätze, Choräle und instrumentale Vor- und Zwischenspiele können sich in beliebiger Anzahl abwechseln.\\nEs gibt sowohl geistliche als auch weltliche Kantaten. Als Kammerkantate wird eine Kantate ab dem 17. Jahrhundert bezeichnet, wenn sie nur für eine Vokalstimme, Generalbass und gelegentlich auch wenige Melodieinstrumente bestimmt ist. Die Choralkantate folgt im Duktus und Inhalt einem geistlichen Choral. Die Kinderkantate ist ein Werk für Kinderchor, die auch szenische und pädagogische Elemente enthalten kann. Für das Weihnachtsfest werden bis heute Weihnachtskantaten geschrieben.\\nAls Teil der Verkündigung im Gottesdienst erlangte die Kantate ihre größte Bedeutung in der ersten Hälfte des 18. Jahrhunderts."},{"page_url":"https://it.wikipedia.org/wiki/Bullenbeisser","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/N._2._Grosser_B%C3%A4hrenbei%C3%9Fer_Ridinger.png","page_title":"Bullenbeisser","context_page_description":"Il Bullenbeisser, conosciuto anche come Bullen, noto come German Bulldog dai cinofili anglofoni e \\"Vecchio mastino tedesco\\" da quelli italiani, era una razza canina molossoide originaria della Germania e ormai estinta. Strettamente imparentato con il Bärenbeisser, altra razza canina germanica estinta, servì da base per la selezione dei molossoidi tedeschi da guardia-difesa: Rottweiler, Deutscher Boxer, Alano, ecc.\\nSono note due varianti geografiche della razza: il Brabanter Bullenbeisser, più piccolo, ed il Danziger Bullenbeisser di dimensioni maggiori."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%81%D9%84%D8%A7%D8%AD_%D9%88_%D8%A8%DB%81%D8%A8%D9%88%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Park_in_bath_england_arp.jpg","page_title":"فلاح و بہبود","context_page_description":"عوامی فلاح و بہبود جس کو انگریزی میں public welfare کہا جاسکتا ہے کسی معاشرے میں بسنے والے عوام الناس کی کیفیت حیات اور ان کے راحت الوجود کے معیار کو بہتر بنانے کے معنوں میں ادا کی جانے والی ایک اصطلاح ہے۔ اردو زبان میں اسے عوامی رفاہ بھی کہا جاتا ہے جو انگریزی کا بہتر لفظی متبادل محسوس ہوتا ہے لیکن عوامی فلاح و بہبود کا لفظ انگریزی اصطلاح سے زیادہ وسعت رکھتا ہے اور اپنے مفہوم میں زیادہ واضح ہے اس وجہ سے اس صفحے کا عنوان محض رفاہ یا فلاح یا عوامی رفاہ کی بجائے عوامی فلاح و بہبود انتخاب پایا۔ سطرالاول میں بیان کردہ تعریف عوامی فلاح کی نصابی تعریف کے طور پر پیش کی جاتی ہے اور اس فلاحی و بہبودی کام کو انجام دینے والے وسیلے کے طور پر اولاً حکومت کو ذمہ دار ٹہرایا جاتا ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Kungsleden","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Kungsleden_from_tjakta.jpg","page_title":"Kungsleden","context_page_description":"Kungsleden, mot suédois signifiant Voie Royale, est un sentier de trekking d'environ 425 km de longueur, au nord de la Suède.\\nLa Voie Royale est divisée en quatre parties correspondant chacune à environ une semaine de marche. Sa création remonte à la fin du XIXᵉ siècle, à l'initiative du Svenska Turistföreningen. La création de ce chemin visait à rendre accessibles les magnifiques paysages lapons. L'itinéraire a progressivement été équipé en refuges."},{"page_url":"https://vi.wikipedia.org/wiki/X%C3%A3_Marion,_Qu%E1%BA%ADn_Morgan,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Map_of_Morgan_County_Ohio_With_Municipal_and_Township_Labels.PNG","page_title":"Xã Marion, Quận Morgan, Ohio","context_page_description":"Xã Marion là một xã thuộc quận Morgan, tiểu bang Ohio, Hoa Kỳ. Năm 2010, dân số của xã này là 1.323 người."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BD%D0%B5%D0%BB%D0%B0%D1%81,_%D0%90%D0%B4%D0%B0%D0%BC_%D0%90%D0%B4%D0%B0%D0%BC%D0%BE%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Egyptgates.jpg","page_title":"Менелас, Адам Адамович","context_page_description":"Ада́м Ада́мович Менела́с — шотландский архитектор, работавший в России, мастер земляных работ и садово-паркового искусства. Представитель романтической неоготики."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A6%D8%AD%D8%A9_%D9%83%D9%88%D9%81%D9%8A%D8%AF-19_%D8%B9%D9%84%D9%89_%D9%85%D8%AA%D9%86_%D8%A7%D9%84%D8%B3%D9%81%D9%86_%D8%A7%D9%84%D8%A8%D8%AD%D8%B1%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/USS_Ralph_Johnson_%28DDG-114%29_during_builder%27s_sea_trials_in_the_Gulf_of_Mexico_US_Navy_170727-N-N0101-001.jpg","page_title":"جائحة كوفيد-19 على متن السفن البحرية","context_page_description":"انتشرت جائحة كوفيد-19 إلى العديد من السفن البحرية العسكرية. ساهمت طبيعة هذه السفن، والتي تشتمل على العمل مع أشخاص آخرين في مناطق صغيرة مغلقة ونقص في الأماكن الخاصة للغالبية العظمى من أفراد الطاقم، في الانتشار السريع للمرض، وحتى أكثر من انتشاره على متن سفن الرحلات السياحية.\\nنظرًا لطبيعة أمن العمليات، قد يكون لدى الجيوش الوطنية سياسات معينة تمنع أو تقيد الإبلاغ عن العدوى بفيروس كورونا المرتبط بالمتلازمة التنفسية الحادة الشديدة النوع 2 أو الوفيات نتيجة الإصابة بفيروس كوفيد-19، لذلك، على الرغم من أن الحالات المذكورة أدناه أبلغ عنها على نطاق واسع من مصادر موثوقة، إلا أن تأكيد المتحدثين الرسميين بالنسبة للجيوش المعنيين لم يكن منهجيًا."},{"page_url":"https://es.wikipedia.org/wiki/Prism_(%C3%A1lbum)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Katy_Perry_-_The_Prismatic_09.jpg","page_title":"Prism (álbum)","context_page_description":"Prism es el tercer álbum de estudio de la cantante estadounidense Katy Perry, publicado el 22 de octubre de 2013 por el sello discográfico Capitol. El disco contó con varios productores como Dr. Luke, Max Martin, Benny Blanco, StarGate y Greg Wells —quienes habían trabajado con la artista en su anterior disco Teenage Dream—. Perry coescribió todas las canciones, con la ayuda de Bonnie McKee, Emeli Sandé, Sia Furler y Lukasz Gottwald, entre otros.​ Asimismo, apareció como artista invitado el rapero estadounidense Juicy J, quien colaboró en un verso de la canción «Dark Horse».​ Originalmente Perry planeó crear un material «más oscuro»; pero durante su desarrollo cambió de idea porque se sintió «muy prismática» al inspirarse en el libro The Power of Now.​​​ En cuanto al sonido, algunos comentaristas indicaron que está muy influenciado por el pop sueco de los años 1990.​\\nEl álbum recibió revisiones mixtas de parte de los críticos.​ En el sitio web Metacritic, obtuvo 61 puntos sobre 100.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%86%D9%8A%D8%B3%D8%A9_%D8%A7%D9%84%D9%82%D9%8A%D8%A7%D9%85%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Golgotha_%28Church_of_the_Holy_Sepulchre%29.jpg","page_title":"كنيسة القيامة","context_page_description":"كنيسة القيامة أو كنيسة القبر المقدس هي كنيسة داخل أسوار البلدة القديمة في القدس. بنيت الكنيسة فوق جلجثة أو الجلجثة وهي مكان الصخرة التي يعتقد أن يسوع صلب عليها. وتعتبر أقدس الكنائس المسيحية والأكثر أهمية في العالم المسيحي وتحتوي الكنيسة وفق المعتقدات المسيحية على المكان الذي دفن فيه يسوع واسمه القبر المقدس.\\nسُمّيت كنيسة القيامة بهذا الاسم نسبة إلى قيامة يسوع من بين الأموات في اليوم الثالث من الأحداث التي ادت إلى موتة على الصليب. تتقاسم الكنيسة الأرثوذكسية الشرقية والكاثوليكية الأرثوذكسية المشرقية."},{"page_url":"https://en.wikipedia.org/wiki/Summerhill_(book)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/SummerhillSchool.jpg","page_title":"Summerhill (book)","context_page_description":"Summerhill: A Radical Approach to Child Rearing is a book about the English boarding school Summerhill School by its headmaster A. S. Neill. It is known for introducing his ideas to the American public. It was published in America on November 7, 1960, by the Hart Publishing Company and later revised as Summerhill School: A New View of Childhood in 1993. Its contents are a repackaged collection from four of Neill's previous works. The foreword was written by psychoanalyst Erich Fromm, who distinguished between authoritarian coercion and Summerhill.\\nThe seven chapters of the book cover the origins and implementation of the school, and other topics in childrearing. Summerhill, founded in the 1920s, is run as a children's democracy under Neill's educational philosophy of self-regulation, where kids choose whether to go to lessons and how they want to live freely without imposing on others. The school makes its rules at a weekly schoolwide meeting where students and teachers each have one vote alike. Neill discarded other pedagogies for one of the innate goodness of the child."},{"page_url":"https://tr.wikipedia.org/wiki/Kent_m%C3%BCzesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Bristol_City_Museum_and_Art_Gallery_%282315%29.jpg","page_title":"Kent müzesi","context_page_description":"Kent müzesi veya kent tarihi müzesi; bir yerleşim yerinin antik ve yakın geçmişi, siyasi tarihi, kültürü ve halkı hakkında bilgi vermek, var olan belge ve eşyaları ise korumak amacıyla oluşturulan bir müze türüdür. Türk müze bilimci Suay Aksoy kent müzelerini \\"Kent müzesinin en önemli koleksiyon malzemesi kentin kendisidir ve içindeki insanlardır.\\" olarak tanımlamaktadır."},{"page_url":"https://pl.wikipedia.org/wiki/Goodwater","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Goodwater_Alabama.JPG","page_title":"Goodwater","context_page_description":"Goodwater – miasto w Stanach Zjednoczonych, w stanie Alabama, w hrabstwie Coosa."},{"page_url":"https://es.wikipedia.org/wiki/Eigenji_(Shiga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Eigen-ji_%28Rinzai_temple%29.jpg","page_title":"Eigenji (Shiga)","context_page_description":"Eigenji fue un pueblo localizado en el Distrito de Kanzaki, Shiga, Japón.\\nEn 2003, el pueblo tenía una población estimada de 6.194 habitantes y una densidad de 34,17 habitantes por km². Su área total era de 181,27 km².\\nEl pueblo recibe su nombre tras el templo budista de Eigen-ji. Es un sitio conocido para ver las hojas rojas del arce japonés en otoño."},{"page_url":"https://de.wikipedia.org/wiki/OAuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Protocol-Flow.png","page_title":"OAuth","context_page_description":"OAuth ist der Name zweier verschiedener offener Protokolle, die eine standardisierte, sichere API-Autorisierung für Desktop-, Web- und Mobile-Anwendungen erlauben. OAuth 1.0 wurde ab 2006 entwickelt und 2007 veröffentlicht. OAuth 2.0, das sich grundlegend von OAuth 1.0 unterscheidet, wurde 2012 von der IETF als RFC 6749 und RFC 6750 veröffentlicht.\\nEin Endbenutzer kann mit Hilfe dieses Protokolls einer Anwendung den Zugriff auf seine Daten erlauben, die von einem anderen Dienst bereitgestellt werden, ohne geheime Details seiner Zugangsberechtigung dem Client preiszugeben. Der Endbenutzer kann so Dritten gestatten, in seinem Namen einen Dienst zu benutzen. Typischerweise wird dabei die Übermittlung von Passwörtern an Dritte vermieden.\\nAls Basis von OpenID Connect wird OAuth 2.0 heute in vielen Internetdiensten auch zur Authentifizierung von Benutzern eingesetzt."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kiinan_maakunnallisista_moottoriteist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/S40-CN_%28GZ%29_no_name.png","page_title":"Luettelo Kiinan maakunnallisista moottoriteistä","context_page_description":"Tämä luettelo kertoo Kiinan maakunnallisista moottoriteistä."},{"page_url":"https://fr.wikipedia.org/wiki/Tintin_au_pays_de_l%27or_noir","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Purfina_petrol_pump_at_the_Den_Hartog_Ford_museum_pic1.JPG","page_title":"Tintin au pays de l'or noir","context_page_description":"Tintin au pays de l’or noir est le quinzième album de bande dessinée des Aventures de Tintin, pré-publié en noir et blanc et en couleurs du 28 septembre 1939 au 9 mai 1940 dans les pages du Petit Vingtième, supplément du journal Le Vingtième Siècle, ainsi que dans l'hebdomadaire Cœurs vaillants, en noir et blanc puis en couleurs. Il parut à nouveau en couleur du 16 septembre 1948 au 23 février 1950 dans les pages du journal Tintin.\\nUne première version de l’album est parue en 1950 situant l'action en Palestine sous mandat britannique, puis une seconde en 1971 se déroulant dans un pays arabe imaginaire qu'Hergé baptise le Khemed."},{"page_url":"https://de.wikipedia.org/wiki/George_Petty","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Memphisbellenose.jpg","page_title":"George Petty","context_page_description":"George Brown Petty IV war ein US-amerikanischer Pin-Up-Maler. Seine Pin-Up-Bilder erschienen hauptsächlich in Esquire und True, sowie in Kalendern, die von den beiden Magazinen und von anderen Firmen zu Werbezwecken herausgegeben wurden. Petty zeichnete eine Reihe von Werbebildern im Pin-Up-Stil, seine Pin-Ups, die in der Mitte des Esquire auf dem Ausfalter abgedruckt wurden, sind der Ursprung des Centerfold. Seine „Petty-Girls“ dienten auch als Motiv-Vorlagen für die Nose art an Militärflugzeugen, wie beispielsweise an der „Memphis Belle“."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8E%E5%9C%8B%E9%86%AB%E7%99%82%E8%A1%9B%E7%94%9F%E7%B6%93%E8%B2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/US_healthcare_cost_panel_v1.png","page_title":"美國醫療衛生經費","context_page_description":"這篇美國醫療衛生經費是用來討論美國人如何獲得醫療衛生服務，如何支付，以及透過各種方式來衡量，為何美國的醫療衛生費用是世界最高的。"},{"page_url":"https://vi.wikipedia.org/wiki/Hinterzarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Hinterzarten_Kirche_und_Schanze.jpg","page_title":"Hinterzarten","context_page_description":"Hinterzarten là một đô thị ở rừng Đen, tây nam bang Baden-Württemberg, thuộc nước Đức. Đô thị Hinterzarten có diện tích 33,37 km². Đô Hinterzarten là một địa điểm du lịch với các hoạt động thể thao như trượt tuyết."},{"page_url":"https://ast.wikipedia.org/wiki/Eurocopa_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/The_opening_ceremony_of_the_first_European_games_7.jpg","page_title":"Eurocopa 2020","context_page_description":"La Eurocopa de fútbol 2020 o Euru 2020, va ser la decimosesta edición del tornéu européu de seleiciones nacionales. va celebrar nel branu de 2020 al cargu de la UEFA. Per primer vegada la fase final de la Eurocopa va tener como sedes a ciudaes de 12 asociaciones distintes del continente, según decisión adoptada en xineru de 2013 pol Comité Executivu de la UEFA. L'organismu continental ellaboró unos informes que fueron presentaos ante'l so Comité Executivu, que determinó'l 19 de setiembre de 2014, en Xinebra, les 12 ciudaes que van allugar el tornéu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D0%B9%D1%82,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Anton_Braith_Auf_dem_Weg_zur_Alm.jpg","page_title":"Брайт, Антон","context_page_description":"Антон Брайт — немецкий художник-пейзажист и анималист, профессор живописи Мюнхенской Академии живописи, почётный член Королевской Академии изящных искусств Мюнхена."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/T.B._Sutton_General_Store.jpg","page_title":"National Register of Historic Places listings in Tennessee","context_page_description":"This is a list of properties and historic districts in Tennessee that are listed on the National Register of Historic Places. There are over 2,000 in total. Of these, 29 are National Historic Landmarks. Each of Tennessee's 95 counties has at least one listing.\\nThe Tennessee Historical Commission, which manages the state's participation in the National Register program, reports that 80 percent of the state's area has been surveyed for historic buildings. Surveys for archaeological sites have been less extensive; coverage is estimated less than 5 percent of the state. Not all properties that have been determined to be eligible for National Register are listed.\\nThe locations of National Register properties and districts, may be seen in an online map by clicking on \\"Map of all coordinates\\".\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://cy.wikipedia.org/wiki/Telor_chwibanog","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Catharopeza_bishopi_Smit.jpg","page_title":"Telor chwibanog","context_page_description":"Aderyn a rhywogaeth o adar yw Telor chwibanog a adnabyddir hefyd gyda'i enw gwyddonol Catharopeza bishopi; yr enw Saesneg arno yw Whistling warbler. Mae'n perthyn i deulu'r Telorion y Byd Newydd sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn C. bishopi, sef enw'r rhywogaeth."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Mesnil-Saint-Firmin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/LMSF_chO.JPG","page_title":"Le Mesnil-Saint-Firmin","context_page_description":"Le Mesnil-Saint-Firmin est une commune française située dans le département de l'Oise en région Hauts-de-France.\\nSes habitants sont appelés les Mesnilois et les Mesniloises."},{"page_url":"https://vi.wikipedia.org/wiki/Ormetica_pauperis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Ormetica_pauperis.JPG","page_title":"Ormetica pauperis","context_page_description":"Ormetica pauperis là một loài bướm đêm thuộc phân họ Arctiinae, họ Erebidae."},{"page_url":"https://la.wikipedia.org/wiki/Graduale","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Gradual_of_King_John_Albert.jpg","page_title":"Graduale","context_page_description":"Graduale est psalmus ille responsorius, de quo Sanctus Augustinus et Sanctus Leo Magnus saepe commemorant, qui respondit primae lectioni Sacrae Scripturae. De more sic cantu profertur: psalmista ipsum psalmum; populus vero canit versum intercalarem, qui dicitur responsorium."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B2%B9%E9%8C%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Typical_saisenbako.jpg","page_title":"香油錢","context_page_description":"香油錢，又稱「香火錢」、「香紙錢」、「功德金」，捐贈香油錢稱作「添油香」、「添香油」等，在台灣，俗稱「添油香」、「寄付」、「寄付金」，在日本稱「賽錢」。有時被引申為奉獻給各種宗教的金錢。\\n古時信徒常以線香、蠟燭、燈油、金紙等物品，捐獻廟宇、寺院，以供祭祀之用。但後來逐漸不以實物捐贈，而以金錢替代，故稱香油錢、香火錢、香紙錢。"},{"page_url":"https://zh.wikipedia.org/wiki/2007%E5%B9%B4%E6%B0%91%E4%B8%BB%E9%80%B2%E6%AD%A5%E9%BB%A8%E7%B8%BD%E7%B5%B1%E6%8F%90%E5%90%8D%E9%81%B8%E8%88%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/2007TaipeiInternationalFlowerExhibition_AnnetteLu.jpg","page_title":"2007年民主進步黨總統提名選舉","context_page_description":"民主進步黨第十二任總統提名選舉，於2007年4月19日舉行，是民主進步黨所舉辦的第四次中華民國總統候選人初選。"},{"page_url":"https://sv.wikipedia.org/wiki/Raggiparadisf%C3%A5gel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Raggiana_Bird-of-Paradise_wild_5.jpg","page_title":"Raggiparadisfågel","context_page_description":"Raggiparadisfågel är en fågel i familjen paradisfåglar inom ordningen tättingar. IUCN kategoriserar arten som livskraftig.\\nRaggiparadisfågel delas in i fyra underarter:\\nP. r. raggiana – förekommer längs södra vattendelaren av sydöstra Papua Nya Guinea\\nP. r. salvadorii – förekommer i lågland i södra Papua Nya Guinea\\nP. r. intermedia – förekommer utmed norra kusten i sydöstra Papua Nya Guinea\\nP. r. augustaevictoriae – förekommer på"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1951/Voorstel","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Verdijk%2C_A._-_SFA008007375.jpg","page_title":"Lijst van personen overleden in 1951/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1951.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Phil_Read","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/06-08-05-RupHoll-Phil_Read_-164.jpg","page_title":"Phil Read","context_page_description":"Phillip William „Phil“ Read, MBE, ist ein britischer Motorradrennfahrer."},{"page_url":"https://en.wikipedia.org/wiki/Washington_and_Old_Dominion_Railroad","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/1st_Ohio_Volunteer_Infantry_%28etching_by_Frank_Leslie%2C_1861%29.jpg","page_title":"Washington and Old Dominion Railroad","context_page_description":"The Washington and Old Dominion Railroad, the successor to the bankrupt Washington and Old Dominion Railway, was an intrastate short-line railroad located in Northern Virginia. Its oldest line extended from Alexandria on the Potomac River northwest to Bluemont at the foot of the Blue Ridge Mountains near Snickers Gap, not far from the boundary line between Virginia and West Virginia. The railroad's route largely paralleled the routes of the Potomac River and the present Virginia State Route 7.\\nThe line followed the winding course of Four Mile Run upstream from Alexandria through Arlington to Falls Church. At that point, the railroad was above the Fall Line and was able to follow a more direct northwesterly course in Virginia through Dunn Loring, Vienna, Sunset Hills, Herndon, Sterling, Ashburn, Leesburg, Paeonian Springs, Hamilton, Purcellville and Round Hill to its terminus at Bluemont, turning sharply to the west only after passing through Clarke's Gap in Catoctin Mountain west of Leesburg. A branch connected the line to Rosslyn."},{"page_url":"https://pt.wikipedia.org/wiki/Pol_Calvet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/2012_2013_-_Pol_Calvet_-_Flickr_-_Castroquini-FCB.jpg","page_title":"Pol Calvet","context_page_description":"Pol Calvet Planellas, mais conhecido como Pol Calvet é um futebolista espanhol que atua como meio-campo. Atualmente joga pelo Los Angeles FC."},{"page_url":"https://hu.wikipedia.org/wiki/Robert_Kubica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Robert_Kubica_2008_Belgium.jpg","page_title":"Robert Kubica","context_page_description":"Robert Józef Kubica; az első lengyel Formula–1-es versenyző, 2006 és 2009 között a BMW Sauber csapatának pilótája volt. A 2010-es idényben a Renault-nál folytatta pályafutását. 2008-ban ő lett az első közép- és kelet-európai versenyző, aki Formula–1-es futamot nyert, miután elsőként intették le a 2008-as kanadai nagydíjon. Pályafutása során tizenkét alkalommal állt dobogón, és egy futamgyőzelemmel rendelkezik. Legjobb világbajnoki eredménye a 2008-ban elért 4. helyezése volt.\\n2011. február 6-án életveszélyes sérüléseket szenvedett egy olaszországi ralibalesetben a Ronde di Andora elnevezésű versenyen. Jobb karját majd hogy nem teljes egészében levágta a szétroncsolódott karosszéria. Ezt követően raliversenyeken vett részt, és bár a La Gazzetta dello Sportnak úgy nyilatkozott, hogy minél hamarabb vissza szeretne térni a királykategóriába és felépülése is mindvégig jó ütemben haladt, súlyosan rongálódott jobb kezének állapota miatt ki kellett hagynia a teljes 2011-es évadot, és sokáig nem sikerült visszatérnie a Formula–1-be. Egy későbbi interjúban ő maga is elismerte, hogy egészségi állapota miatt ez „szinte lehetetlen”."},{"page_url":"https://hu.wikipedia.org/wiki/Robert_Kubica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Robert_Kubica_2008_Belgium.jpg","page_title":"Robert Kubica","context_page_description":"Robert Józef Kubica; az első lengyel Formula–1-es versenyző, 2006 és 2009 között a BMW Sauber csapatának pilótája volt. A 2010-es idényben a Renault-nál folytatta pályafutását. 2008-ban ő lett az első közép- és kelet-európai versenyző, aki Formula–1-es futamot nyert, miután elsőként intették le a 2008-as kanadai nagydíjon. Pályafutása során tizenkét alkalommal állt dobogón, és egy futamgyőzelemmel rendelkezik. Legjobb világbajnoki eredménye a 2008-ban elért 4. helyezése volt.\\n2011. február 6-án életveszélyes sérüléseket szenvedett egy olaszországi ralibalesetben a Ronde di Andora elnevezésű versenyen. Jobb karját majd hogy nem teljes egészében levágta a szétroncsolódott karosszéria. Ezt követően raliversenyeken vett részt, és bár a La Gazzetta dello Sportnak úgy nyilatkozott, hogy minél hamarabb vissza szeretne térni a királykategóriába és felépülése is mindvégig jó ütemben haladt, súlyosan rongálódott jobb kezének állapota miatt ki kellett hagynia a teljes 2011-es évadot, és sokáig nem sikerült visszatérnie a Formula–1-be. Egy későbbi interjúban ő maga is elismerte, hogy egészségi állapota miatt ez „szinte lehetetlen”."},{"page_url":"https://ast.wikipedia.org/wiki/Rublu_sovi%C3%A9ticu","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/SUR_5_1991_B.jpg","page_title":"Rublu soviéticu","context_page_description":"El rublu foi la unidá monetaria de la Xunión Soviética ente 1919 y 1991. Taba estremáu en 100 kopeks. El so códigu ISO 4217 yera SUR."},{"page_url":"https://nl.wikipedia.org/wiki/Wimbledon_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Murray_A._US16_%2810%29_%2829236489603%29.jpg","page_title":"Wimbledon 2016","context_page_description":"De 130e editie van het Wimbledon Championship werd gespeeld van maandag 27 juni tot en met zondag 10 juli 2016. Voor de vrouwen was dit de 123e editie van het Engelse graskampioenschap. Het toernooi werd gespeeld bij de All England Lawn Tennis and Croquet Club in de wijk Wimbledon van de Engelse hoofdstad Londen.\\nDe Brit Andy Murray wist voor de tweede maal in zijn carrière de titel op Wimbledon te pakken. Bij de vrouwen presteerde Serena Williams dit voor de zevende maal. In het mannendubbelspel was het Franse duo Pierre-Hugues Herbert en Nicolas Mahut het sterkste. Bij de vrouwen waren dit de Amerikaanse zussen Venus en Serena Williams, zij wonnen het dubbelspel voor de vijfde maal. In het gemengd dubbelspel ging de titel naar de Britse Heather Watson en Fin Henri Kontinen.\\nTitelverdedigers bij het mannen- en vrouwenenkelspel waren de Serviër Novak Đoković en de Amerikaanse Serena Williams. Het mannendubbelspel in 2015 werd gewonnen door de Nederlander Jean-Julien Rojer en de Roemeen Horia Tecău. Bij de vrouwen waren Martina Hingis en Sania Mirza titelverdedigsters. De titel in het gemengd dubbelspel werd verdedigd door de Zwitserse Martina Hingis en Leander Paes uit India."},{"page_url":"https://hr.wikipedia.org/wiki/Fluorescentna_cijev","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Fluorescent_lighting_spectrum_peaks_labelled.png","page_title":"Fluorescentna cijev","context_page_description":"Fluorescentna cijev je električno rasvjetno tijelo kojemu svjetlost emitira fluorescentni sloj na stijenki cijevi, pobuđen električnim izbojem u smjesi živinih para i plemenitog plina pod niskim tlakom. Na krajevima cijevi ugrađene su dvije serijski spojene žičane elektrode, koje se prolaskom električne struje užare, a elektroni nastali termionskom emisijom ioniziraju živine pare i plemeniti plin i tako olakšavaju električno izbijanje u plinu između elektroda i pri nižim električnim naponima. Zato se fluorescentne cijevi napajaju izravno iz gradske električne mreže, za razliku od visokonaponskih svjetlećih cijevi kao što su na primjer neonske, koje se napajaju preko visokonaponskog transformatora.\\nNakon kratkotrajna žarenja elektroda, njihova se serijska veza prekida vanjskim toplinskim prekidačem, takozvanim starterom. U strujnom krugu napajanja cijevi nalazi se i vanjska električna zavojnica velike samoinduktivnosti."},{"page_url":"https://la.wikipedia.org/wiki/Historia_Afroamericanorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/AmericaAfrica.svg","page_title":"Historia Afroamericanorum","context_page_description":"Historia Afroamericanorum est pars historiae Civitatum Foederatarum quae gentes Afroamericanos tractat. Maior pars Afroamericanorum est progenies Afrorum nigricolorium inter annos 1619 et 1865 in Civitatibus Foederatis captivorum. Nigricolores ex Caribaeo qui in Civitates Foederates migraverunt et progenies eorum quoque Afroamericani habentur, quia historiam communem radicum Africanarum et servitutis possedent. Etiam aliquando historiam advenarum Africanorum recentium comprehendit."},{"page_url":"https://en.wikipedia.org/wiki/George_Henry_Paulin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/King_Robert_of_Sicily_by_George_Henry_Paulin%2C_Kibble_Palace%2C_Glasgow.jpg","page_title":"George Henry Paulin","context_page_description":"George Henry Paulin, often called Harry Paulin, or 'GHP' was a Scottish sculptor and artist of great note in the early 20th century."},{"page_url":"https://es.wikipedia.org/wiki/Jeep_Comando","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Jeep_Comando_HDI_2.jpg","page_title":"Jeep Comando","context_page_description":"El Jeep Comando es un vehículo todoterreno comercializado desde 1968 hasta los años 1980 por la empresa zaragozana Viasa. Fue construido bajo licencia de Willys por Carde y Escoriaza. La empresa francesa Hotchkiss intentó venderla en su mercado local sin demasiado éxito. Se vendió bajo diferentes denuminaciones comerciales: Furgón para la versión furgoneta cerrada, Toledo la versión de pasajeros, Dúplex la versión de cabina doble y Campeador la versión de caja abierta. También fue vendida en sus últimos años bajo las marcas Jeep-Ebro y Jeep-Avia. En total, sumando todas sus variantes, se construyeron unas 8 000 unidades.​\\nCuenta con una chasis de largueros y travesaños sobre el que se monta una carrocería con diseño basado en su homólogo americando Jeepster Commando. Equipó en un principio un motor 2.0 L Barreiros de 63 cv y, tras la compra de VIASA por parte de Motor Ibérica, sustituido desde 1978 por el motor Perkins 4.203, diésel, de 71 cv, así como un motor Hurricane F4-134 de la misma potencia. Se fabricó además bajo encargo de la empresa estadounidense un lote equipado con motores V6, destinados a la exportación a Sudamérica."},{"page_url":"https://es.wikipedia.org/wiki/Cervecer%C3%ADa_Regional","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Cerveceria_La_Regional.jpg","page_title":"Cervecería Regional","context_page_description":"Cervecería Regional C.A. es una empresa venezolana encargada de fabricar cervezas y bebidas a base de malta, fundada en 1929, y ubicada principalmente en Maracaibo, Zulia."},{"page_url":"https://fi.wikipedia.org/wiki/Ph%C3%BA_Qu%E1%BB%91c","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Fishignet.jpg","page_title":"Phú Quốc","context_page_description":"Phú Quốc on Vietnamille kuuluva saari, joka sijaitsee Siaminlahdella aivan Kambodžan rannikon edustalla. Saaren pääkaupunki on nimeltään Dương Đông. Saaren eteläosassa sijaitsee An Thoin satamakaupunki. Phú Quốcin väkiluku on nykyään noin 75 000, yli kymmenkertainen verrattuna vuoteen 1975, jolloin saarella asui vain 5 000 henkilöä. Kolmionmuotoinen saari on 50 km pitkä ja leveimmältä kohdaltaan vain 25 km, pinta-alaa sillä on 597 neliökilometriä. Hallinnollisesti Phú Quốc kuuluu Kiên Giangin maakuntaan.\\nKoko eteläinen Vietnam kuului vielä 1600-luvulla Khmerien valtakuntaan, kunnes vietnamilaiset valloittivat alueen itselleen. Kiista saaren omistuksesta jatkuu kuitenkin edelleen.\\nVielä 1990-luvun puolivälissä saarella toimi vain kaksi melko alkeellista hotellia, ja vain toisella niistä oli lupa ottaa vastaan ulkomaisia vieraita. Armeija valvoi tiukasti aluetta ja liikkuminen oli rajoitettua. Phú Quốcin pohjoisrannalla sijaitsee edelleen peräti kuusi Vietnamin armeijan tukikohtaa. Saaren eteläkärjessä sijaitsee merivoimien tukikohta. Matkailu on kuitenkin noussut saaren yhdeksi pääelinkeinoksi.\\nMuita tärkeitä elinkeinoja ovat kalastus ja pippurinviljely."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%B8_%D0%A2%D0%B8%D1%80%D0%B0%D1%81%D0%BF%D0%BE%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%B7%D0%B0%D1%89%D0%B8%D1%82%D0%BD%D0%B8%D0%BA%D0%B0%D0%BC_%D0%9F%D1%80%D0%B8%D0%B4%D0%BD%D0%B5%D1%81%D1%82%D1%80%D0%BE%D0%B2%D1%8C%D1%8F_-_%D0%94%D0%BE%D0%BD%D0%BE%D1%80.jpg","page_title":"Памятники Тирасполя","context_page_description":"Па́мятники Тирасполя — список всех памятников выдающимся людям, мемориальных комплексов и монументов на территории города Тирасполь, Приднестровье."},{"page_url":"https://sv.wikipedia.org/wiki/Carex_sempervirens","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Carex_sempervirens_%28Horst-Segge%29_IMG_7635.jpg","page_title":"Carex sempervirens","context_page_description":"Carex sempervirens är en halvgräsart som beskrevs av Dominique Villars. Carex sempervirens ingår i släktet starrar, och familjen halvgräs. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E4%BA%AC%E5%B8%82%E5%A2%83%E5%86%85%E7%9A%84%E6%B1%9F%E8%8B%8F%E7%9C%81%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Nanjing_museum_front_view.jpg","page_title":"南京市境内的江苏省文物保护单位列表","context_page_description":"本列表是中华人民共和国江苏省文物保护单位的子列表，列举在南京市境内的江苏省文物保护单位。不包括已升格为全国重点文物保护单位的文物。"},{"page_url":"https://nn.wikipedia.org/wiki/Asalslekta","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Sorbus_x_ambigua_IMG_3983.JPG","page_title":"Asalslekta","context_page_description":"Asalslekta er ei slekt i rosefamilien. Ho inneheld små tre og buskar som har blad med grovtakka kant. Blomane er femtalige og kvite eller rosa med mange støvberarar. Vekstane har bær som ofte er raude, men nokre artar kan òg ha kvite, gule eller grøne bær.\\nPlanteslekta omfattar om lag 100–200 artar. Enkelte forskarar plasserer desse i underslektene Sorbus, Aria, Micromeles, Cormus, Torminaria og Chamaemespilus. Fleire av artane er apomiktar og dannar lett hybridar. Det finst derfor ei rekkje typar tre som er endemiske innanfor eit mindre område.\\nDette er ei svært utbreidd slekt i Europa. I Noreg finst artane rogn og rognasal, i tillegg til fleire lokale endemiske artart. I alt veks 16 asal-artar i Norden, 12 av dei i Noreg.\\nTre i asalslekta kan ha lappete, finnete eller sagtakka blad som alltid er skruestilte. Greinene har ikkje tornar. Dei femtalige blomane har flate kronblad som er lengre enn begeret. Talet på støvberarar er høgt, normalt 15–25. Frukta er små, bær-liknende eple som er inntil 3 cm store, og har 2–3 fråskilde kammer eller rom."},{"page_url":"https://pl.wikipedia.org/wiki/Argan%C3%A7on","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Argan%C3%A7on_%C3%A9glise.JPG","page_title":"Argançon","context_page_description":"Argançon – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Aube.\\nWedług danych na rok 1990 gminę zamieszkiwało 117 osób, a gęstość zaludnienia wynosiła 14 osób/km²."},{"page_url":"https://pl.wikipedia.org/wiki/Jaskinia_Jasna_(Zakrz%C3%B3wek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Jasna_Cave_in_Zakrz%C3%B3wek_Park_DK45_%282%29.jpg","page_title":"Jaskinia Jasna (Zakrzówek)","context_page_description":"Jaskinia Jasna – jaskinia krasowa, znajdująca się w Krakowie, w północno-zachodniej części wzgórza zrębowego Krzemionek Zakrzowskich, w części zwanej Skałkami Twardowskiego, niedaleko Wisły."},{"page_url":"https://en.wikipedia.org/wiki/Toshio_Shiratori","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/ShiratoriToshio.jpg","page_title":"Toshio Shiratori","context_page_description":"Toshio Shiratori was the Japanese ambassador to Italy from 1938 to 1940, adviser to the Japanese foreign minister in 1940 and one of the 14 Class-A war criminals enshrined at Yasukuni.\\nShiratori served as Director of Information Bureau under the Foreign Ministry from 1929 to 1933. He served as Ambassador to Sweden and non-resident Ambassador to Finland from 1933 to 1936. Grand Cross of the Royal Swedish Order of the Polar Star 1939. He was appointed ambassador to Italy, serving from 1938 to 1940, and became adviser to the foreign minister in 1940. He was an advocate of military expansionism, counseling an alliance between Nazi Germany, Italy and Japan to facilitate world domination.\\nOn 23rd May, 1942, the Italian Foreign Minister Count Galeazzo Ciano wrote in his diary that Shiratori had said that, the 'dominion of the world belongs to Japan, the Mikado is the only god on earth, and that both Hitler and Mussolini must become resigned to this reality.'\\nShiratori was found guilty of conspiring to wage aggressive war by the International Military Tribunal for the Far East in November 1948 and sentenced to life imprisonment. He died in prison of laryngeal cancer in 1949."},{"page_url":"https://pl.wikipedia.org/wiki/Artur_Hausner","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Artur_Hausner.jpg","page_title":"Artur Hausner","context_page_description":"Artur Walenty Hausner – polski polityk, działacz socjalistyczny, publicysta, poseł na Sejm Ustawodawczy oraz Sejm I i II kadencji w II RP."},{"page_url":"https://ro.wikipedia.org/wiki/Aparatul_genital_feminin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Vulva_labeled_Romanian.png","page_title":"Aparatul genital feminin","context_page_description":"Aparatul genital al femeii este alcătuit din două glande sexuale, numite ovare, și următoarele organe: două trompe, uter, vagin, vulvă; toate acestea sunt localizate în partea inferioară a cavității abdominale. Trompele se deschid în uter, organ asemănător unui sac, al cărui perete gros și musculos este căptușit cu o mucoasă. Acest organ se continuă cu vaginul, care se deschide la exterior prin vulvă. Organele sexuale exterioare ale unei femei au o structură complexă fiind reprezentate prin: buzele vaginale, aparatul erectil și glandele anexe. În timpul sarcinii, viitorul copil se dezvoltă în uter."},{"page_url":"https://sh.wikipedia.org/wiki/Jordan,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Jordan_Village_Hall_Dec_08.jpg","page_title":"Jordan, New York","context_page_description":"Džordan je grad u američkoj saveznoj državi Njujork."},{"page_url":"https://es.wikipedia.org/wiki/Sociedad_Internacional_de_SIDA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/International_AIDS_Conference_2012_%28Washington%2C_DC%29_%287691329366%29.jpg","page_title":"Sociedad Internacional de SIDA","context_page_description":"La Sociedad Internacional de SIDA conocida como IAS, es la mayor asociación mundial de profesionales del virus de la inmunodeficiencia humana, con miembros en más de 190 países que trabajan en todos los frentes como la respuesta mundial al VIH/sida.​ La IAS es también el administrador de dos conferencias sobre el tema más prestigiosas del mundo; la Conferencia Internacional sobre el Sida y la Conferencia sobre Patogénesis; tratamiento y prevención."},{"page_url":"https://en.wikipedia.org/wiki/Area_codes_317_and_463","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Map_of_Indiana_highlighting_Nine-County_Region.PNG","page_title":"Area codes 317 and 463","context_page_description":"Area codes 317 and 463 are North American Numbering Plan area codes for Indianapolis and nine surrounding counties in central Indiana. It covers all or part of Marion, Boone, Hancock, Hamilton, Hendricks, Johnson, Madison, Morgan, and Shelby counties. 317 is the original area code, while 463 is an overlay covering the same area, making ten-digit dialing mandatory for all calls in the region."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B9%D0%B4%D0%B5%D1%80%D1%84%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Neud%C3%B6rfl_im_Bezirk_MA.png","page_title":"Нойдерфль","context_page_description":"Нойдерфль — ярмаркова громада округу Маттерсбург у землі Бургенланд, Австрія.\\nНойдерфль лежить на висоті 273 м над рівнем моря і займає площу 9 км². Громада налічує 4282 мешканців.\\nГустота населення 476/км².\\nБургомістом міста є Дітер Пош від Соціал-демократичної партії Австрії. Адреса управління громади: 7201 Neudörfl."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E8%AD%A6%E5%AF%9F%E7%BD%B2_(%E6%84%9B%E7%9F%A5%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/ja/4/43/Nagoya_Minami_police-stn.jpg","page_title":"南警察署 (愛知県)","context_page_description":"南警察署は、愛知県警察が管轄する警察署の一つ。大規模警察署であり、署長は警視正。"},{"page_url":"https://en.wikipedia.org/wiki/Arabic_script","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Wikipedia_in_Arabic_script_languages_in_KACST_Office.svg","page_title":"Arabic script","context_page_description":"The Arabic script is a writing system used for writing Arabic and several other languages of Asia and Africa, such as Persian, Uyghur, Kurdish, Punjabi, Sindhi, Balochi, Pashto, Dari, Lurish, Urdu, Kashmiri, Rohingya, Somali, and Mandinka, among others. Until the 16th century, it was also used to write some texts in Spanish. Additionally, prior to the language reform in 1928, it was the writing system of Turkish. It is the second-most widely used writing system in the world by the number of countries using it and the third by the number of users, after the Latin and Chinese scripts.\\nThe Arabic script is written from right to left in a cursive style, in which most of the letters are written in slightly different forms according to whether they stand alone or are joined to a following or preceding letter. The basic letter form remains unchanged. In most cases, the letters transcribe consonants or consonants and a few vowels, so most Arabic alphabets are abjads. Additionally, it does not have capital letters.\\nThe script was first used to write texts in Arabic, most notably the Qurʼān, the holy book of Islam."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BE%D1%80%D0%BE%D1%81%D1%82%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0_%D0%9F%D0%B5%D0%BA%D0%B8%D0%BD_%E2%80%94_%D0%A5%D0%B0%D1%80%D0%B1%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Map_of_China_NTHS_Expressway_G1.png","page_title":"Скоростная дорога Пекин — Харбин","context_page_description":"Скоростная дорога Пекин — Харбин, обозначаемая G1, в сокращённом варианте —; расположена на севере и северо-востоке Китая.\\nНазвание скоростная дорога Цзинха состоит из двух иероглифов: цзин, являющегося частью слова Бэйцзин и ха, являющего частью слова Харбин."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_Notre-Dame_de_Polignan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Chapelle_Notre-Dame_de_Polignan_17.jpg","page_title":"Chapelle Notre-Dame de Polignan","context_page_description":"La chapelle Notre-Dame de Polignan est un édifice religieux catholique située à Gourdan-Polignan, en France.\\nLe retable triptyque du maître-autel et les vantaux du portail sont classés au titre d'objet des monuments historiques de France."},{"page_url":"https://hr.wikipedia.org/wiki/Hrvatske_narodne_no%C5%A1nje","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Mo%C5%A1%C4%87enice038.jpg","page_title":"Hrvatske narodne nošnje","context_page_description":"Hrvatske narodne nošnje predstavljaju dio kulturne baštine hrvatskog naroda s neobično širokim rasponom različitih nošnji. Narodne nošnje i folklor su neodvojivo povezani s načinom života te reflektiraju društvene i kulturne posebnosti pojedinih zemljopisnih područja i podneblja gdje žive Hrvati.\\nIzraz su likovnog shvaćanja i odražavaju razne povijesne utjecaje.\\nHrvatske narodne nošnje vrlo su raznolike i bogato izrađene. Do polovice 19. stoljeća nosilo ih je uglavnom stanovništvo u seoskim sredinama. Po načinu odijevanja prepoznavalo se odakle osoba dolazi.\\nHrvatske narodne nošnje mogu se grubo podijeliti na nošnje jadranske, panonske i dinarske Hrvatske."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%B2%D0%BE%D0%BD-%D1%80%D0%B5%D0%BA%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Devon_Rex.jpg","page_title":"Девон-рекс","context_page_description":"Девонський рекс, Девон — порода кішок, що виникла в результаті мутації у короткошерстих європейських кішок."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_de_Ballycroy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Actitis_hypoleucos_3_%28Marek_Szczepanek%29.jpg","page_title":"Parc national de Ballycroy","context_page_description":"Le parc national de Ballycroy est un parc national de la côte ouest de l'Irlande situé dans le comté de Mayo. S'étendant sur 11 000 hectares, il est traversé par le massif du Nephin Beg et recouvert de vastes tourbières abritant une biodiversité très riche.\\nLe parc est établi en 1998 et est compris dans l'Owenduff/Nephin Complex, une aire protégée au double statut de zone spéciale de conservation et de zone de protection spéciale."},{"page_url":"https://simple.wikipedia.org/wiki/David_Cliche","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/David_Cliche.jpg","page_title":"David Cliche","context_page_description":"David Cliche was a Canadian politician. He represented Vimont in the National Assembly of Quebec from 1994 to 2002. He was a member of the Parti Québécois. After leaving politics, he became an environmental businessman. Cliche was born in Saint-Joseph-de-Beauce, Quebec.\\nCliche died of brain cancer on July 19, 2020 at his home in Saint-Étienne-de-Bolton, Quebec, aged 68."},{"page_url":"https://nl.wikipedia.org/wiki/Den_Haag-Tempel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Osylaan_Zoetermeer.jpg","page_title":"Den Haag-Tempel","context_page_description":"De Den Haag-Tempel van de Kerk van Jezus Christus van de Heiligen der Laatste Dagen in de Nederlandse gemeente Zoetermeer is ontworpen door de architecten van Meijer & Van Eerden uit Zoetermeer en opgetrokken uit Olympia White graniet. Onder de 141 tempels van dit genootschap in de wereld, is het de enige die enkele meters onder de zeespiegel is gebouwd. De bouw werd aangekondigd in augustus 1999 en maakt deel uit van een plan om leden van de Kerk wereldwijd binnen bereik van een tempel te brengen. De Den Haag-Tempel is een klein model tempel met één serie zalen voor verordeningen en twee verzegelkamers voor huwelijken.\\nDe tempel is gebouwd op de locatie waar voorheen een kerkgebouw stond van de kerkgemeente Zoetermeer. De Kerk is sinds 1861 in Nederland gevestigd, de gemeente Zoetermeer is in de jaren 70 opgericht.\\nVoor leden van de Kerk zijn een kerkgebouw en de tempel twee verschillende gebouwen met ieder een eigen functie. Hierin volgen zij de gebruiken van Joden en vroege Christenen die naast de plaatselijke synagoge ook de tempel hadden. Een kerkgebouw is bedoeld als gemeenschapshuis, om wekelijks samen te komen voor de verordening van het avondmaal en als zondagsschool."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%9A_%D0%9F%D0%B0%D0%BB%D0%B8%D0%BB%D1%83%D0%BB%D0%B0%D1%86_%D0%91%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/sr/c/c7/FK_Palilulac_2005-06.jpg","page_title":"ФК Палилулац Београд","context_page_description":"Палилулац је фудбалски клуб из Београда основан у недељу 15. јуна 1924. године. Сениорска екипа је привремено неактивна од сезоне 2014/15. године,\\nдок су млађе категорије клуба и даље активне и такмиче се у оквиру Фудбалског савеза Београда.\\nЗа сезону 2019/20. клуб је активирао први тим који се такмичи у Међуоппштинској лиги Београд.\\nНавијачка група се зове „Зелени шкорпиони”.\\nАдреса клуба: Јовице Васиљевића бб, Крњача"},{"page_url":"https://pt.wikipedia.org/wiki/Z%C3%A1vadka_nad_Hronom","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Z%C3%A1vadka_nad_Hronom.JPG","page_title":"Závadka nad Hronom","context_page_description":"Závadka nad Hronom é um município da Eslováquia localizado no distrito de Brezno, região de Banská Bystrica. Está localizada às margens do rio Hron."},{"page_url":"https://en.wikipedia.org/wiki/John_Douglas,_9th_Marquess_of_Queensberry","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Douglas_family_of_Kinmount_Mausoleum%2C_Cummertrees%2C_Scotland.JPG","page_title":"John Douglas, 9th Marquess of Queensberry","context_page_description":"John Sholto Douglas, 9th Marquess of Queensberry, was a Scottish nobleman, remembered for his atheism, his outspoken views, his brutish manner, for lending his name to the \\"Queensberry Rules\\" that form the basis of modern boxing, and for his role in the downfall of the Irish author and playwright Oscar Wilde."},{"page_url":"https://es.wikipedia.org/wiki/Tony_Kaye","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Tony_Kaye.jpg","page_title":"Tony Kaye","context_page_description":"Para el Tony Kaye director de cine, véase Tony Kaye\\nAnthony John Selvidge, más conocido por su nombre artístico Tony Kaye, es un tecladista británico, famoso principalmente por su participación en el grupo Yes.\\nKaye fue el tecladista original de Yes, entre los años 1968 y 1971, y posteriormente participó en la banda entre los años 1983 y 1995. Luego de su partida de Yes en 1971, colaboró con el proyecto del exguitarrista de Yes, Peter Banks, Flash, para luego formar su propia banda, llamada Badger. Frecuentemente toca con Circa y Yoso, ​ banda formada por miembros de Yes y Toto."},{"page_url":"https://de.wikipedia.org/wiki/Doppelstockwagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Moscow_Kazansky_Station_TVZ_doubledecker_train_08-2016_img3.jpg","page_title":"Doppelstockwagen","context_page_description":"Ein Doppelstockwagen, umgangssprachlich auch Doppeldecker, Doppelstöcker oder kurz Dosto genannt, ist ein Eisenbahn- oder Straßenbahn­wagen beziehungsweise -triebwagen mit Sitzplätzen in zwei übereinanderliegenden Ebenen. Gegenüber einstöckigen Personenwagen können Doppelstockwagen bei gleicher Länge mehr Reisende aufnehmen, was insbesondere auf kurzen Bahnsteigen die Kapazität erhöht. Die baulichen Grenzen sind durch das Lichtraumprofil vorgegeben."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%82%AC%EC%9D%B4%EB%A7%88_%EC%9A%B4%ED%95%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Saimaakanal.svg","page_title":"사이마 운하","context_page_description":"사이마 운하는 핀란드의 사이마 호와 핀란드 만 인근의 러시아 비보르크 사이를 연결하는 운하이다. 1845년부터 1856년까지 공사가 진행되었으며 1856년 9월 7일에 개통되었다. 1963년부터 1968년까지 확장 공사가 진행되었다.\\n핀란드 중남부, 남동부에 걸친 지역에서는 120개 이상의 호수가 운하와 수로로 연결되어 있다. 사이마 호에서 깊은 수심의 수로의 길이는 814km이며 핀란드 중부에 위치한 쿠오피오까지 연결되어 있다."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%9D%E1%83%9B%E1%83%90%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%96%E1%83%98%E1%83%93%E1%83%94%E1%83%9C%E1%83%A2%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Somalian10ef5-1.jpg","page_title":"სომალის პრეზიდენტი","context_page_description":"სომალის პრეზიდენტი — სომალის სახელმწიფოს მეთაური."},{"page_url":"https://de.wikipedia.org/wiki/Schwarzducker","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Cephalophus_niger.jpg","page_title":"Schwarzducker","context_page_description":"Der Schwarzducker ist eine kleine Antilope, die in Westafrika von Sierra Leone bis zum Südwesten Nigerias vorkommt."},{"page_url":"https://es.wikipedia.org/wiki/Cressy-sur-Somme","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Blason_ville_fr_Cressy-sur-Somme_%28Sa%C3%B4ne-et-Loire%29.svg","page_title":"Cressy-sur-Somme","context_page_description":"Cressy-sur-Somme es una población y comuna francesa, en la región de Borgoña, departamento de Saona y Loira, en el distrito de Autun y cantón de Issy-l'Évêque."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_M%C3%B6ckm%C3%BChl","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/M%C3%B6ckm%C3%BChl%2C_Hauptstra%C3%9Fe_21%2C_Kirchplatzseite-20140516-002.jpg","page_title":"Liste der Kulturdenkmale in Möckmühl","context_page_description":"In der Liste der Kulturdenkmale in Möckmühl sind Bau- und Kunstdenkmale der Stadt Möckmühl verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg verzeichnet sind. Dieses Verzeichnis ist nicht öffentlich und kann nur bei „berechtigtem Interesse“ eingesehen werden. Die folgende Liste ist daher nicht vollständig. Sie beruht im Wesentlichen auf dem veröffentlichten Denkmalwerteplan."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D1%8A%D1%80%D1%85%D0%BE%D0%B2%D0%B5%D0%BD_%D0%BC%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D0%BE-%D0%BE%D0%B4%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B8_%D0%BA%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Supreme_Macedonian-Adrianople_Committee_document_of_Nedyalko_Semerdzhiev.jpg","page_title":"Върховен македоно-одрински комитет","context_page_description":"Върховният македоно-одрински комитет е ръководният орган на Македоно-одринската организация – революционна организация на македонски и тракийски емигранти и български общественици, която съществува от 1895 до 1905 година в България и Османската империя. Целта на ВМОК и МОО е реализиране на предвидената в Берлинския договор от 1878 година широка автономия на останалите в границите на Османската империя Македония и Одринска Тракия. Комитетът организира Четническата акция в 1895 година и Горноджумайското въстание в 1902 година, а негови чети участват в Илинденско-Преображенското въстание в 1903 година. След първоначално добро сътрудничество с Вътрешната македоно-одринска революционна организация, Върховният комитет влиза постепенно в конфликт и с нея, и с българското правителство и в 1903 година организацията е забранена в България, а в 1905 година се разпуска. Военното крило в организацията продължава да се занимава с революционна дейност до 1912 година, а след Балканските и Първата световна война част от тях се вливат в десницата на ВМРО, докато част от легалните дейци формират Съюза на македонските емигрантски организации."},{"page_url":"https://kk.wikipedia.org/wiki/%D2%AE%D0%B7%D0%B4%D1%96%D0%BA_%D1%80%D0%B5%D0%B6%D0%B8%D1%81%D1%81%D1%83%D1%80%D0%B0_%D2%AF%D1%88%D1%96%D0%BD_%C2%AB%D0%9E%D1%81%D0%BA%D0%B0%D1%80%C2%BB_%D0%B6%D2%AF%D0%BB%D0%B4%D0%B5%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Robert_wise_1990.jpg","page_title":"Үздік режиссура үшін «Оскар» жүлдесі","context_page_description":"«Оскар» сыйлығы Үздік режиссура үшін — Американ кино академиясы ұсынатын үздік режиссёр марапаты. Номинацияны режиссёрдің гильдиясы, ал жеңімпазды барлық академия мүшелері анықтайды. 1929 жылдан бері, яғни бірінші «Оскар» жүлдесін ұсыну рәсімінен бері, 61 режиссёрге 81 статуэтка бұйырды."},{"page_url":"https://de.wikipedia.org/wiki/Ma%C4%9Farac%C4%B1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Xanik2.png","page_title":"Mağaracık","context_page_description":"Mağaracık war ein jesidischer Weiler im Südosten der Türkei. Der Weiler lag ca. 30 km östlich von Nusaybin in der Provinz Mardin. Der Ort befindet sich am Fuße des Gebirgszuges Tur Abdin in Südostanatolien. Verwaltungstechnisch gehört Mağaracık zum Bucak Girmeli."},{"page_url":"https://en.wikipedia.org/wiki/Bagmati_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Bagmati_River%2C_1950_-_1955.jpg","page_title":"Bagmati River","context_page_description":"The Bagmati River runs through the Kathmandu Valley of Nepal and separates Kathmandu from Patan flowing through the Province No. 2 of Southern Nepal that finally drains into the Indian State of Bihar\\n. It is considered holy by both Hindus and Buddhists. A number of Hindu temples are located on its banks.\\nThe importance of Bagmati also lies in the fact that Hindus are cremated on the banks of this holy river, and Kirants are buried in the hills by its side. According to the Nepalese Hindu tradition, the dead body must be dipped three times into the Bagmati River before cremation, so that the reincarnation cycle may be ended. The chief mourner who lights the funeral pyre must take a holy river-water bath immediately after cremation. Many relatives who join the funeral procession also take a bath in the Bagmati River or sprinkle the holy water on their bodies at the end of cremation. The Bagmati River purifies the people spiritually."},{"page_url":"https://eu.wikipedia.org/wiki/Saint-Uze","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/St_Uze.JPG","page_title":"Saint-Uze","context_page_description":"Saint-Uze Frantziako udalerri bat da, Drôme departamenduan dagoena, Auvernia-Rhône-Alpeak eskualdean. 2013an 2028 biztanle zituen."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%95%BF%E5%85%B4%E6%9C%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Pareiasaurus_serridens_skeleton.jpg","page_title":"长兴期","context_page_description":"长兴期是二叠纪的第九个时期，年代大约位于254.14–251.902百万年前。"},{"page_url":"https://en.wikipedia.org/wiki/Tone_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Tone_River_2015.jpg","page_title":"Tone River","context_page_description":"The Tone River is a river in the Kantō region of Japan. It is 322 kilometers in length and has a drainage area of 16,840 square kilometers. It is nicknamed Bandō Tarō; Bandō is an obsolete alias of the Kantō Region, and Tarō is a popular given name for an oldest son. It is regarded as one of the \\"Three Greatest Rivers\\" of Japan, the others being the Yoshino in Shikoku and the Chikugo in Kyūshū."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre_de_Puiseux-Pontoise","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Puiseux-Pontoise_%2895%29%2C_%C3%A9glise_Saint-Pierre%2C_ch%C5%93ur%2C_vue_vers_l%27ouest.JPG","page_title":"Église Saint-Pierre de Puiseux-Pontoise","context_page_description":"L'église Saint-Pierre est une église catholique paroissiale située à Puiseux-Pontoise, en France. Sa fondation est antérieure au XIIᵉ siècle, et sa nef d'origine, très simple est basse, a subsisté jusqu'en 1895. Grâce à la générosité de la famille Thomassin, elle a été substituée à une nef néo-gothique avec bas-côtés et chapelles, qui a été bénite en 1898. Au moins son vaisseau central imite bien le style gothique en vigueur pendant la première moitié du règne de saint Louis, qui est celui du transept des années 1230. Ses croisillons étaient d'emblée conçus pour se raccorder à des bas-côtés, mais ne communiquaient avec la nef que par des passages provisoires. En s'ouvrant largement sur le transept, la construction néo-gothique met enfin en valeur les parties anciennes de l'église, et forme avec eux un espace presque homogène. Sans toucher aux colonnettes à chapiteaux anciennes, la croisée du transept et le croisillon nord ont été revoûtés à la période flamboyante, au début du XVIᵉ siècle, et les délicats réseaux des fenêtres des croisillons datent de cette époque, ainsi que le clocher en bâtière qui s'élève au-dessus de la croisée du transept."},{"page_url":"https://es.wikipedia.org/wiki/Copa_de_Campeones_de_la_Concacaf_1978","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Estadio_Mateo_Flores_Guatemala.JPG","page_title":"Copa de Campeones de la Concacaf 1978","context_page_description":"La Copa de Campeones de 1978 fue la décimo cuarta edición de la Copa de Campeones de la Concacaf, torneo de fútbol a nivel de clubes más importante de Norteamérica, Centroamérica y el Caribe organizado por la Concacaf. El torneo comenzó el 1 de mayo y culminó el 17 de septiembre de 1978. En la ronda final sólo participarían 3 equipos de diferentes países.\\nEl Comunicaciones de Guatemala, Leones Negros UDG de México y Defence Force de Trinidad y Tobago fueron proclamados campeones, debido a que por problemas de calendario, hicieron imposible jugar los partidos de la ronda final con estos tres equipos.\\nEl Comunicaciones obtuvo su primer y único título en la competición.\\nLos Leones Negros de la Universidad de Guadalajara obtuvieron su primer y único título en la competencia.\\nDefence Force se consagró por primera vez en su historia, transformándose así en el primer —y hasta la fecha, el único— club trinitario en lograr un título en la competición."},{"page_url":"https://en.wikipedia.org/wiki/The_Edgewater_(Seattle)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Seattle_-_The_Edgewater_01.jpg","page_title":"The Edgewater (Seattle)","context_page_description":"The Edgewater is a four-story, 223-room hotel in Seattle, Washington, United States. It is located on the Central Waterfront on a pier over Elliott Bay and is the only over-water, and water-front hotel in the Seattle area. Shortly after it was built, shoreline zoning changes precluded the construction of further hotels on piers. In its early years, the hotel advertised on its north elevation that you could \\"fish from your room.\\"\\nThe hotel is particularly famous for hosting The Beatles when they visited Seattle in 1964 at the height of Beatlemania. Because of the Beatles' connection to the hotel, there is a Beatles-themed suite and the hotel has hosted several Beatles-related events and tributes in recent years. Other famous guests have included Led Zeppelin, the Rolling Stones, Frank Zappa, Kurt Cobain, Black Sabbath and U.S. president Bill Clinton. The Edgewater is also a filming location in the 1992 season 3 episode \\"It Happened in Juneau\\" of Northern Exposure.\\nThe hotel sits on the site of the onetime Galbraith-Bacon Pier, renamed Pier 67 during World War II. It also incorporates part of the area of the former Pier 68. Both old piers were demolished to build the hotel."},{"page_url":"https://en.wikipedia.org/wiki/List_of_equipment_of_the_Armenian_Armed_Forces","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/9M14_Malyutka_Kecel_1.jpg","page_title":"List of equipment of the Armenian Armed Forces","context_page_description":"Modern equipment of the Armenian Armed Forces.\\nAll effort is done to keep the tables up-to-date with reliable information available on open sources.\\nThe information is updated regularly.\\nThis page might contain equipment which are in use with the Artsakh Defense Army, as the equipment is sometimes used by both armies."},{"page_url":"https://it.wikipedia.org/wiki/Cappella_degli_affreschi_(San_Domenico_Maggiore)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Pavimento_della_cappella_degli_affreschi_in_San_Domenico_Maggiore.jpg","page_title":"Cappella degli affreschi (San Domenico Maggiore)","context_page_description":"La cappella degli affreschi è una cappella della chiesa di San Domenico Maggiore di Napoli affrescata da Pietro Cavallini nel 1308 circa.\\nÈ di fatto l'unica cappella della chiesa che conserva un ciclo di affreschi risalente all'epoca angioina, quindi al periodo di edificazione del complesso religioso."},{"page_url":"https://es.wikipedia.org/wiki/Bronis%C5%82awa_D%C5%82uska","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bronis%C5%82awa_D%C5%82uska_%28-1901%29.jpg","page_title":"Bronisława Dłuska","context_page_description":"Bronisława Skłodowska-Dłuska, más conocida como Bronislawa Dluska, fue una científica de La Sorbona, hermana de Maria Sklodowska y una de las cinco hijas de Wladyslaw Sklodowski, maestro de matemáticas y de Bronislawa Boguska, artista.​\\nBronislawa nació en 1865, en Varsovia, en el entonces Zarato de Polonia.​ Se casó con Kazimierz Dluski en 1890, y al año siguiente, en 1891, siguió a Maria Sklodowska a París para estudiar en la Sorbona. Dirigió durante la primera guerra mundial una sala de estudios en el Instituto Curie.​ En 1939, Bronislawa falleció por causas naturales, a los 74 años."},{"page_url":"https://en.wikipedia.org/wiki/Birmingham_Curzon_Street_railway_station_(1838%E2%80%931966)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Curzon_Street_Station_-Birmingham-UK.jpg","page_title":"Birmingham Curzon Street railway station (1838–1966)","context_page_description":"Birmingham Curzon Street railway station was a railway station in central Birmingham, England, opening in 1838 and closed to passengers in 1893 but remaining open for goods until 1966. The station was used by scheduled passenger trains between 1838 and 1854 when it was the terminus for both the London and Birmingham Railway and the Grand Junction Railway, with lines to London, Manchester and Liverpool respectively. Excursion trains ran until 1893 after which only goods trains operated until closure in 1966. More recently, the surviving Grade I listed entrance building was used for occasional art events.\\nIn 2010, a new station, partly on the site of the historical Curzon Street station, was proposed as the Birmingham terminus for High Speed 2. In 2017 plans were approved to redevelop the remaining Grade 1 listed building to turn it into a visitor centre and office space for HS2 and other organisations. HS2 hopes to use the station as the hub for its high-speed line linking London and Birmingham – although these plans are still being developed."},{"page_url":"https://no.wikipedia.org/wiki/Karosseri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Volvo_C70_coupe_--_04-10-2011.jpg","page_title":"Karosseri","context_page_description":"Karosseri, eller overstell, på en bil er alle ytre deler som beskytter bilens andre komponenter eller passasjerene mot utvendig påvirkning.\\nKarosseriet har flere oppgaver. Et selvbærende må være så solid at det tåler vekten av motor, drivverk og de andre komponentene samt passasjerer og bagasje og det må tåle vridningskreftene når bilen manøvrerer. Det må midlertidig ikke være for solid, da det må ta opp mesteparten av energien ved en kollisjon ved deformering. En chassisramme vil måtte gjøre det samme, men vil samtidig begrense karosseriets behov for styrke med hensyn til belastninger fra drivverk og fjæring.\\nKarosseriets aerodynamiske egenskaper er også viktige, både for å minske luftmotstanden og dermed drivstofforbruket, men også for bilens kjøreegenskaper. Et høyt karosseri med rette sider er for eksempel mer påvirkelig for sidevind enn et lavt med avrundede deler.\\nTyper karosseri i bruk er selvbærende og med separat ramme, samt hybrider mellom de to. Så godt som alle lastebiler er utstyrt med ramme. Karosseriet består da av motor-og førerrom og eventuelt lastekasse.\\nKarosseriets hoveddeler:\\nStøtfanger\\nPanser\\nFrontrute\\nSkjermer\\nDørstolper\\nDører\\nSidepaneler\\nKanaler\\nBagasjerom"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B9%88%E0%B8%AD%E0%B8%87%E0%B8%AD%E0%B8%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Gray846.png","page_title":"ช่องอก","context_page_description":"ช่องอก เป็นช่องว่างในร่างกายมนุษย์ ที่ถูกหุ้มด้วยผนังช่องอก"},{"page_url":"https://de.wikipedia.org/wiki/Gliederung_des_Territorialheeres_(Bundeswehr,_Heeresstruktur_4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/StKp_HSchBrig_65.jpg","page_title":"Gliederung des Territorialheeres (Bundeswehr, Heeresstruktur 4)","context_page_description":"Die Gliederung des Territorialheeres der Bundeswehr in der Heeresstruktur 4 beschreibt die Truppenteile des Territorialheeres im Zeitraum von 1980 bis 1992. Die Heeresstruktur 4 beschreibt damit die Aufstellung des Territorialheeres zum Ende des Kalten Krieges.\\nDas Territorialheer ist Teil des Heeres der Bundeswehr. Die weitere Gliederung der anderen Teilbereiche des Heeres finden sich in:\\nTeil 1 – Einleitung und Aufbau der Listen, Führung des Heeres, Gliederung des Heeresamtes und nachgeordneter Bereich\\nTeil 2 – Feldheer: Gliederung des Feldheeres (Bundeswehr, Heeresstruktur 4)\\nTeil 3 – Territorialheer: Gliederung des Territorialheeres (Bundeswehr, Heeresstruktur 4)"},{"page_url":"https://en.wikipedia.org/wiki/Military_ranks_of_Cape_Verde","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Coronel_Armindo_Miranda_during_African_Land_Forces_Summit_2019.jpg","page_title":"Military ranks of Cape Verde","context_page_description":"Military ranks of Cape Verde are the insignia used to denote rank in the Cape Verdean Armed Forces, including the National Guard and Coast Guard."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8A%E8%B6%8A%E5%9C%8B%E9%9A%9B%E6%BB%91%E9%9B%AA%E5%A0%B4%E5%89%8D%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Joetsu_Kokusai_Skijomae_Station_view_from_down_platform_20150126.JPG","page_title":"上越國際滑雪場前站","context_page_description":"上越国际滑雪场前站是一个位于日本新潟县南鱼沼市桦野泽，属于东日本旅客铁道上越线的铁路车站。"},{"page_url":"https://en.wikipedia.org/wiki/Mike_Tobey","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Mike_Tobey.jpg","page_title":"Mike Tobey","context_page_description":"Michael Edward Tobey is an American professional basketball player for Valencia Basket of the Liga ACB. He played college basketball for the Virginia Cavaliers."},{"page_url":"https://fr.wikipedia.org/wiki/Jules_Pouget","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Le_Touquet-Paris-Plage_%28Boulevard_Docteur_Jules_Pouget%29.JPG","page_title":"Jules Pouget","context_page_description":"Jules Pouget, né le 8 mars 1884 à Espalion et mort le 30 juillet 1963 dans le 13ᵉ arrondissement de Paris, est un homme politique français et maire du Touquet-Paris-Plage. Il est qualifié de maire de la renaissance de la station balnéaire."},{"page_url":"https://sv.wikipedia.org/wiki/Mosshumla","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Bombus_%28Thoracobombus%29_muscorum_%28Linnaeus%2C_1758%29.jpg","page_title":"Mosshumla","context_page_description":"Mosshumla är en insekt i överfamiljen bin som finns i stora delar av Europa och även förekommer i Asien. Den har fått sitt svenska namn av sin vana att fodra boet med mossa."},{"page_url":"https://id.wikipedia.org/wiki/Wilayah_bertekanan_rendah","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/HadleyCross-sec.jpg","page_title":"Wilayah bertekanan rendah","context_page_description":"Wilayah bertekanan rendah atau depresi, atau siklon, wilayah tekanan rendah, pusat tekanan rendah, atau sistem tekanan rendah adalah sebagaian wilayah atmosfer Bumi yang memiliki tekanan udara lebih rendah dibandingkan wilayah di sekitarnya pada ketinggian yang sama. Wilayah tekanan rendah dapat digambarkan pada peta sebagai sebuah wilayah tertutup dengan nilai isobar yang semakin menurun mendekati ke pusatnya. Wilayah tekanan rendah merupakan lawan dari wilayah tekanan tinggi. Angin akan bergerak dari wilayah tekanan tinggi menuju wilayah tekanan rendah dan akan berbelok mengikuti rotasi Bumi. Pergerakan angin ke arah pusat dari wilayah tekanan rendah dapat memperbanyak uap air yang terkumpul dan terbentuk di wilayah tersebut sehingga menaikkan tingkat kelembapan dan presipitasinya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%BB%D0%BB%D0%B0,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Orosvigovsky_m_2.jpg","page_title":"Андрелла, Михаил","context_page_description":"Михаил Андрелла — русинский православный писатель-полемист, священник, активный борец против унии и Ватикана."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BA%D1%96%D0%BF%D0%B5%D0%B4%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Jimmy_Wales_in_August_2006.jpg","page_title":"Вікіпедія","context_page_description":"Вікіпе́дія — загальнодоступна вільна багатомовна онлайн-енциклопедія, якою опікується неприбуткова організація «Фонд Вікімедіа».\\nНазва утворена від слів «вікі» та «енциклопедія». Засновниками Вікіпедії є Ларрі Сенгер та Джиммі Вейлз. Офіційне відкриття відбулося 15 січня 2001 року.\\nБудь-хто, у кого є доступ до читання Вікіпедії, також може редагувати практично всі її статті. Вікіпедія — п'ятий за популярністю веб-сайт у світі.\\nСтаном на березень 2020 року містить понад 50 млн. статей, що написані добровольцями з усього світу. Учасників Вікіпедії називають вікіпедистами. В березні 2013 року сайт відвідали понад 517 мільйонів осіб. Як інтернет-довідник Вікіпедія є найбільшою і найпопулярнішою серед подібних сайтів. За обсягом відомостей і тематикою Вікіпедію вважають найповнішою енциклопедією, яку коли-небудь створювали за всю історію людства.\\nМатеріали Вікіпедії, як і інших проєктів Фонду Вікімедіа, є вільними до використання, розповсюдження та вдосконалення на умовах ліцензій Creative Commons Attribution Share-Alike 3.0 Unported та GFDL, а сам сайт проєкту не містить рекламних банерів і працює завдяки добровільним пожертвам."},{"page_url":"https://ceb.wikipedia.org/wiki/Kitimat_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Kitimat_River_August_2012.jpg","page_title":"Kitimat River","context_page_description":"Suba ang Kitimat River sa Kanada. Nahimutang ni sa kondado sa Regional District of Kitimat-Stikine ug lalawigan sa British Columbia, sa kasadpang bahin sa nasod, 3,800 km sa kasadpan sa Ottawa ang ulohan sa nasod. Kitimat River nidagayday paingon ngadto sa Kadagatang Pasipiko."},{"page_url":"https://en.wikipedia.org/wiki/Addition","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Vector_Addition.svg","page_title":"Addition","context_page_description":"Addition is one of the four basic operations of arithmetic, the other three being subtraction, multiplication and division. The addition of two whole numbers results in the total amount or sum of those values combined. The example in the adjacent picture shows a combination of three apples and two apples, making a total of five apples. This observation is equivalent to the mathematical expression \\"3 + 2 = 5\\".\\nBesides counting items, addition can also be defined and executed without referring to concrete objects, using abstractions called numbers instead, such as integers, real numbers and complex numbers. Addition belongs to arithmetic, a branch of mathematics. In algebra, another area of mathematics, addition can also be performed on abstract objects such as vectors, matrices, subspaces and subgroups.\\nAddition has several important properties. It is commutative, meaning that order does not matter, and it is associative, meaning that when one adds more than two numbers, the order in which addition is performed does not matter. Repeated addition of 1 is the same as counting; addition of 0 does not change a number."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Hamburg-Harvestehude","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Stolperstein_Isestra%C3%9Fe_69_%28Erna_Gottlieb%29_in_Hamburg-Harvestehude.JPG","page_title":"Liste der Stolpersteine in Hamburg-Harvestehude","context_page_description":"Die Liste der Stolpersteine in Hamburg-Harvestehude enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Hamburg-Harvestehude verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Hamburg-Harvestehude lebten und wirkten.\\nDiese Seite ist Teil der Liste der Stolpersteine in Hamburg, da diese mit insgesamt 5848 Steinen zu groß würde und deshalb je Stadtteil, in dem Steine verlegt wurden, eine eigene Seite angelegt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Charon_(moon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Pluto-Charon_system-new.gif","page_title":"Charon (moon)","context_page_description":"Charon, also known as Pluto I, is the largest of the five known natural satellites of the dwarf planet Pluto. It has a mean radius of 606 km. Charon is the sixth-largest trans-Neptunian object after Pluto, Eris, Haumea, Makemake and Gonggong. It was discovered in 1978 at the United States Naval Observatory in Washington, D.C., using photographic plates taken at the United States Naval Observatory Flagstaff Station.\\nWith half the diameter and one eighth the mass of Pluto, Charon is a very large moon in comparison to its parent body. Its gravitational influence is such that the barycenter of the Plutonian system lies outside Pluto.\\nThe reddish-brown cap of the north pole of Charon is composed of tholins, organic macromolecules that may be essential ingredients of life. These tholins were produced from methane, nitrogen and related gases released from the atmosphere of Pluto and transferred over 19,000 km to the orbiting moon.\\nThe New Horizons spacecraft is the only probe that has visited the Pluto system. It approached Charon to within 27,000 km in 2015."},{"page_url":"https://sk.wikipedia.org/wiki/Nuret-le-Ferron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Nuret-le-Ferron_%28Indre%29.JPG","page_title":"Nuret-le-Ferron","context_page_description":"Nuret-le-Ferron je francúzska obec, ktorá sa nachádza v departemente Indre, v regióne Centre-Val de Loire."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B1%D1%96%D0%BB%D1%8C%D0%BD%D1%8B_%D1%82%D1%8D%D0%BB%D0%B5%D1%84%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Celulares.JPG","page_title":"Мабільны тэлефон","context_page_description":"Мабільны тэлефон — мабільная камунікацыйная прылада, прызначаная пераважна для галасавых зносін.\\nТэхналагічную аснову мабільнай сувязі складае радыёсувязь.\\nУ цяперашні час сотавая сувязь — самая распаўсюджаная з усіх відаў мабільнай сувязі, таму звычайна мабільным тэлефонам завуць сотавы тэлефон, хаця мабільнымі тэлефонамі, акрамя сотавых, з'яўляюцца таксама спадарожнікавыя тэлефоны, радыётэлефоны і апараты магістральнай сувязі.\\nУ прастамоўі — «мабільнік», «труба», «мабіла» і г.д."},{"page_url":"https://fr.wikipedia.org/wiki/Mont_(Hautes-Pyr%C3%A9n%C3%A9es)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Mont_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Mont (Hautes-Pyrénées)","context_page_description":"Mont est une commune française située dans le département des Hautes-Pyrénées en région Occitanie."},{"page_url":"https://en.wikipedia.org/wiki/Planigon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Semiplanigon_V.3.4.4.6_%28Desmos_Generated%29.png","page_title":"Planigon","context_page_description":"In geometry, a planigon is a convex polygon that can fill the plane with only copies of itself. In the Euclidean plane there are 3 regular forms equilateral triangle, squares, and regular hexagons; and 8 semiregular forms; and 4-demiregular forms which can tile the plane with other planigons.\\nAll angles of a planigon are whole divisors of 360°. Tilings are made by edge-to-edge connections by perpendicular bisectors of the edges of the original uniform lattice, or centroids along common edges.\\nTilings made from planigons can be seen as dual tilings to the regular, semiregular, and demiregular tilings of the plane by regular polygons."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9rie_du_Turkestan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/%D0%9D%D0%B8%D1%89%D0%B8%D0%B5_%D0%B2_%D0%A1%D0%B0%D0%BC%D0%B0%D1%80%D0%BA%D0%B0%D0%BD%D0%B4%D0%B5.jpg","page_title":"Série du Turkestan","context_page_description":"La Série du Turkestan est un ensemble de tableaux du peintre russe Vassili Verechtchaguine, réalisés dans les années 1871=1873 à Munich, sous l'influence de ses séjours en Asie Centrale en 1867-1868 et en 1869-1870. Cette série comprend également une petite sous-série intitulée Les Barbares que l'artiste a décidé de distinguer, pour lui donner une signification indépendante. Cette sous-série est consacrée exclusivement aux sujets militaires."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A1%E0%B5%86%E0%B5%BD%E0%B4%B9%E0%B4%BF_%E0%B4%AE%E0%B5%86%E0%B4%9F%E0%B5%8D%E0%B4%B0%E0%B5%8B_%E0%B4%B1%E0%B5%86%E0%B4%AF%E0%B4%BF%E0%B5%BD%E0%B4%B5%E0%B5%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Smart_Card.jpg","page_title":"ഡെൽഹി മെട്രോ റെയിൽവേ","context_page_description":"ഇന്ത്യയുടെ തലസ്ഥാന നഗരിയായ ഡെൽഹിയിൽ സ്ഥാപിതമായ അതിവേഗ തീവണ്ടി ഗതാഗത മാർഗ്ഗമാണ് ഡെൽഹി മെട്രോ റെയിൽവേ എന്നറിയപ്പെടുന്ന ദില്ലിയിലെ അതിവേഗ തീവണ്ടി ഗതാഗത മാർഗ്ഗം അഥവാ ഡെൽഹി മാസ് റാപ്പിഡ് ട്രാൻസിറ്റ് സിസ്റ്റം. ഇതിന്റെ പ്രവർത്തനങ്ങൾ നടത്തിവരുന്നത് 'ഡെൽഹി മെട്രോ റെയിൽ കോർപ്പറേഷൻ ലിമിറ്റഡ്' എന്ന സ്ഥാപനമാണ്\\n2002 ഡിസംബർ 24 നാണ് ഡെൽഹി മെട്രോ ആരംഭിച്ചത്. ഇത് ഇന്ത്യയിലെ രണ്ടാമത്തെ ഭൂഗർഭ റെയിൽ‌വേ ഗതാഗത മാർഗ്ഗമാണ്. ഇന്ത്യയിലെ ആദ്യത്തെ ഭൂഗർഭ റെയിൽ‌വേ ഗതാഗതമായ കൽക്കട്ട മെട്രോയെക്കാളും ഭൂമിക്കടിയിലൂടെയും ഉപരിതലത്തിലൂടെയും, ഉയർത്തിയ പാളങ്ങളിലൂടെയും ഗതാഗത സംവിധാനം ഡെൽഹി മെട്രോയ്ക്കുണ്ട്. ഡെൽഹി മെട്രോയുടെ തീവണ്ടികൾ മണിക്കൂറിൽ 50 കി.മീ. മുതൽ 80 കി.മീ. വരെ വേഗതയിൽ സഞ്ചരിക്കുന്നു. ഓരോ സ്റ്റേഷനുകളിലും ശരാശരി 20 സെക്കന്റ് മാത്രമേ നിർത്തുകയുള്ളു. 2012 വരെ ഡെൽഹി മെട്രൊ റെയിൽ‌വേക്ക് 193.2 കി.മീ. നീളത്തിൽ പാളങ്ങളും അവക്കിടയിൽ 139 സ്റ്റേഷനുകളും, 6 വ്യത്യസ്ത പാതകളും നിലവിലുണ്ട്."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_in_Hamburg-Hausbruch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Erikaweg.jpg","page_title":"Liste der Straßen in Hamburg-Hausbruch","context_page_description":"Die Liste der Straßen in Hamburg-Hausbruch ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Hausbruch vorhandenen Straßen. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://en.wikipedia.org/wiki/Boletus_subalpinus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Gastroboletus_subalpinus_171207.jpg","page_title":"Boletus subalpinus","context_page_description":"Boletus subalpinus is a species of fungus in the family Boletaceae. The species was first described scientifically in 1969 by American mycologists Harry Delbert Thiers and James M. Trappe. It is found in California and Oregon. It was originally named as a species of Gastroboletus but was found to be in Boletus sensu stricto in a 2013 molecular phylogenetics study."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%82%E4%BF%AE%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Honzan-Senju-ji_Karamon.JPG","page_title":"専修寺","context_page_description":"専修寺は、浄土真宗10派のうちのひとつの真宗高田派の寺院。山号は「高田山」。本山は三重県津市一身田町に、本寺は栃木県真岡市高田にあり、本寺の住職は本山専修寺の住職が兼任している。「専修寺」の名の由来は浄土系宗派の特徴である専修念仏に基づく。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%8B%E5%B3%B6%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Yasimazi01.jpg","page_title":"屋島寺","context_page_description":"屋島寺は、屋島の南嶺山上にある真言宗御室派の寺院。四国八十八箇所霊場の第八十四番札所。\\n本尊真言：おん ばさら たらま きりく\\nご詠歌：梓弓屋島の宮に詣でつつ 祈りをかけて勇む武夫"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%85%D1%80%D0%B0%D0%BC_(%D0%93%D0%BE%D1%80%D1%8B%D0%BD%D1%8C%D0%B3%D1%80%D0%B0%D0%B4_%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%85%D1%80%D0%B0%D0%BC%2C_%D1%81._%D0%93%D0%BE%D1%80%D1%8B%D0%BD%D1%8C%D0%B3%D1%80%D0%B0%D0%B4_%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_26.jpg","page_title":"Свято-Троицкий храм (Горыньград Первый)","context_page_description":"Свя́то-Тро́ицкий храм — православный храм с. Горыньград Первый Ровенского района Ровенской области.\\nСтроился в период с 1812 по 1816 гг. на средства князя Гавриила Александровича Святополк-Четвертинского. Капитально реконструирован и отреставрирован на средства Василия и Виталия Грицаков в 2009-2016 г. Относится к Ровенской и Острожской епархии Украинской православной церкви."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D1%81%D0%B0%D1%81%D0%B8_(1940)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Japanese_battleship_Musashi_under_attack_in_the_Sibuyan_Sea%2C_24_October_1944_%2880-G-281764%29.jpg","page_title":"Мусаси (1940)","context_page_description":"Мусаси — второй линкор в серии типа «Ямато» японского императорского флота времён Второй мировой войны. Флагман Объединённого флота Японии. Получил название в честь древней японской провинции Мусаси. «Мусаси» и однотипный ему «Ямато» были самыми крупными и самыми мощными линейными кораблями в мире, имели водоизмещение 74 000 тонн, главный калибр орудий — 460 мм."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pinturas_de_Vel%C3%A1zquez","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Retrato_de_Felipe_IV_%282%2C_Bilbao_copy%29%2C_after_Diego_Vel%C3%A1zquez.jpg","page_title":"Lista de pinturas de Velázquez","context_page_description":"A seguinte é uma lista não exaustiva de pinturas do mestre espanhol do barroco Diego Velázquez."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%9C%AC%C2%B7%E9%98%BF%E6%81%A9%E7%BB%B4%E5%85%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Penalty_Alnwick.jpg","page_title":"本·阿恩维克","context_page_description":"本杰明·罗伯特·\\"本\\"·阿恩维克，是一名英格兰足球运动员，司职门将，目前他效力于英甲球队博尔顿。"},{"page_url":"https://la.wikipedia.org/wiki/Alba_Iulia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Alba_Iulia_Orthodox_Cathedral.jpg","page_title":"Alba Iulia","context_page_description":"Vide etiam paginam discretivam: Alba\\nSi paginam fere homonymam quaeris vide Apulia\\nAlba Iulia sive Apulum est urbs Transsilvaniae et municipium 66 406 incolarum, qui Albae Iulienses sive Apulenses vocantur. Inter annos 1542-1690 Alba Iulia caput Principatus Transsilvaniae erat, his diebus locus medius Albae Iuliensis comitatus est."},{"page_url":"https://no.wikipedia.org/wiki/Tom%C3%A1s_Podstawski","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Tom%C3%A1s_Martins_Podstawski.jpg","page_title":"Tomás Podstawski","context_page_description":"Tomás Podstawski er en portugisisk fotballspiller.\\nHan representerte Portugal under Sommer-OL 2016 i Rio de Janeiro, der han ble utslått i kvartfinalen med det portugisiske U23-landslaget."},{"page_url":"https://fy.wikipedia.org/wiki/Kanada","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Canadian_parliament_MAM.JPG","page_title":"Kanada","context_page_description":"Kanada is in lân dat rûchwei de noardlike helte fan it Noard-Amerikaanske kontinint beslacht. Oan de noardkant wurdt it begrinzge troch de Noardlike Iissee, yn it easten troch de Atlantyske Oseaan en yn it súdwesten troch de Stille Oseaan. Yn it suden hat it in lang grins mei de Feriene Steaten, dy't dwers troch it kontinint rint, fan 'e iene oseaan nei de oare. Yn it noardwesten, ta einbeslút, swettet Kanada oan 'e Amerikaanske steat Alaska. De haadstêd fan Kanada is Ottawa, dat yn it súdeasten leit. Oare grutte stêden binne Montreal, Toronto, Vancouver, Calgary, Edmonton, Kebek, Winnipeg, Hamilton, Londen, Kitchener en Halifax."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%8F%E7%94%B0%E5%8E%9F%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Signs_of_Ticket_puncher_Odakyu_Chitose-funabashi.jpg","page_title":"小田原線","context_page_description":"小田原線是日本小田急電鐵路線，連結東京都新宿區新宿站和神奈川縣小田原市小田原站。車站編號使用的路線記號為OH。\\n單純以「小田急線」稱呼的場合，通常多是指小田原線。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_Landtages_Nordrhein-Westfalen_(17._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Martin-B%C3%B6rschel-SPD-1_LT-NRW-by-Leila-Paul.jpg","page_title":"Liste der Mitglieder des Landtages Nordrhein-Westfalen (17. Wahlperiode)","context_page_description":"Die Liste der Mitglieder des 17. Landtages Nordrhein-Westfalen umfasst die bei der Landtagswahl vom 14. Mai 2017 gewählten Abgeordneten. Ihre Amtszeit begann am 1. Juni 2017 mit der Konstituierenden Sitzung des Landtages."},{"page_url":"https://es.wikipedia.org/wiki/Servidor","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Inside_and_Rear_of_Webserver.jpg","page_title":"Servidor","context_page_description":"Un servidor es una aplicación en ejecución capaz de atender las peticiones de un cliente y devolverle una respuesta en concordancia. Los servidores se pueden ejecutar en cualquier tipo de computadora, incluso en computadoras dedicadas a las cuales se les conoce individualmente como «el servidor». En la mayoría de los casos una misma computadora puede proveer múltiples servicios y tener varios servidores en funcionamiento. La ventaja de montar un servidor en computadoras dedicadas es la seguridad. Por esta razón la mayoría de los servidores son procesos diseñados de forma que puedan funcionar en computadoras de propósito específico.\\nLos servidores operan a través de una arquitectura cliente-servidor. Los servidores son programas de computadora en ejecución que atienden las peticiones de otros programas: los clientes. Por tanto, el servidor realiza otras tareas para beneficio de los clientes; les ofrece la posibilidad de compartir datos, información y recursos de hardware y software. Los clientes usualmente se conectan al servidor a través de la red, pero también pueden acceder a él a través de la computadora donde está funcionando."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D0%B0%D0%BD%D0%B3_%D0%A1%D1%83%D0%B0%D0%BD_%D0%92%D0%B8%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Hoang_Xuan_Vinh.jpg","page_title":"Хоанг Суан Винь","context_page_description":"Хоанг Суан Винь — вьетнамский стрелок из пистолета. Первый олимпийский чемпион в истории Вьетнама."},{"page_url":"https://da.wikipedia.org/wiki/Daron_Malakian_and_Scars_on_Broadway","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Scars_on_Broadway.jpg","page_title":"Daron Malakian and Scars on Broadway","context_page_description":"Daron Malakian and Scars on Broadway er et amerikansk rock-band dannet af de to System of a Down-medlemmer Daron Malakian og John Dolmayan. Gruppens debutalbum blev udsendt den 29. juli, 2008."},{"page_url":"https://ceb.wikipedia.org/wiki/Sestri_Levante_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Sestri_Levante_and_Baia_del_Silenzio%2C_the_Bay_of_Silence.jpg","page_title":"Sestri Levante (munisipyo)","context_page_description":"Munisipyo ang Sestri Levante sa Italya. Nahimutang ni sa lalawigan sa Provincia di Genova ug rehiyon sa Liguria, sa amihanan-kasadpang bahin sa nasod, 400 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. Adunay 18,172 ka molupyo.\\nAng klima kasarangan. Ang kasarangang giiniton 15 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Enero, sa 8 °C. Ang kasarangang pag-ulan 1,573 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 258 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 42 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Institut_de_recherche_criminelle_de_la_Gendarmerie_nationale","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/IRCGN_Balistique_3.jpg","page_title":"Institut de recherche criminelle de la Gendarmerie nationale","context_page_description":"L'Institut de recherche criminelle de la Gendarmerie nationale est une unité de la Gendarmerie nationale française, chargée des aspects scientifiques des investigations, avec pour missions :\\nl'analyse des prélèvements effectués sur le terrain par du personnel spécialisé : les techniciens en identification criminelle ;\\nle soutien et l'assistance aux unités de terrain lors des enquêtes complexes ;\\nla formation ;\\nla recherche.\\nL'IRCGN fait partie du Pôle judiciaire de la Gendarmerie nationale aux côtés du Service central de renseignement criminel et de l'Observatoire des systèmes de transport intelligent. Créé en 1987 sous le nom de section technique d'investigation criminelle de la Gendarmerie, l'institut est implanté depuis l'été 2015 à Pontoise. C'est l'un des 6 laboratoires français de police scientifique aux côtés des 5 laboratoires de la Police nationale."},{"page_url":"https://de.wikipedia.org/wiki/Konstanz_(Schiff,_1975)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/110915-Konstanz-Schiff.JPG","page_title":"Konstanz (Schiff, 1975)","context_page_description":"Die Motorfähre Konstanz ist eine Autofähre auf der Fährlinie Konstanz–Meersburg auf dem Bodensee. Sie verkehrt wie ihr 1980 in Dienst gestelltes Schwesterschiff Meersburg im Liniendienst zwischen Konstanz-Staad und Meersburg.\\nDie Konstanz wurde am 27. März 1975 als Ersatz für die aus dem Jahr 1939 stammende Meersburg in Dienst gestellt. Sie ist das vierte Fährschiff auf dem Bodensee, das den Namen der badischen Stadt trägt. Die Fähre wurde im Winter 2002/2003 modernisiert."},{"page_url":"https://et.wikipedia.org/wiki/Brian_Aldiss","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Brian_Aldiss_2005.JPG","page_title":"Brian Aldiss","context_page_description":"Brian Wilson Aldiss oli inglise kirjanik. Ta oli üks 1960. aastate uue laine ulme juhtfiguure."},{"page_url":"https://ceb.wikipedia.org/wiki/Eristalinus_punctulatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Aussiegall_-_30_Days_of_Gratitude-_Day_8_%28by%29.jpg","page_title":"Eristalinus punctulatus","context_page_description":"Espesye sa langaw nga una nga gihulagway ni Macquart ni adtong 1847 ang Eristalinus punctulatus. Ang Eristalinus punctulatus sakop sa kahenera nga Eristalinus sa kabanay nga Syrphidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%80%D0%B5%D0%B1%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%C3%96rebro_Sankt_Nikolai_kyrka.JPG","page_title":"Еребро","context_page_description":"Еребро је један од великих градова у Шведској, у средишњем делу државе. Град је у оквиру истоименог Округа Еребро и његово је управно седиште и највећи град. Еребро је истовремено и седиште истоимене општине."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D9%88%D8%AF%D9%84%D8%A7_%D8%AF_%D8%AF%D9%88%D8%A6%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/01_Valladolid_Antiguo_monasterio_Las_Mamblas_Lou.jpg","page_title":"تودلا د دوئرو","context_page_description":"تودلا د دوئرو ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و وایادولید اوستانینده یئرلشیب. بۇ شهرین مساحتی ۶۰ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۸۶۸۳ نفر و اها‌لی سیخلیغی ۱۴۴٫۰۴ اینسان کیلومتر موربّع دیر."},{"page_url":"https://en.wikipedia.org/wiki/Artisans_Angkor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Artisans_Angkor%27s_main_center_on_Stung_Thmey_Street.jpg","page_title":"Artisans Angkor","context_page_description":"Artisans Angkor is a Cambodian social business creating job opportunities for young people in rural areas, while reviving traditional Khmer craftsmanship.\\nThe organisation, founded in 1992, is located on Stung Thmey Street, 2 minutes walk from the Old Market in Siem Reap centre, Cambodia.\\nTwo sites are open to the public in Siem Reap: one specializing in crafts located on Stung Thmey Street and the other specializing in silk at the Angkor Silk Farm. Seven shops selling handmade items made by Artisans Angkor can be found in Siem Reap centre, at the Angkor Silk Farm, at the Angkor Café in front of Angkor Wat temple, in Phnom Penh city centre and in Siem Reap and Phnom Penh International Airport as well."},{"page_url":"https://en.wikipedia.org/wiki/Flag_of_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Reconstructed_Flag_of_Deseret.svg","page_title":"Flag of Utah","context_page_description":"The flag of the State of Utah was adopted in February 2011 and consists of the seal of Utah encircled in a golden circle on a background of dark navy blue. It replaced a previous, albeit rather similar flag that had been in use since 1913."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%D9%85%D9%84%DA%A9%D8%AA_%D8%A2%D8%B1%D8%A7%DA%AF%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Localizaci%C3%B3n_de_Arag%C3%B3n.svg","page_title":"مملکت آراگون","context_page_description":"مملکت آراگون ایک قرون وسطیٰ اور جدید ابتدائی سلطنت تھی،جو جزیرہ نما آئبیریا میں موجود تھی۔ آج یہ اسپین کے جدید ارغون میں اسپین کی خود مختار کمیونٹی، کی حیثیت سے رہ رہی ہے۔"},{"page_url":"https://simple.wikipedia.org/wiki/Saint-Pol-sur-Ternoise","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Blason_Saint-Pol-sur-Ternoise.svg","page_title":"Saint-Pol-sur-Ternoise","context_page_description":"Saint-Pol-sur-Ternoise is a commune. It is found in the region Nord-Pas-de-Calais in the Pas-de-Calais department in the north of France."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%84%AD%E6%99%AF%E6%96%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Jeong_Kyeong-doo_%EC%A0%95%EA%B2%BD%EB%91%90_%28US_Navy_phto_181012-N-TB148-0019_JEJU_ISLAND%2C_Republic_of_Korea%29.jpg","page_title":"鄭景斗","context_page_description":"郑景斗，韩国空军退役将领、庆尚南道人，是第46任韩国国防部长，第40任韩国联合参谋本部议长、第35任韩国空军参谋总长，不仅为该国史上第三位出自陆军以外军种的联合参谋议长，其与海军退将出身的国防部部长宋永武亦共创韩国建军后，两大军方首脑要职同时由非陆军出身者担任的首例。郑氏于1982年加入空军服役，曾任战斗机飞行员，并接受过韩国空军官校及日本航空自卫队干部学校训练。自2009年升为将官后，除了于空军本部、联参本部担当高阶勤务职位外，亦有作战司令部和部队任职经验。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%97%E6%A5%B5-%E8%89%BE%E6%89%98%E8%82%AF%E7%9B%86%E5%9C%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Aitken_Kagu_big.jpg","page_title":"南極-艾托肯盆地","context_page_description":"南極-艾托肯盆地是月球背面一座巨大的撞擊隕石坑，直徑大約2500公里，深13公里，最大落差16.1公里，它是太陽系中已知最大的撞擊坑之一，也被公認為是月球上最大、最古老和最深的撞擊盆地。它以月球背面二處相對應的地貌特徵所命名：位於盆地北端的艾托肯環形山和另一端的月球南極，但這只是國際天文聯合會提出的臨時名稱，其正式命名仍未確定。南極-艾托肯盆地深色的表面分外醒目，從地球上可看到該盆地位於月球南側邊沿猶如一列巨大山脈般的外側邊緣，有時也被稱為萊布尼茨山脈，但該名稱並沒被國際天文聯合會正式認可。"},{"page_url":"https://pl.wikipedia.org/wiki/Cudowne_rozmno%C5%BCenie_chleba","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Brotvermehrungskirche_BW_3-2.JPG","page_title":"Cudowne rozmnożenie chleba","context_page_description":"Cudowne rozmnożenie chleba – dwukrotny cud Jezusa dokonany podczas jego publicznej działalności w Galilei w okolicach Kafarnaum, opisany w pismach Nowego Testamentu.\\nPierwsze rozmnożenie, w czasie którego nakarmiono 5000 mężczyzn, nie licząc kobiet i dzieci, zostało jako jedyny z cudów, oprócz zmartwychwstania, opisane we wszystkich czterech Ewangeliach kanonicznych. Cud ten jest też w literaturze egzegetycznej nazywany „cudem pięciu chlebów i dwóch ryb”.\\nDrugie rozmnożenie, podczas którego nakarmiono 4000 osób, zostało przedstawione w Ewangelii Marka oraz Ewangelii Mateusza. Brak opisów tego wydarzenia u Łukasza i Jana. Cud ten jest też określany „cudem siedmiu chlebów i ryb”."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BD%D0%B4%D0%B0%D1%80%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%B0%D1%80%D0%BA%D0%B8_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Stamp_Soviet_Union_1976_4603.jpg","page_title":"Стандартные марки СССР","context_page_description":"Станда́ртные ма́рки СССР — официальные выпуски стандартных марок Советского Союза в период с 1923 по 1992 год. Всего было эмитировано тринадцать основных стандартных выпусков марок СССР."},{"page_url":"https://en.wikipedia.org/wiki/Artizans,_Labourers_%26_General_Dwellings_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Shaftesbury_Park_Estate.jpg","page_title":"Artizans, Labourers & General Dwellings Company","context_page_description":"The Artizans, Labourers & General Dwellings Company was a nineteenth-century philanthropic model dwellings company, which later became a multinational property developer before being absorbed into Sun Life."},{"page_url":"https://en.wikipedia.org/wiki/Cherryvale,_Kansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Montgomery_County_Kansas_Incorporated_and_Unincorporated_areas_Cherryvale_Highlighted.svg","page_title":"Cherryvale, Kansas","context_page_description":"Cherryvale is a city in Montgomery County, Kansas, United States. As of the 2010 census, the city population was 2,367."},{"page_url":"https://ka.wikipedia.org/wiki/BMW_i8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/11-09-04-iaa-by-RalfR-248.jpg","page_title":"BMW i8","context_page_description":"BMW i8 — მსხვილი საავტომობილო კომპანიის BMW-ს კონცეპტ-კარი. პირველად წარადგინეს ფრანკფურტის ავტოსალონში 2009 წლის სექტემბერში. 2010 წელს კომპანიამ განაცხდა, რომ ავტომობილის სერიულ წარმოებას დაიწყებს მხოლოდ 2013 წლიდან, ლაიფციგში BMW i8 სახელწოდებით. აქვს 7.2 კილოვატ-საათის ლითიუმ-იონური აკუმულატორი. კატეგორია კუპე. ძარა და კარები აგებულია პოლიკარბონატებით. ტრანსმისია წარმოდგენილია 6 სიჩქრიანი მეორე თაობის გადაცემათა კოლოფით. ტურბოდიზელი 1,5 ლ მოცულობისაა, გამოიმუშავებს 163 ცხენის ძალას. მაქსიმალური ბრუნვის მომენტი 290 ნიუტონ-მეტრი. 100 კმ-მდე აჩქარებას სჭირდება 4,8 წამი. მაქსიმალური სიჩქარე 250 კმ/სთ."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%80%92%E7%AB%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/AcroDanceHandstand.jpg","page_title":"倒立","context_page_description":"倒立是使用雙手來支撐，使身體維持上下鉛直顛倒的姿勢。 基本的倒立動作為手掌撐在地上，間距大約與肩同寬，手臂伸直且雙腳向上伸直使身體直立。 倒立有許多變化，但不論是什麼樣的倒立，倒立表演者皆必須具有良好的平衡感與上半身力量。\\n許多體育活動都會進行倒立，包括雜技舞蹈、啦啦隊、馬戲團、瑜伽和體操 。 一些倒立變化是在體操器械上進行的，而許多翻筋斗的過程都會包含倒立姿勢。霹靂舞在定住和踢腿中加入倒立。臂立跳水 – 競技平台跳水的其中一個類別 – 是以倒立開始的跳水。 游泳者如玩遊戲般進行水下倒立，他們的頭部，手臂和身體在水下，腿和腳在水面上方伸展，通常會有競賽，而獲勝者是能夠在水下倒立最長的人。\\n倒立這個動作還有各種其他的名稱。在瑜珈中，倒立被稱為手倒立式，翻譯過後的意思是臉朝下，很像樹的姿勢。在卡波耶拉中，名字來自於巴西的香蕉樹。"},{"page_url":"https://en.wikipedia.org/wiki/Old_Assyrian_Empire","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/KarumKanis.svg","page_title":"Old Assyrian Empire","context_page_description":"The Old Assyrian Empire is the second of four periods into which the history of Assyria is divided, the other three being the Early Assyrian Period, the Middle Assyrian Empire, and the Neo-Assyrian Empire. Assyria was a major Mesopotamian East Semitic-speaking kingdom and empire of the ancient Near East. Centered on the Tigris–Euphrates river system in Upper Mesopotamia, the Assyrian people came to rule powerful empires at several times. Making up a substantial part of the \\"cradle of civilization\\", which included Sumer, the Akkadian Empire, and Babylonia, Assyria was at the height of technological, scientific and cultural achievements at its peak.\\nAt its peak, the Assyrian empire ruled over what the ancient Mesopotamian religion referred to as the \\"four corners of the world\\": as far north as the Caucasus Mountains within the lands of what is today called Armenia and Azerbaijan, as far east as the Zagros Mountains within the territory of present-day Iran, as far south as the Arabian Desert of today's Saudi Arabia, as far west as the island of Cyprus in the Mediterranean Sea, and even further to the west in Egypt and eastern Libya."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D0%BA%D0%B0_%D0%BD%D0%B0_%D0%9D%D0%B5%D0%BF%D1%82%D1%83%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Pantheon_ThermesAgrippa_SeptaJulia.png","page_title":"Базилика на Нептун","context_page_description":"Базилика на Нептун е обществена сграда построена през 1 век пр.н.е. от Марк Випсаний Агрипа на Марсово поле в Рим."},{"page_url":"https://en.wikipedia.org/wiki/Rheinhausen_Ost_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/05175_Hp_Rheinhausen_Ost_Bstg_S%C3%BCd.JPG","page_title":"Rheinhausen Ost station","context_page_description":"Rheinhausen Ost is a station designated as a Haltepunkt in the Duisburg suburb of Rheinhausen in the German state of North Rhine-Westphalia. It was built in 1907 after the commissioning of the Rheinhausen–Kleve railway on the left bank of the Lower Rhine for workers of the Krupp’s steel works. The station was directly at the main entrance to the steel works, Tor 1, which is now heritage-listed."},{"page_url":"https://en.wikipedia.org/wiki/Old_St_Paul%27s_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/StPaul%27sCross.jpg","page_title":"Old St Paul's Cathedral","context_page_description":"Old St Paul's Cathedral was the cathedral of the City of London that, until 1666, stood on the site of the present St Paul's Cathedral. Built from 1087 to 1314 and dedicated to Saint Paul, the cathedral was perhaps the fourth church at Ludgate Hill.\\nWork on the cathedral began after a fire in 1087. Work took over 200 years, and was delayed by another fire in 1135. The church was consecrated in 1240, enlarged in 1256 and again in the early 1300s. At its completion in the mid-1300s, the cathedral was one of the longest churches in the world, had one of the tallest spires and some of the finest stained glass.\\nThe presence of the shrine of Saint Erkenwald made the cathedral a site of pilgrimage. In addition to serving as the seat of the Diocese of London, the building developed a reputation as a social hub, with the nave aisle, \\"Paul's walk\\", known as a business centre and a place to hear the gossip on the London grapevine. After the Reformation, the open-air pulpit in the churchyard, St Paul's Cross, became the place for radical evangelical preaching and Protestant bookselling.\\nThe cathedral was already in severe structural decline by the early 1600s."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%84%D8%A7%D9%85%D9%88%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Lamoura_%2839%29_-_Mairie.JPG","page_title":"لامورا","context_page_description":"لامورا فرانس کا ایک رہائشی علاقہ جو فرانش-کومتے میں واقع ہے۔"},{"page_url":"https://nl.wikipedia.org/wiki/Jacob_Wilhelm_Lustig","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Jacob_Wilhelm_Lustig_-_muzykkunde.jpg","page_title":"Jacob Wilhelm Lustig","context_page_description":"Jacob Wilhelm Lustig was organist van de Martinikerk in Groningen. Tevens was hij werkzaam als componist, klavecinist en muziektheoreticus."},{"page_url":"https://gl.wikipedia.org/wiki/Bernardim_Ribeiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Ribeiro_Hystoria_de_menina_e_moca.jpg","page_title":"Bernardim Ribeiro","context_page_description":"Bernardim Ribeiro foi un escritor e poeta portugués renacentista. A súa principal obra é a novela Saudades, máis coñecida porén como Menina e Moça.\\nFrecuentaría a corte de Lisboa, colaborou no Cancioneiro Geral de García de Resende, que así como Bernardim pertenceu á roda dos poetas palacianos xuntamente con Sá de Miranda, Gil Vicente e outros.\\nFoi o introdutor do bucolismo en Portugal."},{"page_url":"https://tr.wikipedia.org/wiki/Hafif_ticari_ara%C3%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Marennes_17_Renault_Trafic_DCI-115_2014.jpg","page_title":"Hafif ticari araç","context_page_description":"Hafif ticari araç, taşıt ve ticari araç türüdür. Avrupa Birliği'nde brüt araç ağırlığı 3,5 tondan fazla olmayan ticari taşıyıcı araçlar için resmi terimdir. Nitelikli hafif ticari araçlar arasında kamyonet, panelvan, minivan, minibüs ve üç tekerlekli araçlar bulunur."},{"page_url":"https://pt.wikipedia.org/wiki/Cruz_(Cear%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Igreja_Cruz.JPG","page_title":"Cruz (Ceará)","context_page_description":"Cruz é um município do estado do Ceará, Brasil. Localiza-se na microrregião do Litoral de Camocim e Acaraú mesorregião do Noroeste Cearense. O município tem 22 887 habitantes e 334 km². Foi criado em 14 de janeiro de 1985 após ser emancipado de Acaraú através de plebiscito."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B4%D9%85%D8%A7%D9%84%D9%86%D8%A8%D8%B1%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Schmallenberg_um_1900.jpg","page_title":"اشمالنبرق","context_page_description":"{{Infobox settlement\\n|official_name = اشمالنبرق\\n|settlement_type = شهر\\n|nickname =\\n|motto =\\n|image_skyline =\\nاشمالنبرق آلمانین نوردراین-وستفالن ایالتینده یئر آلان بیر شهردیر و ۳۲۹-۸۳۱ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۲۵۵۵۵ نفر دیر. بۇ شهرین ۳۰۳ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://en.wikipedia.org/wiki/Co-op_City,_Bronx","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/NYPL_Bronx_Baychester_Library_Co-op_City_%2827173166852%29.jpg","page_title":"Co-op City, Bronx","context_page_description":"Co-op City is a cooperative housing development located in the northeast section of the borough of the Bronx in New York City. It is bounded by Interstate 95 to the southwest, west, and north and the Hutchinson River Parkway to the east and southeast, and is partially in the Baychester and Eastchester neighborhoods. With 43,752 residents as of the 2010 United States Census, it is the largest housing cooperative in the world.\\nCo-op City was formerly marshland before being occupied by an amusement park called Freedomland U.S.A. from 1960 to 1964. Construction began in 1966 and the first residents moved in two years later, though the project was not completed until 1973. The construction of the community was sponsored by the United Housing Foundation and financed with a mortgage loan from New York State Housing Finance Agency.\\nThe community is part of Bronx Community District 10 and its ZIP Code is 10475. Nearby attractions include Pelham Bay Park, Orchard Beach and City Island."},{"page_url":"https://en.wikipedia.org/wiki/B%C3%B8rge_Bak","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Headshot_of_B%C3%B8rge_Bak.png","page_title":"Børge Bak","context_page_description":"Børge Bak, Knight of the Order of the Dannebrog 1st Class, was a Danish polymath, inventor, violinist, chemist and professor of molecular spectroscopy at the University of Copenhagen, best known for his early contributions to the field of Molecular Spectroscopy. Bak travelled widely as a visiting Professor, including to the University of California, Berkeley, Columbia University in the City of New York, and the University of Bologna. He served as a nominator to the Nobel Committee for Chemistry and played an instrumental role in the 1991 Nobel Prize in Chemistry being awarded to Richard R. Ernst for his \\"contributions to the development of the methodology of high resolution nuclear magnetic resonance spectroscopy\\".\\nBak was the recipient of the 1957 Esso Foundation's prize for outstanding technical scientific research, and was elected a member of the Royal Danish Academy of Sciences in 1958."},{"page_url":"https://vi.wikipedia.org/wiki/G%E1%BB%ABng","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Koeh-146-no_text.jpg","page_title":"Gừng","context_page_description":"Gừng có danh pháp hai phần: Zingiber officinale là một loài thực vật hay được dùng làm gia vị, thuốc. Trong củ gừng có các hoạt chất: Tinh dầu zingiberen, chất nhựa, chất cay, tinh bột."},{"page_url":"https://it.wikipedia.org/wiki/Lanas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Lanas01.jpg","page_title":"Lanas","context_page_description":"Lanas è un comune francese di 403 abitanti situato nel dipartimento dell'Ardèche della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_jogos_da_Sele%C3%A7%C3%A3o_Brasileira_de_Rugby_Union","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Free_Use_British_and_Irish_Lions_flag.PNG","page_title":"Lista de jogos da Seleção Brasileira de Rugby Union","context_page_description":"Segue-se abaixo uma lista com todos os jogos da Seleção Brasileira de Rugby Union. Algumas partidas aparecem tanto na seção de eliminatórias para a Copa do Mundo quanto para o Campeonato Sul-Americano, uma vez que foram válidas para ambas as competições."},{"page_url":"https://sk.wikipedia.org/wiki/Majstrovstv%C3%A1_%C3%81zie_v_hokejbale_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/HK_ChineseYMCA_NTCentre.JPG","page_title":"Majstrovstvá Ázie v hokejbale 2016","context_page_description":"Majstrovstvá Ázie v hokejbale 2016 bol prvý turnaj majstrovstiev Ázie v hokejbale, ktoré organizuje Medzinárodná hokejbalová federácia. Konal sa v dňoch od 9. – 12. novembra 2016 v Hongkongu, za účasti 6 mužských tímov. Zápasy sa odohrali v aréne YMCA King's park Centenary Centre. Víťazom sa stala Kórejská republika, ktorá vo finálovom stretnutí zvíťazila nad domácim Hongkongom."},{"page_url":"https://gl.wikipedia.org/wiki/Aeroporto_de_Salt_Lake_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/SLC_airport%2C_2010.jpg","page_title":"Aeroporto de Salt Lake City","context_page_description":"O aeroporto internacional de Salt Lake City é un aeroporto civil e militar estadounidense situado a 6,4 quilómetros ao oeste do centro de Salt Lake City, Utah. É o aeroporto máis próximo para unha poboación de máis de 2,5 millóns de persoas e está a menos de 30 minutos por estrada de preto de 1,3 postos de traballo.\\nO aeroporto é o cuarto centro de conexións máis grande de Delta Air Lines, ademais de ser un centro de conexións para aeroliña de Delta Connection SkyWest Airlines, con preto de 300 saídas diárias. Tras Delta e Delta Connection, as compañías con máis presenza son Southwest Airlines, American Airlines e Alaska Airlines.\\nEn 2017 24 198 697 pasaxeiros pasaron polo aeroporto de Salt Lake City, representando un incremento dun 4,5% con respecto a 2016. É o 25º aeroporto máis concorrido en Norteamérica e o 85º do mundo en número de pasaxeiros. Ese ano houbo 327 292 movementos de avións, uns 900 por día. O aeroporto é propiedade da cidade de Salt Lake City é está administrado polo seu Departamento de Aeroportos. A cidade tamén é propietaria e opera outros dous aeroportos próximos, o aeroporto rexional South Valley e o aeroporto de Tooele Valley."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrale_dell%27Annunziata_(Tursi)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Cattedrale_dell%27Annunziata_Tursi_7.jpg","page_title":"Cattedrale dell'Annunziata (Tursi)","context_page_description":"La cattedrale dell'Annunziata si trova nel comune di Tursi, in provincia di Matera e sorge sulla piazza Maria SS. di Anglona nella parte bassa della cittadina."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Lokomotiven_und_Triebwagen_der_SNCF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/7221b.jpg","page_title":"Liste der Lokomotiven und Triebwagen der SNCF","context_page_description":"Die Liste der Lokomotiven und Triebwagen der SNCF beinhaltet alle Triebfahrzeuge der Société nationale des chemins de fer français. Die SNCF bezeichnet ihre Lokomotiven nach Achsfolge sowie einer laufenden Seriennummer. Diese wird für jede Baureihe mit einer neuen 100er oder 1000er Stelle angefangen."},{"page_url":"https://pl.wikipedia.org/wiki/Josef_Odlo%C5%BEil","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Josef_Odlo%C5%BEil_1964.jpg","page_title":"Josef Odložil","context_page_description":"Josef Odložil − czeski lekkoatleta specjalizujący się w biegach średnich, który reprezentował Czechosłowację.\\nDwukrotny uczestnik igrzysk olimpijskich w biegu na 1500 metrów - Tokio 1964 oraz Meksyk 1968. Dwukrotny uczestnik mistrzostw Europy - Belgrad 1962 oraz Budapeszt 1966. W obu występach nie odniósł sukcesów. W roku 1967 wywalczył srebrny krążek europejskich igrzysk halowych. Wielokrotny mistrz Czechosłowacji. Reprezentant kraju w pucharze Europy oraz w meczach międzypaństwowych - także przeciwko Polsce. Po zakończeniu kariery pracował jako trener, m.in. w Meksyku. W latach 1968-1987 był żonaty z Věrą Čáslavská. W latach 1992-1993 był członkiem Policyjnego Kontyngentu ONZ w Iraku. Po powrocie do Czech zmarł w wyniku obrażeń doznanych w bójce ze swoim 19-letnim synem w barze.\\nRekord życiowy: 3:37,6. Od 1994 w Pradze rozgrywany jest Memoriał Josefa Odložila."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%A1i_nh%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Atap_Ijuk.JPG","page_title":"Mái nhà","context_page_description":"Mái nhà hay nóc nhà là bộ phận bao phủ phần trên cùng của một tòa nhà. Mái nhà được xây dựng, thiết kể để bảo vệ công trình nhà khỏi ảnh hưởng của thời tiết. Các cấu trúc có mái che được ghi nhận từ một hộp thư cho đến một nhà thờ hoặc sân vận động trong đó nhà ở là phổ biến nhất.\\nTrong hầu hết các nước, mái nhà bảo vệ chủ yếu chống lại mưa. Tùy thuộc vào kết cấu của tòa nhà, mái nhà cũng có thể thiết kế để bảo vệ chống lại nhiệt, ánh sáng mặt trời, tuyết, thời tiết lạnh và gió. Nhiều cấu trúc xây dựng có thể sử dụng tấm lợp để bảo vệ chống lại nắng, gió và mưa nhưng có thể tiếp nhận một phần ánh sáng hoặc một mái hiên có mái che bằng vật liệu bảo vệ chống lại ánh sáng mặt trời, nhưng tiếp nhận các yếu tố khác như gió, nhiệt độ."},{"page_url":"https://ca.wikipedia.org/wiki/Hidrocotil%C3%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Mol2.jpg","page_title":"Hidrocotilè","context_page_description":"L'hidrocotilè o centella asiàtica és una planta herbàcia, originària de Madagascar, que creix en regions pantanoses, tropicals i subtropicals, d'Àsia, Austràlia, Illes del Pacífic, Malàisia, Melanèsia i Nova Guinea.\\nÉs una planta de la família apiàcia, originària de la zona pantropical d'Austràlia, Indonèsia, Xina, Índia, Sri lanka, Madagascar, Àfrica del sud. Una varietat seva Centella remanda creix també a algunes zones d'Amèrica del sud com Brasil, i d'altres d'Amèrica central. El seu hàbitat natural és a zones humides i amb ombres típiques de climes tropicals i subtropicals. C. asiàtica és una herbàcia perenne que no fa més d'un pam d'alçada. Les seves fulles són senceres i amb protuberàncies arrodonides. La inflorescència consta de tres a sis flors sèssils. El fruit és un aqueni, més concretament un diaqueni amb forma de disc."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Russian_artists","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Antropov_Unknown.jpg","page_title":"List of Russian artists","context_page_description":"This is a list of Russians artists. In this context, the term \\"Russian\\" covers the Russian Federation, Soviet Union, Russian Empire, Tsardom of Russia and Grand Duchy of Moscow, including ethnic Russians and people of other ethnicities living in Russia. This list also includes those who were born in Russia but later emigrated, and those who were born elsewhere but immigrated to the country and/or worked there for a significant period of time.\\nSee also: List of Russian architects, List of Russian inventors, List of Russian explorers, List of Russian language writers, Russian culture"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%90%E1%83%A8%E1%83%99%E1%83%98%E1%83%A0%E1%83%94%E1%83%97%E1%83%98%E1%83%A1_%E1%83%A3%E1%83%99%E1%83%98%E1%83%93%E1%83%A3%E1%83%A0%E1%83%94%E1%83%A1%E1%83%98_%E1%83%AC%E1%83%94%E1%83%A0%E1%83%A2%E1%83%98%E1%83%9A%E1%83%94%E1%83%91%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%B0%D1%8F_%D1%82%D0%BE%D1%87%D0%BA%D0%B0_%D0%A0%D0%91.jpg","page_title":"ბაშკირეთის უკიდურესი წერტილები","context_page_description":"ბაშკირეთის უკიდურესი წერტილები — წერტილები, რომლებიც განსაზღვრავენ რუსეთის ფედერაციის სუბიექტის, ბაშკირეთის რესპუბლიკის მდებარეობას გეოგრაფიული კოორდინატების სისტემაში და აღნიშნავენ მის განფენილობას ჩრდილოეთიდან სამხრეთისკენ და აღმოსავლეთიდან დასავლეთისკენ."},{"page_url":"https://ms.wikipedia.org/wiki/Sekolah_Menengah_Kebangsaan_Tun_Syed_Zahiruddin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/KACIP_PINANG.jpg","page_title":"Sekolah Menengah Kebangsaan Tun Syed Zahiruddin","context_page_description":"Sekolah Menengah Kebangsaan Tun Syed Zahiruddin atau nama ringkasnya SMK Tun Syed Zahiruddin, merupakan sebuah Sekolah menengah kebangsaan yang terletak di Melaka.\\nSMK Tun Syed Zahiruddin juga dikenali sebagai TUSZA dalam kalangan warga sekolah, ibu bapa dan penduduk di sekitar sekolah. Nama ini ialah singkatan Tun Syed Zahiruddin. Singkatan ini adalah agar mudah untuk warga sekolah dan penduduk mengenali SMKTSZ."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Charlottenlund","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Charlottenlund_2.JPG","page_title":"Château de Charlottenlund","context_page_description":"Le château de Charlottenlund est un château suédois situé en Scanie à huit kilomètres d'Ystad. Il a été construit en 1849 en style néomédiéval romantique par le futur chef du gouvernement suédois, le comte Arvid Posse. Il a été acheté en 1902 par le Danois Jacob Lachmann, dont les descendants sont toujours propriétaires. Il est entouré d'un domaine de 664 hectares, principalement céréalier, et d'un parc de 122 hectares."},{"page_url":"https://fr.wikipedia.org/wiki/Cesta_(Saint-Marin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Coat_of_arms_of_San_Marino.svg","page_title":"Cesta (Saint-Marin)","context_page_description":"Cesta ou De La Fratta est un des trois pics du mont Titano, qui surplombent la ville de Saint-Marin, capitale de la République de Saint-Marin. Les deux autres pics étant Guaita et Montale. Ces trois sommets portent chacun d'eux les trois châteaux qui assurèrent la défense de la Ville de Saint-Marin que l'on retrouve stylisé sur les armoiries de la république."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Innenstadt_(G%C3%B6rlitz),_Bi%E2%80%93D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/G%C3%B6rlitz%2C_Demianiplatz_44.jpg","page_title":"Liste der Kulturdenkmale in Innenstadt (Görlitz), Bi–D","context_page_description":"In der Liste der Kulturdenkmale in Innenstadt (Görlitz), Bi–D sind sämtliche Kulturdenkmale der Görlitzer Innenstadt verzeichnet, die bis Oktober 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden und deren Straßenname mit den entsprechenden Anfangsbuchstaben beginnt. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Görlitz."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B7%D5%A4%D5%AB%D5%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/The_Plague_of_Thebes.jpg","page_title":"Էդիպ","context_page_description":"Էդիպ, ըստ հունական դիցարանի Թեբեի արքան, Լայոս արքայի և Իոկաստրայի որդին։"},{"page_url":"https://it.wikipedia.org/wiki/Blue_%C3%96yster_Cult","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Allenlanier.JPG","page_title":"Blue Öyster Cult","context_page_description":"I Blue Öyster Cult sono un gruppo musicale rock statunitense nato alla fine degli anni sessanta. Nella loro opera si trovano elementi di diversi sottogeneri del rock, inclusi hard rock, heavy metal, rock psichedelico e rock progressivo. Fra i loro brani più celebri si possono citare The Reaper, Astronomy, Godzilla e Burnin' for You.\\nLa line-up originale della band era composta dal cantante e chitarrista Eric Bloom, dal chitarrista Buck Dharma, dal tastierista Allen Lanier e dai fratelli Joe e Albert Bouchard, rispettivamente bassista e batterista."},{"page_url":"https://nl.wikipedia.org/wiki/Kriemhildm%C3%BChle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Xanten_-_Nordwall_-_Krimhildm%C3%BChle_05_ies.jpg","page_title":"Kriemhildmühle","context_page_description":"De Kriemhildmühle is een stellingmolen in de plaats Xanten in Duitsland."},{"page_url":"https://en.wikipedia.org/wiki/Latin_Quarter,_Copenhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Bispetorvet.jpg","page_title":"Latin Quarter, Copenhagen","context_page_description":"The Latin Quarter is a neighbourhood in central Copenhagen, Denmark. It is bounded by Nørregade to the west, Vestergade to the south, Vester Voldgade to the east and Nørre Voldgade to the north. The name refers to the Latin language, which was once widely spoken in and around the University, whose historic home is situated on the other side of Nørregade. Most of the student life has now been relocated to four new campuses but the area is still known for its lively atmosphere with an abundance of boutiques, cafés and night clubs."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AD%9F%E5%8A%A0%E6%8B%89%E5%9B%BD%E6%80%BB%E7%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Zillur_Rahman_in_Neubrandenburg%2C_Germany_in_1973.jpg","page_title":"孟加拉国总统","context_page_description":"孟加拉国总统，是孟加拉国的国家元首，每五年选举一届，由选举委员会间接选举产生，总统府设在孟加拉宫。\\n当1971年，孟加拉国刚独立时，政府体制中总统只是礼仪性元首，行政权属于总理，但1974年，当谢赫·穆吉布·拉赫曼担任总理时，政权转换为总统制，总统掌握所有行政权，直到1991年，卡莉达·齐亚担任总理时，总理重新掌握政权。\\n1996年，由于出现反对党抵制总理选举的状况，需要总统组织过渡政府，所以在1996年宪法第13次修正时，给予总统更大的权力，包括在过渡政府期间兼管国防部，宣布国家处于紧急状态，解除过渡政府总理和部长职务等，一旦议会解散，总统必须在15日内指定过渡政府总理。但当新议会选出正式总理后，总统将恢复礼仪性职务。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%85%D8%B0%D8%AC%D8%A9_%D8%A7%D9%84%D9%86%D8%B8%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Static%2C_Dynamic%2C_and_Requirements_Models_for_Sys_Partition.jpg","page_title":"نمذجة النظم","context_page_description":"نمذجة النظم أو نمذجة النظام هي دراسة متعددة التخصصات لاستخدام النماذج لتصور وبناء النظم في مجال الأعمال التجارية وتطوير تكنولوجيا المعلومات.\\nالنوع الشائع من نمذجة الأنظمة هو نمذجة الوظائف، مع تقنيات محددة مثل مخطط كتلة التدفق الوظيفي وإنشاء رسومات تخطيطية. يمكن توسيع هذه النماذج باستخدام التحلل الوظيفي، ويمكن ربطها بنماذج المتطلبات لمزيد من تقسيم الأنظمة.\\nعلى النقيض من النمذجة الوظيفية، هناك نوع آخر من نمذجة النظم وهو النمذجة المعمارية التي تستخدم بنية النظم لنمذجة هيكل النظام وسلوكه والمزيد من وجهات النظر.\\nيمكن أيضًا اعتبار لغة نمذجة العمليات، وهي تمثيل رسومي لتحديد عمليات الأعمال في سير العمل، لغة نمذجة النظم."},{"page_url":"https://fi.wikipedia.org/wiki/Seututie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Pyh%C3%A4-Luosto_porot.JPG","page_title":"Seututie","context_page_description":"Seututiet ovat Suomen tieverkon maanteitä, jotka palvelevat seutukuntien liikennettä ja liittävät näitä valta- ja kantateihin. Seututeiden liikenteellinen merkitys on siis valta- ja kantateitä pienempi, mutta yhdysteitä suurempi. Seututeille on tienumerointijärjestelmässä varattu numerot 100–999. Tieopasteisiin numerot on merkitty mustin numeroin valkoiselle pohjalle.\\nOsa seututeistä on valtateiden rinnakkaisteitä, yleensä nykyistä valtatietä vanhempia, samojen paikkakuntien välisiä teitä, jotka toimivat varareitteinä valtateille ja tarjoavat vaihtoehdon hitaammalle liikenteelle. Moottoriteiden rinnalla kulkee aina rinnakkaistie, joka yleensä on tieluokaltaan seututie.\\nLiikenne- ja viestintäministeriö määrää, mitkä tiet ovat seututeitä. Seututeiden numerointi aloitettiin 1960-luvun lopulla tarkoituksena numeroida tärkeimmät päätieverkon ulkopuolella olevat tiet. Vuoden 2014 alussa Suomessa oli 13 609 kilometriä seututeitä. Seututeistä noin 35 prosenttia on kestopäällysteisiä, noin 62 prosenttia kevytpäällysteisiä ja noin 3 prosenttia sorateitä. Vain alle prosentti seututeistä on kaksiajorataisia, kuten seututie 101 eli Kehä I."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Kawalerii_Street_in_Warsaw_DSC_1557.JPG","page_title":"List of diplomatic missions of the United Kingdom","context_page_description":"This is a list of diplomatic missions of the United Kingdom of Great Britain and Northern Ireland, excluding honorary consulates. The UK has one of the largest global networks of diplomatic missions. UK diplomatic missions to capitals of other Commonwealth of Nations member countries are known as High Commissions. For three Commonwealth countries, the Foreign and Commonwealth Office still uses the term \\"Deputy High Commission\\" for Consulates-General, although this terminology is being phased out.\\nIn 2004, the FCO carried out a review of the deployment of its diplomatic missions, and subsequently over a two-year period closed its missions in Nassau, Asunción, Dili, Maseru, Mbabane, Antananarivo, Nuku'alofa, Tarawa, and Port Vila. Additionally several consulates and trade offices were also closed, including those in Fukuoka, Vientiane, Douala, Porto, along with Frankfurt, Leipzig, and Stuttgart in Germany, and Phoenix, San Juan, and Dallas in the United States. Other consulates in Australia, Germany, France, Spain, New Zealand, and the US were downgraded and staffed by local personnel only."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E5%85%AC%E9%96%8B%E5%A4%A7%E5%AD%B8%E6%9D%8E%E5%98%89%E8%AA%A0%E5%B0%88%E6%A5%AD%E9%80%B2%E4%BF%AE%E5%AD%B8%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/OUHK_Kwai_Hing_Campus_Floors.jpg","page_title":"香港公開大學李嘉誠專業進修學院","context_page_description":"香港公開大學李嘉誠專業進修學院是香港公開大學的其中一個學術部門，前稱為香港公開大學持續及社區教育中心。專業進修學院設立於1992年，為學生提供包括職訓短期課程、專業課程、企業培訓、海外學位課程，為培養中六畢業生投身社會之毅進文憑、文憑、高級文憑課程和應用學習課程。另有鼓勵婦女學習的自在人生自學計劃。學科類別有藝術、文化、商業管理及法律、健康科學等。除專業進修課程外，該院亦定期舉辦免費的課程講座。該院現任院長為曾德源博士。\\n前任院長為黃偉寧博士"},{"page_url":"https://pt.wikipedia.org/wiki/Desmatamento_no_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Derrubada_do_Pau_Brasil.jpg","page_title":"Desmatamento no Brasil","context_page_description":"O desmatamento no Brasil é um dos grandes problemas ambientais que o país enfrenta na atualidade. Várias são suas causas, e elas têm peso distinto nas diversas regiões, sendo as mais importantes a conversão das terras para a agricultura ou para a pecuária, a exploração madeireira, a grilagem de terras, a urbanização e a criação de infraestruturas como pontes, estradas e barragens. Os estados do Mato Grosso, Pará e Rondônia são os mais atingidos pelo desmatamento recente.\\nDesde que o homem chegou ao atual território do Brasil, há milhares de anos, passou a produzir impacto ambiental em ciclos repetidos de desmatamento. Mudanças climáticas também devem ter provocado importantes rearranjos nas composições florestais de amplas regiões, mas o conhecimento do processo em épocas tão recuadas é muito incompleto. A partir da conquista portuguesa em 1500 os dados começam a ser mais abundantes, atestando que muitas florestas caíram, especialmente no litoral, para retirada de madeiras e uso agropecuário da terra. De lá para cá o problema se agravou profundamente."},{"page_url":"https://la.wikipedia.org/wiki/Regenc%C3%B3s","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Bandera_de_Regenc%C3%B3s.svg","page_title":"Regencós","context_page_description":"Regencós est commune Hispanicum in Catalauniae Provincia Gerundensi situm, cui anno 2011 301 incolarum sunt."},{"page_url":"https://fi.wikipedia.org/wiki/Jingzhou","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Jingzhou_bridge.jpg","page_title":"Jingzhou","context_page_description":"Jingzhou on prefektuuritason kaupunki Hubein maakunnan eteläosassa Kiinassa. Kaupunki sijaitsee Jangtsejoen pohjoisrannalla, noin 200 kilometriä maakunnan pääkaupunki Wuhanista länteen. Kaupungin väkiluku on 5,692 miljoonaa ja pinta-ala 14 104 neliökilometriä.\\nKaupungin naapureina ovat pohjoisessa Yichangin ja Jingmenin prefektuuritason kaupungit sekä Qianjiangin ja Xiantaon aliprefektuurit. Idässä Jingzhou rajoittuu Xianningin, etelässä Yueyangin ja Changden prefektuuritason kaupunkiin.\\nPiirikuntatasolla prefektuuri jakautuu kahteen kaupunkipiiriin, kolmeen piirikuntatason kaupunkiin ja kolmeen piirikuntaan.\\nJingzhou tunnetaan jo yhtenä Chu-valtion syntypaikoista Kevättä ja syksyä -kaudella."},{"page_url":"https://de.wikipedia.org/wiki/Roger_Beuchat","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Roger_Beuchat.jpg","page_title":"Roger Beuchat","context_page_description":"Roger Beuchat ist ein ehemaliger Schweizer Radrennfahrer."},{"page_url":"https://en.wikipedia.org/wiki/Tamga","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Taj_Mahal_top_of_finial.jpg","page_title":"Tamga","context_page_description":"A tamga or tamgha is an abstract seal or stamp used by Eurasian nomadic peoples and by cultures influenced by them. The tamga was normally the emblem of a particular tribe, clan or family.\\nThey were common among the Eurasian nomads throughout Classical Antiquity and the Middle Ages"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D0%BE%D0%B2%D0%B0%D0%BD%D0%BD%D1%96_%D0%91%D0%B0%D1%82%D1%82%D1%96%D1%81%D1%82%D0%B0_%D0%9A%D1%80%D0%B5%D1%81%D0%BF%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/1601_Cerano_Taufe_Christi_anagoria.JPG","page_title":"Джованні Баттіста Креспі","context_page_description":"Джованні Баттіста Креспі також Іль Черано — італійській художник доби раннього бароко, скульптор і архітектор, працював у Мілані."},{"page_url":"https://de.wikipedia.org/wiki/Germania_inferior","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Landesmuseum_Bonn_2012-01-29-5164.jpg","page_title":"Germania inferior","context_page_description":"Germania inferior war eine römische Provinz. Sie umfasste die westlich des Rheins gelegenen Teile der heutigen Niederlande und Deutschlands sowie Teile von Belgien. Ursprünglich, seit Augustus, war dieses Gebiet ein Heeresbezirk, der verwaltungstechnisch zu Gallien gehörte. Die Provinz wurde erst unter Domitian um 85 n. Chr. eingerichtet. Ihre Hauptstadt und Sitz der Statthalter von Niedergermanien war die Colonia Claudia Ara Agrippinensium, das heutige Köln. Im Zuge einer spätantiken Verwaltungsreform erfolgte dann die Einrichtung der Germania secunda.\\nGermania inferior war die nördliche Nachbarprovinz von Germania superior und lag östlich der Belgica."},{"page_url":"https://de.wikipedia.org/wiki/Flugabwehrkanonenpanzer_Gepard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Cheetah_PRTL.jpg","page_title":"Flugabwehrkanonenpanzer Gepard","context_page_description":"Der Flugabwehrkanonenpanzer Gepard ist ein autonomer, allwetterkampffähiger FlaK-Panzer aus deutscher Produktion. Bereits in den 1970er-Jahren entwickelt und produziert, bildete er für lange Zeit einen Eckpfeiler der Flugabwehr des Heeres der Bundeswehr und anderer Staaten. Mit der Außerdienststellung Ende der 1990er- beziehungsweise Anfang der 2000er-Jahre wird er von keinem der ursprünglichen Nutzer mehr betrieben. Die FlaK-Panzer wurden in der Zwischenzeit an andere Armeen weitergegeben."},{"page_url":"https://war.wikipedia.org/wiki/Distoechurus_pennatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Distoechurus_pennatus.png","page_title":"Distoechurus pennatus","context_page_description":"An Distoechurus pennatus in uska species han Diprotodontia nga ginhulagway ni Peters hadton 1874. An Distoechurus pennatus in nahilalakip ha genus nga Distoechurus, ngan familia nga Acrobatidae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://nl.wikipedia.org/wiki/Baliracq-Maumusson","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Mairie_de_Baliracq.JPG","page_title":"Baliracq-Maumusson","context_page_description":"Baliracq-Maumusson is een gemeente in het Franse departement Pyrénées-Atlantiques en telt 118 inwoners. De plaats maakt deel uit van het arrondissement Pau."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BC%D0%B2%D1%80%D0%BE%D1%81%D0%B8%D0%B9_%D0%90%D0%B2%D1%80%D0%B5%D0%BB%D0%B8%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/History_of_the_Kings_%28f.66%29_Emrys_Wledig.jpg","page_title":"Амвросий Аврелиан","context_page_description":"Амвросий Аврелиан — военачальник, возможно, правитель бриттов примерно во второй половине V века. Имеется предположение, что речь идёт о двух людях — отце и сыне, носивших одинаковые имена."},{"page_url":"https://de.wikipedia.org/wiki/Vollm%C3%BChle_(Gatzweiler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Vollm%C3%BChle_4.jpg","page_title":"Vollmühle (Gatzweiler)","context_page_description":"Die Vollmühle ist eine Wassermühle mit einem unterschlächtigen Wasserrad nahe der Rheindahlener Honschaft Gatzweiler im Mönchengladbacher Stadtbezirk West."},{"page_url":"https://pl.wikipedia.org/wiki/Organizacja_Harcerska_%E2%80%9ERod%C5%82o%E2%80%9D_im._Szarych_Szereg%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Harcowka_OHR.svg","page_title":"Organizacja Harcerska „Rodło” im. Szarych Szeregów","context_page_description":"Organizacja Harcerska „Rodło” im. Szarych Szeregów – niewielka, lokalna organizacja harcerska, założona w 1993 roku przez grupę instruktorów występujących ze Związku Harcerstwa Polskiego. „Rodło” działa współcześnie w Jarocinie i jego okolicach.\\nNazwa organizacji pochodzi od symbolu Związku Polaków w Niemczech – rodła. Wyraża ona dążenia założycieli do stworzenia organizacji zachowującej metodę i tradycję Związku Harcerstwa Polskiego, lecz posiadającej od niego rozłączność prawną, podobnie jak działacze Rodła w Niemczech chcieli kultywować polską kulturę i zwyczaje, lecz być równocześnie niezależni od władz Polskiej Rzeczypospolitej Ludowej."},{"page_url":"https://de.wikipedia.org/wiki/Hermann_Kallenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Gandhi%2C_Sonia_Schlesin%2C_Hermann_Kallenbach.jpg","page_title":"Hermann Kallenbach","context_page_description":"Hermann Kallenbach war ein südafrikanischer Architekt und Weggefährte von Mahatma Gandhi."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_la_No%C3%AB_Bel-Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Ch%C3%A2teau_de_la_No%C3%AB_Bel-Air%2C_Vallet_44.JPG","page_title":"Château de la Noë Bel-Air","context_page_description":"Le château de la Noë Bel-Air est un château situé à Vallet, dans la région Pays de la Loire, en France."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_et_classification_des_races_ovines_de_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Mouton_Charollais.JPG","page_title":"Liste et classification des races ovines de France","context_page_description":"On dénombre une soixantaine de races ovines en France dont certaines sont aujourd'hui des races dites de conservatoire et beaucoup classées par le Bureau des ressources génétiques dans la liste des races en danger.\\nUne classification des races offre à la fois un intérêt culturel et un intérêt pratique :\\nSur le plan culturel, il s'agit d'offrir une compréhension d'un univers de races pouvant apparaître comme disparate à un simple observateur.\\nSur le plan pratique qui prolonge le précédent, une classification permet d'introduire le volet élevage et aptitudes plus ou moins commun à chaque groupe de races. Ce volet se retrouvera, plus développé, dans l'article de chacune d'elles.\\nDe fait cette classification peut-être un portail d'entrée à la connaissance des races ovines et de l'élevage ovin. Ce volet sera abordé dans cet article au travers du paragraphe consacré à une vision d'ensemble de la sélection des races ovines.\\nOn ne perdra pas de vue que les croisements entre races sont plus nombreux en élevage ovin qu'ils ne le sont en élevage bovin et que le nombre de femelles issues de croisement y est relativement élevé.\\nL'article comprend quatre parties :"},{"page_url":"https://de.wikipedia.org/wiki/Herpes-simplex-Viren","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/HSV-1-EM.png","page_title":"Herpes-simplex-Viren","context_page_description":"Als Herpes-simplex-Viren bezeichnet man zwei eng verwandte humanpathogene Virusspezies: das Humane Herpesvirus 1 und 2. Die beiden Spezies wurden ursprünglich als Serotypen derselben Spezies klassifiziert.\\nSie gehören beide zur Gattung Simplexvirus aus der Unterfamilie Alphaherpesvirinae in der Familie Herpesviridae.\\nDie Herpes-simplex-Viren verursachen sehr verschiedene Erkrankungen des Herpes simplex, darunter die sogenannte Mundfäule bei Kleinkindern. Die häufigsten Symptome einer Infektion dieser Viren sind jedoch Lippenherpes und Genitalherpes. Der Herpes neonatorum des Neugeborenen und auch die Herpes-simplex-Enzephalitis insbesondere bei immunsupprimierten Menschen stellen lebensbedrohliche Komplikationen dar."},{"page_url":"https://es.wikipedia.org/wiki/Reino_del_B%C3%B3sforo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/ThracianCoin.JPG","page_title":"Reino del Bósforo","context_page_description":"El Reino del Bósforo fue un Estado de la antigüedad fundado en el año 438 a. C. durante la época clásica por un caudillo local llamado Espártoco I.​ Estaba localizado en la región del Bósforo Cimerio y fue constituido por la unión de diversas colonias griegas de origen jonio, entre las que sobresalieron Eupatoria, Fanagoria, Feodosia, Tanais, Olbia y Panticapea, la mayoría en Crimea, península a la que los griegos llamaban Quersoneso Táurico, Kersonesos Taurikos, también conocida como Táurica. Su capital fue la ciudad de Panticapea.​\\nLa relación y proximidad con los escitas propició una importante influencia en la cultura y el arte de las colonias griegas de la costa norte del Ponto Euxino, así como una fuente de inestabilidad por los continuos ataques por parte de los escitas. Ante la imposibilidad de defenderse de estos ataques, el reino entró bajo la protección póntica. Posteriormente los escitas fueron desplazados por los sármatas, que siguieron atacando las ciudades griegas, por lo que finalmente el reino, para garantizar su supervivencia, aceptó quedar bajo influencia romana."},{"page_url":"https://cs.wikipedia.org/wiki/Fiat_Fiorino","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/FCC_Pod%C4%9Bbrady_2017_36a._Fiat_Fiorino.jpg","page_title":"Fiat Fiorino","context_page_description":"Model Fiorino je malý dodávkový automobil italské firmy Fiat. Jednotlivé série vznikají úpravou jiných, menších automobilů, například první série byla založená na modelu Fiat 127. Vyrábí se od roku 1977 dodnes, částečně protože má ve své třídě největší nákladní prostor."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9F%D0%BE%D1%81%D0%BE%D0%BB%D1%8C%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/%D0%9F%D0%BE%D1%81%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%A1%D0%BF%D0%B0%D1%81%D0%BE-%D0%9F%D1%80%D0%B5%D0%BE%D0%B1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C_2.JPG","page_title":"Посольск","context_page_description":"Посольск — Российн Федерацин Бурятин Кабанскан кӀоштан юкъа йогӀу эвла."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_de_San_Pietro_di_Castello","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Olivolo.jpg","page_title":"Île de San Pietro di Castello","context_page_description":"San Pietro ou San Pietro di Castello, anciennement Olivolo, est une île de la lagune de Venise, en Italie."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B2%D8%AF_%D8%A8%D8%BA%D8%AF%D8%A7%D8%AF_(%D9%81%DB%8C%D9%84%D9%85_%DB%B1%DB%B9%DB%B2%DB%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Thethiefofbagdad-lobbycard-1924.jpg","page_title":"دزد بغداد (فیلم ۱۹۲۴)","context_page_description":"دزد بغداد فیلم آمریکایی که در سال ۱۹۲۴ به کارگردانی رائول والش ساخته شد. این فیلم در لیست بهترین فیلم‌های فانتزی، در رتبه نهم قرارگرفت. این فیلم یکی از دستاوردهای بزرگ سینمای صامت در زمان خود محسوب می‌گردد. داگلاس فربنکس بازیگر اصلی و تهیه‌کننده فیلم، در یکی از بهترین نقش‌های خود ظاهر شده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Maur_(Oise)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Map_commune_FR_insee_code_60588.png","page_title":"Saint-Maur (Oise)","context_page_description":"Saint-Maur is een gemeente in het Franse departement Oise en telt 355 inwoners. De plaats maakt deel uit van het arrondissement Beauvais."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%B0%E5%B0%BC%E7%9F%9B%E5%B0%BE%E9%B1%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Indonesian_coelacanth%2C_Expo_2015.jpg","page_title":"印尼矛尾鱼","context_page_description":"印尼矛尾鱼，又称苏拉威西岛矛尾鱼，是腔棘鱼目矛尾鱼属的其中一种。1997年，在印尼苏拉威西岛发现了一种奇特的鱼，经基因测试发现这个标本在基因上与西印度洋矛尾鱼略有差异。后来于2000年被正式描述，是为矛尾鱼的另一个物种。分子分析估计两个物种的分支时间大约在2,500万年前。\\n该物种已被评定为易危。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B1%D8%AA%D9%85%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Pieter_van_Harinxma_1628-1630.jpg","page_title":"أرتميس","context_page_description":"آرتميس أو أرتميس، بحسب الميثولوجيا الإغريقية القديمة، هي إلهة الصيد والبرية، حامية الأطفال، وإلهة الإنجاب، العذرية، والخصوبة. وتعتبر أرتميس إحدى أهم، وأقوى، وأقدم الآلهة الإغريقية، حيث أنها تنتمي للأولمبيين، أو الآلهة الإثنا عشر. هي ابنة كلا من زيوس، ملك الآلهة، وليتو، وهي أيضًا الأخت التوأم لأبولو\\n. غالبا ما كانت أرتميس تُجسد وفي يدها قوس\\nوسهام، وكان الأيل وشجر السرو مقدسين بالنسبة لها. وفي فترة لاحقة خلال العصر الهليستني، لعبت أرتميس دور إليثيا، الإلاهة الكريتيّة، التي تساند النساء عند الولادة.\\nقورنت أرتميس في وقت لاحق بسيليني، تيتانة كانت في السابق إلهة القمر الإغريقية، حيث كانت تُجسد في بعض الأوقات وهلال فوق رأسها. كما قورنت بإلهة الصيد الرومانية\\n\\"ديانا\\"، الإلهة الأتروسكانية \\"أرتومة\\"، وإلهة كاريا \\"هيكاتي\\". يرى بعض الباحثين أن هذا الاسم، والإلهة نفسها، ليست نتاج فكر الإغريق القدماء، بل تعود لقبل نشوء الحضارة الإغريقية. يُشير إليها هوميروس بصفتها \\"أرتميس ابنة البراري\\" و\\"سيدة الحيوانات\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Szud%C3%A9tavid%C3%A9k","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/S%C3%BCdm%C3%A4hren_Warte.JPG","page_title":"Szudétavidék","context_page_description":"Szudétavidék néven nevezték Csehország azon határvidékeit, ahol a német lakosság volt többségben."},{"page_url":"https://en.wikipedia.org/wiki/Sergio_Fern%C3%A1ndez_(footballer,_born_1977)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Sergio_Fern%C3%A1ndez_Gonz%C3%A1lez_1.jpg","page_title":"Sergio Fernández (footballer, born 1977)","context_page_description":"Sergio Fernández González, known simply as Sergio, is a Spanish retired footballer who played as a central defender.\\nDuring 16 years as a professional, he played mainly for Celta and Osasuna, starting and ending his career with Sporting de Gijón. He appeared in 295 La Liga matches over 15 seasons, scoring nine goals."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%BF%D5%B8%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Wpdms_physics_proton_proton_chain_1.svg","page_title":"Ատոմ","context_page_description":"Ատոմ, քիմիական տարրի հատկություններ ունեցող փոքրագույն մասնիկ։ Ցանկացած պինդ մարմին, հեղուկ, գազ կամ պլազմա կազմված է չեզոք կամ իոնացված ատոմներից։ Ատոմները շատ փոքր են. սովորաբար մոտ 100 պիկոմետր ։\\nՓոքր չափերի պատճառով ատոմների վաքագծի վերաբերյալ դասական ֆիզիկայի կանխատեսումները նկատելիորեն սխալ են, ինչը պայմանավորված է քվանտային էֆեկտներով։ Ֆիզիկայի զարգմացման ընթացքում ատոմային մոդելները հիմնվել են քվանտային սկզբունքների վրա՝ ատոմի վարքագիծն ավելի լավ կանխատեսելու և բացատրելու համար։\\nՑանկացած ատոմ կազմված է մեկ միջուկից և մեկ կամ ավելի էլեկտրոններից։ Միջուկը կառուցված է մեկ կամ ավել պրոտոններից և սովորաբար գրեթե նույն քանակությամբ նեյտրոններից։ Պրոտոններն ու նեյտրոնները կոչվում են նուկլոնները։ Ատոմի զանգվածի ավելի քան 99.94%-ը միջուկն է։ Պրոտոններն ունեն դրական, էլեկտրոնները՝ բացասական, իսկ նեյտրոնները՝ չեզոք էլեկտրական լիցք։ Եթե ատոմում էլեկտրոնների և պրոտոնների թիվը հավասար է, ուրեմն այն էլեկտրականապես չեզոք է։ Եթե ատոմում պրոտոնների համեմատ կան ավել կամ պակաս էլեկտրոններ, ուրեմն այն համապատասխանաբար բացասական կամ դրական լիցք ունի և կոչվում է իոն։\\nԱտոմում էլեկտրոնները միջուկի հետ կապված են էլեկտրամագնիսական ուժի միջոցով։"},{"page_url":"https://ro.wikipedia.org/wiki/1_mai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/David_Livingstone_-1.jpg","page_title":"1 mai","context_page_description":"1 mai este a 121-a zi a calendarului gregorian."},{"page_url":"https://es.wikipedia.org/wiki/Pedro_I_de_Brasil_y_IV_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Pedro_II_of_Brazil_by_Insley_Pacheco_1865b.jpg","page_title":"Pedro I de Brasil y IV de Portugal","context_page_description":"Pedro I de Brasil y IV de Portugal fue un monarca portugués. Proclamó la independencia de Brasil y se convirtió en el primer emperador de Brasil y en el primer jefe de Estado de ese país. Ocupó brevemente el trono portugués con el nombre de Pedro IV, el Rey Soldado."},{"page_url":"https://fr.wikipedia.org/wiki/Solido_(mod%C3%A9lisme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Lancia-Dialogos_Solido_1-43.jpg","page_title":"Solido (modélisme)","context_page_description":"Solido est une marque française de véhicules miniatures Elle est exploitée par la société Z Models à Josselin."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%A1%E0%A5%87%E0%A4%B0%E0%A5%87%E0%A4%A8_%E0%A4%AC%E0%A5%87%E0%A4%A8%E0%A5%8D%E0%A4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Darren_Bent_26-04-2008_1.jpg","page_title":"डेरेन बेन्ट","context_page_description":"डेरेन बेन्ट एक अङ्ग्रेजी पेशेवर फुटबल खेलाडी हुन जसले अग्रपंक्तिको रूपमा खेल्छन् ।"},{"page_url":"https://la.wikipedia.org/wiki/Sesame_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Plazasesamologo.svg","page_title":"Sesame Street","context_page_description":"Sesame Street est spectaculum televisificum quod formá seriei primum in Civitatibus Foederatis praebebatur. Transmissio seriei die 10 Novembris anni 1969 coepit, et usque hodie extenditur. Bertholdus et Ernestus personae notissimae sunt.\\nConsilium huius spectaculi est liberis ediscendis oblectamen dare, doctrinas cum acroamate miscendo. In spectaculis fabulant homines cum pupulis generis Muppet. Sesame Street quidem huius generis spectaculi putatur longissima series."},{"page_url":"https://fr.wikipedia.org/wiki/Voile_%C3%A0_corne","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Bojseglar.JPG","page_title":"Voile à corne","context_page_description":"La voile à corne, est une voile aurique qui tient son nom de la vergue qui s'appelle corne ou pic. L'extrémité inférieure de cette corne, appuyée au mât, pivote selon l'axe du mât. Généralement bordée d'une bôme, la voile à corne peut donc être établie tribord amures ou bâbord amures sans présenter un côté moins performant, car déformé par le mât, et donc sans devoir gambeyer après un virement de bord comme pour la voile au tiers.\\n« Voile à corne » et « voile aurique » ne sont pas synonymes. Il convient d’appeler cette voile sous le seul nom de voile à corne, la voile aurique désignant une catégorie de voile plus large incluant, avec les voiles à corne, d’autres types de voile."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%B1%D0%B0%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Szynkowa.jpg","page_title":"Колбаса","context_page_description":"Колбаса́ — пищевой продукт; классообразующий тип колбасных изделий, представляющий собой мясной фарш в продолговатой оболочке. Может содержать один или несколько видов мяса, например, мясо птиц, различные наполнители, подвергаться температурной обработке или ферментации."},{"page_url":"https://it.wikipedia.org/wiki/Taj_Mahal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Taj_Mahal_N-UP-A28-a.jpg","page_title":"Taj Mahal","context_page_description":"Il Tāj Maḥal è un mausoleo situato ad Agra, nell'India settentrionale, costruito nel 1632 dall'imperatore moghul Shāh Jahān in memoria dell'amatissima moglie preferita Arjumand Banu Begum, meglio conosciuta come Mumtāz Maḥal. Nonostante vi siano molti dubbi riguardo al nome dell'architetto che lo progettò, generalmente si tende a considerare Ustad Ahmad Lahauri il padre dell'opera.\\nCompreso dal 9 dicembre 1983nella lista dei patrimoni dell'umanità dell'UNESCO e inserito nel 2007 fra le nuove sette meraviglie del mondo, è da sempre considerato uno delle più notevoli bellezze dell'architettura musulmana in India."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Places_of_Scenic_Beauty_of_Japan_(Shimane)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/%E7%99%BD%E5%B3%B6%E6%B5%B7%E5%B2%B8.jpg","page_title":"List of Places of Scenic Beauty of Japan (Shimane)","context_page_description":"This list is of the Places of Scenic Beauty of Japan located within the Prefecture of Shimane."},{"page_url":"https://en.wikipedia.org/wiki/Krachi_West_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/%D0%92%D0%BE%D0%BB%D1%8C%D1%82%D0%B0_%28%D0%93%D0%B0%D0%BD%D0%B0%29.PNG","page_title":"Krachi West District","context_page_description":"The Krachi West District is one of the eight districts of the Oti Region and was previously one of the twenty-five districts in the Volta Region of Ghana. Krachi West district capital and administrative centre is Kete Krachi."},{"page_url":"https://en.wikipedia.org/wiki/Pleasure_Dome_(railcar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Turquoise_Room_Santa_Fe_Super_Chief_1951.JPG","page_title":"Pleasure Dome (railcar)","context_page_description":"The Pleasure Domes are a fleet of six streamlined dome lounge cars built by Pullman-Standard for the Atchison, Topeka and Santa Fe Railway in 1950. The cars were used exclusively on the Super Chief from their introduction in 1950 until the end of Santa Fe passenger service in 1971. Amtrak retained all six cars and continued to operate them until 1980 when they were retired. All six were preserved. The Pleasure Dome, with its famed \\"Turquoise Room\\" private dining room, contributed to the Super Chiefs reputation for elegance and luxury. The name is derived from a line in Samuel Taylor Coleridge's poem Kubla Khan."},{"page_url":"https://ca.wikipedia.org/wiki/Hist%C3%B2ria_del_republicanisme_espanyol","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Pi_y_margall.jpg","page_title":"Història del republicanisme espanyol","context_page_description":"A Espanya ha existit una persistent corrent de pensament republicana al llarg dels segles xix, xx i XXI, que no obstant això han cristal·litzat solament en dos curts períodes de la història que sumen menys de 10 anys de la història espanyola. Aquests períodes en els quals la República va ser la forma de govern de l'Estat espanyol van ser la Primera República Espanyola, entre l'11 de febrer de 1873 i el 29 de desembre de 1874; i la Segona República Espanyola, entre el 14 d'abril de 1931 i l'1 d'abril de 1939.\\nEn l'actualitat, malgrat que Espanya és des de les Lleis Fonamentals del franquisme una monarquia, que es va convertir en monarquia parlamentària amb la Constitució de 1978, acceptada per l'oposició al franquisme, tradicionalment republicana, el republicanisme va seguir existint. Algunes enquestes indiquen que fins i tot presenta un creixement entre l'opinió pública del país. Els partits polítics amb major representació que han reincorporat en els últims anys la reivindicació \\"republicana\\" són la coalició de partits Izquierda Unida, el major membre de la qual és el PCE, Iniciativa per Catalunya Verds-ICV i Esquerra Republicana de Catalunya"},{"page_url":"https://en.wikipedia.org/wiki/Etobicoke_Creek_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Etobicoke_Creek_2018.jpg","page_title":"Etobicoke Creek station","context_page_description":"Etobicoke Creek is a bus rapid transit station on the Mississauga Transitway in Mississauga, Ontario, Canada. It is located along the north side of Eglinton Avenue at Tahoe Boulevard.\\nTahoe and Etobicoke Creek opened on 16 February 2016."},{"page_url":"https://es.wikipedia.org/wiki/Harald_Welzer","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Welzer_harald_091107.jpg","page_title":"Harald Welzer","context_page_description":"Harald Welzer es un psicólogo social, sociólogo, teórico social y politólogo alemán.​\\nWelzer es director del Centro Interdisciplinario de Investigación para la Memoria -Center for Interdisciplinary Memory Research-, investigador del Programa de Investigación sobre el Clima, especialista en el comportamiento social en el Holocausto y otras guerras genocidas. Es autor, entre otros, del libro Guerras climáticas.​"},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_o_Monte_Cassino","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Bundesarchiv_Bild_146-1975-014-31%2C_Monte_Cassino%2C_deutsche_Kriegsgefangene.jpg","page_title":"Bitwa o Monte Cassino","context_page_description":"Bitwa o Monte Cassino – w rzeczywistości cztery bitwy stoczone przez wojska alianckie z Niemcami, które miały miejsce w 1944 roku w rejonie klasztoru na Monte Cassino. Bitwa ta uznawana jest za jedną z najbardziej zaciętych w czasie II wojny światowej. Brytyjski historyk Matthew Parker napisał: Bitwa o Cassino – największa lądowa bitwa w Europie – była najcięższą i najkrwawszą z walk zachodnich aliantów z niemieckim Wehrmachtem na wszystkich frontach drugiej wojny światowej. Po stronie niemieckiej wielu porównywało ją niepochlebnie ze Stalingradem.\\nPo udanych lądowaniach aliantów w Kalabrii, Tarencie i Salerno na początku września 1943 roku, i po kapitulacji Włoch w tym samym miesiącu, siły niemieckie zaczęły się powoli wycofywać w kierunku północnym. Sprawnie dowodzone wojska niemieckie, opierając się na dwóch improwizowanych liniach obrony, prowadziły działania opóźniające ofensywę aliancką, przygotowując w tym czasie Linię Gustawa – silnie ufortyfikowany i trudny do zdobycia pas umocnień obronnych przebiegający w najwęższym miejscu Półwyspu Apenińskiego."}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},F={class:"search-container"},T={class:"card-container"},I={key:0,class:"empty-state"},G=["disabled"],R={key:0},H={key:1};function N(a,e,s,m,o,r){const d=_("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",F,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),h(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",T,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),D(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",I,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",H,"Loading...")):(t(),n("span",R,"See more"))],8,G)):p("",!0)])}const K=g(L,[["render",N],["__scopeId","data-v-61dca868"]])